INSERT INTO `bands` VALUES (7,'DIANDRA','1501759857.jpg','DIANDRA INDONESIA adalah Sebuah band beraliran pop asal tulungagung yang terbentuk sejak 2014, awal mula terbentuknya diandra adalah untuk ikut serta di kompetisi band yang syukurnya hampir di semua kompetisi band, diandra dapat masuk di 3 besar kompetisi tersebut, hingga suatu saat para personil berkumpul dan membahas tentang visi misi para personil diandra yang ingin mencoba masuk di dunia industri musik, sampai pada akhirnya diandra sukses meluncurkan single yang rilis pertama tahun 2016 dengan lagu DIANDRA - Lagu Cinta Untukmu.','Pop','facebook;instagram;poster;teman;lainnya;','Surabaya',16,'2017-08-03 03:30:57','2017-08-03 03:30:57'),(12,'LITTLE DAY','1501776552.jpg','“Salam Industri Musik Indonesia”\r\n\r\nHalo \"Little Fams\" (sebutan untuk penggemar LITTLE DAY)\r\nPerkenalkan band pop punk yang berasal dari jakarta\r\nWe are LITTLE DAY\r\nYap...band yang di gawangi oleh Dhara sebagai Vocalis , Ice pada Gitar , lalu ada Nty di posisi Gitar , dan Iwank di Bass , yang terakhir di posisi yang selalu berada di belakang panggung Perkenalkan Drummer kami Mr.Bonge.\r\nBand yang lahir pada tanggal 20 Oktober 2015 ini terbilang cepat perkembangannya\r\nKarena apa...\r\nDi umur yang terbilang masih belia ini,\r\nAkan tetapi LITTLE DAY sudah memiliki jam terbang perform/off air yang sudah cukup padat di dua tahun ini\r\nTerbukti juga dari ketotalitasan dari setiap personilnya yang saat ini sudah memiliki Album E.P (Perdana) yang berjudul \"BERJUANG\" yang berarti kita berjuang untuk maju dan menciptakan karya. di setiap lagu, dan di dalam album ini pun punya cerita masing-masing dan penuh perjuangan di setiap lagu di album E.P ini\r\n\r\nDan dalam waktu yang sangat berdekatan pula LITTLE DAY akan kembali masuk ke dapur rekaman untuk Album selanjutnya\r\nEntah Album atau E.P nantinya\r\nDari kekompakan dan cemistry dari setiap personil LITTLE DAY yang membuat Band ini sangat produktif\r\nBanyak sudah materi yang sudah kami siapkan untuk beberapa Album ke depan,\r\nSeperti apa sih perform dan musik LITTLE DAY ??\r\nBanyak persamaan dari setiap personilnya\r\nYaitu mempunyai referensi dari band ² seperti ENDANK SOEKAMTI , ROCKET ROCKERS , SUPERGLAD , PEE WEE GASKINS ,dll\r\nSelain referensi lokal, Banyak juga musisi dari luar untuk kita jadikan referensi, tapi kita lebih cenderung mengangkat band lokal karna kita hidup di negara INDONESIA, Sebagai simbol bangga pada musisi dalam negeri , yang sesuai dengan genre LITTLE DAY sendiri.\r\nMusik yang di suguhkan oleh LITTLE DAY memiliki Beat yang Energic\r\nApalagi di setiap perform nya\r\nKalian pasti terhipnotis dengan musik dan aksi panggung yang mereka tampilkan\r\nSudah pasti kalian di buat tidak bisa diam dan berkeringat semangat\r\nPenasaran kaaaan...\r\nMakanya pantengin terus sosial media LITTLE DAY untuk mengetahui update jadwal terbaru dan kegiatan setiap harinya dari LITTLE DAY\r\nSilahkan di Follow sosial media kami di bawah ini :\r\n- Instagram : @littleday5\r\n- Path : LITTLE DAY\r\n- Twitter : @littleday5\r\n- Facebook : LITTLE DAY\r\n- Youtube : LITTLE DAY\r\n\r\nMakna dan arti dari setiap lagu LITTLE DAY ??\r\nAda sebuah pesan pastinya dari setiap lagu kami\r\nKarena yang menarik itu menurut kami adalah hal-hal atau cerita sehari hari\r\nPagi , siang , sore , dan malam\r\nPasti memiliki cerita yang berbeda di setiap waktu itu\r\nTeman , musuh , keluarga , mantan ,dll\r\nDan di tema ini pastinya ada pesan semangat/motivasi di dalamnya\r\nEasy listening\r\nYak...itulah musik LITTLE DAY\r\nAkan tetapi , keanggunan suara dari sang vocalis (Dhara)\r\nDi balut dengan beat musik yang energic , dan banyak pesan sosial dan motivasi di dalam lirik setiap lagunya\r\nLITTLE DAY selalu siap membakar semangat kalian kembali\r\nSo...sampai bertemu \"Little Fams\" di panggung yang akan menampilkan LITTLE DAY di kotamu.\r\nBest Regards.\r\n\r\nLittle Day Live perform 2015 s/d 2017\r\n\r\n-Live Gulp & Gulf Rockin Bar resto\r\n-Live Grand Charly Rawamangun Square (Gigs)\r\n-Live Obesphere distro Rawamangun\r\n-Live Cimanggis-depok (Gigs)\r\n-Live Pentas Seni SMK Ganesa Satria 1 Depok\r\n-Live \"Friday Coustic\" At JX Tainment,jakarta\r\n-Live Grand Charly rawamangun Square(Gigs)\r\n-Live Beerhouse Caffe JX Tainment, jakarta (Gigs)\r\n-Live Ancol Beach City \"GEBYAR BAMBU RUNCING\" 2016\r\n-Live \"MARKET MENTENG # 2 \" At Taman Menteng Jak-Pus\r\n-Live Beerhouse Caffe JX Tainment, Jakarta (Gigs)\r\n- ON-AIR 104,2 Radio MS-TRI FM (live perform Acoustic)\r\n-Live \"WARUNG DEEBONG\" Jak-Pus\r\n-Live \"PRO JAM\" 2016 At Lap. BLOK M SQUARE Jak-Sel\r\n-Live Halaman gedung \"KEMENPORA RI\" Jak-Sel\r\n-Live Grand Charly Rawamangun Square (Gigs)\r\n-Live \"PASAR SENI ANCOL\" Jak-Pus\r\n-Live \"OUTFEST 2017\" Ex Golf Driving Range senayan\r\n-Live universitas JAYABAYA PULOMAS JAKARTA\r\n-Live in JAKARTA FAIR 2017','Rock','instagram;','Jakarta',23,'2017-08-03 08:09:12','2017-08-03 08:09:12'),(13,'HIVE ID','1501818701.JPG','Berawal dari band kampus yang dibentuk oleh Faisal, Aha, dan Aris di akhir 2010, mimpi yang besar dan keinginan untuk tetap menjalankan passion bermusik walaupun setelah lulus kuliah menjadikan HIVE tetap eksis hingga sekarang.\r\n\r\nTelah aktif manggung di Jakarta sejak akhir 2015 khususnya di scene indie berbasis komunitas tempat mereka aktif bersosialisasi, 101% Music Community, HIVE mulai dikenal luas di Jakarta, dan telah bermain di beberapa panggung besar seperti panggung Cardinal di Pekan Raya Jakarta dan juga telah pernah tampil live sebagai guest star di program Teras Sore di Elshinta TV.\r\n\r\nKini di tahun 2017, HIVE fokus kembali ke root mereka sebagai musisi yaitu untuk berkarya, kembali ke studio untuk menyelesaikan beberapa lagu barunya yang siap untuk direkam dan diperdengarkan ke khalayak.\r\n\r\nKesempatan yang ditawarkan Levi\'s Band Hunt merupakan peluang emas bagi HIVE untuk bisa mendapatkan partner yang mumpuni dalam memperdengarkan karya-karya bermusik terbaru mereka, karya musik yang memadukan karakter vocal falsetto khas dari Aha yang berbau Japanese Rock, dengan aransemen musik khas British yang banyak dipengaruhi oleh Radiohead, Oasis, dan tentunya, The Beatles.\r\n\r\nGet ready to be HIVED.\r\n\r\nFB Page: https://www.facebook.com/HIVE.ID.OFFICIAL/\r\nTwitter: @HIVE_ID\r\nYoutube Channel: https://www.youtube.com/channel/UC1s4jn4MzCy63uNKwlgT1Sw','Alternative Rock','instagram;','Jakarta',10,'2017-08-03 19:51:41','2017-08-03 19:51:41'),(14,'Dua Pintu','1501994272.JPG','Terbentuk tahun 2015. Dua Pintu merilis EP tahun 2016 di Earhouse. Tampil di beberapa festival: Hai Day 2015, RRI Pro2 Indie Fest, Pamulang festival. Gigs: Round Up by Indoestri, Ruang Musik, dll. Media coverage by: Hai Magazine, Deathrockstar, Googs, Ganlob. Radio airplay/chart: 8eh ITB, Kiss FM Medan. EP available at Eargasm record store Ps. Santa; Digital stores/ streaming platforms.','Alternative Rock','teman;','Jakarta',35,'2017-08-05 20:37:52','2017-08-05 20:37:52'),(15,'JNKY','1502010470.png','Kami adalah band yang baru saja terbentuk tahun 2017, dan kami menyajikan kombinasi genre music pop dan rock dengan karakter vocal yang unik.','Pop','instagram;','Yogyakarta',36,'2017-08-06 01:07:50','2017-08-06 01:07:50'),(16,'High Gain','1502043188.JPG','We didn\'t play music\r\nBut what we do, telling stories.','Others','instagram;','Jakarta',37,'2017-08-06 10:13:08','2017-08-06 10:13:08'),(17,'Dynamic Trio','1508561900.jpg','Dynamic Trio terbentuk pada tahun 2013, berawal dari teman nongkrong, dan jamming bareng, awal manggung biasanya bareng komunitas blues setempat, lalu mulai dibawa oleh legend blues indonesia, Alpha De Frets untuk main reguler di beberapa cafe, sempat reguler di cafe daerah bsd untuk 2 tahun, Dynamic Trio di pilih untuk menjadi endorser/ brand ambassador dari Brand Squier Guitar and Bass dan Mapex Drum, bersama artis seperti Yoyo Bassman, Ferri HK, dan Andi Bayou, beberapa kali melakukan clinic dan manggung di pameran yang diadakan oleh PT Citra Intirama selaku distributor tunggal Squier dan Mapex. Dynamic Trio juga sudah beberapa kali main diluar kota seperti Bandung, Surabaya, dan yang terakhir tahun 2015 di kota Palu, bersama artis seperti Gideon Tengker, Indah Winar, Yoyo Bassman, dll.','Blues','facebook;','Jakarta',40,'2017-08-07 09:44:57','2017-10-20 20:58:20'),(18,'JAD !!','1502157155.jpg','Saya seorang penyanyi solo dengan format band. Setiap event yang ditawarkan saya meminta bantuan orang yang berbeda untuk mengisi band. Saya sering mengisi beberapa event seperti wedding, acara gereja, terakhir saya mengisi di diversity run Bandung. Prestasi terbaik pernah menjuarai Ignatius Got Talent (Juni 2017). Saya berharap bisa memenangkan kompetisi ini agar saya bisa mendapat kesempatan lebih banyak untuk menghibur banyak orang.','Alternative Rock','facebook;instagram;informasi_toko;vipclub;','Jakarta',41,'2017-08-07 17:52:35','2017-08-07 17:52:35'),(19,'evnflo','1502161724.png','band ini berawal dari mahasiswa dari Universitas Lampung yg sering diundang untuk acara internal kampus. namun seiring berjalannya waktu, kami menjadi salah satu band yang diperhitungkan di Lampung. sampai saat ini, kami sering perform sebagai guest star baik dari panggung skala kecil sampai skala besar.','Rock','instagram;teman;','Jakarta',42,'2017-08-07 19:08:44','2017-08-07 19:08:44'),(20,'Abe Project','1502163529.JPG','Abe Project merupakan bagian dari Rising Star Indonesia Tahun 2014\r\n\r\nJuara 1 Acustico Baywalk Mall\r\n\r\nPrestasi Personil :\r\nJuara 3 singing competition XL Axiata (Evin Kusuma-Gitaris Abe Project)\r\n\r\nIklan Djarum (Adam-Bassist Abe Project)','Pop','teman;','Jakarta',43,'2017-08-07 19:38:49','2017-08-07 19:38:49'),(21,'Elegant Band','1502167300.PNG','terbentuk 17 June 2017. Juara Festival Band di Kecamatan Cibarusah Bekasi.','Rock','facebook;instagram;','Jakarta',46,'2017-08-07 20:41:40','2017-08-07 20:41:40'),(22,'HocuspocuZ','1502184685.jpg','HocuspocuZ; berdiri lewat pencarian kepuasan serta penggabungan idealisme dalam bermusik, terbentuk pada tanggal 14 Februari 2004 yang lalu. Perjalanan bersama yang cukup panjang tersebut menyumbangkan banyak pengalaman bagi band ini, untuk ikut dalam berbagai macam event dan kompetisi baik lokal maupun nasional. \r\n\r\nAdapun achievement yang pernah didapat adalah :\r\n- Juara 4 Festival Musik Indie (Indiecaholic), by Sampoerna (2014).\r\n- 12 Bear Finalis Gudang Garam Rock Competition, by Log Zhelebour.\r\n- Finalis, Best Guitar, Best Drummer : Cardinal Music Awards at Kuta - Bali (2009)\r\n- Finalis Hardrock Calling at Kuta-Bali (2011)','Rock','instagram;','Surabaya',49,'2017-08-08 01:31:25','2017-08-08 01:31:25'),(23,'Pagston','1502196046.jpg','Berawal dari teman seperkampusan dan sepermainan . Tidak ada prestasi yg mencolok selain ikut berpartisipasi di gigs kolektifan yg diadakan oleh teman-teman .','Rock','facebook;teman;','Jakarta',51,'2017-08-08 04:40:46','2017-08-08 04:40:46'),(24,'numan replay','1502198543.jpeg','Juara 1 festival band toboali city on fire','Pop','instagram;','Jakarta',54,'2017-08-08 05:22:23','2017-08-08 05:22:23'),(25,'Neverland','1502202082.PNG','Band yang terbentuk secara pertemanan dari kecil, bikin lagu lalu upload di youtube, masing-masing personel pernah punya band sendiri.','Alternative Rock','instagram;','Jakarta',56,'2017-08-08 06:21:22','2017-08-08 06:21:22'),(26,'LAMAFA','1502204414.JPG','Lamafa adalah sebuah band folk asal Jakarta yang digawangi oleh Achgulanjo pada Vocal dan Satrio pada Guitar. Lamafa sendiri berdiri sejak Oktober 2016 dengan mengusung genre folk ethnic. Awalnya Satrio ingin membuat proyek solo bermaterikan Ethnic instrumentalia yang sudah digarap sejak awal 2016. Namun pada pertengahan jalan ia mengalami stuck dan memutuskan untuk memformulasikan musik tersebut dengan format band. \r\nAchgulanjo (jojo) sapaan akrabnya memiliki ketertarikan pada musik-musik blues,reggeae, rockabilly dan musik Indonesia era 70-an. Sedangkan Satrio memiliki ketertarikan pada musik jazz,soul,folk dan alternative. Irama dan lirik yang ada dalam album mata air mata ini merupakan asimilasi dari influence musik Satrio dan Achgulanjo.\r\nInstrument yang kami gunakan berupa; bass,gitar,perkusi dan strings. Musikalitas kami disupport juga oleh dua  additional player bass dan perkusi. Hal ini menjadikan warna yang berbeda saat Lamafa bermain live. \r\nArti dari nama Lamafa adalah julukan seorang pemburu paus di lamalera,NTT. Terdapat nilai filosofis yang unik ketika kami memutuskan untuk menggunakan nama Lamafa. Pemburu paus di lamalera memiliki tujuan yang mulia dengan rela berkorban memburu paus ditengah lautan menggunakan peralatan sederhana demi kelangsungan hidup dan ritual adat  masyarakat setempat. Berangkat dari hal tersebut kami menghubungkan filosofi ini dengan musik. Ambisi dan tekad seorang lamafa kami coba terapkan dalam mengarungi dunia musik yang cukup fluktuatif dan dinamis. Kami berharap mampu menelurkan karya-karya musik yang memiliki energi dan intensitas yang baik untuk semua penikmat musik Indonesia.\r\n\r\n\r\nPrestasi : Juara 1 Band Audition 7th Ramadhan Jazz 2017','Folk','facebook;instagram;guitar_plus;','Jakarta',63,'2017-08-08 07:00:14','2017-08-08 07:00:14'),(27,'D\'Vriza','1502207017.jpg','Kami adalah grup band yang beraliran pop progresive, yang mulai terbentuk pada pertengahan tahun 2011. Kami beberapa kali berkesempatan menjadi guest star pada even di Mall di daerah Depok dan Bogor. Selain itu kami juga sempat menjadi band reguler di beberapa kafe di Bogor dan Jakarta.','Pop','facebook;','Jakarta',66,'2017-08-08 07:43:37','2017-08-08 07:43:37'),(28,'Black drama','1502208846.JPG','Kami adalah band yg berasal dari daerah sulawesi tengah,bermusik di ibu kota , suda mengikuti event2 di ibu kota seperti jkarta fair,miss eart,dan masi banyak lagi','Rock','facebook;instagram;','Jakarta',68,'2017-08-08 08:14:06','2017-08-08 08:14:06'),(29,'Secret Wall Revenge','1502209132.jpg','Ditahun ini kami akan merilis mini album yang bertemakan tentang kemanusia, album ini akan berisi 6 lagu. 1 intro, 2 lagu recycle dari lagu kami terdahulu, 2 lagu baru, dan sebuah lagu dari band metal papan atas indonesia yang akan kami cover dengan versi yg berbeda','Others','facebook;instagram;informasi_toko;vipclub;guitar_plus;poster;teman;lainnya;','Jakarta',64,'2017-08-08 08:18:52','2017-08-08 08:18:52'),(30,'Toilet Surfers','1502211608.jpg','Toilet Surfers, sebuah kuartet punk rock asal ibukota, berdiri pada 2015 silam. Pada Juni 2016, kami menjadi headliner pada acara \'Punk Parade by Cardinal Awards\' di Pekan Raya Jakarta. Agustus 2016, kami merilis sebuah single secara independen berjudul \"Sick Weirdo\" yang didistribusikan secara digital melalui iTunes, Spotify, Amazon Music, dan lain sebagainya. Pada Juli 2017, kami kembali menjadi headliner pada acara \'Punk Parade by Cardinal Awards\' di Pekan Raya Jakarta.','Rock','teman;','Jakarta',72,'2017-08-08 09:00:08','2017-08-08 09:00:08'),(31,'PeKa','1502221060.jpg','Bogie,Emre,Lucky dan Reynard (additional player) pernah tergabung dalam band Venue dibawah label Keci Music, Kekuatan dan gairah bermusik yang selalu ada membuat kami selalu \"PeKa\" untuk membuat karya-karya musik dan ingin kembali menyentuh penikmat musik di Indonesia.. pada awal mula prestasi kami sebagai Band (Venue) pernah menjadi 20 besar Finalis A Mild Most Wanted wilayah Jabar,membuat single di album KFC keci catchy star (Keci), Ost Dalam Mihrab Cinta album kekuatan cinta (KFC), semoga kami dapat berkarya dan berprestasi lebih dengan adanya event dari Levi\'s ini...salam hangat dari kami -PeKa-','Pop','instagram;','Jakarta',78,'2017-08-08 11:37:40','2017-08-08 11:37:40'),(32,'Spiky Monster','1502227072.jpg','Spiky Monster adalah band pop punk yang berdiri sejak tahun 2011. dan ketika itu terbentuknya ketika masih dalam bangku smp\r\nSpiky Monster telah mengeluarkan album dan video clip secara mandiri, dimana semua pengerjaan dilakukan oleh tim spiky monster dan teman teman para personil','Others','facebook;','Yogyakarta',81,'2017-08-08 13:17:52','2017-08-08 13:17:52'),(33,'Lorong Waktu','1508562074.jpg','band rock asal medan yang terbentuk di pertengahan 2015 dan sudah merilis EP di 2016 kemarin bersamaan 2 video klip','Rock','instagram;','Medan',61,'2017-08-08 19:12:54','2017-10-20 21:01:14'),(34,'HOPE REBEL','1502253682.jpg','Sebuah band yang membawakan genre Punk Rock. Mereka berasal dari salah satu kota di Jawa Tengah yaitu Brebes. Mereka beranggotakan 3 orang yaitu Anzas Gembul (Vocal and Guitar) , Denny (Backing Vocal and Bassist), Uyiex (Drummer). Mereka banyak terpengaruh oleh The Living End, Superman Is Dead, Tiger Army, Suicidal Sinatra, Green Day, Blink 182, Bad Religion, DESALUKANEGARA, Anti Flag.','Alternative Rock','facebook;instagram;','Jakarta',97,'2017-08-08 20:41:22','2017-08-08 20:41:22'),(35,'CABRON','1502257455.jpg','Cabron adalah band Funk Rock asal Jakarta yang dibentuk pada tahun 2017. Cabron bermula sebagai evolusi dari band HEADmove yang beranggotakan Ald (Gitar & Vokal), Hendri (gitar), Reza (Bass), dan Dio (Drum) yang telah dibentuk sejak 2008 lalu.\r\n\r\nNamun, ditengah-tengah perjalanannya, Dio dan Reza mendadak mengundurkan diri mereka dari HEADmove. Ald dan Hendri kemudian mengajak Martyn (Bass) serta Ganda (Drum) untuk bergabung dan mengisi kekosongan pada band itu. Ald lalu menyarankan mengubah nama band mereka menjadi Cabron.\r\n\r\nNama Cabron sendiri di ambil dari bahasa latin yang artinya \"berandalan\" .. Namun kami mengartikan kata \"berandalan\" tersebut dengan arti lain, yaitu : berandalan dalam berkarya.\r\n\r\n\r\nGaya bermusik Cabron sangat dipengaruhi oleh RHCP, sebuah pengaruh yang seringkali disebut sebagai sebuah \"inspirasi\" oleh para anggotanya. Sebagai tambahan, para anggota Cabron juga menyebutkan Extreme, Wild Cherry, Lenny Kravitz, dan masih banyak lagi sebagai band atau grup musik yang membuat gaya bermusik mereka menjadi seperti sekarang ini.\r\n\r\nSaat ini Cabron tengah menggarap EP (Extended Play/Mini Album) secara Indie sebagai modal awal kami untuk meramaikan pergerakan musik Funk di Indonesia khususnya di Jakarta.','Funk','instagram;teman;','Jakarta',99,'2017-08-08 21:44:15','2017-08-08 21:44:15'),(36,'D\'Ark Legal Society','1502258601.jpeg','D\'Ark Legal Society adalah band Alternative Metal dari Jakarta.\r\n\r\nD\'Ark Legal Society terbentuk tahun 2007 dan telah merilis 1 EP (Life) dan 1 album (Fruit of Chaos - 2015).  \r\n\r\nTahun 2017 ini D\'Ark Legal Society atau biasa di kenal sebagai D.L.S. akan mewakili Indonesia ke festival musik International di Quebec, Canada, bernama Envol et Macadam.  Dan juga tanggal 9 September mendatang D.L.S. akan merilis EP yang bertajuk \"Simulacra\"','Rock','facebook;guitar_plus;','Jakarta',103,'2017-08-08 22:03:21','2017-08-08 22:03:21'),(37,'No Resign','1502259023.jpg','No Resign berdiri ketika Zakir dan Okie sedang bermain disalah satu studio musik, mereka berdua hanya bermain iseng-iseng atau biasa disebut \"jammin\" Pada saat itu, Zakir mencoba menghubungi Ichal untuk coba menjadi drummer dalam band. Berselang 2 hari No Resign pun merecord sebuah lagu yang berjudul \"Selamat Jalan\" yang akan dijadikan single pertamanya nya dalam album \"The Sun Goes Down\"','Alternative Rock','facebook;','Jakarta',104,'2017-08-08 22:10:23','2017-08-08 22:10:23'),(38,'Klarity','1502260160.JPG','Dear Levi\'s Band Hunt Team, \r\n\r\n8 tahun kami bersama dalam bermain musik pada tahun ke 6 kami membentuk \"Klarity\" sebagai karakter musik kami \"Jelas dan Apa Adanya\". Genre pada group ini juga tidak terfokus hanya pada satu aliran (mostly Alternative Rock) namun kami juga memberikan beberapa aliran berbeda sehingga musik ataupun karya yang kami hasilkan jauh lebih berwarna. Beberapa pengalaman yang sudah kami lewatkan yaitu :\r\n- As a Guest Star at Margo Friday Jazz\r\n- As a Band Ambassador HAI Magazine (HAI Demos Band) pada acara Tumplek Blek \"Otobursa\"\r\n- As a 3rd winner di kediaman Bang Iwan Fals \"StudiKota Competition\"\r\n- As a Guest Star at Kompas Gramedia Kebon Jeruk\r\n- As a Guest Star at Marley Cafe Energy Building SCBD\r\n- As a Guest Stay at PENSI 48 HS, 39 HS, 28 HS, 6 HS.\r\n- DLL\r\nMelalui ini kami selalu berusaha untuk terus belajar dan mencari kesempatan untuk kami terus mengembangkan pengalaman kami dalam bermusik. Semoga bersama lagu dan pengalaman yang telah kami kirimkan dapat menjadi bahan pertimbangan untuk para dewan juri dan para penikmat musik. Sekali lagi terimakasih dan suses selalu.\r\n\r\nWarm Regards,\r\nKlarity','Alternative Rock','instagram;','Jakarta',105,'2017-08-08 22:29:20','2017-08-08 22:29:20'),(39,'REJECTED KIDS','1502263566.jpg','Band ini terbentuk pada awal 2004 dimana saat itu helmy dan 2 personil lama yaitu Ostra dan Ridzki masih duduk dibangku sekolah menengah pertama. Sekitar tahun 2007 tirta masuk untuk membantu gitar dan back vocal kemudian kami merilis ep yang berjudul \"unspoken feelings\" yang dirilis oleh plush records. Singkat cerita lalu ditahun 2011 kami merilis sendiri album kami yang berjudul \"A New Chapter Has Begun\" dengan fallacies records dan juga kami bekerja sama dengan big circle records (slovenia) dan bells on records (japan), di album ini Ostra sudah tidak bermain gitar yang kemudian digantikan dengan ragam kusdinar, lalu seiring berjalannya waktu perubahan personil pun kembali terjadi, Ridzki yang saat itu bermain bass harus digantikan dengan agung karena kesibukan pekerjaan lalu disusul ragam pada tahun 2016 yang ikut juga harus keluar dan digantikan oleh ridwan sampai sekarang dan pada tahun itu juga kami kembali merilis album yang berjudul \"home\" yang dirilis oleh rise and girnd records dan IIOI records (singapore) dilanjutkan dengan serangkaian tour malaysia-singapore yang kami beri nama \"no reason to stop\" ditahun yang sama. Terakhir kemarin kami juga baru saja mengadakan tour beberapa kota yaitu Bali, Malang, Jogjakarta, Bandung, dan Jakarta bersama beberapa band japan (waterweed, dradnats, dan lext).','Others','facebook;','Jakarta',106,'2017-08-08 23:26:06','2017-08-08 23:26:06'),(40,'ALLEIA','1502269417.jpg','Hallo apa kabar semuanya??\r\n\r\nlagu yang kami kirimkan berjudul DENGAN SENYUMAN direkam pada tahun 2013 awal bulan, lalu ikutan demoday trus diajak rekaman sm Capung Javajive, bikin album deh... hehehe. ini ada beberapa press release  tahun 2013 hahah kelamaan yakkk. \r\n\r\nPress Release 2013 Alleia, adalah sebuah band yang berasal dari kota Bandung beranggotakan 5 personel yang dibentuk pada awal tahun 2010 oleh Feroz,Izzy,dan Anggie yang kuliah di Fakultas Ekonomi Universitas Parahyangan,Ryan (Universitas Padjajaran),Surya (Universitas Islam Bandung) . Perjalanan Alleia dimulai dengan merambah berbagai macam panggung di sekitar kampus juga beberapa cafe di kota bandung. Berbekal sebuah demo lagu yang berjudul “Dengan Senyuman” , mereka mencoba peruntungan dengan mengikuti sebuah acara komunitas musik “Demoday” Bandung yang digagas oleh kang Capung “JavaJive”, setelah melewati berbagai macam diskusi positif dalam acara tersebut akhirnya tercapailah keputusan membuat sebuah album dengan keterlibatan musisi ternama seperti Capung JavaJive, sebagai Produser , untuk mendukung proses dari awal pembuatan hingga release-nya single perdana Alleia pada tahun 2013 ini. Dengan mengusung tema musik Pop- yang dikemas penuh warna juga mudah dimengerti, pada lead guitar, Ryan sangat menyukai genre musik rock-blues, guitar rhytm Izenk menyukai genre music Pop-Rock sementara drummer Surya dan bassis, Anggi, menyenangi aliran Funk-beat, Lalu ditambah vokalis, Feroz, yang menggemari genre music Alternative. Perbedaan aliran tersebut dicampur menjadi satu membuat genre musik Alleia terdengar sangat unik. . Dari penggabungan talenta masing-masing personil yang saling melengkapi, seluruh ide dan kreativitas dalam mencipta karya diakomodasi sebagai bentuk ekspresi untuk bergabung baik dalam industri musik juga dengan para pecinta musik Dalam single pertama yang berjudul “Selamanya”, Alleia ingin menyampaikan sebuah karya yang ekspresif, easy listening dengan lirik yang catchy namun tidak kacangan dan terdengar lebih menyegarkan bagi anak-anak muda jaman sekarang, dengan harapan berbonus impresi terhadap pendengar musik di berbagai kalangan. Dengan segala kerendahan hati dan obsesi sederhana ingin menyemarakkan warnawarni apresiasi musik negeri ini, Alleia lahir, hadir dan bersemangat untuk Indonesia.\r\n\r\n\r\nhttps://musik.kapanlagi.com/rising-star/alleia-andalkan-pop-aneka-warna-37974f.html\r\n\r\n\r\nKapanlagi.com - Band asal Bandung yang diberi nama Alleia ini dibentuk tahun 2010 oleh Feroz (vokal), Izenk (gitar), Anggi (bass), Ryan (gitar), dan Surya (drum). \r\nPerjalanan bermusik mereka dimulai dari panggung di sekitar kampus dan kafe yang ada di Kota Kembang. Dan berbekal sebuah demo lagu berjudul Dengan Senyuman, mereka pun mencoba peruntungan dengan mengikuti sebuah acara komunitas musik Demoday Bandung yang digagas oleh Capung \'Java Jive\'.\r\n\r\nSetelah melewati berbagai macam diskusi positif dalam acara tersebut, akhirnya tercapailah keputusan untuk membuat album dengan keterlibatan Capung sendiri sebagai produser. Hingga terciptalah single perdana Alleia di 2013 ini.\r\n\r\nMengusung tema pop yang dikemas penuh warna membuat Alleia justru tampil unik. Semua itu merupakan campuran dari hobi masing-masing personel yang memiliki hobi dan warna musik yang berbeda-beda. Ryan mencintai musik rock-blues, Izenk lebih ke pop rock, Surya dan Anggi menyukai funk-beat, dan Feroz di alternatif.\r\n\r\nDi single perdananya berjudul Selamanya, Alleia ingin menyampaikan sebuah karya yang ekspresif, easy listening, dengan lirik yang catchy namun tidak kacangan dan terdengar lebih menyegarkan. Mereka berharap single ini juga berbonus impresi terhadap pendengar musik di berbagai kalangan.\r\nitu duluu........\r\n\r\n2017.....\r\nTapi saat ini kami sudah indie mencoba peruntungan kembali untuk maju kembali dan ingin memberikan angin segar.... kalo bisa juga angin gelebug yah biar bisa menghantam..... hehehe  \r\n\r\ncontact person\r\nANGGIE GUSTIAR \r\n081313999980','Alternative Rock','facebook;instagram;','Jakarta',102,'2017-08-09 01:03:37','2017-08-09 01:03:37'),(41,'olsam','1502269752.jpg','OLSAM adalah sebuah grup orkes kontemporer berdiri sejak  Ramadhan 2017 yg suka gegendingan dan wara wiri naek vespa dibilangan cagar alam depok , \r\ndigawangi oleh : \r\nJakul Gendang\r\nZamal Melod\r\nRudibagol Rhytm\r\nOcan Tamborin\r\n\r\nKalo ade jarum yg patah jangan simpen dalem peti , kalo ade kata yg salah jangan di simpen dalem ati .\r\nFrom gang with love \r\n\r\n#orkeslaughscooterandmanymore','Others','teman;','Jakarta',113,'2017-08-09 01:09:12','2017-08-09 01:09:12'),(42,'The Flins Tone','1502270702.jpg','Terbentuk sejak 2004 sebagai projek \"iseng-iseng\" satu keluarga hingga akhirnya kita memutuskan untuk serius dan merilis EP \"Flinsnopsis\" di tahun 2011. Setelah ada beberapa pergantian personil, kami tidak bisa berhenti disitu saja, setaun kemudian kami merilis full album pertama kami \"He\'s the Best Actor for this Episode\". Dan pada tahun 2016 lalu kami merilis full album kedua kami \"Good News\". Semua album kami rilis secara independen. Pada tahun 2015 akhir kami juga mendapatkan kesempatan untuk muncul sedikit di video clip salah satu band idola kami New Found Glory, untuk lagu \"Ready and Willing\". Hingga di akhir 2016 lalu kami mendapat kabar bahwa \"Good News\" masuk nominasi \"Produksi karya metal terbaik\" (meskipun sebenarnya kami bukan metal) di ajang AMI AWARDS 2016 yang sejauh ini merupakan prestasi terbesar kami sebagai sebuah band.','Rock','facebook;teman;','Surabaya',114,'2017-08-09 01:25:02','2017-08-09 01:25:02'),(43,'RoyalBandit','1502272632.jpg','Rebel rockers asal jakarta yang konsisten dengan musik rock nya , lirik yang membicarakan masalah sosial menjadi andalan RoyalBandit mengarungi deras nya dunia musik indonesia, band ini pernah menjadi pembuka KPR (kelompok penerbang roket) dan Superglad di jakarta fair 21 juni 2017 .\r\nBesar dari panggung ke panggung karena radio dan televisi terlalu mengecilkan aliran yang royalbandit bawakan.','Rock','instagram;','Jakarta',115,'2017-08-09 01:57:12','2017-08-09 01:57:12'),(44,'Rhetoric states','1502284360.JPG','Adalah sebuah ikatan persahabatan antara Maul Skiba dan Yudhi WarMan yang menjadi bakal terbentuknya band punk rock asal Tangerang ini. Perkenalan keduanya pada genre punk California dekade tahun 90an, seperti Bad Religion, Pennywise, Rancid, The Offspring, Total Chaos, Operation Ivy, NOFX, membawa aroma tersendiri pada terbentuknya punkrock ala Rhetoric States (RXS). Sering bergonta-ganti drummer, bergonta-ganti nama band, sampai akhirnya Oktober 2006 mendapatkan nama yang bertahan hingga saat ini. Kata \"Rhetoric\" diilhami dari salah satu bait pada lagu band punkrock lawas asal California Bad Religion, dan menggabungkan kata \"States\" yang memiliki nilai falsafah, bahwasanya Rhetoric States adalah sebuah resistensi dalam diri untuk tidak terbuai dengan janji-janji politik penguasa negeri.\r\n \r\nFormasi awal Maul Skiba (gitar, vokal), Yudhi WarMan (bass, vokal) dan Bima Sky (drums) menelurkan Live Demo \"Factory Of Hell\" dirilis tahun 2007 diproduksi 100 keping CD, dengan singel \"Di Bawah UMR\" yang didedikasikan untuk perjuangan buruh di Indonesia. Lalu tahun 2011 RXS meriliskan album EP \"First Blood\", album yang berisi kisah aktivis era reformasi \'98 penuh dengan aroma perjuangan, cinta dan revolusi. \"Bangkit dan Hancurkan\", \"Bungaku\" dan \"Paling Benar Sedunia\" menjadi lagu-lagu yang ditunggu dan menjadi andalan dalam setiap pentas. Lagu \"Pemuda\" yang mampu memacu adrenalin dapat dilihat official video clip nya di Kanal https://youtube.com/rhetoricstates. Proses mixing dan mastering album \"First Blood\" dilakukan di Bandung oleh Yoni Gayot, sound engineer band-band fenomenal seperti, Superman Is Dead (Bali), Rocket Rockers (Bandung), Koil (Bandung), dan sebagainya.\r\n \r\nAwal tahun 2012, RXS mendapat apresiasi dari Majalah Hai, berkesempatan membuka konser Anti-Flag band punkrock politikal asal Amerika Serikat di Jakarta. Dan bulan Februari, lagu \"Bungaku\" terpilih masuk dalam kompilasi CD \"Independent Love Song\" Majalah Hai bersama band Last Child (Jakarta) dan beberapa band lainnya. Sampai di Januari 2013 menapakkan kaki di negeri tetangga Malaysia, dalam \"Semenanjung Malaysian Tour\" di dua kota, \"Pesta Hantu Violence vol.3\" di Shah Alam dan di Rumah Api, Kuala Lumpur.\r\n \r\nAwal tahun 2014 , Bima Sky (drums) digantikan oleh Luffy DC. Mei 2015, selanjutnya Rhetoric States merampungkan Tour Malaysia untuk yang ke dua kalinya, kali ini di Kuala Lumpur dan Penang. Bertema \"Semalam di Malaysia\".\r\n \r\nAktifit bergerak bersama dalam kegiatan sosial donor darah \"Blood Care\" kegiatan rutin 3 bulanan. Mengajak kawan-kawan aktifis punkrock Tangerang, sebagai wadah kebersamaan yang dapat membantu sesama.\r\n \r\n \r\nLine Up:\r\nMaul Skiba – Vokal/Gitar\r\nYudhi WarMan – Vokal/Bass\r\nLuffy DC – Drum\r\n \r\nRXS Base\r\nJl. Mandala No. 37 RT 003/01, Tanah Tinggi\r\nKota Tangerang – Banten 15119','Others','facebook;instagram;informasi_toko;vipclub;guitar_plus;poster;teman;lainnya;','Jakarta',124,'2017-08-09 05:12:40','2017-08-09 05:12:40'),(45,'Felicia','1502286194.jpg','Felicia terbentuk november 2016. Terbilang baru namun bukan pemula dalam dunia musik. Masing-masing personel memiliki pengalaman pada gorup/band sebelumnya yang membuat felicia semakin mantap.\r\nBelum lama terbentuk felicia sudah diundang dalam beberapa event di Jogja karta, beberapa event menjadi guest star.\r\nPada tahun 2017 felicia merilis single pertama yang berjudul steffany, sudah bisa dinikmati di gerai musik online.','Alternative Rock','instagram;teman;','Yogyakarta',129,'2017-08-09 05:43:14','2017-08-09 05:43:14'),(46,'Alurmaju','1502290748.jpg','Alurmaju adalah sebuah projek Solo Faizal Aditya R. yang diresmikan pada pertengahan 2016 di Yogyakarta. Sebagai frontman, Faizal berperan sebagai Vokalis & Gitaris (Songwriter) di projek ini. Mengusung aliran Pop Nusantara, projek ini awalnya dibentuk untuk mewadahi beberapa lagu yang tercipta semenjak 2012 tapi dirasa kurang pas dibawakan di projek Faizal yang lain. Karenanya, lewat projek ini Faizal berharap dapat menyalurkan dan mempresentasikan karya-karya tersebut dengan baik. Projek ini pertama kali diperkenalkan di Sebuah Event Daerah FKY (Festival Kesenian Yogyakarta )2016 dengan format full band. Ketika di panggung biasanya dibantu oleh beberapa player additional. di tahun 2017,Saat ini tengah menyelesaikan rekaman EP (Mini Album) Pertamanya.','Pop','instagram;teman;','Yogyakarta',137,'2017-08-09 06:59:08','2017-08-09 06:59:08'),(47,'Flowchart','1502292684.jpg','History\r\n\r\nFlow Chart, musisi  musisi muda asal Bekasi yang memberikan sebuah warna baru dengan menuangkan dua vokal tunggal di dalamnya, dan Flow chart memulai karirnya dengan nama awal The Flowchart (18 Februari 2015). Dari nama awal tersebut telah melahirkan satu buah single \"Takkan Terlupa\" dan satu buah Album yang bertajuk \"Kita , Dia dan Mereka\" di bawah label rekaman Rush Record Production, dimana ada satu lagu yang dikeluarkan untuk promo Album tersebut yang berjudul Hadapi dan Lalui , dan lagu tersebut masih turut berkontribusi serta dibawa kedalam reinkarnasi flow chart hingga kini.\r\nNama Flow Chart pun di resmikan pada tanggal 17 juni 2017 setelah menetapkan personilnya dengan : Koy (Lead Vocal), Dianto (Vocal), Ical ( Bass), Tomkids (Lead Guitar), Sandi (Rhytm Gitar), dan Agung (Drum). Dengan 3 punggawa baru ( Tomkids, Agung, dan Sandi) Flow Chart mengluarkan single terbaru yang berjudul \"Curhat\" dan lagu ini merupakan simbol perubahan konsep yang lebih melekatkan nuansa Pop Punk di dalam aransement musik Flow Chart itu sendiri.\r\nSedangkan untuk lagu dan lyrik yang disajikan Flow Chart tidak jauh berbeda dengan sebelumnya, kami masih membahas tentang isu seputar percintaan, kehidupan, dan persahabatan. Memilih genre Pop Punk adalah jalan tengah bagi kami yang berlatar belakang musik yang berbeda seperti punk rock, metal dan lain nya. \r\nArti nama Flow Chart itu sendiri adalah gambaran langkah - langkah dalam menyelesaikan suatu masalah, dan nama inilah yang memotivasi mereka sebagai pacuan untuk memulai, melangkah, dan meraih mimpi dengan apa yang telah dijalani, dimana baik buruknya suatu masalah pasti akan terselesaikan.\r\nMengenai influence, sebenarnya banyak band yang menginspirasi dikarenakan selera kami yang beragam. Namun kami begitu mengagumi All Time Low, New Found Glory, Blink 182, Angels and Airwaves, dan Paramore. \r\nMengenai visi dan misi band ini, kami ingin muncul ke masyarakat luas, dan dapat memperdengarkan hasil karya kami tersebut dalam suatu alunan musik yang dicintai masyarakat. \r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\nFlowChart Experiences\r\n\r\nBekasi Population” Pensi @ SMK Mangunjaya, 22 Desember 2015\r\nBekasi Expo 2017 @ Summarecon Mall Bekasi, 16 Maret 2017\r\nMesin Bersatu XIII @ Kampus Unisma Bekasi, 18 Maret 2017\r\nBekasi ClothFest @ Kota Harapan Indah Bekasi, 1 April 2017\r\nBeFEST Bekasi Food Festival @ Bekasi Town Square, 15 April 2017\r\nMusic Creativity Ripstore Asia @ Condet, 16 April 2017\r\nIndie Revive #1 @ Abnormal Cafe Cilegon, 30 April 2017\r\nHello! Good Ideas @ Condet, 28 Maret  2 April 2017\r\nDont Forget Your Roots @ Rossi Fatmawati, 13 Mei 2017\r\nBogor Clothing Fastingval @ Gor Padjajaran Bogor, 16 Juni 2017\r\nPekan Raya Jakarta (PRJ) @ Jakarta Fair Kemayoran Gambir Stage, 16 Juli 2017\r\n A Zone Go A Head People @ Castle Disctrict Bekasi, 30 Juli 2017','Others','facebook;instagram;informasi_toko;poster;teman;lainnya;','Jakarta',142,'2017-08-09 07:31:24','2017-08-09 07:31:24'),(48,'Chuck Jones','1502294807.jpg','Chuck Jones terbentuk tahun 2008, dimana kami berkeinginan untuk membuat suatu karya musik yang bisa diterima semua kalangan masyarakat luas','Alternative Rock','facebook;','Jakarta',146,'2017-08-09 08:06:48','2017-08-09 08:06:48'),(49,'band cadenza','1502297700.jpg','band asal surabaya terbentuk pada tgl 24 september 2016\r\nprestasi:- juara 1 ONTREZZ INDIE MUSIK\r\n              - 20 besar SOUND OF TRI 2017','Pop','facebook;instagram;','Surabaya',149,'2017-08-09 08:55:00','2017-08-09 08:55:00'),(50,'Redzahra','1502298485.jpg','Band dengan teman satu sekolah yang awalnya dibentuk untuk mengisi acara Pensi. semenjak itu band ini diteruskan dan memiliki lagu-lagu sendiri','Pop','facebook;','Jakarta',153,'2017-08-09 09:08:05','2017-08-09 09:08:05'),(51,'NEVERLONE','1502305317.jpg','NEVERLONE\r\nTepat pada Tanggal 21 April 2011 …\r\nBerawal dari kesamaan dalam hobby musik, Uwiek ( Lead Vocal ), Riki ( Screamming Vocal & Rapp ),  Zhany ( Bass ), Butoy ( Guitar ), Abee ( Synthe ), Aan ( Drum ) mencoba menyatukan visi dan misi dalam membentuk sebuah grup band Yaitu NEVERLONE yang berasal dari kota Jakarta .\r\n\r\nNama NEVERLONE sendiri di ambil dari bahasa inggris yang terdiri dari NEVER dan ALONE yang artinya Tak Pernah Sendiri. Namun agar terdengarnya simple dan mudah di ingat jadi kami memutuskan untuk menggabungkan kata kata tersebut menjadi NEVERLONE. Makna dari kata kata yang kami buat dengan nama NEVERLONE yang sebenarnya adalah agar semua personil tak pernah merasa sendiri dalam berkarya di musik, sekaligus agar semua orang bisa menikmati dan tidak pernah merasa sendiri setelah mendengarkan lagu NEVERLONE.\r\n\r\nSeiring berjalan nya waktu dalam mencari jati diri NEVERLONE, yang sesungguhnya cukup memakan waktu yang sangat lama dan tidak instan pertama kali kami mengusung Genre Pop, Pop Rock, Kini NEVERLONE mengusung jenis aliran musik \" NEW RAPP CORE \" , adalah jenis aliran musik rapp/hip-hop, yang di kombinasikan dengan sedikit sentuhan musik Rock, dan hardcore.','Alternative Rock','facebook;teman;lainnya;','Jakarta',158,'2017-08-09 11:01:57','2017-08-09 11:01:57'),(52,'The Sailor & The Waves','1502305671.jpeg','The Sailor And The Waves, sebuah grup dengan format 3 piece band yang sengaja dibangun tahun 2014. Pada bermulanya TSATW dibentuk akibat kebutuhan akan wadah berkarya oleh seorang gitaris blues yang akhirnya mengajak drummer punk serta dibumbui bujuk rayu pada seorang bassis.\r\n\r\nMeski baru seumur jagung, berbagai jenis panggung dan gigs sering dicicipi oleh TSATW. Debur ombaknya dapat disaksikan di link berikut: https://youtu.be/Lyj4EnsK-Yk\r\n\r\n3 bujang keren dibalik TSATW; Pradana Samara pada Gitar, Widyuta Wibisana pada Drum, dan Raema Yoratian pada Bass. Memadukan nuansa Surf, Rock, Space, Punk, dan Blues untuk menceritakan pahit getir asam manisnya dunia Mahasiswa.\r\n\r\nDalam lagu berjudul Alien yang ditautkan pada form ini misalnya, bercerita tentang malasnya mahasiswa pengendara motor dengan jas hujan. Lebih memilih balik kanan bubar jalan daripada kehujanan dan pakai jas hujan.\r\n\r\nUntuk prestasi, kami The Sailor & The Waves pernah menyabet gelar juara ke-2 ide/gagasan terbaik yang disuarakan lewat lagu pada Averland, sebuah kompetisi prestis yang diadakan oleh GoAheadPeople by PT. HM Sampoerna Tbk.\r\n\r\nSeperti itu. Terima kasih.','Rock','instagram;','Yogyakarta',156,'2017-08-09 11:07:51','2017-08-09 11:07:51'),(53,'TEOPE BAND','1502313653.jpg','Band yang beranggotakan 6 orang ini sering manggung di pensi pensi dan berbagai festival musik','Pop','facebook;instagram;','Jakarta',161,'2017-08-09 13:20:53','2017-08-09 13:20:53'),(54,'Mud Reaper','1502330247.JPG','Mud Reaper, previously Teenage Outlaw, is a heavy metal/rock band from Bandung, Indonesia. The Band was founded in 2014 in \'the middle of nowhere\' by bunch of dirtbike enthusiasts consisting of guitarist Yagi Febriana, vocalist Nara Witaraga, bassist Bobbie Zulfikar, drummer Iko and guitarist Ichad. Originated from a desire to contributed in their dirtbike community that called \'Rebel Dirtbike\' by way of writing an anthem that representing the spirit of Rebel Dirtbike and also as an adrenaline injection for all dirtbike enthusiasts.\r\n\r\nUnder the name of Teenage Outlaw, in early 2015 Nara as vocalist had to leave the band for some reasons while The Band ready to produce their singles project, spontaneously The Band took a quick decision by pass down the microphone to Bobbie Zulfikar considering that he used to be a vocalist before, and The Band decided to change the band name into \'Mud Reaper\' which is representing more their passion on dirtbike.\r\n\r\nMay 2015, with Bobbie on Bass & Vocals, Ichad and Yagi on Guitars, and Iko on Drums, Mud Reaper has completed their delayed singles project. They were recorded two songs at Masterplan Recording Chamber Bandung and engineered by Zoteng from Forgotten, mixed and mastered by Simon from In Place of Hope, and also Baruz from Godless Symptoms with Sarkasz from Bars of Death participated as vocal directors. The lyrics from one of Mud Reaper\'s singles tittled \'Gasspoll\' written by Addy Gembel from Forgotten (One of founder of Rebel Dirtbike) as his dedication for Rebel Dirtbike and all Adrenaline Junkies in the Universe.','Heavy Metal','facebook;instagram;','Jakarta',167,'2017-08-09 17:57:27','2017-08-09 17:57:27'),(55,'DPR','1508561478.jpg','Perkenalkan kami DPR band, kami pemida yang menyalurkan hobi kami lewat musik, kami sudah bersama dari tahun 2006, berawal di sekolah yang sama, pahit manis kami bangun band ini, kami belum pernah bongkar pasang personil, tetapi yang berawal dari 5 orang dan bertambah menjadi 6 orang, seiring berjalannya waktu dua dari anggota kami memilih untuk hengkang karena pendidikan, dan mulai tahun 2014 sampai saat ini formasi resmi kami tinggal ber4, sama seperti band yang sudah mapan di indonesia atau pun kelas internasional yang mengalami perubahan nama, kami pun juga mengalami itu tercatat 3 kali pergantian nama karena perubahan anggota kami, kami mendirikan band ini dengan nama No One pada tahun 2006 berganti menjadi A Name One di tahun 2010, dan pada tahun 2014 kerja sama dengan label indie lokal dan ikut dalam pembuatan Album kolaborasi nama kami berganti menjadi DPR yang mana diambil dari huruf depan nama kami masing2,\r\nuntuk dibidang prestasi kami, yaitu :\r\n- 20 Besar Coca-cola school band fest se indonesia di tahun 2007\r\n- Opener Arsyla band di tahun 2014 pada event KlaProject\r\n- Pengisi acara di Pharmacy Fair Univ. Pancasila pada tahun 2013\r\n- Pengisi acara di Ubhara fair di Univ. Bhayangkara pada tahun 2013','Pop','facebook;','Jakarta',168,'2017-08-09 18:01:44','2017-10-20 20:51:18'),(56,'all sizerband','1502331185.jpg','Introduction\r\nSejak awal terbentuk tahun 2012, All Sizer band yang terdiri dari Shandy (Vocal),Ardan (Bass) dan Ilham (Drum) memutuskan untuk selalu membawakan lagu ciptaan mereka sendiri di setiap event, berbagai respon dari pendengar dan teman2, baik positif maupun negative menjadi motivasi buat mereka.\r\n\r\nGenre\r\nDalam bermusik, All Sizerband mengalami evolusi, dahulu band ini bergenre Pop,  namun sejalannya perkembangan musik,  saat ini  All Sizer band berevolusi kejalur pop rock, hal ini dipengaruhi oleh masing – masing personil All Sizer.\r\n\r\nInfluence\r\nPass Band,FiveMinute,Muse\r\n\r\nVisi&Misi\r\nAll Sizer band berusaha terus berkarya  yang sesuai dengan perkembangan musik yang sudah ada dan berharap dapat diterima oleh pecinta music Indonesia.Selain terus berkarya dan bermusik, All Sizer band mempunyai misi, turut member kontribusi terhadap perkembangan music Indonesia khususnya indie.\r\n\r\nMedia Promo\r\nAll Sizer band dalam mempromosikan lagunya lewat media internet, www.All Sizer band, youtube.com, facebook.com,twitter.musik indie Indonesia,soundcloud.\r\n\r\n\r\nPerform\r\n-	Ikatan Remaja Anti Narkoba ( IRAN ) yang disponsori oleh Djarum Super\r\n-	Peringatan 17 Agustus\r\n\r\nProduct :\r\nhttp://www.AllSizerband.com\r\n-Mini Album (2012)\r\nMini album ini terdiri dari 1 lagu,\r\n* MasihAdakah\r\n-Mini Album (2013) Mini album ini terdiri dari 5 lagu\r\n* Biarkanlah\r\n* Hingga Sakit Hati Ini\r\n* Kasih\r\n* Kuingin Kau Kembali\r\n* Meski Kau\r\nMini album ini dibuat khusus untuk Fasizle ( fans All Sizer ),Penggarapan album ini dilakukan secara serius oleh All Sizer band, baik konsep lagu, sound, semua proses recording,mixing dan mastering dilakukan di Avega Music Studio.\r\n\r\nVideo\r\nAll Sizer band berencana akan membuat Video klip pada tahun ini( Hingga Sakit hati ini ).\r\n\r\n\r\n\r\nBiografi\r\n\r\nNama			: Shandy Wibowo B		\r\n\r\nNama panggilan	: Gantenx\r\n\r\nTempat/Tgllahir		: Indramayu,04 April 1982\r\n\r\nMakananfavorit		: Mie Swa,Mieayam\r\n\r\nMinumanfavorit	: Air putih,jusAlpukat\r\n\r\nHobby			: Baca buku\r\n\r\nPosisi di band		: Vocal\r\n\r\nAlamat			: jl.mushollah nurul amal no.37 peninggilan selatan – Tangerang\r\n\r\n\r\n\r\n\r\n\r\nNamalengkap		: IlhamWahyudi	\r\n\r\nNama panggilan	: Ilham/Qray\r\n\r\nTempat/Tgllahir		: Jakarta,28 Mei 1993 	\r\n\r\nMakanan favorit	: Tahu,Tempe,Bakso\r\n\r\nMinuman favorit	: Air putih,MinumanDingin\r\n\r\nHobby			: Playing guitar,Membuatlagu\r\n\r\nPosisi di band		: Drumer\r\n\r\nAlamat			: Jl.H.Sadeli no.63 rt005/001 Larangan selatan – Tangerang\r\n\r\n\r\n\r\n\r\nNama lengkap		: Ardan Said	\r\n\r\nNama panggilan	: kamplenk\r\n\r\nTempat/Tgllahir		: Bandung,26Juni 1989\r\n\r\nMakanan favorit	: All Food\r\n\r\nMinuman favorit	: Mineral Water\r\n\r\nHobby			: Playing Guitar\r\n\r\nPosisi di band		: Bassist\r\n\r\nAlamat			: Jl.Sunter Utara no.3A Jakarta Utara','Alternative Rock','facebook;','Jakarta',166,'2017-08-09 18:13:05','2017-08-09 18:13:05'),(57,'The Old Coffee','1502331708.jpg','The Old Coffee adalah sebuah band bergenre blues-rock dari Bandung, Indonesia yang terbentuk dibulan Agustus 2011. Kami terpengaruh oleh band yang popular di era 60’s - 70’s, khususnya yang bergenre blues, rock, progressive, dan rock n roll. Di tahun 2017 ini kamipun sudah merampungkan Album yang berisi 5 Track yang bertajuk \"Basa Basi\" dan sudah launching dibeberapa digital music publisher seperti Spotify, iTunes, Deezer dsb.\r\n\r\nPrestasi:\r\n•Bandung Beatles Day fest the 1st winner at Festival Citylink, 2012\r\n• Informatics fest the 2nd winner at Widyatama, 2013\r\n• Economic fest the 2nd winner at STIE Inaba, 2014\r\n• Festival koes plus the 1st winner at The Historich Cimahi, 2016\r\n• Super Rockin\' Performance Bandung, 2017','Blues','facebook;','Yogyakarta',154,'2017-08-09 18:21:48','2017-08-09 18:21:48'),(58,'Monday like sunday','1502332331.JPG','Jujur untuk prestasi kita belum ada karena kita main di dunia indie yang bergenre kan punkrock. Tapi kalo soal nama kita sudah punya nama di bekasi karena sering main di gigs gigs bekasi maupun di luar bekasi. Di akui dochi peewee gaskins sebagai dustbox nya bekasi.','Others','facebook;','Jakarta',173,'2017-08-09 18:32:11','2017-08-09 18:32:11'),(59,'smara tantra','1502333385.jpg','parkiran jazz, blues on stage balai soejadmoko, jazz in lebaran 2016&2017, bukan musik biasa wisma seni, soegijazz 2016, mld jazzphoria 2016&2017','Others','instagram;','Yogyakarta',127,'2017-08-09 18:49:45','2017-08-09 18:49:45'),(60,'X-Kaliber','1502334079.jpg','Prestasi :\r\n- Juara 1 Band Competition Yamaha Asian Beat 2016 Regional Jambi & 10 besar Band Competition Yamaha Asian Beat 2016 Regional Indonesia\r\n\r\n- Juara 1 Festival Band Simpati Loop Jambi 2014','Rock','facebook;','Jakarta',163,'2017-08-09 19:01:19','2017-08-09 19:01:19'),(61,'X-Kaliber','1502334544.jpg','Prestasi :\r\n- Juara 1 Band Competition Yamaha Asian Beat 2016 Regional Jambi & 10 besar Band Competition Yamaha Asian Beat 2016 Regional Indonesia\r\n\r\n- Juara 1 Festival Band Simpati Loop Jambi 2014','Rock','facebook;','Jakarta',163,'2017-08-09 19:09:04','2017-08-09 19:09:04'),(62,'Tutur Nada','1508562552.jpg','Tuturnada berawal dari side project beberapa personil dari band yang sudah ada terlebih dulu yang sama-sama ingin membuat band yang berbeda dari band sebelumnya, kecenderungan itu yang mengawali kami untuk membentuk Tuturnada sebagai wadah bermusik bagi kami untuk menyalurkan hasrat terpendam yang tidak bisa disalurkan di band sebelumnya. Kami sedang mempersiapkan sebuah album dan sekarang dalam proses merekam beberapa lagu untuk di masukkan dalam album nanti, kemungkinan beberapa bulan kedepan akan merilis sebuah single pertama kami.','Pop','facebook;instagram;informasi_toko;guitar_plus;teman;','Yogyakarta',177,'2017-08-09 19:13:08','2017-10-20 21:09:12'),(63,'Kero & the looper coustic','1502335408.PNG','Unique performance','Pop','facebook;','Jakarta',180,'2017-08-09 19:23:28','2017-08-09 19:23:28'),(64,'Nocturnal','1502335691.jpg','Nocturnal adalah band beraliran post-grunge yang berdomisili di pulau Bali dan didirikan oleh Freddie (vocals,guitars) dan Rian (Bass) pada tahun 2010.\r\nPada tahun 2012 Nocturnal menjadi salah satu peserta band kompilasi album Bali Total Grunge Vol.1','Rock','teman;','Surabaya',170,'2017-08-09 19:28:11','2017-08-09 19:28:11'),(65,'Lada','1502336883.jpg','Band rock yang berasal dari Cibinong, Bogor\r\n\r\nJuara 1 Yamaha (2014) Juara 1 Rock Band Ciawi','Rock','guitar_plus;','Jakarta',25,'2017-08-09 19:48:03','2017-08-09 19:48:03'),(66,'Freak City','1502337944.jpg','Band kami sering diundang di acara acara komunitas, kampus, pensi sekolah dan gigs di Jabodetabek dan Bandung.\r\nDan kami sudah mempunyai Album EP dengan 5 lagu track, dan album ini kita beri nama \"Lari Pagi\" yang diambil dari judul lagu kita. Album ini diproduksi oleh kami sendiri.','Others','facebook;guitar_plus;teman;','Jakarta',186,'2017-08-09 20:05:44','2017-08-09 20:05:44'),(67,'Hidden Message','1502340020.jpg','Hidden Message!!\r\n\r\nBand ini terbentuk 18 Februari 2006. Pada suatu malam di sebuah acara hingar-bingar anak muda di kota Cibinong, seorang remaja beranjak dewasa, dia adalah gitaris band punk yang bernama OTRE. Gitaris itu bernama Iwan Cakra yang biasa di sapa Nawi dan kini menjadi cikal bakal Vokalis serta Lead Guitar dari band ini.\r\n\r\nSingkat cerita, band ini sempat vakum beberapa tahun dari kancah musik Lokal dan Interlokal. Sampai akhirnya, tinggal tersisa beberapa personil, yaitu Nawi Message [Vocal dan Lead Guitar] dan Angga Hide [Bass]. Pemain bass yang bernama Angga ini adalah pemain terakhir yang bergabung di Hidden Message [Pada masa itu].\r\n\r\nPada tahun 2015 akhir, Nawi dan Angga sempat membuat project untuk Album baru, tetapi mereka berfikir jika dikerjakan berdua, nanti akan seperti Same-Same atau Too Phat. Dan akhirnya merekapun sepakat untuk merekrut Vokal dan Guitar untuk mengisi kekosongan formasi depan panggung. Dia bernama Zulfikar Iqbal yang sempat tergabung bersama band tersohok di kota Bogor.\r\n\r\nKemudian, setelah Iqbal bergabung, mereka terfikir kembali untuk mengajak Josua mengisi kekosongan Drum. Josua adalah teman kampus dan band terdahulu Nawi dari band OTRE. Lengkap sudah formasi Hidden Message, mereka berkumpul karena mempunyai kesamaan yaitu mengidolakan band yang mempunyai angka 182. Mereka berharap, formasi ini adalah formasi yang pas dan solid untuk melanjutkan perjalanan mereka untuk membuat soundtrack para Messenger [Sebutan Fans Mereka].','Alternative Rock','facebook;','Jakarta',190,'2017-08-09 20:40:20','2017-08-09 20:40:20'),(68,'SHADE','1508562333.jpg','dengan mengusung genre musik yang sedikit berbeda yaitu Jazz-Punk / Japanese rock, SHADE cukup mengambil perhatian beberapa pihak dengan single pertamanya. Bahkan Dapat respons dari warga Chiba-Jepang. Sampai saat ini banyak brand lokal yang mempercayai SHADE untuk menggunakan product mereka masing-masing. Seolah-olah SHADE adalah band of brand.  Dengan personil yang irit hanya bertiga mampu memeriahkan event- event musik / gigs yang sering di adakan. Berharap kedepannya bisa menjalin kerja sama dengan pihak-pihak yang luar biasa di bidangnya, terimakasih (:','Others','teman;','Jakarta',195,'2017-08-09 22:17:32','2017-10-20 21:05:33'),(69,'Kecoa Terbang','1502346346.jpg','Pada bulan juni 2017 lalu kami pernah menjadi finalist event planetrox indonesia dan pemenangnya akan tampil di event yang bernama envol et macadam di canada dan event ini diikuti 400 band seluruh indonesia, dan kami tidak menjadi pemenang kami finish di posisi kedua.PlanetRox 2017 Indonesian Finalist Envol & Macadam Festival At Quebec Canada.','Rock','teman;','Jakarta',194,'2017-08-09 22:25:46','2017-08-09 22:25:46'),(70,'Batiga','1508545718.jpg','Batiga berdiri sejak tahun 2011 di Yogayakarta. Beranggotakan 5. Telah memiliki satu album, dan sedang proses mastering album terbaru di Nashville, USA yang rencananya akan di rilis pertengahan tahun mendatang. 5 anggota dengan komposisi 5 kepribadian, karakter serta influence musik yang unik unik. Riosa terkenal dengan nuansa vokal dengan vibra yang tebal, sewaktu kecil hingga SMA penyabet juara pop singer kancah lokal maupun nasional, serta ditunjuk sebagai wakil dari Yogyakarta untuk student exchange di NEw Zealand, pertengahan 2015 kemarin. Talcha Sultanik Hanalaneng, terlahir dari keluarga yang tekun dengan musik & seni, Kakak perempuannya, juga sempat memiliki band bernama Niwangi yang dulu sempat mencicipi industri perlabelan indonesia, pernah menjadi brand ambassador lokal Yogayakarta untuk produk sennheiser dan bersama sama dengan Batiga tour bersama sennheiser tema drum clinic dan simple miking untuk keperluan recording bersama sennheiser. Yunan Patrajuangga, gemar memainkan piano sejak dia umur 6 tahun, karena memang Ayahnya seorang musisi, dalam Batiga, dia ditunjuk untuk menggawangi musik musik Batiga sebagai Music Director.Andreas Dwi Cahyadi atau yang sering dikenal sebagai Andreas DC dan Luke Ottaviandri adalah dua orang sabahat sejak SMA. Dua duanya pernah dipercaya sebagai arranger beberapa lagu dari Nano Tirta Group serta  Lana Nitibagaskarta (Warner Musik Indonesia) tahun 2013 - 2014. Saat ini Andreas DC pun sebagai brand ambasador dari produsen Bass Lokal, yaitu F.A.D bersama dengan Om Indro Harjodikoro dan teman teman lainnya, serta dia pun memiliki product signed sendiri di F.A.D yang bersama sama dengan F.A.D dan Batiga dipasarkan secara nasional. Secara terpisah, Batiga sendiri pun (secara utuh) memiliki beberapa prestasi, antara lain adalah seringkali diminta untuk mengarasemen lagu lagu jingle/backsound perusahaan ataupun film film indie, pernah sebagai brand ambasador dari salah satu produk kecantikan wanita di Yogyakarta, bersama salah satu media indiependent Yogakarta melakukan tour di Jakarta, Jawa Tengah, serta Jawa Timur.','Pop','instagram;','Yogyakarta',197,'2017-08-10 00:39:04','2017-10-20 16:28:38'),(71,'RELIEFS','1502363328.JPG','Relief dalam kamus besar bahasa indonesia yang berarti corak-corakan jadi setiap personil memiliki cirikhas nya masing-masing baik itu dari genre dan cara bermain musik, kami tambahkan huruf S, karena band ini berasal dari kota Sukabumi. 1st Winner Dapur Letter Rock Shows Gigs, 1st Winner Komunitas Music Sukabumi Fest.','Rock','lainnya;','Jakarta',202,'2017-08-10 03:08:48','2017-08-10 03:08:48'),(72,'Fortypercent','1502365192.JPG','Berawal dari SMA yang sama, kami sering ngumpul bareng meskipun awalnya berbeda band. seiring berjalannya waktu, berlandaskan visi, misi, kesukaan musik, dan kecocokan antar personil, kami sepakat untuk membentuk band ini, dengan mengusung aliran rock alternative. Kami sudah beberapa kali manggung di event kecil maupun besar, nampil di event indie lokal, serta opening beberapa artis.','Alternative Rock','instagram;teman;','Medan',201,'2017-08-10 03:39:52','2017-08-10 03:39:52'),(73,'ARTHUR','1502371631.JPG','ARTHUR band memulai langkah di tahun 2010 , kami memulai dari band keluarga,yg di isi oleh Ruby di gitar, kikikeroz di drum, dan sopian di vocal ( dengan nama MAKE-UP band) Yg mulai di bentuk antara tahun 2001-2008 hilir mudik naik turun stage ,  BANDUNG-KARAWANG-CiIKARANG-BEKASI seiring dengan berjalannya waktu,vokalis sopian memilih karir Yg lain, dan di awal 2010, sang Drumer kikikeroz berganti posisi menjadi vokalis, gitar tetap di isi oleh Ruby, dan selanjutnya kita menggaet , bassis YANT TAGARA, Drum EKI, Dan juga sekaligus mengganti nama BAND kita dari MAKE-UP menjadi ARTHUR ,kenapa kita memilih ARTHUR menjadi nama BAND kita , karna di beberapa cerita dan kisah ,ARTHUR adalah seorang raja Yg bijaksana,pemberani,dan di sukai oleh rakyatnya, jd Kuta berharap , musik , dan karya kita ,bisa di nikmati,disukai oleh pencinta,penikmat musik di seluruh dunia, \r\nGenre Yg kita bawakan ada POP , pop Yg baru yg segar ,Yg kita namakan sebagai FRESHPOP\r\ndi awal langkah ARTHUR ,kita sempat beberapa kali perfom, antara Cikarang - Bekasi, di tahun Yg sama 2010 , kita mengikuti ajang festival BAND Nasional A-mild wanted , dan Alhamdulillah kita langsung masuk Final regional jawa barat , dari seribu lebih band , kita masuk 10 besar, selanjutnya kita banyak perfom dipanggung besar, menjadi opening band , seperti, ada band, naif, Vagetoz, anji,dll','Pop','facebook;','Jakarta',148,'2017-08-10 05:27:11','2017-08-10 05:27:11'),(74,'zoo elephant','1502383641.jpg','-masuk kompilasi demajorsxurbangigs\r\n-masuk kompilasi kick fest','Pop','instagram;teman;','Jakarta',221,'2017-08-10 08:47:21','2017-08-10 08:47:21'),(75,'Green Octave','1502384393.jpg','Green Octave (biasa disebut GO) merupakan grup band asal kota Indramayu. GO berawal dari band indie bernama BASS BAND yang kemudian dengan member yang baru pada tahun 2014 berganti nama sebagai Green Octave. Selama lebih dari 2 tahun GO telah menelurkan beberapa single andalan diantaranya Cinta Tak Capai, Cinta Datang Kembali, dan Wanita terakhir. Single Wanita Terakhir direkam sebagai salah satu reward atas pencapaian runner-up Festival Band Duta Indramayu 2016.','Pop','facebook;','Jakarta',220,'2017-08-10 08:59:53','2017-08-10 08:59:53'),(76,'Pasir Pantai','1502386145.jpg','Awal terbentuknya band kami mulai dari sebuah sekolah menengah tingkat atas. Dari sekadar bersenda gurau, lalu meningkat pada intensitas pertemuan, kemudian lahirlah sebuah ide untuk membentuk sebuah band dengan nama Seven Rastaman\r\n\r\nLazimnya pertumbuhan sebuah band, kami pun mengalami perombakan personil. Seiring tambal sulam personil, maka pada tanggal 9 Desember 2009 kami tentukan sebuah nama baru untuk mewakili kami ber 5 , yaitu Pasir Pantai\r\n\r\nPemilihan nama tersebut bagi para kami tidak memiliki arti yang sangat khusus. Penggunaan nama Pasir Pantai bagi kami bukan hanya sekedar simple tapi ada makna tersendiri untuk nama tersebut yaitu adalah Pasir merupakan benda padat yang sulit untuk dipisahkan yang dimana harapan kami para pendengar tidak untuk dilipakan. Dan kata pantai kami pilih karena kesejukan dari suasana tersebut yang membuat perasaan dan jiwa kami menjadi relex.\r\n\r\nkami beranggapan bahwa pasir di pantai melambangkan sebuah hubungan yang saling mengenal satu sama lainnya yang berasal dari semua golongan. Kesemua itu, bagi kami merupakan sebuah nilai yang tak terhingga.\r\n\r\nBand yang berdomisili di bagian selatan Kota Jakarta ini beranggotakan Leso (vokal1), Kinoy (rhythm), Danni (lead), Yugo (bass), dan Ryan (drum). dan muncul Mega (keyboard) . Serta dibantu oleh beberapa pemain additional perkusi dll\r\n\r\nKami berharap dapat menjadi band yang berkembang lebih baik, maju, sukses, dan dapat memberikan kesan terdalam bagi semua golongan. Sehingga setiap orang yang menyaksikan performansi Kami dapat terhibur, baik secara live maupun dengan mendengarkan via perangkat audio.\r\n\r\nPenilaian masyarakat atas respon karya-karya kami merupakan dorongan semangat para personil untuk terus berkarya. Dorongan tersebut diibaratkan seperti ombak yang selalu menggerakkan butiran pasir di pantai ,\r\n\r\nSeiring pertumbuhannya, alhamdulillah kini kami sudah memiliki 7 buah karya (Lagu). berkat doa orang tua dan kalian semua sahabat brader & sista yang sudah dukung kami dari awal sampai saat ini, Terimakasih','Others','facebook;','Jakarta',218,'2017-08-10 09:29:05','2017-08-10 09:29:05'),(77,'Back On Stage','1502397362.jpg','Di bentuk pada tahun 2016 deseber, manggung di caffe,dan event2 di bandung,..\r\nBack On Stage band ber genre musik pop punk alternatif, beranggota 3 orang.','Alternative Rock','facebook;','Jakarta',224,'2017-08-10 12:36:02','2017-08-10 12:36:02'),(78,'Back On Stage','1502397387.jpg','Di bentuk pada tahun 2016 deseber, manggung di caffe,dan event2 di bandung,..\r\nBack On Stage band ber genre musik pop punk alternatif, beranggota 3 orang.','Alternative Rock','facebook;','Jakarta',224,'2017-08-10 12:36:27','2017-08-10 12:36:27'),(79,'Back On Stage','1502397404.jpg','Di bentuk pada tahun 2016 deseber, manggung di caffe,dan event2 di bandung,..\r\nBack On Stage band ber genre musik pop punk alternatif, beranggota 3 orang.','Alternative Rock','facebook;','Jakarta',224,'2017-08-10 12:36:44','2017-08-10 12:36:44'),(80,'Back On Stage','1502397452.jpg','Di bentuk pada tahun 2016 deseber, manggung di caffe,dan event2 di bandung,..\r\nBack On Stage band ber genre musik pop punk alternatif, beranggota 3 orang.','Alternative Rock','facebook;','Jakarta',224,'2017-08-10 12:37:32','2017-08-10 12:37:32'),(81,'Back On Stage','1502397482.jpg','Di bentuk pada tahun 2016 deseber, manggung di caffe,dan event2 di bandung,..\r\nBack On Stage band ber genre musik pop punk alternatif, beranggota 3 orang.','Alternative Rock','facebook;','Jakarta',224,'2017-08-10 12:38:02','2017-08-10 12:38:02'),(82,'Back On Stage','1502397491.jpg','Di bentuk pada tahun 2016 deseber, manggung di caffe,dan event2 di bandung,..\r\nBack On Stage band ber genre musik pop punk alternatif, beranggota 3 orang.','Alternative Rock','facebook;','Jakarta',224,'2017-08-10 12:38:11','2017-08-10 12:38:11'),(83,'Shout Keepers','1502420417.jpg','SHOUT KEEPERS a.k.a @shokeepHC adalah PROJECT band HARDCORE asal tambun selatan - BEKASI yang terbentuk tepat pada tanggal 12 - 12 - 2012, dengan berawalkan personil aldino - vocal, awank “racer dancer” - guitar, kiki - drum. dengan terinfluence seperti shutdown, strife dan agnostic front. tetapi dikarenakan kesibukan dari setiap personilnya, project ini harus berhenti di tahun 2013.\r\nTepat diawal tahun 2015 diteruskan kembali dengan personil gita “ex pesona 13” - vocal, awank “racer dancer” - gitar, ardi “back to the future” - bass, aat “losetime” - drum. dengan formasi baru ini shokeepHC melakukan mini tour pertama di jonggol & cipanas 1-2 januari 2015, serta banyak perubahan baik dari sound dan influence seperti hatebreed, wolfdown, terror & madball\r\n\r\nUsai mini tour tersebut ardi & aat harus resign, project ini kembali terus dilanjutkan setelah bergabungnya konx “ex secret forgotten & mesin rusak” - drum, benk “ex destination before death & secret forgotten” - lead guitar serta kake - bass, dengan terbentuknya formasi ini shokeepHC langsung melakukan mini tour kedua mereka di rawa mangun, jonggol & bekasi 14-15 maret 2015, serta berlanjut dengan banyak tampil di gigs & events baik didalam kota maupun diluar kota\r\n\r\nSaat ini kami baru saja mengeluarkan mini-album bertitle “aliansi//alliance” dan trailer nya sekarang sudah dapat dilihat di youtube official maupun beberapa portal video dunia yaitu hardcore worldwide dan blankTV, salah satu dari empat materi yang terdapat di mini-album tersebut yaitu “blood stage” juga telah dikeluarkan dalam bentuk video lirik, yang sudah di unggah di youtube official serta di unggah ulang oleh kembali blankTV.','Others','facebook;','Jakarta',225,'2017-08-10 19:00:17','2017-08-10 19:00:17'),(84,'NEARMINE','1502426792.jpg','BIOGRAFI NEARMINE Band\r\n\r\n‘Nearmine Band’ terbentuk pada tanggal  8 november 2012\r\nDidirikan atas dasar hobby dan kecintaan personil terhadap musik ,\r\nMasing-masing personil memiliki latar belakang dan basic yang berbeda, namun memiliki visi dan misi yang sama dalam bermain musik.\r\n‘Nearmine Band’ berkeinginan bermain musik untuk ikut meramaikan belantika musik di tanah air dan menciptakan karya musik yang dapat di nikmati oleh para pendengar musik di tanah air.\r\nMaka ditahun 2016 ini Nearmine Band,Memutuskan untuk bergabung dengan Lebel Musik “ATO Production” dengan Tujuan agar ‘Nearmine Band’ semakin dikenal oleh masyarakat luas bahkan bisa dikenal sampai Mancanegara. Dengan single hits “Masih Mencintaimu”, masyarakat dapat menikmati lagu kami yang bernuansa romantic.\r\nDengan memperbanyak jadwal life performance baik On air atau Off air,kami mengharapkan antusias warga indonesia untuk selalu mendukung kami dengan cara mengaktifkan RBT ( Ring Back Tone ) kami serta mendownload album kami di amazon.com dan Itunes Apple. sehingga Para penikmat musika dapat menikmati dan merasa puas dengan Karya - karya ‘Nearmine Band’.\r\nDalam perwujudannya, ‘Nearmine Band’  akan menyuguhkan suatu musik yang menarik untuk dinikmati dan dikemas secara profesional.\r\n‘Nearmine Band’ menawarkan sebuah konsep musikalitas untuk ikut memeriahkan suasana tempat dengan lagu-lagu yang disuguhkan.\r\nKonsep kami menyuguhkan hiburan segar dengan penampilan professional yang tidak hanya mementingkan keindahan harmonisasi music tapi juga menampilkan performance yang dapat menarik dan membuat pendengarnya terbawa suasana.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\nTRACK RECORD BAND\r\nSelama perjalanan sejak tahun 2013 kurang lebih kami memiliki beberapa pengalaman di berbagai event & Acara\r\nSeperti :\r\n	Februari 2013 : Kami menjadi salah satu band pengisi acara yang ikut berpartisipasi dalam acara ‘STAR MUSIC’ bakti sosial dalam rangka penggalangan dana untuk para korban banjir Jakarta yg diselenggarakan di. (Mall Ramayana Depok)\r\n	Januari 2014 : Kami meraih penghargaan dan menjadi juara dalam kompetisi band ‘WE LOOP U BOGOR’ yang diselenggarakan di Padjajaran Bogor oleh salah satu perusahaan yang bergerak dibidang provider telekomunikasi. (Telkomsel)\r\n	Maret 2014 : Kami menjadi bintang tamu di salah satu stasiun radio FM yang ada di bogor dalam acara ‘MUSIK INDIE AKUSTIK’.\r\n	September 2014 : Kami menjadi band pengisi acara ulang tahun di gedung pernikahan. (Gedung Golden Bogor)\r\n	November 2014 : Kami meraih penghargaan dan terpilih menjadisalah satu band dalam kompetisi ‘BOGOR ALL STAR COMPILATION’ yang diselenggarakan di salah satu café di bilangan padjajaran bogor. (Catherius Café)\r\n\r\n\r\n\r\n	Desember 2014 : Kami diundang untuk menjadi bintang tamu dalam sebuah acara di salah satu café yang terletak di bilangan bantar jati bogor. (Terrace Café)\r\n	Januari 2015 – Sekarang : Kami diterima dan dipercaya menjadi ‘HOME BAND’ atau band pengisi di salah satu café di bilangan yasmin bogor. (Food Paradise Café)\r\n	Agustus 2015 : Kami menjadi bintang tamu selama beberapa minggu di salah satu café di bilangan suryakencana bogor. (Cyrano Café)\r\n	Juni 2016 – Juli 2016 : Kami menjadi ‘HOME BAND’ atau band pengisi di AEON Mall BSD City, dengan di 3 venue berbeda yaitu di Food Culture, Café Street ,dan Food Carnaval . Sepanjang masa kontrak dari tempat ke tempat yang lain,antusias penonton sangat positif dan banyak yang mengapresiasi aksi panggung “Nearmine Band” di AEON Mall BSD City .','Pop','facebook;','Jakarta',217,'2017-08-10 20:46:32','2017-08-10 20:46:32'),(85,'Pepton','1502437853.jpg','Pepton adalah sebuah band yang terdiri dari omball sebagai vocalis ,F levi sebagai gitaris, CeiiJe sebagai basis dan Danang sebagai drumer.\r\n\r\nYang berdiri pada bulan Juli di tahun 2009.\r\n\r\nPepton berdiri dari hoby setiap personil yaitu bermain musik dan menciptakan lagu.\r\n\r\nKami bertemu dan memainkan lagu-lagu ciptaan kita di studio band. Tak hanya membawakan lagu ciptaan sendiri tapi kita juga memainkan lagu-lagu band papan atas seperti maroon 5, Audioslave dan G n R .\r\n\r\nTetapi pada tahun 2015 akhir F Levi dan Danang memilih untuk hengkang  dari band Pepton.\r\n\r\nTinggal tersisa Omball dan CeiiJe yang masih ingin melanjutkan mimpi dan hoby di dunia musik.\r\n\r\nKita berdua bertahan karena ingin memperdengarkan lagu-lagu yang sudah di rekam agar semua orang dapat menikmati dan mendengarkan hasil karya kita.\r\n\r\nHarapan kita lagu-lagu Pepton dapat di jadikan memori lagu di setiap perjalanan hidup para pendengar','Pop','facebook;','Jakarta',230,'2017-08-10 23:50:53','2017-08-10 23:50:53'),(86,'The Scientist','1502438888.jpg','Hanya band biasa','Alternative Rock','instagram;teman;','Jakarta',14,'2017-08-11 00:08:08','2017-08-11 00:08:08'),(87,'Narayana','1502441077.jpg','Narayana adalah band beraliran Alternative Pop Rock. Kami mengusung tema kemanusian, cinta, sosial dan spiritual. \r\nLagu kami yang berjudul \"Embun di Asia\" pernah tergabung dalam album kompilasi bertajuk \"Akalliar ; Pop Alt.\" yang diproduseri oleh Ali Akbar dan Ian Antono pada tahun 2007, dengan kontrak hanya sampai 1 tahun.\r\nKami juga pernah mengisi berbagai pentas band di Yogyakarta, dan tampil di stasiun televisi lokal \"Jogja TV\".','Alternative Rock','teman;','Yogyakarta',229,'2017-08-11 00:44:37','2017-08-11 00:44:37'),(88,'Pasukan Penjaga Pohon','1502441837.jpg','Pasukan Penjaga Pohon band yang bermarkas di Tangerang - Banten , terbentuk pada 11 November 2017, Band ini terbentuk dikarenakan masih ada passion untuk berkarya di bidang musik dari ke empat laki laki yang dulunya masing masing punya band sendiri sendiri namun sudah bubar jalan, dikarenakan masih memiliki keingginan untuk bermusik mereka pecahan dari 4 band yang menjadi satu ( Pasukan Penjaga Pohon ). Event inde sering mereka ikuti oleh band yang terbilang baru ini salah Satunya adalah Panggung PRJ 2017 dll.','Funk','instagram;teman;','Jakarta',232,'2017-08-11 00:57:17','2017-08-11 00:57:17'),(89,'Sirocka','1502442691.jpg','band asal kota kecil cianjur,menyuguhkan materi musik alternativ rock yang segar di telinga pendengar Indonesia','Alternative Rock','facebook;teman;','Jakarta',98,'2017-08-11 01:11:31','2017-08-11 01:11:31'),(90,'Sirocka','1502442709.jpg','band asal kota kecil cianjur,menyuguhkan materi musik alternativ rock yang segar di telinga pendengar Indonesia','Alternative Rock','facebook;teman;','Jakarta',98,'2017-08-11 01:11:49','2017-08-11 01:11:49'),(91,'Sirocka','1502442716.jpg','band asal kota kecil cianjur,menyuguhkan materi musik alternativ rock yang segar di telinga pendengar Indonesia','Alternative Rock','facebook;teman;','Jakarta',98,'2017-08-11 01:11:56','2017-08-11 01:11:56'),(92,'JENOVA','1502446531.jpg','Jenova adalah Band yang terbentuk di Purwokerto pada tanggal 8 Agustus 2010, merupakan band yang mengusung genre Japanese Alternatif dan di gawangi oleh Sigit (Bassist) , Bait (Vocal), Danny (Rhythm), dan Yogo (Drum). Setelah hengkangnya Bayu dari Jenova , untuk sementara posisi tersebut digantikan oleh Five (Lead Guitar) .Musik yang dimainkan Jenova terinfluence dari band-band bergenre Japanese Rock seperti One Ok Rock, L’Arc En Ciel dan J-Rock.\r\nJenova sering menjadi pengisi acara dan guest star di event-event lokal terutama yang berbau jejepangan.\r\nJenova juga tergabung di salah satu komunitas band indie yang dinaungi oleh salah satu Radio dan sering ikut serta dalam berbagai acara musik indie di kota Purwokerto.\r\nUntuk prestasi , Jenova pernah lolos ke tahap semifinal ajang pencarian bakat yang diselenggarakan oleh salah satu merk rokok pada tahun 2014.\r\nUntuk saat ini Jenova sudah memiliki 4 lagu.','Rock','teman;','Yogyakarta',234,'2017-08-11 02:15:31','2017-08-11 02:15:31'),(93,'OLLY OXEN','1502451774.jpg','Band yang berdiri Agustus 2016 lalu pada mulanya dibentuk sebagai proyek alter-ego ini  kemudian direkatkan oleh kesamaan visi untuk membuat komposisi lagu rock yang imajinatif dan variatif. Gemby (Gitar), Mere (Vokal), Novelino (Bass), dan Gawank (Drum) telah mengusung musik yang sarat akan riff berat yang catchy, bumbu vocal yang penuh pertualangan dan konten yang kritis.\r\nSetelah merilis ulang edisi terbatas single \"Adult’s Dream is a Violations\" dalam format kaset dan mampu terjual habis pada gelaran Record Store Day lalu, grup rock Olly Oxen memantapkan eksistensinya dengan merilis sebuah EP bertajuk \"Bad Mantra\". EP dalam format CD ini akan dirilis pada 12 Mei 2017 kemarin. Momentum ini juga menjadi kesempatan bagi Olly Oxen untuk memperkenalkan video-clip lead single kedua mereka yang berjudul sama dengan album “Bad Mantra”. Seluruh materi yang ada di mini album ini sudah dapat didengarkan melalui kanal streaming musik seperti Apple Music, Spotify dan Deezer.\r\nEP \"Bad Mantra\" berisi tentang kontrol media atas kehidupan manusia, bagaimana citra dan informasi dibingkai untuk melemahkan pemikiran dan memutar persepsi. Keempat lagu dalam mini album ini mewadahi narasi tersebut melalui sudut pandang korban dalam lagu \"Adult’s Dream is A Violation\", sang antagonis “Bad Mantra” yang dibangun melalui sound tremolo gitar yang kelam, optimisme\r\nagen perubahan dalam ketukan 3/4 pada “Self Preaching\" dan diakhiri dengan nyanyian perayaan ketidakberdayaan bernuansa vokal hip-hop “Mr. Dunnowattudu\". \"EP ini adalah tentang mengingatkan diri untuk tidak berhenti berpikir dan mempertanyakan sistem disekitar kita, dan untuk menolak hidup dalam mimpi orang lain','Rock','facebook;instagram;teman;','Yogyakarta',140,'2017-08-11 03:42:54','2017-08-11 03:42:54'),(94,'Beeswax','1502456186.jpg','Beeswax adalah band beraliran emo yang berdiri di Malang sejak 2014. Beeswax telah menelurkan 2 album yakni \"First Step\" dan \"Growing Up Late\" dan sedang dalam proses merampungkan album ketiga. Pada tahun 2016, Beeswax terpilih menjadi finalis We The Fest x Demajors Band Showdown dan tampil dalam gelaran We The Fest 2016. Band ini juga telah masuk dalam kompilasi \"Emotion, No\" berisikan musisi-musisi emo di Asia, serta kompilasi \"Music For Brighter Day\" di tahun 2017. Beeswax juga menjadi band pembuka untuk rangkaian tur band Turnover di Yogyakarta, dan telah menjajal panggung di berbagai kota di Pulau Jawa.','Alternative Rock','teman;','Surabaya',239,'2017-08-11 04:56:26','2017-08-11 04:56:26'),(95,'Ris And Soul','1502464164.jpeg','Terbentuk di tahun 2009, tepatnya tanggal 19-agustus-2009..\r\nBerawal dari keisengan mengikuti sebuah lomba yang mendadak,dan terbentuklah kami..\r\nMemulai perjalan yang sedikit mebuat kami dewasa dalam bermusik…\r\nPergantian personilpun telah kami rasakan…\r\nBerat, tapi itulah sebuah pilihan yg kami harus pilih waktu itu..\r\nSekarang dengan formasi baru kami, kami ingin terus mecoba berkarya dan mencipta…\r\nMelangkah kedepan dan tak pernah melupakan memori masa lalu..\r\nTerus mencoba dan mencoba, membuat sesuatu yang berguna…\r\nInilah kami,hanya sekelompok remaja ya terus belajar dalam berkarya\r\nInilah kami…\r\nRis And Soul\r\n\r\nprestasi :\r\n1. juara 3 festival flexi aksi band SMA Se DKI Jakarta rolling stone kemang 2009','Pop','facebook;instagram;','Jakarta',241,'2017-08-11 07:09:24','2017-08-11 07:09:24'),(96,'Fingerstyle','1502472779.JPG','Sebelum bernama Fingerstyle, nama band kami sebelumnya adalah The Rings, dan sudah berjalan lima tahun, banyak pengalaman dan prestasi yang kami raih, salah satunya adalah menjadi juara 3 ajang pencarian bakat yang di selenggarakan oleh Alfarecords dengan tema Naga Mencari bintang, kami di kontrak selama satu tahun, namun selama berjalannya promo yang dilakukan oleh pihak label kami rasa tidak ada progres yang signifikan, hingga habis masa kontak, dan setelah itu juga tiga personil dari kita mengundurkan diri, dan sekarang hanya tinggal dua orang saja, dan memutuskan untuk mengganti nama menjadi Fingerstyle.','Others','facebook;','Jakarta',238,'2017-08-11 09:32:59','2017-08-11 09:32:59'),(97,'Japra','1502475515.jpeg','Japra terbentuk 7 Juli 2009 dengan nama awal Japrajazz. Namun di tahun 2013 kata jazz sepakat ditanggalkan karena dinilai sudah tidak relevan dengan warna musik kami yang semakin luas. Di tahun 2015 kami akhirnya merilis sebuah album berjudul SOULOUT yang kami produseri sendiri. Pop, jazz, folk, blues dan RnB, berpadu jadi satu di album tersebut. Album itu adalah representasi musik yang kami mainkan selama kurang lebih 6 tahun karenanya warna musik dalam album itu begitu variatif.  \r\n\r\nHingga saat ini kami masih aktif tampil di berbagai acara. Berikut beberapa acara musik yang pernah kami ikuti dan prestasi yang pernah kami raih.\r\n\r\n- UI Sound Explotion (2010)\r\n- Festival Budaya, UI (2011)\r\n- Margo Friday Jazz (2012)\r\n- Juara Festival Musik Akustik Green Pramuka Square (2013)\r\n- Adfest, Universitas Brawijaya, Malang (2013)\r\n- Perwakilan Indonesia di Asean Jazz Festival, UKM, Malaysia (2013)\r\n- Labs Project (2014)\r\n- Postig 6 (2014)\r\n- Banten Jazz Night (2014)\r\n- Ramadhan Jazz (2014)\r\n- Jazz Atas Awan (2014)\r\n- Juara 2 Torabika Jingle Jazz (2014)\r\n- Soundsations (2015)\r\n- Juara 1 Regional Amild Road to Soundrenaline (2015)\r\n- Soundrenaline (2015)\r\n- Taman Buaya Beat Club (2016)\r\n- Love Donation (2017)\r\n- (Ismail Marzuki Jazz Festival (2017)','Pop','facebook;','Jakarta',150,'2017-08-11 10:18:36','2017-08-11 10:18:36'),(98,'NABULA','1502479402.jpg','Diangkat dari sebuah nama Nebula yang ada diluar bima sakti, yang kami ubah menjadi NABULA. Mahakarya Tuhan yang maha agung yang menginspirasikan banyak orang tentang keindahan alam semestanya, tanpa terkecuali kami yang menjadikan nama Nabula sebagai nama band yang terbentuk di bandung pada awal bulan agustus tahun 2015. Anggotanya berjumlah 3 orang yaitu Sendy (vocal), Bonchu (guitar), Wahyu (Guitar).\r\n\r\n  Radiohead, Coldplay, The Maccabees, Blur, beberapa band ini lah yang menginspirasi Nabula untuk terus berkarya menyuarakan musik Indie Rock.\r\n\r\n  Nabula tidak hanya ingin sekedar meramaikan belantika musik di Indonesia, melainkan karena NABULA SANGAT SIAP memperkenalkan karya-karya yang sudah KAMI komposisikan dan banyak dipengaruhi oleh music Indie Rock/alternatif 90-an dengan sajian yang terdengar lebih Fresh lagi.','Alternative Rock','facebook;instagram;teman;','Jakarta',77,'2017-08-11 11:23:23','2017-08-11 11:23:23'),(99,'Sheriff And Gun','1502482653.JPG','Kami adalah Sheriff And Gun.\r\n\r\nBand kami berdiri pada 5 April 2009 dengan nama lama Visit the Angel Rebel yang mengusung genre Punk Rock.\r\n\r\nKami terdiri dari 3 personil :\r\n\r\nValiant sebagai gitaris\r\nAgung sebagai bassis dan vokal.\r\nRizky sebagai stand up drummer dan back vokal.\r\n\r\nSetelah 4 tahun bergelut dalam musik punk rock, kami memutuskan juga menetapkan pilihan untuk berganti genre menjadi Rockabilly pada 5 April 2012 dan mengganti nama band kami menjadi Sheriff And Gun.\r\n\r\nBand kami diklasifikasikan sebagai sangat muda tapi kami membawa jenis musik yang dewasa. Alasan kita untuk band ini yaitu berdasarkan satu visi, misi yang satu dan satu tujuan.\r\n\r\nFilosofi musik kami adalah warna kehidupan kita sendiri dan orang lain.\r\nTerdapat nilai-nilai kehidupan seseorang serta banyak pihak.\r\n\r\nSemenjak berganti nama dan beralih genre dari 05 April 2012, kami menjadi bagian dari komunitas Jakarta Rockabilly & Indonesia Rockabilly bersama band rockabilly lainnya dan kami telah mengikuti beberapa acara musik gigs di beberapa tempat hingga pertengahan tahun 2015. Dan dari pertengahan tahun 2015 hingga awal tahun 2016, kami sempat break/vakum dikarenakan salah satu personil kami sedang fokus untuk menyelesaikan skripsi kuliahnya.\r\n\r\nDi awal tahun 2016, kami memulai kembali dengan melakukan rekaman untuk lagu-lagu kami yang saat ini sudah menjadi EP atau Mini Album.\r\n\r\nSetelah selesai melakukan proses rekaman, kami bergabung dengan salah satu komunitas musik indie yaitu FORMI (Forum Musik Indie Indonesia) dan 101% Music Community. Dalam melanjutkan karir kami dibidang musik. Kami berpartisipasi dalam beberapa event musik hingga saat ini.','Others','instagram;','Jakarta',245,'2017-08-11 12:17:33','2017-08-11 12:17:33'),(100,'Knuckle Bones','1502497615.jpg','Knuckle Bones is a Melodic Metalcore band from Jakarta that started in 2017. The band consists of 3 members, Pras(vocals), Raka (Guitarist) and Riki (Guitarist). Knuckle Bomes just releast their first ever EP \"Inception\". The EP tells a story about Lucid Dreaming (where youre awake but in dream state). If you want to understand more, you can watch the movie Inception by Christopher Nolan. If you want to listen to our EP or buy it, you can stream on iTunes, Spotify and other media outlets.','Rock','teman;lainnya;','Jakarta',247,'2017-08-11 16:26:55','2017-08-11 16:26:55'),(101,'AUDIOTERAPI','1502521432.jpg','Audioterapi band was found at the end of 2009 by three medical students in Jakarta who felt able to play songs, Yudha DP, Ryan Tantri Ardo, and Aditia Nata Kusuma. \r\n\r\nThey met Ramadaridesa, the vocalist and the author who never finished the song, at the same school, in the same year. Since then, the songs are never finished, began to be solved together. \r\n\r\nAudioterapi start spreading some of their songs through electronic data and from gigs to gigs around Jakarta, Bogor and Bandung. \r\n\r\nIn 2010, Gilang Kusmayadi, a friend at the same school, still, who often lends a guitar to Audioterapi began to join, then he left in 2014. \r\nRio began to join us as a guitar player in 2017.\r\n\r\nGenre that they played is what they like. Adjusted for the purpose of the song that was made. That\'s Audioterapi genre. Based on the atmosphere.','Others','instagram;vipclub;','Jakarta',134,'2017-08-11 23:03:52','2017-08-11 23:03:52'),(102,'SLOWLY SHINE','1502528242.jpg','SLOWLY SHINE yg berarti perlahan bersinar dan akan selalu bersinar, prestasi juara 1 jingle Muscle Car Indonesia','Alternative Rock','facebook;instagram;informasi_toko;','Jakarta',248,'2017-08-12 00:57:22','2017-08-12 00:57:22'),(103,'Inrain','1502529239.jpg','Pada tanggal 7 Mei 2017 Inrain memenangkan juara ke-2 pada audisi Jakcloth band. yg bertempat di Arena PRJ-Kemayoran.','Heavy Metal','facebook;','Jakarta',250,'2017-08-12 01:13:59','2017-08-12 01:13:59'),(104,'By The Way','1508561242.jpg','Musik adalah suatu perwujudan ekspresi jiwa yang tercipta dari imajinasi dan perasaankami. Dari sinilah kami bercerita tentang indahnya persahabatan,kebersamaan persaudaraanserta melewati suka dan duka yang luar biasa.Inilah bentuk kegiatan positif kami,ekspresi kami,wadah dimana kita menuangkankreatifitas,tempat terkumpulnya ide ide kami dan dimana lahirnya karya BYTHEWAY.BYTHEWAY sendiri terbentuk pada tanggal 20 Mei 2016. BYTHEWAY terbentuk dari Dika (Vokal), Gilank (Gitar), Adit (Bass), Rangga (Drum), yang bermula dari persahabatan yangmempunyai cita cita yang sama dalam bermusik. Bersatu bersama­sama mewujudkan mimpiyang selama ini menghantui.Dengan menggunakan nama BYTHEWAY,Kami akan berusaha menciptakan musik dengan gaya BYTHEWAY. Keinginan untuk terus maju dan berkembang,itulah semangat kami.Semoga saja dengan segenap upaya kami,BYTHEWAY dapatmenghasilkan karya yangberkualitas dan menjadi bermanfaat bagi penikmat dan pecinta musik semuanya.','Pop','facebook;instagram;teman;','Yogyakarta',253,'2017-08-12 03:43:12','2017-10-20 20:47:22'),(105,'Drown','1502539252.jpeg','Drown terbentuk di tahun 2015\r\nDengan line up \r\nHasan maulana gitar ,taufik lukmana gitar ,adhi septia gitar,afifur rohman bass,pandu sandhya vokal ,adin hidayat drum drown mengusung konsep antara perpaduan genre postrock dan emotive di blend menjadi satu menjadikan sebuah fresh genre dengan 3 gitaris mengusung unsur reverb,echo dan luapan emosi.\r\nTelah merekam 5 lagu ep bertajuk worthless ditahun 2015 \r\nSeling beberapa waktu kemudian adhi septia memutuskan untuk keluar dari band \r\nDan pada tahun ini kami akan melangsungkan album ke 2 dengan title \"ANOTHER SAD ANTHEMS\"','Rock','facebook;','Surabaya',243,'2017-08-12 04:00:52','2017-08-12 04:00:52'),(106,'ARP','1502540444.JPG','Band reagge asal Yogyakarta yang terbentuk karena personilnya satu kampus semua..\r\nMempunyai single yang berjudul Kera Terbang.','Others','facebook;instagram;teman;','Yogyakarta',254,'2017-08-12 04:20:44','2017-08-12 04:20:44'),(107,'Uncle and The Dogs','1502555396.jpg','Sering manggung di gigs bekasi dan jakarta\r\nSalah satu penampil di jakfair 2017 gambir stage','Others','instagram;teman;','Jakarta',258,'2017-08-12 08:29:56','2017-08-12 08:29:56'),(108,'PARAS','1502557969.jpg','PARAS TERBENTUK PADA TANGGAL 2 JULI 2015 DI DEPOK JAWA BARAT. BERAWAL DARI PERTEMANAN BERMAIN DI RENTAL STUDIO MUSIK. WARNA MUSIK YANG MEREKA USUNG IALAH POP ROMANTICK , DENGAN PENGARUH BAND BAND SEPERTI GOO GOO DOOLS, NOAH, THE CALLING, DEWA 19 HINGGA KANGEN BAND.\r\nSETELAH BERMAIN DARI PANGGUNG KE PANGGUNG AKHIRNYA PARAS MENYELESAIKAN LAGU PERTAMA MEREKA DENGAN JUDUL LAGU \"HAPUS RASA\" MENURUT MEREKA INI MENJADI LAGU PALING DI ANDALKAN DARI BERBAGAI MATERI LAGU YANG MEREKA MILIKI.\r\nPERSONIL PARAS TERDIRI DARI Armand (VOCAL), Vesa ( GITAR), Dio (BASS) Zizi ( RHYTEM GITAR) Faisal (DRUM).\r\n\r\n1.pengisi acara mall to mall (2014 - 2015)\r\n2.wedding to wedding\r\n3.opening band\r\n4.top 40 cafe \r\n5.juara 2 djarum super music id\r\n6.Guest Star kementerian perindustrian (2016 - 2017)\r\n7.Guest Star Perpustakaan nasional indonesia (2016 - 2017)','Pop','informasi_toko;','Jakarta',92,'2017-08-12 09:12:49','2017-08-12 09:12:49'),(109,'Fly To The Moon','1502561877.jpg','Guestar : Dies Nat. SMAN 1 Kertosono 51\r\nPartisipasi di Kediri Clothing Fest 2015\r\nGuestar : Stie Nganjuk 2016\r\nGuestar anniv vw nganjuk 2017','Alternative Rock','facebook;instagram;guitar_plus;','Surabaya',260,'2017-08-12 10:17:57','2017-08-12 10:17:57'),(110,'HEAT','1502598950.jpg','Featured in \"Uprising\" EDM compilation album with original tracks \"Blaze\"','Others','maliq;','Jakarta',83,'2017-08-12 20:35:50','2017-08-12 20:35:50'),(111,'HEAT','1502598971.jpg','Featured in \"Uprising\" EDM compilation album with original tracks \"Blaze\"','Others','maliq;','Jakarta',83,'2017-08-12 20:36:11','2017-08-12 20:36:11'),(112,'Vamos','1502601052.jpg','Perform Jakcloth 2017 pengisi acara,BSD 1000 Band BSD,Pasar Seni Ancol pengisi acara,PRJ event perform at stag pucuk harum.','Pop','facebook;instagram;teman;','Jakarta',213,'2017-08-12 21:10:52','2017-08-12 21:10:52'),(113,'Jeane','1508562014.jpg','Jeane terbentuk pada tanggal 30 Agustus 2016, dan sebetulnya kami sudah saling mengenal satu sama lain sebelum band ini terbentuk, kami sering melakukan jamming bareng mengisi acara pensi-pensi dan festival musik lainnya di kota kami ataupun luar kota, ikutan festival/perlombaan yang alhamdullilah kami pernah menjadi peserta yang layak untuk mendapatkan predikat juara, seperti :\r\n1. Juara 1 OMBUDSMAN lagu cipta anti korupsi\r\n2. Juara 3 Superrawk Bandung Dago\r\n3. Juara 2 Breakpoint Fest.Music\r\n4. Juara 3 Jazzphoria Music','Blues','instagram;','Jakarta',268,'2017-08-13 00:52:24','2017-10-20 21:00:14'),(114,'Red White Band','1502626984.jpg','Red White adalah sebuah band yang terbentuk pada 7 Agustus 2015. Adapun Musik Yang diusung oleh red white adalah  musik ethnic yang dibungkus dengan nuansa alat musik kenusantaraan dan kami ingin menyuarakan hal-hal kebaiakan baik dari segi sosial, cinta, maupun spiritual hakiki yang nantinya kami berharap lewat alunan nada dan lirik lagu-lagu kami akan memberi dampak positif bagi para pendengar musik kami.','Alternative Rock','facebook;instagram;teman;lainnya;','Jakarta',70,'2017-08-13 04:23:04','2017-08-13 04:23:04'),(115,'A dulphy time','1502631834.jpg','Band kami terbentuk pada 2016 tepatnya bulan desember dengan mengusung genre \'rock alternative\' ,beranggotakan 5 personil berasal dari garut dan kami baru menghasilkan 2 single lagu karya kami sendiri','Alternative Rock','instagram;','Jakarta',262,'2017-08-13 05:43:54','2017-08-13 05:43:54'),(116,'Bona & The Rong-rong','1502635797.png','Single on itunes, spotify and Joox','Pop','vipclub;','Jakarta',261,'2017-08-13 06:49:57','2017-08-13 06:49:57'),(117,'B2 Band','1502639679.jpg','Perkenalkan kami band dari kota Majalengka Jawa Barat. yang ingin ikut serta dan mudah mudahan ada rezeqinya dengan adanya band hunt levi\'s ini.\r\n\r\nTerbentuk saat bulan Ramadhan 2017. Dengan personil kawan kawan bermain yang awalnya bukan kawan ngband. Masing masing personil yg awalnya memiliki band sendiri dan dengan memegang alat yang berbeda juga. namun saat masing2 band memiliki kesibukan peribadi maka Billal Akbar atau yg sering di panggil (Bam) mengajak Bombom sebagai vocal, Karena minimnya Vokalis di daerah kami terpaksa bombom yang lihai memainkan gitar dipaksa untuk bernyanyi, untuk memulai lagi perjalanan ngband dikota kami, kemudian bam dan bombom mengajak M. Dadan untuk mengisi gitar utama di band. Karena nada nada dan irama gitarnya yang dirasa cocok untuk sebuah band baru yang akan kami jalani. dimana awalnya tiap personil mempunyai genre yang berbeda. saat kami bingung memulai namun tidak ada penggebuk drum. Lalu Bam mengajak teman sahabat bahkan bisa dibilang guru dalam dunia musik, yaitu Robby Cahyadi yang mahir dan sudah memulai lama di dunia musik. kami ber 4 konsisten dengan genre yang simple namun dapat mengajak dan yang pasti ingin berkarya hasil ciptaan sendiri. setelah terbentuk kami mulai sharing dan mengobrol (musik) agar tau 4 orang ini akan seperti apa musiknya. Mulai memainkan gitar dan bernyanyi semua akhirnya kami mendapatkan nada nada yang easy listening. \r\nDan kami menamai band ini dengan B2 yg bisa di artikan bam&bom, namun tidak dirasa cocok maka diganti makna menjadi Ber Bagi.\r\nAlhamdulillah kami sudah memiliki 6 konsep lagu ciptaan dan yang pertama sudah kami buat demo di home studio record. dengan alat dan mixing yang apa adanya. meskipun kami tau masih banyak kekurangan karena drum yang kita gunkaan adalah midi. dan masih banyak yang kurang. namun kami jadikan itu sebagai demo untuk acar Levi\'s Band Hunt 2017 ini.\r\nsemoga kami dapat memberi dan membuat orang yang mendengarnya suka dengan karya kami.\r\n\r\nprestasi yang band B2 dapat untuk saat ini masih belum ada. karena kami masih baru terbentuk, belum ada event dikota atau daerah kita yang harus di ikuti. Namun tiap tiap personil pernah mendapat prestasi di band dahulunya.\r\n\r\nsekian cerita singkat dari kami. tidak ada yang istimewa namun semoga juri dan pihak terkait di Levi\'s Band Hunt 2017 ini senang dan suka dengan musik kami.. Aminn','Pop','facebook;','Jakarta',226,'2017-08-13 07:54:39','2017-08-13 07:54:39'),(118,'CHORD','1502689661.jpg','GROUP BAND YANG TERBENTUK PADA TAHUN 2014 DI PURWAKARTA INI , BERLATAR BELAKANG BERMACAM GENRE MUSIK YANG DI USUNG PARA PERSONIL.\r\n\r\nSEIRING KESERIUSAN PERSONIL UNTUK MENGEMBANGKAN CHORD BAND , MEREKA MENSEPAKATI GENRE MUSIK POP MODERN YANG AKAN DI USUNG CHORD BAND PADA INDUSTRI MUSIK INDONESIA.\r\n\r\nMULAI DARI PANGGUNG KE PANGGUNG ,KOMPETISI , CAFE KE CAFE CHORD BAND SUDAH LALUI DAN SAMPAI SAAT INI SUDAH ADA BEBERAPA LAGU YANG DI CIPTAKAN.\r\n\r\nCHORD BAND DIGAWANGI LIMA (5) ANAK MUDA BERBAKAT DAN BERPOTENSI DI DUNIA MUSIK (ABRAHAM – VOCAL , WISNU – GITAR 1 , ERWIN - GITAR 2 , BADIES – BASS , CALVIN – KEYBOARD ) .\r\n\r\n“ IMPIAN “ ADALAH NAMA ALBUM PERDANA CHORD BAND SEBAGAI LANGKAH TEPAT UNTUK BERADA DI JALUR INDUSTRI MUSIK INDONESIA. \r\n\r\nCHORD BAND SANGATLAH SIAP UNTUK MENGIBARKAN KARYA NYA DI INDUSTRI MUSIK INDONESIA , DENGAN HARAPAN KARYANYA BISA DI TERIMA DI MASYARAKAT SERTA BISA MEMBAWA ARAH POSITIVE UNTUK KEMAJUAN INDUSTRI MUSIK INDONESIA.\r\n\r\nMORE INFORMATION \r\nInstagram   	: Chord_Band      	Instagram   		: Creative_Musikindo  \r\nFacebook 	: Chord Band        Facebook 		: Creative Musikindo  \r\nTwitter  	: @Band_Chord      Twitter  		: @Creative_Musikindo\r\n\r\n\r\nOUR PERFORMANCE / DISCOGRAPHY RELEASE\r\n-	GEBYAR UNDIAN PANEN HADIAH BRI PURWAKARTA\r\n-	PEMUTARAN SERENTAK RADIO SE- INDONESIA , MALAYSIA & BRUNEI DARUSALAM  HITS SINGLE CHORD “ YANG PERTAMA “\r\n-	RELEASE HITS SINGLE CHORD “ YANG PERTAMA “ SOUNDTACK INFOTAINMENT EXPOSE & SELEBRITA TRANS7\r\n-	RELEASE 2nd SINGLE CHORD “ AKU YANG SAKIT “ DI RADIO-RADIO SE-INDONESIA\r\n-	PURWAKARTA NGANPLAG\r\n-	WEEKEND MUSIC – PLAZA AREA MALL KARAWANG CENTRAL PLAZA\r\n-	JAK INDIE PRO – PANTAI KARNAVAL ANCOL – JAKARTA\r\n-	INDOMUSICALLY – LA PIAZZA KELAPA GADING – JAKARTA\r\n-	SOUND OF TRI – SERANG PROV.BANTEN\r\n-	WEEKEND KOTA TUA – MUSEUM FATAHILA – JAKARTA\r\n-	ON AIR PROGRAM MUSIC ZONE “ KEMUNING TV “\r\n-	ON AIR SPESIAL TALKSHOW BANTEN RADIO\r\n-	SUBANG RAMADHAN FAIR 2017\r\n-	PEKAN RAYA JAKARTA / JAKARTA FAIR KEMAYORAN 2017\r\n-	LEBARAN FESTIVAL – PANTAI KARNAVAL ANCOL – JAKARTA\r\n-	DAN MASIH BANYAK LAGI OFF / ON AIR CHORD','Pop','facebook;instagram;','Jakarta',264,'2017-08-13 21:47:41','2017-08-13 21:47:41'),(119,'ZYTHUS','1502690995.jpg','ZYTHUS diambil dari nama dewa \"ZETHUS\" (Dewa penggembala), kami proyeksikan ke musik sesuai dengan karakter PENGGEMBALA yang memanjakan hewan gembalaannya, berharap musik kami bisa memanjakan pendengar musik ZYTHUS.\r\nPrestasi berkesan untuk kami adalah masuk 10 Besar FInalis A Mild Soundrenalin daerah Yogyakarta tahun 2012 dan beberapa kali mengisi Dies Natalis kampus yang ada di Yogyakarta.','Pop','teman;','Yogyakarta',278,'2017-08-13 22:09:55','2017-08-13 22:09:55'),(120,'jou barakati','1502696449.JPG','JOU BARAKATI - \r\n\r\nM.Irsyad (ex Moiss, ex Warehouse), Lazuardi Rifki (Sugar Bitter), Dimas Sadewa (Sugar Bitter), Hari Candra (ex Moiss) Erwin Handoko (ex UKLunch) yang tergabung dalam grup musik psychedelic-rock asal Semarang, Jou Barakati, telah melepas single perdana berjudul “My Uniform and Super Close Buddy”. Lagu yang menjadi draf dalam penggarapan album untuk project tahun ini sudah dapat dinikmati di kanal youtube \'Elok Nada Grup\'\r\n\r\nDalam pers rilisnya, Jou Barakati menjelaskan “My Uniform and Super Close Buddy” mengulas tema romansa remaja yang dikemas dengan lantunan psychedelic-rock ala bohemian. Sebuah pengalaman pribadi Lazuardi Rifki yang memiliki hubungan eksentrik dengan dara manis, membawa penembang berkhotbah melalui tulisannya. Dentum ketukan yang tidak lambat maupun cepat dan harmoni melodi yang lembut membangun nuansa dalam spektrum kebahagiaan dan kegusaran mewarnai kehidupan, bahkan penyesalan. Buaian suara flute di akhir lagu yang menjadi klimaks menuntun pendengar ikut mengobservasi inti cerita di lagu ini.\r\n\r\nDidalangi oleh Tommy Saputra (manajer Holy Baby Horny), yang tumbuh kembang di skena musik metal Semarang, ingin memulai sebuah eksperimen baru. Dengan keberhasilan Holy Baby Horny merilis … album dan melangsungkan tour, Tommy yang akrab disapa Tomek, ingin memproklamirkan band baru dengan musikalitas yang kontras dengan sebelumnya. Tidak menunggu waktu lama bergabunglah personil lengkap Jou Barakati yang cukup dibilang berpengalaman di dunia musik, khususnya Semarang. Dengan menyajikan nuansa musik gelap wewangian psychedelic rock ala bohemian yang dapat dinikmati oleh orang banyak.\r\n\r\n\r\n\r\n\r\n“My Uniform and Super Close Buddy”\r\n “cliche” mungkin adalah kata yang tepat untuk menggambarkan suatu lagu yang bertemakan romansa. Yang membedakan\r\nadalah dari pendekatan yang digunakan, baik secara musikal maupun sudut pandang\r\nyang “tidak biasa”. Seperti JOU BARAKATI, sebuah band psychedelic-rock ala\r\nbohemian asal Semarang yang baru saja merilis single perdana berjudul “My Uniform and Super\r\nClose Buddy”. Dan ini lagu cinta yang tidak biasa-biasa saja,  \r\n\r\nDalam single “My Uniform and Super Close Buddy”, JOU BARAKATI mengulas tema romansa remaja\r\nyang dikemas dalam lantunan psychedelic rock ala Bohemian. Sebuah pengalaman pribadi seseorang\r\nyang memiliki hubungan eksentrik perempuan, membawanya ber-”khotbah” melalui tulisannya. Dentuman\r\nketukan yang tidak lambat maupun cepat, serta harmoni melodi yang lembut membangun nuansa dalam\r\nspektrum kebahagiaan dan kegusaran yang telah mewarnai kehidupan. Buaian suara flut diakhir lagu\r\nyang menjadi klimaks menuntun pendengar ikut mengobservasi inti cerita dilagu ini.\r\n\r\nProses pengerjaan single ini sangat sederhana, pada bulan April lalu pengerjaan lagu ini dilakukan sendiri.\r\nSingle lagu “My Uniform and Super Close Buddy” dioperatori oleh personilnya sendiri,\r\n\r\n\r\n\r\nTembang-tembang romantis yang berlalu lalang mendongengkan keindahan patah hati.\r\nSetuju, sangat “cliche”.\r\n Joubarakati pun setuju, band psychedelic ala bohemian asal Semarang ini secara explisit \r\nmenggambarkan betapa romansa itu sangatlah luas. Suasana 70an, dengan menambah vibe statis ala undersubstanced hippies\r\n \r\n\r\nterangkum manis dalam balutan lagu berjudul “My Uniform and Super\r\nClose Buddy”.','Rock','instagram;informasi_toko;guitar_plus;poster;teman;lainnya;','Yogyakarta',219,'2017-08-13 23:40:49','2017-08-13 23:40:49'),(121,'jou barakati','1502696491.JPG','JOU BARAKATI - \r\n\r\nM.Irsyad (ex Moiss, ex Warehouse), Lazuardi Rifki (Sugar Bitter), Dimas Sadewa (Sugar Bitter), Hari Candra (ex Moiss) Erwin Handoko (ex UKLunch) yang tergabung dalam grup musik psychedelic-rock asal Semarang, Jou Barakati, telah melepas single perdana berjudul “My Uniform and Super Close Buddy”. Lagu yang menjadi draf dalam penggarapan album untuk project tahun ini sudah dapat dinikmati di kanal youtube \'Elok Nada Grup\'\r\n\r\nDalam pers rilisnya, Jou Barakati menjelaskan “My Uniform and Super Close Buddy” mengulas tema romansa remaja yang dikemas dengan lantunan psychedelic-rock ala bohemian. Sebuah pengalaman pribadi Lazuardi Rifki yang memiliki hubungan eksentrik dengan dara manis, membawa penembang berkhotbah melalui tulisannya. Dentum ketukan yang tidak lambat maupun cepat dan harmoni melodi yang lembut membangun nuansa dalam spektrum kebahagiaan dan kegusaran mewarnai kehidupan, bahkan penyesalan. Buaian suara flute di akhir lagu yang menjadi klimaks menuntun pendengar ikut mengobservasi inti cerita di lagu ini.\r\n\r\nDidalangi oleh Tommy Saputra (manajer Holy Baby Horny), yang tumbuh kembang di skena musik metal Semarang, ingin memulai sebuah eksperimen baru. Dengan keberhasilan Holy Baby Horny merilis … album dan melangsungkan tour, Tommy yang akrab disapa Tomek, ingin memproklamirkan band baru dengan musikalitas yang kontras dengan sebelumnya. Tidak menunggu waktu lama bergabunglah personil