d continue on without Rizal Firdaus, Reza Maulana took his place as lead guitar, and the band re-arranged their songs to be played for one guitar. \r\nWith the new four-member formation, the band released the single \"Kejarlah\" on July 17, 2015.In November 2015 Reza Maulana asked Paulus Perkasa, who was their friend in school to join as Rythm Guitarist . and now Arashi Je composed by the new five member formation . ARASHI JE\'s basic influences were One Ok Rock and Another Japanese Rock Band.','Rock','instagram;','Jakarta',314,'2017-08-15 02:06:04','2017-08-15 02:06:04'),(138,'AWARENESS','1502811787.JPG','AWARENESS adalah band bergenre Pop Punk asal Padang yg terbentuk pada 26 Juni 2014 dengan formasi awal yaitu Iqbal ( Guitar/Vocal ), Adhit ( Bass/Vocal ) dan Haris ( Drum ). Formasi ini kemudian berubah setelah Erin bergabung dan mengisi bagian Vocal untuk AWARENESS pada Februari 2015.\r\n\r\nSampai saat ini Awareness sendiri sedang dalam proses penggarapan album perdananya dan mempersiapkan sebuah tour. \r\nSelama bermusik, Awareness telah perform di event-event bergengsi nasional. Lagu Awareness juga memasuki kompilasi yang bersifat nasional mewakili Kota Padang seperti Record Store Day Indonesia, Andalas Lima Sore, dll.','Others','instagram;','Jakarta',324,'2017-08-15 07:43:07','2017-08-15 07:43:07'),(139,'Dewantara rock','1502811965.jpg','Dewantara rock terbentuk pada tanggal 23 mei 2014, beranggotakan empat orang, windi(vokal),ceria (gitar), iyan (drum), widi(bassis), fajar (ed.keybordis)\r\n\r\nprestasi:\r\njuara 1 dalam festival band yang di adakan oleh gudang garam dan menjadi     opening dari MAHADEWA, GEISHA, dan CAPTAIN JACK\r\njuara 1 dalam acara festival akustik yang di adakan oleh yamaha','Rock','facebook;instagram;informasi_toko;vipclub;guitar_plus;umi;maliq;poster;teman;lainnya;','Yogyakarta',320,'2017-08-15 07:46:05','2017-08-15 07:46:05'),(140,'Sudden Supper','1502812715.JPG','Sudden Supper adalah band alternative rock dari Yogyakarta yang terbentuk pada tanggal 13 November 2016 beranggotakan 4 (empat) orang personil. Sampai saat ini Sudden Supper sudah memiliki 5 (lima) buah lagu diantaranya:\r\n1. Rendezvous\r\n2. Say Won\'t\r\n3. Drowning\r\n4. Cute Poison\r\n5. I Wish I Could Agree On What People......\r\nNama Sudden Supper memiliki makna dari latar belakang musik masing-masing personilnya yang berbeda-beda dan pada awalnya terbentuk secara tiba-tiba (Sudden), dan Supper yang bermakna \"Jamuan setelah makan malam\" yang juga selalu disajkan secara tiba-tiba namun selalu bisa dinikmati. Musik dari Sudden Supper sendiri banyak terinspirasi dari band-band seperti Nirvana, Foo Fighters, Radiohead, Green Day, dan banyak band-band alternative rock lainnya. Sementara ini, dari lima lagu, baru satu lagu yang sudah direkam dan bisa didengarkan di digital stores, yaitu \"Rendezvous\" dan rencananya dalam waktu dekat ini Sudden Supper akan menggarap mini album.','Alternative Rock','facebook;','Yogyakarta',279,'2017-08-15 07:58:35','2017-08-15 07:58:35'),(141,'GEMURUH','1502832388.jpg','Beberapa event/gigs terbaru :\r\n\r\n- Radio interview at demajors radio\r\n- Rock Show Gigs by dapurletter\r\n- SoundsAtion \"Hore Ho of Rock\" at Taman Ismail Marzuki, Cikini\r\n- Opening band at Jikunsprain Album Release Party, Borneo Beerhouse\r\n- The Rock Campus (Episode 88) at Lost & Found, Kemang','Rock','teman;','Jakarta',299,'2017-08-15 13:26:28','2017-08-15 13:26:28'),(142,'magnesence','1502857676.jpg','2017\r\n- D\'RAPTORS BROTHERS Family Day 2017 : Performer\r\n- Gambir Stage - Jakarta Fair Expo 2017 : Featuring Performer\r\n- CARDINAL Stage Of Soul - Jakarta Fair Expo 2017 : Featuring Performer\r\n- HAI Day 2017 : Performer\r\n- ROCKOSTRAD - Musik Bersatu @ ZENI KOSTRAD - Srengseng Sawah : Performer\r\n- FAMILY MINI CONCERT Part 2 by 101% Music Community : Performer\r\n- Magnesence on air - RRI PRO-2 105 FM - Jakarta : Performer\r\n- FAMILY MINI CONCERT Part 1 by 101% Music Community : Performer\r\n- CARDINAL Present: 