 Stage : Featuring Performer','Pop','facebook;instagram;informasi_toko;teman;','Jakarta',330,'2017-08-15 20:27:56','2017-08-15 20:27:56'),(143,'The Armstrong Band','1502863894.jpg','The Armstrong adalah sebuah band beraliran pop punk yang terbentuk pada tahun 2009 di Bandung. Band ini terdiri dari 3 orang personil yaitu Junto (gitar&vokal), Erik (drum), Roy (gitar) dan seorang additional untuk bermain bass. Sebenarnya masing masing personil berteman sudah sejak lama, sudah sering bermain bersama, karena memang lahir dari komunitas yang sama pula. Tapi pada tahun 2009 kebetulan diadakan sebuah acara musik yang membuat mereka sepakat untuk sama sama membentuk band.\r\n\r\nBeberapa prestasi :\r\n\r\n2010 - Juara 1 Lomba Video Band dari LG\r\nhttp://thearmstrongband.blogspot.co.id/2010/09/sasarengan-nambih-seru-pisan-euy-lg.html\r\n\r\n2011 - Masuk Kompilasi Pop Is Dead III\r\nhttps://mindblasting.wordpress.com/2011/12/31/pop-is-dead-iii/\r\n\r\n2012 - Masuk Kompilasi Flowers City Fresh rilisan dari Komunitas Akustik / Ariesco Music Studio.','Alternative Rock','guitar_plus;','Jakarta',332,'2017-08-15 22:11:34','2017-08-15 22:11:34'),(144,'Visual Dream Band','1508562587.jpg','Visual Dream Band terbentuk di Tangerang pada 27 April 2010 dengan genre Pop Rock di Tangerang yang beranggotakan :\r\nVokalis	: Anata\r\nGitaris	: Jeffry\r\nBassist	: Bily\r\nDrumer	: Steven\r\nAwal mulanya kami membentuk band untuk mengcover lagu-lagu dari Band Jepang seperti L’arc en ciel dan beberapa lagu Ost.Anime lainnya hanya untuk mengikuti beberapa event musik seperti pensi SMA / kampus dan Festival band.\r\nKami juga pernah mendapatkan juara di beberapa festival band, namun bukan itu saja yang kami inginkan, Sebab seiring berjalannya waktu, kami menciptakan karya yang tentunya agar dapat diterima kalangan masyarakat luas.\r\n\r\nPrestasi :\r\n-	Juara 1 Festival Band di Kalideres, 2014\r\n-	Juara 2 Festival Band UNAS, 2015\r\n-	Juara 1 Festival Band di Jatiuwung, 2015\r\n-	Juara 1 Festival Band UNJ, Jiyuu Matsuri 2016\r\n-	Juara 1 Festival Band Animaku No Hibi di Ramayana Bogor, 2016','Rock','guitar_plus;','Jakarta',334,'2017-08-15 22:13:32','2017-10-20 21:09:47'),(145,'Self confidence band','1502864421.jpg','Kami berasal dari kota makassar\r\nTerdiri dari 4 personil\r\nKami merintih di dunia musik sudah 7 tahun \r\nPrestasi alhamdulillah\r\nKami pernah juara satu festival musik yg di adakan oleh telkomsel\r\nSaat itu festival ajang pencarian bakan lagu ciptaan\r\nBand kami jadi juara satu\r\nLagu kami juga sudah berapa kali top chart pertama di radio2 musik di makassar','Pop','guitar_plus;teman;','Jakarta',335,'2017-08-15 22:20:22','2017-08-15 22:20:22'),(146,'HEROES PARTY','1502867710.jpeg','Kita Heroes party Band yg berasal dari tangerang ingin mengungkapkan apa yg kita alamai selama ini melalu pesan sebuah nada untuk kalian semua','Heavy Metal','guitar_plus;teman;','Jakarta',339,'2017-08-15 23:15:10','2017-08-15 23:15:10'),(147,'ACEMOJO','1502868037.jpg','Acemojo, band yang berasal dari kota Solo ini mencoba peruntungan baru dalam dunia musik di Indonesia. Band yang pada awalnya bernama The Brown ini merilis lagu single yang menjadi andalan sekaligus gebrakan baru yang bertajuk “After The Rain”. Lagu ini bercerita tentang dampak hebat dalam perubahan baru dan sedikit menyinggung cerita tentang keadaan band yang sempat berganti-ganti personil hingga sepakat mengganti nama menjadi “Acemojo” yang dimana para personil memiliki harapan yang besar untuk memiliki nasib baru dan lebih baik. Single “After The Rain” ini memiliki makna dimana munculnya pelangi sebagai simbol dan pelengkap keindahan setelah turunnya hujan deras, juga membawa suasana yang bersemangat untuk kita bergerak. \r\n\r\nkami pernah terlibat dalam beberapa gigs komunitas, beberapa dalam panggung seni, serta yang terakhir kami terlibat dalam Kompilasi Warningmagz vol.1\r\n\r\nkami juga selalu mendokumentasikan live act kami, dan kami upload via youtube kami ACEMOJO serta Instagram Acemojo','Rock','guitar_plus;teman;','Yogyakarta',340,'2017-08-15 23:20:37','2017-08-15 23:20:37'),(148,'The Hoodie','1502870229.jpg','The Hoodie merupakan grup rock asal Bogor yang dibentuk oleh Alfian (Gitar), Alwan (Gitar), Fakih (Vokal), Yugi (Bass), dan Adrie (Drum). The Hoodie banyak terpengaruh oleh sound band rock/bluesrock 70-an yang mengandalkan distorsi, beat yang cepat, dan harmoni. Nama-nama seperti Deep Purple, Led Zeppelin, Black Sabbath merupakan beberapa band yang mempengaruhi musikalitas The Hoodie.','Rock','instagram;','Jakarta',347,'2017-08-15 23:57:09','2017-08-15 23:57:09'),(149,'Classroom','1502871239.jpg','Alternative rock with influence Nirvana, Foo Fighters, Red Hot Chili Peppers, Alice in Chain, Rage Against The Machine, Muse, Bee Gees, Audio Slave, Led Zepellin, Guns n Roses, Black Flag and kind some out of the box music genre like Kvelertak and many more.....\r\n\r\nWe have 5 songs material that already package in EP album in 2015. Walk in independent movement and just do everything we love.....\r\n\r\nWhy we are join The Levi\'s Band Hunt?\r\nIt\'s passion no commercial needed.....','Alternative Rock','instagram;','Jakarta',348,'2017-08-16 00:13:59','2017-08-16 00:13:59'),(150,'Ramses and The Experiences','1502872101.jpg','Juara 3 Galaxee SMP PJ 2008\r\nBest Guest Star and Featuring band on Monster Invation Management, Tebet','Blues','guitar_plus;','Jakarta',346,'2017-08-16 00:28:21','2017-08-16 00:28:21'),(151,'At Night','1502876214.jpg','Terbentuk tahun 2005 di sebuah kota kecil Magelang','Alternative Rock','instagram;umi;','Yogyakarta',353,'2017-08-16 01:36:55','2017-08-16 01:36:55'),(152,'paginancerah','1502877379.jpg','paginancerah berasal dari Bandar Lampung\r\n9 june 2004\r\nsaat ini sedang melakukan proses album','Rock','teman;','Jakarta',362,'2017-08-16 01:56:19','2017-08-16 01:56:19'),(153,'Halus Lembut','1502879810.jpg','Band ini terbentuk tanggal 8 Agustus tahun 2014. Beranggotakan Zulaika Nafira pada vocal, Xander Ongko sebagai pencipta lagu, backing vocal dan lead guitar, dan Julian Patty pada drum. Lagu pertama Halus lembut berjudul \"Kapal Miring\" dijadwalkan untuk dirilis di Youtube pada pertengahan September 2017. Debut panggung mereka dapat disaksikan di akun Youtube mereka: Official Halus Lembut yang menampilkan performa mereka membawakan lagu-lagu ciptaan merek sendiri pada acara Jakarta Fair 2017 di panggung gambir.','Pop','guitar_plus;','Jakarta',365,'2017-08-16 02:36:50','2017-08-16 02:36:50'),(154,'PAREIDLOIA','1502883519.jpeg','Terbentuk di akhir tahun 2012 dengan mengusung musik pembaruan dalam ranah indie pop dengan nuansa new wave dibalut lik gitar tremolo dan nuansa elemnt elktornik.','Others','instagram;','Jakarta',355,'2017-08-16 03:38:39','2017-08-16 03:38:39'),(155,'noisereverse','1502887202.jpg','Band yg terbentuk di bandung 2013, kami belum mempunyai prestasi tapi mempunyai banyak karya yg belum di apresiasi.','Pop','instagram;guitar_plus;','Jakarta',366,'2017-08-16 04:40:02','2017-08-16 04:40:02'),(156,'Sinleto','1502888231.jpg','SINLETO, band dari Surabaya yang telah merilis mini album bertitle \'Seroja\', yang dirilis pada tanggal 1 januari 2017','Alternative Rock','instagram;','Surabaya',369,'2017-08-16 04:57:11','2017-08-16 04:57:11'),(157,'Glowing butterfly','1502890761.jpg','Glowing butterfly adalah band yang berasal dari Banjarmasin / Kalimantan selatan yang berdiri pada 20 Agustus 2013. Band ini terbentuk dari Anak – anak pemusik pencinta musik Japanese,Dengan mengusung genre Japanese rock.\r\n	Dan kami sering mengisi acara – acara musik di Banjarmasin / banjarbaru. Selain mengikuti lomba-lomba band. Glowing butterfly Jugasering menjadi Guest star pada event-event Jepang Festival yang sering di adakan di kota Banjarmasin dan sekitarnya.\r\n\r\nPrestasi yg sudah di gapai	 ;\r\n-	JUARA 1 JAPANESE FESTIVAL BAND SMA 3 ( 2013 )\r\n-	JUARA 1 JAPANESE FESTIVAL BAND SMAVEN 7 ( 2013 )\r\n-	JUARA 1 JAPANESE FESTIVAL ANIME GATERING ( Banjarbaru )\r\n-	JUARA 2 JAPANESE FESTIVAL BAND SMAVEN 7 ( 2015 )\r\n-	GUEST STAR EVENT JAPAN MUSIC PARTY ( 2015 )\r\n-	GUEST STAR EVENT HIKARI COSWALK COMPETITION  ( 2016 )\r\n-	 GUEST STAR EVENT HANAMI MATSURI “ KIREI NO SAKURA “ ( 2016 )','Rock','guitar_plus;','Surabaya',381,'2017-08-16 05:39:21','2017-08-16 05:39:21'),(158,'Blackstone29','1502891239.jpg','BlackStone29 banyak dipengaruhi oleh band-band rock seperti Guns & Roses, Metallica, Alter Bridge dan masih banyak lagi. Setelah dua tahun berdiri BlackStone29 merekam beberapa lagu, diantaranya Kota Istimewa, Melayang dan Untuk Vokasi yang dijadikan sebagai anthem Sekolah Vokasi Universitas Gadjah Mada.','Rock','instagram;','Yogyakarta',108,'2017-08-16 05:47:19','2017-08-16 05:47:19'),(159,'Jackfruitband','1502892735.jpg','Didasari oleh persahabatan lima pemuda dari masa sekolah yang kemudian diperkaya oleh kecintaan mereka terhadap musik, Jackfruitband tumbuh menjadi kelompok musik yang kompak, harmonis, dan kuat.\r\n\r\nDipimpin oleh Camille Secioria, putra sulung dari Elfa Secioria, salah satu maestro musik Indonesia. Dengan arahan langsung dari sang maestro, Jackfruitband telah terbiasa berlatih, secara grup maupun personal untuk membawakan karya-karya yang unik dan menantang sejak dini. Khususnya berbagai lagu dengan genre Latin, Jazz, dan Blues.\r\n\r\nDisamping Elfa Secioria, musisi-musisi besar yang ikut membentuk Jackfruitband, Stevie Wonder, Michael Jackson, Jamiroquai, Incognito dan Earth Wind and Fire, juga menginspirasi komposisi karya-karya Jackfruitband.\r\n\r\nJackfruitband digawangi oleh Camille (drums), Cavell (keys), Gilang (guitars), Robby (bass) dan Farlan (vocals), selama kurang lebih 1 dekade bermusik bersama-sama, Jackfruitband telah merilis satu mini album (EP) yang berjudul “We Are Here” berisikan 6 lagu; Dancing Tonight, Oasis Song, Simple Whisper, Happy Life, It Just Got To Be You dan We Are Here, yang dirilis dalam bentuk digital (iTunes, Spotify, Soundcloud, Youtube, dll.)  dan CD fisik pada tahun 2015.\r\n\r\nJackfruitband sendiri telah aktif mengikuti beberapa ajang atau festival musik di Indonesia, dari tingkat nasional dan Internasional seperti Bekasi Jazz Festival, Margo Friday Jazz, TP Jazz Bandung Festival, Java Jazz Festival, dll.','Jazz','instagram;','Jakarta',382,'2017-08-16 06:12:15','2017-08-16 06:12:15'),(160,'THE YOUNGSTERS','1502893378.jpg','THE YOUNGSTERS berasal dari kota Nganjuk Jawa Timur, berdiri pada bulan september 2015 lalu beranggotakan tiga orang yaitu Yogi ( Vocalist + Guitarist), Aldi (Bassist) dan Shandy (Drummer). \r\nKami sudah lama berkarya dan berkecimpung dalam dunia musik sejak awal SMA sampai sekarang. Banyak karya lagu yang kami ciptakan salah satunya \" I\'m sorry \" yang menjadi lagu andalan kami yaitu perpaduan antara musik rock dan electric.\r\nMeskipun kami sudah memiliki banyak lagu, namun terasa percuma karena kota kelahiran kami sendiri kurang memperhatikan bakat dan kreativitas para kaula muda. Tidak ada wadah bagi band indie untuk bisa berapresiasi.\r\nSatu - satunya cara untuk sedikit mengobati kekecewaan itu yaitu kami selalu mengupload lagu ke reverbnation, youtube dan soundcloud yang sudah kami kerjakan dengan sederhana melalui komputer.\r\nDengan adanya LEVI\'S BAND HUNT kami sangat terdorong untuk mengikutinya. Andai saja kami tidak lolos seleksi kami akan berlapang dada dan berkarya lebih baik lagi karena dengan adanya LEVI\'S BAND HUNT yang sangat mendukung band dengan lagu ciptaan sendiri dan mendukung semua genre bisa membuat band indie semakin bersemangat untuk selalu berkarya.','Alternative Rock','instagram;','Surabaya',374,'2017-08-16 06:22:58','2017-08-16 06:22:58'),(161,'foxteen','1502894702.jpeg','Foxteen is a band formed by college mates.\r\nThe name itself is a joint form of some words,\r\nwhich are FOX (acronym for Freedom Of\r\nXoul; freedom of soul, freedom in artistic\r\nworks and freedom in musical expressions)\r\nand Teen (refers to the members of the band,\r\nwhich have dragged into music since they\r\nwere teenagers).\r\nFoxteen offers alternative rock genre,\r\nestablished in 2007 with a few changing of\r\nthe members. As the time goes by, in 2012\r\nmembers\r\nwe tried to renew our appearances, song\r\narrangements, packaging and the members’\r\ncharacter. The story goes on since then','Alternative Rock','guitar_plus;','Jakarta',372,'2017-08-16 06:45:02','2017-08-16 06:45:02'),(162,'SHAL','1502895018.jpg','SHAL band adalah singkatan dari See, Hear and Feel, di adopsi dari\r\nbahasa inggris yang erarti “Lihat, dengar dan rasakan”.\r\n\r\nJauh Sebelumnya, cikal bakal SHAL dimulai oleh teman satu sekolahan yakni\r\nFira, Ragil, Firman, Abdy, & Iqbal, band yang sebatas perform di studio dan meng-cover\r\nlagu dari band-band ternama. Setelah beberapa bulan kemudian mereka mencoba\r\nikut tampil di beberapa kompetisi band, Setahun berselang setelah SHAL\r\nterbentuk, mereka Vakum karena terbentur oleh kesibukan akademik mereka.\r\n Dan Setahun kemudian, SHAL kembali dan mencari drumer baru. Fahrul yang\r\nmasih teman satu sekolah, terjun menggantikan Iqbal.  Saat itu mereka sepakat untuk\r\nmerapatkan barisan, lalu memutuskan mengganti nama band mereka  dengan nama SHAL\r\ndan meresmikan tanggal 01 Agustus 2012 sebagai hari terbentuknya SHAL band.\r\n\r\nSelama Dua tahun lebih, mereka telah banyak melaui suka duka\r\ndan seiring waktu sang Vocalist (Fira) sudah tidak punya waktu luang untuk band mereka,\r\nlalu mereka sepakat untuk merekrut Vocalist baru dan sejak itu beberapa nama telah tercatat\r\ndalam history SHAL band, yang tak terpungkiri mereka (Fira, Ryta, Alwi, Cimy & Fadel)\r\ntelah menorehkan banyak prestasi untuk SHAL band.\r\n\r\nSejak terbentuk, SHAL telah menjajal berbagai  panggung kompetisi band dan di tahun 2015,\r\nmereka memutuskan untuk maju di jalur Indie band dan merekrut Vocalist baru “Emen”.\r\n\r\n* * *\r\n\r\nTerbentuk :\r\n01 Agustus 2012\r\n\r\nMember :\r\nEmen\r\nRagil\r\nFirman\r\nFahrul\r\n\r\nGenre :\r\nEasycore Synth\r\nElectronic Rock\r\n\r\nSosial Media :\r\nInstagram :  @shal.band | Twitter :  @shal_band | Facebook :  shal band\r\n\r\nLink lagu ciptaan :\r\nwww.soundcloud.com/shalofficial\r\nwww.youtube.com/shalofficial\r\n\r\nAlamat :\r\nJl Abd Rasyid Dg Lurang No 4b / Sungguminasa / Gowa / Makassar / Sulawesi Selatan / Indonesia\r\n\r\nContact Us :\r\n0853 9444 6266\r\nsheehearfeel@gmail.com','Others','instagram;','Jakarta',329,'2017-08-16 06:50:18','2017-08-16 06:50:18'),(163,'Sparkle','1502897691.jpg','1. JUARA HARAPAN I FESTIVAL BAND REMAJA GRJP\r\n2. JUARA 4 FESTIVAL INDIEMUSIC SPEEDYTREK\r\n3. JUARA 2 FESTIVAL KARANG TARUNA DKI JAKARTA\r\n4. JUARA II A MILD LIVE BAND COMMUNITY','Pop','facebook;teman;','Jakarta',386,'2017-08-16 07:34:51','2017-08-16 07:34:51'),(164,'Oursoul','1502899352.jpg','Juara 1 rapper medan di jl. Ringroad','Hip Hop','guitar_plus;','Jakarta',385,'2017-08-16 08:02:32','2017-08-16 08:02:32'),(165,'Fatman','1502903255.jpg','Fatman is a Punk Rock band from Bandar Lampung city, Lampung, Indonesia since 2009. Fatman consist of Luthfi Satria (Vocal+Guitar) Dwi Prakoso (Bass+ Vocal) and Adam Aldino (Drum)','Others','instagram;','Jakarta',390,'2017-08-16 09:07:35','2017-08-16 09:07:35'),(166,'SABI','1502905407.jpg','Sebuah kelompok musik beraliran alternative rock yang berasal dari Kota Pekanbaru Provinsi Riau Indonesia ini telah berdiri sejak desember 2011, dan pernah mengikuti berbagai kompetisi di tingkat lokal, nasional, dan internasional.','Alternative Rock','instagram;','Medan',384,'2017-08-16 09:43:27','2017-08-16 09:43:27'),(167,'SIX','1502909301.JPG','Six band asal Bandar Lampung yang terbentuk di tahun 2012 awal.\r\n\r\nPrestasi :\r\n- juara 1 festival music blast out djarum super 2012\r\n- juara 2 festival musik natar 2013\r\n- juara 2 festival musik tapis evolution 2017','Alternative Rock','guitar_plus;','Jakarta',393,'2017-08-16 10:48:21','2017-08-16 10:48:21'),(168,'HIPTODAY!','1502909389.jpg','“ HIPTODAY!\" adalah sebuah band RapRock yang berasal dari kota Kupang, Nusa Tenggara Timur, yang kini berdomisili di Bandung.  \r\nTerbentuk pada tanggal 22 maret 2015. HIPTODAY! Terdiri dari : Big V (mc rap) , Jio (lead vocal), Eman (gitaris), Fandi DonJ (drummer) dan Yozhy (synthesizer).\r\nSejauh ini, HIPTODAY! Sudah berhasil menghasilkan sebuah EP perdana dengan tajuk EXPLORASI. Album EP ini juga sudah tersebar di beberapa digital store seperti Spotify, Itunes, dll, dan juga 2 buah video klip “EXPLORASI” dan “SIKSA DOSIS TINGGI”\r\n        Berikut panggung dan beberapa prestasi yang sudah didapatkan oleh HIPTODAY!\r\n1.	Juara 1 dalam kompetisi GoAheadPeople NTT “Road To Soundrenaline 2015” dan mendapatkan kesempatan untuk bermain di welcoming stage Soundrenaline di tahun 2015.\r\n2.	Manggung di beberapa panggung GoAheadPeople di NTT\r\n3.	Menjadi Opening stage beberapa musisi nasional seperti Judika, J-rocks, Mario Klau\r\n4.	Menjadi Guest star di acara :\r\na.	Road To Soundrenaline 2016\r\nb.	CrossBorder 2016\r\nc.	BNN hari anti narkoba 2016\r\nd.	Mega Amplification in Timor Leste 2016\r\n5.	Juara 1 dalam kompetisi band “Jakcloth band competition 2017”','Others','instagram;','Jakarta',391,'2017-08-16 10:49:49','2017-08-16 10:49:49'),(169,'Young And Powerfull','1502912680.jpg','Berawal dari kesenangan atas genre musik yg sama, kita sepakat membentuk band ini pada 28 september 2014, nama Young And Powerfull sendiri memiliki makna bahwa kita adalah sekumpulan anak muda yg penuh dengan semangat, kreativitas yg tinggi serta selalu dipenuhi dengan pikiran optimisme dan positive thinking\r\nPrestasi terbaru kita adalah kita sudah berhasil menyelesaikan album indie pertama kami yg bertajuk \"Antusias\"','Others','guitar_plus;teman;','Surabaya',367,'2017-08-16 11:44:40','2017-08-16 11:44:40'),(170,'D\'harness','1502913919.jpg','D\'harness band asal mancak serang banten indie','Pop','teman;','Jakarta',397,'2017-08-16 12:05:19','2017-08-16 12:05:19'),(171,'Class Of The Moon','1502914014.JPG','Class Of The Moon adalah band yang terlahir dari sebuah mimpi yang sama & hobi yang sama. Terlahir di kota yang penuh dengan musisi - musisi kreatif yaitu bandung membuat Class of the moon bangga bisa memeriahkan kancah musik indie dan termotivasi agar tetap konsisten dan bisa menuangkan warna baru di dunia musik indie. Secara resmi Class Of The Moon Berdiri pada tanggal 14 Agustus 2013 sebagai main Genrenya Indie Rock. Band yang di nahkodai oleh Seva (Seva Pratama), Wilman (Wilman Bratawijaya), Taufiq (Taufiq Akbar) telah meluncurkan beberapa single diantaranya pada tahun 2014 mereka merilis single yang berjudul \'Nyata\' yang telah masuk dalam beberapa kompilasi dan salah satunya kompilasi \'5th Compilation Anniversary Jakcloth\'. Setelah itu pada tahun 2016 Class Of The Moon Merilis sebuah single yang berjudul \'Fault\' yang juga sempat masuk dalam top chart di salah satu radio di bandung, dan juga single tersebut tergabung dalam sebuah kompilasi \'Pop punk Revolution vol.1\' yang dirilis oleh Digital Publisher Ana Music yang bisa didengarkan secara streaming melalui aplikasi spotify dan juga bisa didapatkan secara legal di itunes, deezer, Amazon MP3, dan lain lain.\r\nClass Of The Moon Sendiri telah banyak mengisi acara-acara seperti pensi,bazar market, dan lain lainya di berbagai daerah diantaranya bandung, jakarta, bogor, banten dan pandeglang. Dan juga sempat menjadi juara pertama dalam sebuah band competition accoustic di event CHIP FIESTA 2014 yang diselengarakan di Universitas budi luhur pada 20 mei 2014.','Rock','instagram;guitar_plus;','Jakarta',396,'2017-08-16 12:06:54','2017-08-16 12:06:54'),(172,'Class Of The Moon','1502914055.JPG','Class Of The Moon adalah band yang terlahir dari sebuah mimpi yang sama & hobi yang sama. Terlahir di kota yang penuh dengan musisi - musisi kreatif yaitu bandung membuat Class of the moon bangga bisa memeriahkan kancah musik indie dan termotivasi agar tetap konsisten dan bisa menuangkan warna baru di dunia musik indie. Secara resmi Class Of The Moon Berdiri pada 