 kompilasi \'5th Compilation Anniversary Jakcloth\'. Setelah itu pada tahun 2016 Class Of The Moon Merilis sebuah single yang berjudul \'Fault\' yang juga sempat masuk dalam top chart di salah satu radio di bandung, dan juga single tersebut tergabung dalam sebuah kompilasi \'Pop punk Revolution vol.1\' yang dirilis oleh Digital Publisher Ana Music yang bisa didengarkan secara streaming melalui aplikasi spotify dan juga bisa didapatkan secara legal di itunes, deezer, Amazon MP3, dan lain lain.\r\nClass Of The Moon Sendiri telah banyak mengisi acara-acara seperti pensi,bazar market, dan lain lainya di berbagai daerah diantaranya bandung, jakarta, bogor, banten dan pandeglang. Dan juga sempat menjadi juara pertama dalam sebuah band competition accoustic di event CHIP FIESTA 2014 yang diselengarakan di Universitas budi luhur pada 20 mei 2014.','Rock','instagram;guitar_plus;','Jakarta',396,'2017-08-16 12:07:48','2017-08-16 12:07:48'),(174,'Quartetiga','1502932480.JPG','Juara 2 Jazz Festival Semanggi 2015','Jazz','guitar_plus;','Jakarta',400,'2017-08-16 17:14:40','2017-08-16 17:14:40'),(175,'Quartetiga','1502932497.JPG','Juara 2 Jazz Festival Semanggi 2015','Jazz','guitar_plus;','Jakarta',400,'2017-08-16 17:14:57','2017-08-16 17:14:57'),(176,'Quartetiga','1502932507.JPG','Juara 2 Jazz Festival Semanggi 2015','Jazz','guitar_plus;','Jakarta',400,'2017-08-16 17:15:07','2017-08-16 17:15:07'),(177,'No Slide','1502942911.JPG','Noslide ialah.. Audrey in Guitar (vocal) Arief in Guitar (Back Vocal) Fakhran ramadhan (Bass) Dendy (drum) Dengan segala kesungguhan, kerja keras kami merilis mini album yg berjudul “realita” ini oleh Trifusion Music Records”. Sebagai rincian atas produksi kami sebagai berikut : Band : Noslide Genre	: Punk Rock Release	: 10 November Tahun	: 2016 Label	: Trifusion Music Records List track	: 6 track/lagu Judul mini album : Realita Noslide.. Kota dan kaum muda akan selalu berkolaborasi dan memainkan sebuah interaksi sosial dan akan selalu berhadapan dengan barbagai permasalahan di dalam sebuah keseharian. Untuk tetap mempertanyakan dan melawan otoritas, Punk memainkan peranan penting untuk selalu mempertanyakan standar hidup masyarakat moderen dan mainstream sekarang ini. Sebagai hasil dari itu semua, kota dan kaum muda menjadi sebuah arena dan masyarakat yang ada di dalamnya mempengaruhi pembuatan lirik yang kami buat yang berkaitan dengan praktik-praktik budaya di dalamnya. Hal ini juga yang mendefinisikan ulang pengalaman kami dan pemahaman kami tentang tinggal di sebuah kota dan sebagai agen perubahan di masyarakat. Apakah musik kami akan disukai semua orang? Siapa yang berhak mengklaim musik yang kami mainkan di dalam ruang kota? Ataukah modernitas dari cara baru ber-Punkrock dan bising yang dihasilkan kami terlalu arogan untuk diakui? No slide adalah punkrock band yang berasal dari jakarta. Sejujurnya, punkrock telah memberikan sebuah pencerahan bagi masing-masing personil kami untuk tetap melawan. Misi yang akan kami sampaikan adalah lirik yang kami tulis dan nyanyikan bisa diterima semua orang, dan pesan yang kami artikulasikan bisa meraih pendengar global. Satu hal yang pasti, kami akan terus melawan. Sejak band ini dibentuk pada tahun 2013 dan karena kecintaan kami kepada band punk tahun 90 dan 80an, kami masih harus belajar untuk memberikan pesan yang ‘baik’ kepada pendengar kami dimanapun mereka berasal dan mereka berada. Kami telah merilis mini album pertama kami yang bertajuk “Realita” yang berisikan sebanyak 6 lagu. Rise against, Bad Religion, Lagwagon, Local Resident Failure, The Decline, No Use For a Name, Speak Up, NTRL, Buddy Bully, My Name adalah band yang mewarnai musik kami dan menjadi sebuah warna baru yang bernama No Slide. Kami memiliki 1 lirik berbahasa Inggris dan 5 lirik yang berbahasa Indonesia. Hal tersebut dilakukan karena mini album dan untuk album-album berikutnya akan dibuat dengan format seperti itu dan bisa meraih pendengar yang berasal dari luar Indonesia.','Funk','guitar_plus;','Jakarta',403,'2017-08-16 20:08:31','2017-08-16 20:08:31'),(178,'ALL ICE','1502944457.jpg','Kami band dari kota kecil padang sumatra barat ..  Sering terjadi masalah internal dalam band kami,  sudah beberapa kali bertukar formasi,  tapi karna kami punya semangat bermusik yang sama, kami tetap bisa berkarya, dan semoga karya kami dapat di terima di industri musik indonesia\r\nPrestasi yang pernah kami peroleh\r\nJuara dua padang fair 2016\r\nJuara satu festival yamaha 2016\r\nJuara dua di pekan inovasi rri padang 2016\r\nJuara satu festival sesumatra barat di tarusan pesisir selatan 2015\r\nJuara dua festival tiger camp 2016 \r\nDan beberapa kali dapat the best player...  Di beberapa event','Pop','instagram;','Medan',373,'2017-08-16 20:34:17','2017-08-16 20:34:17'),(179,'Damney','1502957008.jpeg','Band coveran di cafe tiap weekend dan ingin mencoba peruntungan','Pop','lainnya;','Jakarta',408,'2017-08-17 00:03:28','2017-08-17 00:03:28'),(180,'Virus.','1502958566.jpg','Juara 1 Accoustic Fikom Unpad 2009\r\nJuara 2 Jazz Day Psikologi Unpad 2011\r\nJuara 1 Pilihan Penonton Terfavorit Akustik Prodia ITB 2010','Jazz','instagram;guitar_plus;','Jakarta',412,'2017-08-17 00:29:26','2017-08-17 00:29:26'),(181,'TEKSAS BAND','1502959107.JPG','Band ini terbentuk tgl 21 maret 2011 dan telah mengalami perubahan personil semenjak didirikannya. Namun pendiri band ini yaitu sigit dan ucha masih tetap ingin melanjutkan karyanya.','Rock','facebook;','Jakarta',411,'2017-08-17 00:38:27','2017-08-17 00:38:27'),(182,'The Marsu','1502959852.jpg','THE MARSU adalah sekumpulan anak anak muda dari bandar lampung yang mempunyai bakat dan hobby yang sama tentang bermusik maka terbentuk lah THE MARSU pada awal tahun 2010.\r\nTHE MARSU itu sendiri mengusung genre yang berbeda dari genre musik yang biasanya\r\ngenre musik THE MARSU itu ialah Rock Electronica antara perpaduan dentuman distorsi progres dan sentuhan nuansa nuansa electro, dubstep, dan loop loop Dj, tetap dengan lirik lagu yang\r\neasy listening.\r\nselain itu genre dan lagu lagu THE MARSU bisa di nikmati dari semua kalangan dan usia.\r\n\r\nTHE MARSU itu sendiri terdiri dari lima pria tampan asal kota tapis berseri yaitu :\r\n(BAIM)vocal,\r\n(ENNO) bass,\r\n(FAJAR) drum,\r\n(PHENYOETZ) guitar ,\r\n(ANOM) keyboard.\r\n\r\nDari sekian event performance THE MARSU selalu mendapat support dan antusias dari para audience di event tersebut, THE MARSU selalu mendapat nilai plus dan prestasi yang dapat di bangga kan antara lain :\r\n\r\n- 10 Finalis Terbaik MOKA CLASS MUSIC COMPETITION 2010\r\n- Juara I Festival Musik Akbar HUT KOTA BANDAR LAMPUNG 2010\r\n- Juara I Festival Musik HONDA PT.NUSANTARA SURYA SAKTI 2010\r\n- Juara I Festival Vallentine Gunung Sulah 2010\r\n- Juara I Festival Musik Tanjung Bintang 2010\r\n- Juara II Festival Musik kemerdekaan Sumur Waru PALEMBANG 2010\r\n- Juara III HOME BAND TALENT BEOLI FM MUSIK LIVE 2011\r\n- Juara III Festival Musik Kemerdekaan Sawah Brebes 2012\r\n- Juara III Festival Musik Gokil Jagabaya 2013\r\n- Juara III Festival Musik Kemerdekaan Kec. Panjang 2014\r\n- Juara III Festival Campus DCC 2013\r\n- Juara III Respect Independet 2012\r\n- Band Favorit Festival Musik Tiger Day Fakultas Hukum Unila 2015\r\n- Best Live Guest Star & Supremation of THE MARSU 2014\r\n- LIVE PERFORMANCE SENSASI HITS CLASS MILD 2012 (IBI Darmajaya)\r\n- LIVE PERFORMANCE Launching Album MOKA COMPILATION 2013\r\n- Juara 1 live performance soprest season universitas UNILA 2016\r\n- Juara 1 live performance anniversarry universitas bandar lampung (UBL) 2016\r\n- Juara 1 live performance sikam terusik universitas POLINELA 2016\r\n- Juara 2 live performance festival akbar 2016 universitas DARMAJAYA 2016\r\n- juara 1 live performance event yamaha 2016\r\n- juara 1 live performance hut 17 agustus gedong air kemiling Bandar Lampung 2016\r\n- juara 1 festival musik ramayan robinson 2017\r\n- juara 2 festival musik universitas gentiaras 2017\r\n- juara 3 band competition Tapis evolutin piala gubernur lampung 2017\r\n- juara 3 fesyival akbar ibi darmajaya 2017\r\n- opening stage burgerkill and siksa kubur tibal pride 2017\r\n- juara 3 festival rock se sumbagsel 2017\r\nAND MANY MORE...','Rock','guitar_plus;','Jakarta',349,'2017-08-17 00:50:52','2017-08-17 00:50:52'),(183,'XamtRock','1502963355.jpg','Xamtrock adalah band asal lampung.','Rock','guitar_plus;','Jakarta',415,'2017-08-17 01:49:15','2017-08-17 01:49:15'),(184,'Sylviana','1502964013.jpg','Pernah main di : \r\n-JAMS UI\r\n-Pangudi Luhur Project 2016\r\n-Sunyata Night\r\n-Rockgasm\r\n-Konser 1000 Band\r\n-JAMS UPBEAT\r\n\r\nSudah merilisi single berjudul \" Dimensi Malam \" beserta video clip.','Alternative Rock','instagram;informasi_toko;teman;','Jakarta',251,'2017-08-17 02:00:13','2017-08-17 02:00:13'),(185,'FOR YOU ALL','1502971261.jpg','Foryouall adalah band yang mengusung genre british poppunk, terbentuk tahun 2012 dengan formasi 5 orang. Saat ini FYA (Foryouall) sudah mempunyai 5 lagu dan siap untuk launching album pada tahun 2017 nanti. Lagu berjudul “Wake Up” akan menjadi pondasi FYA melangkah lebih maju dari saat ini. Bongkar pasang pemain sudah seringkali dilakukan, sampai sekarang kira-kira sudah 3kali rombak pemain. Pada tahun 2016 ini, FYA menetapkan 4 personil awal yaitu Chandra (23th) asal Kebumen sebagai Vocalist, Ivan (22th) asal Semarang sebagai Gitaris, Edo (23th) asal Pekalongan sebagai Lead Gitar, Anugerah Arief / biasa dipanggil Aan (22th) asal Blora sebagai Drummer, kemudian Rendra (22th) asal Boyolali sebagai pengisi / pengganti Bassis di FYA sejak 2015 hingga sekarang dan tambahan 1 personil baru sebagai pelengkap formasi adalah Yayan / kerap dipanggil Benjis (22th) sebagai pemain Keyboard. Dengan formasi 6 orang ini FYA akan meneruskan perjalanan untuk mencapai puncak kesuksesan.\r\nSejak berdiri tahun 2012 lalu, tidak sedikit prestasi yang telah dicapai oleh FYA. Menjuarai lomba, Sebagai Guestar acara, main di Tv walaupun tv lokal, sampai sepanggung dengan artis Nasionalpun pernah dirasakan oleh kami. Pada akhir tahun 2016 ini, kami sedang gencar mempromosikan karya karya kami. Bukan hanya berbentuk audio saja tetapi visual juga. Mengikuti perkembangan jaman juga, kita banyak menshare karya kita lewat medsos juga seperti Facebook, Twitter, Instagram, Youtube sampai myspace pun kita punya. Bukan hanya gencar di medsos, kita juga mengikuti banyak event musik.','Others','guitar_plus;teman;','Jakarta',380,'2017-08-17 04:01:01','2017-08-17 04:01:01'),(186,'You!','1502972085.jpg','Band yang dibentuk tahun 2012 oleh 2 bersaudara Jusman & Ogan. Dengan personil tetap 2 orang dan ditambah additional player sesuai kebutuhan panggung.\r\n\r\nDuo/group yang berasal dari Cianjur ini sudah sering mengisi berbagai acara kampus, instansi, showcase, dll.\r\n\r\nSudah mempunyai single yang berjudul \"Hingga Aku Tiada\", \"Berharap\" dan \"Dia Atau Dia\".\r\n\r\nSempat masuk ke 30 besar dari sekitar 2000 peserta kompetisi Talent Development Guinness Amplify yang di adakan oleh Guinness Beer dan bekerja sama dengan Music Label Musica Studio yang dinilai oleh Steve Lilliwhite.','Pop','facebook;instagram;umi;','Jakarta',417,'2017-08-17 04:14:45','2017-08-17 04:14:45'),(187,'B_band','1502979249.jpg','B_band adalaha salah satu band berpotensi di daeranya,\r\nDan sudah beberapa kali perfom di dalam maupun di kotanya sendiri. (Sul-sel)','Alternative Rock','facebook;','Jakarta',378,'2017-08-17 06:14:09','2017-08-17 06:14:09'),(188,'Panji and Friends','1502981027.jpg','Sebuah Karya Anak Bangsa.....','Alternative Rock','teman;','Surabaya',418,'2017-08-17 06:43:47','2017-08-17 06:43:47'),(191,'Foura','1502993561.png','band kampung yang ingin mencoba mempersembahkan karyanya','Pop','instagram;','Jakarta',424,'2017-08-17 10:12:41','2017-08-17 10:12:41'),(192,'Legalvoid','1502999229.jpg','to drain adalah awal pembentukan dari legal void, rick mengalami hangover selama 1 minggu, untuk bisa mengimplementasikannya di contactlah doni, setelah 1 bulan berjalan rangga pun ikut bergabung dan setelah itu +- sudah 10 event kami lalui sampai dengan saat ini. prestasi kami bisa berada dalam BBGB (Big Brother Grunge Bandung)','Alternative Rock','teman;','Jakarta',427,'2017-08-17 11:47:09','2017-08-17 11:47:09'),(193,'Create Think Band','1503013650.jpg','CREATE THINK band berasal dari kota PURWAKARTA (jawa barat) yang terbentuk pada 20 Januari 2016 yang terdiri dari 3 personil band yaitu : TRI DARMA PUTRA / MATOEL (VOCAL & GUITARS RYTHEM), RICKY PRATAMA ISNANDI / Q’PAY (GUITARS MELODY), & ERICK KURNIA SOPANDI / ENDUT (DRUMS).\r\nFilosofi CREATE THINK  di ambil dari karakter  RAMBUT dari masing – masing personil yang kriting akan tetapi arti dalam kata CREATE THINK adalah BUAT BERFIKIR  karna CREATE THINK termotivasi  untuk slalu  memberikan kreasi2 musik  Rock yang di taburi dengan lyric  bernuansa Realita Cinta Dan Kehidupan.CREATE THINK sudah mempunyai Jam terbang yang  lumayan banyak Dan  salah satu nya slalu  di undang untuk mengisi  acara-acara  ANNIVERSARY CLUB  MOTOR, CREATE THINK pada  tanggal 25 NOVEMBER  2016 meliris Single Lagu yang berjudul “BEIIBY” dan Alhamdulillah dari semua kalangan dari yang muda sampe yang tua banyak yg menyukai SINGLE Lagu CREATE THINK, Kami pun saat ini sedang meliris  untuk  Mini  ALBUM  yaitu berjudul “AKHIRI MIMPI”.','Rock','teman;','Jakarta',275,'2017-08-17 15:47:30','2017-08-17 15:47:30'),(194,'ID Band','1503024191.jpg','Berdiri 7 November 2016 dengan 5 personil berformat akustik dan bergenre akustik EDM. Personil terbentuk semenjak 2 personil ID Band yang berkuliah membentuk sebuah band dan kemudian datang 3 personil yang saat itu sedang mencari personil untuk manggung, Latar belakang mulai dari yang bersekolah, berkuliah, sampai yang bekerja. Prestasi ID Band sudah sangat banyak mulai dari dipercaya bermain di mall-mall ternama, weddingan, dipercaya sebagai band untuk shooting trans 7 di sebuah cafe, sampai yang terakhir duet dengan DIVA Indonesia, Krisdayanti a.k.a KD','Pop','facebook;','Jakarta',433,'2017-08-17 18:43:11','2017-08-17 18:43:11'),(195,'KINDA','1503037187.jpg','Masih baru,masih hangat dan baru pentas di beberapa acara pensi-pensi sekolahan dan event2 komunitas.','Pop','facebook;','Jakarta',436,'2017-08-17 22:19:47','2017-08-17 22:19:47'),(196,'Full Lights Out','1503041587.jpg','Cerita:\r\nFull Lights Out adalah sebuah band beraliran pop-jazz yang terlahir di kota Bandung. Band ini diinisiasikan oleh Jose(Gitar), Crist(Drum) dan Boy(Bass) pada tahun 2015, yang kemudian menggaet Raken(Piano) dan Nico(Vokal) pada tahun 2016. Setiap syair dan nada pada lagu-lagu band ini diambil dari pengalaman pribadi mereka, membuat lagu-lagunya lebih berarti.\r\n\r\nPrestasi:\r\n- The 9th International Kampoeng Jazz, Universitas Padjadjaran Bandung, 29 April 2017\r\n- Borobudur Nite Music & Lantern, Candi Borobudur Magelang, 31 Desember 2016\r\n- AWSM FSTVL, Secapa AD Bandung, 3 Desember 2016\r\n- Walk eat & sound, USB YPKP Bandung, 29 Oktober 2016','Pop','maliq;','Jakarta',318,'2017-08-17 23:33:07','2017-08-17 23:33:07'),(197,'ZIA BAND','1503045685.JPG','VI.	Prestasi\r\n\r\nTahun 2014 single hits ZIA Band  yg berjudul indah bersamamu telah menjuarai disetiap radio lokal yg ada di palembang, Zia band juga berhasil sebagai juara disalah satu kompetisi akustik di Palembang. Selain itu, Zia Band juga menjadi Juara Favorit ILCC Telkomsel 2014 dan 5 besar band terpilih nasional Pro 2 RRI Palembang\r\nZIA Band telah mengeluarkan 2 (dua) single yang berjudul \"Indah Bersamamu\" di ciptakan oleh Putra (bassis) serta dua lagu \"Salah Jalan\" dan \"Touch Your Dream\" yang di ciptakan oleh Adit (gitaris).','Rock','facebook;instagram;informasi_toko;vipclub;guitar_plus;umi;maliq;poster;teman;lainnya;','Jakarta',392,'2017-08-18 00:41:25','2017-08-18 00:41:25'),(198,'Vietnam rose','1503047533.jpg','VIETNAM ROSE\r\nTerinspirasi dari cerita tragis, Sebuah politisasi di negara Vietnam,  perlawanan rakyat kususnya kaum wanita terhadap penjajah dimana sebuah penyakit bernama Vietnam Rose menjadi wabah mematikan\r\n\r\nBerdiri tambun,Bekasi sejak 2007 , fakum selama kurang lebih 10tahun dan mulai di resmikan kembali tahun 2017 .\r\nBintang Bassis sekaligus pendiri band ini mengajak untuk meneruskan VIETNAM ROSE dengan merekrut Abel ex Path Of Shadow , Pijay ex Secret Forgotten , Erwin ex Mr.peanut , dan mengajak Reska Vokalis  masih menjadi vokalis Danger Of Destination & Battle Blood\r\n\r\ncerita berlanjut dengan terjadi perubahan formasi pada vocal Reska keluar digantikan oleh Doyeh ex vocalis Tower (Deathcore),\r\ndengan perubahan formasi nuansa musikpun berubah yang awalnya mengusung genre Metal core menjadi Death metal core / melodick Death Metal, Sebagai Bukti existensi single INFIDEL & RHYMES OF THE INSULT diluncurkan  dan berlanjut pengerjaan debut album pertama bertajuk SINGULARITY.','Heavy Metal','instagram;guitar_plus;teman;','Jakarta',442,'2017-08-18 01:12:13','2017-08-18 01:12:13'),(199,'CLOSING STAGE','1503049897.jpg','We found together and we care each other.','Others','instagram;','Yogyakarta',370,'2017-08-18 01:51:37','2017-08-18 01:51:37'),(200,'Namaskara','1503052167.jpg','Dimulai dari kesamaan visi dalam bermusik, band yang beranggotakan Fella Oktaria sebagai vokalis, Bobby Marsatya sebagai bassis, Ardi Ardian & Mario Morada sebagai gitaris, dan Mahendra Yogaswara sebagai drummer, sepakat untuk membentuk sebuah band. Walaupun terbilang band baru, namun band yang terbentuk pada tanggal 20 Agustus 2015 ini memiliki para personil yang berpengalaman dan mempunyai jam terbang yang cukup tinggi dalam bermusik.','Pop','facebook;instagram;poster;','Yogyakarta',444,'2017-08-18 02:29:27','2017-08-18 02:29:27'),(201,'NAMASKARA','1503061773.jpg','Dimulai dari kesamaan visi dalam bermusik, band yang beranggotakan Fella Oktaria sebagai vokalis, Bobby Marsatya sebagai bassis, Ardi Ardian & Mario Morada sebagai gitaris, dan Mahendra Yogaswara sebagai drummer, sepakat untuk membentuk sebuah band. Walaupun terbilang band baru, namun band yang terbentuk pada tanggal 20 Agustus 2015 ini memiliki para personil yang berpengalaman dan mempunyai jam terbang yang cukup tinggi dalam bermusik.','Pop','facebook;instagram;poster;teman;','Yogyakarta',452,'2017-08-18 05:09:33','2017-08-18 05:09:33'),(202,'THE WORKING PUNK HEROES','1503061964.jpg','DIBENTUK TAHUN 2015 ATAS DASAR PENGEN SENANG - SENANG. \r\n\r\nPRESTASI SEJAUH INI ADA DUA :\r\n- MANGGUNG DI LOCAL GIGS KALIBARU BERISIK, TANJUNG PRIOK, TAHUN BARU 2015\r\n- LAUNCHING CHANNEL YOUTUBE SETELAH DUA TAHUN, BARU ADA SATU LAGU\r\n\r\nOIA, SALAH SATU MEMBER KITA ADA YANG UMURNYA LEWAT BATAS MAKSIMAL DI TAHUN INI. COBA AJA BOLEH DONG YA KARENA SENI GAK MANDANG UMUR KAN? HEHE OKE.\r\n\r\nSEMOGA GAK MENYURUTKAN ANIMO LEVI\'S BAND HUNT YA. AMIN.','Others','facebook;','Jakarta',451,'2017-08-18 05:12:44','2017-08-18 05:12:44'),(203,'KLIF','1503065143.jpg','Yogyakarta yang terkenal dengan predikat kota budaya, menjerumuskan kami pada panggung kesenian. Bidang musik, memberi kami ruang untuk berekspresi lebih dalam melampiaskan kesuntukan aktivitas sehari-hari. Melihat realita itu, menggugah kami untuk memberikan perspektif baru di telinga pecinta musik. Ketukan padat, nada yang terjal merupakan cara kami untuk mengajak pecinta musik untuk rehat sejenak dari suntuknya hidup. Ya, itulah karakter kami, band Klif yang berproses di kota budaya dengan atmosfir seni. Fancy Lady, sebagai judul single pertama kami melegitimasi deskripsi di paragraf ini. Enjoy our first single.','Alternative Rock','instagram;','Yogyakarta',448,'2017-08-18 06:05:43','2017-08-18 06:05:43'),(204,'Blue Eyes Band','1503068899.jpg','Dengarkan musik kami.','Alternative Rock','facebook;','Yogyakarta',453,'2017-08-18 07:08:19','2017-08-18 07:08:19'),(205,'childlook band','1503070397.jpg','childlook adalah band yang ber aliran pop  didirikan  arfan & lalah swaktu SMA  disalah satu sma di tegal, bertemu personil chidlook pun punya kesamaan yuris yang kebetulan slah satu teman waktu sma memutuskan bergabung dengan childlook swaktu bandnya bubar ,dan intan pun juga demikian swaktu bandnya bubar  memutuskan untuk menerima ajakan arfan untuk bergabung di childlook untuk mengisi drum...,\r\n-prestasi childlook juara 1 festifal band tahun 2010/2011 di salah stu mall terbesar ditegal ,dan aktifitas childlook sekarang childlook menjadi band reguler di salah satu cafe di tegal','Pop','guitar_plus;','Jakarta',454,'2017-08-18 07:33:17','2017-08-18 07:33:17'),(206,'Saradipa Etnic','1503073582.jpg','Saradipa Etnic adalah band tradisional modern dari kalimantan selatan yang mengusung genre Rock Etnic , yang memadukan suara antara raungan distorsi gitar dan instrument etnik banjar .','Others','guitar_plus;','Yogyakarta',435,'2017-08-18 08:26:22','2017-08-18 08:26:22'),(207,'X3','1503078082.JPG','Berdiri di awal 2017 ,band yang terdiri dari 3 personil ini sepakat untuk mengusung musik folk.','Folk','guitar_plus;','Jakarta',458,'2017-08-18 09:41:22','2017-08-18 09:41:22'),(208,'9.11 (NINE TO ELEVEN)','1503081829.jpg','9.11 (Nine To Eleven) adalah sebuah band yang mengusung genre musik Rock yang berasal dari kota Sukabumi. Nine To Eleven terbentuk pada tanggal 25 Des 2016\r\nBerawal dari pertemuan Evert (vocalis) dengan Ivan (Gitaris) di salah satu cafe, yang berlanjut dengan obrolan seputar musik, ternyata kedua orang ini mempunyai selera musik yang sama, maka iseng iseng kami berdua berniat membentuk sebuah band, lalu Evert mengajak Yusuf (Bassis) untuk bergabung, disusul dengan Heru/co\'er (gitaris) dan Iskandar (drummer) maka terbentuklah 9.11 (NINE TO ELEVEN).\r\n9.11 pernah menjuarai event SUPER RAWK FEST 2017 yang di adakan oleh SUPER MUSIC ID untuk area Sukabumi,Bogor, dan Cianjur. dan bermain satu panggung dengan band besar seperti GOD BLESS, KOTAK dan /rif.','Rock','guitar_plus;','Jakarta',459,'2017-08-18 10:43:49','2017-08-18 10:43:49'),(209,'Emelly Band','1503109080.jpg','Emelly band berdiri sejak 2014 prestasi juara 1 BRI indie music, juara 2 festival tingkat kabupaten, sering mengisi acara di caffe .','Pop','facebook;instagram;informasi_toko;vipclub;guitar_plus;umi;maliq;poster;teman;lainnya;','Surabaya',93,'2017-08-18 18:18:00','2017-08-18 18:18:00'),(210,'Bangsal 13','1503115581.jpg','Kami adalah band lokal asal kota Garut dengan genre Hardcore Punk. Kami pernah mengikuti ajang festival di beberapa acara seperti Hellprint West Java Invassion, Camp Magnify, Studio show dan acara-acara lainya. Pada saat Festival Hellprint 2016 kami pernah memasuki 10 band terbaik, meskipun tidak juara utama, tetapi kami sangat bangga bisa berada dalam 10 band terbaik pada saat itu hehe. Tidak hanya itu, dari beberapa personil kita pernah mendapatkan the best player ke 1 (drum) di satu ajang Festival Pelajar antar SMA yang dulu pernah di selenggarakan di salah satu event di Garut.','Others','facebook;','Jakarta',460,'2017-08-18 20:06:21','2017-08-18 20:06:21'),(211,'ARMY SCHOOL','1503131795.jpg','Grup band ini berdiri pada tahun 2003 yang terlahir dari komunitas kecil di kota Sidikalang yang bernama SUC ( SIDIKALANG UNDERGROUND COMMUNITY) dengan mengusung genre PUNK ROCK.','Rock','instagram;guitar_plus;','Medan',469,'2017-08-19 00:36:35','2017-08-19 00:36:35'),(212,'BORUTO','1503133588.jpg','kami adalah sekumpulan peserta magang jepang yang memiliki kesukaaan dengan musik. Dan ini adalah salah satu cara kami untuk saling berbagi agar tetap kompak.\r\nUtuk HIBURAN, CERITA, & KENANGAN','Alternative Rock','facebook;','Yogyakarta',467,'2017-08-19 01:06:28','2017-08-19 01:06:28'),(213,'BEE SING','1503135276.jpg','BEE SING adalah band yang terbentuk pada tahun 2015, berawal dari kegelisahan pribadi masing masing. Dengan spirit D.I.Y kami membentuk grup  band ini.  BEE SING  mengusung genre Alternative /Noise / Rock Experimental. \r\n\r\nBEE SING sudah ada dalam 2 kompilasi yaitu MEDAN TERIAK 3 & GRUNGE SUMUT pada tahun 2017 ini.','Alternative Rock','instagram;guitar_plus;teman;','Medan',471,'2017-08-19 01:34:36','2017-08-19 01:34:36'),(214,'line up','1503140229.jpg','- mendapatkan penghargaan di lomba karya cipta lagu support by mcd Joglo.\r\n- juara 3 festival band di bekasi suport by radiobekasi thn 2016\r\n-juara 1 festival band rock dalam rangka hari kermerdekaan di cibubur junction support by cibubur junction\r\n-terpilih sebagai band favorite di festival tanggerang thn 2017','Pop','facebook;instagram;umi;teman;','Jakarta',475,'2017-08-19 02:57:09','2017-08-19 02:57:09'),(215,'line up','1503140248.jpg','- mendapatkan penghargaan di lomba karya cipta lagu support by mcd Joglo.\r\n- juara 3 festival band di bekasi suport by radiobekasi thn 2016\r\n-juara 1 festival band rock dalam rangka hari kermerdekaan di cibubur junction support by cibubur junction\r\n-terpilih sebagai band favorite di festival tanggerang thn 2017','Pop','facebook;instagram;umi;teman;','Jakarta',475,'2017-08-19 02:57:28','2017-08-19 02:57:28'),(216,'line up','1503140297.jpg','- mendapatkan penghargaan di lomba karya cipta lagu support by mcd Joglo.\r\n- juara 3 festival band di bekasi suport by radiobekasi thn 2016\r\n-juara 1 festival band rock dalam rangka hari kermerdekaan di cibubur junction support by cibubur junction\r\n-terpilih sebagai band favorite di festival tanggerang thn 2017','Pop','facebook;instagram;umi;teman;','Jakarta',475,'2017-08-19 02:58:17','2017-08-19 02:58:17'),(217,'ACTINIUM','1503142198.jpg','Actinium band Asal Kota Bogor yang terbentuk pada tanggal 12 Desember 2012, yang bergenre Rock & NuMetal.\r\nActinium telah merilis mini album pada bulan april 2017 yang berisikan 4 lagu di dalam nya, selain di rilis secara fisik, mini album ini pun telah di rilis secara digital dan tersedia di Itunes, Joox, Spotify, Amazon, dan situs resmi lain nya','Rock','instagram;','Jakarta',476,'2017-08-19 03:29:58','2017-08-19 03:29:58'),(218,'NAZURU','1503149082.JPG','10 BESAR KFC TALENT SEARCH 1 BINTANG\r\nTOUR 10 KOTA SUMATERA A MILD\r\nJUARA 2 SOUND SATION\r\nJUARA 3 SOUNDVERSITY\r\nJUARA 1 ROCKNATION 2013\r\n80 BESAR RISING STAR LIVE PERFORM RCTI','Alternative Rock','instagram;maliq;','Jakarta',457,'2017-08-19 05:24:42','2017-08-19 05:24:42'),(219,'Blue eyes','1503161762.JPG','Blue Eyes adalah band yang terbentuk pada 2014 dengan misi mewarnai musik Indonesia, band kami ber genre pop punk .kami mengambil nama BLUE EYES karena BLUE itu biru identik dengan warna laut yg menggambarkan dari mana kita berasal yaitu priok, dan EYES adalah mata merupakan bagian tubuh dari tubuh manusia yg penting fungsinya . jadi BLUE EYES itu mempunyai arti band yg berasal dari priuk berharap menjadi sesuatu yg penting fungsinya bagi manusia AMIN :D\r\nPrioritas kami dalam berkarya adalah lagu yang Easy listening ga harus dengan skill yg hebat . yang terpenting lagu kita bisa diterima masyarakat .\r\n\r\nbanyak pergantian personil di band ini dan Blue Eyes bertahan sampai sekarang dengan formasi\r\n\r\nVocal / gitar :Muhammad Arief Fauzy : https://www.facebook.com/m.delong.12?ref=ts \r\nVocal / bass : Erlando Putrama https://www.facebook.com/erlando.putrama?fref=ts\r\nDrumm : Shulis Chiio : https://www.facebook.com/creamzmayonez\r\nLead Guitar : Teguh Islean : https://www.facebook.com/tseptura?fref=ts\r\n\r\n\r\nTanpa Blue Eyes People kami bukan apa - apa \r\nBlue Eyes People most of our lives :)','Pop','instagram;umi;poster;teman;','Jakarta',482,'2017-08-19 08:56:02','2017-08-19 08:56:02'),(220,'RISING BAND','1503168722.png','RISING BAND adalah gabungan dari tim kesenian SMA PGRI 4 & SMAN 7 BOGOR yang di bina oleh R.Dang Iyos Manggung dan Rising band terbentuk tahun 2015\r\nSejak tahun 2015 hingga sekarang RISING BAND telah meraih 37 piala dari Festival Band maupun Akustik','Jazz','instagram;guitar_plus;teman;lainnya;','Jakarta',357,'2017-08-19 10:52:02','2017-08-19 10:52:02'),(221,'Selaksa Senja','1503205451.png','Selaksa Senja terbentuk karena panggilan jiwa masing-masing personelnya yg ingin bermain musik dengan jujur dan apa adanya. Band ini baru terbentuk di tahun 2017 setelah kami ber-empat cukup lama saling sharing ide dan bermusik bersama-sama. Nama Selaksa Senja yang berarti bayangan di saat senja/sore hari dipilih karena mewakili nuansa musik kami yang di satu sisi teduh, damai, mengalir, tapi juga terkadang keras dan penuh amarah.\r\n\r\nKami mengusung aliran Alternative Rock/Post-rock dengan pengaruh musik dari beberapa band diantaranya Kodaline, Mew, Radiohead, Padi dll. \r\n\r\nDengan modal lirik dan kekuatan sensasi musik trance Post-rock yg soulful, kental dan mengalir, Selaksa Senja ingin menyampaikan pesan melalui lagu-lagunya, serta menyentuh hati dan membius siapapun yang mendengarkannya.','Alternative Rock','instagram;','Surabaya',484,'2017-08-19 21:04:11','2017-08-19 21:04:11'),(222,'The BRICE','1503210162.jpg','Terbentuk di Yogyakarta pada akhir tahun 2015. Mengusung jenis musik \'alternatif\' dengan nuansa \'british/britpop\' pada era 90-an. Personil The BRICE merupakan alumni dari Fakultas Seni Pertunjukan Jurusan Musik Pop Jazz di Institut Seni Indonesia Yogyakarta (ISI). Beberapa kali menjadi Guest Star di acara panggung musik di Yogyakarta. Dengan jenis musik britpop 90-an yang cukup langka ditemui di era sekarang ini, kami sangat percaya diri dengan jenis musik dan lirik dari The BRICE yang cukup easy listening dan mudah dipahami oleh masyarakat umum. Kami yakin, musik The BRICE bisa memecah kerinduan masyarakat yang tumbuh di generasi 90-an. \r\n\r\nwww.thebricemusic.com','Alternative Rock','instagram;','Yogyakarta',472,'2017-08-19 22:22:42','2017-08-19 22:22:42'),(223,'RANKAIO','1503215413.jpg','ORKESMELAYU UGAL-UGALAN','Others','guitar_plus;','Jakarta',493,'2017-08-19 23:50:13','2017-08-19 23:50:13'),(224,'MOTH','1503218579.JPG','HISTORY \r\nMOTH is an Indonesian psychedelic rock band founded by alif kikin and fian juli in 2014. The group began as a home recording project for alif kikin, fian juli and julio who writes, records, and produces the music. The project consists of alif kikin (bass guitar & vocals), fian juli (guitar & synthesiser), julio (drums). MOTH released their debut studio ep album, Men Of The Hocus Pocus, which was make a showcase ep launching concert in 10th of july in this year.\r\n\r\nPERFORMANCE \r\n- Mothday ( Moth ep launching concert)\r\n- Indonesian Night Market at UNSW (sydney,Australia)\r\n- Captain Cook\'s Hotels Bar (sydney,Australia)\r\n- Sydney Jamming Club','Others','instagram;','Jakarta',491,'2017-08-20 00:42:59','2017-08-20 00:42:59'),(225,'Looking to the future','1503221332.png','Kami dari band asal kota bandar lampung, terbentuk dri tahun 2013, yg terdiri dari 4 personil.\r\nLatif (gitar+vocal), rio (bass), agus (lead gitar), dan taming (drum).\r\nTahun ke tahun kami pun berganti personil. \r\n2015 agus (lead gitar) keluar krna fokus mnerus ke pendidikannya. Sementara kami hanya berjalan dengan 3 orang personil, gitaris pun memakai audisional.\r\nStelah agus keluar, taming pun menyusul keluar krna lebih fokus ke pekerjaannya. Akhirnya, phian alias engkoh masuk menggantikan posisi taming. Tapi tak lama engkoh pun keluar tanpa sebab..\r\n... sempat vakum 1 tahun setelah kehilangan agus dan taming. \r\nLambat laun, 2016, kami pun mulai bangkit setelah bertemu dengan rizky (kiki) yg mengisi Lead Guitar, dan bertemu teguh aditya  drumer dri band cello, bergabung dengan kami. \r\nKami pun mencoba untuk tampil di setiap acara seperti, acara pagelaran musik, festival, Jakcloth, dan mengisi live music dicafe.\r\nKami yang terdiri dari 4 orang personil ini pun dengan genre yang berbeda, latif cenderung ke aliran alternative rock, ryo screamo, kiki classik rock, teguh  melayu. \r\nTapi untuk di Looking to the future/LTTF Band, smuanya pun komitmen dengan Genre ALTERNATIVE ROCK. \r\nUntuk prestasi, belum banyak yg kami dapat, karena untuk sekarang kami pun baru bangkit untuk berkarya... \r\n2015 kami membuat sebuah karya kecil untuk di dengar. Sebuah lagu yang berjudul \"Kukenang semua\"\r\nDan 2017 ini baru membuat karya kecil lagi untuk di dengar masyarakatn. Lagu yg berjudul Akhir Perjalanan feat yunni.\r\nBisa di lihat di you tube dengan link https://m.youtube.com/watch?v=u8fLquQeAcg','Alternative Rock','facebook;instagram;guitar_plus;teman;','Jakarta',394,'2017-08-20 01:28:52','2017-08-20 01:28:52'),(226,'Bless The Knights','1503230064.jpg','Bless The Knights was established in 7 April 2009, with an old name called Blitzkrieg by their guitarist, mrfritzfaraday, who thought that there was such an urgency of change on Indonesian music, since there were a lot of bands having quite the same genre and tend to follow each other\'s pathway. Regarding to the meaning of Blitzkrieg, which is a “quick attack”, Blitzkrieg music that is having a lot of details and complexity has to be accountable when it is performed live on stage as what is happening to a military attack, which effect has to be accountable to the public.\r\nIn the beginning, Blitzkrieg chose Progressive metal as the core of their music. Furthermore as the time goes by, they were having a lot of maturity process until they finally discover their own usually called ‘Aggressive Heavy Metal Core Progressive’.\r\nIn 2010, the band released their very first album called ‘The Energy of Anger’ including their 6 original songs. At that time, there were just 2 people left in the band, which were mrfritzfaraday (Guitar, Bass and Vocal) and Erick Kevin (Drums). Blitzkrieg was also one of line up of Indonesian phenomenal compilation album ‘Born to Fight’ involving legendary bands, such as Rotor, Imanissimo, Divine and many more dangerous bands.\r\nBlitzkrieg got a public attention as they were one of the opening act of the super band PSMS Amazing Union (Mike Portnoy, Billy Sheehan, Tony Macalpine, Derek Sherinian) at Rock Fest 2012, as well as being the opener of Swedish Death Metal band, Grave in 2013. At the same year, Blitzkrieg was also being one of the headlining action of the Jakarta Guitar Festival 2013 alongside with the 2009 Guitar Idol from Thailand, Jack Thammarat and British Fingerstyle Guitarist, Mike Dawes.\r\nIn 2014, they finally decided to start producing their second album entitled “Bless The Knights”. This is finally becoming their new name for ‘Blitzkrieg’ is still existing or used by several bands and will not be appropriate to be used for a world wide album issue.\r\nOn their newest album, Bless the Knights is working alongside Indonesian professional label, Greenland Indonesia. They were once very close to an Italian recording label, but the deal were never ended into one clear point until finally they were joining Shredguy Records of Ohio, United States of America for their international distribution label.\r\nTheir recent formation are: mrfritzfaraday (Guitars and Vocals), Rad (Vocals), Olgie Alvianus (Guitars), Opic (Drums) and Arry (Basses). This formation is a combination of aggression, complexity, creativity and modernity that will surprise the crowd they performed for.','Heavy Metal','guitar_plus;','Jakarta',388,'2017-08-20 03:54:24','2017-08-20 03:54:24'),(227,'Anastasys','1503235619.JPG','Main Stage Jakarta Fair 2015 \r\nMain Stage Jakarta Fair 2016 \r\nTanggerang Summerfest 2016 \r\nPekan Raya Indonesia (1000Band United) 2016 \r\nLive on Teras Sore Elshinta TV 2017 Youtube Channel : Anastasys TV\r\nCloth Fest at Teras Rimbun Cibubur Jaktim 2017\r\nGuest Star Anniversary 28th Poltek LP3i 2017\r\nPerform at Teras JB Extracoustic at Joglo beer Kemang 2017\r\nIndie Star Kartini Day at Pasar Seni Ancol 2017\r\nIndomusically at La Piazza Kelapa Gading 2017\r\nIndie Kota Tua Weekend at Taman Fatahila Kota Tua Jakarta 2017','Rock','facebook;teman;','Jakarta',508,'2017-08-20 05:26:59','2017-08-20 05:26:59'),(228,'the Oten','1503239430.jpg','kami band dari bandung beranggotakan 6 personil','Pop','lainnya;','Jakarta',509,'2017-08-20 06:30:30','2017-08-20 06:30:30'),(229,'Jejak Awan Pesawat','1503241212.jpg','Jejak Awan Pesawat adalah sebuah band atau kelompok musik yang terbentuk pada tanggal 3 juni 2016 berasal dari kota Bandung, yang awal mulanya hanya sebuah project kecil2an untuk sesuatu hal, tapi lama kelamaan malah semakin menjadi seurius untuk di jalani, yang didirikan oleh 3 orang yaitu cepi, eki dan dyka, didirikan karena atas kecintaan kami terhadap musik dan hobi yang sama, lalu masuklah ahmad untuk mengisi kekosongan di posisi drum, karena saat itu posisi drum sedang kosong, karena kami bertiga tidak ada yang mengisi posisi itu. Nama Jejak Awan Pesawat sendiri kami ambil dari salah satu judul lagu sebuah idol group. Jejak Awan Pesawat mengusung jenis musik yang bergenre pop alternatif, tapi di setiap lirik dan musiknya kami berusaha memasukan bahasa dan musik2 sunda, jepang dan inggris.','Pop','guitar_plus;','Jakarta',431,'2017-08-20 07:00:12','2017-08-20 07:00:12'),(230,'VICT','1503243768.jpg','VICT adalah band asal Semarang, Indonesia yang terbentuk tahun 2013. mereka beranggotakan 3 orang, Ery (vokalis/gitaris), Bayu (basis) dan Adit (drummer). pada tahun 2015, mereka merilis 2 single yang berjudul \"Ex-Friend\" dan \"King Of The World\" melalui media sosial soundcloud dan bandcamp','Alternative Rock','guitar_plus;','Yogyakarta',510,'2017-08-20 07:42:48','2017-08-20 07:42:48'),(231,'BERANTAI','1503246389.jpg','BERANTAI founded 2010 is born a metal scene , From Pasuruan Eat Java, Indonesia\r\nGenre : Technical Death Metal\r\n\r\nLine up 2017 :\r\n\r\nAdhe - Vocal\r\nDhany - Guitar 1\r\nBodrek - Bass\r\nAdham - Drum\r\n\r\n\r\n\r\nIn years 2012, successfully launching EP (extended play)\r\ncontains 5 track songs :\r\nTitle : SUGENG RAWUH SANG CEMENG ING TLATAH JAWI\r\nGenre : Experiment Death Metal\r\n1. Pengantin sak getih\r\n2. Jihad\r\n3. Cantik membunuh\r\n4. Mata satu bangsat\r\n5. Madab nyawa\r\n\r\n• And was in the self release only 50 copies on CD, We held a tour in East Java\r\n- BETWEEN BLACK AND SAND “anniversary” 12 Feb 2012 at Pasuruan East Java”\r\n- MALANG SEDARAH #2 “26 Feb 2012 at Malang East Java”\r\n- WAR BLOOD Fest #2 “03 March 2012 at Malang East Java”\r\n- STEP FOR GLORY “23 March 2012 at Malang East Java”\r\n- TRENDY BANGSAT #25 “03 Juny 2012 at Surabaya East Java”\r\n- BURNING GORE Fest “09 Des 2012 at Surabaya East Java”\r\n- UNDERGROUND PEDULI “15 Des 2012 at Malang East Java”\r\n\r\nIn years 2014, we officially changed the concept of music\r\nFebuary 2015 we self release single song\r\nTitle : DISTRICT OF WAR\r\nGenre : Technical/Melodic Death Metal\r\n\r\n• And was in the self release only 25 copies on CD, we has a tour in 2 city\r\n- MOJOKERTO MOSHPIT AREA “08 Feb 2015 at Mojokerto East Java”\r\n- PARTY FOR MY FRIEND “22 Feb 2015 at Bangil, Pasuruan East Java”\r\n- JOMBANG GROUNG MOVE ON “22 Feb 2015 at Jombang East Java”\r\n\r\n\r\nLine Up : (2010 - 2013)\r\nAdhe - Vocal\r\nDhany - Lead Guitar\r\nAira - Rhythm (Hyperteroid)\r\nEkik - Drum\r\n\r\nLine up : (2013 - 2014)\r\nAdhe - Vocal\r\nDhany - Guitar\r\nHaidar - Bass (Virgin Corpse)\r\nAdham - Drum\r\n\r\nLine up : (2014 - 2015)\r\nAdhe - Vocal\r\nDhany - Guitar\r\nBodrex - Bass (ex Divine Hatred / ex Trexi Sick HC / ex Scum Syndrome)\r\nAdham - Drum\r\n\r\n\r\nDrummer and Guitar additional player that has been filling our line up position\r\nAndre - Drum (Haram, Stagnated)\r\nDoni - Guitar (Nasty, Black Sunday)\r\n\r\n\r\n\r\n“C O M I N G S O O N P R O M O 2 0 1 7”\r\nW.A.R (Worldly As Revenge)\r\nPenghargaan\r\nDiscography\r\n\r\n- EP album 2012 \"SUGENG RAWUH SANG CEMENG ING TLATAH JAWI\"\r\n\r\n- Single 2013 \"DISTRICT OF WAR\"\r\n- Single 2015 \"GARIS DOMINAN\"','Heavy Metal','instagram;','Surabaya',512,'2017-08-20 08:26:29','2017-08-20 08:26:29'),(232,'SITIHINGGIL','1503247998.jpg','Band yg berasal dari ujung timur pulau jawa ini dibentuk oleh Anton (drum) dan Hanafi (gitar) pada 2009 saat duduk bangku Sma dan resmi berdiri pada 2014 lalu. Band yg mengusung progressive rock ini berhasil merekam demonya di tahun 2016 dan sukses menjadi band pembuka di konser band asal Bandung, Jasad saat konser di kota Genteng, banyuwangi.','Others','guitar_plus;','Surabaya',489,'2017-08-20 08:53:18','2017-08-20 08:53:18'),(233,'ID band','1503254375.jpg','\"id\" iyaaa \"id\"\r\nkenapa namanya \"id\" ?\r\n\"id\" artinya identitas..\r\ndibaca inggris \"aiiiidiiii\"\r\nDibaca indonesianya \"iiideee\"\r\nKita anak muda yang ingin menciptakan \"iiideeee\" baru di musik indonesia agar musik indonesia semakin berkualitas!\r\n\r\nYang sebenarnya nama singkatan dari 2 personil dalam band kami yaitu \"id\" \r\nDi vocal \"icky\" dan gitaris \"Dedi\" jadinya \"id\" \r\nGenre musik kami Pop British\r\nSemoga \"id\" bisa menghibur dan meramaikan industri musik di negara kita yaitu INDONESIA.\r\nDan bisa membawa nama negara INDONESIA di industri musik luar negri..\r\nMembawa harum nama negara kita di berbagai negara.. Amin\r\n\r\nMateri lagu dari kami tentang percinta\'an anak anak abg yang lagi pdkt pacaran gitu gitu hehe\r\nMY DECISION selalu menjaga komunikasi tentang hubungan kita agar kita tidak SALAH PAHAM\r\nKenapa aku begini semua KARNA CINTA\r\nWalaupun aku itu masih RAHASIA \r\nTapi hati dan perasa\'an aku itu TAK INGIN SESA\'AT \r\n\r\n\"My Decision\" nama di mini album kami..\r\nDi mini album kami ada 5 lagu :\r\n1. ID - My Decision\r\n2. ID - Salah Paham\r\n3. ID - Karna Cinta\r\n4. ID - Rahasia\r\n5. ID - Tak Ingin Sesa\'at\r\n\r\n#salammusikindonesia\r\n( ID #ickydedi )\r\nMaju terus musik INDONESIA..? \r\n#musik #indonesia #untuk #dunia \r\n\r\nContact person :\r\nrizky.moersas@gmail.com','Pop','facebook;','Jakarta',515,'2017-08-20 10:39:35','2017-08-20 10:39:35'),(234,'AWAN','1503254886.jpg','Berawal dari prodject band cafe ke cafe, mengikuti beberapa festival dan menjadi band event di JAKCLOTH serta band penghibur di acara weeding . Membuat kita tetap terus semangat berkarya di dunia musik indonesia.','Alternative Rock','guitar_plus;','Jakarta',443,'2017-08-20 10:48:06','2017-08-20 10:48:06'),(235,'MISCLEF!','1503283725.jpg','Misclef! adalah band bergenre pop-alternative yang berasal dari Jatinangor, Bandung. Berawal dari sebuah perkumpulan mahasiswa dengan latar belakang pendidikan yang sama, mereka membuat band yang pada awalnya hanya untuk mengisi di acara angkatan pada tahun 2013. Seiring berjalannya waktu, selama 4 tahun terakhir ini Misclef sudah meraih beberapa prestasi di tingkat regional kampus diantaranya Juara 1 Festival Band di tingkat Agrokompleks Unpad (2014), Juara 2 Festival Band FORSI Unpad (2014 & 2015), hingga mengisi acara di beberapa event besar di regional Bandung dan sekitarnya, seperti di acara NGAMPLAGFEST INFOBDG. Saat ini, Misclef sudah memiliki 5 lagu sendiri yang rencananya akan dibentuk sebuah EP / Mini Album yang bertajuk \"Fase Frase\" pada akhir tahun 2017 ini.','Pop','instagram;teman;','Jakarta',143,'2017-08-20 18:48:45','2017-08-20 18:48:45'),(236,'AVIATE','1503285175.jpg','Aviate terbentuk pada bulan mei 2017. band fresh dengan genre pop terbaru. yaitu pop disaster. dimana genre kami dominan dengan pop alternative dan mix dengan punk rock.','Alternative Rock','facebook;instagram;','Jakarta',520,'2017-08-20 19:12:55','2017-08-20 19:12:55'),(237,'Sloky Party','1503286167.JPG','Band bergenre Hard Rock yang sedikit mencampurkan nuansa grunge dan Rock n Roll,sempat masuk menjadi 5 Besar Finalis Indonesia di ajang international Planetrox Envol Et Macadam 2017','Alternative Rock','instagram;poster;teman;','Jakarta',503,'2017-08-20 19:29:27','2017-08-20 19:29:27'),(238,'PLAYFVL CAB','1503290718.JPG','Playfvl Cab berdiri dari tahun 2014 terdiri dari Arief as Guitar, Wira as Bass, Wendo as Vocals dan Eres as Drum. Playfvl Cab mengusung genre Alternative Rock. Prestasi yang kita peroleh Manggung di LALALA Fest, Rock in Celebes Dan Alternatif Menggugat. Selain prestasi manggung kita di event yang besar kita mempunyai prestasi di video clip. Video Clip kita di terima oleh VEVO.','Alternative Rock','facebook;','Jakarta',522,'2017-08-20 20:45:18','2017-08-20 20:45:18'),(239,'NEXA','1503291431.JPG','NEXA','Pop','guitar_plus;poster;teman;','Jakarta',523,'2017-08-20 20:57:11','2017-08-20 20:57:11'),(240,'Assenaband','1503293504.jpg','Assena adalah sebuah nama group band yang terlahir karena persahabatan Farras dengan Bastian. Sejak duduk dibangku SMP kami berdua (farras dan bastian) ingin sekali mempunyai group band yang handal dan berprestasi dalam bermusik.\r\n   Oleh karena itu kami berdua mencoba membuat lagu dari gabungan syair dan lirik, sampai akhirnya kami berhasil membuat beberapa lagu. Setelah kami menciptakan beberapa lagu, kami pun sempat bingung untuk kelanjutannya agar lagu kami dapat sempurna di bawakan oleh sebuah group band.\r\n  Dan kami mencoba untuk mencari personil agar dapat di ajak membentuk sebuah group band seperti yang kami inginkan. Setelah sempat gonta-ganti personil dan kini akhirnya kami berdiri dengan 3(tiga) personil, yang dapat bekerja sama dalam bermusik dengan baik.\r\n\r\nKapan Assena Terbentuk ?\r\nAssena pun terbentuk pada tanggal 28 November 2009,  itu pun setelah kami mendapatkan personil untuk melekapi music dalam group band ini. Assena pun mempunyai arti yang simple yaitu, “ Anda Suka Saya Senang “.  menurut kami untuk nama sebuah band itu gak perlu mempunyai makna yang dalam, yang penting mudah diingat dan diucap.  Karna kami disini ingin sekali diingat dengan karya bermusik kami, bukan sekedar nama yang puitis atau pun bermakna indah.\r\n\r\nPengaruh Musik Assena.\r\n· Scorpions, Deep purple, Queen, Yngwie malmsteen, dan Muse.\r\n· Genre yang kami buat dalam band kami adalah Slow Rock, dimana lagu slow yang didalamnya menpunyai interlude rock.\r\n\r\nJudul Lagu yang sudah Recording :\r\n1. Kamu-kamulah\r\n2. Sadarkah\r\n3. Sahabat\r\n4. Sungguhku ingin\r\n5. Telahku beri\r\n\r\nCatatan.\r\nMemiliki komitmen Menjadi seorang musisi adalah kerja keras seumur hidup, bukannya hanya iseng-iseng! Musisi yang sukses di industri musik tidak sekedar memasukan jempol kaki mereka untuk memeriksa keadaan air. mereka langsung terjun dengan kepala mereka lebih dahulu dan tidak melihat kebelakang lagi . Sekali anda menjadi musisi maka selamanya anda adalah seorang Musisi.\r\n\r\nPengalaman Kami.\r\n\r\nMengikuti acara Pensi Kampus :\r\n- STIMIK (jakarta barat)\r\n- Trisakti (jakarta barat)\r\n- Ista Al-kamal (jakarta Barat)\r\n- UI (Depok)\r\n- BSI\r\n- Dll.\r\n\r\nPensi SMA :\r\n- SMK AA (tanjung duren)\r\n- Yadika 1 (jakarta barat)\r\n- SMAN 111 (Bandengan)\r\n- Dll.\r\n\r\nPensi Umum :\r\n- Audisi Hut TVRI\r\n- Mall Atrium (Jakarta barat)\r\n- Ramayana Semper/priuk (jakarta utara)\r\n- Cafe Wapres (jakarta selatan)\r\n- KFC cideng (jakarta barat)\r\n- Indomart Point jl.Ampera (jakarta selatan)\r\n- Sting Belaraja (tanggerang)\r\n- Puri Walk Kembangan (jakarta barat).','Pop','facebook;instagram;informasi_toko;umi;maliq;poster;teman;lainnya;','Jakarta',524,'2017-08-20 21:31:44','2017-08-20 21:31:44'),(241,'SOVEREIGN','1503298268.jpg','Lewat penggalan video lirik untuk single pertamanya, Sovereign menggoda para penikmat musik lewat balutan musik cadasnya. Single “The One Whom Earth Refuse” yang dirilis dalam format video lirik berupa teaser debut EP-nya lewat layanan streaming tersebut, telah berumur setahun dalam perilisannya dan kini mereka mengabarkan bahwa ada 7 lagu yang akan dimasukan dalam mini albumnya. Pada video liriknya, Sovereign mencoba menghantarkan beberapa potongan konstruksi lirik bernuansa agnostic yang dibawakan dengan kegeraman.','Heavy Metal','instagram;','Jakarta',496,'2017-08-20 22:51:08','2017-08-20 22:51:08'),(242,'Jendela kamar','1503300862.jpg','Sebuah grup duo yang beranggotakan rizki and ikhsan, di bentuk pada 2012 karena satu pemahaman tentang musik bahwa musik itu seperti jendela dalam kamar.\r\nBersifat pribadi, namun terbuka dan bebas, dan bisa di dengar oleh semua kalangan.','Others','facebook;','Jakarta',530,'2017-08-20 23:34:22','2017-08-20 23:34:22'),(243,'Jendela kamar','1503300868.jpg','Sebuah grup duo yang beranggotakan rizki and ikhsan, di bentuk pada 2012 karena satu pemahaman tentang musik bahwa musik itu seperti jendela dalam kamar.\r\nBersifat pribadi, namun terbuka dan bebas, dan bisa di dengar oleh semua kalangan.','Others','facebook;','Jakarta',530,'2017-08-20 23:34:28','2017-08-20 23:34:28'),(244,'Jendela kamar','1503300870.jpg','Sebuah grup duo yang beranggotakan rizki and ikhsan, di bentuk pada 2012 karena satu pemahaman tentang musik bahwa musik itu seperti jendela dalam kamar.\r\nBersifat pribadi, namun terbuka dan bebas, dan bisa di dengar oleh semua kalangan.','Others','facebook;','Jakarta',530,'2017-08-20 23:34:30','2017-08-20 23:34:30'),(245,'Jendela kamar','1503300873.jpg','Sebuah grup duo yang beranggotakan rizki and ikhsan, di bentuk pada 2012 karena satu pemahaman tentang musik bahwa musik itu seperti jendela dalam kamar.\r\nBersifat pribadi, namun terbuka dan bebas, dan bisa di dengar oleh semua kalangan.','Others','facebook;','Jakarta',530,'2017-08-20 23:34:33','2017-08-20 23:34:33'),(246,'Jendela kamar','1503300876.jpg','Sebuah grup duo yang beranggotakan rizki and ikhsan, di bentuk pada 2012 karena satu pemahaman tentang musik bahwa musik itu seperti jendela dalam kamar.\r\nBersifat pribadi, namun terbuka dan bebas, dan bisa di dengar oleh semua kalangan.','Others','facebook;','Jakarta',530,'2017-08-20 23:34:36','2017-08-20 23:34:36'),(247,'VELLAROSE','1503311972.jpg','Vellarose, grup musik bergenre pop punk asal Jakarta ini tidak lagi disebut band pendatang baru. Memulai debutnya dengan single lagu mutiara terindah dan Let Itu Flow, Vellarose berhasil menjadi \"demos terpilih\" di salah satu edisi HAI Magazine tahun 2013.\r\n\r\nSeiring perjalanannya sejak pertengahan 2013, Vellarose telah mengalami beberapa pergantian personil. Vellarose kini digawangi oleh Nicola (Vocal), Niel (Bass), Ayi (Guitar), Carlos (Guitar), dan Mejun (drum). \r\nDalam bermusik, Vellarose mengedepankan attitude, aransemen yang ciamik, kekuatan lirik, ditambah adanya wanita di posisi penggebuk drum yang menjadi daya tarik.\r\n\r\nBeberapa band internasional seperti All Time Low, New Found Glory, Blink 182, Totalfat, Four Year Strong, ADTR, dan band pop punk lainnya telah menjadi pengaruh bagi musik Vellarose. Tidak ketinggalan band pop punk tanah air seperti Rocket Rockers dan Pee Wee Gaskins yang juga menjadi panutan mereka.\r\n\r\nHingga kini, di waktu yang masih terbilang seumur jagung, Vellarose sudah meraih banyak kesempatan tampil di berbagai stage. Baik gigs underground, festival, pensi, atau acara musik ternama diikuti. Pencapaian terbesar dicapai setelah Vellarose terpilih sebagai Rising Star dari Levi’s dan berhak tampil di acara musik Breakout Net TV. Selain itu, Vellarose juga tampil di acara Pensi Fair yang diadakan Global Tv dan Loop ID. Acara tahunan seperti Jakcloth pun jarang dilewatkan. Berbagai pensi dan acara musik kampus pun akrab dihadiri Vellarose. Tidak juga ketinggalan lagu-lagu Vellarose sering muncul di berbagai Kompilasi musik dan radio-radio.\r\n\r\nPencapaian Vellarose yang belum seberapa ini pun tidak lepas dari karya-karyanya yang telah dikemas dalam bentuk digital di setiap akun social media mereka maupun dalam kepingan CD. Terbukti mereka melepas sebuah mini album bertajuk “A Luta Continua” pada tahun 2014. Respon positif yang mereka terima membawa mereka semakin terinspirasi untuk terus berkarya secara positif pula. Single baru kerap mereka sebar di dunia maya. Dari mulai lagu teranyarnya yang berjudul Mutiara Terindah sampai lagu terbaru bertajuk Bisa Bahagia.\r\n\r\nVELLAROSE EXPERIENCE\r\n\r\nPENTAS SENI DI SEKOLAH DAN UNIVERSITAS\r\n1. SMAN BHK Cibubur (2016)\r\n2. SMA Al-Azhar 4 Bekasi (2016)\r\n3. MAN 11 Jakarta (2014, 2015, 2016)\r\n4. SMAN 29 Jakarta (2016)\r\n5. SMAN 3 Jakarta (2016)\r\n6. SMAN 2 Bekasi (2015 & 2016)\r\n7. Univ. Yarsi Jakarta (2016)\r\n8. SMA Al-Azhar Harapan Indah (2016)\r\n9. SMA Jakasampurna Bekasi (2016)\r\n10. SMAN 10 Bekasi (2015)\r\n11. Univ. Negeri Jakarta (2015 & 2016)\r\n12. SMPN 216 Jakarta (2014 & 2015)\r\n13. SMAN 1 Tangerang (2015)\r\n14. SMAN 13 Jakarta (2015)\r\n15. SMA Sang Timur Jakarta (2015)\r\n16. SMAN 15 Bekasi (2015)\r\n17. MAN 4 Jakarta (2014 & 2015)\r\n18. SMAN 10 Bogor (2015)\r\n19. SMAN 14 Jakarta (2015)\r\n20. SMAN Global Mandiri Cibubur (2015)\r\n21. SMAN 1 Bekasi (2015)\r\n22. SMPN 9 Jakarta (2015)\r\n23. SMA Bakti Idhata Jakarta (2015)\r\n24. Univ. Pancasila (2014 - 2017)\r\n25. SMPN 99 Jakarta (2015)\r\n26. MAN 8 Ciputat (2014)\r\n27. Univ. Tarumanegara (2014)\r\n28. SMA Regina Pacis Bogor (2014)\r\n29. SMPN 117 Jakarta (2013)\r\n30. Institut Musik Indonesia (2013)\r\n31. SMAN 65 Jakarta (2013)\r\n32. SMAN 59 Jakarta (2013)\r\n33. Univ. Indonesia (2013)\r\n34. SMAN 11 Jakarta (2017)\r\n35. Etc . . . \r\n\r\nFESTIVAL DAN MUSIC EVENT\r\n1. Jakcloth (2013-2017)\r\n2. Street Wear Tour (2014)\r\n3. Road To Jakarta Fair (2014)\r\n4. Festival Musik Kementerian Perikanan 2013 (20 Besar)\r\n5. Breakout NET TV as Rising Star Levi’s (2014)\r\n6. Paramore Nite Paramore Indonesia (2014)\r\n7. Band Challenge OZ Radio 2014 (20 Besar)\r\n8. Demos Hero Hai Magazine 2013 (10 Besar)\r\n9. Demoskustik Hai Magazine & Chip Magazine (15 Besar)\r\n10. Demos Terpilih Hai Magazine edisi \r\n20/XXXVII/2013 (2013)\r\n11. Music Bite Greensand & 7 Eleven 2015 (3 Besar)\r\n12. Kickfest Bandung (2016)\r\n13. Teras Sore Elshinta TV (2016)\r\n14. Pensi Fair Global TV & LOOP ID 2016 (3 Besar)\r\n15. LOOP ID Jakarta 2014 (5 Besar)\r\n16. Levi’s Cool Park Bandung (2015)\r\n17. Teraskustik (2015)\r\n18. Supermusic Rockin Battle Jakarta (2017)\r\n19. Out of The Box website O’Channel (2013)\r\n20. Jakarta Music Society (2016 & 2017)\r\n21. Premium Nation 11st Anniversary (2014)\r\n22. Festival Go Accoustic Seven Eleven (2013)\r\n23. Gigs-gigs di Jakarta dan sekitarnya\r\n24. Hai Day (2017)\r\n25. Ramadhan Food Festival (2017)\r\n26. Sound of Tri Jakarta (2017)\r\n27. Tangerang Crowded Fest (2017)\r\n28. Jakarta Fair (2017)\r\n29. Projam Battle Series (Juni & juli 2017)\r\n30. Etc..\r\n\r\nALBUM KOMPILASI\r\nRacerkids Clothing Compilation (2014) – Song : Let It Flow\r\nShockline Records Compilation (2014) – Song : Sepeda\r\nJakcloth 5th Anniversary Compilation (2014) – Song : Let It Flow\r\nDaily Like Indonesia World Wide Sentuh Sentuh (2014) – Song : Let It Flow\r\nEasycore Not Dead Compilation ECND Records (2014) – Song : Let It Flow\r\nString Syndict Compilation (2014) – Song : Let It Flow\r\nIndiestortions vol. 2 (2015) – Song : Let It Flow\r\nKickfest Compilation (2015) – Song : Hylena\r\nIndie Compilation Indonesia (2016) – Song : Renjana\r\nEtc . . .\r\n\r\n\r\nR A D I O\r\n1. 97.6 Venus Makassar\r\n2. 102 Cassanova Bali\r\n3. Oz Radio Bali\r\n4. 89.7 Fm Global Radio Bandung\r\n5. RRI Pro 2 Bandung\r\n6. 99.1 Fm Kalaweil Kalimantan Timur\r\n7. 104.5 Unisi Jogja\r\n8. Kisi Fm Bogor\r\n9. Era Fm Univ. Negeri Jakarta\r\n10. Demajors\r\n11. IRS Radio\r\n12. RCBS\r\n13. Monochrome\r\n14. Name Radio\r\n15. Berisik Radio\r\n16. VIO (Voice Indie Online)\r\n17. Ruang Lain\r\n18. Goo Goo Radio\r\n19. Pro 2 Jak\r\n20. Etc . . .','Others','facebook;guitar_plus;','Jakarta',518,'2017-08-21 02:39:32','2017-08-21 02:39:32'),(248,'Bleeding Last Season','1503313856.jpg','Band asal kota Banyuwangi - Jawa Timur yang terbentuk dari tahun 2015 yang mencoba memberi warna baru pada musik indie Indonesia dengan mengusung genre Deathcore yang berbeda dari musik Underground yang lain. Bleeding Last Season mempunyai dua single. Single perdana berjudul \"Bloody Mary\" dan baru saja mengeluarkan single kedua yang berjudul \"Shoot Me\" yang sudah dapat didengar di Reverbnation / Soundcloud beserta VideoClip yang dapat ditonton pada saluran YouTube kami \"Bleeding Last Season\"\r\n\r\nUntuk prestasi, kami masuk top 10 bands dalam event BeholderFest (Bandung) yang di ikuti oleh band Indie seleruh Indonesia dan kami adalah salah satu yang mewakili Jawa Timur dalam audisi tersebut. Dan juga kami sudah sering perform dalam event besar di wilayah kami maupun di luar kota. Event besar yang pernah kami kunjungi seperti BeholderFest (Bandung), JakCloth 2016 (Jember), JemberIndieClothing (Jember), JemFest (Jember) dan kami juga sering menjadi Guest Stars di kota kami (Banyuwangi) seperti GrandOpening ExhaleApparel Store, RockGoJampi, Serdadu Blambangan #1 dan lain lain. Lagu kita \"Shoot Me\" juga sering masuk dalam nominasi top Indonesia Deathcore songs di berbagai Channel YouTube indie di Seluruh Indonesia seperti PalingBerisik, Loudonesia, Indonesian Deathcore dan lain lain.\r\n\r\nLebih lengkap nya bisa di cek FansPage akun media sosial kami \r\nInstagram : https://www.instagram.com/bleedinglastseason/\r\nFacebook : https://www.facebook.com/bleedinglastseason/\r\nReverbnation : https://reverbnation.com/bleedinglastseason\r\nSoundcloud : https://soundcloud.com/bleedinglastseason\r\nChannel YouTube : Bleeding Last Season','Others','instagram;guitar_plus;','Surabaya',534,'2017-08-21 03:10:56','2017-08-21 03:10:56'),(249,'Flato','1503313969.JPG','Main di DOM,jxtaiment,block m,','Pop','facebook;instagram;','Jakarta',536,'2017-08-21 03:12:49','2017-08-21 03:12:49'),(250,'THERRA','1503314814.jpg','berawal dari persahabatan yang mempunyai tujuan sama dalam bermusik untuk berkarya di industri musik','Pop','instagram;','Jakarta',533,'2017-08-21 03:26:54','2017-08-21 03:26:54'),(251,'CANGKIR','1503316069.jpg','BAND CANGKIR TERDIRI DARI 4 PERSONIL DENGAN TAMBAHAN ADDITIONAL PLAYER . BERDIRI SEJAK 2013 DAN TELAH MELEWATI BEBERAPA PANGGUNG BESAR DIJAKARTA DAN TV SWASTA . BERALIRAN POP GROOVE DENGAN SEDIKIT SENTUHAN JAZZ.','Jazz','instagram;poster;','Jakarta',538,'2017-08-21 03:47:49','2017-08-21 03:47:49'),(252,'Vyo ardie','1503317058.jpg','VYO ARDIE & BAND\r\n\r\n1.       Latar Belakang\r\n\r\nRasa syukur saya panjatkan kepada Tuhan Yang Maha Esa atas lagu saya MERAIH MIMPI  yang saya ciptakan bertujuan demi meramaikan industri musik tanah air.\r\n\r\nDengan bermunculan band-band indie dan penyanyi solo di kota sidoarjo maka persaingan pun sangat ketat. Karenanya saya ingin membuat lagu dengan genry pop modern  hingga akhirnya tercipta lagu MERAIH MIMPI\r\n\r\nsaya yang mencintai music dan ingin terjun serta maksimal dalam musik bertekad akan terus berusaha untuk memberikan yang terbaik.\r\n\r\nKarena mengawali karier dari bawah maka saya memutuskan untuk berkarier untuk mencari label jika suatu saat nanti saya mendapat tawaran rekaman dari salah satu label music di indonesia\r\n\r\n2.      Sejarah Singkat\r\n\r\nSaya vyo ardie\r\nPernah masuk  audisi dream band 3 2006 masuk 5 besar wakil jawa timur yang di adakan di kota surabaya di stasiun televisi swasta TV7 sekarang ( trans 7)\r\nDan sekarang masih aktif manggung di sidoarjo dan sekitar nya di bantu sama aditional player bass,drum,kybord\r\n\r\n3.      Visi & Misi\r\n\r\nAdapun Visi & Misi saya adalah memberikan hiburan yang menyenangkan pada setiap event  Dengan tujuan kedepannya bisa menjadi salah satu penyanyi solo dari sidoarjo yang berhasil sukses di belantika musik tanah air.','Pop','instagram;guitar_plus;','Surabaya',539,'2017-08-21 04:04:18','2017-08-21 04:04:18'),(253,'Chikin Braders','1503317533.jpg','Band alternative asal cirebon terbentuk februari 2016, berawal dari kejenuhan masing masing personil yang sudah memiliki band sendiri, mencoba warna baru dalam satu projectan, nama Chikin Braders sendiri di ambil dari nama Vokalisnya Chikin Muhammad dan Braders sendiri sebagai penambahnya, Eka Pratama digitar, Rahman Bass, dan Dirgantara disektor drum\r\nChikin sendiri adalah salah satu finalis 25 besar Indonesian Idol 2012 dan 2014, dan beinisiatif membentuk project braders ini\r\nPrestasi :\r\nFinalis Sound Of Tri 2017 indonesia, album kompilasi Revolusi Musik Indie Cirebon, EP Album indie \"Revolution Dreams\" by Chikin Braders 2016, Finalis Rockin Battle 2016, Guest Star SuperRawk Cirebon','Alternative Rock','instagram;teman;','Jakarta',531,'2017-08-21 04:12:13','2017-08-21 04:12:13'),(254,'METHAMORPHOSYS','1503320963.jpg','baru sampai on air d beberapa radio dalam kota','Pop','facebook;','Yogyakarta',541,'2017-08-21 05:09:23','2017-08-21 05:09:23'),(255,'eP\'s','1503325077.png','berawal dari kelas 2 sma kami sering main alat musik sambil bernyayi di kelas, hingga band kami sering tampil di acara acara besar:\r\n1. Hari kartini SMAN 5 Bogor\r\n2. Five Nativistic Anthem (Braja mustika Bogor)\r\n3. Thanks Giving (gumati Bogor)\r\n4. Wedding Party (Novotel Bogor)\r\n\r\nSelain live music, kami telah merilis 1 lagu buatan kami yang berjudul \"Tak Mengapa\" dan muncul di koran Radar bogor.','Pop','instagram;guitar_plus;','Jakarta',529,'2017-08-21 06:17:57','2017-08-21 06:17:57'),(256,'nggak rock n roll','1503325388.jpg','nggak rocknroll band berdiri dari tahun 2006. berawal dari band komunitas yang ada di wilayah bandar lampung. prestasi nggak rocknroll band pernah menjuarai beberapa event music di bandar lampung dan pernah menjadi band pembuka konser band SLANK ..','Heavy Metal','facebook;instagram;','Jakarta',545,'2017-08-21 06:23:08','2017-08-21 06:23:08'),(257,'Detected overall','1503326999.jpg','Detected overall adalah sebuah band beraliran \"Disasterpunk\"\r\n\r\nBand ini terbentuk kurang lebih pada tahun 2008, yang di gawangi oleh 4 orang personil Dhiasta as vocal/guitar • emaipi as guitar/Vocaloid • Rian as drum • nay as bass ini adalah formasi terbaru kami setelah bongkar pasang personil, dan pada akhir tahun 2016 lalu album perdana kamu baru saja di release secara mandiri (D.I.Y)\r\nUntuk saat ini kami terus fokus promo album kami yang baru saja direlease akhir tahun lalu','Alternative Rock','guitar_plus;','Jakarta',525,'2017-08-21 06:49:59','2017-08-21 06:49:59'),(258,'REVICALBAND','1503328299.jpg','Revical terbentuk pada tanggal 01 Mei 2010, yang mengusung genre Pop Alternative. Kata Revical sendiri berasal dari gabungan kata \"Revival In Call\", yang berarti memanggil sebuah kebangkitan.\r\n\r\nRevical mengikuti kompetisi Band yang diadakan oleh Mall Emporium dan Oz Radio pada Oktober 2014. Dan Revical mendapat juara pertama dalam kompetisi tersebut.','Pop','guitar_plus;teman;','Jakarta',528,'2017-08-21 07:11:39','2017-08-21 07:11:39'),(259,'HUMANIMAL','1503328499.jpg','Masih dengan hardcore rap ala beastie boys, biohazard, bodycount, deez nuts dan cypress hills, masih dengan spirit dan kemarahan yang sama. Itulah yang bisa di simak dalam kesan pertama saat mendengarkan single perdana dari HUMANIMAL. Band ini masih sangat belia, baru didirikan pada 1 August 2016. Tiga dari empat personil humanimal adalah pelaku lama dalam skena music hardcore tanah air. Mereka adalah Ex-personil dari Bestiality yang pada 30 April 2016 menyatakan bubar setelah 19 tahun malang melintang di skena hardcore tanah air. Lepas dari Bestiality, Dika (Bass), Qubil (Guitar), dan Upi (Drum) ternyata tak bisa berdiak diri terlalu lama, mereka mengaja Mahesa untuk mengisi slot vokal saat tercetus ide mendirikan Humanimal. Kata Humanimal adalah gabungan dari Human Animal, yang menurut filosofi mereka adalah \"Think like human, Do like animal!\" dan mereka tetap mengusung musik hardcore ditambah dengan nuansa Rap/Hip Hop pada vokal.\r\nSebagai perkenalan, humanimal telah merilis dua buah single dengan judul \"Human Animal\", Single ini secara resmi d rilis eksklusif oleh Eastern Wolves Music.','Others','instagram;','Jakarta',546,'2017-08-21 07:14:59','2017-08-21 07:14:59'),(260,'SPJ','1503332211.jpg','Mengekspresikan nada - nada manis','Pop','teman;','Surabaya',549,'2017-08-21 08:16:51','2017-08-21 08:16:51'),(261,'SAVE MY STORY','1503335204.jpg','Save my story adalah salah satu band indie yang berdomisili di Gorontalo yang mengusung genre pop punk..band ini terbentuk di akhir tahun 2015..sampai saat ini band ini masih aktif di event-event musik indie yang ada di seputaran sulawesi','Pop','teman;lainnya;','Surabaya',550,'2017-08-21 09:06:44','2017-08-21 09:06:44'),(262,'Fever Blues Magic','1503374684.PNG','Semua berawal dari \"BLUES\" pada awalnya kami tidak saling mengenal karena masing-masing personil suka dengan musik Blues kami di pertemukan di salah satu komunitas Blues di Banten (Banten Blues Brother) sejak saat itu kami sepakat untuk membentuk group band yang kami namakan FEVER BLUES MAGIC, tekad kami adalah membawa nama baik musisi Blues Indonesia ke seluruh penjuru dunia, Aseek.. dengan karya kami yang bergenre Blues Alternative, kami yakin bahwa kami pasti bisa, Merdeka!!','Blues','guitar_plus;','Jakarta',556,'2017-08-21 20:04:44','2017-08-21 20:04:44'),(263,'ARASHEL','1503374748.jpg','ARASHEL adalah band yang berasal dari Purwakarta.\r\ndibentuk pada tahun 2014.\r\nArashel mengusung genre Pop - Alternative rock.\r\nnama ARASHEL memiliki arti kuat dan terlindungi, dengan harapan dapat memberikan kepercayaan dan keuatan kepada seluruh personil nya untuk berjuang menggapai cita - cita, yaitu karya ARASHEL dapat diterima dan dinikmati oleh masyarakat Indonesia.\r\nSampai saat ini ARASHEL sudah memiliki fanbase di Purwakarta dengan sebutan Kawan Arashel.','Pop','facebook;guitar_plus;teman;lainnya;','Jakarta',60,'2017-08-21 20:05:48','2017-08-21 20:05:48'),(264,'DMG Band','1503383427.jpg','Berawal dari teman kampus, maka terbentuk lah band ini, kami lebih sering perform di acara wedding, daripada panggung, kalau panggung mungkin saat acara pensi dan semacam nya..','Pop','instagram;teman;','Jakarta',39,'2017-08-21 22:30:27','2017-08-21 22:30:27'),(265,'DMG Band','1503383627.jpg','Berawal dari teman kampus, maka terbentuk lah band ini, kami lebih sering perform di acara wedding, daripada panggung, kalau panggung mungkin saat acara pensi dan semacam nya..','Pop','instagram;teman;','Jakarta',39,'2017-08-21 22:33:47','2017-08-21 22:33:47'),(266,'NOVICE','1503385720.jpg','NOVICE : Jiwa baru yang satu tujuan bersatu dalam kesatuan ide dan kreative bermusik .\r\nPrestasi : Tamu undangan AMI AWARDS 2015\r\nGuest Star : Kick andy Metro Tv\r\nMusik kita TVRI Jateng','Pop','instagram;','Yogyakarta',560,'2017-08-21 23:08:40','2017-08-21 23:08:40'),(267,'Cobra','1503393825.jpg','Kami adalah sekumpulan saudara yang masih memiliki keterikatan darah. Dengan adanya sedikit bakat dan kemauan, kami membentuk band yang mengusung tema \"grindcore\". Di kota kelahiran kami, nama Cobra belumlah sempurna, namun untuk luar kota seperti Purwakarta, Subang, Tasik dan sekitarnya kami cukup dikenal. \r\nCobra sudah membuat EP Album berjudul \"Breaking News\" yang bisa didengarkan di link yang terserdia di bawah.\r\nSemoga berkenan, Terimakasih.\r\n#SalamOlahraga','Others','facebook;instagram;guitar_plus;umi;','Jakarta',562,'2017-08-22 01:23:45','2017-08-22 01:23:45'),(268,'Onewayband','1503399568.jpeg','Oneway terbentuk diJakarta tahun 2016, terdiri dari Morai (vocal), Ozzy (bass), Ryo (drum), dan Razak (gitar), yang berawal dari mengerjakan project musik bersama, lalu masing-masing personil memiliki kesamaan dari segi musikalitas dan visi misi yang sama.\r\n\r\nNama Oneway sendiri tidak mempunyai arti khusus dan spesifik. \r\n\r\nNama Oneway sendiri terinspirasi dari banyak kesamaan masing-masing personil.','Pop','facebook;instagram;informasi_toko;vipclub;guitar_plus;umi;maliq;poster;teman;lainnya;','Jakarta',565,'2017-08-22 02:59:28','2017-08-22 02:59:28'),(269,'Charicature','1503402739.jpg','Charicature berasal dari kota enrekang sulawesi selatan\r\nGitar 1: anchu anwar\r\nGitar 2: elhy parimba\r\nBass ;aldhy\r\nDrumer :jhono\r\nVocal :aris munandar','Pop','facebook;instagram;informasi_toko;vipclub;guitar_plus;umi;maliq;poster;teman;lainnya;','Jakarta',568,'2017-08-22 03:52:19','2017-08-22 03:52:19'),(270,'SHINE','1503404028.jpg','SHINE terbentuk pada 17 juli 2015, arti nama SHINE itu sendiri yaitu \"Bercahaya/Cahaya\". Untuk prestasi SHINE sendiri sudah banyak yang diikuti dari macam kegiatan acara festival, pagelaran, giggs, dan acara musik lainnya yang ada di bandar lampung, kami sangat berharap dari arti nama SHINE kami dapat menjadi band yang tetap bersinar di musik indonesia dan bisa berkarya dengan baik dan dapat di terima oleh seluruh masyarakat indonesia maupun luar.','Pop','instagram;umi;teman;','Jakarta',567,'2017-08-22 04:13:48','2017-08-22 04:13:48'),(271,'FAYO','1503411939.jpg','Fayo dibentuk sejak 1 juli 2014, \"fayo\" diambil dari bahasa nias yang berarti \"payung\", karena kami berharap musik kami dapat meneduhkan.\r\nFayo berkomitmen mengusung genre reggae dgn balutan tradisional nusantara,\r\n\r\nAdapun prestasi kami antara lain:\r\n- Juara 1 Festival Lagu Religi Ramadhan Fair \r\n Medan (2014)\r\n- Juara 2 Asian Beat Band Competition Regional Medan (2014)\r\n- Opening Act Soundsation Medan (2014)\r\n- Opening Act Soundsation 5 kota Medan, L.Pakam, Siantar, P.Sidempuan, Banda Aceh (2015)\r\n- Juara 1 Asian Beat Band Competition Regional Medan (2015)\r\n- Sepuluh Besar Asian Beat Band Competition National, Jakarta (2015)\r\n- Opening Act Suryanation Motorland Medan (2016)\r\n- Opening Act Soundsation Medan, Tebing Tinggi, Binjai, Lubuk Pakam, Sei Rampah (2016)\r\n- Opening Act Soundsation Binjai (2017)\r\n- Opening Act Soundsation Road To Soundrenaline Medan (2017)','Others','lainnya;','Medan',429,'2017-08-22 06:25:39','2017-08-22 06:25:39'),(272,'SNEAK BAND','1503412263.jpg','Sneak sebuah band pop/melodic punk, yang terbentuk di oktober 2016 lalu, band yang berasal dari Pematangsiantar (North Suamtera) berbasiskan oleh tiga orang pemuda yang sebenarnya mempunyai ketertarikan yang berbeda dalam hal genre musik. Setalah lama mendiskusikan akhirnya sepakat mendirikan SNEAK dengan have fun. Prestasi yang membanggakan adalah ketika kita membentuk band ini dan tidak membutuhkan waktu lama untuk mengerjakan meteri lagu, sepanjang perjalanan dari oktober tahun lalu sampai saat ini kami telah menyelesaikan 2 single,  berjudul \"Punk and Pain,  Out From My Depression\" dan 1 single recycle \"Punk and Pain\" menjadi versi akustik. Selain itu juga di Desember tahun 2016 sangat membanggakan ketika kita mendapat kesempatan untuk bermain di salah satu festival musik tahunan musik independent kota Pematangsiantar yakni Siantar Extreme Fest.','Others','guitar_plus;','Medan',513,'2017-08-22 06:31:04','2017-08-22 06:31:04'),(273,'TREA','1503415296.jpg','Berawal dari band yang berbeda - beda dan sering dipertemukan bahkan menjadi rival dalam event parade band, mereka pun saling kenal satu sama lain dan sering bertukar fikiran tentang musik serta saling berbagi job. febri berasal dari band  yang bernama unik, Fadil dan Rendi dari scarlett, lalu dzaky dari band shoulhunter. Pada tahun 2012 Dzaky mulai masuk menjadi additional dari band scarlett di karena kan drummer dari band scarlett berpindah domisili, dan pada tahun 2013 mreka dipertemuka dalam event kompilasi major eleven yg di selenggarakan oleh label asal Bekasi yaitu Naga Java, namun dalam event tersebut tidak ada hasil yang berarti mereka pun memutuskan untuk tidak melanjutkan project tersebut.\r\n\r\n Singkat cerita Band Scarlett dan Unik pun bubar jalan, hingga mereka semua sempat vacum dalam waktu yang cukup lama. Pada tahun 2014 fadil yang pada saat itu sedang melaksanakan kuliah kerja nyata (KKN) dalam perkuliahannya satu kelompok dengan sang vokalis yaitu febri. Dalam kegiatan KKN tersebut Fadil dan Febri sering kali mengisi waktu luangnya dengan iseng-iseng bermain alat music, dari situlah Fadil mulai punya keinginan untuk membentuk band lagi.\r\n\r\n Setelah beres kegiatan kuliah tersebut ada event salah satu brand roko menawarkan job kepada Fadil agar band yg terdahulunya mengisi acara tersebut, namun pada saat itu Fadil tidak memilik band dan mulai lah terfikir untuk membentuk suatu band. Mulai lah Fadil menghubungi kembali Rendi, Febri dan Dzaky untuk membuat sebuah band, dan bergabunglah mereka dalam satu band yang bernama B.O.O.T.S Band yang pada saat itu belum bernama Trea. Dalam jangka waktu 1 minggu band terbentuk merekapun langsung mengisi acara pada event brand rokok tersebut. Mulailah mreka sering mengisi event-event baik di dalam kota ataupun luar kota.\r\n\r\n namun dalam aransemen lagu-lagu mereka sering kali membutuhkan alunan keyboard maka merekapun menarik zody menjadi additional keyboard yg berasal dari band Scarlett. Seiring berjalannya waktu mereka pun terus maju bukan tanpa kendala, berbagai kendala sering kali menghampiri mereka. Masalah silih berganti namun setiap masalah selalu merka selesaikan tanpa berdampak negative pada band, justru dengan permasalahan tersebut menjadi pembleajaran yang sangat berarti sehingga membuat kekompakan terus meningkat dan semakin mematangkan mereka.\r\n\r\n\r\nSeiring waktu berjalan merekapun memutuskan untuk mengganti nama band mereka dikarnakan nama B.O.O.T.S Band diambil untuk nama sementara karena saat awal terbentuk mereka di hadapkan untuk langsung mengisi acara, bukan hal yang mudah untuk memutuskan suatu nama band merekapun masing masing mengumpulkan kandidat untuk penggantian nama B.O.O.T.S Band, setelah perundingan dan penyaringan maka muncul lah nama Tread dan Altar. Dan yang sebenarnya terpilih adalah Altar, namun pada satu event di saat pendataan band fadil salah menyebut nama malah Trea yang terdaftar. Namun semua personil menyepakati untuk membatalkan nama Altar dan setuju untuk meresmikan nama TREA yang di ambil dari kata Yunani yang bearti memiliki pengaruh. Dan harapan mereka Trea Bisa di terima oleh masyarakat Indonesia serta dapat membawa pengaruh positif pada industry music Nasional.','Pop','teman;','Jakarta',111,'2017-08-22 07:21:36','2017-08-22 07:21:36'),(274,'STEREA','1503420525.JPG','STEREA terbentuk pada awal 2010 dibekasi,berawal dari jam session distudio beberapa kali sampai menemukan kecocokan satu sama lainnya\r\nSetelah beberapa kali melakukan jam session maka terbentuklah band STEREA ,yang berarti SOLID\r\nDengan filosofi kita selalu solid / kompak disetiap keadaan\r\nDengan dukungan dari sahabat dan keluarga,sterea bisa mengikuti beberapa acara pensi dan Event-event yang ada di beberapa tempat\r\n \r\n	STEREA terdiri dari,UBAY (vocal),FAI (gitar),KEMAL (bass),PIPO (drum)\r\nStage experience :\r\n-	A mild soundsation bekasi\r\n-	Pro mild bekasi\r\n-	Giggs lumbung padi\r\n-	Event Liverpool café \r\n-	Yamaha road race (dawuan karawang)\r\n-       Rockin Battle','Alternative Rock','guitar_plus;','Yogyakarta',574,'2017-08-22 08:48:45','2017-08-22 08:48:45'),(275,'Alaskan Minority','1503424651.jpg','BIOGRHAPY\r\nAlaskan minority, Terbentuk pada tanggal  4 Maret 2016 dengan beranggotakan 4 personel,yaitu :\r\nMaulana (drum) , Gilang (lead guitar) , Yoga(ex Ryhtim) , Barra (bass and vocal).\r\n\r\nNama Alaskan minority tersebut memiliki filosofi yang diambil dari ALASKAN dan MINORITY atau\r\n\r\nMINORITAS.\r\n\r\n(alaskan)penduduk alaska yang dimana Alaska itu adalah suatu tempat yg jauh dan dingin serta tidak banyak terjamah oleh masyarakat,tetapi tempat yg sangat ingin dikunjungi. (minority) berartikan minoritas yang dimana sebagai masyarakat atau sekumpulan minoritas pada suatu tempat. Dengan demikian ALASKAN MINORITY sebagai tempat bagi orang orang minoritas yang sangat ingin dikunjungi (dikenal) meskipun hanya sebagai orang minoritas,tapi tetap bersikap “dingin”\r\n\r\nPada bulan Mei 2016 Alaskan Minority meluncurkan lagu pertama yang berjudul ‘flesh and bone’ lalu pada bulan Juli meluncurkan single kedua nya yaitu ‘oblivion’\r\n Seiring berjalan nya waktu alaskan minority bersepakat untuk menambah personel dengan mengisi pada bass.setelah sepakat untuk memustuskan siapa yang akan mengisi pada bass,akhirnya posisi bass diambil alih oleh Fachry (Baim).\r\n\r\nBanyaknya permintaan dari pendengar meminta lagu flesh and bone dibuat versi akustik,karena banyak pendengar dan “minoritas” yang meminta,maka kami setuju untuk membuat lagu ‘flesh and bone’ versi akustik.dan rating menunjukan bahwa flesh and bone versi akustik lebih banyak dinikmati.\r\n\r\nSetelah Baim bergabung bersama alaskan,tiba di penghujung cerita bahwa Yoga memutuskan untuk hengkang dari alaskan minority karena satu dan lain hal.bersamaan dengan hengkangnya yoga,bersamaan itu pula alaskan meluncurkan single ketiga nya yang berjudul ‘its not a good choice,but this is the best plan’\r\nDan hingga saat ini alaskan minority sedang mengerjakan lagu lagu yang akan dibuat dalam satu EP album yg bertajuk ‘CYCLE’, setelah meluncurkan lagu keempat yang berjudul ‘unbeaten’\r\n\r\n\r\nPerform Experience\r\n\r\nDies Natalis MIPA UNJANI (Maret 2016)\r\n\r\nMode Market (April 2016)\r\n\r\nKiara Condong (September 2016)\r\n\r\nInhoftank (Oktober 2016)\r\n\r\nDies Natalis INFORMATIKA UNJANI (Oktober 2016)\r\n\r\nGreen Foodcourt UNJANI –LACOMM ( Oktober 2016)\r\n\r\nSTOCKLOT-LACOMM (November 2016)\r\n\r\nEvolusi Genetik Party –Ciamis (Desember 2016)\r\n\r\nMINDSET - Cimahi (Desember 2016)\r\nSubang Bersatu Vol. 1 – Subang  (Februari 2017)\r\n\r\nPsycolor Glowing Run – Unjani Cimahi  (Februari 2017)\r\n\r\nBogor Metalcore – Bogor  (Februari 2017)\r\n\r\nFESSPPA – Cimahi  (Maret 2017)\r\n\r\nOne Tun – Bandung  (April 2017)\r\n\r\nApril Mosh – Cikalong Wetan  (April 2017)\r\n\r\nSuper Rawk – Bandung  (April 2017)\r\n\r\nJakcloth Summerfest 2017 – Jakarta  (Mei 2017)\r\n\r\nClothing Fastingval – Bogor  (Juni 2017)','Others','instagram;informasi_toko;guitar_plus;poster;teman;lainnya;','Jakarta',323,'2017-08-22 09:57:31','2017-08-22 09:57:31'),(276,'Eigengrau','1503428350.JPG','Where did we spot \"Eigengrau\"? The Germany has a saying for the light which creates its own gray color known as Eigengrau. How we would unify the meaning into the characters of our band is the way our music alters the ignition of a gray light knowing that the last hope is in the harmony we create. Our music is like an ocean shining through the reflection of a moonlight where gray clouds and narrowed breeze can still bring hope to another night and keeping us safe until the next morning. Let\'s talk about who we are. Eigengrau is the colliding of many different bands into one portion of a whole bowl. In this one enthusiastic bowl, you may find flesh and blood of our cultural Indonesian humanity pouring into the harmony of percussion. It is like a cinnamon in a bowl of creamy flavored ice cream where you get the highlight as well as the intriguing taste. Now, imagine having a bowl of us in the middle of a Mediterranean Sea under the galaxy of gray sparkles. Starting by the middle of 2016, we were formed by our very own ambitious vocalist a.k.a. The and guitarist a.k.a. Deden when they were spurting each others\' feelings about music and all those band talk. They both reconcile the true meaning of harmony and decided to hold each others\' hands in creating a song delightedly to be out of the box known as Only You as our single. Obviously, playing a track on live performances would not be what we had in mind in committing music. So we tagged along our significant others--we shall call them Fadjar as our drummer; Dio as our bassist; Bunga and Nold as our percussionist; and Sita as our synthesizer--who are passionate to enlighten music together in perpetual to Eigengrau.','Others','instagram;maliq;','Jakarta',578,'2017-08-22 10:59:10','2017-08-22 10:59:10'),(277,'Walking Time','1503452042.jpg','Juara  1 Akustik ( Metamorphoses Competition).\r\n20 Besar Vidio.com Musicbattle Bersama Ariel Noah.\r\n20 Besar soundof3 Jabotabek.\r\n20 besar akustik sejabotabek ( Kampung indie Competition )','Pop','teman;','Jakarta',579,'2017-08-22 17:34:02','2017-08-22 17:34:02'),(278,'Walking Time','1503452043.jpg','Juara  1 Akustik ( Metamorphoses Competition).\r\n20 Besar Vidio.com Musicbattle Bersama Ariel Noah.\r\n20 Besar soundof3 Jabotabek.\r\n20 besar akustik sejabotabek ( Kampung indie Competition )','Pop','teman;','Jakarta',579,'2017-08-22 17:34:03','2017-08-22 17:34:03'),(279,'Alceo','1503472449.jpg','Terbentuknya Alceo Band pada tahun 2015 di Serang-Banten, awalnya hanya 2 personil yaitu Adam (Guitar) & Enda (Vocal) seiring berjalannya waktu akhirnya kita memutuskan untuk menambah personil lengkap untuk lebih serius, dan kita coba buat 1 demo lagu untuk kita publikasikan lewat radio-radio lokal yang berada di kota kami, berangkat dari tekad dan keseriusan kami yakin dan percaya pasti ada kesempatan yang datang untuk band kami, Alceo Band.','Pop','guitar_plus;','Jakarta',587,'2017-08-22 23:14:09','2017-08-22 23:14:09'),(280,'arosafocus','1503473085.jpg','juara 1 FEST HONDA\r\nFINALIS WANTED 2009\r\nFINALIS LA LIGHTS INDIFEST 2011','Alternative Rock','instagram;','Surabaya',588,'2017-08-22 23:24:45','2017-08-22 23:24:45'),(281,'MERONTA band','1503477907.jpg','jackloth summer fast 2017','Rock','facebook;instagram;','Surabaya',590,'2017-08-23 00:45:07','2017-08-23 00:45:07'),(282,'BRIGEZTREGGAE','1503482645.jpg','Brigeztreggae dibentuk di Ciputat pada tanggal 28 Oktober 2016. Yang mengusung aliran Reggae, dengan sentuhan Pop, Rock.\r\n\r\n* Finalis Sound Of Tri (perwakilan Banten)\r\n* Guest Star at Anniversary Kelurahan Mekar Jaya, Tangsel\r\n* Peserta Competition at Starlight, Jakarta Timur\r\n* Guest Star Pensi SMK Puspita Bangsa, Tangsel\r\n* Guest Star at HERO Terogong New Year Party, Jakarta Selatan\r\n* Guest Star at Pilar Ciputat Sumpah Pemuda, Tangsel','Others','instagram;guitar_plus;maliq;','Jakarta',398,'2017-08-23 02:04:05','2017-08-23 02:04:05'),(283,'the Weekenders','1503484300.jpg','Manggung di acara-acara biasa','Others','poster;','Jakarta',598,'2017-08-23 02:31:40','2017-08-23 02:31:40'),(284,'The Tripper','1503485928.jpeg','Berangkat dari lagu My Swinging Blue Jeans yang kami rasa ada benang merahnya dengan konsep Jeans sebagai sandang, teman, pasangan, bahkan jodoh, kami memulai kolaborasi musik.','Others','instagram;','Jakarta',580,'2017-08-23 02:58:49','2017-08-23 02:58:49'),(285,'HIS_Musik','1503491728.jpg','runner up cardinal 2008\r\nfinalis asian beat regional bekasi 2009\r\nfinal L.A Starup regional bekasi 2010','Pop','poster;','Jakarta',573,'2017-08-23 04:35:28','2017-08-23 04:35:28'),(286,'THE XANDER','1503492773.jpg','The Xander berdiri pada tahun 2007. berkiprah di event musik indie dan festival pada tahun 2009 dengan karya lagu ciptaan sendiri dan meraih juara indie radio online serta konser 1000 band.','Pop','teman;','Jakarta',416,'2017-08-23 04:52:53','2017-08-23 04:52:53'),(287,'VOIS','1503494408.jpg','Guest Star SMA 6 Tanggerang Selatan Akral Arnawa','Pop','poster;','Jakarta',604,'2017-08-23 05:20:08','2017-08-23 05:20:08'),(288,'Manjakani','1503494549.jpg','MANJAKANI, berawal dari pertemuan Taufan dan Nabilla di sebuah institusi pendidikan yang sama. Ketertarikan sepasang kekasih ini kepada musik melahirkan kreativitas yang unik.Taufan dan Nabilla terus melanjutkan proyek musik dengan serius, hingga akhirnya terbentuklah nama MANJAKANI sebagai duo yang berasal dari Kota Pontianak. \r\nJuni 2015, MANJAKANI pun mulai memberanikan diri membawakan lagu-lagu ciptaan mereka sendiri ketika tampil sebagai pembuka dalam acara peluncuran mini album salah satu band indie Pontianak. Gayung bersambut, lagu-lagu MANJAKANI ternyata cukup bisa diterima pecinta musik. Kini MANJAKANI pun merilis lagu pertama yang mereka ciptakan berjudul \'ASMARAWEDA\'. Lagu tersebut mengawinkan harmonisasi yang manis dari permainan gitar akustik Taufan & Nabilla. Nabilla pun memberikan vokal yang penuh diiringin suara Taufan. \r\n\r\nBanyak terdapat pro dan kontra dalam pemilihan nama, Arti manjakani sendiri secara harfiah merupakan ramuan atau obat perapat yang biasa digunakan oleh wanita, sebagai filosofi musiknya, diharapkan pendengar merapatkan telinga dan pendengarannya pada kesyahduan musik manjakani yang mengusut genre folks pop dan secara visual memang begitu sunyi.\r\n\r\nMANJAKANI kini sudah melepas Single dan Music Video yang berjudul “Asmaraweda” dan dilanjutkan dengan proses penggarapan album pertama yang mencakupi beberapa lagu antara lain Asmaraweda, Asam Pedas,Hitam Putih dan lagu lainnya yang akan dirilis dalam waktu dekat.\r\n\r\nBerikut adalah beberapa link tentang karya Manjakani yang sudah didokumentasikan:\r\n\r\nLive Session “Bunyi Simpanan” #1\r\nhttps://www.youtube.com/watch?v=25m7dZ5GTIk\r\nManjakani – Asmaraweda Official Video Lyric\r\nhttps://www.youtube.com/watch?v=go3g45559bk\r\nManjakani – Asmaraweda Official Music Video\r\nhttps://www.youtube.com/watch?v=d5AoIgVsSHc\r\nManjakani – Hanyut (Live at Leks Mansion, Kuching Malaysia\r\nhttps://www.youtube.com/watch?v=FA661L9D6KA\r\nBanda Neira – Yang Patah Tumbuh Yang Hilang Berganti (Cover)\r\nhttps://www.youtube.com/watch?v=lzh_NgkqrrE\r\nInterview Qubicle\r\nhttps://qubicle.id/interest/7914\r\nReviewThedisplay.net (Video Music “Asmaraweda”)\r\nhttp://thedisplay.net/2017/05/03/manjakani-asmaraweda-music-video/\r\n\r\n\r\nPRESTASI \r\n1. Line Up Folk Music Festival 2017, Malang\r\n2. Urban Gigs Yogyakarta 2016\r\n3. Best Of Three  Sound Of Tri Jakarta 2017, Ecopark Ancol\r\n4. Juara 1 Pekan Inovasi RRI (Radio Republik Indonesia)','Folk','teman;','Jakarta',602,'2017-08-23 05:22:29','2017-08-23 05:22:29'),(289,'kosmonote','1503496654.jpg','PRI 2017 (*Pekan Raya Indonesia*, ICE BSD)\r\n- Borneo Beerhouse, Kemang (Performing with *Expedition Moscow*, from\r\nRussia)\r\n- PRJ 2017 (*Pekan Raya Jakarta Kemayoran*, Cardinal Stage)\r\n- PRJ 2017 (*Pekan Raya Jakarta Kemayoran*, Gambir Stage)\r\n- Ziplong event, Tangerang','Electro','poster;','Jakarta',605,'2017-08-23 05:57:34','2017-08-23 05:57:34'),(290,'Kalvari','1503501880.jpg','Cerita Band:\r\nKalvari terbentuk di Pamulang Tangsel pada 11 September 2014. Band yang mengusung rock sebagai warna dasar musik mereka ini beranggotakan Gogo (voc), Umbu (guitar), Baskoro (bass), Geo (drum). Lirik dan lagu yang Kalvari ciptakan itu sendiri tidak lepas dari isu kehidupan sehari-hari.\r\n\r\nVIVA KALVARI!\r\n\r\nPrestasi band:\r\n1. Teraskustik Chapter 48 Teraskota BSD;\r\n\r\n2. Anniversary 4th Squadward Jakarta;\r\n\r\n3. A3 We Are Back Again Event Ciledug;\r\n\r\n4. Tangerang Crowded Fest;','Rock','facebook;','Jakarta',558,'2017-08-23 07:24:40','2017-08-23 07:24:40'),(291,'Gos blues','1503505980.jpg','terdiri dari 3 personil yang berbera genre dan mengusung musik blues rock , hingga sampai saat ini masih terus berkarya  bermain dari panggung ke panggung di beberapa event yang ada di bandung, sekarang juga lagi proses pembuatan mini album ber isi  7 track dan pernah sekali menjuarai festival musik di salah satu universitas di bandung','Blues','facebook;instagram;','Jakarta',610,'2017-08-23 08:33:00','2017-08-23 08:33:00'),(292,'YELLOW JET CLUB','1503509115.jpg','Yellow Jet Club, Kuartet Semarang yang terbentuk pada awal 2016,  yang beranggotakan gabungan dari beberapa band kota semarang yaitu Isa \"santikarisma\" - (guitar/vokal)  Ari \"Redam\" - (drum), adit \"pyong pyong, weekenders a gogo\" (bass),  riky \"santikarisma\" (guitar lead ). bergenre indie rock dengan nuasa ala yellow jet club. Yellow jet club telah merilis debut single pertama pada tanggal 21 april bertepatan pata perhelatan record store day berjudul \"shake the world\". Lalu YJC Mengadakan tour sendiri bertajuk shake the world tour jawa timur dan bali pada tanggal 18 - 23 agustus2017. YELLOW JET CLUB sedang mempersiapkan EP album pertamanya dan akan di rilis secepatnya.','Alternative Rock','teman;','Yogyakarta',611,'2017-08-23 09:25:15','2017-08-23 09:25:15'),(293,'SANTIKARISMA','1503511404.jpg','Santikarisma, bergenre Rock Semarang terbentuk pada 2012,  yang beranggotakan  RioSu(Vokal), Isa (Gitar – Backing Vocal),  Riky ( gitar ) Okky tawon ( bass) Minyut Sofyan (Drum).  Santikarisma  telah mengeluarkan 1 lagu demo yaitu “kembalikan derajat\"  pada bulan agustus 2014 . Setelah mengerluarkan demo lagu, Santikarisma langsung merekam materi baru yang rencananya akan mereka rilis dalam bentuk Single lagu pada bulan april ini 2017.\r\nSingle tersebut akan dirilis  dalam bentuk fisik dan melalui kanal soudcloud berjudul \"sugestivisi\" yang menceritakan tentang ungkapan saran dan hasrat dalam bermusik. Setelah rilis nya single, santikarisma berencana merilis album debut pertamanya brtajuk serupa \"sugestivisi\". santikarisma akan merilis album debut pertamnya pada september 2017 ini yang di naungi oleh maternal disaster record','Rock','teman;','Yogyakarta',612,'2017-08-23 10:03:24','2017-08-23 10:03:24'),(294,'Gos blues','1503512961.jpg','kami dari Gos blues terdiri dari 3 personil, berdiri pada tahun 2013 yang mengusung gende musik blues rock,sekarang ini lagi menggarap mini album yang mudah2an akan rilis awal tahun 2018, pernah juga menjuara festival musik rock di salah satu universitas yang berada di bandung dan sampai sekarang masih aktif dari panggung ke panggung di beberapa event2\r\n-event yang ada di kota bandung','Blues','facebook;instagram;','Jakarta',614,'2017-08-23 10:29:21','2017-08-23 10:29:21'),(295,'Gos blues','1503512991.jpg','kami dari Gos blues terdiri dari 3 personil, berdiri pada tahun 2013 yang mengusung gende musik blues rock,sekarang ini lagi menggarap mini album yang mudah2an akan rilis awal tahun 2018, pernah juga menjuara festival musik rock di salah satu universitas yang berada di bandung dan sampai sekarang masih aktif dari panggung ke panggung di beberapa event2\r\n-event yang ada di kota bandung','Blues','facebook;instagram;','Jakarta',614,'2017-08-23 10:29:51','2017-08-23 10:29:51'),(296,'Tetra','1503514462.jpg','Tetra berdiri sejak 2014 silam dengan latar belakang kesamaan persepsi tentang musik. Nama Tetra diambil dari gelombang \'theta\' yaitu gelombang otak yang dihasilkan manusia saat sedang bermimpi, meditasi, atau hypnosis. Sangat terpengaruh dengan musik era 70-an seperti Pink Floyd, The Beatles, King Crimson, The Doors, hingga Jimi Hendrix. Saat ini Tetra tengah mempersiapkan debut album nya secara indie. Tetra pernah terpilih menjadi 3 besar Bogor Local Heroes yang diselenggarakan RRI Radio. Juga terpilih untuk masuk album kompilasi ripstore.asia se Jabodetabek.','Others','guitar_plus;','Jakarta',613,'2017-08-23 10:54:22','2017-08-23 10:54:22'),(297,'C\'kroll','1503517784.jpg','C\'kroll band berdiri pada tahun 2009','Alternative Rock','facebook;instagram;','Jakarta',615,'2017-08-23 11:49:44','2017-08-23 11:49:44'),(298,'Fireflies','1503549788.jpg','Fireflies adalah sebuah band bergenre\r\nPop Rock Punk yang berasal dari kota Bandung.\r\nMusik kita tergabung dalam tiga genre antara\r\nPop, Rock, & Punk.','Pop','instagram;','Jakarta',617,'2017-08-23 20:43:08','2017-08-23 20:43:08'),(299,'Gladiss','1503553794.jpg','Gladiss adalah sekolompok anak muda asal Sekayu Muba, Sumatera Selatan yang memiliki ketertarikan yang sama terhadap musik.','Pop','guitar_plus;','Jakarta',576,'2017-08-23 21:49:54','2017-08-23 21:49:54'),(300,'WEFLY','1503556194.jpg','WEFLY adalah Band asal Yogyakarta yang terbentuk pada tanggal 15 Desember 2015, yang beranggotakan Vosta (Vocal), Yongki (Guitar), Dani (Guitar), Evan (Bass), dan Bibi (Drum).','Rock','instagram;teman;lainnya;','Yogyakarta',505,'2017-08-23 22:29:54','2017-08-23 22:29:54'),(301,'ID band #ickydedi','1503556594.jpg','ID iyaaa ID..\r\nkenapa namanya ID?\r\nID artinya identitas..\r\ndibaca inggris \"aiiiidiiii\"\r\nDibaca indonesianya \"iiideee\"\r\nKami anak muda yang ingin menciptakan \"iiideeee\" baru di musik indonesia agar musik indonesia come back seperti dulu.. Hehe amin?\r\nYang sebenarnya nama singkatan vocalis dan gitaris..?\r\nnama vocalisnya \"icky\" dan gitarisnya \"Dedi\" jadinya ID\r\n???\r\nSalam perkenalan semuanya..\r\nSemoga ID bisa menghibur dan meramaikan industri musik di negara kita yaitu INDONESIA?amin..\r\nDan bisa membawa nama negara INDONESIA di industri musik luar negri..\r\nMembawa harum nama negara kita di berbagai negara.. Amin?\r\nmateri lagu dari kami tentang kehidupan?\r\nkita hidup harus yakin!\r\ntanamkan dari hatimu keyakinan bahwa kita mampu berjuang demi kebahagia\'an.. Jangan pernah mengeluh..\r\nSemua akan indah pada akhirnya...??\r\nUntuk Materi lagu masih dalam proses pembuatan.. insya ALLAH kami juga akan membuat vedeo clip di hits lagu kami yang berjudul \"my decision\"\r\nNantikan ya guys?\r\nLove you all..\r\nMaju terus musik INDONESIA..?','Pop','facebook;instagram;','Jakarta',608,'2017-08-23 22:36:34','2017-08-23 22:36:34'),(302,'Jumperfi','1503557177.jpg','Planetrox 2016 big 5 Indonesia Finalist, Japex 2016, Audiopro Randall-Russel featuring band,  Pekan raya Indonesia 2016, Konser1000Band,  SCTV, Liputan6.com Akustikplus. Jan 2017,  SGC Reunion - Gitarplus Stage, Summarecon Mall Serpong, Performer, March 2017,  Showcase @Pavilliun28, May 2017,  JakartaFair 2017, Main stage, 1 july 2017 (feat. Bengbeng PASband & Baken Hellcrust),  YAMAHA Tone Made Easy Performer','Rock','guitar_plus;','Jakarta',277,'2017-08-23 22:46:17','2017-08-23 22:46:17'),(303,'violet','1503560006.jpg','VIOLET\r\n- Pernah mengikuti ajang A MILD Live WANTED \r\n- Band Pembuka D \'MASIV @ Bangkalan Madura\r\n- memiliki 22 lagu ( 2 album ) dengan aliran pop','Pop','teman;','Surabaya',67,'2017-08-23 23:33:26','2017-08-23 23:33:26'),(304,'violet','1503560096.jpg','VIOLET\r\n- Pernah mengikuti ajang A MILD Live WANTED \r\n- Band Pembuka D \'MASIV @ Bangkalan Madura\r\n- memiliki 22 lagu ( 2 album ) dengan aliran pop','Pop','teman;','Surabaya',67,'2017-08-23 23:34:56','2017-08-23 23:34:56'),(305,'RISE','1503561913.jpg','RISE is an Indonesian brand new 80’s fussion rock. We\r\n				  Rock music as a red line blend with various other genre\r\n\r\n1. Featuring band in SMA 34,SMA 1 Bekasi, SMA Labschool Cibubur,SMA MH Thamrin.\r\n\r\n2. Guest star at firstmedia TV,Ireng Halimun art showcase, \r\n                                                      Record Storeday Pasar Santa Day 3\r\nexperience here!)   		   3. Guest Star at Independent Radio in Bintaro','Rock','facebook;instagram;informasi_toko;guitar_plus;umi;teman;','Jakarta',622,'2017-08-24 00:05:13','2017-08-24 00:05:13'),(306,'UNISEX','1503562663.jpg','Berikut link yang menceritakan sedikit tentang unisex : http://m.viva.co.id/life/hiburan/652145-15-tahun-band-unisex-setia-di-jalur-punk-rock','Rock','guitar_plus;','Jakarta',620,'2017-08-24 00:17:43','2017-08-24 00:17:43'),(307,'Buddy Bully','1503567098.jpg','Berawal dari tahun 2007, kami dikenal dengan nama NATALIE (Negative Attitude Is Not A Little Effort) lalu di tahun 2015 kemarin kami menjadi Buddy Bully\r\n\r\nDi tahun 2016 kemarin kami sudah mengeluarkan mini album yang berjudul Buddy Bully EP dengan 5 lagu dengan lagu gatjoan berjudul \"Try To Be Cool\"','Rock','guitar_plus;','Jakarta',625,'2017-08-24 01:31:39','2017-08-24 01:31:39'),(308,'SECRET MEADOW','1503567247.JPG','Secret Meadow was formed in early 2016 and consists of Ricardo Tufano (Guitar/Vocal), Jaro Petang (Guitar/Synth), Arief R. Wijaya (Bass), and Mulyana A. Viqry (Drums).\r\n\r\nWorking at a record store together for almost 2 years made them eager to form a band, but couldn\'t be realized due to the lack of free time they can spent together.\r\nThe long awaited moment came out in their favor right after Edo\'s (Ricardo) resignation from the store, and Jaro, who had resign earlier.\r\n\r\nSecret Meadow played within the range of The Cure to Deerhunter, Nick Drake to Slowdive a blend between pop and alternative rock, even with the touch of folk music.\r\n\r\nTheir first single, Water in the Flowing River, talks about the simplified interpretation of the concept of time. How it described that time is like river without banks, a basic structure of the universe that  transcends everything. Time, is the cause of creation and destruction at once. \r\nThe Song itself is packaged in a pop kind of music with jangly guitar and a touch of ambient synth sound on the back, inviting those who listen to contemplate about everyday life.\r\n\r\nOn february, they finally released Same Old Fear, an extended play consists of 5 tracks, includes their previously released single. Just Like how the title sounds, they\'re talking about the fear of being twenty-something, singing out the anxiety of young adulthood.','Pop','facebook;informasi_toko;','Jakarta',621,'2017-08-24 01:34:07','2017-08-24 01:34:07'),(309,'Hoolahoop','1503569448.jpg','- Perwakilan Indonesia; Music Matters Live, Singapore (2015)\r\n- Perwakilan Indonesia; MU:CON Seoul, South Korea (2015)\r\n- #Saatnya Konser Untuk Berlari, 2015 (Konser Perdana)','Alternative Rock','facebook;poster;','Jakarta',557,'2017-08-24 02:10:48','2017-08-24 02:10:48'),(310,'de-classe','1503571747.JPG','wasting time','Others','teman;','Jakarta',629,'2017-08-24 02:49:07','2017-08-24 02:49:07'),(311,'kebunku','1503580878.jpg','Biography\r\n\r\nKebunku adalah sebuah Band yang berdiri pada tahun 1999,\r\nyang saat itu ketiga personilnya sedang mendalami ilmu menggambar di Fakultas Seni Rupa Institut Kesenian Jakarta.\r\n\r\nSetelah menjalani dua tahun pendalaman ilmu menggambar,\r\nmereka mulai mengalami hal-hal yang berbenturan dengan apa yang mereka inginkan.\r\nbahwa ternyata semua tidak sesuai dengan apa yang digambarkan…\r\nbahwa ternyata kenyataan selalu membuat mereka merasa tertekan…\r\nuntuk menyuarakan keresahannya akhirnya Johan, Tombak, dan Oki sepakat untuk membentuk sebuah Band\r\ndengan nama KEBUNKU.\r\n\r\nNama Kebunku didapat karena Institut Kesenian Jakarta sebelum menjadi tempat menimba ilmu kesenian, yang dulunya merupakan kebun binatang.\r\ndan sampai sekarang masih banyak pohon-pohon besar yang hidup disana,\r\nmembuat para mahasiswa seperti tinggal di kebun.\r\n\r\nDengan musik PUNK ROCK yg mengusung tema keseharian,\r\nKEBUNKU mulai menciptakan lagu-lagu yang dianggap mampu mewakili perasaan mereka\r\ndan perasaan rekan-rekan senasib.\r\n\r\nPada awalnya formasi KEBUNKU (tahun 1999) adalah:\r\n\r\nGuitar/Vocal : Johan K\r\nBass : Oki\r\nDrum : Tombak\r\n\r\nSetelah merasa letih dengan popularitas dan ingin meneruskan studinya,\r\nakhirnya Johan mengundurkan diri pada tahun 2004,\r\nyang akhirnya posisinya digantikan oleh Bobby dan ditambah Caesar.\r\nMaka formasi KEBUNKU saat itu menjadi :\r\n\r\nGuitar/Vokal : Bobby\r\nGuitar/Back Voc : Caesar\r\nBass : Oki\r\nDrum : Tombak\r\n\r\nLalu setelah sekian lama kita bertahan dengan formasi tersebut,\r\ndengan sangat disayangkan harus merubah formasi kembali\r\ndan formasi final saat ini Kebunku (pada tahun 2009) berubah formasi menjadi :\r\nGuitar/Vokal : Bobby\r\nBass : Oki\r\nDrum : Tombak\r\n\r\nsaat ini  2017 \r\nGuitar/Vokal : Bobby\r\nBass : tommy\r\nDrum : Tombak','Others','guitar_plus;teman;','Jakarta',627,'2017-08-24 05:21:18','2017-08-24 05:21:18'),(312,'Shakalus','1503582677.jpg','jadi band ini terbentuk 2012, lalu berkembang menjadi Arupadhatu band etnik asal Jember. Namun Shakalus tetap pada formasi utama','Pop','facebook;teman;','Surabaya',637,'2017-08-24 05:51:17','2017-08-24 05:51:17'),(313,'WEFLY','1503583064.JPG','Wefly adalah sebuah grup musik bergenre Pop/Rock Alternatif yang berasal dari Kota Yogyakarta, Indonesia. Grup musik ini dibentuk pada tahun 2015 dengan single pertama yang berjudul “Dengarkan Suara Hati”. Grup band ini terdiri dari 5 personil yaitu Vosta (Vocal), Yongky (Lead Guitar), Dani (Rhythm Guitar), Evan (Bass) dan Habibi (Drum). Grup musik ini juga mengenalkan lirik yang sederhana dan puitis, musik yang mudah di ingat dengan ciri khas suara sang vokalis Vosta. Wefly sendiri diambil dari kata we dan fly yang berarti kita terbang atau kita akan terbang. Sesuai dengan visinya, anggota grup musik ini menamakan dirinya wefly karena ingin membawa karya-karya mereka keberbagai kota di Indonesia bahkan keluar Negeri.\r\n\r\nAwal terbentuk:\r\nGroup band Wefly terbentuk berawal dari pertemuan Yongky (Guitar) dan Vosta (Vocal) yang kebetulan satu organisasi di salah satu kampus swasta di Yogyakarta. Kemudian pada Agustus 2015 keduanya sepakat untuk membentuk group band yang mereka namakan Wefly dengan menambah personil Hami sebagai Bassist dan Toni sebagai drummer. Namun pada awal Oktober 2015 band ini mengalami keretakan karena salah satu personil Wefly mendapat musibah yang berujung pada mangkraknya band ini disusul keluarnya Hami dan Toni dari band ini. Pada akhirnya band ini tetap jalan dengan mengajak Evan sebagai Bassist dan Habibi sebagai drummer yang kebetulan teman satu SMA dan teman satu kampung  Yongky. Dengan formasi seperti itulah, mereka mulai manggung dan memainkan musik beraliran Brits Alternatif. Perjalanan profesional Wefly dimulai tahun 2016 dengan merambah dari cafe ke cafe di Yogyakarta dengan membawakan lagu-lagu top 40, serta alternative rock seperti One Ok Rock, The Script, Coldplay, Radiohead, dll. Pada Februari 2016, mereka berempat mulai melakukan rekaman dan mengeluarkan single pertama yang berjudul \"Dengarkan Suara Hati\" disusul \"Khianat\" sebagai single kedua mereka. Pada 4 Mei 2017, Wefly mengubah formasi dengan menambah personil karena merasa kosong jika manggung hanya dengan satu gitar. Hingga kemudian mereka merekrut Dani sebagai Rhythm Guitar untuk mengisi kekosongan tersebut. Sejak band ini terbentuk dengan konsep Indie memang belum ada penghargaan secara resmi yang diraih. Namun lagu berjudul \"Dengarkan Suara Hati\" terpilih dan masuk kedalam enam besar dari 300 lebih lagu yang diseleksi dan dibawakan oleh salah satu penyanyi terbaik Indonesia dan disiarkan langsung disalah satu program TV swasta nasional pada bulan April 2016 lalu. Hingga saat ini Wefly sedang menyelesaikan proses rekaman untuk mini Album mereka yang akan segera diliris pada akhir tahun 2017 ini.','Pop','instagram;','Yogyakarta',633,'2017-08-24 05:57:44','2017-08-24 05:57:44'),(314,'Lingkaran Atmosfer','1503584388.jpg','Lingkaran Atmosfer adalah Band Independen yang berbasis di Kota Surabaya. Dengan mengusung genre Post-Rock, Lingkaran Atmosfer memberikan nuansa yang baru untuk menyampaikan emosi ke audience. Dibentuk pada tahun 2015 yang pada awalnya hanya sebatas cover lagu, Lingkaran Atmosfer memberanikan berkarya sendiri, karena keinginan untuk meluapkan ide-ide yang di garap kolektif tiap personil.\r\n\r\nFilosofi dari nama Lingkaran Atmosfer sendiri adalah lingkaran yang berarti tak bersudut dan atmosfer adalah lapisan yang melindungi bumi. Dari kedua penjabaran tersebut, Kami berharap musik kami dapat merangkul semua orang dengan nuansa yang kami berikan dan dapat diterima oleh semua orang.\r\n\r\nPrestasi : \r\n- Juara 2 Musicology Record Rising Up #2015\r\n- Juara 3 Road to Sound of Tri Region Malang','Others','instagram;informasi_toko;teman;','Surabaya',438,'2017-08-24 06:19:48','2017-08-24 06:19:48'),(315,'SOUND COUSTIK','1503587496.jpg','BAND indie berasal dari kota palopo,\r\nterbentuk tahun 2013..\r\nmenjuarai festival band di berbagai kota di sulawesi selatan\r\n\r\ndan ada beberapa konsep yang kami sudah \r\nciptakan sbb :\r\n* Berdendang anak jalanan\r\n* Bahagia bersamamu\r\n* arti sahabat\r\n* sepih\r\n* ku harus lalui\r\n* menangis karna kedua orang tua\r\n* jalan sedih.','Pop','facebook;instagram;lainnya;','Medan',639,'2017-08-24 07:11:36','2017-08-24 07:11:36'),(316,'Wefly','1503588027.JPG','Wefly adalah sebuah grup musik bergenre Pop/Rock Alternatif yang berasal dari Yogyakarta, Indonesia. Grup musik ini dibentuk pada tahun 2015 dengan single pertama yang berjudul “Dengarkan Suara Hati”. Grup band ini terdiri dari 5 personil yaitu Vosta (Vocal), Yongky (Lead Guitar), Dani (Rhythm Guitar), Evan (Bass) dan Habibi (Drum). Grup musik ini juga mengenalkan lirik yang sederhana dan puitis, musik yang mudah di ingat dengan ciri khas suara sang vokalis Vosta. Wefly sendiri diambil dari kata we dan fly yang berarti kita terbang atau kita akan terbang. Sesuai dengan visinya, anggota grup musik ini menamakan dirinya wefly karena ingin membawa karya-karya mereka keberbagai kota di Indonesia bahkan keluar Negeri.\r\n\r\nAwal terbentuk:\r\nGroup band Wefly terbentuk berawal dari pertemuan Yongky (Guitar) dan Vosta (Vocal) yang kebetulan satu organisasi di salah satu kampus swasta di Yogyakarta. Kemudian pada Agustus 2015 keduanya sepakat untuk membentuk group band yang mereka namakan Wefly dengan menambah personil Hami sebagai Bass dan Toni sebagai Drum. Namun pada awal Oktober 2015 band ini mengalami keretakan karena salah satu personil Wefly mendapat musibah yang berujung pada mangkraknya band ini disusul keluarnya Hami dan Toni dari band ini. Pada akhirnya band ini tetap jalan dengan mengajak Evan sebagai Bassist dan Habibi sebagai drummer yang kebetulan teman satu SMA dan teman satu kampung Yongky. Dengan formasi seperti itulah, mereka mulai manggung dan memainkan musik beraliran Brits Alternatif. Perjalanan profesional Wefly dimulai tahun 2016 dengan merambah dari cafe ke cafe di Yogyakarta dengan membawakan lagu-lagu top 40, serta alternative rock seperti One Ok Rock, The Script, Coldplay, Radiohead, dll. Pada Februari 2016, mereka berempat mulai melakukan rekaman dan mengeluarkan single pertama yang berjudul \"Dengarkan Suara Hati\" disusul \"Khianat\" sebagai single kedua mereka. Pada 4 Mei 2017, Wefly mengubah formasi dengan menambah personil karena merasa kosong jika manggung hanya dengan satu gitar. Hingga kemudian mereka merekrut Dani sebagai Rhythm Guitar untuk mengisi kekosongan tersebut. Sejak band ini terbentuk dengan konsep Indie memang belum ada penghargaan secara resmi yang diraih. Namun lagu berjudul \"Dengarkan Suara Hati\" terpilih dan masuk kedalam enam besar dari 300 lebih lagu yang diseleksi dan dibawakan oleh salah satu penyanyi terbaik Indonesia dan disiarkan langsung disalah satu Program TV swasta Nasional pada bulan April 2016 lalu. Hingga saat ini Wefly sedang menyelesaikan proses rekaman untuk mini Album mereka yang akan segera diliris pada akhir tahun 2017 ini.','Pop','instagram;teman;','Yogyakarta',641,'2017-08-24 07:20:27','2017-08-24 07:20:27'),(317,'Arupadhatu','1503589139.jpg','juara favorit se keresidenan besuki/setapal kuda. probolinggo, lumajang, jember, bondowoso, situbondo. lagu kali ini aransemen arupadhatu dari lagu noah cobalah mengerti','Others','facebook;','Surabaya',640,'2017-08-24 07:38:59','2017-08-24 07:38:59'),(318,'THE MAXWEL','1503589873.JPG','The Maxwel adalah band yang berasal dari kota Kendal Indonesia . pada tanggal 11 desember 2013 lahirlah band tersebut yang mengusung genre POP . \r\n\r\nNama The Maxwel sendiri bermakna max yang artinya maximal dalam berfikir dan wel berasal dari kata well (baik) . jadi kesimpulanya adalah berfikir maksimal yang baik atau bermanfaat dalam bermusik .\r\n\r\nThe maxwel sendiri sudah menelurkan single-single seperti : Bintang Hatiku , Putih abu-abu , Bukan Seorang Penghibur , Tak Lagi Bersamamu , Jalani Hidup ini , Pergilah Jauh , Terima Kasih Semua , Tersenyum Letih , Kau Buatku Sempurna, Kuambilkan Bintangmu dan masih banyak lagi .\r\n\r\nHarapan bagi maxwel sendiri semoga karya-karyanya kami bisa diterima masyarakat luas mampu menembus industri musik nasional hingga internasional . mengharumkan nama kota kendal dan negara indonesia kita tercinta  . amin','Pop','facebook;instagram;teman;','Yogyakarta',130,'2017-08-24 07:51:14','2017-08-24 07:51:14'),(319,'The Weekenders','1503591505.jpg','pengisi acara di event2','Others','poster;','Jakarta',628,'2017-08-24 08:18:25','2017-08-24 08:18:25'),(320,'JBBlues','1503591910.jpg','“ Blues bukan hanya suatu genre menurut kami, blues adalah rasa, Blues adalah kepedulian \r\nBlues adalah Pelajaran kehidupan “.\r\n \r\n\r\nJBBlues, mungkin dari namanya saja sudah ketahuan bahwa kami mengkiblatkan musik apa, ya “Blues”.Kami memilih jalur musik blues bukan karena suatu hal yang mudah, kami melewati proses proses bermusik hingga akhirnya kami jatuh kedalam musik blues.\r\nJBBlues  dibentuk pada tanggal 27 januari 2017 beranggotakan moamar (gitar dan vocal), Riski B ( bass), Ricky G (drum), Aspasia (Tenor saxophone), Bimo S (Alto saxophone), Nasrullah G ( Trumpet ), dan Angga Hut ( Trombone ).\r\n\r\n    \r\n  \r\n \r\n    \r\nJBBlues, nama yang dibuat dan disetujui di dalam Kereta api yogyakarta – Blitar , karena memang Job main pertama kami adalah di Kota Blitar. Nama JBBlues sendiri diambil dari nama alamat basecamp kami atau lebih tepatnya alamat rumah yang menjadi tempat kami berproses . JB adalah singkatan dari Jeron Benteng, Jadi JBBlues adalah Jeron Benteng Blues. Tempat berkumpul kami beralamat di jalan suryoputran kecamatan kraton, disinilah para warga sekitar menyebutnya Jeron Benteng, Karena memang lokasinya di dalam lingkup benteng kraton Yogyakarta.\r\n \r\n\r\nMusik JBBlues Sangat dipengaruhi oleh musik Blues era lawas tahun 60an hingga 90an seperti era Blues dijaman Robert Johnson yang karyanya direkam ulang tahun 1961, muddy waters, albert king, BB king, eric Clapton, jimi Hendrix, Stevie Ray Vaughn. Tapi dalam karya karya kami, kami juga menyisipkan unsur unsur RnB dan Funk ala ala James Brown. Yang terpenting bagi kami adalah karya karya kami mempunyai taste tersendiri, ketika kami memainkan karya kami sendiri tanpa melihat siapa kami para pendengar sudah mengetahui bahwa itu musik dari JBBlues.\r\n\r\n\r\n\r\n\r\nBrass section yang digawangi Aspasia, Bimo s, Nasrullah G , Angga Hut adalah kekuatan utama bagi kami, dengan tambahan komposisi gitar yang liar dan groove Bass serta Drum yang menghentak menjadikan musik JBBlues  mempunyai warna tersendiri. \r\nKami juga disebut sebagai Blues kejut oleh pendengar karena menurut pendengar ketika JBBlues bermain diatas panggung selalu memberi kejutan kejutan baru di setiap penampilannya.\r\nCerah, single pertama kami yang berhasil membawa JBBlues sebagai 5 besar band yang terpilih untuk tampil di acara Radioshow TVone bulan maret 2017 yang diselenggarakan di alun alun utara Yogyakarta. Ini sebuah pencapaian yang tak terlupakan bagi kami, mengingat dari proses seleksi yang diikuti 120 Band dari Yogyakarta dan kami masih berumur 3 bulan di dalam naungan JBBlues, kami mendapat sebuah keberuntungan dari Tuhan YME, kami bukan terbaik dari 120 band tersebut hanya saja kami beruntung, karena menurut kami TIDAK ADA band yang tidak bagus di Yogyakarta.\r\n \r\n\r\n      \r\nLirik JBBlues sebagian besar mengarah kepada perjalanan kehidupan manusia, tentang sebuah kebebasan, kejujuran dalam hidup, hingga kematian. Kami memilih hal ini karena kami ingin karya karya kami bermanfaat bagi pendengar, karena kami sadar kami dan pendengar adalah manusia, yang mana manusia adalah tempat lupa dan akhirnya buta, lupa akan siapa kita sebenarnya, lupa darimana kita berasal, lupa akan segalanya dan akhirnya buta.\r\n\r\n     \r\nTujuan bermusik kami bukan hanya untuk sebuah ketenaran tetapi lebih ke manfaat musik kami untuk semua orang. Blues kami Blues yang menghibur, Blues kami Blues yang mendamaikan, Blues kami untuk sebuah kebaikan.\r\n\r\n\r\n\r\nPrestasi : \r\nJuara 3 RadioShow Tvone 2017 Yogyakarta\r\nJuara 2 Road To Soundrenaline 2017 Yogyakarta','Blues','instagram;lainnya;','Yogyakarta',642,'2017-08-24 08:25:10','2017-08-24 08:25:10'),(321,'Kraken','1503601019.jpg','-Press Rellease-\r\nSalah satu band asal bogor ini terbilang cukup sukses di usianya yang baru terbentuk sejak 6 juni 2016 mereka terdiri dari Borie (vocal), Ryan Boyan & Dhany Kinoy (guitar), Hilman (bass), Fahmi (drum).\r\n\r\nUntuk nama kraken sendiri berasal dari nama untuk monster laut berbentuk gurita yang besar, untuk filosofinya sendiri mereka mengartikan Kraken adalah monster yang berasal dari sekumpulan energi, yang artinya diharapkan kami ber-5 bisa menjadi satu kesatuan untuk memberikan energi yang besar untuk musik kami. (Ujar hilman)\r\n\r\nUntuk influence sendiri kraken sangat terinspirasi oleh musik lamb of god dan Kataklysm namun selain itu mereka sangat explore dengan warna musik musik di luar musik metalcore itu sendiri. \r\n\r\nSoal genre terserah pendapat para pendengar mendeskipsikannya. “Band kita basic musiknya metal, kenapa milih metal? Awalnya itu hanya ingin olahraga aja tiap minggu manggung atau latihan, musik metal kan hentakannya semangat tuh otomatis pada gerak minimal kepalanya, eh ternyata keterusan ampe sekarang di hellprint,” ujar Hilman, salah satu personil Band KRAKEN saat dihubungi di tengah kesibukan KRAKEN.\r\n\r\nBand yang merilis single bertajuk \"Lawan\" yaitu lagu yang bercerita tentang perlawanan terhadap kemalasan diri, dan album Kraken sendiri akan dirilis setelah event hellprint united V tepatnya di akhir tahun ini. Untuk materi lagu dari kraken sendiri berpesankan tentang kehidupan sehari-hari yang sangat kompleks.\r\n\r\nYang di rasakan para awak kraken ketika mereka berdiri atas nama kraken, mereka merasa harus lebih dewasa bukan hanya untuk materi lagu saja seperti hal hal yang kecil ga ngaret latihan dan komitmen yang kuat untuk ngeband tanpa harus mengorbankan seperti pekerjaan. \r\nResolusi ke depan, kraken berharap musik mereka bisa diterima oleh semua orang dan memberikan warna musik yang baik kepada penikmat metal dan berencana untuk dapat memiliki kesempatan mengenalkan musik mereka ke seluruh Indonesia.\r\n\r\nDalam perjalanan kraken mereka sangat berterima kasih kepada semua pihak yang mendukung seperti bharata (outright) yang memberikan masukan selama proses road to hellprint, Manager Kraken Ishak Rachman, Road Manager Kraken Tyo, Seluruh Metalhead Bogor, Seluruh Band di Bogor yang mensupport kami, komunitas solo guitar BGF, R9 Community, Bogor Metal Community, Bogor Total Metal Community, Indonesianmetalcore dan lain lain. \r\n\r\nnb : (dilansir dari berbagai wawancara terhadap Kraken)\r\n\r\nMedia Sosial :\r\n•	Instagram : @officialkrakenbogor\r\n•	Facebook : Kraken Bogor\r\n•	Twitter : @kraken_bogor\r\n•	Youtube : Kraken Core Official','Others','instagram;guitar_plus;umi;teman;','Jakarta',645,'2017-08-24 10:56:59','2017-08-24 10:56:59'),(322,'Beyond the Mirage','1503606745.PNG','Beyond the Mirage (BTM) terbentuk dari 2015 berawal dari forum komunitas metalcore di salah satu forum ternama di Indonesia. Terbentuk atas dasar saling memiliki passion di progressive/metalcore/djent, BTM mulai lahir perlahan walau kesibukan antar personil tidak dapat ditolerir.\r\nMemiliki influence dari August Burns Red, Miss May I, Between the Buried and Me, Avenged Sevenfold, Bring Me the Horizon, Dreamshade, Bless the Fall, Trivium, Periphery, March (JKT), Vitalism, etc menjadikan BTM memiliki unsur progressive/metalcore/djent yang kental.\r\n\r\nBTM adalah: Andreas (guitar), Calvin (guitar), Rio (drum), Ihsan (vocal) & Nakula (bass).\r\n\r\nBerbagai kendala dialami salah satu personil BTM, sehingga adanya pergantian member (Ganesha - gitaris; yang merupakan salah satu founder awal) dan digantikan oleh Calvin (guitar) agar BTM terus berjalan. \r\nPembuatan single pertama BTM \"SE7EN DAYS AFTER\" memakan waktu 7 bulan dikarenakan lokasi dan jarak antar member dikala itu. Sekarang BTM berevolusi memiliki members yang solid, frequent listener to metal, passion yang sama tanpa terbawa arus genre.','Heavy Metal','facebook;','Jakarta',646,'2017-08-24 12:32:25','2017-08-24 12:32:25'),(323,'A+','1503626826.JPG','Terbentuk pada 7 November 2015\r\nmengusung konsep \"boyband nge-band\"\r\nmempunyai pasar dititik ABG sampai remaja\r\nmemiliki single yang berjudul Megaku','Pop','teman;','Jakarta',648,'2017-08-24 18:07:06','2017-08-24 18:07:06'),(324,'TEORI','1503644025.png','TEORI terbentuk di kota Solo pada tahun 2010. Adalah Gege Saga, Dhawa Rezkyna, Martinus Sentana juga Ichsandy Nugraha yang mengusung kelompok musik ini. Terpengaruh dengan musik band-band inggris alternatif, menjadikan satu kesamaan diantara banyaknya perbedaan selera. Salah satu yang paling mempengaruhi adalah Radiohead. Disamping itu kemunculan Tame Impala serta Temples turut mewarnai perkembangan karya. Pop Alternatif dengan beberapa siraman modulasi pun lekat tersemat dalam album perdana kami yaitu “TANTRUM” (2016). Band indie dengan segala kemampuan untuk berproses serta promosi seringkali memutar cara agar karyanya didengar. TEORI memutuskan salah satu cara yang paling tepat adalah melakukan tur ke luar kota. Terhitung dalam medio 2 tahun terakhir, TEORI sudah dua kali melakukan ibadah tur Jawa-Bali. Selain itu showcase promo album serta media maya pun juga dilakukan. Tahun ini masih melanjutkan beberapa cara untuk promo album. Video musik untuk single kedua akan segera dirilis pertengahan tahun 2017. \r\nDiscography \r\n-	Confused (single/2014) \r\n-	Sesari Selagu (single/2016) \r\n-	TANTRUM (Album/2017) \r\n-	Lovely Bones (single/2017)','Alternative Rock','instagram;guitar_plus;teman;','Yogyakarta',663,'2017-08-24 22:53:46','2017-08-24 22:53:46'),(325,'ANMA','1503644534.jpg','Anma band berdiri pada tanggal 8 Mei 2013, Berawal dari Imam (vokal), Adam (gitar), dan Sandi (drum) yang memang sudah saling kenal dan terlibat beberapa kali dalam suatu projek musik dari SMA mencoba untuk membuat sebuah band yang mengusung genre pop rock. Namun tidak adanya player bass membuat kami disibukan untuk mencari player bass. Mendapat referensi dari seorang teman, Adam bertemu Ibnu (bass) dan ternyata Ibnu tertarik untuk bergabung dengan Anma Band.','Pop','instagram;','Jakarta',658,'2017-08-24 23:02:14','2017-08-24 23:02:14'),(326,'Kraken','1503644958.jpg','-Press Rellease-\r\nSalah satu band asal bogor ini terbilang cukup sukses di usianya yang baru terbentuk sejak 6 juni 2016 mereka terdiri dari Borie (vocal), Ryan Boyan & Dhany Kinoy (guitar), Hilman (bass), Fahmi (drum).\r\n\r\nUntuk nama kraken sendiri berasal dari nama untuk monster laut berbentuk gurita yang besar, untuk filosofinya sendiri mereka mengartikan Kraken adalah monster yang berasal dari sekumpulan energi, yang artinya diharapkan kami ber-5 bisa menjadi satu kesatuan untuk memberikan energi yang besar untuk musik kami. (Ujar hilman)\r\n\r\nUntuk influence sendiri kraken sangat terinspirasi oleh musik lamb of god dan Kataklysm namun selain itu mereka sangat explore dengan warna musik musik di luar musik metalcore itu sendiri. \r\n\r\nSoal genre terserah pendapat para pendengar mendeskipsikannya. “Band kita basic musiknya metal, kenapa milih metal? Awalnya itu hanya ingin olahraga aja tiap minggu manggung atau latihan, musik metal kan hentakannya semangat tuh otomatis pada gerak minimal kepalanya, eh ternyata keterusan ampe sekarang di hellprint,” ujar Hilman, salah satu personil Band KRAKEN saat dihubungi di tengah kesibukan KRAKEN.\r\n\r\nBand yang merilis single bertajuk \"Lawan\" yaitu lagu yang bercerita tentang perlawanan terhadap kemalasan diri sendiri dan album Kraken sendiri akan dirilis setelah event hellprint united V tepatnya di akhir tahun ini. Untuk materi lagu dari kraken sendiri berpesankan tentang kehidupan sehari-hari yang sangat kompleks.\r\n\r\nYang di rasakan para awak kraken ketika mereka berdiri atas nama kraken, mereka merasa harus lebih dewasa bukan hanya untuk materi lagu saja seperti hal hal yang kecil ga ngaret latihan dan komitmen yang kuat untuk ngeband tanpa harus mengorbankan seperti pekerjaan. \r\n\r\nResolusi ke depan, kraken berharap musik mereka bisa diterima oleh semua orang dan memberikan warna musik yang baik kepada penikmat metal dan berencana untuk dapat memiliki kesempatan mengenalkan musik mereka ke seluruh Indonesia.\r\n\r\nDalam perjalanan kraken mereka sangat berterima kasih kepada semua pihak yang mendukung seperti bharata (outright) yang memberikan masukan selama proses road to hellprint, Manager Kraken Ishak Rachman, Road Manager Kraken Tyo, Seluruh Metalhead Bogor, Seluruh Band di Bogor yang mensupport kami, komunitas solo guitar BGF, R9 Community, Bogor Metal Community, Bogor Total Metal Community, Indonesianmetalcore dan lain lain.','Others','instagram;guitar_plus;umi;teman;','Jakarta',666,'2017-08-24 23:09:18','2017-08-24 23:09:18'),(327,'Ambience of Opera','1503645106.jpg','Ambience of Opera adalah sebuah band bergenre electronic progressive metal dari jakarta, band unik ini memadukan antara genre metal yang notabene musik keras dengan EDM (electronic dance music).','Others','instagram;lainnya;','Jakarta',659,'2017-08-24 23:11:46','2017-08-24 23:11:46'),(328,'Epidemic','1503645645.jpg','band ini terbentuk pada 10-10-2015 dengan formasi cipta (guitar),fathur (guitar),ucok (drum),khoir (bass) dan ayub (vokal) formasi awal ini sudah menghasilkan sebuah single yang berjudul \"anti visions\".Karna kesibukan khoir akhirnya khoirpun harus mundur dari epidemic.dan kami sempat kawalahan mencari pengganti untuk posisi bass.akhirnya kami bertemu dengan teman lama yaitu dedi ex god voice,dedi sempat beberapa bulan mengisi kekosongan bass diepidemic,karna tuntutan kerjaan akhirnya dedipun harus mundur dari epidemic dan disusul fathur juga mundur.sempat vakum beberapa bulan karna merasa band sudah tidak produktif akhirnya ayub mengambil keputusan untuk mundur dari band dan disusul ucok.karna semangat masih tersisa akhirnya cipta terus mencoba mencari member untuk menghidupkan kembali epidemic dan bertemulah dengan mueq tara dan endrik.sampai detik ini formasi ini masih tetap solid walau belum ada pemain bass.Dan epidemic sudah mengeluarkan 2 lagu terbaru mereka yang mengusung genre metal/djent.','Others','facebook;instagram;','Medan',656,'2017-08-24 23:20:45','2017-08-24 23:20:45'),(329,'STIGMA band','1503645746.jpg','Kami Stigma adalah band indie asal kota kendal jawa tengah','Pop','instagram;','Yogyakarta',665,'2017-08-24 23:22:26','2017-08-24 23:22:26'),(330,'SOLOENSIS','1503645825.jpg','Manusia purba Homo Soloensis yang terlahir di pinggiran sungai Bengawan Solo adalah salah satu dari sekian makhluk purba yang sudah bisa berfikir nalar pada lingkungan sekelilingnya, dan juga pintar karena lingkungannya. Tercermin dalam mereka memenuhi kebutuhan hidup dengan memanfaatkan benda-benda disekelilingnya, karena itu kami termotivasi oleh filosofi Homo Soloensis yaitu pintar dan cerdas karena sekelilingnya. Entah ini adalah mandat Nenek Moyang atau hanya semangat berkarya kami saja, SOLOENSIS terbentuk tahun 2008 dan beberapa kali mengalami perubahan personil di kala itu, dan personil tetap saat ini tercatat, Pungkas Pinundi (bass), Gemas Isyak A (vocal/gitar), Sinom Jalu (gitar), dan Faishal Ardi I (drumm). \r\n Sebenarnya susah bagi kami untuk menyebut genre musik yang kami bawakan secara tepat, dibilang Punk, Garage, atau bukan itu, padahal kami membawa protes politik, protes kemanusiaan. Dibilang Psychedelic Rock? Musik kami tidak menggunakan gear-gear effect yang aneh dan penuh ambience, tetapi kami membawakan manifestasi psikis kami pada lirik lagu-lagu kami. \r\n Dibilang Rock? Kami tidak begitu handal dalam skill bermain, tetapi kami selalu berusaha tetap rock menurut kami sendiri. Genre Soloensis adalah ketika teman-teman menyaksikan secara utuh apa yang kami bawakan di panggung live, ketika itulah anda bisa menyebut genre kami sesuai keterwakilan anda terhadap musik Soloensis. Karena apa yang kami lakukan dengan SOLOENSIS ini hanya tentang musik dan apa yang ingin kami sampaikan hingga waktu yang tak tentu.\r\n\r\nDiscography :\r\n1. Soloensis \"Self Titled\" (Album/2014)\r\n2. Tak Lagi Sejati (Single/2014)\r\n3. Sederhana Saja (Single/2016)\r\n4. Renovasi Dini (Single/2017)','Rock','instagram;guitar_plus;teman;','Yogyakarta',667,'2017-08-24 23:23:45','2017-08-24 23:23:45'),(331,'Stigma','1508562383.jpg','kami Stigma band indie asal kota kendal jawa tengah\r\n\r\nBand yang didirikan sejak tahun 2010 hingga kini\r\n\r\nKerap tampil di kota lokal jateng\r\nPekalongan , batang , weleri , semarang dan kendal\r\n\r\nBand kami kerap mengisi acara ivent indie lokal','Pop','instagram;','Jakarta',672,'2017-08-25 00:00:03','2017-10-20 21:06:23'),(332,'Unbeaten','1503648346.jpg','Unbeaten adalah band rock alternative berasal dari Bogor yang terbentuk pada 2014, single pertama \"Dia\" menduduki chart nomor 1 untuk Band Indie di Lesmana FM Bogor selama 5 minggu beruntun. Single kedua \"Hanya Untukmu\" masuk chart majalah Hai dan berhasil direview dan dimuat di kolom majalah Hai. Pada tahun 2017 Unbeaten merilis lagu terbaru \"The Easiest Thing\" semua lagu Unbeaten tersedia di Digital Music Store.','Rock','instagram;teman;','Jakarta',599,'2017-08-25 00:05:46','2017-08-25 00:05:46'),(333,'Kick Your Motor Noise','1503649138.jpg','Kick Your Motor Noise merupakan nama yang kami ambil karena keseharian kami menggunakan motor dalam segala aktivitas, setiap hari nama ini juga merupakan bentuk kritik kami terhadap salah satu bentuk kejadian di jalanan. Kritik itu kami aplikasikan terhadap musik kami yang  penuh dengan suara bising dan mengehentak bertenaga kuda.\r\n\r\n \r\n\r\nTerbentuk pada tahun 2008, Genre yang kami membawakan secara garis besar adalah ROCK, tapi di padukan dengan sedikit unsur genre seperti Stoner, Psychedelic, dan mungkin Shoegaze. Musik kami terinspiras ikebanyakan dari band-band  70an, tapi tidak hanya band  70an saja karena setiap dekade kami mengikuti dan belajar dari mereka.\r\n\r\n \r\n\r\nSaat ini formasi yang terbentuk sudah merupakan formasi terbaru sejak tahun 2015 hingga detik saat ini.\r\n\r\n \r\n\r\nhttps://soundcloud.com/kick-your-motor-noise','Rock','instagram;','Jakarta',649,'2017-08-25 00:18:58','2017-08-25 00:18:58'),(334,'MM33','1503649474.jpg','MM33 adalah sebuah band yang terbentuk dari tempat nongkrongnya anak2 band atau sering disebut studio music yang berada di daerah tg.priok Jakarta utara.Nama band ini tersebut diambil dari nama studio music itu sendiri.Awalnya band ini terbentuk karena sering latihan band ditempat tersebut walaupun personilnya punya band masing2.Karena sering ketemu dan sharing ditempat tersebut,Ucon (vocal),Vivin (guitar 1),Ai (guitar 2),Nano (Bass),dan Risto (drummer) mencoba untuk latihan tanpa adanya konsep dan tujuan.Adanya kekurangan dalam latihan tersebut mereka tidak saling menjatuhkan melainkan saling memberi semangat dan masukan yang positif terhadap masing2 player.Merasa adanya kecocokan dalam bermain music dan sikap,Vivin (Guitar 1) berinisiatif untuk membentuk band baru distudio tersebut.Ucon (vocal),Ai (guitar 2),Nano (bass) dan Risto (drummer) setuju dengan inisiatif vivin (guitar 1) dan memberikan nama untuk band ini yaitu “MM33” sesuai dengen nama studio tersebut.Pihak pengelola pun tidak keberatan dengan nama band tersebut disamakan dengan nama studio musiknya,bahkan mendukung agar band ini tetap berjalan.Jakarta,3 Maret 2017 adalah hari yang ditetapkan sebagai hari lahirnya/terbentuknya “MM33”.Tujuan terbentuknya band ini adalah untuk menuangkan inspirasi dalam setiap personil masing2 kedalam music dan memberikan hiburan kepada masyarakat umum dalam berbentuk musik.','Pop','instagram;','Jakarta',673,'2017-08-25 00:24:34','2017-08-25 00:24:34'),(335,'Morscode','1503650262.jpg','Terbentuk pada akhir 2013, Morscode adalah sebuah grup alternative rock asal kota Bekasi yang terdiri dari 4 personil yaitu Agam, Hendy, Dioma, dan Tantyo. Nama Morscode sendiri terinspirasi dari nama para supir mereka terdahulu yang suka mengantar jemput apabila latihan dan manggung di gigs.\r\nSejak tahun 2013 hingga saat ini, Morscode telah banyak mengisi acara-acara musik baik itu di kota Jakarta maupun luar Jakarta. Dari mulai pensi sekolahan, acara kampus, sampai acara besar seperti \"Volcom X Panther : Wild in the park\" yang diadakan di Scientica Skate Park BSD dan \"Goers App : Folk Talk\" yang diselenggarakan di Southbox Kemang Jakarta.\r\nSaat ini Morscode sedang dalam proses produksi pembuatan mini album perdana-nya.','Alternative Rock','vipclub;','Jakarta',674,'2017-08-25 00:37:42','2017-08-25 00:37:42'),(336,'STARFIVE','1503650372.jpg','STARFIVE adalah salah satu grup band pelajar rilisan Bandkamu Solo dibentuk pada tahun 2014 tepatnya pada tanggal 14 Juli 2014. Personel STARFIVE terdiri dari Vivian Mulano (Vokal) Natsir Musta (Gitar) Tika Syamsuri (Bass) Avan Garda (Keyboard) dan Deva Amru (Drums). Nama STARFIVE berasal dari kata Star (Bintang) Five (Lima) dimana semua personel dari grup band ini adalah anak muda serta pelajar berprestasi dalam bidang pendidikan dan musik baik tingkat nasional maupun daerah, salah satunya adalah Deva Amru (Drummer cilik) di usia 8 tahun ini berhasil menyabet penghargaan sebagai Juara Favorit pada ajang Pemuda Musik Empowering yang diadakan oleh Kementrian Pemuda dan Olah Raga tahun 2013. Avan Garda keyboardis STARFIVE pernah menyabet penghargaan sebagai Best Keyboard DIY Jateng 2014 dan juga merupakan pelajar teladan di sekolahnya. Begitu pula Natsir Musta juga memiliki prestasi penghargaan The Best Gitar DIY Jateng 2 tahun berturut-turut 2013 dan 2014. Dan dua personel cewek grup band ini Vivian Mulano dan Tika Syamsuri adalah Best Vokal dan Best Bass Player Soloraya tahun 2013. Grup band STARFIVE ini dibentuk bertujuan agar dapat menginspirasi para pelajar dan remaja di tanah air untuk mau berkarya dan berprestasi dalam bidangnya secara profesional.\r\nNama STARFIVE sendiri dipakai sejak pertama awal mereka manggung yaitu pada acara Ngabuburit puasa dimana mereka ngejam bareng musisi-musisi Solo di markas mereka yaitu Bandkamu Solo Studio Musik & Recording. STARFIVE lahir dengan mengusung genre rock alternatif sebagai pengintegrasian perbedaan genre musik yang ditekuni oleh masing-masing personel.\r\nAwal Tahun 2015 ini mereka membuat single “Andai Bersamamu” dan baru saja menyelesaikan penggarapan Video klip. STARFIVE memiliki mentor-mentor yang sudah dikenal di dunia hiburan tanah air. Sebagai Manager sekaligus mentor Bobby Teamlo, Fay Ehsan IMB, Plenthe Percussion, Kiky Hendra Pratama dan Bayu Dessabian (Almarhum).\r\nSemestinya dengan kreativitas dan dukungan sumber daya yang hebat dalam bermusik, STARFIVE harusnya mampu bersaing di dunia musik dan jagad hiburan di tanah air. Tentunya dengan persaingan yang positif. Berkarya dengan wajar karena tidak ada jalan pintas dalam seni “No Pain No Gain” tetap rendah hati walau setinggi Malaikat.\r\nSTARFIVE sangatlah menyadari restu dan dukungan pendengar dan pelaku industri musik di Indonesia yang merupakan modal dimana akan merubah situasi band-band di Indonesia agar lebih diminati dan dicintai oleh penggemar musik nasional.\r\nSTARFIVE sendiri memiliki markas di Bandkamu Solo yang beralamat di Jl. Raya Baki No. 173 Kadilangu Baki Sukoharjo Solo Jawa Tengah','Alternative Rock','teman;','Yogyakarta',651,'2017-08-25 00:39:32','2017-08-25 00:39:32'),(337,'EGA SIFA','1503651522.jpg','Menjadi band endorse dari beberapa produk distro MR.CRAFTO dan First Goodness','Pop','facebook;','Jakarta',679,'2017-08-25 00:58:42','2017-08-25 00:58:42'),(338,'EBON','1503652178.jpg','Endorser produk fashion HALB PROJECT dan HEO Production','Rock','facebook;','Jakarta',682,'2017-08-25 01:09:38','2017-08-25 01:09:38'),(339,'SPACE IMPACT','1503652485.jpg','event lokal gigs,jakcloth summer fest 2014','Rock','guitar_plus;','Jakarta',680,'2017-08-25 01:14:45','2017-08-25 01:14:45'),(340,'FOLKS!','1503654310.jpg','FOLKS! terbentuk pada tahun  2012 dengan alasan kesukaan kami terhadap musik yang sama,maka kami sepakat dari awal untuk memainkan musik folk sebagai musik utama,walaupun terkadang kami masih membawakan musik dari genre lain,tetapi tetap dengan sentuhan,aransemen dan konsep musik folk,agar tidak keluar dari konsep musik kami yang sebenarnya,karena mungkin musik seperti ini masih sedikit awam di masyarakat kita.Dengan maksud memberikan sesuatu yang berbeda,kami juga berharap semua orang yang mendengarkan musik kami mendapatkan edukasi dan pengetahuan yang lebih luas lagi terhadap musik..Dan yang terpenting kami berharap para penikmat & pecinta musik dapat terhibur & mengapresiasi musik ini lebih baik lagi.','Folk','guitar_plus;','Jakarta',688,'2017-08-25 01:45:10','2017-08-25 01:45:10'),(341,'Enter Your Puk','1503654554.jpg','Terbentuk pada tahun 2006 karena menyukai genre musik yang sama. Seiring berjalannya waktu kami menciptakan karya kami sendiri dan mulai mengisi acara acara kampus dan acara anak anak muda di Jakarta','Rock','guitar_plus;','Jakarta',668,'2017-08-25 01:49:14','2017-08-25 01:49:14'),(342,'Rising The Fall','1503656916.jpg','Sebuah band yang terlahir dari semangat, dedikasi, dan rasa cinta terhadap musik keras.\r\nSelera musik yang berbeda-beda dari kami tidak menghambat perjalanan bermusik kami.\r\nJustru memperkaya nuansa musik yang kami ciptakan.\r\n\r\nDengan musik yang berteriak tentang keresahan dan pemberontakan.Semua terkumpul menjadi satu membentuk sebuah mental bermusik yang kuat dan musik\r\nbernuansa  Metal & Hardcore menjadikan pilihan nada yang kami mainkan.\r\n\r\nTerbentuk pada bulan Mei 2010, sempat mengalami pergantian personil & sedikit perubahan genre musik.\r\n\r\nAlbum “Revolusi” merupakan album perdana kami yang direlease pada pertengahan tahun 2014.\r\nPemenang planetrox envol et macadam 2016 yang diberangkatkan ke Quebec, Canada','Heavy Metal','lainnya;','Jakarta',661,'2017-08-25 02:28:36','2017-08-25 02:28:36'),(343,'Native','1503658647.JPG','Native terbentuk pada awal tahun 2015 dengan genre alternative rock , beranggotakan 5 orang personil terdiri dari 1 gitar , 1 bass , 1 vokal , 1 drum dan 1 keyboard. Namun pada tahun 2016 , 2 personil kita yaitu bassist dan keyboardist kita mengundurkan diri dikarenakan ada masalah internal. Dan di gantikan dengan bassist baru dan diperkuat dengan rythm gitar. Materi lagu Native sendiri mayoritas menceritakan masalah yang terjadi pada anak muda sekarang masalah kehidupan, Cinta , Pertemanan , dsb. Beberapa prestasi yang pernah kita peroleh antara lain adalah : juara 1 deteksi band 2k15 , Juara 2 piala bupati sidoarjo 2k15 , juara 3 uph highschool band competion 2k15 , Juara 1 elvest band competion dan juara 1 soundsation live audition Sidoarjo 2k17.','Alternative Rock','instagram;','Surabaya',687,'2017-08-25 02:57:27','2017-08-25 02:57:27'),(344,'Remaja Senyum','1503658702.jpg','Remaja Senyum terbentuk pada tanggal 7 November 2015. Remaja Senyum bergenre Progressive, diantaranya memadukan unsur musik rock, funk, etnik, dan jazz. Ditengah naiknya musik EDM (Electronic Dance Music) atau sejenisnya, kami masih tetap mempertahankan musik Progressive.\r\nRemaja Senyum memiliki filosofi yaitu, Remaja yang berarti berusia 11 tahun hingga 21 tahun. Karena pada saat pembentukan Remaja Senyum, usia kami dibawah 21 tahun. Senyum yang berarti ekspresi wajah yang menampilkan kebahagiaan dan rasa senang. Jadi pada intinya, Remaja Senyum adalah anak yang berusia dibawah 21 tahun yang menyajikan musik dengan rasa kebahagiaan dan kesenangan.\r\nAwal mula, personil kami terdiri dari 1 Vocal (Putri), 2 Gitar (Gredy & Bob), 1 Bass (Boy), dan 1 Drum (Pandji). Namun seiring berjalannya waktu, Remaja Senyum menambahkan instrument Keyboard (Elika Mukti) kedalam grupnya, dan total 6 personil. Namun, pada nyatanya, bertahan lebih sulit ketimbang menambahkan. Bob & Elika memilih mundur, dan lebih memilih pendidikannya. Ketika saat itu pula, kami mengajak Erwin yang merupakan Keyboardist untuk bergabung dengan Remaja Senyum hingga saat ini. Namun, tidak hanya ajang perlombaan band yang diikuti. Remaja Senyum, juga mengikuti acara gigs, wedding, dan acara-acara musik lainnya.\r\n\r\nPrestasi \r\n1. Juara 1 Festival band desa seni TMII November 2015\r\n2. Juara 2 Indie kota tua Januari 2016\r\n3. Juara 2 SMANU Thamrin Februari 2016\r\n4. Juara 1 Mall Balekota Tangerang Maret 2016\r\n5. Juara 1 Mutiara Gading Bekasi April 2016\r\n6. Juara 1 Univ. Thamrin Jaksel April 2016\r\n7. Juara 1 Encarnation UI April 2016\r\n8. Juara 2 Mall metro cipulir Mei 2016\r\n9. Juara 1 Univ Pancasila Mei 2016\r\n10. Juara 2 Falms UKM Rangkasbitung Mei 2016\r\n11. Juara 1 Festival Cisadane Juli 2016\r\n12. Juara 1 SMA Pusaka Abadi Agustus 2016\r\n13. Juara 1 UPJ Bintaro 13 Agustus 2016\r\n14. Juara 1 Istana Anak-anak TMII Agustus 2016\r\n15. Juara 1 Gor cempaka putih September 2016\r\n16. Juara 2 Snowbay TMII September 2016\r\n17. Juara 1 Gor Otista September 2016\r\n18. Juara 1 SMA Don Bosco 1 Jakarta November 2016\r\n19. Juara 1 Manajemen UNJ November 2016\r\n20. Juara 1 Univ. Binus Novmber 2016\r\n21. Juara 1 SMAK Penabur 4 November 2016\r\n22. Juara 1 Youth Festival DKI November 2016\r\n23. Juara 2 KMM UIN Desember 2016\r\n24. Juara 1 Artfest Poltek Kelapa sawit Desember 2016\r\n25. Juara 1 One Bell Park Mall Desember 2016\r\n26. Juara 1 Alseace BSD Februari 2017\r\n27. Juara 1 SMANU Thamrin Februari 2017\r\n28. Juara 1 Festivaganza Bogor Februari 2017\r\n29. Juara 1 Eclipse April 2017\r\