itas, tapi attitude dan faktor \"KLOP\" menjadi pondasi penting sebuah band. Sekarang kami sudah memiliki 3 buah lagu yang akan kami rilis dalam waktu dekat. Band ini sudah beberapa kali mengikuti gigs yang diadakan oleh beberapa komunitas baik di jogja dan sekali ke luar daerah ( Wonosari ).','Rock','teman;','Yogyakarta',697,'2017-08-25 04:28:19','2017-08-25 04:28:19'),(349,'Madman Attacks','1503665528.jpg','Berawal dari kegilaan anak muda akan musik dan ingin mendirikan band, akhirnya terbentuklah band yang bernama madman attacks pada tanggal 27 oktober 2011. Maksud dari nama MadMan Attack ialah serangan laki-laki gila, gila disini yang dimaksud bukan penyakit psikis atau gangguan jiwa tapi ialah laki-laki yang gila akan musik dan ingin menyerang masyarakat dengan sebuah karya.\r\n\r\nMadman Attacks sudah mengalami perubahan personil awal mula personil madman attacks adalah Reza (vokalis/gitar) Feri (Gitar/backing vokal) Gilang (Bass) dan Songgo (Drum) dan saat itu kami menganggkat genre Punk Rock, kita biasanya mengcover lagu dari superman is dead, Blink128, Sum41 dan banyak lagi, tetapi pada pertengahan tahun 2012 Reza mengundurkan diri dari band dan disusul oleh Gilang, dengan alasan terlalu sibuknya mereka bekerja dan sulit membagi waktu antara bekerja dan ngband. akhirnya madman attacks pun vakum sekitar setahun tapi feri bertekat menghidupkan lagi madman attacks dari ke vakuman, dia mengajak songgo untuk mencari personil pengganti. dan bertemulah kita dengan Genta dan Candra. setelah itu kita sepakat menghidupkan madman attacks dengan visi dan misi yang sama. akhirnya formasi kami berubah Genta (vokal/gitar) Feri (gitar/backvokal) Candra (bass) dan Songgo (drum) kami pun berpaling dari Punk Rock ke Pop Punk','Others','instagram;lainnya;','Yogyakarta',660,'2017-08-25 04:52:08','2017-08-25 04:52:08'),(350,'Soulgiver','1503666667.png','\'\' Soulgiver \'\' sebuah proyek solo dari gitaris sekaligus vokalis yang akrab dipanggil yefta ini terbentuk pada tahun 2013 atas dasar kebebasan bermusik tanpa ada batas dan pengkotak-kotakan genre musik. \r\nmulai dari ngamen kafe ke kafe , sampai mengikuti ajang pencarian bakat di salah satu stasiun televisi di indonesia.\r\nDari panggung ke panggung , wedding ceremony , gathering dan expo , Yefta sering bermain bersama teman-teman yang membantu mengisi kekosongan pada posisi gitar , bass dan drum.\r\nSekarang ini , soulgiver sedang mengerjakan mini album yang direncanakan selesai di akhir tahun 2017 ini dengan tajuk \" Love me (It\'s Simple) \"','Alternative Rock','facebook;','Jakarta',478,'2017-08-25 05:11:07','2017-08-25 05:11:07'),(351,'Klingking band','1503667738.jpg','klingking band menggambarkan adanya sebuah persahabatan dimana klingking memiliki makna walaupun kecil tapi dia mampu memegang janji. prestasi : Juara 2 festival band telkomsel Elang nusa, juara 3 Festival grandAcoustic palembang Icon dan juara 3 Festival Honda','Pop','instagram;','Yogyakarta',702,'2017-08-25 05:28:58','2017-08-25 05:28:58'),(352,'ARIF AFSYAH','1503674630.jpg','Saya Arif dari Padang sekarang mencoba keberuntungan di Jakarta. Hobi musik sudah dari SD belajar musik waktu itu hanya bermodalkan gitar pinjaman, karena faktor biaya dan niat yang kuat untuk bisa hidup dimusik. Kelas dua SMP saya mencoba buat lagu sendiri hingga sekarang sampai 100 lagu ciptaan sendiri yang sudah saya ciptakan. Tahun 2014 karena motivasi yang tinggi saya mengumpulkan uang hasil menulis dikoran media lokal dan kampus saya memproduksi lagu saya sendiri secara independent, biaya sendiri dan promosi sendiri hingga ke radio-radio lokal, kampus, dan sekolah waktu itu. Alhamdulillah dua lagu genre Pop saya banyak yang suka dan beri tanggapan positif, hingga beberapa event sata berkolaborasi dengan Penyair dan musisi lokal waktu itu. Ditahun 2015 saya juga produksi lagu religi karena ada event dari label Malaysia untuk membuka lowongan bermusik disana yang diadakan dikota saya. Syukur alhamdulillah lagu religi saya terpilih. Dan saya sangat berharap bisa bergabung di Universal Musik Indonesia, mendengarkan karya-karya saya, berkolaborasi dan belajar hidup dimusik.','Others','umi;','Jakarta',706,'2017-08-25 07:23:50','2017-08-25 07:23:50'),(353,'AFTER SKY','1503675544.jpg','AFTER SKY adalah band rock asal kota malang yg beranggotakan dua gadis belia DIANA (15 tahun) pada posisi gitar dan vokal serta VIOLA (14 tahun) pada drums dan vokal yang bernaung di bawah CJM Entertainment\r\nDebut mini album pertama mereka dirilis 20 november 2016 sekarang mereka kembali merilis single yg bertema nasionalisme untuk menyambut hari kemerdekaan RI ke 72 bertajuk KIBARKAN BENDERA serta satu single pendamping SELAMAT ULANG TAHUN TEMANKU yang diputar serentak tgl 14 Agustus 2017 di beberapa radio di pulau jawa','Pop','facebook;instagram;teman;','Jakarta',707,'2017-08-25 07:39:04','2017-08-25 07:39:04'),(354,'People Need To Know','1503676113.jpg','People Need To Know adalah sebuah band bergenre Pop Punk yang terdiri dari 4 anak muda yang menyalurkan hobi dan passion mereka dibidang musik.','Alternative Rock','facebook;','Jakarta',200,'2017-08-25 07:48:33','2017-08-25 07:48:33'),(355,'Variant Band','1503676665.jpg','Berawal dari suatu perbedaan di genre musik hingga kami kemas dengan nama variant yg berarti perpaduan perbedaan yg di jadikan satu genre..juara 1 akustik se-kabupaten Lampung..juara 1 festival   Tigaraksa Tangerang..dll','Pop','teman;','Jakarta',708,'2017-08-25 07:57:45','2017-08-25 07:57:45'),(356,'SIFBOH BAND','1503680146.jpg','WE ARE SIFABOH :\r\nSifaboh Terbentuk Di Tahun 2008 , Sifaboh Berasal Dari Penyingkatan Kata Yaitu Sipandai Belajar Bodoh, Sudah Berulang Kali Berganti Personil Tapi Hanya 2 Orang Yang Tetap Bertahan Sampai Sekarang, Pada Tahun 2009 Berkat Adanya Perkenalan Dari Teman Ke Teman Kami Berkumpul Berempat Untuk Mengatakan Sesuatu Yaitu Tentang Perjuangan Musik Rock Untuk Masa Depan  Dan Akhirnya Kami Sepakat Untuk Melajudkan Band Ini. \r\nSIFABOH Member Since 2016\r\nVox : Rendi 