tif radio RRI cipta lagu 2 desember 2013\r\n-juara 1 festival yamaha semakin didepan 23 mei 2014\r\n-juara 3 festival galaxy zone 29-30-31 agustus 2014\r\n-juara 1 festival pagelaran panggung pemuda 28 oktober 2014\r\n-juara 1 festival band yamaha motor show 23-24 mei 2015 (the best vocal)+(the best guitar)+(the best bass)+(the best drum)\r\n-juara 2 festival unrika all-kepri 5-7 juni 2015(the best drum)\r\n-juara 1 festival all-kepri keprimall 24-25 september 2015 (thebestguitar+thebestdrum)\r\n-juara 1 festival all-kepri 20 november 2016\r\n(thebestvocal+thebestguitar+thebestbass+thebestdrum)\r\n\r\n\r\n\r\n\r\n\r\n\r\nOPENING ACT ARTIST : \r\n\r\n- A Mild Soundrenaline 2008\r\n-The Rock - FSPMI 2008\r\n-Netral Club Xpresation 2008\r\n- Sahara –Pesta Kembang Api 2009\r\n- Lobow - IM3 2009\r\n- PeterPan U Mild Biker 2010\r\n- Blackout - Yamaha matic road show 2011(Medan)\r\n- J-Rock’s IM3 2012\r\n- The Virgin Class Sound Sation 2012\r\n- Radja – Waterboom 2012\r\n- Rif – Waterboom 2012\r\n- The Virgin – Waterboom 2012\r\n- Geisha A Mild SounSation 2013\r\n- Andra & The Backbone 2013\r\n- Slank – FSPMI 2014\r\n- Naff A Mild Sounsation 2015\r\n- Kotak A Mild Soundsation 2015\r\n\r\nTahun 2013 Lagu Karya Kami Terpilih Dalam Sountrack Film True Heart, Yang Diputar Diseluruh Indonesia Yang Berjudul Langkah Baru .\r\n\r\nVideo Link YouTube : \r\nhttps://www.youtube.com/watch?v=b2L6JRw_JbU\r\nhttps://www.youtube.com/watch?v=7LV3JmpN-3k\r\nhttps://www.youtube.com/watch?v=su6J4_9QYPM\r\nhttps://www.youtube.com/watch?v=PLChNt-0Pfc','Rock','instagram;guitar_plus;teman;lainnya;','Jakarta',710,'2017-08-25 08:55:46','2017-08-25 08:55:46'),(357,'Hexa','1503680834.jpg','Hexa merupakan sebuah band yang berasal dari kota Bandung, yang terbentuk pada tanggal 24 Agustus 2012 dan mengusung genre Alternative. Arti kata Hexa itu sendiri berasal dari bilangan kimia yang berarti enam (6). Arti Hexa sendiri adalah keterkaitan hati antara 5 personil Hexa dengan penikmat musik Hexa dan orang – orang yang mendukung juga orang - orang di balik Hexa yang dianggap menjadi personil ke 6 di band Hexa ini. Hexa juga merupakan singkatan dari ‘Hope Ex Alrisemusic’, yang memiliki arti harapan yang lebih baik untuk band ini dari para personil, karena sebelum nama Hexa ada, band ini bernama Alrisemusic. Hexa dibentuk karena latar belakang pertemanan sejak SMP, yang memiliki hobi yang sama yaitu bermusik dan memiliki mimpi yang sama untuk bisa berkarya dan berkembang juga berkontribusi bagi industri musik Indonesia. Personil Hexa yaitu : Ghina (Vokal), Garin (Gitar), Ridwan (Gitar), Harry (Bass), dan Ari (Drum).\r\nHexa sudah banyak memiliki jam terbang dan pengalaman tampil diantaranya : Tampil di pentas seni SMP, SMA, dan Univesitas yang ada di kota Bandung dan Jatinangor. Tampil di event - event yang ada di kota Bandung. Mengikuti dan menjuarai lomba dan festival - festival musik yang diselenggarakan di kota Bandung. Juga pernah menjadi home band untuk beberapa cafe yang ada di Kota Bandung. Hingga saat ini Hexa baru mempunyai satu lagu, yang berjudul “Langkah Baru”. Semoga lagu ini bisa menjadi awal yang baik, baru, juga cerah bagi Hexa untuk menempuh perjalanan dalam kancah industri musik Indonesia, dan karya - karya Hexa bisa dinikmati juga menjadi inspirasi bagi banyak orang.','Alternative Rock','instagram;guitar_plus;','Jakarta',713,'2017-08-25 09:07:14','2017-08-25 09:07:14'),(358,'Marta','1503686460.png','Kakak beradik','Folk','teman;','Jakarta',717,'2017-08-25 10:41:00','2017-08-25 10:41:00'),(359,'MURDER','1503714941.jpg','Murder is a death metal band from the Indonesia formed in 2010. Murder started in the Boyolali, Central Java, Indonesia in October 13, 2010 as a death metal band. The group was founded by vocalist Hestu Dharmawan Putra and guitarist Syaiful Iwan. In early years, Murder settled on three members of more than 3 years: Hestu Dharmawan Putra, Syaiful Iwan, and Ardhina (as a drummer). To fill the bassist position, Hestu was decided to invite his brother to fill these position. Basically, he had been a bassist in several metal bands in Boyolali, which is Hide the Last and Sadistic Torture.\r\nAfter several years, Ardhina departed from the band on July 2014 for occupation reasons. Ardhina replaced by Fian Parcil as a substitute drummer, and he has been involved in several events.\r\nIn October 2013, we focus to work on making the first album, after before the 2 demos was released in 2010 and 2012. And it reduces the intensity of us to perform in gigs.\r\nIn the middle of making the album, Fian are focusing on his (punk) band and could not help us anymore. In October 2013, we focus to work on making the debut album. In the making of the album, Hestu was focus on making lyric, Syaiful focus on the making the overall rhythm and lead, and Tikko focus on the idea of Syaiful arrangements, bass line arrangements and drum beats.\r\nThe album was produced at home. From recording guitar, bass, drums, mixing, and mastering all completely done at home, but not for the vocal sessions. Vocals were recorded in Enlabz Studio. In Mei 2015, we are in the process of making a promo album with pre-release albums. Therein contains 4 songs from a total of 8 songs that will be released on Murder debut album.','Heavy Metal','instagram;','Yogyakarta',582,'2017-08-25 18:35:41','2017-08-25 18:35:41'),(360,'Cosmic Mind','1503728696.jpg','Meskipun kita hanya sebuah band yang masih seumur jagung, namun pemainnya bukanlah para pemain baru. Memiliki mimpi dan visi yang jelas terhadap karir bermusik kedepannya. Terus menciptakan karya-karya yang tentunya inovatif meski masih sebatas mengikuti kata hati. Telah menciptakan sebuah klip dengan budget minimalis. Sedang merekam beberapa lagu baru. Terus tampil dipanggung-panggung besar maupun kecil hampir ditiap minggunya. Menjadi 7 besar dari 66 band Rock yang ikut partisipasi dalam pagelaran Konser Rock Nasional 66 Band dalam 12 jam di TMII dan akan segera ikut serta dalam pagelaran finalnya pada Desember nanti.','Pop','guitar_plus;','Jakarta',725,'2017-08-25 22:24:56','2017-08-25 22:24:56'),(361,'The Tombstones','1503732575.jpg','The Tombstones, band beraliran Garagerock asal Yogyakarta yang telah terbentuk pada tahun 2013.Lagu-lagu The Tombstones tereksploitasi dari beberapa\r\ngenre seperti Rocknroll, Garagerock, Blues, Grunge, dan Punkrock sehingga memberikan warna baru di musik tanah air. Diracik menjadi satu hingga terdengar lebih powerfull dan high energy yang siap memuaskan pecinta music rock. The Tombstones telah mengisi di salah satu acara TV Nasional dengan nama acara DCDC Musik Kita Eps.9 Koil x The Tombstones, dan menjadi salah satu finalis di acara Rockin To Rockin Battle dan Radio Show 2017. Ig :tombstonesquad','Rock','instagram;poster;teman;','Yogyakarta',690,'2017-08-25 23:29:35','2017-08-25 23:29:35'),(362,'JC BAND','1503744676.jpg','JC band, bAND indie berasal dari sul-sel tepatnya di Luwu timur kota Wawondula. sering menjuarai festival band di berbagai daera di sulawesi dan pernah menjuarai evand festival band tingkat nasional.\r\n                  \r\n                Contack :\r\n                          ig : @jc_band\r\n                          fb : JC BAND','Pop','facebook;instagram;lainnya;','Medan',634,'2017-08-26 02:51:16','2017-08-26 02:51:16'),(363,'Superego','1503750481.jpg','Superego adalah unit Alternative Rock asal Bandung. Band ini beranggotakan Jeremy Jonathan (Guitar & Vocal), Yoendo Nebriko (Guitar), Talia Thaib (Bass) dan Rifqi Hidayat (Drum). Terbentuk pada pertengahan bulan April 2015, lagu – lagu mereka banyak terinspirasi oleh band – band yang  jaya pada era 90-an seperti Nirvana, Sonic Youth dan My Bloody Valentine. Permainan gitar berbalut overdrive dan lead harmonik, petikan bass yang kasar serta dentuman drum bertempo cepat dan keras menjadi karakter dari permainan musik Superego sendiri. \r\n\r\nPrestasi :\r\nJuara 3 lomba band FORSI Universitas Padjadjaran (2015)\r\nJuara 2 lomba band FORSI Universitas Padjadjaran (2016)','Alternative Rock','instagram;','Jakarta',730,'2017-08-26 04:28:01','2017-08-26 04:28:01'),(364,'Undersixteen','1503762540.jpg','Awal mula terbentuk pada tahun 2014 dalam sebuah acara festival dengan 5 personil. Festival pertama kami tidak begitu membahagiakan, tetapi itulah awal mula kami terbentuk. Setelah beberapa festival berlalu akhirnya kami mencoba untuk mengekspresikan diri kami melalui lagu, hingga akhirnya kami melakukan recording beberapa lagu pada tahun setelahnya, meskipun akhirnya kami kehilangan satu personil pada lagu ke 5 kami, dan melanjutkan recording dengan 4 personil tersisa. \r\nTahun 2016 menjadi tahun kebahagiaan kami ketika kami menyelesaikan perekaman mini album kami secara independen.','Pop','instagram;umi;teman;','Yogyakarta',732,'2017-08-26 07:49:00','2017-08-26 07:49:00'),(365,'Undersixteen','1503762567.jpg','Awal mula terbentuk pada tahun 2014 dalam sebuah acara festival dengan 5 personil. Festival pertama kami tidak begitu membahagiakan, tetapi itulah awal mula kami terbentuk. Setelah beberapa festival berlalu akhirnya kami mencoba untuk mengekspresikan diri kami melalui lagu, hingga akhirnya kami melakukan recording beberapa lagu pada tahun setelahnya, meskipun akhirnya kami kehilangan satu personil pada lagu ke 5 kami, dan melanjutkan recording dengan 4 personil tersisa. \r\nTahun 2016 menjadi tahun kebahagiaan kami ketika kami menyelesaikan perekaman mini album kami secara independen.','Pop','instagram;umi;teman;','Yogyakarta',732,'2017-08-26 07:49:27','2017-08-26 07:49:27'),(366,'Undersixteen','1503762615.jpg','Awal mula terbentuk pada tahun 2014 dalam sebuah acara festival dengan 5 personil. Festival pertama kami tidak begitu membahagiakan, tetapi itulah awal mula kami terbentuk. Setelah beberapa festival berlalu akhirnya kami mencoba untuk mengekspresikan diri kami melalui lagu, hingga akhirnya kami melakukan recording beberapa lagu pada tahun setelahnya, meskipun akhirnya kami kehilangan satu personil pada lagu ke 5 kami, dan melanjutkan recording dengan 4 personil tersisa. \r\nTahun 2016 menjadi tahun kebahagiaan kami ketika kami menyelesaikan perekaman mini album kami secara independen.','Pop','instagram;umi;teman;','Yogyakarta',732,'2017-08-26 07:50:15','2017-08-26 07:50:15'),(367,'Undersixteen','1503762683.jpg','Awal mula terbentuk pada tahun 2014 dalam sebuah acara festival dengan 5 personil. Festival pertama kami tidak begitu membahagiakan, tetapi itulah awal mula kami terbentuk. Setelah beberapa festival berlalu akhirnya kami mencoba untuk mengekspresikan diri kami melalui lagu, hingga akhirnya kami melakukan recording beberapa lagu pada tahun setelahnya, meskipun akhirnya kami kehilangan satu personil pada lagu ke 5 kami, dan melanjutkan recording dengan 4 personil tersisa. \r\nTahun 2016 menjadi tahun kebahagiaan kami ketika kami menyelesaikan perekaman mini album kami secara independen.','Pop','instagram;','Yogyakarta',732,'2017-08-26 07:51:23','2017-08-26 07:51:23'),(368,'Undersixteen','1503762703.jpg','Awal mula terbentuk pada tahun 2014 dalam sebuah acara festival dengan 5 personil. Festival pertama kami tidak begitu membahagiakan, tetapi itulah awal mula kami terbentuk. Setelah beberapa festival berlalu akhirnya kami mencoba untuk mengekspresikan diri kami melalui lagu, hingga akhirnya kami melakukan recording beberapa lagu pada tahun setelahnya, meskipun akhirnya kami kehilangan satu personil pada lagu ke 5 kami, dan melanjutkan recording dengan 4 personil tersisa. \r\nTahun 2016 menjadi tahun kebahagiaan kami ketika kami menyelesaikan perekaman mini album kami secara independen.','Pop','instagram;','Yogyakarta',732,'2017-08-26 07:51:43','2017-08-26 07:51:43'),(369,'Undersixteen','1503762789.jpg','Awal mula terbentuk pada tahun 2014 dalam sebuah acara festival dengan 5 personil. Festival pertama kami tidak begitu membahagiakan, tetapi itulah awal mula kami terbentuk. Setelah beberapa festival berlalu akhirnya kami mencoba untuk mengekspresikan diri kami melalui lagu, hingga akhirnya kami melakukan recording beberapa lagu pada tahun setelahnya, meskipun akhirnya kami kehilangan satu personil pada lagu ke 5 kami, dan melanjutkan recording dengan 4 personil tersisa. \r\nTahun 2016 menjadi tahun kebahagiaan kami ketika kami menyelesaikan perekaman mini album kami secara independen.','Pop','instagram;','Yogyakarta',732,'2017-08-26 07:53:09','2017-08-26 07:53:09'),(370,'Adiva','1503763088.jpg','Kami adalah band cafe juga recording dan biasa bermain dibcafe cafe jakarta','Pop','instagram;','Jakarta',734,'2017-08-26 07:58:08','2017-08-26 07:58:08'),(371,'SIVA','1503765144.jpg','Band yang berdiri pada tahun 2012 akhir ini mengusung konsep genre pop, terdiri dari Yudi, Darma, Beni, dan Yuda berasal dari kota Palembang, bermimpi untuk jadi band go nasional dari panggung ke panggung baik itu event wedding, sebagai band pembuka artis ibu kota dan pemerintah setempat. Dengan niat bermusik sepenuh hati, itulah moto kami untuk bermusik untuk meramaikan kancah musik nasional.','Pop','instagram;','Jakarta',726,'2017-08-26 08:32:24','2017-08-26 08:32:24'),(372,'nice friday','1503765229.jpg','Festival Film Indonesia Batam, Panasonic award, Apache exclusive Nice Friday live Semarang, Indonesia movie award, Surya pro mild Batam, java jazz, indosat makassar, Umild tanggerang, supreme mild bali, hugos jogjakarta, fame station bandung, ect.','Others','instagram;','Jakarta',733,'2017-08-26 08:33:49','2017-08-26 08:33:49'),(373,'UP DOWN','1503767142.jpg','juara 1 parade band IAIN JEMBER, road to sundrenaline malang,  partisipan rekor muri 1015 musician surabay.','Rock','instagram;','Surabaya',474,'2017-08-26 09:05:42','2017-08-26 09:05:42'),(374,'Teacher Kids','1503769396.jpg','Sudah rilis album pertama berjudul Titik Nol','Rock','facebook;instagram;informasi_toko;vipclub;guitar_plus;umi;maliq;poster;teman;','Medan',736,'2017-08-26 09:43:16','2017-08-26 09:43:16'),(375,'Day For Uncle Sam (DFUS)','1503770208.jpg','Day For Uncle Sam (DFUS) berdiri pada bulan Maret 2011 , dengan formasi awal 5 orang sampai 2017 sekarang. Telah meluncurkan Debut Album pada 2016 kemarin , dan merilis video Clip pada bulan Sepetember 2017 ini. Portfolio prestasi Day For Uncle Sam adalah pemenang Juara 1 pada Event JakCloth Goes To Jember 2016 dan menjadi talent pengisi acara di beberapa event JakCloth. Pada 2018 akan merilis Album ke dua dalam format EP.','Alternative Rock','instagram;umi;poster;','Surabaya',737,'2017-08-26 09:56:48','2017-08-26 09:56:48'),(376,'THE ViCSKA','1503770226.jpg','THE VICSKA adalah band asal majalengka selatan yang didirikan pada tahun 2011, dan nama THE VICSKA sendiri diambil dari nama band sebelumnya yaitu VICTORY dan digabungkan dg nama kampungnya yaitu SUKAMULYA dan terbentuklah nama THE VICSKA pada awal th 2011. THE VICSKA  beranggotakan 4-personiel yang terdiri dari :\r\n\r\nAris-Vocal\r\nKiki-Gitar\r\nTyan-Bass\r\nRyan-Drum\r\n\r\n-Prestasi yang pernah diraih yaitu pernah menjadi juara 1 di acara parade musik jagamulya yang bertempat di malausma dan kami juga pernah meraih juara 2 di acara memperingati hari kemerdekaan pd tgl 16agt 2016 selain itu juga gitaris kami pernah meraih gelar gitaris terbaik dua kali yang pertama pada event 17an dan yang ke dua pada event tahun baru dan vokalis kami juga mendapatkan gelar vokalis terbaik dalam event music kemerdekaan yg diselenggarakan pd tgl 15agt 2017 bertempatan di talaga','Alternative Rock','facebook;','Jakarta',643,'2017-08-26 09:57:06','2017-08-26 09:57:06'),(377,'hitam polos','1503774832.jpg','Band alternatif-rock yang terbentuk pada akhir tahun 2016 ini beranggotakan juno (vocal), gregorio (gitar, dan radin (gitar). Ide untuk membentuk band ini awalnya dari pertemanan gregorio dan radin, yang menyukai genre musik yang sama (alternatif-rock/western rock/blues/country). Sering manggung/event reguler bersama di cafe-cafe ternama ibukota jakarta, mereka bertemu dengan juno vocalis yang kebetulan cocok dengan warna musik yang sedang mereka garap. Saat ini lagu berjudul \"don\'t go\" merupakan debut lagu yang sedang mereka garap. Dengan tema lirik berbahasa inggris yang komersil mereka berupaya untuk mencoba mendapatkan perhatian para pendengarnya, lirik sentimentil berbau cinta diharapkan dapat menjadi senjata andalan mereka untuk memulai debut single di tahun 2017. Hitam polos, gregorio sepakat bersama teman-teman yang lain untuk memakai nama itu. Tak ada makna spesial dari nama itu, hanya karena sering memakai kaos berwarna hitam polos gregorio mengusulkan untuk memakai nama tersebut. Harapannya ialah warna hitam polos tersebut bisa bersanding dengan warna-warna (musik) lainnya. Saat ini mereka menjadi salah satu band reguler di cafe ternama jakarta.','Alternative Rock','instagram;guitar_plus;','Jakarta',686,'2017-08-26 11:13:52','2017-08-26 11:13:52'),(378,'Tuan Muda','1503790780.jpg','Tuan Muda adalah sebuah grup musik di Indonesia yang berasal dari daerah Bengkulu. Dibentuk atas ketidak sengajaan oleh willy Gegem pada 17 Juli 2011 karena ingin mengikuti sebuah kompetisi Musik dan punya keinginan yang kuat untuk meng-Cover lagu dengan karya sendiri di genre musik yang berbeda. Dan berhasil menjadi salah satu band ternama dan menjadi sebuah trandcenter di kalangan musisi (band) umum propinsi Bengkulu .yang juga berkeinginan menjadi band bersejarah dan dikenang serta berpengaruh untuk seluruh pecinta musik di Bengkulu hingga cakupan nasional. Dengan seringnya berganti personil dari awal berdirinya Tuan Muda,dan akhirnya Tuan Muda telah menemukan pilihan formasi yang kokoh dengan personil :\r\n•	Agung Dwi Prayugo (vocal 1)\r\n•	Ophi krisna (vocal 2)\r\n•	M.Aditya (guitar)\r\n•	M.Lophy (bass)\r\n•	Willy Gegem (drum) \r\n\r\n\r\n\r\n-	2013 Tuan Muda juara 1 ulang tahun Akutansi UNIB \r\n-	2013 Tuan Muda juara 1 ulang tahun manajemen UNIB\r\n-	2013 perfom Tuan Muda sebagai opening band RIF di Suport center Bengkulu\r\n-	2014  mengikuti festival band bersama Tuan Muda\r\n•	Juara 1 acara HONDA di Bencoolen Mall Bengkulu\r\n•	Juara 1 acara HONDA di Lap.parkir Bencoolen Mall Bengkulu\r\n•	juara 1 HUT Akutansi UNIB \r\n•	Juara 1 HUT Manajemen UNIB \r\n•	Juara 2 acara YAMAHA di Lap.parkir Bencoolen Mall Bengkulu\r\n•	Juara 2 acara HPN di Sport Center Bengkulu\r\n•	Juara 1 HUT UKM seni Dehasen Bengkulu\r\n•	Juara 1 HUT Kepahyang \r\n•	Juara 2 acara Honda di Lap.parkir Bencoolen Mall Bengkulu\r\n•	Juara 3 acara HONDA di Bencoolen Mall Bengkulu\r\n•	Juara 1  acara GG MILD di Bencoolen Mall Bengkulu\r\n•	Guest Star karnaval 3 GSG UNIB\r\n•	Opening vocalis marvel band di Rainbow Café Bengkulu\r\n•	Opening dj yasmin di Rainbow Café Bengkulu\r\n•	Opening mahadewa band di Sport Center Bengkulu\r\n•	Guest Star launching motor Honda di Bencoolen Mall Bengkulu\r\n•	Opening jambrud band di Kepahyang\r\n•	Ultah KMK kepahyang\r\n•	Perfom tahun baru di Sport Center Bengkulu\r\n\r\n\r\n\r\n\r\n\r\n-	2015 festival band  Tuan muda \r\n•	Juara 1 festival band acara SAMPOERNA di belakang Bencoolen Mall Bengkulu\r\n•	Juara 1 festival band acara HONDA di Bencoolen Mall Bengkulu\r\n•	Juara 1 festival band acara Akutansi UNIB\r\n•	Juara 1 festival band HONDA di Bencoolen Mall Bengkulu\r\n•	Juara 1 festival band acara Manajemen UNIB\r\n•	Juara 2 festival band HONDA di Bencoolen Mall Bengkulu\r\n•	Juara 2 festival band HONDA di Bencoolen Mall Bengkulu\r\n•	Juara 2 festival band KNPI Lubuk Linggau\r\n•	Juara 1 festival band GGMILD di teluk segara Bengkulu\r\n•	Juara 1 festival band GGMILD di Sport Center Bengkulu\r\n•	Juara 2 festival band GGMILD di Bandar Lampung\r\n•	Juara 2 festival band RRI PRO 2 Bengkulu\r\n•	Guest Star launcing motor HONDA di Bencoolen Mall Bengkulu\r\n•	Opening band Andra and the backbone di lap.parkir Bencoolen Mall Bengkulu\r\n•	Opening band Netral di lap.parkir Bencoolen Mall Bengkulu\r\n•	Opening payung teduh di GSG UNIB\r\n•	Perfom tahun baru etex studio di Bengkulu\r\n-	2016 Tuan Muda\r\n•	6 besar festival band banteng music festival Nasional di plenary hall JCC JAKSEL\r\n•	Juara 3 festival lebong (Bengkulu) rockin’ land \r\n•	Juara 2 Bengkulu expo di sport center Bengkulu\r\n•	Juara 1 Festival band merah putih di bom baru Bengkulu\r\n•	Juara 2 festival band HPN di sport center Bengkulu\r\n-	2017 Tuan Muda\r\n•	Indie Station cap.1 di KONAKITO Bengkulu\r\n•	Perfom Road To Soundrenaline di Bandar Lampung\r\n•	Guest Star Anniversary Pasukan Radix di Hotel Santika Bengkulu\r\n•	Opening Act Budi Doremi di Hotel Santika Bengkulu','Others','teman;','Jakarta',715,'2017-08-26 15:39:40','2017-08-26 15:39:40'),(379,'KREATIC','1503800012.jpeg','kreatic : kreasi gitink dan coik . sebuah band bentukan dri 2000an yg cuma bs menghibur temen2 doang :D jrg bgt ikut acara formal karena krg pede :D pernah sekali maksain akhirnya demam panggung dan gagal hingga waktu yg membuat smw personil terpisah .walaupun gagal bae :D ... band udh gak lengkap ... saya masih berjuang untuk mimpi .gitu aja dh . thx u?','Pop','instagram;guitar_plus;','Jakarta',704,'2017-08-26 18:13:32','2017-08-26 18:13:32'),(380,'Javania','1503808898.jpg','javania adalah grup musik dari 2007. meskipun baru 2009 baru resmi menngunakan nama \"javania\" kumpulan dari beberapa musisi band jogja. kami tidak terikat label ataupun promotor manapun. untuk karya baru 10 lagu kami baru sempat record secara home recording saat ini. untuk jogja mungkin sudah tidak asing lagi karena sedari 2007 sudah sering tampil baik event sekolah, instansi sampai event konser amal beberapa tahunlalu. kami ada untuk berkarya, dengan mengusung genre all around, dari pop rock sampai blues kami rangkum menjadi 1 aransment di setiap lagu kami.','Others','instagram;','Yogyakarta',744,'2017-08-26 20:41:38','2017-08-26 20:41:38'),(381,'Revolper63','1503821764.jpg','Awal terbentuknya band ini,yaitu 2 tahun yg lalu. Awalnya kami hanya sekumpulan teman nongkrong . Lalu kami punya inisiatif,karna kami semuanya suka dengan musik terutama Musik rock.lalu muncullah ide kami untuk membentuk band yaitu Revolper63 .kami belum mendapat prestasi selama 2 tahun ini.','Alternative Rock','instagram;poster;teman;lainnya;','Medan',664,'2017-08-27 00:16:04','2017-08-27 00:16:04'),(382,'HUNTINGHOUSE','1503822193.jpg','mengikuti audisi band djarum super di bogor','Alternative Rock','lainnya;','Jakarta',750,'2017-08-27 00:23:13','2017-08-27 00:23:13'),(383,'Lollypop Monster','1503822876.jpg','Lollypop Monster terbentuk pada akhir tahun 2009. \r\npada tahun 2012 Lollypop berhasil menjadi juara online audisi Indie Meet The Label dan mengikuti  babak penyisihan di Surabaya, namun keberuntungan belum berpihak pada LPM, sehingga kami harus cukup bangga isa lolos sampai 10 besar.\r\n\r\nberjalannya tahun terjadilah 2 pergantian personil pada posisi drum & Lady Vocal.\r\n\r\ntujuan kami ikut Levi\'s band hunt, kami ingin memperbanyak pengalaman kami dan kami ingin terus bermusik.\r\n\r\n\"From one stage to another stage! To achieve our hope, together!\"','Electro','guitar_plus;','Jakarta',749,'2017-08-27 00:34:36','2017-08-27 00:34:36'),(384,'Mafia','1503828915.JPG','Terbentuk pada tanggal 1 juli 2017 oleh Wahyu (Drum), Bobby (Guitar), Rio (Bass), Rebecca (Vocal), dan Fajar (Keyboard). Di awali oleh Wahyu dan Bobby yang pada saat itu sedang ingin mencoba meng’explorasi’ music Rock dengan nuansa Jazz dan brass section. Akhirnya tercetuslah ide untuk membuat sebuah band dengan image Mafia. Pada saat itu Bobby masih tergabung di sebuah Band Progresif Rock asal Karawaci Tangerang yang bernama “Waluku” (Finalis gudang garam rock fest 2006), Sedangkan Rio mempunyai Band bergenre Power Pop yang bernama “Reto”, begitu juga dengan Wahyu yang pada saat itu masih tergabung di Band Modern Rock asal Tangerang yang bernama “deSound”(band yg sempat mengeluarkan album “page one” pada 2009). Akan tetapi keinginan untuk membuat sebuah band dengan genre yang ‘berbeda’ dan kevakuman band mereka masing-masing membuat mereka sepakat membentuk sebuah band dengan nama “Mafia”, yang bisa disebut sebagai salah satu simbol “pemberontakan”. Nama ini tercetus begitu saja dan berkesinambungan dengan Visi-Misi para personel yang ingin membuat suatu musik yang berbeda dan melawan ‘aturan’, serta simple dan “ear catching”.Pengerjaan Materi lagu digarap dengan serius di Nm studio di Kawasan Tangerang, diawali dengan lagu “Jiwa benalu”, berikutnya “Hedonis”, karya-karya berikutnya pun mengalir dengan bebas namun bisa dipertanggung jawabkan.\r\nMusic Mafia banyak dipengaruhi oleh band-band seperti Foo Fighters, Incubus, Paramore serta lagu-lagu dari big band/orchestra, yang sarat dengan karakter Rock dibalut dengan latar nuansa Swing dan Orchestra ala film-film Mafia.\r\nCP : 089609781983 (wahyu','Alternative Rock','poster;teman;','Jakarta',752,'2017-08-27 02:15:15','2017-08-27 02:15:15'),(385,'The Drummer\'s','1503841492.jpg','The drummers terbentuk dari satu komunitas drum di cianjur (rdc) riungan drummer cianjur, dengan semua personil nya adalah drummer profesional asa cianjur,  maka terbentuk lah the drummer\'s untuk lagu pun kita lebih ke hal hal kehidupan sehari hari dan lebih jenaka mungkin unik dengan semua personil nya memakai topeng.','Rock','facebook;','Jakarta',759,'2017-08-27 05:44:52','2017-08-27 05:44:52'),(386,'Throne','1503841725.jpg','Band terbentuk pada tanggal 04 oktober 2015 yang beranggotakan 5 orang, band ini beraliran progressive rock. Sudah beberapa prestasi yang kami raih salah satunya juara favorit pada acara pensi fair global tv 2015, juara 1 binus festival, juara 1 festival panggung budaya jiexpo, dan mengisi acara di beberapa pensi sekolah.','Rock','instagram;guitar_plus;teman;','Jakarta',498,'2017-08-27 05:48:45','2017-08-27 05:48:45'),(387,'S.A.M Site','1503841731.png','Band bergenre Techno Core/Industial Nu Metal.','Others','guitar_plus;teman;','Jakarta',762,'2017-08-27 05:48:51','2017-08-27 05:48:51'),(388,'Brain Disorder','1503842866.jpg','Brain Disorder yang biasa disebut BD ini adalah band Slamming Death Metal asal Kota Bengkulu, Sumatera - Indonesia. Band yang sudah berdiri sejak 2005 ini sudah banyak mengalami evolusi. Hingga saat ini telah banyak Single lagu yang sudah dimuntahkan.','Others','instagram;','Jakarta',763,'2017-08-27 06:07:46','2017-08-27 06:07:46'),(389,'Scream Against Time','1503847687.JPG','Awal mula band ini bermula dari sebuah mimpi dan hasrat tersembunyi seorang Joe  yang ingin bermain musik keras danmengembangkannya di Indonesia. Saat itu Joe sedang belajar bermain gitar dan ingin merekam-rekam iseng di studio. Berhubung dia pernah bertemu dengan Khesa, drummer dari band lain, dan langsung diajak bertemu dan rekaman. Karena butuh seorang vokalis, Joe mengajak sahabat nya dari satu sekolah, Edel untuk bernyanyi. Seiring waktu berjalan, Joe tidak mau cuman sekedar berproduksi di studio, maka dari itu dia ingin mencari gitaris kedua, bassist dan seorang vokalis scream. Khesa memiliki teman tetangga yaitu Yudit yang bisa bermain gitar, dan meng-snowball kan ke Daniel, yang sedang belajar untuk berteriak, dan akhirnya Raihan, yang bermain bass. Setelah panggung mereka pertama, mereka langsung merekam EP pertama mereka berjudul Motionless dan release tanggal 14 Juli 2017 di Spotify, iTunes, Amazon dll dan juga bentuk fisik yaitu CD. Berhubung Yudit & Daniel sedang sibuk dengan urusan pribadi nya, sekarang datang lah member pengganti gitaris yaitu Joshua, yang sudah berpengalaman juga. Scream Against Time adalah sekelompok band orang-orang muda tapi itu tidak menghalangi mereka untuk berserius dan berkarya di industri musik.\r\n\r\nPrestasi:\r\n\r\n• Pernah tampil di panggung gede seperti Tosca 2017, Tangfest 2017 dll.\r\n• Telah release EP berjudul Motionless di bulan Maret.\r\n• Telah release 2 musik video di youtube berjudul \"You May\" dan \"Rise\"','Others','poster;teman;','Jakarta',745,'2017-08-27 07:28:07','2017-08-27 07:28:07'),(390,'Black Wine Grandpa','1503851455.jpg','Berdiri tahun 2014','Alternative Rock','guitar_plus;','Jakarta',477,'2017-08-27 08:30:55','2017-08-27 08:30:55'),(391,'A.M.O Project','1503851666.jpg','Dibentuk Tahun 2016 di Bandung\r\nAmo project adalah project solo guitar instrumental oleh Gitarisnya sendiri, Amo. Beranggota  4 orang, 2 Gitaris, (Amo dan Hadi) Drummer (Andi) dan Bassis (Robert) Merekam, mendanai dan merilis sendiri EP yang berjudul \"My Guitar and Me\" yang memiliki genre yang luas dari heavy metal sampai jazz fusion pada September 2016. Dan akan terus maju berharap musik instrumental dapat menembus pasar musik Indonesia.','Others','guitar_plus;','Jakarta',669,'2017-08-27 08:34:26','2017-08-27 08:34:26'),(392,'DIANDRAS','1503854399.jpg','Berawal dari keinginan Rezza Verdant dan Raga Pratama yang ingin membentuk sebuah band dengan mengusung musikalitas rock, dibalut dengan konsep dan musik ala \"DIANDRAS\" yang akhirnya sepakat menamakan genre Rythm Rock. Mereka pun mencari personil.\r\nHingga akhirnya mereka menghubungi Azka Adiba untuk mengisi posisi sebagai Bassist. Dan tak sampai disitu, mereka pun bertemu Aditya di salah satu event lalu mengajaknya bergabung dalam sinergitas bermusik ini pada tanggal 15 September 2015.\r\nLangkah demi langkah lurus tertanam dan panggung demi panggung pun terjajaki. Hingga lahirlah satu buah karya melalui proses dialektis yang ada berjudul \"Insecure\" yang kini bisa dinikmati di iTunes, Spotify, etc.\r\nNamun, belum genap 2 tahun DIANDRAS (formerly known as Diandra\'s Evening). Tepat pada tanggal 27 Mei 2017, Aditya mengundurkan diri. Setelah menyelesaikan Tour Lombok - Sumbawa (24 Sept - 7 Oct 2016) dan Tour Malaysia (11 - 13 Feb 2017).\r\nProduktifitas karya tidak terhenti sampai disini. Progress demi progress terus diupayakan. Alhasil panggung Jakarta Fair pun berhasil dijajaki. Dan saat ini sedang dalam proses penggarapan single kedua yang akan diluncurkan pada akhir September 2017.','Alternative Rock','instagram;umi;teman;','Yogyakarta',766,'2017-08-27 09:19:59','2017-08-27 09:19:59'),(393,'HYSTERIA','1503859687.jpg','NAMA BAND		        : H Y S T E R I A\r\nTAHUN TERBENTUK	: 2013 (Dengan formasi awal), hanya saja formasi awal tidak bertahan cukup lama, sehingga terjadilah kefakuman di dalam Band. Para personil sibuk dengan karir masing-masing, ada yang bersolo karir dan ada juga yang menjadi session player di band lain. Hysteria dengan formasi baru terbentuk sekitar pertengahan April 2017, dengan niat awal adalah sebagai band project an, dikarenakan masing-masing personil memiliki kesibukan masing-masing di band mereka ataupun bersolo karir sebagai session player. Berikut uraian personil-personil Hysteria beserta dengan achievment di bidang musik.\r\nPERSONIL 	:  1. ANDRI DHARMA ( VOCAL )\r\n			   2. IVAN MAHYA DEVA ( GUITAR )\r\n			   3. IBNU ALDIAN ( BASS )\r\n			   4. FUADI ARMAN ( DRUM )\r\n			   5. ASEP IMAN PERMANA ( KEYBOARD )\r\n\r\nPRESTASI 		: Prestasi secara band memang belum banyak dikarenakan Hysteria dengan formasi baru ini baru saja terbentuk namun prestasi secara individual anggota personil termasuk sangat membanggakan, baik itu prestasi secara nasional maupun secara internasional.\r\n\r\n\r\n\r\nDAFTAR PRESTASI \r\n\r\nIVAN MAHYA DEVA (GUITARIST) :\r\n- 2nd Place Ibanez Flying Finger Indonesia 2017\r\n- TOP 30 Kiesel Guitar Contest 2017 (Internasional)\r\n- The 1st Winner Of Band Competition JAMSIKA UNAND (Jumpa Musik Kampus) 2004 \r\n-	The 1st Winner Of Yamaha Free Your Soul (Band Competition-Nasional) on 2006 \r\n-	The 1st Winner of Sastrakustik Band Competition on 2006 \r\n-	Welcoming Stage of Jakarta Jam in Tennis Indoor Senayan Jakarta on 2007, Simple Plan, One Republic, Lost Prophet International Concert. \r\n-	The 2nd Winner of Jakarta Guitar Competition (International) on 2013 \r\n-	The 3rd Winner of Waves Of Shred Guitar Competition (International) 2013 \r\n-	The 3rd Winner of Riffs Contest (Guitar Competition) – International 2013 \r\n-	TOP 30 Guitarists out of 1.256 contestants in French Guitar Contest II (International) 0n 2013. \r\n-	TOP 10 Flying With Ibanez Indonesian Guitar Challenge 2015 (Nasional)\r\n-	TOP 50 Jamtrack Central Guitar Competition 2015 (Internasional)\r\n-	2nd Winner Hari Hari Music Shred Guitar Competition 2017 (Nasional)\r\n-	Visit my Youtube Channel for further references (http://www.youtube.com/user/ivanxmahya ) \r\n\r\nANDRI DHARMA (VOCALIST)\r\n-	Opening Concert Triad  Padang Yamaha Stage 2010\r\n-	GuessStar Yamaha Dari tahun 2010 sampai 2015\r\n-	Opening Concert Anji 2013 Teluk Kuantan Riau\r\n-	Opening Concert Rif soundrenaline 2015\r\n-	The Best Vokal Festival Band Se-Sumbar piala Dinas Kebudayaan dan Parawisata Pasaman tahun 2015/2016\r\n-	Top 2 Online Audition Rising Star 2014\r\n-	Juri Festival band indie/solo Song Dll\r\n-	Pencipta Lagu dan Arranger\r\n-	Instruktur Vokal dan Musik di SMA N 6 PADANG dan SMA N 1 Sitiung Kabupaten Dharmasraya \r\n-	Utusan Sumbar Dalam Acara Gita Permata Nusantara Di TMII 2015/2016 Jakarta\r\n\r\nIBNU ALDIAN ( BASS PLAYER) \r\n-	The Best Bass Player Next Level Pensi Fair Global TV 2016\r\n-	2. Brand Ambassador ExtraJoss Blend 2016 - 2017\r\n-	3. Artist (Bass Player) iklan Extrajoss Blend Next Level\r\n-	4. Juri Festival Band Indie, Akustik, dll\r\n-	5. Session Player (Bass) untuk Band Pembuka Artis\r\n\r\nFUADI ARMAN (DRUMMER) :\r\n-	Peserta pesta gendang di malaka\r\n-	Sesion player drum orchestra isi padang panjang\r\n-	Sesion player drum di acara asean jazz with M.Halim @batam\r\n-	Sesion player drum with minangapentagong @sawah lunto internasional music festival\r\n-	Peserta indonesian drum and percussion @bentara budaya jakarta with indojati\r\n-	Sesion player drum di acara final hardrock rising star @bali with A gift from anita band\r\n-	Instruktur drum @GRSB padang dan PURWACARAKA padang\r\n-	Sesion drum player pengiring konser artis di padang alex rudiart,ressa herrlambang,nita thalia,iis dahlia \r\n\r\nASEP IMAN PERMANA (KEYBOARDIST)\r\n\r\n-	Session Player \r\n-	Arranger\r\n-	 Best Keyboardist\r\n-       Artist Home Band\r\n-       Piano/Keyboard Teacher at GRSB','Alternative Rock','guitar_plus;poster;teman;lainnya;','Medan',593,'2017-08-27 10:48:07','2017-08-27 10:48:07'),(394,'Mahesh','1503864841.jpg','Mahesh merupakan plesetan nama dari nama awal Mahesa. Mahesa terbentuk pertengahan 2014 ketika sekumpulan mahasiswa tingkat akhir di Unsoed Purwokerto mengikuti audisi sebuah acara kampus bertajuk Dentistry Perforation. Acara tersebut memberikan kesempatan kepada band yang lolos audisi untuk tampil sebagai opening band special guest star. Saat itu, Sheila on 7 menjadi special guest star. Mahesa berhasil lolos audisi menjadi satu dari tiga band yang tampil untuk opening band Sheila on 7. \r\n\r\nPasca acara Dentistry Perforation, Mahesa sempat vakum 6 bulan karena masing-masing personil kembali disibukkan oleh tugas akhir perkuliahan. Dua personil utama Mahesh yakni Panji dan Haidar berinisiatif untuk mulai kumpul untuk jamming dan membuat materi lagu. Kebetulan pula Haidar sudah punya satu materi lagu yang saat itu baru liriknya saja. Setelah beberapa kali jamming unplugged, jadilah lagu pertama Mahesa yaitu Udara. \r\n\r\nAkhir 2015, Mahesa meminta bantuan seorang kawan yang bernama Ridho untuk membuat live session lagu Udara. Kebetulan pula Ridho sedang menggarap rintisan project video live bernama Rid\'s Creative. \r\n\r\nSelepas live session Udara, Haidar ingin lepas dari bayang-bayang Mahesa yang tampil di Dentistry Perforation. Akhirnya nama Mahesh lah yang dipilih. Panji dan Haidar mulai menyicil beberapa materi lagu untuk tabungan rekaman yang nantinya bisa digarap setelah lulus. Munculah beberapa lagu yang terinspirasi dari kehidupan sehari-hari Panji dan Haidar seperti, Pagi, Awan, Kantin, Kipas, hingga Lagu Dini Hari. Selain itu Mahesh menyiapkan lagu berlirik bahasa Inggris seperti Save Heart dan Bad Value.\r\n\r\nJamming hanya berdua membuat Mahesh membutuhkan tambahan sound rhytm yang lebih padat lagi untuk aransemen lagu-lagu setelah udara. Dimas sebagai gitaris semasa Panji SMA pun direkrut sebagai gitaris utama. Dimas pun menyumbang materi lagu yang juga terinspirasi dari kehidupan sehari-hari berjudul Ku Akan Pulang.\r\n\r\nPasca lulus kuliah hingga kini, Mahesh masih merutinkan latihan untuk mematangkan aransemen lagu-lagu persiapan untuk album debut.','Pop','maliq;','Jakarta',222,'2017-08-27 12:14:01','2017-08-27 12:14:01'),(395,'Speed Invited','1503890715.jpg','Sering main di acara-acara gigs di Bekasi periode 2011-2013','Others','facebook;','Jakarta',765,'2017-08-27 19:25:15','2017-08-27 19:25:15'),(396,'Speed Invited','1503890732.jpg','Sering main di acara-acara gigs di Bekasi periode 2011-2013','Others','facebook;','Jakarta',765,'2017-08-27 19:25:32','2017-08-27 19:25:32'),(397,'Tropical Flower','1503892779.jpg','Tropical Flower pernah merilis album Kompilasi 10 Band Sumatera dalam Indiespired 2011 Jong Sumateranen Bond bersama Aksara Record','Pop','teman;','Jakarta',777,'2017-08-27 19:59:39','2017-08-27 19:59:39'),(398,'Leaving The Nemesis','1503898735.jpg','Kami sedang mengerjakan EP berjudul \'HIS BACK\'','Others','guitar_plus;','Medan',784,'2017-08-27 21:38:55','2017-08-27 21:38:55'),(399,'SYAHINSOMNIA','1503900862.jpg','Sebuah band yang berasal dari Tangerang. Nama SYAHINSOMNIA di ambil dari salah satu personil sang vocalis arti dari nama kepanjangannya AndianSyah dan ditambahkan Insomnia yg arti nya Tidak bisa tidur / Tidak pernah tidur cepat. Selalu bermain musik dan menulis lagu setiap malam. Di sisi lain Syahinsomnia pun mempunyai arti dan makna tersendiri yaitu , kita ingin mencoba mewarnai musik Indonesia / nasional. Tidak jauh dari kata Insom , Syahinsomnia bergenre NEO POP AND JAZZ , dengan mengusung Konsep yg agak sedikit berbeda . Tapi orang2 bilang musik kita lebih menonjol ke Jazz :D SYAHINSOMNIA Terbentuk pada pertengahan tahun yaitu bulan Juli 2016 , dan hingga saat ini Syahinsomnia memiliki 5 Pemuda yg keren dan Gagah : 1. Kudill - Vocal 2. Hadi Godil - Guitar / back vocal 3. Aceng - Lead Guitar 4. Shiba - Bassist 5. Timbil - Drum Dan kami baru saja merelease sebuah Single pertama yaitu \' Kan Ku Jaga \' Sudah tersedia di Digital Store Music! Kalian bisa streaming di Apple music, Joox, Spotify, Dezeer etc! Semoga kita bisa manggung sekaligus dapat bonus jajan:D Di kota-kota lain, seperti NASIONAL bahkan INTERNASIONAL','Jazz','facebook;instagram;teman;lainnya;','Jakarta',787,'2017-08-27 22:14:22','2017-08-27 22:14:22'),(400,'Egg Eyes Cow (E.E.C.)','1503901209.JPG','Terbentuk di sebuah cafe di Denpasar, Bali pada tahun 2009. Dimotori oleh Sayang (vocal), bersama ketiga personil lainnya pun sepakat membentuk band dengan nama Egg Eyes Cow dengan cita-cita menjadi band major label yang bisa mewarnai dunia musik Indonesia. Pada pertengahan tahun 2009, E.E.C. mulai rekaman di studio home recording milik seorang teman, dan berhasil merampungkan 6 lagu. Pada tahun 2009 juga, E.E.C. berhasil tampil pada segmen band Indie yang diadakan oleh Blue Eyes Cafe, Bali. Sayangnya, pada bulan September 2009, Indra (gitar) harus bekerja di luar pulau Bali, sehingga E.E.C. vakum untuk sementara. Pada kisaran tahun 2010-2011 ditengah kesibukan masing-masing personil band, E.E.C. berhasil membuat 2 video klip amatir. Pada tahun 2012, Wahyu (drum) melanjutkan pendidikan ke jenjang S2 di Semarang, sehingga E.E.C. benar-benar vakum total. Pada akhir tahun 2015, Indra (gitar) dan Wahyu (drum) sudah kembali berdomisili di Bali, dan keempat personil asli E.E.C. sepakat untuk kembali melanjutkan passion dalam bermusik bersama.','Pop','guitar_plus;','Surabaya',780,'2017-08-27 22:20:09','2017-08-27 22:20:09'),(401,'Jendela Kamar','1503906233.jpg','kita baru saja terbentuk dan mulai awal nya sering ketemu reguleran di cafe2.\r\ndan berencana membentuk band dan mencoba memberanikan diri untuk membuat karya\r\ndan membuat nama band nya jendela kamar :]','Pop','instagram;guitar_plus;','Medan',788,'2017-08-27 23:43:53','2017-08-27 23:43:53'),(402,'Forme!','1503908286.png','Terlahir di kota pelajar Yogyakarta pada tahun 2012,\r\nForme! adalah sebuah grup musik beraliran pop-blues yang mencoba\r\nmenunjukkan penampilan terbaik untuk setiap panggungnya.\r\nSuara khas sang vokalis (Zaky), berpadu dengan gitaris (Taufik),\r\nbassis (Dana), keyboard (Yudis) dan drummer (Yosi) yang telah malang\r\nmelintang di dunia musik Yogyakarta mampu memberikan suguhan\r\nsegar dengan menggabungkan musik pop-blues dari mulai lagu dengan\r\ntempo rendah hingga tinggi dengan referensi musik dari musisi dalam\r\ndan luar negeri seperti John Mayer, Jason Mraz, BB King, Jimi Hendrix,\r\nStevie Ray Vaughan, Gugun Blues Shelter, Ginda and The White Flowers\r\ndan beberapa musisi lainnya.\r\n\r\nLive Performance:\r\n2016\r\nNgamal Kuy, Kuy Creative, Ex-Matchamu Pogung, Yogyakarta\r\nTottaly Blues, Rock \'N Real, Terrace Cafe and Karaoke Yogyakarta\r\n\r\n2015\r\n“Fesbuker 2015”, Universitas Islam Indonesia.\r\n“Jambore Siaran Nasional IV”, Radio Republik Indonesia,\r\nMuseum Vredeburg, Yogyakarta.\r\n“Seger-segeran Sansekerta 2015” Fakultas Pertanian UGM\r\n“Jazz Mben Senen, Bentara Budaya, Yogyakarta.\r\n“Chareaty Analog Coffee Barz X Meat & Great”\r\n“Inagurasi Mahasiswa Baru Fisip” Universitas Atma Jaya\r\nYogyakarta.\r\n“Gelanggang Expo 2015” Universitas Gadjah Mada.\r\n“Business Festival 2015” Universitas Kristen Duta Wacana.\r\n“Employement Gathering Bank Indonesia Purwokerto”,\r\nQueen of The South Beach Resort, Yogyakarta.\r\n\r\n2014\r\nPameran Keramik “Vacuum Learning” ,Bentara Budaya\r\n“USAID Disaster conference, Yogyakarta\r\nWelcoming Dinner “LBD 5,” BNI Foodpark\r\nHalal bi halal PT MIROTA KSM 2014\r\n“Festival Museum” Pendopo Taman Siswa\r\nPengisi Acara“Farewell Party” IUP FEB UGM at Dafam Hotel\r\nClosing Party “Looking Beyond Disaster 5” Grand Aston,\r\n\r\n2013\r\nNew Year Party, Kalimilk Seturan\r\n“Sarasehan” Budaya Papua Barat, Purna Budaya UGM\r\nMIPA Charity Concert Fakultas MIPA UGM\r\nLooking Beyond Disaster Charity Concert, UGM\r\nMalam minggu at KFC”, KFC Soedirman\r\nEarth Hour event, 2013\r\n“Go Shopping” Balai Utari Wanitatama\r\nHarmony #3 Bazaar & Garage Sale, Balai Utari Wanitatama\r\nISAP 2013, Yogyakarta\r\n\r\nContact Info :\r\nEmail : itsformeofficial@gmail.com\r\nPhone : +62 852 6893 4359 (Dana)\r\nInstagram : @itsformeofficial\r\nFacebook : facebook.com/itsformeofficial\r\nSoundcloud : itsformeofficial\r\nTwitter : formeofficial\r\nYoutube : Forme Official\r\nReverbnation : reverbnation.com/formeofficial','Blues','instagram;guitar_plus;teman;','Yogyakarta',740,'2017-08-28 00:18:06','2017-08-28 00:18:06'),(403,'Fialova','1503912098.jpg','Fialova merupakan Sebuah Band beraliran pop alternative. Dibuat mengikuti idealisme para personilnya yang ingin agar karyanya masuk dalam industri musik komersil. Sebelumnya para personil Fialova merupakan anggota dari Band Columbus Reborn yang sudah menelurkan satu album dan berkolaborasi dengan musisi musisi nasional.','Pop','umi;teman;','Jakarta',792,'2017-08-28 01:21:38','2017-08-28 01:21:38'),(404,'COSMOGONY','1503916474.JPG','Cosmogony adalah sebuah band pop punk/Punk rock/ alternative yang dibentuk di Palu, Sulawesi Tengah, pada tahun 2013. Band Beranggotakan Oki (drum), Iwin (bass/vox) dan yoga (gitar/vox) Saat ini sudah merilis EP Album yang bertajuk ‘NYATA’ yang berisikan 6 buah lagu yang direkam di sebuah studio di Palu yang bernama Velo record.\r\n\r\nSejarah terbentuknya band ini berawal dari perkenalan oki dan yoga yang kebetulan bersekolah di sekolah yang sama, yang kemudian memutuskan untuk memulai sebuah band.\r\n\r\nTidak ingin menjadi duo racun, oki dan yoga mencari seseorang yang pas untuk mengisi posisi bass/vox. Setelah melalui masa PDKT yang cukup lama, akhirnya agung resmi mengisi posisi bass/vox. Pada hari itu setelah solat jum’at band ini resmi terbentuk dengan nama Cosmogony dan perjalanan pun dimulai.\r\n\r\nPenampilan pertama Cosmogony yaitu pada Festival Teluk Palu dan cosmogony terus menjajal gigs-gigs local yang ada di kota palu, hingga akhirnya Cosmogony memutuskan untuk merekam single pertama mereka yang berjudul ‘Terdiam dan Terbakar’. Tidak lama setelah merilis single tersebut Posisi bass/vox yang sebelumnya di isi oleh agung harus di gantikan oleh Irwin Zaenong. Masuknya Iwin kedalam formasi band ternyata membawa angin segar untuk Cosmogony. Tidak butuh waktu lama untuk penyesuaian setelah pergantian personil Cosmogony merilis debut EP album pertama yang bertajuk ‘NYATA’ , ini menjadi bukti keseriusan dan totalitas Cosmogony sebagai sebuah band yang berkarya di jalur independen.\r\n\r\nSaat ini Cosmogony sedang dalam proses pengerjaaan Album terbaru yang bertajuk ‘HIBERNASI’ yang baru saja di rilis tepat pada tanggal 24 April 2017.','Others','teman;','Jakarta',794,'2017-08-28 02:34:34','2017-08-28 02:34:34'),(405,'Cosmo','1503918815.jpg','terbentuk tahun 2010 di sulawesi selatan, dan telah beberapa kali berganti personil membuat robi vokalis Cosmo tetap yakin bahwa musik Cosmo bisa diterima oleh penikmat musik tanah air. Dengan formasi sekarang kami berharap dengan adanya levis band hunt ini bisa menjadi salah satu jalan Musik Cosmo agar sampai ketelinga penikmat musik Indonesia.','Pop','facebook;maliq;','Jakarta',723,'2017-08-28 03:13:35','2017-08-28 03:13:35'),(406,'Larina','1503918909.jpg','Menjadi 15 Besar Finalis Indonesian Sound Festival 2015','Pop','teman;','Jakarta',795,'2017-08-28 03:15:09','2017-08-28 03:15:09'),(407,'April Lost Marrie','1503919067.jpg','APRIL LOST MARRIE adalah band metalcore dari Yogyakarta yang terbentuk pada tanggal 4 april 2011. Awal mula band ini merupakan gagasan dari Yayas (vokal) dan Joe (gitar) untukmembuat sebuah band dengan genre post-hardcore. Kemudian mereka berdua mengajak Rinenggar (gitar), Terra (bass) dan Ressa (drum) untuk bergabung dengan band. Seiring berjalannya waktu pada awal tahun 2015 member band ini mulai keluar satu persatu meninggalkan band karena kesibukan masing-masing. Setelah sempat vakum beberapa bulan akhirnya pada awal tahun 2016 Yayas mulai membangkitkan lagi April Lost Marrie dengan mengajak Ajik (gitar), Fanda (drum), Yuga (bass) untuk bergabung dengan band dan merubah genre band menjadi metalcore.','Others','teman;','Yogyakarta',769,'2017-08-28 03:17:47','2017-08-28 03:17:47'),(408,'STICK UP','1503919155.jpg','Stick up berasal dari kota tasikmalaya pada tahun 2013\r\nSetick up terdiri dari 5 orang personil dengan posisi :\r\nAdut : gitar\r\nDena : vocal\r\nLukman : bass\r\nRaufik : gitar\r\nAngga : drum\r\nStick up beraliran pop punk / alternatif rock. \r\nPrestasi :\r\n- Juara 3 di tasikmalaya motekart pestival pada tahun 2015\r\n- juara 1 di pro mild protections musik pestival pada tahun 2016\r\n- juara 3 di festival music instinct pada tahun 2016','Alternative Rock','guitar_plus;','Jakarta',600,'2017-08-28 03:19:15','2017-08-28 03:19:15'),(409,'The Good Listener','1503919572.jpg','The Good Listener lahir pada tanggal 24 April 2011 di Yogyakarta. Sampai saat ini kami memiliki mini album bertajuk \"Partikel Emosi\" berisi 5 lagu yang telah di launching pada tahun 2013.','Rock','poster;teman;','Yogyakarta',742,'2017-08-28 03:26:12','2017-08-28 03:26:12'),(410,'Defodio Band','1503920038.jpg','Defodio Band terbentuk dari Kumpulan UKM Band Bina Nusantara yang bergenre Rock, yang terinspirasi dari black sabbath, iron maiden, gun n roses, led zeppelin, dan Band rock dunia lainnya. Band kami pernah Lolos audisi B-Voice Anniversary yang bintang tamunya Maliq & D\' essential, Teddy Aditya, dan Lain-lain. Kami pernah nge-gigs di rockgasm supermusic id, manggung di acara B-Fest (Binus Festival Band) Raise your sound, dan acara band lainnya. Kami mempunyai album yang berjudul \" Sanity \" tapi baru 3 lagu yang sudah di record.','Rock','instagram;teman;','Jakarta',790,'2017-08-28 03:33:58','2017-08-28 03:33:58'),(411,'Backspace','1503925163.jpg','Backspace adalah band punk asal kota medan yang terbentuk pada Desember 2016 yang beranggotakan 3 orang dan 1 orang additional. Sejauh ini Backspace sudah mengeluarkan 4 single yaitu \"All Goes Down,\"Screaming To The World\",\"Tanpa Kata\", dan \"Walking\" yang sudah bisa di dapatkan di berbagai platform seperti iTunes, Spotify, Youtube, dan lainnya. @Officialbackspace adalah username Backspace di Youtube dan Instagram. Backspace berencana mengeluarkan Album yg berisi 9 lagu (termasuk 4 lagu diatas) di akhir tahun ini.','Others','teman;','Medan',801,'2017-08-28 04:59:23','2017-08-28 04:59:23'),(412,'RocBuc','1503926122.jpg','Terbentuk awal tahun 2016.','Others','facebook;instagram;teman;lainnya;','Yogyakarta',803,'2017-08-28 05:15:22','2017-08-28 05:15:22'),(413,'Fill Me Out','1503926733.JPG','Hello, we are Fill Me Out a pop punk band from south jakarta, kita terdiri dari 4 orang personil, band ini terbentuk 2 tahun yang lalu yang ber influance terhadap All Time Low dan pee wee gaskins. prestasi yang sudah kita sudah capai antara lain : \r\n1. kita sudah mempunyai album yang berisi 7 lagu dan sudah bisa didengar di spotify, i tunes music, youtube dan soundcloud.\r\n2. kita sudah launching album kita di JK7 kemang pada tanggal 31 maret 2017.\r\n3. kita sudah bermain di berbagai tempat dan acara besar nya antara lain jakcloth, rolling stone, dan acara tahunan BPJS, dan bermain di warner music indonesia sebagai guest star,  All Time Low  tribute yang diselenggarakan oleh All Time Low Indonesia.\r\n4. salah satu gitaris kami lolos dalam audisi peavey gitar show down.\r\n5. kita sering bermain di berbagai acara musik kampus sebagai spesial performance.','Others','instagram;guitar_plus;','Jakarta',802,'2017-08-28 05:25:33','2017-08-28 05:25:33'),(414,'Nitya Band','1503929097.JPG','Nitya band, terbentuk pada 09-November-2015\r\nmemulai karir bermusik dengan mengikuti festival accoustic local di bali, dan sampan menjuarai ( Juara 1 ) festival band di Bali pada Maret 2016 lalu, hingga sini Nitya sudah memiliki 5 buah lagu yg sudah bisa di dengarkan di Soundcloud , Youtube dan media lain nya, mempunyai satu video klip yg berjudul Harapan. Nitya memiliki hingga kini memiliki 5 personil diantarnaya, MellyNia ( Vocal ) Gustraa ( Melody) Ariana ( Rhythm) Ferdinand ( Bass ) Dedha ( Cajon ). Nitya sempat mengukuti roadshow di beberapa kota di Bali ada bulan September 2016 lalu. Berjalan telama hempir 2 tabun dan aktif dalam kegiatan musik di bali, mengisi acara di beberapa event besar di kota Denpasar, sempat di undang undang di stasiun radio swasta di bali dan di liput oleh salah satu media cetak. Sekian perkenalan dari Nitya band, maaf jika ada kata-kata yang kurang berkenan. Terima Kasih.','Others','facebook;instagram;teman;lainnya;','Surabaya',806,'2017-08-28 06:04:57','2017-08-28 06:04:57'),(415,'afif and friend','1503930635.JPG','lagu tentang persahabatan lagu sudah sangat tenar di sulawesi selatan asal dari makassar','Pop','facebook;instagram;informasi_toko;','Yogyakarta',808,'2017-08-28 06:30:35','2017-08-28 06:30:35'),(416,'GVM. (GIVE ME SOME ADVICE)','1503933245.jpg','GVM. (Alternative Pop/Rock) terbentuk pada tahun 2009 di Jepara, Nama GVM berasal dari “Give Me Some Advice” yang berarti “Beri Aku Nasihat” Supaya lebih mudah diingat, kemdian band ini dinamakan GVM. Filosofinya adalah GVM. Ingin terus berkembang melalui nasehat/saran dari pendengarnya. Band ini beranggotakan 5 personil yaitu Bryan, Dhimas, Alfian, Andra, dan Bowok. Namun di akhir tahun 2016 Bryan (Vokal) pergi ke Australia untuk urusan pekerjaan kemudian posisi Vokal dirangkap oleh Dhimas (Gitar, Vokal). Tahun 2011 GVM. Merilis single “Jangan Berhenti” dan “Guilty Of” di tahun 2013. Kemudian pada tahun 2015 GVM. Mulai produksi Extended Play yang bertajuk “2015” dengan enam lagu dan di launch pada 25 February di Stasiun TV lokal “Semarang TV”.','Alternative Rock','instagram;teman;','Yogyakarta',652,'2017-08-28 07:14:05','2017-08-28 07:14:05'),(417,'Enzil','1503934658.jpg','Enzil berasal dari bahasa Belanda yang artinya Satu Jiwa, kami terdiri dari 4 personil dan 1 additional player, kami sering mengikuti festival festival musik di jakarta, sampai akhirnya kami berhasil menjadi runner up di salah satu festival musik tersebut','Others','guitar_plus;','Jakarta',719,'2017-08-28 07:37:38','2017-08-28 07:37:38'),(418,'Sakarat getih','1503935276.jpg','Kami terlahir sebagai masyarakat biasa dsri satu kampung kecil di garut, kami yg sama sama hobi akan musik ingin mengembangkan kemampuan kami, berharap bisa di sukai dan d terima di masyarakat','Heavy Metal','facebook;instagram;','Jakarta',811,'2017-08-28 07:47:56','2017-08-28 07:47:56'),(419,'Muco Gusto','1503936678.jpg','Berawal dari satu tongkrongan di Institusi musik bilangan Jakarta, Singkatnya Muco Gusto terbentuk pada 15 Januari 2012 yang berasal dari Jakarta Timur.\r\nMuco Gusto diambil dari bahasa Spanyol yang memiliki arti \"Senang berkenalan dengan anda\" dan semoga dari nama itu, Muco Gusto bisa menyuguhkan musik yang menyenangkan di hati para pendengar.\r\nMuco Gusto mengusung genre Rock Alternative, yang diisi oleh Gema (vocals) Willy (Bass) Putra (Guitars) Yosi (drums).\r\nTelah mengeluarkan 2 single yang berjudul ANJING BESAR & MATI SURI DI KERAMAIAN, yang juga sudah bisa dinikmati di gerai musik digital; Spotify, iTunes, Apple Music, dll. \r\nDan untuk Mati Suri di Keramaian, Muco Gusto juga sudah merilis Official Music Video di kanal YouTube \"mucogustoband\". \r\nMati Suri di Keramaian juga dijadikan sebagai OST. \"Saksi Jingga\", untuk Festival film pendek independent di Jepang & Korea. \r\nMati Suri di Keramaian juga masuk 10 besar finalis Digilive Band Festival yang diadakan di Guitar Freaks, Jakarta.\r\nTahun ini Muco  Gusto sudah merampungkan materi-materi untuk full album yang betajuk, \"CATATAN\" yang akan segera dirilis.\r\n\r\nBerbagai panggung dalam kota maupun luar kota sudah mulai kita sambangi. Diantara lain;\r\n- Live at IMI SOCA Hall, Senior Recital.\r\n- Live at DeHoii, Pondok Indah, Jakarta Selatan.\r\n- 4Ever Indie, at JK7 Bar&Club, Jakarta Selatan.\r\n- 5 besar finalis Digilive Band Fest 2016.\r\n- Jakarta Creative Week, Kokas 2016.\r\n- Boys Market, Gandaria City 2016.\r\n- Fusion Jungle, Rolling Stone Cafe, Jakarta.\r\n- Bandung Creative Week, TSM, Bandung 2016.\r\n- Fisip Folk Fest, UNPAD, Jatinangor 2016.\r\n- Pucuk Cool Jam SMAN 112, Jakarta Barat.\r\n- Konser 1000 Band, Ice BSD Tangerang.\r\n- DCDC Shoutout, Global TV.\r\n- Radionet Show, Binus TV.\r\n- 8th Himmarcomm Anniversary, Binus 2016.\r\n- Rocket 88 Faceless at XabiSpace, JakSel.\r\n- Pamulang Festival 2016\r\n- Show Case at Dreamers Radio\r\n- Show Case at Pavilliun 28.\r\n- Kulfaspro 2016, Medan, Sumatera Utara.','Alternative Rock','guitar_plus;','Jakarta',553,'2017-08-28 08:11:18','2017-08-28 08:11:18'),(420,'Senandung','1503936888.JPG','Berawal dari sering ngumpul bareng akhir nya 5 pemuda tanah daeng membentuk Senandung mengusung tema pop jazz senandung berusaha agar bisa mendapatkan kesempatan diajang levis band hunt','Jazz','instagram;','Surabaya',322,'2017-08-28 08:14:48','2017-08-28 08:14:48'),(421,'HALIMUN','1503937423.JPG','Unit Punk / Rock Alternative yang berlokasi di Bogor, Jawa Barat bagian selatan, beranggotakan 4 orang. Berdiri tahun 2012 dengan nama HEROES OF OVER. Sempat merilis mini album (EP) di tahun 2015 yang berisi 4 track.\r\nDan akhir tahun 2016 menyisakan 3 personil, kemudian memutuskan merubah nama menjadi HALIMUN.','Rock','guitar_plus;','Jakarta',441,'2017-08-28 08:23:43','2017-08-28 08:23:43'),(422,'ONE NIGHT IN ALCATRAZ','1503937458.jpg','ONE NIGHT IN ALCATRAZ (ONIA)\r\nInstagram: @onia_rawk\r\nfacebook.com/onenightinalcatraz\r\n---\r\nBand yang mengusung musik Alternative Rock, spesifik pendekatan lebih kepada grunge. Mengusung musik grunge yang anti-vandal, emosional yang elegan, dengan nuansa sound modern dan lirik yang intens pada tema keseharian manusia dalam rumitnya proses interaksi sosial. Kami biasanya menyebut ini sebagai aliran \"Dark Pop Raw Rock\". Mengajak untuk melawan lemah, penguatan karakter diri dan berani meMANUSIAkan manusia. Menjadikan musik sebagai media pengantar pesan dan menyampaikan gagasan melalui getir syair syatir.\r\n---\r\nKami banyak main di gigs lokal komunitas maupun berbagai event musik lintas genre.  Sering pula terlibat pada event bernuansa humanisme dan charity. Sedikit cerita, kami tumbuh dalam lingkup sederhana dengan banyak keresahan yang menjadi amunisi dalam memproduksi karya ke ranah nyata :)','Alternative Rock','facebook;instagram;guitar_plus;teman;','Jakarta',812,'2017-08-28 08:24:18','2017-08-28 08:24:18'),(423,'Basih','1503938176.jpg','Basih berdiri tahun 2004 pada waktu itu bernama dimensi, kemudian tahun 2017 berganti nama menjadi Basih.\r\nPrestasi :\r\n1. Juara 1 festival band se karasidenan banyumas STAIN Purwokerto tahun 2006.\r\n2. Juara 1 Festival band laskar independent tahun 2011 Purbalingga.\r\n3. Juara 1 festival band Pringgading jengkar Purbalingga, tahun 2011.\r\n4. Juara 2 festival band Malibu entertaintment tahun 2011 taman kota Purbalingga.\r\n5. dan lain - lain','Rock','guitar_plus;','Yogyakarta',813,'2017-08-28 08:36:16','2017-08-28 08:36:16'),(424,'THE BUNGSU','1503938376.jpg','THE BUNGSU ( Japanese Pop )\r\n\r\nSebuah band yang terbentuk tanggal 10 oktober 2005, Kami membentuk band ini dengan ambisi besar, memberikan warna baru di blantika musik Indonesia. Menjadi inspirator menghasilkan gabungan kata dan nada yang harmonis dengan ciri khas di telinga penndengar.\r\n\r\nSesuatu yang baru lahir dari band baru, dan akan menjadi nuansa baru, sehingga menjadi harapan baru.\r\n\r\n“The Bungsu” mempunyai kesamaan visi dan misi dalam bermusik dengan Japanese pop. Namun demi memuaskan penggemar musik, khususnya kaula muda yang dinamis dan progresif. Dan dengan tanpa meniggalkan ciri khas, serta idealisme kami, segala warna musik konsumsi anak muda dan penikmat musik\r\n\r\nTetap sederhana dalam bermusik namun cermat dalam mengikuti atmosfir musik Indonesia dan akan menjadi trendsetter di kalangan muda adalah paradigma kami, kebersamaan adalah pondasi kami, persahabatan adalah tujuan kami para personil “The Bungsu”.','Others','facebook;instagram;informasi_toko;vipclub;guitar_plus;poster;','Jakarta',585,'2017-08-28 08:39:37','2017-08-28 08:39:37'),(425,'JUST KIDDING','1503940052.jpg','-','Others','instagram;guitar_plus;','Jakarta',815,'2017-08-28 09:07:32','2017-08-28 09:07:32'),(426,'JUST KIDDING','1503940199.jpg','-','Others','instagram;guitar_plus;','Jakarta',815,'2017-08-28 09:09:59','2017-08-28 09:09:59'),(427,'HILLTOP','1503943275.JPG','Pentas seni Universitas Negeri Jakarta Lomba juara 3','Alternative Rock','facebook;','Jakarta',818,'2017-08-28 10:01:15','2017-08-28 10:01:15'),(428,'HILLTOP','1503943424.JPG','Pentas seni Universitas Negeri Jakarta Lomba juara 3','Alternative Rock','facebook;informasi_toko;umi;teman;','Jakarta',818,'2017-08-28 10:03:44','2017-08-28 10:03:44'),(429,'HILLTOP','1503943682.JPG','Pentas seni Universitas Negeri Jakarta Lomba juara 3','Alternative Rock','facebook;informasi_toko;umi;teman;','Jakarta',818,'2017-08-28 10:08:02','2017-08-28 10:08:02'),(430,'Jakasonic','1503943712.JPG','Jakasonic band yang terlahir tahun 2017\r\nsebelumnya vokalis jakasonic (katon) merupakan vokalis dari band kolken, pernah ikut konser 1000 band. terakhir manggung kemarin di thamrin city mall hari minggu 27-07-2017','Alternative Rock','facebook;instagram;teman;','Jakarta',514,'2017-08-28 10:08:32','2017-08-28 10:08:32'),(431,'CRY-ON','1503944418.jpg','CRY-ON merupakan sebuah band Britpop Alternative Techno yang terbentuk 15 Januari tahun 2011, awalnya kami teridiri dari empat personil tetapi karena dengan berbagai kisah perjalanan akhirnya kami memutuskan untuk melakukan pergerakan band ini dengan dua personil, yaitu Black (Guitar dan Sequencer) dan Nyouw (Midipad dan Vocal).\r\nPada pergerakan awal, kami telah menyelesaikan satu album yang berjudul “BERAWAL DARI”. Album ini direlease secara digital dan gratis, bisa didownload di akun Reverbnation serta Souncloud kami. Pada pergerakan selanjutnya CRY-ON merilis album kedua yang berjudul “ANKH”. Album “ANKH” ini menceritakan tentang semua masalah kehidupan, bukan hanya cinta tapi hidup bercerita tentang manusia dan penciptanya, manusia dengan sesamanya dan manusia dengan dirinya sendiri. “ANKH” adalah simbol dari mesir kuno yang berbentuk kunci, artinya setiap kehidupan kita sebenanya hanya menyelesaikan masalah dan itu adalah tugas kita untuk hidup. Pada album kedua ini, kami mendistribusikan tidak hanya berupa album digital, tetapi diproduksi dalam bentuk fisik.\r\n\r\nPendistribusian untuk album kedua dikemas dalam bentuk boxset yang terdiri dari CD dan juga merchandise. Dalam pendistribusian album kedua ini, kami merambah pasar indie kebeberapa kota tidak hanya di Jawa Timur saja melainkan ke Jawa tengah dan Bali. Pengalaman kami selama lima tahun terakhir ini telah memberikan banyak pengalaman yaitu ,\r\n1. The Best Peform Parade Band Indie di Radar Jember dan Kolektif Indie Group Jember (FINGER) tahun 2012;\r\n2. The Best Perform Festival Cipta Lagu hari AIDS sedunia se-Nasional yang diadakan oleh Universitas Negeri Jember lagu yang berjudul “BERJALAN” tahun 2013;\r\n3. Road To Soundrenaline di Surabaya pada tahun 2014;\r\n4. Jember Indie Cloth pada tahun 2015 - 2016 ;\r\n5. Jember Fashion Carnival Music Exibition di Alun-Alun Jember pada tahun 2015-2016;\r\n6. Launching 2nd Album Cry-On “ANKH” pada tahun 2016;\r\n7.Jakcloth goes to Jember 2017\r\n8. Dan event gigs lainnya menjadi Guest Star dibeberapa tempat di Kota','Alternative Rock','facebook;instagram;teman;lainnya;','Surabaya',817,'2017-08-28 10:20:18','2017-08-28 10:20:18'),(432,'A R P','1503963643.jpg','ARP is an Indonesian Rock Band originated from Jakarta City. The group consists of Ardika as lead vocal & guitarist, Ivan as rapper and Naufal as drummer. The band formed by Ardika in 2012 named ARP Project. ARP project had a unique concept. It was only had one personnel as songwriter and guitarist. Those positions were filled by Ardika himself and the other positions were filled by additional players. Their first single released on August 2012 titled \"Hilang\" and air-played in Radio Republik Indonesia (RRI) by RRI\'s radio broadcaster - Fajar Pramana Putra. The song was reaching number one in RRI Indie Chart for 5 months. Before Ardika formed ARP Project, he was the guitarist of 3 bands; POLYCHROMATIC was his first band on High School, the single was air-played on Sunset Island Music Online Radio on the USA and the other band is NEON. But the bands was taking their break because of personnel’s other business. On 2017, Ardika met Ivan and Naufal. They committed to make a new project leaded by Ardika also and the already released their first single named “Ran”','Rock','teman;','Jakarta',269,'2017-08-28 15:40:43','2017-08-28 15:40:43'),(433,'The EDISI','1503971742.jpg','Beranggotakan 4 personil band yg terdiri dari elfrin (vocal), imam (gitar),  deni (bass) & syiam (drum)','Alternative Rock','instagram;guitar_plus;lainnya;','Jakarta',768,'2017-08-28 17:55:42','2017-08-28 17:55:42'),(434,'Rasi band','1503981279.jpg','Rasi band terbentuk pada tahun 2010, berawal dari teman sekampung dan kuliah di kota yg sama. Perestasi yg pernah di raih itu banyak tidak dapat kita ceritain satu per satu.','Pop','teman;','Jakarta',791,'2017-08-28 20:34:39','2017-08-28 20:34:39'),(435,'Dupsivision','1503990060.jpg','-Juara 3 dan Best Bassist Lomba Band \"ESCALADES REVINESIA\" 2014 SMAK 5 BPK Penabur\r\n-Juara 3 dan Best Bassist, Lomba Band \"JUKEBOX 2014\" SMAK 1 BPK Penabur\r\n-Juara 2 Sound of School Band Competition \"REGENERATION\" Hai! Day 2014 (Kalo nggak salah ada yg dapet best disini)\r\n-1st Winner, Best Bassist, Best Drummer, Best Keyboardist at Band Competition \"VIBE 2014\" SPH Sentul City\r\n-Juara 2 Band Competition Provoke! Day 2014 at Gandaria City\r\n-Juara 1 Sound of School Band Competition Hai! Day 2015\r\n-Juara 2, Best Bassist, Best Guitarist, Best Drummer, Best Keyboardist Lomba Band \"TWENTY 2015\" SMAK 1 BPK Penabur','Jazz','guitar_plus;poster;','Jakarta',783,'2017-08-28 23:01:00','2017-08-28 23:01:00'),(436,'Arya novanda Band','1503990758.jpg','featuring bersama kelompok penerbang roket di padang, surabaya (2016) dan\r\njakarta pada awal 2017 (arya sebagai additional menggantikan rey gitaris\r\nKPR yang berhalangan pada saat itu),\r\n\r\n Rising blues group Jazz n Blues Club 2016,\r\n\r\nArya Gitaris blues termuda yang dikatakan memiliki soul ter langka no.3 di\r\nIndonesia oleh legenda blues Rama Satria Claproth\r\n\r\nArya Novanda diakui memiliki skill sangat bagus dan masa depan cerah oleh\r\nmusisi blues idolanya Gugun dari Gugun Blues Shelter yang telah melewati\r\nmasa lalu seperti yang Arya alami sekarang..(perjuangan)','Blues','poster;','Jakarta',836,'2017-08-28 23:12:38','2017-08-28 23:12:38'),(437,'Every Brains','1503994470.jpg','Every Brains adalah band Rock asal Jakarta yang terbentuk sejak 2009. Nama Every Brains sendiri berarti \"Setiap Otak\" kami pilih sebagai nama band ini, karena setiap karya yang diciptakan berasal dari pemikiran masing - masing dari personil. Dan kami memiliki misi untuk membangkitkan kembali musik rock di Indonesia.\r\nUntuk prestassi sendiri sudah banyak acara yang kami isi untuk menghibur pecinta musik di Jakarta.','Rock','instagram;','Jakarta',835,'2017-08-29 00:14:30','2017-08-29 00:14:30'),(438,'Miracle Rasta','1503996462.jpg','Pernah mendapat juara 3 di event A Mild Live Wanted 2011, pernah mendapat penghargaan teather sapu lidi (kampus BSI)','Others','facebook;instagram;','Jakarta',774,'2017-08-29 00:47:42','2017-08-29 00:47:42'),(439,'Scenario','1503999444.jpg','20 april 2016 dari sudut utara kota yogyakarta tersebutlah satu nama \"SCENARIO\". buah pikiran dari Aji (vocal),Aik (gitar),Fx.Septian (bass),Aditya (Drum) untuk membangun suatu wadah menularkan berbagai macam pikiran. menumpahkan berbagai macam keresahan  kemudian dirangkai menjadi satu tujuan kedalam musik. merangkai setiap kejadian yang terjadi di kehidupan lalu disusun dalam rangkaian cerita yang diinginkan dan dibutuhkan semua pendengar adalah alasan dibalik nama scenario. dalam setiap karyanya scenario mencoba melihat sesuatu dari sudut pandang yang berbeda dari kebanyakan orang. lirik yang ditulis bersifat puitis dengan diksi-diksi yang unik. tema lagu yang dibawakan bercerita tentang kemanusiaan,isu lingkungan dan cinta. dengan sentuhan sound yang syahdu mencoba membawa pendengar berkhayal menuju imajinasinya.\r\nPrestasi\r\n1.Opening act ADERA (accountingphoria Univ.Sanata Dharma)\r\n2.Finalis boshe vvip club band competition with Rocket Rockers\r\n3.Live recording Jogja Audio School\r\n4.Torabika Goes to campus Univ. Muhammadiyah Yogyakarta\r\n5.Pensi SMA N 2 Kebumen\r\n6.Pensi SMK Yapek Gombong\r\n7.Pensi SMK N 1 Kebumen\r\n8.FKY (festival kesenian yogyakarta)','Pop','poster;','Yogyakarta',814,'2017-08-29 01:37:24','2017-08-29 01:37:24'),(440,'SONIC BAND','1503999826.jpg','UI-ADM Cup Festival Band, 1st position\r\nUI-FKM SPARE8 Cup Festival Band, first position\r\nFestival Band Bekasi Margahayu Sejabodetabek. 60 participants, 4th position\r\nBifest (Binus Festival), 2nd position\r\nHANI (Hari Anti Narkoba seIndonesia) 2013, as Guest star\r\nVOTE @UI Fisip 2013, As Guest Star\r\nFakultas Ilmu Pengetahuan Budaya UI Festival, As Guest Star 2014\r\nMusic Corner @UNJ Fak.Seni Musik, Ass Guest Star\r\nMusic Corner @UNJ Fak.Seni Musik, Ass Guest Star\r\nMusic Corner @UNJ Fak.Seni Musik, Ass Guest Star\r\nMusic Corner @UNJ Fak.Seni Musik, Ass Guest Star\r\nCylophonic LabSchool@Gedung Perfilman Usmar Ismail 2015, Ass Guest Star\r\nPRJ Panggung Budaya 2017, Ass Guest Star\r\nMusic Corner @UNJ, Fak. Seni Musik, Ass Guest Star','Jazz','instagram;teman;','Jakarta',844,'2017-08-29 01:43:46','2017-08-29 01:43:46'),(441,'Lini Masa Trio','1504001002.jpg','Band asal Medan ini terbentuk atas dasar keinginan untuk berekspresi lebih liar dalam berkarya. Ide awal terbentuknya berasal dari Elmo dan Rio yang merasa jenuh memainkan musik pop yang dirasa sangat jauh dari jiwa mereka. Mereka sepakat membentuk sebuah band yang memainkan musik rock yang disusupi unsur blues dan soul. Seiring waktu berjalan, pergantian personel pun terjadi di posisi drum. Perbedaan visi dan karakter menjadi beberapa penyebab hengkangnya pemain drum. Setelah proses pencarian yang panjang, mereka akhirnya mengajak Anggi untuk bergabung  mengisi pilar kosong di band ini. Sejauh ini mereka sudah menghasilkan dua single yaitu \"Beauty\" dan \"Orang pinggiran\". \"Beauty\" bercerita tentang bagaimana usaha manusia untuk mencapai impian nya dan single yang kedua \"Orang Pinggiran\" bercerita tentang masyarakat pinggiran kota yang selalu menjadi korban umbar janji para elit politik. Gigs indie, kolektif, dan beberapa event besar sudah dijajal band ini. Prestasi yang dirasa sangat berkesan  oleh mereka adalah menjadi opening act  band Indie asal Perancis \"kokomo\" ketika tour di kota Medan. \r\n\r\nKeinginan kami mengikuti Levi\'s Band Hunt untuk menunjukkan bahwa musisi Tanah Sumatera khususnya kota Medan memiliki taji yang tak kalah dari musisi kota yang lain. Terima Kasih, Assalamualikum, Syalom, Om Swatyastu','Rock','facebook;instagram;','Medan',839,'2017-08-29 02:03:22','2017-08-29 02:03:22'),(442,'KROVOSH','1504001051.jpeg','Pernah main di beberapa event diantaranya; road to doomsday, road to rockin battle, super rawk, soundsations, dan beberapa event2 lainnya','Rock','guitar_plus;teman;lainnya;','Jakarta',843,'2017-08-29 02:04:11','2017-08-29 02:04:11'),(443,'MASAKECIL','1504001569.jpg','Band indie punk rock jakarta utara,  yg terbentuk pada tahun 2013 dari berbagai idealisme yg berbeda namun mempunyai satu tujuan yg sama dlm memajukan dunia musik indie di indonesia .','Rock','guitar_plus;','Jakarta',833,'2017-08-29 02:12:49','2017-08-29 02:12:49'),(444,'BIMA and THE COWBOYS','1504002408.jpg','The blues is the roots, everything else is the fruits ~\r\nwe love blues, we play blues, from Bandar Lampung with blues..','Blues','teman;','Jakarta',842,'2017-08-29 02:26:48','2017-08-29 02:26:48'),(445,'BROKEN TRASH','1504002652.jpg','Baru merilis Ep Album Perdana bertajuk \'Badshit\' awal Mei 2017 dalam bentuk kaset yang di Produksi oleh Straineyes Records (Malaysia).','Others','teman;','Jakarta',845,'2017-08-29 02:30:52','2017-08-29 02:30:52'),(446,'Second Heartbeat','1504007064.jpg','1. Tampil di acara penggalangan dana untuk gempa bumi pijie jaya , aceh.\r\n2. Di undang di acara pensi SMPN 61\r\n3. Juara 3 lomba Band di SMAN 24 (Exart)\r\n4. Juara 2 lomba Band di SMPN 111','Pop','guitar_plus;','Jakarta',847,'2017-08-29 03:44:24','2017-08-29 03:44:24'),(447,'IONS','1504008218.jpg','Ions berasal dari Institusi di Jakarta ( IKJ ) yang bermulai dengan kata bismillah.','Rock','instagram;','Jakarta',848,'2017-08-29 04:03:38','2017-08-29 04:03:38'),(448,'NFS band','1504009877.jpeg','NFS adalah band asal kota bogor, NFS sudah sering menjuarai festival acara musik dengan format musik yang khas dari suara sang vocalis.','Pop','umi;','Jakarta',849,'2017-08-29 04:31:17','2017-08-29 04:31:17'),(449,'The Connect','1504010058.JPG','The Connect berawal dari pertemanan pada masa sekolah (SMA). Sebelumnya band ini dibentuk untuk mengikuti festival musik band antar sekolah. Seiring berjalannya waktu, The Connect mengalami bongkar pasang personil. Sampai pada akhirnya personil tetap beranggotakan 4 orang, yakni: Pandhika (Vocal), Mico (Guitar), Ade (Drum) dan Endy (Bass). Dengan mengusung genre Alternatif Rock, The Connect berharap bisa memberikan warna yang berbeda di blantika musik Indonesia dan terus memberikan karya terbaik kami untuk semua pecinta musik Indonesia.\r\n\r\nExperience:\r\n- Juara 1, Kosgoro EXPO (2005)\r\n- Best Performance, Class Mild Festival (2005)\r\n- Yamaha Event (2011)\r\n- Plaza Cibubur Event (2011)\r\n- Jiexpo PRJ, Booth Kopi Pak Belalang (2017)\r\n- Full Respect Movement, Jakarta Garden City (2017)\r\n- Pekan Raya Kabupaten Bekasi 2017\r\n- IndiePendence, Jungle Land (Soon at 2 Sept 2017)','Alternative Rock','instagram;guitar_plus;lainnya;','Jakarta',571,'2017-08-29 04:34:18','2017-08-29 04:34:18'),(450,'radakbanu','1504015713.jpg','kami band yang mengusung genre baru termasuk di dalamnya mengalir ciri khas musik tradisi, bercampur rock dan sajak. pernah tampil di acara - acara seperti sunyata night, konser cinta musik indonesia di senayan, geriliya ekspresi di mondo by the rooftop,dll','Others','teman;','Jakarta',853,'2017-08-29 06:08:33','2017-08-29 06:08:33'),(451,'Best Day Ever','1504017102.jpg','Band : BEST DAY EVER\r\nlokasi : Medan\r\nGenre : Pop Punk Alternative\r\nBerdiri : 7 juli 2011\r\nAlbum : Revolutioner di tahun 2015\r\nPersonil : Budi Ari Yandi ( Gitaris )\r\n                 Mhd Rivan ( Drummer )\r\n                 Heri Setiawan ( Bassis )\r\n\r\nLive perfom : Gigs Medan , Event\" and radio show','Alternative Rock','facebook;instagram;umi;','Medan',855,'2017-08-29 06:31:42','2017-08-29 06:31:42'),(452,'Vistakita','1504017389.jpg','Cerita ;\r\nVistakita didirikan tanggal 12 Desember 2012 oleh beberapa pecahan personil band lokal Kota Payakumbuh yang sebelumnya dari band yang berbeda.\r\nPrestasi ;\r\n1. Juara 1 A Zone Sumatera Barat ( 2016 )\r\n\r\n2. Juara III Festival Indie Pop Progress Payakumbuh ( 2013 )\r\n\r\n3. Juara III Festival Guguak Indie Performance (2013 \r\n\r\n4. Juara III Festival Acoustic Politani Unand ( 2013 )\r\n\r\n5. Juara Favourite Festival G-Stern Part II ( 2013 )\r\n\r\n6. Guest Stars at Jumpa Musisi tiga Dekade ( 2013 )\r\n\r\n7. Guest Stars at SMA N 1 Kec. Lintau ( 2014 )\r\n\r\n8. Guest Stars at SMA N 1 Kec. Payakumbuh (2014 )\r\n\r\n9. Guest Stars at SMA N 1 Kec. Guguak ( 2014 )\r\n\r\n10. Guest Stars at SMP N 1 Kec. Guguak ( 2014 )\r\n\r\n11. Finalis Indie On Radio On Air Lagu Ciptaan Se-Sumatera Barat ( 2014 )\r\n\r\n12. Juara III Festival Acoustic KSN - GLK ( 2014 )','Alternative Rock','teman;lainnya;','Jakarta',537,'2017-08-29 06:36:29','2017-08-29 06:36:29'),(453,'huhu dan popo','1504019860.JPG','huhu dan popo adalah nama kucing peliharan milik dayat. kami pernah membuat sebuah gig kecil dimana yang hadir harus membayar dengan menggunakan puisi. kami menyebutnya \"nonton musik bayar dengan puisi\". gagasannya adalah dimana karya tidak selalu harus dibayar dengan uang.','Folk','facebook;','Jakarta',771,'2017-08-29 07:17:40','2017-08-29 07:17:40'),(454,'Werewolf','1504021994.jpg','di tahun 2012 band WEREWOLF terbentuk dengan mengusung genre THRASH METAL yang berasal dari Kota Bandung .\r\ndan Telah merilis 1 E.P Album yang bertajuk \"In Thrash We Trust\" dengan 5 Songlist di E.P Album , dan telah merilis juga beberapa videoclip yang berjudul Judge,Welcome To The Jungle (GNR Cover), dan Moon Of Death sekaligus menjadi Single Di tahun 2017 .','Heavy Metal','poster;teman;lainnya;','Jakarta',858,'2017-08-29 07:53:14','2017-08-29 07:53:14'),(455,'JUSTKIDDING','1504024375.JPG','JUST KIDDING lahir pada tahun 1999 berawal dari tongkrongan di gang rumah dan teman sekolah. \r\nPrestasi dari tingkat kabupaten hingga provinsi sudah diikuti dan alhamdulilah 3 besar yang kita raih sampai best vocal. Namun, Kami lebih bangga bahwa saat ini masih bertahan untuk berkarya.','Others','instagram;guitar_plus;teman;','Surabaya',857,'2017-08-29 08:32:55','2017-08-29 08:32:55'),(456,'ELKA','1504025967.jpg','ELKA terbentuk tgl 22 juli 2014 di lampung, tepatnya di bandar lampung, Nama ELKA sendiri kami pilih karena mudah diucapkan dan mudah diingat.\r\nDemikian prestasi ELKA hingga saat ini.\r\n-Opening LYLA BAND diLAMPUNG TENGAH\r\n-Opening CITA CITATA PANGGUNG BINTANG TOJOE diLAMPUNG TENGAH\r\n-Opening GEISHA diLAMPUNG UTARA\r\n-Opening NIDJI diPRINGSEWU\r\n-Opening D\'MASIVE KOTA METRO\r\n-Opening D\'VIRGIN PRINGSEWU\r\n-GG MILD TOUR PRINGSEWU\r\n-GG MILD TOUR TALANG PADANG\r\n-GG MILD TOUR PKOR BANDAR LAMPUNG\r\n-GG MILD TOUR KOTA METRO\r\n-GG (PRO JAM) LAMPUNG BARAT\r\n-AZONE SAMPOERNA MILD LAMPUNG TENGAH\r\n-AZONE SAMPOERNA MILD KOTA METRO\r\n-AZONE SAMPOERNA MILD BANDAR LAMPUNG\r\n-AZONE SAMPOERNA MILD LAMPUNG UTARA','Pop','facebook;instagram;guitar_plus;','Jakarta',840,'2017-08-29 08:59:27','2017-08-29 08:59:27'),(457,'nea metra band','1504029757.jpg','Tiada cerita yang paling indah selain cerita kita dapat dipertemukan dalam sebuah keluarga besar nea metra, dan tiada prestasi yang paling berkesan selain kita masih berdiri saling bergandengan tangan bersama di nea metra.','Others','lainnya;','Jakarta',841,'2017-08-29 10:02:37','2017-08-29 10:02:37'),(458,'Paint in Black','1504031230.JPG','Paint In Black, band yang terbentuk sejak tahun 2008 ini mengusung genre Nu Heavy Metal,  beranggotakan Rio (vocal), Dedi (bass), Pebi (Guitar), Amar (Lead Guitar), dan Wawunk (Drummer). Formasi inilah yang mengantar Paint In Black menjadi salah satu band yang cukup diperhitungkan dikancah skena musik Lampung.\r\nPrestasi dan Penghargaan: \r\n-Penghargaan dari semua senior Metalhead Lampung\r\n-Asquad Pemenang Goaheadpeoplechalange 2017\r\n-Penghargaan Dari Ngehits Tribalpride 2017, Sebagai Band Metal Lampung Terbaik 2017\r\n-Satu panggung Bersama Burgerkill,Seringai,Beside,Siksakubur','Heavy Metal','guitar_plus;','Jakarta',727,'2017-08-29 10:27:10','2017-08-29 10:27:10'),(459,'CLASSMATE','1504033755.JPG','CLASSMATE berasal dari kota Subang (Jawa-Barat) yang beranggotakan 6 personil diantaranya Alfian(Vokal),Ari(Bass),Donny(Gitar),Yusuf(Gitar),Debi(Drum) & Asep(Keyboard/Synthesizer). Kami terbentuk pada tanggal 1 April 2013 dan sudah mengeluarkan beberapa single serta EP Album. Classmate bergenre Alternative Rock. Dan Kami pun sudah pernah menggelarkan Indie Tour dibeberapa kota di Jawa-Barat diantaranya (Subang,Bandung,Bogor,Jakarta,Bekasi & Karawang). Prestasi yang sudah kami capai diantaranya : 40 besar semifinal Rockinbattle (Supermusic id regional Bandung) , Semifinal Sound of tri (regional Bandung) , Juara 1 The best Band performance di kampus STKIP subang , Juara 1 The best band performance di kampus UNSUB subang & Juara 2 The best band Performance di Laskar indonesia. Kami pun sering diundang diberbagai acara diantaranya acara kampus dan beberapa acara Sponsor Rokok untuk menjadi band Local pembuka guest star.. Kampus yang kami pernah singgahi yaitu (UNPAD,UPI,UNJANI,UNPAS,UNJ & IPB). Semoga harapan kami mengikuti kompetisi yang diselenggarakan oleh pihak PT Levi\'s bertajuk Levi\'s Band Hunt ini dapat menjadi jembatan menuju impian kami dalam berkarir dimusik yaitu ingin menjadi pencetus Band dari INDONESIA yang lagunya bisa terkenal di dalam negeri maupun luar negeri serta bisa kontrak kerja sama dengan pihak Label Universal Music Indonesia demi mewujudkan mimpi mimpi kami bisa membawa nama INDONESIA ke manca negara tentunya sangat berharap kami bisa lolos dalam tahap tahap audisi ini dan menjadi juara Levi\'s Band Hunt. Aamiin yaroball alamin','Alternative Rock','instagram;','Jakarta',865,'2017-08-29 11:09:15','2017-08-29 11:09:15'),(460,'White Raheem','1504054006.jpg','Band Jadul\r\n\r\nwww.whiteraheem.ga','Alternative Rock','facebook;teman;lainnya;','Jakarta',872,'2017-08-29 16:46:46','2017-08-29 16:46:46'),(461,'Chiprock','1504058711.jpg','Chiprock terbentuk pada tahun 2012 dan mengusung genre blues, chiprock sendiri tidak pernah mengikuti ajang festival band indie hanya saja sering menjadi guest star di acara parade band.','Blues','guitar_plus;','Surabaya',747,'2017-08-29 18:05:11','2017-08-29 18:05:11'),(462,'the khopet\'s','1504060106.jpg','awal mula dibentuk pada tahun 2010 dengan formasi awal 5 orang, dengan nama band ngejeglog band,','Pop','facebook;','Jakarta',743,'2017-08-29 18:28:26','2017-08-29 18:28:26'),(463,'White Rose','1504061823.JPG','WHITE ROSE merupakan salah satu band profesional kebanggaan Bali dengan menawarkan genre musik Pop Punk berkelas sejak 2014 dan layak mendapatkan perhatian publik. \r\n\r\nBRIEF FACTS:\r\n→ Merilis album perdana pada tahun 2015 bertajuk \'Buka Mata Mereka\' di bawah naungan Heartless Records dan sukses melaksanakan tur swadaya ke-10 kota di Jawa Timur dan Jawa Tengah.\r\n→ Tidak hanya di kandang sendiri, White Rose kerap diundang dari event pensi hingga sponsor raksasa di luar Bali seperti Soundsation, Road To Soundrenaline, Jakcloth, ProJam, Showcase ICC. \r\n→ Kota-kota yang pernah disinggahi White Rose untuk perform antara lain: Jakarta, Semarang, Jogja, Malang, Surabaya, Purwokerto, dan masih banyak kota-kota di Jawa dan Bali yang telah mereka kunjungi. \r\n→ Memiliki basis massa yang sedang berkembang bernama WHITE ROSE FAMILY (WRF), dan WRF tersebar di beberapa kota di Indonesia, meski belum sebesar basis massa SID, namun basis massa WRF cukup loyal dan menunjukkan progress untuk bertambah lebih banyak lagi. \r\n→ Juara 2 Hard Rock Rising 2017 Regional Bali. Prestasi yang cukup memukau untuk seukuran band Pop Punk yang notabene bukan termasuk genre yang cukup populer baik di kalangan Underground ataupun mainstream. \r\n→ White Rose juga termasuk band yang cukup  \'advanced\' dan selalu menjadi penggagas ide-ide baru modern sehingga cara promosinya banyak ditiru menjadi referensi dan inspirasi band-band indie yang ada di Bali. \r\n→ Band internasional seperti Fall Out Boy dan All Time Low bisa dibilang menjadi band terdekat yang bisa dikaitkan dengan tampilan White Rose secara keseluruhan meski masing-masing personil memiliki taste dan inspirasi musik yang berbeda-beda.','Alternative Rock','guitar_plus;','Surabaya',876,'2017-08-29 18:57:03','2017-08-29 18:57:03'),(464,'sevenine','1504066937.jpg','sevenine band poppunk asal medan yang sudah beberapa kali berganti personilnamun yang masih menetap hingga kini adala seorang bassis nya saja','Others','guitar_plus;','Medan',885,'2017-08-29 20:22:17','2017-08-29 20:22:17'),(465,'Tomodachi','1504070076.jpg','Tomodachi band dibentuk dari tahun 2007 dan Alhamdulillah sampai saat ini masih solid personil nya, hanya pernah berganti peraonil pada drum saja,dan pernah menjuarai berbagai festival band serta sudah mempunyai album Lagu sendiri tetapi blum pada tahap promosi','Alternative Rock','guitar_plus;','Jakarta',387,'2017-08-29 21:14:36','2017-08-29 21:14:36'),(466,'Tomodachi','1504070180.jpg','Tomodachi band dibentuk dari tahun 2007 dan Alhamdulillah sampai saat ini masih solid personil nya, hanya pernah berganti peraonil pada drum saja,dan pernah menjuarai berbagai festival band serta sudah mempunyai album Lagu sendiri tetapi blum pada tahap promosi','Alternative Rock','facebook;guitar_plus;','Jakarta',387,'2017-08-29 21:16:20','2017-08-29 21:16:20'),(467,'Tomodachi','1504070184.jpg','Tomodachi band dibentuk dari tahun 2007 dan Alhamdulillah sampai saat ini masih solid personil nya, hanya pernah berganti peraonil pada drum saja,dan pernah menjuarai berbagai festival band serta sudah mempunyai album Lagu sendiri tetapi blum pada tahap promosi','Alternative Rock','facebook;guitar_plus;','Jakarta',387,'2017-08-29 21:16:24','2017-08-29 21:16:24'),(468,'KEISHA BAND','1504070779.jpg','Juara 3 islamic band sidoarjo,  vokalis juara 2 singing contest happy laraku','Pop','teman;','Surabaya',890,'2017-08-29 21:26:19','2017-08-29 21:26:19'),(469,'Jangar','1504070880.jpg','Award :\r\nBreakthrough Artist of The Year\r\nPICA Magazine Editor Choice Award 2016\r\n\r\nReceive 3 Stars Review for \"Self Titled EP\"\r\nby Rolling Stone Indonesia Magazine\r\nEdisi 137 - September 2016 \r\n\r\nBiography:\r\nJangar is a hard rock band from Bali which has received national attention by releasing their EP album online and numerous tour to Java island. Since its debut performance in mid 2015, Jangar have gained a lot appretiation through its critics of Indonesian social situation and its powerful stage performance.\r\n\r\nThe name Jangar was taken from Sundanese word means \"Headache\". Jangar is an uncontrollable pain inside the head which could bring the sufferer trough an anger state.\r\n\r\nJangar\'s music is influenced by alternative 90\'s to 2000\'s rock, through bands such as Clutch, The Sword, Red Fang and Kyuss.\r\n\r\nJangar\'s music has a hard rock undertone, but is combined with many other genres of sound, such as stoner rock, blues, heavy metal, and doom metal.\r\n\r\nJangar has released 1 EP album and 1 split album along side with Piston from Jakarta and Terapi Urine from Bandung. Jangar also collaborate in various music compilation.\r\n\r\nJangar \"Self Titled EP\" can be found in various digital music platform such as Spotify, Apple Music, Dezeer, etc.','Rock','instagram;','Jakarta',880,'2017-08-29 21:28:00','2017-08-29 21:28:00'),(470,'Arberi Band','1504071085.jpg','Arberic Band , adalah band ber-genre Pop Melayu asal SUMEDANG JAWAB BARAT-Indonesia. Yang terbentuk 03 Juli 2014, Dari kata ARBERIC yaitu \"AyoBERmusIC\" . Yang dinaungi 3 personil Diantarnya Reval(Vokalis) , Sultan(Gitaris) Dan Dadan(Drummer). dan mengeluarkan Single Perdana yang berjudulLUKISAN LUKA','Others','facebook;instagram;teman;','Jakarta',891,'2017-08-29 21:31:25','2017-08-29 21:31:25'),(471,'Samsara','1504074363.jpg','This music might be characterized most easily by what it isn\'t. It\'s rarely simple enough in structure and instrumentation to be called rock (and certainly retains enough of a sense of humor to be disqualified as art rock). It\'s not serious or straightforward enough to be called jazz. It\'s often too esoteric or extreme to be called pop. It\'s in some middle ground between all of these, which means it\'s populated with the outcasts from other well-established genres. As a result, Space Age Pop is full of brilliant, bizarre, and exciting sounds, which are particularly striking to ears accustomed to the stereotypes that populate the more familiar genres.\r\n\r\n\r\nHailing from the southern corner of Jakarta which famous for its hustle and bustle, Consisting of 5 childhood mates who used to gathering around in a small dusty padded room. When a small chatter over the phone turned to be a seemingly enthusiastic call. In the 2015\'s the band\'s project was formed under the name Samsara that fronted by Rerez (synthesizer, keyboards, vocals), Ardana (guitar), Arya (guitar, vocals), Reygi (bass) and Widan (drums). Meaning of Samsara itself in Buddhism is the beginning-less cycle of repeated birth, mundane existence and dying again.','Alternative Rock','facebook;instagram;','Jakarta',797,'2017-08-29 22:26:03','2017-08-29 22:26:03'),(472,'Valgus Band','1504076539.JPG','- JUARA 2 BAND IN BANDUNG -\r\nValgus sendiri diambil dari bahasa Estonia yang artinya Cahaya...Banyak nama-nama yang kita pakai untuk nama band ini, dan akhirnya kita terfokus untuk memakai nama Valgus.\r\nValgus Band adalah sebuah group band yang terbentuk di Bandung pada tanggal 11 Februari 2012, yang  beranggotakan Cikal ( Vocal ), Dapenk ( Gitar ), Yogie ( Bass ), Joe ( Drum ) - Nukuz ( Drum ), Ariess ( Keyboard ).Dikarenakan Joe Drumer sebelumnya pindah domisili ke Yogyakarta maka posisi drumer di gantikan oleh Nukuz dan ada penambahan personil Ariess di Keyboard.','Alternative Rock','facebook;instagram;guitar_plus;teman;','Jakarta',824,'2017-08-29 23:02:19','2017-08-29 23:02:19'),(473,'Chiprock','1504077561.jpg','Chiprock terbentuk pada tahun 2012 dan mengusung genre Blues. Chiprock sendiri belum pernah sama sekali mengikuti ajang Festival band indie dan hanya sering mengikuti acara parade band umum.','Blues','guitar_plus;','Surabaya',895,'2017-08-29 23:19:21','2017-08-29 23:19:21'),(474,'amoury','1504078399.jpg','Baru Berjuang','Electro','facebook;instagram;guitar_plus;','Jakarta',825,'2017-08-29 23:33:19','2017-08-29 23:33:19'),(475,'TrenchHorror','1504078630.jpg','Kami pernah diundang diluar kota untuk beberapa event seperti.\r\nPurwokerto grind Fest. Bogor Grind Fest. Jakarta Grind Fest. Dan banyak acara lainnya.','Others','guitar_plus;teman;','Jakarta',897,'2017-08-29 23:37:10','2017-08-29 23:37:10'),(476,'Memories of camelia','1504078896.jpg','Memories Of Camelia Terbentuk pada tanggal 13 bulan November tahun 2014 (13-11-14) \r\nBand Kami Ber Genre POP PUNK.... \r\nDan Posisi Personil Kami Ada 3 orang,yaitu Ryan fak (vocal guitar), DickySP (vocal bass),riky santoso (Drum)\r\nIngin memajukan musik-musik ber genre POP PUNK di Kota subang','Others','teman;','Jakarta',671,'2017-08-29 23:41:36','2017-08-29 23:41:36'),(477,'Jionara','1504081341.jpg','Pada tanggal 7 bulan 10, tepat pada tahun 2014 lima pria dipertemukan. Terdiri dari Alan(vocal), Eggy(gitar), Rizal(gitar) Aby(bass) dan Dimas(drum). Seiring dengan tanggal tersebut disebutlah JIONARA. Penggabungan semiotika lambang 7 dan 10 serta penyertaan nama “Nara”. Membuat mereka selalu mengingat angka sejarah yang akan membuat mereka menjadi besar, Nara yang bersifat selalu setia dan bersahabat membuat mereka terikat dengan sifat tersebut.\r\n\r\nAkhir tahun 2014 lalu Jionara band asal bandung yang terdiri dari 5 orang pria ini menghadiahi tahun baru dengan meluncurkan single yang berjudul “Kelakuan Hujan”. \r\nDan pada pertengahan tahun 2015, kami juga meluncurkan single kedua yang berjudul \"Pelepasan Adalah Pertahanan Terbaik\".','Pop','guitar_plus;','Jakarta',870,'2017-08-30 00:22:21','2017-08-30 00:22:21'),(478,'BRIGEZTREGGAE','1504084547.jpg','Brigeztreggae dibentuk di Ciputat pada tanggal 28 Oktober 2016. Yang mengusung aliran Reggae, dengan sentuhan Pop, Rock.\r\n\r\n* Finalis Sound Of Tri (perwakilan Banten)\r\n* Guest Star at Anniversary Kelurahan Mekar Jaya, Tangsel\r\n* Peserta Competition at Starlight, Jakarta Timur\r\n* Guest Star Pensi SMK Puspita Bangsa, Tangsel\r\n* Guest Star at HERO Terogong New Year Party, Jakarta Selatan\r\n* Guest Star at Pilar Ciputat Sumpah Pemuda, Tangsel','Others','instagram;guitar_plus;','Jakarta',901,'2017-08-30 01:15:47','2017-08-30 01:15:47'),(479,'MY STEREO ILL','1504085216.JPG','Band asal selatan jakarta yang terbentuk pada 12-12-2012.Juara pertama regional bandung dan juga sekaligus juara utama/nasional dalam FESTIVAL SUARA ANTIKORUPSI 2016 yang diselenggarakan oleh KPK RI,menjadi band pembuka konser SLANK di JAKARTA FAIR 2017','Alternative Rock','facebook;instagram;','Jakarta',898,'2017-08-30 01:26:56','2017-08-30 01:26:56'),(480,'story burn to ashes','1504085745.jpg','2004 terlahir karena perpecahan beberapa band dari masing2 personil yang diprakarsai oleh ipoet (vocal) dan mance (guitar) yang bermaksud membuat sebuah band dan akhirnya menemukan jimmy (bass) dan isal (drum). terbentuklah band yang bernama story burn to ashes yang menjadi simbol dari mereka sampai saat ini. nama yang berasal dari lirik lagu alone at last (bdg) dengan judul remembering never telah mereka usung selama 2 tahun lebih sampai masuknya kill atau tirta story burn (guitar) dan keluarnya isal sang penggebuk drum yang di gantikan oleh ichan aka kucluk racy yang akhirnya kami membawakan lagu2 yang bernuansa death metal dan metalcore dengan influence (walls of jericho, lamb of god, black dahlia murder, dan suicide silence etc) we are... ipoet story burn as vocal Chakill aka tirta story burn as guitar jimmy story burn as bass mance aka rahman savanty as guitar ichan aka kucluk racy as drum seiring berjalanya waktu trjadi perpecahan ichan dan mance kluar dan kini SBTA hanya tinggal menyisakan Iput,Cakil & Jimmy,namun itu tidak menjadikan kami berhenti untuk berkarya dan terus bergentayangan di Gigs tanah air.. SBTA telah menelurkan beberapa karya di antaranya: 1. takkan ku dengar lagi 2. lost (available @ sound of calours compilation; home made record) 3. stuck 4. love is suicide (available @ liburan di bulan compilation;mata angin production) 5. about the pain and die 6. takkan diam (available @ couplelicious compilation; copuplelicious production) 7. mati rasa sampai saat ini, sampai saatnya nanti STORY BURN TO ASHES takkan diam ku teriak teriak ku takkan diam !!!','Heavy Metal','instagram;','Jakarta',904,'2017-08-30 01:35:45','2017-08-30 01:35:45'),(481,'QIA BAND','1504086389.jpg','Band kami terbentuk awal januari 2017, personil band kami hanya 3 saja dari yang sebelumnya 5 personil mungkin sudah pada sibuk kerjaan dan kegiatan masing\" ,,hehehe\r\nuntuk prestasi kami pernah mengikuti ajang festival musik sprite d plong lolos sampai finalis 5 besar dari 40 peserta band n 1 panggung dengan band ternama pernah juga mengikuti ajang festival di UIN tangsel menang juara 1 dari 5 peserta ,, untuk kegiatan kami setiap malem minggu kita ngisi acara band di salah satu kedai di tangerang selatan belum lama sempat kita promo lagu di salah satu stasiun TV ,,\r\nTerimakasih :-) Salam QIA','Pop','facebook;guitar_plus;lainnya;','Jakarta',838,'2017-08-30 01:46:29','2017-08-30 01:46:29'),(482,'arband','1504087352.jpg','Metal ke Melayu biar terkenal..','Pop','instagram;guitar_plus;','Jakarta',662,'2017-08-30 02:02:32','2017-08-30 02:02:32'),(483,'WANWE','1504089628.jpg','WANWE adalah grup musik Indonesia yang berdiri pada 25 Mei 2016 di Jakarta. Grup band ini  adalah sekumpulan anak-anak muda. 5 Anggota berdirinya adalah Ali (vokal), Budhi (bass), Akay (gitar), Fabry (gitar), dan Riyan (drum). WANWE juga telah mengikuti ajang musik Indie di Caffe-caffe jakarta dan Festival musik, dan memiliki 1 lagu andalan berjudul \"Samakan Langkah\"','Alternative Rock','teman;','Jakarta',566,'2017-08-30 02:40:28','2017-08-30 02:40:28'),(484,'Octave Band','1504095071.jpg','octave band belum pernah mengikuti ajang festival jenis apapun , selama ini hanya membuat demo track dan manggung secara off air di acara acara seperti djarum black , L.a light , Honda , Hut Kota Tangerang , Beer house , dan acara music lain nya.','Pop','teman;','Jakarta',714,'2017-08-30 04:11:11','2017-08-30 04:11:11'),(485,'Forthemoment','1504095083.jpg','Band ini berawal dari beberapa anak rantau di jogja yang tinggal di kos yang sama dan memiliki hobi yang sama pula yaitu bermusik. Mereka sepakat untuk membentuk sebuah band dan diberi nama FORTHEMOMENT(biasa disingkat FTM untuk mempermudah pengucapan), karena ingin selalu memberikan moment-moment berharga bagi para penikmat musik nya. Perjalanan  pun dimulai, dimulai dari ngamen- ngamen dengan hanya dibayar makan ,ngamen di nikahan, ikut festival musik , sampai akhirnya bisa ngamen reguler/event di cafe-cafe,hotel-hotel, dan tempat-tempat ternama di jogja maupun luar daerah jogja. Pasang surut gonta ganti personil sempat dirasakan band ini. Karena kebutuhan lagu-lagu yang diciptakan oleh FTM, Okky, personil terakhir yang bergabung, di daulat sebagai vocal female leader setelah sebelum nya Ari(gitaris) dan Lanang (bassis) juga merangkap sebagai vocalis. Dan dengan Rinto sebagai penjaga beat alias drummer, maka FORTHEMOMENT siap memberikan karya- karya terbaiknya.','Pop','guitar_plus;','Yogyakarta',852,'2017-08-30 04:11:23','2017-08-30 04:11:23'),(486,'EKSTRAVERSI','1504101247.jpg','Ekstraversi terbentuk di tahun 2016, walaupun sebenarnya keenam personil ini sudah saling kenal sejak tahun 2015. Pada awalnya, mereka bertemu di komunitas lokal yaitu SoundCloud Malang.\r\n\r\nDi bulan Oktober, 2015, keenam personil ini mendapatkan kesempatan untuk tampil di sebuah panggung mewakili komunitasnya. Mendapatkan respon yang sangat baik dari audiens, mereka akhirnya sepakat untuk membawa band yang telah terbentuk ini ke arah yang lebih serius. Nama Ekstraversi terinspirasi dari panggung pertama, yaitu acara yang dipanitiakan oleh mahasiswa Psikologi Universitas Brawijaya. Maka dari itu, Ekstraversi diambil dari istilah psikologi.\r\n\r\nSampai sekarang Ekstraversi telah tampil di panggung-panggung di Malang dan menciptakan lagu-lagu untuk materi album mereka. \r\n\r\nMusik Ekstraversi banyak terpengaruh dari band-band seperti The Groove, RAN, Maliq & D\'Essentials, Barry Likumahuwa Project, Dll.','Pop','instagram;guitar_plus;maliq;teman;','Surabaya',912,'2017-08-30 05:54:07','2017-08-30 05:54:07'),(487,'flame heart','1504103815.jpg','terbentuknya ketika dahulu kala kami sedang berkumpul bersama ketika itu \" LUTFI, HELMY, dan UUT(old bassis) sedang berbincang bagaimana jikalau kita membentuk sebuah band.. terpikir dan terbesit bermacam aliran, dan memang jiwa kami semua berbeda, tapi bagaimana kita mengemas dalam satu komposisi yg tepat yaitu PUNKROCK..\r\nketika itu kami tersentak dengan formasi 3 anggota ini, untuk menambahkan sebuah getaran pada band ini, kami menambahkan 1 personil yaitu ROBBY pada vocal/guitar,,\r\ndidalam perjalanan band ini kami menemukan kendala dengan bertolak belakang visi,, dan akhirnya kami kembali terbentuk rampung dengan 3 anggota,, ketika itu UUT lah yg resign..\r\nkami tetap bangkit dengan formasi ROBBY,LUTFI,dan HELMY.. dalam bangkitnya itu kami menemukan sebuah personil baru untuk mengisi kekosongan dalam formasi ini,, dan dia ADIE seorang bassis yg akan mengisi formasi ini agar lengkap kembali...\r\ndan sampai sekarang alhamdulillah kami masih stay dengan formasi ini,,, walaupun disini kami semua berbeda aliran dan genre,,,\r\ntetapi visi dan misi kita terus berkobar dan terus mencapai rawk !!!!!\r\nFOR ALL FLAMES GET CMON F**KING RAWK !!!!!\r\n\r\nwe have 7 songs already released :\r\n1. Hilang\r\n2. Goodbye Penguin\r\n3. Kenangan\r\n4. Harapan Terakhir ( Padamkan Mimpi )\r\n5. Bad Feeling ( Broken Heart )\r\n6. Horny Tonight\r\n7. Buried\r\n8. Merah Putih ( Meraih Mimpi )\r\n9.  Goodbye Penguin feat Lulu ( Accoustic )','Rock','facebook;guitar_plus;','Jakarta',886,'2017-08-30 06:36:55','2017-08-30 06:36:55'),(488,'flame heart','1504103867.jpg','terbentuknya ketika dahulu kala kami sedang berkumpul bersama ketika itu \" LUTFI, HELMY, dan UUT(old bassis) sedang berbincang bagaimana jikalau kita membentuk sebuah band.. terpikir dan terbesit bermacam aliran, dan memang jiwa kami semua berbeda, tapi bagaimana kita mengemas dalam satu komposisi yg tepat yaitu PUNKROCK..\r\nketika itu kami tersentak dengan formasi 3 anggota ini, untuk menambahkan sebuah getaran pada band ini, kami menambahkan 1 personil yaitu ROBBY pada vocal/guitar,,\r\ndidalam perjalanan band ini kami menemukan kendala dengan bertolak belakang visi,, dan akhirnya kami kembali terbentuk rampung dengan 3 anggota,, ketika itu UUT lah yg resign..\r\nkami tetap bangkit dengan formasi ROBBY,LUTFI,dan HELMY.. dalam bangkitnya itu kami menemukan sebuah personil baru untuk mengisi kekosongan dalam formasi ini,, dan dia ADIE seorang bassis yg akan mengisi formasi ini agar lengkap kembali...\r\ndan sampai sekarang alhamdulillah kami masih stay dengan formasi ini,,, walaupun disini kami semua berbeda aliran dan genre,,,\r\ntetapi visi dan misi kita terus berkobar dan terus mencapai rawk !!!!!\r\nFOR ALL FLAMES GET CMON F**KING RAWK !!!!!\r\n\r\nwe have 7 songs already released :\r\n1. Hilang\r\n2. Goodbye Penguin\r\n3. Kenangan\r\n4. Harapan Terakhir ( Padamkan Mimpi )\r\n5. Bad Feeling ( Broken Heart )\r\n6. Horny Tonight\r\n7. Buried\r\n8. Merah Putih ( Meraih Mimpi )\r\n9.  Goodbye Penguin feat Lulu ( Accoustic )','Rock','facebook;guitar_plus;','Jakarta',886,'2017-08-30 06:37:47','2017-08-30 06:37:47'),(489,'Denial','1504109249.jpeg','Denial, didirikan sejak tahun 2016 di Pamulang. Pada tahun 2017 awal, Denial terpilih mewakili Indonesia di Ajang Planetrox CA (Kanada) bersama 9 Band lainnya, yang diantaranya Peeweegaskins. Saat ini Denial tengah menyelesaikan Mini Albumnya.','Heavy Metal','instagram;teman;','Jakarta',728,'2017-08-30 08:07:29','2017-08-30 08:07:29'),(490,'HILLTOP','1504109468.jpg','Pentas seni/ Lomba UNJ juara 3','Alternative Rock','facebook;instagram;informasi_toko;teman;','Jakarta',918,'2017-08-30 08:11:08','2017-08-30 08:11:08'),(491,'HILLTOP','1504109513.jpg','Pentas seni/ Lomba UNJ juara 3','Alternative Rock','facebook;instagram;informasi_toko;vipclub;guitar_plus;umi;maliq;poster;teman;lainnya;','Jakarta',918,'2017-08-30 08:11:53','2017-08-30 08:11:53'),(492,'HILLTOP','1504109726.jpg','Pentas seni/ Lomba UNJ juara 3','Alternative Rock','facebook;instagram;informasi_toko;vipclub;guitar_plus;umi;maliq;poster;teman;lainnya;','Jakarta',918,'2017-08-30 08:15:26','2017-08-30 08:15:26'),(493,'HILLTOP','1504109888.jpg','Pentas seni/ Lomba UNJ juara 3','Alternative Rock','facebook;instagram;informasi_toko;vipclub;guitar_plus;umi;maliq;poster;teman;lainnya;','Jakarta',918,'2017-08-30 08:18:08','2017-08-30 08:18:08'),(494,'HILLTOP','1504110212.jpg','Pentas seni/ Lomba UNJ juara 3','Alternative Rock','facebook;instagram;informasi_toko;vipclub;guitar_plus;umi;maliq;poster;teman;lainnya;','Jakarta',918,'2017-08-30 08:23:32','2017-08-30 08:23:32'),(495,'ZUNO','1504114279.jpg','Juara 1 Indigital fest 2017\r\nJuara 1 Alamsutra fest 2016\r\njuara 1 fest ultah tangsel 2016','Others','lainnya;','Jakarta',921,'2017-08-30 09:31:19','2017-08-30 09:31:19'),(496,'Zimoutha\'CLAN','1504117907.jpg','Kami adalah sekelompok group musik yang berdo,isili di suatu komunitas pecinta japan di surakarta.\r\nkami mulai terbentuk pada 12 agustus 2016.\r\n\r\nPRESTASI :\r\n\r\n- JUARA II , BAND KOMPETISI KEIRAN FEST SMA7 SURAKARTA (21 AGUSTUS 2016)\r\n\r\n- JUARA HARAPAN , BAND KOMPETISI NIKI JAPAN , PRPP SEMARANG (27 AGUSTUS 2016)\r\n\r\n- JUARA II, BAND KOMPETISI JAPAN EXPO UNISRI SURAKARTA (28 NOVEMBER 2016)\r\n\r\n- GUESTAR , SOLO IMLEK FESTIVAL\r\n (BALAIKOTA SURAKARTA 27 JANUARI 2017)\r\n\r\n- GUESTAR, TRIBUTE L\'ARC~EN~CIEL & ONE OK ROCK  ( HARTONO TRADE CENTER 5 FEB 2017)\r\n\r\n- GUESTAR, J-KAI FESTIVAL UMS SURAKARTA ( 11 MARET 2017 )\r\n\r\n- GUESTAR, SHINSOKU  GATEHRING JAPAN MUSIC PERFORMER ( 20 FEBRUARY 2017\r\n\r\n- GUESTAR, DIEST NATALIST KAMPUS ISTIBANK SOLO ( 23 MARET 2017 )\r\n\r\nDan pada tanggal 6 agustus 2017 kami mengadakan sebuah event \"Mini Japan festival\" untuk memperingati 1st anniversary zimoutha\'clan sekaligus merealist single perdana kami yang di selenggarakan di Hartono Trade Center.\r\nMore info :\r\nFacebook : https://www.facebook.com/profile.php?id=100020138867975&fref=ts\r\nGmail        : zimouthaclan@gmail.com\r\n-----------------------------------------------------------\r\nMore Media Promo :\r\n\r\nFanspage : https://www.facebook.com/ZimouthaClan/?fref=ts\r\nInstagram : @zimouthaclan\r\nReverbnation : www.reverbnation.com/zimouthaclan\r\nSound Cloud : https://soundcloud.com/zimoutha-cian','Alternative Rock','facebook;instagram;guitar_plus;teman;','Yogyakarta',399,'2017-08-30 10:31:47','2017-08-30 10:31:47'),(497,'BraderJon','1504150397.jpg','Braderjon berdiri 25 oktober 2014 mengusung genre classic rock, blues, rock n roll, reggae.. Sering mentas di outdor n cafe di seputaran priangan timur.','Rock','guitar_plus;','Jakarta',931,'2017-08-30 19:33:17','2017-08-30 19:33:17'),(498,'BraderJon','1504150928.jpg','Braderjon berdiri 25 oktober 2014 mengusung genre classic rock, blues, rock n roll, reggae.. Sering mentas di outdor n cafe di seputaran priangan timur.','Rock','guitar_plus;','Jakarta',931,'2017-08-30 19:42:08','2017-08-30 19:42:08'),(499,'BraderJon','1504150953.jpg','Braderjon berdiri 25 oktober 2014 mengusung genre classic rock, blues, rock n roll, reggae.. Sering mentas di outdor n cafe di seputaran priangan timur.','Rock','guitar_plus;','Jakarta',931,'2017-08-30 19:42:33','2017-08-30 19:42:33'),(500,'BraderJon','1504151122.jpg','Braderjon berdiri 25 oktober 2014 mengusung genre classic rock, blues, rock n roll, reggae.. Sering mentas di outdor n cafe di seputaran priangan timur.','Rock','guitar_plus;','Jakarta',931,'2017-08-30 19:45:22','2017-08-30 19:45:22'),(501,'BraderJon','1504154527.jpg','Braderjon berdiri 25 oktober 2014 mengusung genre classic rock, blues, rock n roll, reggae.. Sering mentas di outdor n cafe di seputaran priangan timur.','Rock','guitar_plus;','Jakarta',931,'2017-08-30 20:42:07','2017-08-30 20:42:07'),(502,'JAKARTA BOMB BLAST','1504154861.jpg','Tepat pada tanggal 17 Juli 2009, bersamaan dengan tragedi pemboman JW Marriot dan Ritz Carlton yang dilakukan oleh Nurdin M. Top cs, dengan dipenuhi rasa optimis yang begitu tinggi, Raxel mencoba membangun sebuah band. Ditemani oleh Helmy (Musthafa Helmy) pada Bass/Back Vox, Cornel (Cornelius Endriarto) pada Loop/Moog/Synth, dan Aris (Aris Maulana) pada Drum maka terbentuklah JAKARTA BOMB BLAST. Nama “Jakarta Bomb Blast” ini dilatarbelakangi oleh filosofi yang begitu mendalam dan penuh harapan. “Jakarta Bomb Blast” kami artikan sebagai sebutan untuk mengenang tragedi bom Kuningan yang membuat perhatian seluruh masyarakat Indonesia maupun Dunia tertuju secara serentak dan selalu memperbincangkan kejadian tersebut dimanapun mereka berada. Maka, dengan mengusung nama ini kami pun berharap melalui karya-karya yang kami ciptakan, dapat membunuh perhatian orang banyak, baik di negara sendiri maupun sampai ke Manca Negara.\r\n\r\n- im3 unsigned group competition finalist (2010)\r\n- festival & parade musik 1001 band road to MURI at Taman mini indonesia indah. Big 10 melodic category finalist (2010)\r\n- dimuat HAI MAGAZINE vol.27 rubrik Demos hal88\r\n- festival & parade musik 1001 band jilid 2 at kemenpora senayan #1 winner on modern rock genre category (2011)\r\n- we are pop punk java tour 14 kota se pulau jawa (2014)\r\n- buka bersama 7 halal bihalal tour with MAHADEWI bogor - Bandung - Jakarta (2014)\r\n- chart #1 national & #7 international \"electronica\" category at www,reverbnation.com (periode september 2013 - may 2014)\r\n- Love Heart Tour with Pee wee gaskin , Killing Me inside, Jakarta bomb blast (5 kota jawa tengah 2016)','Alternative Rock','facebook;instagram;poster;lainnya;','Jakarta',932,'2017-08-30 20:47:41','2017-08-30 20:47:41'),(503,'sepedamini.','1504156697.jpg','Sepedamini adalah Band yang ber-genre Grunge/Alternative Rock asal Bandar Lampung, Indonsia, terdiri dari : Angga Martha (Vokal), Hari ‘kmx’ (Lead Gitar), Rachmat Anto (Gitar), Welly (Bass), Fyan Gigih (Drum), Berdiri pada November 2015 dan sudah menghasilkan satu buah album (indie) yang bertajuk ‘mukadua’ pada Agustus 2016.\r\nPrestasi :\r\n- BIG 40 Nasional (big 10 Regional Jakarta) Supermusic Rockin\' Battle 2017\r\n- Juara 1 Festival Akbar UKMBS Musik IBI Darmajaya Lampung (Tingkat Sumbagsel) 2017.\r\n- Juara 1 Festival Band Piala Walikota Bandar Lampung 2016.\r\n- Opening Act. Burgerkill & Siksakubur @Tribal Pride Lampung 2017\r\n- Opening Act. PAS Band & Endank Soekamti @Suryanation Motorland Lampung 2017.\r\n- Opening Act. Revenge The Fate @Gitarplus Lampung 2016.\r\n- Opening Act. EDANE @Gitarplus Gitaransore Lampung 2016.\r\nDLL','Alternative Rock','guitar_plus;','Jakarta',342,'2017-08-30 21:18:17','2017-08-30 21:18:17'),(504,'After Midnight','1504157148.jpg','After Midnight adalah sebuah band yang didirikan pada 21 April 2016 bergenre pop punk','Others','guitar_plus;','Jakarta',937,'2017-08-30 21:25:49','2017-08-30 21:25:49'),(505,'51ST AVENUE','1504168533.jpg','51st Avenue adalah sebuah band yang berasal dari Makassar. Band ini terbentuk dari pertemanan semasa SMA kemudian berkembang hingga kini sudah 8 tahun bersama bermain musik. Walaupun sudah mengalami beberapa kali pergantian personil tapi band ini masih bisa tetap berjalan dan tetap berkarya.\r\n\r\n51st Avenue juga mengalami proses yang sulit untuk bisa tetap bertahan hingga kini, proses melawan ego dan ambisi masing-masing personil, bahkan hingga perjuangan awal kami yang berjuang keras melalui beberapa tahap audisi agar kami bisa mendapatkan kesempatan untuk bisa perform di beberapa event di kota makassar dan hingga kini 51st Avenue sudah memiliki cukup tempat di hati publik Makassar.','Jazz','teman;','Surabaya',866,'2017-08-31 00:35:33','2017-08-31 00:35:33'),(506,'MEMOUS','1504169367.jpg','Band bergenre Alternative rock / Culture rock yang berdiri tahun 2009 tetapi mulai aktif lagi tahun 2014 sejak lulus sma. Sampai saat ini sudah manggung di acara acara kampus, bazar, pensi, graduation, tv kampus, grand/soft opening cafe dan yang lainnya. Kenapa dinamakan Culture Rock : Culture Rock adalah perpaduan antara kultur/budaya dan rock, jadi kita mencapurkan alat tradisional ( Angklung ) ke dalam genre musik Rock. Dan juga ada beberapa lagu dari MEMOUS / lagu cover an dari MEMOUS yang memakai Angklung sebagai contoh, MEMOUS meng-cover lagu BIMBANG dari MELLY GOESLAW dengan kemasan yang sangat berbeda. https://soundcloud.com/memousband/memous-band-bimbang-medley Sudah punya beberapa SINGLE dan VIDEO CLIP (di YouTube) juga sedang mempersiapkan untuk MINI ALBUM. Single dan Video Clip ( MEMOUS - IF Music Video ) : https://www.youtube.com/watch?v=2Aae7jcSrKg','Rock','teman;','Jakarta',945,'2017-08-31 00:49:28','2017-08-31 00:49:28'),(507,'ARFF','1504170777.jpg','ceritanya sikh dulu waktu pas kita masih sekolah\r\ndengan hoby maen musik , karna dukungan temen2 alhamdulilah kita bisa','Pop','facebook;instagram;informasi_toko;vipclub;guitar_plus;umi;maliq;poster;teman;lainnya;','Jakarta',946,'2017-08-31 01:12:57','2017-08-31 01:12:57'),(508,'ACTEON BAND','1504171032.jpg','juara 1 festival FIF safari, pembuka opening RAN, juara 1 festival religi, mendapatkan golden tiket INDIGITAL FEST 2017','Pop','guitar_plus;teman;lainnya;','Jakarta',936,'2017-08-31 01:17:12','2017-08-31 01:17:12'),(510,'Footprints','1504179235.jpg','Rekam Jejak\r\n----------------------------------------\r\n- Music Line up @Fisiphoria UNDIP (2016)\r\n- Big 40 Rockin\' Battle Super Music (2017)\r\n- Big 10 Regional Malang MLD Jazz Band Wanted (2017)\r\n- Music Line up @Land of Leisures (2017)\r\n\r\nStory\r\n----------------------------------------\r\nPada tahun 2015 Anak Chakti membentuk band yang saat itu bernama Mom’s Kitchen dengan formasi utama Anak Chakti (Keyboard), Yusuf (Bass), Fahmi (Vocal), dan Garin (Guitar). Posisi drummer saat itu fleksibel, dapat berupa additional atau tanpa drum. Seluruh personil berangkat dari latar belakang musik yang berbeda, Anak Chakti berangkat dari musik Pop dan Jazz, Yusuf yang berangkat dari seorang gitaris metal, Fahmi biasa mengisi jam session dalam acara komunitas Jazz setempat, dan Garin berangkat dari musik Rock. Saat itu Mom’s Kitchen sempat mengisi beberapa event dengan membawakan beberapa lagu jazz dengan sentuhan rock, lagu rock dengan beberapa lick jazz dan bebop, ataupun lagu pop yang dibawakan dengan sedikit sentuhan jazz atau rock. Berjalan beberapa waktu, lalu munculah ide konsep band “Story Telling” dimana setiap lagu memiliki cerita, dan memiliki hubungan antara lagu satu dengan lainnya baik dari lirik dan ilustrasi musiknya. Penekanan dari konsep band tersebut adalah bahwa setiap karya band yang dibuat dapat se-epic mungkin, memiliki cerita berkesinambungan seperti novel atau cerita pendek sehingga penikmat musik disuguhi karya “Hibrid” antara lagu dan cerita. Juli 2016 Sandi masuk ke dalam band member mengisi posisi drummer. Sandi satu pemikiran dengan konsep band yang demikian. Yogyakarta, 3 September 2016 beranggotakan Anak Chakti, Yusuf, Garin, Sandi, dan Fahmi sebagai vokalis, sebuah band bernama Footprints berdiri sekaligus menyudahi Mom’s Kitchen. Semua personil memiliki pandangan yang sama, yaitu Go International. Nama ”Footprints” dipilih dengan filosofi agar setiap karya yang kami suguhkan bisa meninggalkan jejak di benak para audience, dan yang pasti lebih mudah disebut di kancah international. Pada bulan Maret 2017, Sandi memutuskan untuk keluar dari Footprints dengan alasan perbedaan sudut pandang dalam bermusik. Kemudian pada bulan Mei Tanzil masuk untuk mengisi posisi drum. Salah satu karya yang telah selesai digarap adalah Let\'s Fly. Lagu tersebut bercerita tentang seseorang yang telah siap menggapai impiannya bersama seseorang/sejumlah orang yang ada dalam hidupnya. Let\'s Fly dapat dinikmati melalui 2 cara, yaitu dari cerita lagu itu sendiri, atau dengan menghubungkan cerita dalam Let\'s Fly dengan lagu lainnya. Selain itu kami telah merencanakan beberapa konsep cerita untuk karya kedepan.','Rock','guitar_plus;poster;teman;','Yogyakarta',949,'2017-08-31 03:33:55','2017-08-31 03:33:55'),(511,'POMBOY\'S Band','1504181081.jpg','Perform di Pekan Raya Indonesia 2016 Konser 1000 Band di ICE BSD CITY Tangerang','Pop','teman;','Jakarta',915,'2017-08-31 04:04:41','2017-08-31 04:04:41'),(512,'MANLY DANCY','1504184217.jpg','Manly Dancy merupakan  band bergenre musik pop yang berasal dari kota Subang Jawa Barat. Manly Dancy berdiri pada tanggal 20 September 2016. Band ini di bentuk karena visi dan misi bermusik yang sama antar personil dan menyuguhkan warna musik yang fresh.  \r\nKami pernah menjadi juara festival band yang diselenggarakan oleh salah satu perusahaan rokok dikota kami.\r\nKami pernah menjadi opening Vieratale\r\nKami pernah menjadi opening Payung Teduh.\r\nDan masih banyak lainnya.','Pop','facebook;instagram;guitar_plus;umi;maliq;poster;teman;lainnya;','Jakarta',954,'2017-08-31 04:56:57','2017-08-31 04:56:57'),(513,'Garis Pena','1504185420.jpg','www.garispena-musik.com','Others','facebook;instagram;teman;','Jakarta',809,'2017-08-31 05:17:00','2017-08-31 05:17:00'),(514,'CODE Band','1504186769.jpg','Group band asal Makassar, terbentuk pada awal tahun 2012 dengan nama kode, Diambil\r\ndari bahasa indonesia diartikan sebagai simbol atau isyarat yang disampaikan dan mempunyai makna atau maksud tertentu.\r\nDi tahun 2015 kami mengeluarkan single pertama yang di produseri Capung(Javajive)\r\nBand ini banyak di pengaruhi oleh band\r\nterkenal seperti Coldplay, Oasis,Bonjovi, Imagine,Alabama shakes,Stereophonic,\r\nNTRL, imagine dragon dan banyak lagi.','Alternative Rock','informasi_toko;','Yogyakarta',926,'2017-08-31 05:39:29','2017-08-31 05:39:29'),(515,'Odetta band','1504187607.jpg','odetta adalah band yang mengusung genre kreatif pop yang beranggotakan 4 orang yaitu mirza (vocal), topik (drum), jaru (gitar) dan eka (bass).\r\n\r\nTerbentuk pada juni 2016 lalu, kami sudah berhasil masuk ke 10 besar acara jakcloth festival yang di adakan di gambir expo pada may 2017.','Pop','instagram;','Jakarta',911,'2017-08-31 05:53:27','2017-08-31 05:53:27'),(516,'CODE BAND','1504187988.jpg','Group band asal Makassar,terbentuk pada awal tahun 2012 dengan nama kode,Diambil\r\ndari bahasa indonesia diartikan sebagai simbol atau isyarat yang disampaikan dan\r\nmempunyai makna atau maksud tertentu. Di tahun 2015 kami sempat mengeluarkan single pertama kami yang di produseri oleh Capung(Javajive) ,Band ini banyak di pengaruhi oleh band terkenal seperti Coldplay, Oasis, Bonjovi, Alabama Shakes, NTRL, Imagine dragondan banyak lagi.','Alternative Rock','informasi_toko;','Yogyakarta',959,'2017-08-31 05:59:48','2017-08-31 05:59:48'),(517,'JAGERMONSTER','1504193198.PNG','.CERITA\r\nJagermonster di bentuk pada tahun 2009 dengan nama awal MASTERPLAN HIPMETAL. Pada tahun 2013 kami berhasil membuat Album perdana yang berjudul \"YESTERDAY, TODAY, TOMORROW, AND FOREVER\" dan Album kompilasi yang berjudul \"MEDAN TERIAK\".\r\n\r\n.PRESTASI\r\n- Menjajah puluhan bahkan ratusan panggung di kota medan dan luar kota\r\n- Menjadi Finalist asal kota Medan di acara Penghargaan salah satu Brand Fashion yang di selenggarakan di Kuta, Bali.\r\n- Dan Masih Lagi','Others','guitar_plus;teman;','Medan',618,'2017-08-31 07:26:38','2017-08-31 07:26:38'),(518,'UbanProject','1504194530.JPG','2015 adalah tahun terbentuknya uban project.tahun emas untuk boi uban,indra batara,sandy arfian,ari rizky mengembang segala kreatifitas bermusik dlm 1 tujuan yg pasti,sukses!!','Funk','facebook;teman;','Jakarta',470,'2017-08-31 07:48:50','2017-08-31 07:48:50'),(519,'soerjakanta','1504194785.jpg','soerjakanta berasal dari nama ejaan kosa kata yang belom di sempurna yaitu artinya kaca pembesar. dan berdiri dari tahun 2015 \r\n\r\nband ini berkonsep mengarah swing and roll yang perpaduan antara swing dan rock n roll yang mengalir ke arah suasana vintage \r\n\r\nprestasi yang dimiliki yaitu\r\n- pernah Dapat Peringkat 3 besar radio di medan\r\n- lalu bintang tamu di PRSU 2016\r\n- Bintang Tamu di Festival Amaliun Foodcourt 19 Agustus 2016\r\n- 2015 Akustar i - radio\r\n- bintang tamu indie mami vol v\r\n- pernah bermain di swarloka vintage jazzy night\r\n- dan di jazzy night di sorry grandma','Others','lainnya;','Medan',967,'2017-08-31 07:53:05','2017-08-31 07:53:05'),(520,'Duende','1504194899.png','Sebuah kolaborasi amatir musisi gadungan.ngeband karena warung kopinya sepi. niatnya menghibur diri sendiri. Hanya bertanggung jawab atas pembuatan karya sendiri, tanpa bertanggung jawab atas kenikmatan pendengar. Grazie, El Duende!','Alternative Rock','facebook;instagram;lainnya;','Jakarta',958,'2017-08-31 07:54:59','2017-08-31 07:54:59'),(521,'Basic Evolution','1504194993.JPG','Basic Evolution adalah band yang berasal dari kota Depok, Indonesia.\r\nBand ini digawangi oleh 5 orang :\r\n- Ichsan Septian : Vocal / Rythm\r\n- Fachri Ghozali : Lead Guitar\r\n- Dien Galuh Ekananda : Bass\r\n- M. Dinda Nugroho : Midi Controller / Vocal\r\n- Ludfi Satria Nugraha : Drum\r\n\r\nBasic Evolution mengusung genre musik yang bertajuk \"Pop Sweet Punk\". Band ini terbentuk pada Agustus 2012, dan telah menyelesaikan Extended Play atau yang sering disebut dengan Mini Album pertama mereka pada pertengahan tahun 2016 lalu. Berikut 5 daftar lagu yang berada pada E.P pertama Basic Evolution yang berjudul \"Monologue\" :\r\n- Aku Bukan Mereka\r\n- Mellisa\r\n- Running Out Of Time\r\n- Lost In Wonderland\r\n- The Night Is Alright\r\n\r\nBasic Evolution juga baru saja menyelesaikan sebuah film pendek yang dikembangkan dari judul lagu andalan mereka yaitu \"Aku Bukan Mereka\". Di akhir tahun ini, Basic Evolution juga sedang merencanakan secara matang untuk menggarap video clip pertama mereka. Basic Evolution juga sering melakukan banyak performance di pensi-pensi sekolah dan beberapa konser di Jabodetabek.','Others','guitar_plus;','Jakarta',928,'2017-08-31 07:56:33','2017-08-31 07:56:33'),(522,'Plural','1504197067.jpg','Plural is a Psychedelic pop band that was formed in 2014. The band was originally formed by Andara ( Vocal/guitar) and Hizrian (Guitar) as the founder of Plural. then they added more personnel Jicho(Drums), Nugi ( Bass) and Ravi (Synth/keys) to complete the formation of Plural.','Others','instagram;','Jakarta',972,'2017-08-31 08:31:07','2017-08-31 08:31:07'),(523,'The Unromantic','1504197222.jpg','Juara II Sprite d\'plong Band Competition Bogor 2011','Others','guitar_plus;teman;','Jakarta',850,'2017-08-31 08:33:42','2017-08-31 08:33:42'),(524,'TABS','1504197907.jpg','berdiri tahun 2014 tanggal 20 bulan april\r\nmemilih format trio yang diisi oleh\r\nPanji : voc, cajon, harmonica\r\npandu : gitar, voc\r\nmanda : gitar, voc\r\nkami bertiga mengusung genre FOLK - kontempoler\r\n\r\nprestasi : juara 1 band akustik di kickparade Yogyakarta tahun2015\r\ndan banyak mengisi gigs gigs indie di Yogyakarta, diantaranya heavensound vol 1 dan 2.  brithis invation di Yogyakarta, dan acara Lennon days di Yogyakarta\r\n\r\nTABS sekarang berdomisili di provinsi Lampung, tepatnya di Kota Bandar Lampung','Others','instagram;','Jakarta',974,'2017-08-31 08:45:07','2017-08-31 08:45:07'),(525,'justkidding band','1504202331.jpeg','Assalamualakum... perkenalkan kami anak band dari kota kecil yg ada di jawabarat tepat di kab.subang. kami punya sedikit cerita tentang band kami yg didirikan awal thn 2000 an. Alhmd sampai sekarang masih tetep exsist mesti beberapa kali gonta ganti personil. Kami sekumpulan anak gang yg hobi bermain musik walau cuma dgn bakat yg pas pas an dan otodidak semuanya soalnya kita mempunyai motto yaitu berani malu gak norak yang penting punya cinta dan cita cita. \r\nDengan prestasi yg kita capai walaupun gak di dokumentasikan alhmd sampai skg kita sudah memiliki lagu ciptaan sendiri atau karya sendiri yg sudah direcording walaupun dgn hasil yg pas2an juga. Sementara hasil prestasi yg paling berkesan yaitu ketika kita jadi juara di acara sound of indie-pendence. Dari situlah kita selalu di jadikan sebagai band opening artis ibukota. Mudah2an dengan adanya kompetisi ini kita yg jadi band ibukotanya amin... terima kasih byk buat levis band hunt yg udah memberikan solusi agar lagu kita bisa di dengar dan diterima oleh para pecinta musik tanah air.. amin ya robbalalamin.','Alternative Rock','teman;','Jakarta',877,'2017-08-31 09:58:51','2017-08-31 09:58:51'),(526,'Sin-Thing','1504206026.jpg','Band yang terbentuk pada tanggal 28 Juni 2016 yang mengusung genre punk rock dan membawa misi bermusik guna merawat persatuan dan kesatuan Indonesia.','Others','facebook;instagram;guitar_plus;','Jakarta',978,'2017-08-31 11:00:26','2017-08-31 11:00:26'),(527,'SINTHINK','1504231465.jpg','Band yang terbentuk 14 oktober 2014 ini. terdiri dari lima anak muda yang memiliki tujuan yang sama dalam bermusik. sudah banyak prestasi yang di raih oleh band ini.dan kali ini akan ditunjukan di ajang bergengsi LEVI\'S BAND HUNT.','Rock','instagram;teman;','Surabaya',985,'2017-08-31 18:04:25','2017-08-31 18:04:25'),(528,'Black drama','1508561229.jpg','Black drama ada perubahan nama dari gazita , setela pergantian 2 orang personil drum dan bass, asal kami juga lumayan jauh dari sini, ya kami berasal dari timur indonesi , sulawesi dan papua, datang ke ibu kota awal 2011 untuk mengadu nasip dengan bermain musik,di ibukota kita suda bermain di berbagai macam acara mulai reguler sampai event seperti \"jakarta fair kemayoran,acara2 indie,japex,miss eart,dan masi banyak event2 sederhana yang kami ikuti, saat ini juga kami suda mempunyai lagu2 demo yg kami rekam di best camp kami ( walaupun sederhana si )','Alternative Rock','instagram;guitar_plus;','Jakarta',988,'2017-08-31 19:44:01','2017-10-20 20:47:09'),(529,'Detak','1504239750.jpg','Detak band terbentuk pada tahun 2015. Awal berkumpul sama sama bekerja disebuah perusahaan swasta, iseng iseng latihan distudio. Tahun Mei 2016 juara harapan 1 banteng musik festival bekasi.','Alternative Rock','teman;','Jakarta',968,'2017-08-31 20:22:30','2017-08-31 20:22:30'),(530,'TABS','1504245329.jpg','tabs berdiri di Yogyakarta tanggal 20 bulan april 2014\r\nsekarang Tabs berdomisili di Bandar Lampung, karna telah menyelesaikan tugas di Yogyakrta (kuliah)\r\n\r\nprestasi : juara 1 akustik festifal di KICKPARADE 2015,di Yogyakarta\r\ndan banyak mengisi gigs gigs indie di yogyakarta, diantaranya\r\n1. heavensound vol 1 dan 2\r\n2. brithis invation\r\n3. lennon days\r\n4. tributte to the beatles','Folk','instagram;','Jakarta',990,'2017-08-31 21:55:29','2017-08-31 21:55:29'),(531,'JIN','1504247607.jpg','JIN adalah band dengan 5 personel yaitu : yubi (vocal), novi (guitar), siera (rythm), ikhsan (bass), lucky (drum) dari banten','Alternative Rock','guitar_plus;umi;teman;','Jakarta',910,'2017-08-31 22:33:27','2017-08-31 22:33:27'),(532,'EAR','1504249077.jpg','Bermula dari kepedulian kualitas musik di era sekarang ini,kami \"e.a.r Band\" menyuguhkan hidangan melodi-melodi yang lebih musikalitas. Prestasi: Juara 2 Festival Music Djarum Exhibition 2007 Regional Kabupaten.','Rock','facebook;teman;','Jakarta',994,'2017-08-31 22:57:58','2017-08-31 22:57:58'),(533,'Stereowaves','1504250310.jpg','Berawal dari pertemanan di social media dan membentuk sebuah band','Alternative Rock','instagram;','Jakarta',997,'2017-08-31 23:18:30','2017-08-31 23:18:30'),(534,'unity for the respect','1504250571.jpg','Unity for the respect\r\nBerasal dari Bogor beranggota 5 orang personil.  \r\nKami terbentuk di tahun 2012 kami sering mengikuti ivent ivent musik di daerah jabodetabek .dan sekitar nya memiliki 1 mini album berjumlah 6 lagu di dalam nya.  \r\nKami memilih genre musik rock karna kami ber5 suka ber improvisasi atau mengembangkan genre rock tersebut menjadi banyak bagian. \r\nDi kesempatan kali ini .kami meng-upload salah satu single di mini album kami yang berjudul.\r\n\'takan terhenti\' kenapa kami memilih lagu tersebut.  \r\nKarna lagu ini berisi tentang 5 semangat dari semua anggota personil kami yang melebur manjadi satu.  \r\nSemoga salah satu single lagu kami ini bisa mewakili semangat kami.  Untuk terus selalu bermusik.','Rock','instagram;','Jakarta',941,'2017-08-31 23:22:51','2017-08-31 23:22:51'),(535,'unity for the respect','1504250586.jpg','Unity for the respect\r\nBerasal dari Bogor beranggota 5 orang personil.  \r\nKami terbentuk di tahun 2012 kami sering mengikuti ivent ivent musik di daerah jabodetabek .dan sekitar nya memiliki 1 mini album berjumlah 6 lagu di dalam nya.  \r\nKami memilih genre musik rock karna kami ber5 suka ber improvisasi atau mengembangkan genre rock tersebut menjadi banya