nSemoga salah satu single lagu kami ini bisa mewakili semangat kami.  Untuk terus selalu bermusik.','Rock','instagram;','Jakarta',941,'2017-08-31 23:23:10','2017-08-31 23:23:10'),(538,'Hujanesokhari','1504256686.jpg','Hujanesokhari adalah musik folk bercampur dengan space rock yang membahas tentang sosial campaign Stop bulying. Dimana kegiatan positif sosial dituangkan melalui karya seni musik.\r\n\r\nPrestasi :\r\n2015 Tergabung bersama KPK / PRUNG 2015 - Team koppie indie, mensuarakan stop korupsi bersama slank & efek rumah kaca.','Folk','guitar_plus;','Jakarta',542,'2017-09-01 01:04:46','2017-09-01 01:04:46'),(539,'BlackTail','1504263340.jpg','pada saat 17 augustus 2015 Black Tail berdiri.\r\nawal mula black tail berdiri ketika acara taun 17an di komplek, osep(guitar),reno(bass) dan salim(drum) 1 grup band di acara 17an tersebut , sedangkan firdi(vocal)dan Dico(guitar) berbeda band.\r\nsetelah acara selesai kita nongkrong bareng, waktu itu osep dan firdi mengidekan \"ngejam\" dan setelah brp bulan rutin latian, kita ber5 sepakat untuk membuat band, dan akhirnya black tail pun terbentuk.\r\ntp saat ini dico dan renato memilih jadi addtional karna kesibukan kuliah.\r\ntp mereka tetep gabung klo black tail manggung ^^','Rock','guitar_plus;','Yogyakarta',1003,'2017-09-01 02:55:40','2017-09-01 02:55:40'),(540,'Skylite','1504264679.jpg','Skylite was born in  February 2012 when 4 young creative energetic and unique gathered with their similiar taste of music. They are Taufik, Firmano, Iqbal & Mirza. We came from South Jakarta brought the whole new modern rock genre for all ages and communities to share our musics worldwide. Until now Skylite has been performing through the gigs, school/campus festival, and many other exhibitions. Some of the biggest events like :\r\nBlukustik (Univ Budi Luhur, 2012)\r\nFestival Komunitas Jogja (Senayan, 2012)\r\nJakarta Clothing Expo (Jakcloth Senayan, 2012)\r\nIndie Basecamp I & II (Ancol, 2012)\r\nEarth Day Festival (Pamulang, 2012)\r\nTop 10 Paramore Festival (Ancol, 2012)\r\nSmith Clothing Midnight Sale (Endorse Store Tebet, 2013)\r\nTop 50 L.A. Lights Meet The Labels 2013\r\nSMK Telkom (Jakarta, 2014)\r\nJakarta Clothing Expo (Jakcloth Senayan, 2014)\r\nHarganas Tangsel (Lap. Sunburst BSD, 2015)\r\nand more...','Alternative Rock','facebook;instagram;','Jakarta',1002,'2017-09-01 03:17:59','2017-09-01 03:17:59'),(541,'Alena','1508545703.jpg','Alena adalah Band Indie Pop Rock yang berasal dari Jakarta Timur, Indonesia.\r\nNama Alena diambil dari bahasa Yunani kuno yang \r\nberarti “Cahaya”. Berfilsafat dengan keberadaannya yang terang benderang membantu kami menerjang harapan.\r\nAlena berdiri pada bulan April 2011 dan sempat\r\nbergaonta ganti personil, dengan personil tetap yang sekarang Maia (Vocal), Abhay (Drum ‘n Sequence), Miivtah (Bass), Jacko (Guitar).','Alternative Rock','facebook;teman;','Jakarta',1008,'2017-09-01 05:43:02','2017-10-20 16:28:23'),(542,'Bed Stories','1504274678.jpg','Bed Stories terbentuk karena alasan yang sederhana yaitu rasa kerinduan para personilnya akan nuansa musik 90an hingga 2000an awal. Kami mengungsung nuansa punk rock seperti greenday, no use for a name, atau california punk yang dibalut dengan konsep sedikit \"sirkus\" di aksi live kami. \r\nPrestasi kami sebenarnya belum terlalu banyak, kami hanya sempat bermain di gigs kecil seperti rossi fatmawati atau pensi sekolah  dan juga panggung terbesar kami di pekan raya Indonesia tahun 2016.','Others','guitar_plus;umi;','Jakarta',1014,'2017-09-01 06:04:38','2017-09-01 06:04:38'),(543,'Roternal','1504274954.png','Roternal adalah band Rock yang berasal dari Tangerang, Banten. Roternal berdiri pada tahun bulan Februari 2016 dengan formasi awal yaitu Chairul M. S (Vokal), Fikri Akbar (Gitar), dan M. R. Julian (Drum). Single Roternal yang berjudul \"Akhirnya Setan Pun Puas\" dirilis pada bulan Juli 2016 yang menceritakan tentang penyimpangan dari pergaulan remaja Indonesia saat ini. Roternal sangat terinspirasi dengan God Bless, Boomerang, Metallica, Guns n\' Roses, dan Skid Row.','Rock','facebook;instagram;guitar_plus;teman;','Jakarta',908,'2017-09-01 06:09:14','2017-09-01 06:09:14'),(544,'SINTHINK','1508562356.jpg','Band yang terbentuk 14 oktober 2014 ini terdiri dari lima anak muda yang memiliki tujuan dan bakat yang sama dalam bermusik.sudah banyak prestasi yang diraih. dan kali ini akan ditunjukan di ajang yang bergengsi LEVI\'S BAND HUNT.','Rock','instagram;teman;','Surabaya',1016,'2017-09-01 06:35:20','2017-10-20 21:05:56'),(545,'realist','1504277292.jpg','Realist Band terbentuk tgl 11 maret 2017 asal cikarang selatan (bekasi), bergenre alternative rock dengan 5 personil dan single pertama kami yang berjudul pergi menjauh. Harapan kami bisa diterima oleh semua kalangan terutama pendengar musik rock.','Alternative Rock','instagram;','Jakarta',1017,'2017-09-01 06:48:12','2017-09-01 06:48:12'),(546,'Vajar','1504277956.jpg','Vajar terbentuk tahun 2005, Vajar yang berarti matahari pagi, waktu dimana harapan dan kehidupan kita dimulai. Kita adalah sekumpulan anak muda kreatif yang ingin terus berkarya untuk melanjutkan hidup dan menghidupkan harapan.\r\nMelalui Vajar, tempat kita berekspresi dan menyalurkan kreativitas, kita berharap para pendengar lagu kita akan terhibur dan terinspirasi. Serta dapat menumbuhkan dan membangkitkan harapan.','Alternative Rock','teman;','Surabaya',776,'2017-09-01 06:59:16','2017-09-01 06:59:16'),(547,'One Night Stand','1504279247.jpg','Sebuah reuni kecil pertemanan berujung ambisi electro-pop dari Kota Palopo, Sulawesi Selatan.','Electro','facebook;','Surabaya',1011,'2017-09-01 07:20:47','2017-09-01 07:20:47'),(548,'Latos','1504280691.jpg','Menjuarai beberapa kompetisi festival music dan menjadi home band local.','Alternative Rock','instagram;','Jakarta',563,'2017-09-01 07:44:51','2017-09-01 07:44:51'),(549,'MANGROOVE BAND','1504281957.jpeg','Awal terbentuk MANGROOVE yaitu pada 25 Juni 2015, dan personilnya terdiri dari Farhan on Vocal, Indra on Keys/Guitar, Banu on Saxophone. Kita bertiga adalah teman main dari SMA yang sama, dan kemudian merantau ke Yogyakarta untuk melanjutkan kuliah disana. Sewaktu SMA, Indra adalah kakak kelas dari Banu dan Farhan, kami dipertemukan disebuah gigs kecil yakni acara sosialisasi mahasiswa dan kami merupakan pengisi acara tersebut, dimana gigs tersebut merupakan gigs pertama kami tampil dihadapan para audience. Dari perjalanan musik kami bertiga selama 2 tahun lebih, banyak diantara kami saling berbeda pendapat, namun itu semua dapat teratasi dengan ke kompakan kita dan jiwa bermusik yang sejalan untuk mengarah ke satu tujuan yaitu berkarya dengan hati untuk mewarnai blantika musik Indonesia. Karena kami yakin bahwa perjalanan kami untuk bermusik merupakan suatu proses yang harus dijalani dan kami pun percaya bahwa taste bermusik kami memang pantas untuk didengar oleh penikmat musik diseluruh negeri.\r\nPengalaman bermusik kami selama 2 tahun lebih banyak kami dapati dengan menghibur para audience baik dari cafe, event kampus, wedding maupun event besar juga pernah kami hibur yaitu seperti Event mall, Pameran Mobil, Jogja Fashion Festival dan masih banyak lagi.','Pop','instagram;informasi_toko;umi;maliq;','Yogyakarta',1022,'2017-09-01 08:05:57','2017-09-01 08:05:57'),(550,'DARRAS BAND','1504283642.jpg','DARRAS band adalah band yg berasal dari kota singkawang yang sudah 4 tahun berdiri dikota ini.. di.pulau kalimantan barat... \r\nDARRAS sudah berkali -kali mendapat kan juaras setiap kompetisi yang ada... sekiranya sudah 7 kali..mendapat kan piala piagam penghargaan... dan yang lain nya yg sudah di.peroleh... DARRAS juga sudah sering mengikuti acara acara yg ada dikotanya... akustik cafe akustik mall... akustik wedding... dan acara fullband... Darras juga sudah tampil di ibu kota kalbar... Darras adalah sebuah band yang berbobot tinggi..  mereka 5 personil beda genre tapi bisa menjadi satu... mereka bisa berbagi ilmu musik yang mereka dapati... Darras mempunyai keunikan tersendiri di kotanya dan nama Darras sedang naik daun saat ini.','Alternative Rock','instagram;','Jakarta',977,'2017-09-01 08:34:02','2017-09-01 08:34:02'),(551,'Yellou','1504284600.jpg','Band ini aseli tidak memiliki prestasi formal apa-apa dalam bermusik, namun sampai saat ini kami telah menciptakan beberapa karya dan 12 diantaranya sudah dalam dalam bentuk demo rekaman.\r\nPara personil telah bersama-sama sejak masa perkuliahan dan saat ini kami terus berkarya walaupun masing-masing personil sudah disibukkan dengan kesibukan masing-masing.\r\nSelamat menikmati lagu jagoan kami, Siapa Namamu?','Alternative Rock','instagram;lainnya;','Jakarta',884,'2017-09-01 08:50:00','2017-09-01 08:50:00'),(552,'KAZAN','1504289525.jpg','KAZAN kita ambil dari filosofi bahasa Yunani Yang Berarti PEMENANG .. Terbentuk pada tanggal 7 Oktober 2011 .. Mengusung Genre Britpop .. \r\n\r\nPrestasi Band KAZAN :\r\nJuara 1 Lomba Band Group Tingkat Kota Jakarta Selatan 2014\r\nJuara 1 Musik Kreatif Modern Tingkat Pemuda Jakarta Barat 2014\r\nMost Favourite Emporium Band Challenge 2014 \r\nJuara 1 Lomba Cipta Lagu Jingle \"Pekan Nasional Keselamatan Jalan 2015\r\nJuara 2 Festival Band \"Cibubur Junction\" 2015\r\nJuara 2 Lomba Band Gebyar Gelanggang Remaja Pemuda Indonesia Jakarta Pusat 2016\r\nJuara 2 Benteng Musik Festival 2016','Pop','instagram;teman;','Jakarta',775,'2017-09-01 10:12:05','2017-09-01 10:12:05'),(553,'CHROMESTHESIA','1504292485.png','Five years of good friendship, they decided to form a band and airing since 2016 with \"Crowd\" as the first single. Their songs mostly talk about love, motivation, and brotherhood, are nicely wrapped in dramatic and inspiring sounds. They don\'t exactly know what genre they are playing in but they believe that they have their own music style, influenced by Kodaline, Echosmith, Coldplay, and many more. Now they are up to make their first album called Atmosphere.','Pop','facebook;poster;','Yogyakarta',1025,'2017-09-01 11:01:25','2017-09-01 11:01:25'),(554,'ganesha two','1504293715.jpg','BIOGRAFI BAND GANESHA TWO\r\nGANESHATWO ,itu adalah nama band kami.Band kami terbenetuk  Pada tanggal 28 maret 2009 DI DEPOK .\r\nMengapa nama adalah GANESHA TWO ..Nama  GANESHA memiliki banayak arti namu yang kita ambil dari ganesa ada simbol dari lambang kecedasa dan kebijaksaaan . selain arti itu ada yang lebih berharga karna nama ini juga suatu pemberian guru-guru kami pada waktu membentuknya di sekolah. \r\nPertama ,kita memiliki personal 5 tetap .terdiri dari ikhsan (gitar 1) putra (vocal) ian (drum) ahmad (gitar 2) rizky (basis) berselang dua tahun band ini berjalan ahmad (gitar 2) mengudurkan diri di karnaka kesibukannya .Lalu masuk lah hervian untuk mengisi rhytem berselang bebrapa tahun berjalan di tahun 2014 hervian (gitar 2) dan di ikuti dengan rizky (basis) keluar mengudurkan diri dikarnakan kesibukanya berkerja .Lalu di tahun 2014 itu juga bergabung lah fajar untuk mengisi kekosogan band ganesa two  di posisi basis . sampai saat ini lah band GANESHA TWO berangotakan  4 orang personil  . yang insallah aka berjuang bersama menyujudkan mipi di dunia hiburan musik .','Pop','guitar_plus;','Jakarta',887,'2017-09-01 11:21:55','2017-09-01 11:21:55'),(555,'AKLA','1504313369.png','AKLA\r\n- Terbentuk tahun 2015\r\n- Saat ini telah merilis album ke-2 berjudul \"Sastra Hati\"\r\n- Finalis sound of 3 2017\r\n- Easy listen & various genre on our new album','Pop','instagram;umi;','Jakarta',1029,'2017-09-01 16:49:29','2017-09-01 16:49:29'),(556,'Kala','1504315114.jpg','Kala adalah sebuah band yang mengusung genre folk asal Yogyakarta, Indonesia. Band yang beranggotakan Arista (Vocal), Gilar Arief (Elektrik Gitar), Steven Yoyada (Bass), Aditya Hendy (Akustik Gitar), dan Lanno Joseph (Drum). Band yang terbentuk pada medioker 2017 ini pernah menjadi kontestan pada event band competition dari sebuah  vendor rokok kenamaan dari Indonesia bulan Juli 2017.','Folk','instagram;guitar_plus;umi;poster;','Yogyakarta',1006,'2017-09-01 17:18:34','2017-09-01 17:18:34'),(557,'Shuffle 7','1504315357.jpg','Band asal Yogyakarta berdiri pada tanggal 20 November 2016, awal didirikan oleh Putra (Putra Aribowo,Vocal) dan Gamas (Enrique Arsimilen Gamaswara,Guitar) . Band yang dinamai \" Shuffle7 \" yang memiliki arti Shuffle dalam istilah musik yaitu Irama Rock dengan fell Swing. dan pengambilan kata/huruf 7(seven) diambil dari ide Bayu (bayu Linggar Restu,Guitar) yaitu tangga Nada (Do,re,mi,fa,so,la,si) . Band dari Yogyakarta ini beranggotakan Putra (Putra Aribowo,Vocal), Bayu (Bayu Linggar Pangestu,Guitar), Gamas (Enrique Arsimilen Gamaswara,Guitar), Sidik (Sidik yulianto,Guitar Bass), Farhan (Hafif Farhan,Drum). Shuffle 7 telah menghadiri Show/perform antar SMA di yogyakarta. Single pertama Shuffle 7 berjudul Masa Sekolah , yang telah menyebar dibeberapa pendengar tinggat Sekolah di Yogyakarta, dan Album Perdana Shuffe 7 \"Musim Semi\" yang direncanakan Keluar pada bulan Januari 2018. Band yang masih memiliki Umur cukup muda (belasan tahun) asal yogyakarta ini telah memiliki lagu ciptaan sendiri seperti Single Masa Sekolah yang sudah masuk Digital Music Store dan beberapa penggemar tingkat Pelajar di Kota Yogyakarta.','Pop','facebook;instagram;informasi_toko;teman;','Yogyakarta',315,'2017-09-01 17:22:37','2017-09-01 17:22:37'),(558,'PALKER','1504317691.jpg','band di buat karena satu misi yang sama\r\nsehati dengan pembuatan lagu dan konsepnya\r\n\r\nprestasi \r\nsering main di event di pembukaan pensi-pensi dan opening artis','Folk','facebook;instagram;guitar_plus;poster;teman;lainnya;','Jakarta',544,'2017-09-01 18:01:31','2017-09-01 18:01:31'),(559,'Jhard','1504319583.jpg','Jhard (baca : Jard). berasal dari Ciwidey - Bandung Selatan terbentuk pada hari Jumat 9 April 2010 dengan Genre Pop & Rock. Jhard berasal dari nama depan personil yang dibentuk pertama kali J (Jimmy), H (Heri), A (Asep), R (Riyan), D (Dery). \r\n\r\nPada Tgl 2 Mei 2015, Susunan Pemain Inti Jhard adalah \r\nJimmy (Vocals), Abie (Guitar), Yadi (Guitar) Hermawan (Bass), Adi (Drumm)\r\n\r\nAdditional Vocalist : Yoan\r\n\r\nSebutan dari Fans Jhard adalah Jharders.\r\n\r\nAwards\r\nJuara 1 Swara Muda Band Competition di Jatinangor, 7 Mei 2017 Bandung\r\n\r\nJuara 1 Banteng Music Festival di Bale Endah, 11 Mei 2016 Bandung\r\n\r\nJuara 1 Djarum Super Friendship Moment di Neo Cafe Soreang 2 Juni 2015 Bandung\r\n\r\nJuara 1 Festival Band JO RUPI di BIP 28 Mar 2015 Bandung\r\n\r\nJuara 2 Festival Band Inagurasi Lima Jari Unibba, 14 Mar 2015 Bandung\r\n\r\nJuara 1 Festival Band Monumen Palagan Sasak 9 Nov 2014 di Banjaran \r\n\r\nJuara 2 Festival Acoustic Pasteur Hyper Point 13 April 2014 di Bandung \r\n\r\nJuara 2 Band In Bandung / Lagu \"Bila Mungkin\" masuk chart nomor 2 di Bandung Radio periode Maret - April 2014\r\n\r\nJuara 1 Festival Band Sapoek Milangkala ka II 25 Jan 2014 di Ciwidey\r\n\r\nJuara 3 Festival Band Religi 23 Des 2013 di SMA N 1 Ciwidey\r\n\r\nJuara 1 Festival Hari Pahlawan 10 Nov 2013 di Ciwidey','Rock','instagram;teman;','Jakarta',586,'2017-09-01 18:33:03','2017-09-01 18:33:03'),(560,'The Little Lizard','1508562535.jpg','The Little Lizard adalah band asal Tasikmalaya. Terbentuk pada Desember 2015 dengan genre rock, blues, psychdelic, rock n roll.','Rock','guitar_plus;','Jakarta',1033,'2017-09-01 20:08:30','2017-10-20 21:08:55'),(561,'ARESKHA','1504330822.jpg','pernah tampil di TV local dan radio local seperti TVRI Kal-sel, Prima TV, Kompas TV Kal-sel, BanjarTV, TapinTV, Radio RRI Banjarmasin, I-Radio Banjarmasin.','Alternative Rock','guitar_plus;','Surabaya',1038,'2017-09-01 21:40:22','2017-09-01 21:40:22'),(562,'The Listener','1504336423.jpg','Berawal dari teman seperjuangan sewaktu masa masa kuliah yang mempunya satu mimpi.','Pop','facebook;','Jakarta',1043,'2017-09-01 23:13:44','2017-09-01 23:13:44'),(563,'Fortunates','1504338221.jpg','diambil  dari  kata  fortuna  yang  berarti  keberuntungan,  berdiri  pada  29 november  2013,bermarkas di jl kartika raya no 254 c KPAD gegerkalong ba