isi acara di MercydayBenz 2015 di Kotabaru Parahyangan Bandung\r\nPengisi acara di Yamaha Motor Show 2015\r\n-Pengisi acara Radio PR Fm di Car Free Night 2015\r\n-GuestStar di Ramadhan Festival coustic di BEC 2015\r\n-Home Band Istana Plaza Bandung, Bullwings PVJ, LeBiere, Dulang Resort, Motzen Steak and Ale Dago, DLL.\r\n-Juara 1 Acoustic Festival di Bandung Radio 95.2 FM 2015\r\n-Pengisi acara di Festival Bandoeng Baheula 2015\r\n-Pengisi acara di Food fesitival di Dalem Kaum 2015\r\n-Pengisi acara Ngabuburit Ramadhan 2015 di hotel Gino Veruci Bandung\r\n-Pengisi acara di GG Mild Signature 2015\r\n-Pengisi acara di Wisuda Purna Bhakti Telkom Indonesia 2015\r\n-Pengisi acara di Jambore Nasional Camping Bikers 2015','Pop','poster;','Jakarta',993,'2017-09-01 23:48:06','2017-09-01 23:48:06'),(565,'Mr. Bones','1504343707.jpg','Kami Mr. Bones adalah band yang bergenre reggae berasal dari kota Nganjuk, terbentuk pada tahun 2013 lalu yang sudah sempat merilis single pertama yaitu \" Try To Forget \" dan sudah sampai tahap video clip.\r\ndan sekarang ini kita mengikuti audis \" Levis Band Hunt dengan single kedua kami yang judulnya Gadis SMA.','Others','facebook;instagram;poster;','Surabaya',1048,'2017-09-02 01:15:07','2017-09-02 01:15:07'),(566,'NADA-NADYA\' NEW BROTHER\'S.','1504344523.jpg','NADA-NADYA\' NEW BROTHER\'S. band asal kota PALOPO sul-sel sering tour road to cafe, juara di berbagai evant festival band sesulawesi/selatan. pernah menjuarai evant national di jakarta. dll..','Pop','facebook;instagram;guitar_plus;teman;lainnya;','Jakarta',1049,'2017-09-02 01:28:43','2017-09-02 01:28:43'),(567,'VARD HOLI','1504348775.jpg','VARD HOLI Band ini berawal dari sekumpulan anak pindahan di beberapa daerah ke Sekolah Menengah Atas Negeri 1 di Kecamatan V Koto Timur Kabupaten Padang Pariaman Sumatera Barat. Mereka pindahan Ari/Drumer dari Padang, Yatna/Gitaris dari Bogor, Doni/Bassis dari Jakarta dan Riandi/Vokalis dari Bekasi. Mereka berkumpul di sebuah lokal atau kelas yang menyatukan mereka bermula dari mp3 dihp masing-masing yang satu genre dengan mereka. Berlanjut mencoba latihan ke studio dan mencari lagu yang sesuai dengan aliran mereka. \r\nSeiring berjalannya waktu Vard Holi Mengulik satu lagu pertama mereka yang berjudul Hadapilah ciptaan Ari dan Yatna. Dan terjadilah Musibah di SumBar Pada Tanggal 29 September 2009 merobohkan semua bangunan di Sumbar umumnya, Yatna di panggil balik oleh orang tuanya ke Bogor. Semenjak kepergian yatna kebogor VH mencari pengganti Gitaris baru yaitu Vicky yang juga siswa dari SMA tersebut. Riandi Keluar Karena pindah SMA tidak Berkomitmen. \r\nBerlanjut pada lagu pertama Mereka yang berjudul Hadapilah mereka akan rekaman yang mengisi Vokal yaitu Ari. VH akan mencari Vokalis Baru yaitu Adit yang juga merupakan Siswa SMA tersebut menjadi Formasi Baru Ari/drumer, Doni/Basis, Vicky/Gitar dan Adit yang baru pada Vokal. Tidak lama pada formasi tersebut mereka mengeluarkan rekaman lagu kedua dan ketiga yang berjudul yaitu Takkan Pernah Bisa ciptaan : Ari dan Anggun, lagu Waktu Khusus Ciptaan Ari dan Doni.\r\nVard Holi juga Aktif dalam mengikuti Event di Pariaman Festival Band dan Sebagainya. Setelah mereka menyelesaikan Sekolah Mereka pada tahun 2011 Doni kembali Ke Daerahnya meninggalkan VH. Beranjak Kepadang mereka kuliah, VH juga mencari personil baru pada Bass Yang bernama Andre dari padang, di Padang VH juga aktif mengikuti On Air di radio Kota Padang, dan Guestar Pada acara SMA di Kota Padang. Tidak lama kemudian Adit Hengkang keluar dari VH melakukan Ber-Solo Karir mengeluarkan Album Solo. Vicky sibuk Kuliah di Padang Panjang diam tidak merespon dengan VH sampai saat ini. \r\nPada tahun awal 2017 Ari dan Andre berkomitmen mencari gitaris yang bisa langsung vokal  ketemu dengan Dhika mereka melangsungkan rekaman pada bulan Mei 2017 mengeluarkan Single yang Berjudul “Kawan”. mereka akan bertekad niat akan men-sukseskan, berkarya dengan VH kedepannya untuk daerah, nasional dan internasional.','Alternative Rock','facebook;instagram;lainnya;','Jakarta',923,'2017-09-02 02:39:35','2017-09-02 02:39:35'),(568,'troya','1504351777.jpg','terbentuk tahun 2007, di tahun 2016 telah merilis 1 album secara independent.','Alternative Rock','guitar_plus;','Jakarta',1060,'2017-09-02 03:29:37','2017-09-02 03:29:37'),(569,'Stand by me kidz','1504357059.jpg','Stand by me kidz berasal dari kota tasikmalaya yg beraliran alternatip rock / poppunk\r\nStand by me kidz terdiri dari empat orang peraonil,  di antaranya \r\nNewin : vocal / bass\r\nAgung : gitar\r\nEful : gitar\r\nHerman : drum','Alternative Rock','instagram;guitar_plus;','Jakarta',1068,'2017-09-02 04:57:39','2017-09-02 04:57:39'),(570,'Laika ID','1504358863.jpg','Laika ID terbentuk sejak Maret 2013 di Kota Bekasi, dimana Arendo Sineas sebagai vokalis dan Rio Kalvari sebagai gitaris ingin membuat sebuah projek musik baru yang fresh dan tidak membawa bayang-bayang musik mereka di band sebelumnya, dimana Arendo mencari jati diri dengan musik Punk sedangkan Rio bertumbuh dewasa dengan Rock and Roll. Pemilihan nama pun dimulai, dan ketika itu tercetuslah nama Laika yang terinspirasi dari seekor anjing husky kepunyaan Uni Soviet yang menjadi makhluk hidup pertama yang terbang ke bulan didalam sebuah kapal bernama Sputnik. Karena menurut mereka berdua namanya cukup filosofis untuk dijadikan sebuah nama band, Laika digambarkan adalah personil yang tergabung didalam Laika ID sendiri, Kapal Sputnik merupakan alat dimana itu adalah sebuah karya musik yang mereka mainkan, dan bulan menjadi mimpi Laika ID dalam bermusik atau pencapaian yang akan dituju oleh Laika ID sendiri. \r\nSaat itu Arendo dan Rio mengajak beberapa teman untuk menjadi personil yang dirasa cocok untuk bergabung, sampai mereka bertemu dengan bocah konservatorium, Reindhardt Yobel yang bekerja sama dengan mereka dari tahun 2014 dan menjadi drummer tetap hingga sekarang. 1 Tahun berikutnya Laika ID mendapatkan bassist bernama Pierre Saselah, di pertengahan 2016 Bintang bergabung sebagai gitaris. Kini Laika ID adalah Arendo, Rio, Reindhardt, Pierre, dan Bintang dan sepakat mengusung aliran pop yang bergizi. 5 orang dengan visi misi yang sama dan satu tujuan yang sama bersama Laika ID. Sejauh ini Laika ID telah menciptakan 6 lagu salah satunya adalah VANATIQUE yang sudah beredar dan dapat disaksikan di Youtube sejak  23 Agustus 2017. Lagu yang ditulis oleh Arendo ini merepresentasikan kegundahan dan kekesalan dengan apa yang terjadi di kehidupan sosial masyarakat yang mudah terprovokasi dan terpecah-belah.\r\n\r\nRunner Up Lee Cooper Band Invansion 2015','Others','facebook;','Jakarta',1069,'2017-09-02 05:27:43','2017-09-02 05:27:43'),(571,'Filosofi Band','1504359366.jpg','Pernah mengisi acara event Charity dan pernah mengisi acara atau manggung di Coffee Shop','Pop','facebook;instagram;umi;maliq;teman;','Jakarta',1050,'2017-09-02 05:36:06','2017-09-02 05:36:06'),(572,'Day For Uncle Sam (DFUS)','1504361250.jpg','Day For Uncle Sam (DFUS) terbentuk pada 2011 di Surabaya dengan formasi awal 5 personil hingga sekarang (2017). Mengusung genre Emo/Alternative Rock. Pada 2016 Day For Uncle Sam merilis Debut Album yang bertajuk FLORIBUS VENENOSA dan Video Footage. Achievement prestasi yang dimiliki : *Juara 1 Jakcloth SummerFest dan Pengisi acara Jakcloth Jember & Jakarta *Tapping perform at SBO Tv Surabaya.','Alternative Rock','instagram;umi;teman;','Surabaya',1075,'2017-09-02 06:07:30','2017-09-02 06:07:30'),(573,'BUS','1504361558.jpg','Berawal dari perbedaan menjadi suatu karya seni music yang berbeda','Others','facebook;teman;','Surabaya',1074,'2017-09-02 06:12:38','2017-09-02 06:12:38'),(574,'Jeans Roek','1504361839.jpg','Sudah meluncurkan 2nd Album\r\n1. Bangkit Dari Kubur (2015)\r\nLauching di Jakcloth Store Bogor 24 Maret 2016.\r\nKompilasi Manajemen Artis Indonesia Lagu \"Palkon\" 2016.\r\n2. Here We Are Shut Your Mouth (2016)\r\nLaunching di RRI Bogor 26 Maret 2017.\r\nKompilasi Album Proganizer Lagu \"Indahnya Perbedaan & Lapor Polisi\" 2017.\r\n\r\nSalah satu single di Album ke-2 kami yang berjudul \"Indahnya Perbedaan\" menjadi soundtrack Hari Perdamaian Dunia di Universitas Negeri Jakarta.\r\n\r\nPanggung-panggung yang pernah kita nodai\r\n-Soundsation Gunung Putri Bogor 2016\r\n-Bogor Clothing Market 2016\r\n-Hari Jadi Bogor 2016\r\n-Jakcloth Summer Fest Kemayoran 2017\r\n-Jakcloth Lebaran Lippo Cikarang 2017\r\n-Jakcloth Lebaran Parkir Timur Senayan 2017\r\n-Pekan Raya Jakarta 2017\r\n-Bogor Clothing Fastingval Gor Padjajaran 2017\r\n-Bogor Clothing Fest Braja Mustika 2017','Rock','guitar_plus;','Jakarta',1073,'2017-09-02 06:17:19','2017-09-02 06:17:19'),(575,'Math Morska','1504363016.jpg','Math Morska adalah band berasal dari kota Pasuruan. Band ini memainkan lagu bergenre Alternative Rock. Math Morska beranggotakan 4 orang, Akbar pada Vocal, Ade pada Guitar, Coco pada bass dan Malik pada Drum. Saat ini Math Morska sedang menggarap Album EP pertamanya.','Alternative Rock','instagram;poster;teman;','Surabaya',1051,'2017-09-02 06:36:56','2017-09-02 06:36:56'),(576,'Melancholic Demon','1504363114.jpg','Band pengisi album kompilasi Revolusound Vol.1','Rock','instagram;teman;','Jakarta',1031,'2017-09-02 06:38:34','2017-09-02 06:38:34'),(577,'Day For Uncle Sam (DFUS)','1504368886.jpg','Day For Uncle Sam berdiri di Surabaya pada tahun 2011 dengan formasi 5 personil (Ferdi-vocal,Ryan-Bass,Brilly-guitar,Tino-lead guitar,Lindu-drum) hingga 2017 sekarang. Pada 2016 Day For Uncle Sam merilis Debut album yang bertajuk FLORIBUS VENENOSA dengan materi 10 lagu dan Video clip footage . Achievement prestasi yang di capai : * Juara 1 Jakcloth Summer Fest dan pengisi acara Jakcloth Summerfest & Goes to Jember *Tapping perform at SBO TV Surabaya.','Alternative Rock','instagram;umi;poster;teman;','Surabaya',1082,'2017-09-02 08:14:46','2017-09-02 08:14:46'),(578,'Ngepass','1504373272.jpg','Born to be a Rock n Roll','Rock','teman;','Yogyakarta',644,'2017-09-02 09:27:52','2017-09-02 09:27:52'),(579,'Fletch','1504375667.jpg','Fletch merupakan band indie pop asal kota Malang yang berdiri pada tahun 2015. Sejauh ini Fletch telah merilis 3 single yang berjudul It Sparked It Rained, Tiga Pagi,  dan Sadajiwa. Khusus 2 single terakhir sudah dapat didengarkan di Spotify. Tiga Pagi dirilis pada tanggal 28 Mei 2017 sedangkan Sadajiwa dirilis tepat pada hari kemerdekaan yaitu tanggal 17 Agustus 2017. Untuk lagu Tiga Pagi sendiri sudah masuk ke dalam 2 playlist Spotify yaitu Indienesia dan Pojok Akustik. Sampai saat ini, lagu Tiga Pagi sudah didengarkan lebih dari 100.000 kali di Spotify. Lagu Tiga Pagi ini juga masuk ke dalam album kompilasi Cassette Store Day Malang 2017 yang akan dirilis pada bulan Oktober mendatang. Untuk prestasi lainnya, Fletch juga sudah bermain di beberapa event musik besar seperti, Urbangigs dan Kickfest.','Others','informasi_toko;teman;','Surabaya',1084,'2017-09-02 10:07:47','2017-09-02 10:07:47'),(580,'Ciremay','1504375734.jpg','Hanya ikut event2 saja belum ada prestasi','Pop','guitar_plus;','Jakarta',1086,'2017-09-02 10:08:54','2017-09-02 10:08:54'),(581,'ELENA','1504404462.jpg','kita bertemu dari jaman sekolah\r\nsepakat untuk membentuk band ,,dan kita semua mempunyai kesukaan genre musik yang sama yaitu electronic \r\n\r\nprestasi \r\nkita sering manggung di pensi-pensi di kota kita maupun  di luar kota\r\nmenjadi opening artis','Electro','facebook;instagram;guitar_plus;poster;teman;lainnya;','Jakarta',1090,'2017-09-02 18:07:42','2017-09-02 18:07:42'),(582,'Jellyfish','1504405186.jpg','Band ini terbentuk pada tanggal 24 Januari 2016 lalu di Surabaya, terdiri dari Nesa (vokal), Faiz (Gitar), Wira (Bass), Zulvian (Drum), dan Amik (Keyboard). Saat ini, Jellyfish telah merilis sebuah single berjudul \"Dengarkan Aku\".','Pop','teman;','Surabaya',1042,'2017-09-02 18:19:46','2017-09-02 18:19:46'),(583,'MOSES BANDWIDTH','1504405735.jpg','Inspirasi awal pembentukan Moses Bandwidth berawal pada tahun 2003. Saat itu LaVey Junior yang tengah meneruskan studi kuliahnya di kota Bandung, tertarik pada beragam type musik Progressif yang memiliki nuansa metal. Tetapi selanjutnya kakaknya mengenalkan dia pada suatu genre yang bernama Gothic Metal, Dari waktu tersebut lalu LaVey Junior seolah jatuh cinta pada type musik ini, serta berusaha untuk memperoleh beragam Info serta rekomendasi tentang Gothic Metal.\r\n\r\nPada akhir tahun 2004, LaVey mencari orang yang mempunyai visi dan misi yang sama juga dengan dia, untuk membuat suatu band Progressif, tetapi ia mengerti seutuhnya bahwasanya amatlah susah untuk mencari orang di sekitar yang memiliki dedikasi tinggi pada musik Metal. Sesudah lama mencari tiada hasil, dia lalu berinisiatif untuk mebuat beragam materi lagu yang semua pelaksanaan musiknya dikerjakan oleh sendiri serta mengakibatkan, persoalan baru juga timbul saat Ia mesti memperoleh seorang untuk isi vocal.\r\n\r\nSelang beberapa saat ia menghubungi female vocal bernama Riska Elfira dan Chris Bobby (Drummer) yang disebut rekan sekelasnya dibangku kuliah sekalian adalah anggota Gabungan Nada Mahasiswa (Pasuma) UNISBA memiliki ciri-ciri vocal yang pas dengan \"Moses Bandwidth\". Seputar bulan Maret 2005, Moses Bandwidth sudah menyelesaikan suatu single pertamanya berjudul \"Selangkah Menuju Surga\" yang sistem recordingnya dikerjakan dengan cara profesional di MMS Studio, Indramayu.','Rock','facebook;','Jakarta',1089,'2017-09-02 18:28:55','2017-09-02 18:28:55'),(584,'The candle\'s','1504409966.jpg','Terbentuk pada tahun 2014\r\nBase studio musik 66\r\nKemayoran','Alternative Rock','facebook;','Jakarta',1078,'2017-09-02 19:39:26','2017-09-02 19:39:26'),(585,'The candle\'s','1504409976.jpg','Terbentuk pada tahun 2014\r\nBase studio musik 66\r\nKemayoran','Alternative Rock','facebook;','Jakarta',1078,'2017-09-02 19:39:36','2017-09-02 19:39:36'),(586,'Monster Pengerat Wortel','1504411164.jpg','Band dengan komposisi musik yang terbilang menentang arus, anti mainstream, dan segmented ini, sering di anggap sebagai penjelajah mesin waktu. \"mereka tidak terlahir di era ini\" celetukan yang sering terdengar.\r\nDeep, down, dan dirty yang menjadi benang merah atas landasan perpaduan antara blues era lama dan unsur dixie tanpa terompet, berhasil menghantarkan karya mereka mewarnai beberapa radio berkonteks indie di Eropa dan Amerika.\r\nSudut pandang lain dalam menyikapi kesedihan, kesendirian dan air mata, masih menjadi pokok utama dalam setiap garis lirik yang berserakan bernuansa kegelapan.','Others','facebook;instagram;','Surabaya',1091,'2017-09-02 19:59:24','2017-09-02 19:59:24'),(587,'The Wrench','1504411831.JPG','The Wrench was created in the late of 2013, starting as a dynamic duo, Priansya as the tempo keeper and the beat maker, and Dillon filling it with a rock- bluesy sounds. Thereafter, we decided to bring the groove as we asked Fajar to join us and we jammed together.\r\nWhen we work on a bluesy tones, we often took a bit of “Jimi Hendrix” style. And when we want to rock a bit out, we took the 60’s or 70’s rock ‘n’ roll kinda sounds, but then we decided to go both ways, and adding a little funk in our sound. Ours, and ours alone. As we’re still green in this kind of music, we got so much to do and a lot of things to explore. Well whatsoever, we love music, and we’ll always be.','Rock','facebook;','Jakarta',1094,'2017-09-02 20:10:31','2017-09-02 20:10:31'),(588,'A L I V E','1504412650.jpg','est 2009, formasi awal 6 orang..dan yg tersisa hanya 3 orang, memiliki pengalaman manggung dan punya lebih 10 track,  menjadi bagian event amild wanted 2010.','Pop','teman;','Jakarta',1036,'2017-09-02 20:24:10','2017-09-02 20:24:10'),(589,'Sinleto','1504413038.JPG','Sinleto telah merilis mini album yang berjudul \"SEROJA\" pada tanggal 1 januari 2017, dan berisikan 6 lagu (4 lagu mini album, 2 lagu bonus track)','Alternative Rock','instagram;poster;','Surabaya',1095,'2017-09-02 20:30:38','2017-09-02 20:30:38'),(590,'Ruang Kosong','1508562318.jpg','Kami terbentuk tahun oktober 2015 dengan formasi awal dicky, novan kemudian january 2016 enggar masuk mengisi plot bass disertai dengan ricard yang bergabung akhir agustus 2017 sebagai posisi drum. di bagian drum kami sudah 3 kali  berganti personil di sepanjang tahun 2016. hingga periode ini kami berkomitmen untuk selamanya berkarya. dari segi prestasi di tahun 2016 kami pernah juara 2 sebagai band favorit pada event ramadhan sensation di graha fairground surabaya, november 2016 sebagai partisipan untuk acara dan pemutaran film perdana di Tribute to oasis di M radio surabaya, july 2017 kami berkesempatan untuk live audition road to soundrenaline di pazkul sidoarjo dan di akhir agustus kami berpartisipasi di pemecahan rekor bersama 1015 musisi di kodam surabaya.','Alternative Rock','instagram;teman;','Surabaya',1083,'2017-09-02 20:41:28','2017-10-20 21:05:18'),(591,'Pronks','1504416074.jpg','Band Alternative sejak 2012. Terbentuk dan berdomisili di Malang. Merilis debut EP berjudul Lullabies For Insomnian di akhir 2015.','Alternative Rock','teman;','Surabaya',1059,'2017-09-02 21:21:14','2017-09-02 21:21:14'),(592,'MASTERPLAN BAND','1504416272.jpg','MASTERPLAN Band terbentuk 2 tahun yang lalu di kota Ciamis, Jawa Barat.\r\nMusik kami berasal dari berbeda-beda band dan berbeda-beda genre juga. \r\nAda yang senang Rock, Alternative rock, Japanese Rock, British, & Metal. Dan sekarang terbentuk dalam MASTERPLAN Band dengan berGenre musik Alternative Rock.\r\nMASTERPLAN biasa maen di gigs2 Pensi, Produk Event, Ulang tahun Kota, dll. Di sekitaran kota Ciamis, Tasikmalaya, Bandung dll.\r\nTerakhir kemarin kita masuk di ajang RISING STAR INDONESIA 2016 yang ditayangkan oleh RCTI.\r\nMASTERPLAN lolos audisi regional Bandung, lalu lolos di babak ROOM AUDITION (Audisi bertempat di studio RCTI, Kebon jeruk, jakarta. Lolos dan masuk ke tahap LIVE AUDITION, lolos lagi dan masuk ke tahap LIVE DUEL.\r\nDan MASTERPLAN masih berjalan sampai sekarang.','Alternative Rock','instagram;','Jakarta',953,'2017-09-02 21:24:32','2017-09-02 21:24:32'),(593,'4 Event','1504417619.jpg','Terbentuk tanggal 29 februari 2016, berawal dari grup jual beli gitar di facebook. Tanpa memandang umur, maupun yang lainnya. Karena keinginan kita semua sama, yaitu berkarya di dunia musik.','Rock','teman;','Surabaya',1007,'2017-09-02 21:46:59','2017-09-02 21:46:59'),(594,'MASTERPLAN BAND','1504417732.jpg','MASTERPLAN Band terbentuk 2 tahun yang lalu di kota Ciamis, Jawa barat.\r\nPersonil MASTERPLAN berasal dari berbeda-beda band & berbeda-beda genre pula, ada yang senang Rock, Alternative Rock, Japanese Rock, & British.\r\nMASTERPLAN biasa perform di gigs2 Pensi, Product Event, Ulang Tahun kota dll. Di sekitaran kota Ciamis, Tasikmalaya, Banjar, Bandung, dll.\r\nTerakhir kemarin MASTERPLAN mengikuti ajang RISING STAR INDONESIA season 2, yang ditayangkan oleh RCTI.\r\nKami mengikuti audisi regional Bandung.\r\nDari situ MASTERPLAN lolos ke babak ROOM AUDITION (Audisi bertempat di studio RCTI kebon jeruk, Jakarta). Alhamdulillah lolos dan masuk ke babak LIVE AUDITION, dari LIVE AUDITION alhamdulillah lolos. Sehingga masuk ke babak berikutnya yaitu LIVE DUEL.\r\nDan MASTERPLAN sekarang masih berjalan.','Alternative Rock','instagram;','Jakarta',953,'2017-09-02 21:48:52','2017-09-02 21:48:52'),(595,'Radio Story','1504422190.jpg','Radio Story adalah sebuah group/band yang terbentuk di akhir tahun 2014. Konsisten dengan mengusung sub-genre Melodic Punk/Alternative, Radio Story telah melahirkan sebuah mini album yang bertajuk \"Quaternion\".','Alternative Rock','facebook;instagram;','Surabaya',1020,'2017-09-02 23:03:10','2017-09-02 23:03:10'),(596,'Breaking the Brain','1504422596.jpg','Breaking the Brain terbentuk pada 19 Februari 2016\r\nPada awal terbentuk ada empat personil, pada akhir 2016 salah satu personil memutuskan keluar karena akan menikah.\r\nSampai saat ini, band ini beranggotakan 3 orang personil.\r\nAbdillah (Vokal,Bass)\r\nSurya (Gitar)\r\nDikin (Drum)\r\nBreaking the Brain bergenre Pop Punk\r\nInfluence : Blink 182, NTRL, Pee Wee Gaskins, Rocket Rockers\r\nPada bulan September 2017, kami mengeluarkan dua single baru, dan total ada 5 single yang sudah kami record\r\nKami sering ikut support acara band lokal di Surabaya dan sekitarnya (Regist)\r\nKami berharap bisa tampil di panggung panggung di seluruh Indonesia, menghibur banyak orang','Others','teman;','Surabaya',1072,'2017-09-02 23:09:56','2017-09-02 23:09:56'),(597,'The Paper Roll','1504426570.jpg','Awal anggota terbentuk hanya 2 orang teman yang sepemikiran ingin membuat sebuah mini album untuk di dengar orang-orang. Dan akhirnya terbentuk band yang kami namakan \"The Paper Roll\".\r\nPrestasi kami :\r\n1. Juara Pertama di pestival Magnify \"North Blash\", Tahun 2016.\r\n2. Juara Ke-3 di Pestival Magnify \"Rock Your Freedom\", Tahun 2017','Alternative Rock','facebook;instagram;','Medan',609,'2017-09-03 00:16:10','2017-09-03 00:16:10'),(598,'Hunter Band','1504429757.jpg','kami band indie surabaya\r\nterbentuk tahun 2007','Pop','facebook;instagram;teman;','Surabaya',1098,'2017-09-03 01:09:17','2017-09-03 01:09:17'),(599,'Bekstun','1504431676.jpg',': BEKSTUN Band Rock Asal Bandung yang terbentuk sejak tahun 2014 dengan formasi Bintang (gitar) Alvin (gitar/vocal) Dani (Bass) Raka (Drum). Genre Musik Bekstun adalah Rock dengan sedikit sentuhan Blues pada setiap lagu nya yang mempunyai Ciri khas tersendiri, saat ini Bekstun sedang sibuk menyiapkan EP (mini album) . Bekstun sering diundang/berkesempatan perform di Beberapa Event di Bandung musik dll dan pernah mendapatkan Sertifikat penghargaan Band dari event UNPAD Bandung . Pada tahun 2016 lalu BEKSTUN telah menyelesaikan projek 2 Single Perdananya. Di tahun 2017 ini Bekstun dan 2 band rock asal bandung juga diundang untuk bisa mengisi acara di Kota Purwakarta.','Rock','guitar_plus;','Jakarta',1109,'2017-09-03 01:41:16','2017-09-03 01:41:16'),(600,'Kayana Band','1504431790.jpg','Band ini berdiri pada tanggal 3 mei 2015 di kota pahlawan Surabaya. Event yang pernah kami ikuti yaitu festival W.R Soepratman Jazz Festival Kaza City Mall mendapatkan juara 1, dan Festival dies natalis 56 ITS mendapatkan juara 1. Kami berjumlah 6 personil yang terdiri dari Frisca (vocal), Davit (Drum), Danang (Guitar), Ochang (Guitar), Dimas (Bass), dan Radith (keyboard).','Jazz','instagram;','Surabaya',1108,'2017-09-03 01:43:10','2017-09-03 01:43:10'),(601,'Kayana Band','1504432102.jpg','Band ini berdiri pada tanggal 3 mei 2015 di kota pahlawan Surabaya. Event yang pernah kami ikuti yaitu festival W.R Soepratman Jazz Festival Kaza City Mall mendapatkan juara 1, dan Festival dies natalis 56 ITS mendapatkan juara 1. Kami berjumlah 6 personil yang terdiri dari Frisca (vocal), Davit (Drum), Danang (Guitar), Ochang (Guitar), Dimas (Bass), dan Radith (keyboard).','Jazz','instagram;','Surabaya',1108,'2017-09-03 01:48:22','2017-09-03 01:48:22'),(602,'Kayana Band','1504432116.jpg','Band ini berdiri pada tanggal 3 mei 2015 di kota pahlawan Surabaya. Event yang pernah kami ikuti yaitu festival W.R Soepratman Jazz Festival Kaza City Mall mendapatkan juara 1, dan Festival dies natalis 56 ITS mendapatkan juara 1. Kami berjumlah 6 personil yang terdiri dari Frisca (vocal), Davit (Drum), Danang (Guitar), Ochang (Guitar), Dimas (Bass), dan Radith (keyboard).','Jazz','instagram;','Surabaya',1108,'2017-09-03 01:48:36','2017-09-03 01:48:36'),(604,'Kayana Band','1504432161.jpg','Band ini berdiri pada tanggal 3 mei 2015 di kota pahlawan Surabaya. Event yang pernah kami ikuti yaitu festival W.R Soepratman Jazz Festival Kaza City Mall mendapatkan juara 1, dan Festival dies natalis 56 ITS mendapatkan juara 1. Kami berjumlah 6 personil yang terdiri dari Frisca (vocal), Davit (Drum), Danang (Guitar), Ochang (Guitar), Dimas (Bass), dan Radith (keyboard).','Jazz','instagram;','Surabaya',1108,'2017-09-03 01:49:21','2017-09-03 01:49:21'),(606,'San Reys','1504434848.jpg','San Reys ( dibaca s^n reys ) dibentuk pada tanggal 1 agustus 2016. Nama San Reys diambil dari Bahasa inggris “Sun Rays”, namun penulisannya di ubah kedalam bahasa Indonesia mengikuti Pelafalannya (Pronunciation).  Dengan visi dan misi yang sama dari empat personil yaitu Norman , Dimas, Rifky dan Okta. Dengan mengusung genre \"Alternative Rock\", mereka yakin bisa meramaikan musik di Indonesia terutama Palangkaraya tempat lahirnya band San Reys.\r\n\r\n Sejak mula terbentuknya San Reys, mereka selalu ikut berpartisipasi dalam acara-acara musik yang diadakan di kota asal mereka yaitu Palangka Raya. Mereka selalu turut ambil bagian di \r\ndalam event-event di kota tersebut.\r\nMulai dari Panggung Acara Festival Musik Hingga Panggung Acara Hiburan. \r\n\r\nUntuk acara Festival Musik, di Palangka Raya memang jarang sekali mengadakannya saat mula terbentuknya San Reys, sehingga San Reys hanya pernah mengikuti Festival Musik sebanyak dua kali sejak pertama kali terbentuk hingga saat ini. Prestasi yang pernah diraih San Reys dalam Festival Musik adalah menjadi \"juara satu\" dalam acara Musik Anak Jalanan yang diadakan oleh Polda Kalteng. \r\n\r\nBeda Halnya dengan Acara Panggung Hiburan, San Reys selalu ikut ambil bagian karena seringnya diadakan Acara Musik Panggung Hiburan ketimbang Festival Musik di kota mereka. Mulai dari Full band Hingga Akustik.\r\n\r\nUntuk Full Band, San Reys sering berpartisipasi dalam berbagai Event Kota dan Kegiatan yang diadakan oleh berbagai kalangan. Seperti hari perayaan, hari ulang tahun, pesta rakyat hingga acara musik indie lokal.\r\n\r\nKhusus untuk Akustik, San Reys saat ini mengikat kerjasama sebagai Home Band di Login Cafe setiap minggunya yang berada di Kota mereka.\r\n\r\nSan Reys juga sudah pernah dua kali mengikat Kontrak Kerjasama bersama Aquarius Boutique Hotel untuk tampil menjadi Home Bandnya di Lios Cafe ketika Bulan Ramadhan 2016 dan 2017.\r\n\r\ndemikianlah cerita dan prestasi singkat dari San Reys. Masih banyak cerita Perjalanan dari San Reys yang belum dibagikan, atas perhatiannya, San Reys ucapkan Terimakasih.','Alternative Rock','teman;','Surabaya',404,'2017-09-03 02:34:08','2017-09-03 02:34:08'),(607,'Kecikitty','1504435132.png','Finalis Soundsation region Jakarta Selatan, Kami juga sempat mengisi di acara Pensi di SMA Jakarta, Jakcloth Cirebon, Ulang tahun Kota Solo, Semarang Fair, dan masih banyak lainnya, dan salah satu prestasi bagi kami yaitu lahirnya album perdana kami yang bertajuk \"Hedonisme\".','Rock','instagram;','Jakarta',1105,'2017-09-03 02:38:52','2017-09-03 02:38:52'),(608,'MAUT','1504437495.jpg','MAUT adalahband bergenre \"Heavy Rock\" asal Jkarta yang dimotori oleh Martin dan Iqbal Aria pada akhir tahun 2015. Kemudian Martin mengajak Agil ikut dalam band dengan mengisi posisi sebagai bassist. Pada awal tahun 2016 MAUT telah merekam single perdana yang bertajuk \"Roda dan Kayu\"diikuti dengan beberapa kali manggung di acara-acara kampus dan gigs kecil. Pada awal tahun 2017 Martin mengundurkan diri dari MAUT, akhirnya Raveliza Ramadhan kami percaya untuk mengisi posisi sebagai drummer. Kini MAUT sedang menggarap album perdana yang akan dirilis pada tahun 2018 mendatang.','Rock','instagram;','Jakarta',800,'2017-09-03 03:18:15','2017-09-03 03:18:15'),(609,'Deaf Dog','1504439208.jpg','Berawal dari satu hobi yang sama. Kami, Antonius, Micho, Robby dan Yustino membuat band yang bernama Deaf Dog. Kami sudah memiliki beberapa lagu kami sendiri dan salah satunya adalah \"Dalam Gelap Bercerita\" yang dikemas dengan musik yang fresh, easy listening dan dapar dipertanggung jawabkan','Others','facebook;instagram;vipclub;guitar_plus;umi;lainnya;','Yogyakarta',1116,'2017-09-03 03:46:48','2017-09-03 03:46:48'),(610,'Mukalangka','1504439980.jpg','Band yang ingin karyanya disukai oleh banyak orang dan para pecinta musik khususnya.\r\nSering menjadi tribute Nirvana dan menjadi Guest Star dalam acara Indonesia Culture Expo 2016 di Shah Alam, Malaysia.','Alternative Rock','guitar_plus;','Jakarta',1039,'2017-09-03 03:59:40','2017-09-03 03:59:40'),(611,'escpd','1504442905.jpg','Escpd merupakan band yang berdiri pada akhir 2016 di Jakarta, Indonesia. Dikembangkan dari grup band sebelumnya yang terdiri dari Riza Bachri (Vokal, Gitar), Satria Bimasakti (Bass, Vokal), dan Thareq Satria (Drum, Vokal). Escpd menambah satu personil yaitu Arfan Bachri (Gitar, Vokal) untuk memperkuat dan menjadikan escpd sebagai band dengan personil yang beranggotakan 4 orang.\r\n\r\nA Fool\'s Foolish Question menjadi single pertama yang akan dirilis di semua platform musik digital (spotify, apple music, dll) pada 17 Agustus 2017. Konflik perbedaan persepsi antara benar dan salah menjadi tema yang diangkat pada lagu ini. Proses produksi lagu ini memakan waktu kurang lebih 6 bulan, diawali dengan proses take rekaman di ALS Studio hingga proses mastering yang dilakukan di Sage Studio, Amerika Serikat. Dengan proses produksi yang sedemikian rupa, berharap single ini akan ikut meramaikan industri musik di Indonesia.\r\n\r\nSetelah merilis lagu ini, ditargetkan Escpd akan merilis EP pertamanya pada tahun 2018 nanti dengan materi yang sedang digarap.','Rock','facebook;','Jakarta',1122,'2017-09-03 04:48:25','2017-09-03 04:48:25'),(612,'Shroomeater','1504445201.jpg','shroom eater band yang mengambil genre rock dengan sub genre (stoner, rock n roll ) Band refrensi: black sabbath, the sword, earthless, wolfmother, clutch, graveyard, dan masih banyak lagi. Personel : raksa (tendensi bunuh diri) sebagai vokalis, armando sebagai guitar lead and melody, yongki sebagai drummer, dan Bhamby sebagai bassist. Berdiri sejak 2014 yang sebelumnya beraliran thrash metal lalu berganti menjadi genre rock dengan beberapa sub genre yg diambil pada awal 2015.','Rock','poster;','Jakarta',1026,'2017-09-03 05:26:41','2017-09-03 05:26:41'),(613,'D\'ROYALS','1504445967.jpg','DROYALS TERBENTUK PADA JANUARI 2017\r\nPRESTASI:\r\n1. PERINGKAT 1 LAGU INDIE DI RADIO CASSANOVA BALI (PROGRAM INDIE COMUNITY)','Rock','facebook;instagram;teman;','Yogyakarta',84,'2017-09-03 05:39:27','2017-09-03 05:39:27'),(614,'The Godspeed','1508562420.jpg','Berawal dari sejarahnya, The Godspeed merupakan band\r\nasal Yogyakarta terbentuk pada bulan Maret 2015 dan bertepatan\r\nketika nama The Godspeed itu sendiri diambil. Nama Godspeed\r\ndiambil dari kata pada sebuah plakat peluncuran Apollo 11 ,dan\r\ndiambil dari kata kata yang di ucapkan para pelaut pada pelaut lain\r\nnya yang akan pergi berlayar \"semoga saudara berhasil\" atau seperti\r\nungkapan makna dari kata good luck.\r\nBand ini terdiri dari Abi Zulfakhry Rosadi (Vokal), Ferdy\r\nRamadhan (Guitar / BackingVokal), Fawwaz Athifi (Guitar),\r\nMertiAfridin / Mree (Bass), Muhammad Kemal Akbar (drum). Secara\r\ngenre Godspeed mengusung Rock dengan sentuhan blues. Secara\r\nkeseluruhan Band-band yang menjadi influence kami yaitu The\r\nBlack Keys, Led Zeppelin, Nirvana, Artic Monkeys.\r\nSingle pertama kami telah kami rilis dan bisa didengarkan\r\noleh khalayak ramai lewat soundcloud melalui akun The\r\nGodspeedINA yang berjudul “Under Control”. Dan dalam waktu dekat\r\nini, single pertama kami tersebut akan segera diperluas melalui akun\r\nSpotify dan media yang lainnya dan berharap musik yang kami\r\nbawakan bisa di apresiasi oleh semua orang.','Rock','guitar_plus;','Yogyakarta',1041,'2017-09-03 05:53:22','2017-10-20 21:07:00'),(615,'EVVI','1504446842.jpg','EVVI adalah sebuah grup band beraliran emotional metalcore asal Surabaya yang dibentuk pada tanggal 13 Oktober 2016. Beranggotakan 4 orang pada awal berdiri yang terdiri dari Wino (Drumer), Uyab (bassis), Tanju (gitaris), Nanda (vokalis). Namun saat ini band ini memiliki formasi baru menjadi berlima, dengan menambah gitaris satu lagi bernama Ervan sebagai  gitaris.\r\n\r\nEVVI yang berdiri tahun 2016 dan berdomisili di Surabaya ini terbentuk dari kegelisahan Wino dan Tanju yang baru saja mengundurkan diri dari band-nya yang dulu beraliran rock, karena dirasa kurang cocok. Lalu mereka mengajak Nanda dan Bayu untuk bergabung dalam band-nya. Mereka memadukan antara genre metalcore dan emotional hardcore, lalu mereka berani menyebutnya emotional metalcore untuk menunjukkan jati diri mereka.\r\n\r\nEVVI telah menghasilkan single pertama “The Canary”, yang menceritakan kegelisahan seseorang dalam hidupnya yang mencari sebuah kebebasan, yang mereka gambarkan dengan seekor burung Kenari.\r\n\r\nDan untuk kedepannya, Band yang kini beranggotakan 5 orang ini masih menggarap beberapa single, maka ditunggu saja pergerakan-nya untuk siap mewarnai skena underground tanah air.​\r\n\r\nPernah berpartisipasi dalam event Indie Clothing Expo 2017','Others','teman;','Surabaya',1104,'2017-09-03 05:54:02','2017-09-03 05:54:02'),(616,'FAYRUSH','1504446953.jpg','fayrush adalah band pop kreatif asal yogyakarta, berawal dari beberapa band yang berbeda sering bertemu di panggung kemudian kita mencoba sama sama menyalurkan hobi dan kreatifitas membuat karya karya musik seperti yang saat ini.\r\nsemoga bisa mendapat apresiasi dari teman teman pendengar semuanya.','Pop','guitar_plus;','Yogyakarta',526,'2017-09-03 05:55:53','2017-09-03 05:55:53'),(617,'Brawijaya','1504448911.jpg','Band ini terbentuk atas dasar keinginan para personel untuk mencapai masa depan yang lebih baik melalui bermusik. Dengan menggabungkan personel personel terbaik di kota Wonogiri yang telah beberapa kali memenangkan festival tingkat nasional, Brawijaya Band berharap dapat bergabung di major label untuk lebih luas mengembangkan musikalitas, dan juga turut memajukan dunia musik nasional dengan kualitas-kualitas yang kami miliki. Band ini merupakan harapan seluruh personel untuk menggapai kesuksesan dan salah satu cara untuk berkontribusi memajukan musik Indonesia yang berkualitas tinggi. Brawijaya Band berharap dengan mengikuti Levi Band Hunt, harapan kami dapat terwujud untuk bergabung dengan major label dan untuk menunjukkan kualitas band kami didepan dewan juri dan masyarakat luas.','Pop','teman;','Jakarta',1114,'2017-09-03 06:28:31','2017-09-03 06:28:31'),(618,'GURAU SENJA','1504450676.jpg','awal terbentuknya \"GURAU SENJA\" pada tanggal 19 agustus 2016 terbentuknya saatkita lagi kumpul kumpul sore hari dan ada sebuah ide untuk membentuk sebuah band yang bernuansa folk pop, kita baru manggung di cafe cafe acara pensi sekolah dan acara kampus, bertepatan pada 1 tahunnya band kami berdiri. kami merilis sebuah single baru yang berjudul \"BATAS MIMPI\" sekian terimakasih mari membumi #marimembumi','Folk','facebook;','Jakarta',770,'2017-09-03 06:57:56','2017-09-03 06:57:56'),(619,'Garside','1504450928.jpg','Garside merupakan band indie bergenre dance-rock yang berasal dari Medan, Indonesia. Band ini terbentuk pada tgl 1 Maret 2017. Beranggotakan 5 orang: Ellen pada vocal, Jeje dan Afif pada gitar, Sam pada bass, dan Arep di drum. Lagu pertama Garside yang berjudul \"Pretend\" di rilis pada tgl 14 Agustus 2017. Garside sedang mempersiapkan untuk rilis lagu kedua dalam waktu dekat ini. Soundcloud: soundcloud.com/garsideofficial IG: @garsideofficial Email: garsideofficial@gmail.com','Others','teman;','Medan',896,'2017-09-03 07:02:08','2017-09-03 07:02:08'),(620,'Evalin','1504451115.jpg','Evalin adalah band beraliran Pop asal Yogyakarta yang beranggotakan Sukma (Vokal), Anton (Bass), Pandu dan Beben (Gitar), dan dibantu Fakhriyan (Additional Drum) dan Dito (Additional Keyboard). Evalin telah melepas single pertamanya yang berjudul \"Masih\" pada tanggal 17 Agustus 2017','Pop','instagram;poster;teman;','Yogyakarta',606,'2017-09-03 07:05:15','2017-09-03 07:05:15'),(621,'Tacenda','1504451420.jpg','Band yang berasal dari bogor ini terdiri dari Ayas sebagai vokalis, Ario bimo sebagai guitar 1, Abil sebagai lead guitar, dan Rizal sebagai bassist. Band ini mengusung aliran pop dengan sedikit sentuhan aestetic dan britpop music. Berbagai event yang sudah pernah diikuti oleh band ini antara lain Gebyar Nusantara IPB 2016 sebagai pencipta Jingle, Gues star di Launching IPB Bookstore 2017, dan Performer di Jungle land Indiependence 2017','Pop','instagram;','Jakarta',699,'2017-09-03 07:10:20','2017-09-03 07:10:20'),(622,'Tacenda','1504451444.jpg','Band yang berasal dari bogor ini terdiri dari Ayas sebagai vokalis, Ario bimo sebagai guitar 1, Abil sebagai lead guitar, dan Rizal sebagai bassist. Band ini mengusung aliran pop dengan sedikit sentuhan aestetic dan britpop music. Berbagai event yang sudah pernah diikuti oleh band ini antara lain Gebyar Nusantara IPB 2016 sebagai pencipta Jingle, Gues star di Launching IPB Bookstore 2017, dan Performer di Jungle land Indiependence 2017','Pop','instagram;','Jakarta',699,'2017-09-03 07:10:44','2017-09-03 07:10:44'),(623,'Tacenda','1504451447.jpg','Band yang berasal dari bogor ini terdiri dari Ayas sebagai vokalis, Ario bimo sebagai guitar 1, Abil sebagai lead guitar, dan Rizal sebagai bassist. Band ini mengusung aliran pop dengan sedikit sentuhan aestetic dan britpop music. Berbagai event yang sudah pernah diikuti oleh band ini antara lain Gebyar Nusantara IPB 2016 sebagai pencipta Jingle, Gues star di Launching IPB Bookstore 2017, dan Performer di Jungle land Indiependence 2017','Pop','instagram;','Jakarta',699,'2017-09-03 07:10:47','2017-09-03 07:10:47'),(624,'Tacenda','1504451457.jpg','Band yang berasal dari bogor ini terdiri dari Ayas sebagai vokalis, Ario bimo sebagai guitar 1, Abil sebagai lead guitar, dan Rizal sebagai bassist. Band ini mengusung aliran pop dengan sedikit sentuhan aestetic dan britpop music. Berbagai event yang sudah pernah diikuti oleh band ini antara lain Gebyar Nusantara IPB 2016 sebagai pencipta Jingle, Gues star di Launching IPB Bookstore 2017, dan Performer di Jungle land Indiependence 2017','Pop','instagram;','Jakarta',699,'2017-09-03 07:10:57','2017-09-03 07:10:57'),(625,'Tacenda','1504451467.jpg','Band yang berasal dari bogor ini terdiri dari Ayas sebagai vokalis, Ario bimo sebagai guitar 1, Abil sebagai lead guitar, dan Rizal sebagai bassist. Band ini mengusung aliran pop dengan sedikit sentuhan aestetic dan britpop music. Berbagai event yang sudah pernah diikuti oleh band ini antara lain Gebyar Nusantara IPB 2016 sebagai pencipta Jingle, Gues star di Launching IPB Bookstore 2017, dan Performer di Jungle land Indiependence 2017','Pop','instagram;','Jakarta',699,'2017-09-03 07:11:07','2017-09-03 07:11:07'),(626,'RABR','1504452765.jpg','kami terbentuk pada tahun 2014. pada awalnya kami merupakan band tribute The Beatles dan memiliki nama The Rubber\'69 yang kami adaptasi dari judul album The Beatles yaitu Rubber Soul. kemudian di awal tahun 2017 kami memutuskan untuk menulis lagu kami sendiri dan merubah nama band kami menjadi RABR yang merupakan singkatan masing-masing personil (Rama,Ammar,Bismo, dan Refki).\r\n\r\nBerikut adalah prestasi dan jam terbang kami:\r\n1. Tampil di acara Closing Quatrolympic dan Qbike, yang persembahkan oleh SMAI Al-Azhar 04 Kemang Pratama, Bekasi.\r\n2. Tampil di acara Re-Aggression #1, yang dipersembahkan oleh Basilisk dan Indiesline\r\n3. Tampil di beberapa acara Tribute to The Beatles di Bekasi dan Jakarta\r\n4. Tampil di acara KitaKustik dan Musik Teras Atas, yang diadakan oleh yayasan musik KITA ANAK NEGERI.\r\n5. Tampil di acara Friday Madness, di Univ. Paramadina\r\n6. Tampil di acara Astro, yang di persembahkan oleh SMAN 8 Bekasi\r\n7. Tampil di Jakarta Garden City, Cakung','Others','facebook;','Jakarta',1128,'2017-09-03 07:32:45','2017-09-03 07:32:45'),(627,'MRBRANDDY','1504456681.jpg','Tour with LA Concert 12 kota di Jatim, 7 kota with Telkom Flexy, Kompas TV, Ultah SBO TV, Juara 2 Dahsyat RCTI, Dahsyat XL, Opening Marvel, Drive, Kotak band.','Pop','instagram;','Surabaya',1106,'2017-09-03 08:38:01','2017-09-03 08:38:01'),(628,'Me and My Foodtruck','1504458985.jpg','We began as 4 boys in South Tangerang with nothing better to do and one thing in mind: making music. We started off playing regularly at our highschool, until we thought about getting things serious.\r\nWe took a look at ourselves and found what we all felt collectively about music, we appreciate most by its diversity and it was what led us to the tunes we have now.\r\nWe play different genres. With this in mind the name shortly came after. \"Music is a lot like food, it comes in different tastes and colours.\" And seeing how we play different genres we call ourselves: Me and My Foodtruck.\r\n\r\n-Achievement-\r\n\r\nPerforming on stage, chronologically:\r\n- PL Fair Fest by SMA Pangudi Luhur, Jakarta. (2014)\r\n- Festival Bazaar Ancol, Jakarta. (2014)\r\n- Beevolution Cup by Binus School Serpong, South Tangerang. (2015, 2016)\r\n- Rock n’ Roll Night by Ravers Entertainment, South Tangerang. (2015)\r\n- Bynamic Fest by Binus School Serpong, South Tangerang. (2015, 2017)\r\n- Sky Avenue by SMA Labschool Kebayoran, Jakarta. (2015)\r\n- Dynamite Vancofest by Sekolah Tunas Indonesia, South Tangerang. (2015)\r\n- Dogchella Fest by SMA Garuda Cendekia, South Tangerang. (2015)\r\n- Konser 1000 Band by Pekan Raya Indonesia, ICE BSD. (2016)\r\n- Econofest by ESB FEB Universitas Gadjah Mada, Jogjakarta. (2017)\r\n- A number of private gig.\r\n\r\nMedia who supported us!\r\n-Gadis Magazine edisi 26, 10-23 October 2015. \r\n-Tangsel Pos, April 12th, 2015.','Pop','instagram;poster;teman;','Yogyakarta',1137,'2017-09-03 09:16:25','2017-09-03 09:16:25'),(629,'Good Muzzle Love Summer','1504459057.jpg','Good Muzzle Love Summer adalah band beraliran Rock (spesifik: Pop Punk) dari Jakarta.\r\n\r\nDidasari oleh passion dan motivasi yang sama di dunia Musik, Gilang, Jonny, dan Jowel, yang \r\npada awalnya mempunyai band masing-masing, berkomitmen untuk \r\nmembentuk band ini di awal tahun 2017, dengan musik yang fresh, dan dengan tujuan menyegarkan telinga pendengar.\r\n\r\nGood Muzzle Love Summer pun merekrut additional drummer sebagai pelengkap ketika perform.','Rock','facebook;instagram;','Jakarta',1131,'2017-09-03 09:17:37','2017-09-03 09:17:37'),(630,'RARE4','1504460404.jpg','RARE4 terbentuk pada tanggal 25 Oktober 2015, pada saat itu kami diajak kepada teman kami untuk mengisi acara Sumpah Pemuda, dengan semangat yang tinggi kami membentuk sebuah band bernama RARE4 yang diambil dari nama-nama personil kami pada saat itu. RARE4 sendiri mengusung genre Pop Alternative karena dianggap yang paling cocok dengan setiap karakter personilnya.','Pop','instagram;','Jakarta',1140,'2017-09-03 09:40:04','2017-09-03 09:40:04'),(631,'Arch Project','1504493851.png','Hardrock Band based in Yogyakarta.','Rock','instagram;guitar_plus;maliq;poster;teman;','Yogyakarta',343,'2017-09-03 18:57:31','2017-09-03 18:57:31'),(632,'Black Flag Army','1504498088.jpg','musik kami terinspirasi dari musik rock era 80 dan 90, seperti guns n roses, metallica, blue oyster cult dll,dan kami yakin band ini akan menjadi trandseter dan sukses jika mendapat record deal dari universal music indonesia','Alternative Rock','facebook;','Surabaya',603,'2017-09-03 20:08:08','2017-09-03 20:08:08'),(633,'Tetra Band','1504502264.jpg','Official Tetra Band Based in Ponorogo City, East Java, Indonesia Est.2015. Membangkitkan kembali jiwa rock di kalangan anak muda, Tetra Band hadir dengan genre bernuansa Rock Modern & Rock Alternatif. \"KITA\" merupakan single & video klip pertama yang bercerita tentang arti persahabatan pada masa remaja, di dalam persahabatan tersebut pasti ada perbedaan-perbedaan yang melengkapi persahabatan tersebut. Didalam perbedaan tersebut kita bisa menyatukan dan membuat persamaan dalam persahabatan. Akhirnya terciptalah \"KITA\"\r\n\r\nPrestasi:\r\n1. Juara 1 Festival Honda MPM Motor 2016 \r\n2. Juara 2 BRI Festival 2016\r\n3. Juara 3 Grebeg Suro Rock Festival','Alternative Rock','guitar_plus;','Yogyakarta',1019,'2017-09-03 21:17:44','2017-09-03 21:17:44'),(634,'Every Brains','1504502763.jpg','Every Brains, berdiri sejak tahun 2010. Berawal di massa-massa SMA kami, saat musik elektrik sedang bergejolak tapi kami menolak untuk terhanyut dalam dentuman beat yang terdengar dimana-mana. Kami memilih untuk menikmati kerasnya musik ACDC, The Doors, The Sigit dan musik-musik yang sebagian besar adalah warisan dari ayah-ayah kami. \r\n\r\nGigs pertama kami di imax kemang pada tahun 2010, tercengang saat melihat crowd berlari kearah kami ketika kami membawakan T.N.T dari ACDC. Saat itulah kami meyakini bahwa ROCK adalah musik & lifestyle kami. \r\n\r\nSempat vakum lama karena kebutuhan hidup yang memaksa kami untuk menjauh dari mimpi dan setelah beberapa kali mencari-cari drumer pengganti teman kami yang memutuskan untuk berpisah, akhirnya Togu hadir dengan pukulan blues nya yang membangunkan lagi hasrat kami untuk bermimpi lebih jauh. Kini kami hanya ingin mimpi kami terdengar dan berharap dapat membangkitkan kembali kejayaan musik rock.','Rock','instagram;','Jakarta',1151,'2017-09-03 21:26:03','2017-09-03 21:26:03'),(635,'CUBASE','1504504231.jpg','cubase semi finalist asian beat 2015 surabaya regional\r\nmanggung cafe to cafe\r\nband audisi djarum supermusic','Alternative Rock','poster;teman;','Surabaya',181,'2017-09-03 21:50:31','2017-09-03 21:50:31'),(636,'Jamuju','1504504391.jpg','Berawal dari akhir tahun 2015, Risky memiliki ide untuk membentuk sebuah band. Lalu ia mengajak Fahmi untuk mengisi posisi drum. Sampai akhirnya mereka berdua mencoba untuk membuat beberapa lagu. lalu mereka bertemu dengan Yusuf Bagus untuk mengisi posisi vokal sekaligus penulis lirik.\r\n\r\n    Seiring berjalannya waktu, Risky mengajak Dimaz untuk mengisi posisi bass. Dan akhirnya setelah personil lengkap, terlahirlah sebuah band bernama Jamuju. Dan meraka memulai untuk membuat beberapa demo DIY dengan serius.\r\n\r\n    Lalu pada awal tahun 2017 Yusuf Bagus memutuskan untuk hengkang. Kemudian, pada pertengahan tahun 2017, Risky mengajak Afrian Arif untuk menggantikan posisi Yusuf Bagus sebagai vokalis.\r\n\r\n    Untuk prestasi, hingga saat ini Jamuju belum pernah mendapatkan satupun prestasi. Ya mungkin jika Jamuju dapat memenangkan Levi\'s Band Hunt ini, itu menjadi prestasi pertama mereka.','Others','guitar_plus;','Jakarta',616,'2017-09-03 21:53:11','2017-09-03 21:53:11'),(637,'ROMANTICK','1508562301.jpg','Berangkat dari sebuah persahabatan yang lama, walaupun kami pribadi yang berbeda-beda, tetapi kami selalu menerima perbedaan itu untuk bersatu.\r\n\"SATU NAMA, SATU MIMPI, DIRAIH BERSAMA DAN UNTUK BERSAMA\"\r\nWe Are ROMANTICK!\r\nSweet Rock!\r\n\r\nPrestasi :\r\n- Juara 1 \"Rock Fest Kediri Jatim 2011\"\r\n- Finalis 3 besar Band \"Digital Icon with RCM Jakarta 2014\"\r\n- 10 besar Kompilasi Album Alfa Record \"Project Alfa 2015\"','Alternative Rock','guitar_plus;','Yogyakarta',1021,'2017-09-03 22:13:16','2017-10-20 21:05:01'),(638,'Alkemirasa','1504508425.png','Alkemirasa terbentuk tahun 2016 yang beranggotakan 4 personil yang berasal dari Jakarta. Kami merupakan band yang mengawalinya dengan merilis 3 lagu yang sudah ada di soundcloud kami.','Alternative Rock','instagram;','Jakarta',1141,'2017-09-03 23:00:25','2017-09-03 23:00:25'),(639,'Nokta','1504513632.jpg','Terebntuk pada 12 November 2012\r\nsingle pertama \"Andai Saja\"','Pop','instagram;poster;teman;lainnya;','Surabaya',1165,'2017-09-04 00:27:12','2017-09-04 00:27:12'),(640,'pride','1504514913.JPG','band yang terbentuk 2011 ini terus berkarya dengan membuat beberapa lagu yang terus di rekam,dan kali ini mereka mengikuti festival levi\'s','Alternative Rock','facebook;','Jakarta',1155,'2017-09-04 00:48:33','2017-09-04 00:48:33'),(641,'KATFIS','1504516329.jpg','KATFIS was formed on March 2011 at one of the blues music festival in Jakarta, when at that time each of us performed at the festival in our respective groups. It was born from the inspiration of Babet and Efril who have been passionate on the local independent music scene in Jakarta. We decided to create a duo group comprised of guitar and drums to explore music without boundaries. An exploration of blues and rock music expressed without any restrictions and formalities. We often enter the studio and \"boom!\" our works are written with flow and dynamic. We have similar taste, vision and mission to play music that builds our strong characters to stay active on various music events both locally and internationally. In the beginning we were both quite busy with other music groups making Katfis started to be active by the end of 2012. We are releasing a mini album by the end of the year and compact tour gigs are our plans. Realizing changes in the music industry are happening frequently, we believe we can contribute to this trend.\r\n\r\nWe called it Katfis (was \"The Deadcatfish) for the name reflects the other sides of our lives. It serves as a media to express our desires and unique ideas by implementing them into music. To allure and simplify the name of the band, without diminishing the essence of its philosophy, we cut off the name into KATFIS We obtain the name from the philosophy of the catfish itself that has the advantage to survive very nimbly in a difficult terrain. Moreover, we amazed that catfish has an extra respiratory, that is called \"arborecent organ\", which fully folds, just like our band that always has extra ideas to express ourself in a unique way.','Rock','facebook;instagram;guitar_plus;','Jakarta',1166,'2017-09-04 01:12:09','2017-09-04 01:12:09'),(642,'RPlay Band','1504518436.JPG','Band kami terbentuk 7 Juli 2011, RPlay adalah singkatan dari Romeo Play sosok Romeo bagi kami adalah tipe Lelaki yang setia, disini kami melambangkan arti setia berarti konsisten berkarya di jalur musik. Kami jarang mengikuti kompetisi band karena kami lebih fokus berkarya di jalur indie, hanya ini saja yang bisa kami jelaskan, terima kasih','Blues','facebook;instagram;teman;','Yogyakarta',846,'2017-09-04 01:47:16','2017-09-04 01:47:16'),(643,'O.L.D','1504520444.jpg','O.L.D band terbentuk pada tahun 2010 dikota kecil Kab.Tanah Bumbu Kalimantan Selatan dengan beranggotakan 5 personil yakni Matt Rock(Vocalis), Ayoy(Gitaris), Uyo(Bassist), Azis(Keyboardist) dan Abee(Drummer)\r\nBand ini dulunya bernama Diamond Impact namun pada tahun 2017 ini kami melakukan perubahan nama menjadi O.L.D.\r\nO.L.D band sudah sering meraih juara pada ajang2 festival band dan band competition diKalimantan. Khususnya pada tahun 2016 kemarin O.L.D berhasil meraih Best Runner Up Tingkat Provinsi Se-Indonesia BMF 2016 dan masuk 24 Besar Semifinalis BMF 2016 Tingkat Nasional diJakarta.\r\nO.L.D band ini mengusung konsistensi dijalur musik cadas yaitu Rock dan Progressive Metal dengan ber\'influenze pada musik DGM,Dream Theater, Thirty Second To Mars dan One OK Rock.','Rock','instagram;teman;lainnya;','Yogyakarta',1028,'2017-09-04 02:20:44','2017-09-04 02:20:44'),(644,'MARVEEN & THE WHITE ANGEL','1504524626.jpg','Band Pembuka Armada, Republik dan Virgoun','Funk','facebook;lainnya;','Surabaya',1110,'2017-09-04 03:30:26','2017-09-04 03:30:26'),(645,'Fornication','1504524646.jpg','Disudut barat kota Yogyakarta pada penghujung akhir tahun 2015 termuntahkan sebuah band yang beraliran Deathcore. Fornication, yang berideologi ingin mengubah skema permusikan Jogja dengan dentuman roda gila yang diiringi raungan dan geraman bertubi tubi bersama melodis gitar yang memperkosa telinga para pendengar, yang sebagian besar dogma orang awam musik undergrond adalah musik teriak-teriak tidak jelas, tidak dapat dinikmati atau didengar, sehingga mereka mengubah anggapan itu dengan mengejakulasikan musik-musik sidestream di Nusatara ini, agar industri musik musik lokal khususnya Underground bisa lebih terdengar kembali. Demo lagu mereka pada tanggal 4 Februari 2016 yang ditangani oleh Flazh Records. Berjudul “The Fallen King Is Rising” resmi keluar di Reverbnation, SoundCloud dan Bandcamp pada tanggal 26 Februari 2016.','Others','facebook;instagram;','Yogyakarta',1153,'2017-09-04 03:30:46','2017-09-04 03:30:46'),(646,'Black Revolver','1504530155.jpg','Black Revolver, mengusung genre rock yang banyak mengdaptasi musik vintage era 60an-70an. Pada dasarnya Black Revolver terinfluence oleh budaya musik rock n roll dan budaya hippies di era tersebut. Alunan melodi ala psychedelic rock dan blues adalah ciri khas Black Revolver, serta perpaduan chord sederhana dan hentakan riff ala heavy rock sebagai senjata untuk menggetarkan telinga penikmat musik rock. Seperti namanya, karya-karya Black Revolver dibuat dengan menitik beratkan pada power yang mematikan namun tanpa mengurangi sudut pandang estetikanya. Saat ini Black Revolver sudah merilis 3 single dan rencananya bulan september 2017 akan merilis debut album mereka.\r\nBlack Revolver juga pernah mengikuti festival Rock yang diadakan oleh Soul Kitchen Rock Festival pada tahun 2014 dan berkat semangat dan kerja keras teman - teman band, Black Revolver mendapatkan juara 1 pada Soul Kitchen Rock Festival tersebut.','Rock','facebook;instagram;informasi_toko;umi;teman;lainnya;','Jakarta',1064,'2017-09-04 05:02:35','2017-09-04 05:02:35'),(647,'Tarian Dian','1504531655.jpg','Ya cita-cita doang siiih','Jazz','instagram;','Jakarta',4,'2017-09-04 05:27:35','2017-09-04 05:27:35'),(648,'No Deadline','1504532203.jpg','NO DEADLINE [CERITA & PERJALANANNYA]\r\nNo Deadline adalah sebuah band yang berasal dari Pasuruan, Indonesia, pertama kali dibentuk pada tanggal 10 November 2009. Dengan mengusung aliran Pop/Rock Alternative, No Deadline berkeinginan untuk menjadi band besar yang musiknya dapat dinikmati oleh semua orang dari kalangan apapun dan dikenang selamanya oleh semua orang.\r\nAwal terbentuknya band ini adalah ketika kami para personel masih bersekolah di SMP yang sama di Bangil dan berada dalam ekstrakurikuler yang sama pula yakni ekskul Musik. Ketika jadwal Pensi tiba, kami diarahkan untuk membentuk sebuah Band agar bisa tampil dan voilaaa.... terbentuklah No Deadline yang personelnya masih sama seperti saat ini yakni Yayan (Vokal), Nur (Bass), Yuan (Drum), Cholis (Gitar) dan terakhir ada Alo (Gitar) yang akhirnya digantikan oleh Decka (Gitar).\r\nKami merencanakan dengan serius untuk berkomitmen berkarir di bidang musik sejak lulus SMP. Seiring berjalannya waktu kami telah memiliki belasan materi yang siap untuk direkam secara profesional, akan tetapi kami belum dapat merealisasikannya untuk saat ini karena terhalang oleh keterbatasan dana dan kesibukan personelnya.\r\nDengan adanya Event Levi’s Band Hunt ini memberikan secercah harapan pada kami untuk dapat membuat impian kami menjadi kenyataan dan sukses. Kami sangat berharap untuk memenangkan event ini dan akan mengupayakan semua yang kami miliki untuk memenangkannya. \r\nSekian secuil kisah dari No Deadline. Terima Kasih.','Pop','poster;teman;','Surabaya',1096,'2017-09-04 05:36:43','2017-09-04 05:36:43'),(649,'Fly To The Moon','1508561916.jpg','Guesstar @DN SMAN 1 Kertosono 51\r\nGuesstar @DN Stie Nganjuk FAK. Ekonomi\r\nKediri Clothing fest Participants\r\nProjam BMX comp. Kediri 2016\r\nGuesstar @17an kertosono','Alternative Rock','facebook;instagram;guitar_plus;teman;','Surabaya',1135,'2017-09-04 05:40:02','2017-10-20 20:58:36'),(650,'Meet oN Sunday','1504532460.jpg','Kita band berasal dari kota Medan... Kita menamai band ini meet oN Sunday karena awal mula kita jumpa dihari minggu dan sebelumnya antara kita pernah menjadi GROUP...prestasi kita pernah menjuarai festival musik karya cipta di RRI dan menjadi juara 2 festival rock di Medan...','Pop','teman;','Medan',1174,'2017-09-04 05:41:00','2017-09-04 05:41:00'),(651,'Meet oN Sunday','1504532483.jpg','Kita band berasal dari kota Medan... Kita menamai band ini meet oN Sunday karena awal mula kita jumpa dihari minggu dan sebelumnya antara kita pernah menjadi GROUP...prestasi kita pernah menjuarai festival musik karya cipta di RRI dan menjadi juara 2 festival rock di Medan...','Pop','teman;','Medan',1174,'2017-09-04 05:41:23','2017-09-04 05:41:23'),(652,'Meet oN Sunday','1504532657.jpg','Kita band berasal dari kota Medan... Kita menamai band ini meet oN Sunday karena awal mula kita jumpa dihari minggu dan sebelumnya antara kita pernah menjadi GROUP...prestasi kita pernah menjuarai festival musik karya cipta di RRI dan menjadi juara 2 festival rock di Medan...','Pop','teman;','Medan',1174,'2017-09-04 05:44:17','2017-09-04 05:44:17'),(653,'Meet oN Sunday','1504532744.jpg','Kita band berasal dari kota Medan... Kita menamai band ini meet oN Sunday karena awal mula kita jumpa dihari minggu dan sebelumnya antara kita pernah menjadi GROUP...prestasi kita pernah menjuarai festival musik karya cipta di RRI dan menjadi juara 2 festival rock di Medan...','Pop','teman;','Medan',1174,'2017-09-04 05:45:44','2017-09-04 05:45:44'),(654,'Meet oN Sunday','1504532807.jpg','Kita band berasal dari kota Medan... Kita menamai band ini meet oN Sunday karena awal mula kita jumpa dihari minggu dan sebelumnya antara kita pernah menjadi GROUP...prestasi kita pernah menjuarai festival musik karya cipta di RRI dan menjadi juara 2 festival rock di Medan...','Pop','teman;','Medan',1174,'2017-09-04 05:46:47','2017-09-04 05:46:47'),(655,'The B.O.N.A','1504534000.jpg','The B.O.N.A (Between Old and New Alternative) band ini terbentuk pada 5 Januari 2013 dengan personil awal Mamen (Guitar), Ivan (Guitar), Putra (Vocal), Pety (Vocal), Imam (Bass) dengan mengusung genre Rock Old School, formasi ini berhasil mengeluarkan single \"Temani Aku\" seiring berjalannya waktu kami harus mengganti personil dan akhirnya menjadi Mamen (Guitar), Imam (Bass), Pety (Vocal), Ical (Vocal), Aldino (Guitar), Fajar (Drum), formasi kedua ini menghasilkan single \"What Should I Do\" dan mendaur ulang single pertama kamu \"Temani Aku\", formasi ini mengalami masalah dengan kesibukan masing-masing dan akhirnya kami terpaksa mengganti personil lagi menjadi Mamen (Guitar), Imam (Bass), Jack (Vocal dan Guitar), Nay (Drum) formasi ini berhasil mengeluarkan single \"Menunggu\" dan mendaur ulang \"What Should I Do\" dan mengubah konsep musik kami menjadi Alternative Progresif Rock dan karna kesibukan drummer maka kami terpaksa mengganti personil kembali dengan additional kami dan formasi ini yang bertahan hingga sekarang Mamen (Guitar), Imam (Bass), Jack (Vocal dan Guitar), I\'am (Drum)\r\nPrestasi : Juara 3 MutanFest UPN 2014, Juara 1 Smesco Art Fest 2015, Juara 3 Indonesia Kaya Fest 2016, Guest Star Metrofest 2015, Juara 2 Harumatsuri 2016, Guest Star Metrofest 2016','Alternative Rock','guitar_plus;teman;','Jakarta',1138,'2017-09-04 06:06:40','2017-09-04 06:06:40'),(656,'SAVANA','1504534031.jpg','Savana awalnya merupakan sebuah projek solo dari Nanda dengan mengusung lagu lagu bertemakan cinta yang dibawakan dengan musik pop alternatif. namun, seiring berjalannya waktu Nanda akhirnya memutuskan untuk menambah sejumlah personil yakni Ciko, Buntar, Cahyo dan Marcel. pada awalnya formasi tersebut baik baik saja. Akan tetapi karena adanya urusan pribadi yang tidak dapat ditinggalkan akhirnya Buntar, Cahyo dan Ciko memutuskan untuk rehat sejenak dari band dan membuat posisi savana akhirnya kosong. Tak berapa lama, akhirnya SAVANA  kembali menemukan orang orang yang dirasa cocok untuk mengisi kekosongan tersebut. Mereka adalah Jeff, Barak dan Eyo. Bersama Personil baru, SAVANA telah mengisi banyak acara seperti gigs gigs indie, pensi kampus, Indie clothing serta jakarta fair 2017. Dan kini Savana tengah mempersiapkan album serta video klip dari single terbarunya.','Rock','instagram;teman;','Surabaya',1005,'2017-09-04 06:07:12','2017-09-04 06:07:12'),(657,'The B.O.N.A','1504534475.jpg','The B.O.N.A (Between Old and New Alternative) band ini terbentuk pada 5 Januari 2013 dengan personil awal Mamen (Guitar), Ivan (Guitar), Putra (Vocal), Pety (Vocal), Imam (Bass) dengan mengusung genre Rock Old School, formasi ini berhasil mengeluarkan single \"Temani Aku\" seiring berjalannya waktu kami harus mengganti personil dan akhirnya menjadi Mamen (Guitar), Imam (Bass), Pety (Vocal), Ical (Vocal), Aldino (Guitar), Fajar (Drum), formasi kedua ini menghasilkan single \"What Should I Do\" dan mendaur ulang single pertama kamu \"Temani Aku\", formasi ini mengalami masalah dengan kesibukan masing-masing dan akhirnya kami terpaksa mengganti personil lagi menjadi Mamen (Guitar), Imam (Bass), Jack (Vocal dan Guitar), Nay (Drum) formasi ini berhasil mengeluarkan single \"Menunggu\" dan mendaur ulang \"What Should I Do\" dan mengubah konsep musik kami menjadi Alternative Progresif Rock dan karna kesibukan drummer maka kami terpaksa mengganti personil kembali dengan additional kami dan formasi ini yang bertahan hingga sekarang Mamen (Guitar), Imam (Bass), Jack (Vocal dan Guitar), I\'am (Drum)\r\nPrestasi : Juara 3 MutanFest UPN 2014, Juara 1 Smesco Art Fest 2015, Juara 3 Indonesia Kaya Fest 2016, Guest Star Metrofest 2015, Juara 2 Harumatsuri 2016, Guest Star Metrofest 2016','Alternative Rock','guitar_plus;teman;','Jakarta',1138,'2017-09-04 06:14:35','2017-09-04 06:14:35'),(658,'Rainy Days Today','1504539677.jpg','Rainy  Days  Today  terbentuk  tahun  2009  di  Surabaya  dengan  mungusung genre alternative  yang  digawangi  Rian  Prakoso  (vokal  &  gitar),  Veda  Carreza  (synthesizer), Rusman  Muharom  (gitar),  Adhi  Makayasa  (drum) dan Kukuh Rahman (bass).  Rainy Days Today telah merilis  sebuah  EP sebagai  album  pembuka  yang  berjudul  \"Triangle  Positivity\'  dan 3 rilisan  album  kompilasi. Setelah beberapa kali mengalami pergantian personel dan melakukan perubahan nama Rainy Days  menjadi  Rainy  Days  Today,  di bulan  September 2017 Rainy  Days  Today  kembali  merilis single yang berjudul “Rekreasi Luar Ruangan” sebagai lagu pembuka untuk album kedua yang akan di rilis pada akhir tahun 2017 sekaligus merayakan 8 tahun Rainy Days Today berkarya dalam scene indie surabaya. \r\n\r\nMore info :\r\nTwitter : @rainydaystoday\r\nInstagram : @rainydaystoday_\r\nSoundcloud : rainydaystoday\r\nYoutube : Rainy DaysTV','Others','teman;lainnya;','Surabaya',963,'2017-09-04 07:41:17','2017-09-04 07:41:17'),(659,'GURIS','1504539763.jpg','Band GURIS berasal dari \"gurisan\" atau bercanda. Berdiri dari tahun 2011 berawal dari teman satu kampus di salah satu Univeritas di Purwokerto kemudian masing masing punya hoby yg sama yaitu bermain musik dan dari situlah mulai punya ide bentuk suatu band dengan mengambil genre alternative rock. \r\n\r\nPrestasi ;\r\n- Juara I lomba Acoustik Yamaha di Moro Dept. Store Purwokerto tahun 2012','Alternative Rock','facebook;instagram;teman;','Yogyakarta',1172,'2017-09-04 07:42:43','2017-09-04 07:42:43'),(660,'Adi Nugroho Experiment band','1504541498.JPG','Dibentuk januari 2017, saat ini sedang proses penggarapan album Indie dengan genre progressive Metal. Diproduseri secara swadaya oleh Adi Nugroho itu sendiri, dan dibantu oleh musisi-musisi muda surabaya, Malang, Sidoarjo dan Gresik.','Heavy Metal','teman;','Surabaya',1133,'2017-09-04 08:11:38','2017-09-04 08:11:38'),(661,'Caramello (duo)','1504543165.jpg','Berdiri pd bulan juni 2016 di kota jogjakarta..\r\nBerawal dari mengcover lagu2 lalu diupload diyoutube.. dan seiring perjalanan mencoba berkarya dgn menciptakan lagu sendiri..','Pop','instagram;','Yogyakarta',1189,'2017-09-04 08:39:25','2017-09-04 08:39:25'),(662,'havinhell','1504544750.JPG','havinhell terbentuk di Yogyakarta pasa ahun 2009 dan pada tahun 2012 tepatnya, havinhell merilis album pertama yang bertajuk \"super fighter\", dan pada tahun ini kita dalam proses album yang kedua. Terus bereksperimen, banyak bereksplorasi dan bebas berekspresi , Tak ada yang tak mungkin untuk dijadikan inspirasi dalam berkarya,yang terpenting adalah nada yang mengalun dalam setiap musik Havinhell dapat memberikan semangat bagi siapa saja yang mendengarkan.','Alternative Rock','guitar_plus;','Yogyakarta',1191,'2017-09-04 09:05:50','2017-09-04 09:05:50'),(663,'OWN','1504545219.jpg','• Band Featuring in Trisakti Blues Festival 1 at Rolling Stone Cafe Jakarta 2012.\r\n• Band Featuring in Trisakti Blues Festival 2 at Parkir Timur GBK Senayan Jakarta 2013.\r\n• 1st winner for Music Festival A ZONE by A Mild GoAheadPeople for The Beatles Night at Labiere, Central Park 2014.\r\n• Opening Gugun Blues Shelter for A ZONE by A Mild GoAheadPeople for The Beatles Night at Labiere, Central Park 2014.\r\n• Opening PANDAI BESI for Sound Sations by A Mild GoAheadPeople at Patio, Central Park 2014.\r\n• Band Featuring in Parjo 3 at Parkir Timur Senayan GBK Senayan Jakarta 2014.\r\n• Guest Star in Jakarta Museum Day Festival at Museum Kota Tua Jakarta 2014.\r\n• Band Featuring in Trisakti Blues Festival 3 at Rolling Stone Cafe Jakarta 2014.\r\n• Guest Star in Indonesia Motocycle Festival at Parkir Timur Senayan Jakarta March 2014.\r\n• Band Featuring in Trisakti Blues Festival 4 at Parkir Timur GBK Senayan Jakarta 2015.\r\n• “The Best Band Performance” for Saturday Music Indie at Grand Charly Rawamangun Square 2015.\r\n• One of the band in Parkir Musik 1st Compilation Album 2015 (can be donwloaded at App Store\r\n& Play Store)\r\n• Band Featuring in Parjo 2015 live band stage at Parkir Timur Senayan Gelora Bung Karno\r\nSenayan Jakarta.\r\n• Guest Star in Saturday Music Indie at Warung Apresisai (Wapres) Blok M Jakarta 2015.\r\n• Tribute to Jimi Hendrix in Cardinal Stage at Pekan Raya Jakarta (PRJ) 2015.\r\n• Band Featuring in Autoshow by TMED at Plaza Barat GBK Senayan Jakarta 2015.\r\n• Participant Asian Beat Event at FX Sudirman Jakarta 2015.\r\n• Guest Star of grand opening DUZTFIELD Clothe Store at Tanggerang Dec 12, 2015.\r\n• Endorsed by DUZTFIELD Clothe Store from Dec 12, 2015 – March 12, 2016.\r\n• Guest Star in Carnival Tangerang at I amsterdam Kota Bumi January 6-10, 2016\r\n• Band Featuring in Indie Social gig at JK7 Bar Swiss-Belhotel Kemang Jakarta February 25, 2016\r\n• Guest Star in Gathering Pajak feat. Memes “Classy” “The Beginning of Great Changes in Togetherness“ at Gelanggang\r\nMahasiswa Trisakti University Jakarta March 12, 2016\r\n• Guest Star in Parjo (Pasar Jongkok) 2016 “Neverland” stage with Jikunsprain at Plaza Timur GBK, Jakarta March 13, 2016\r\n• Launching 1st USB Compilation Album “Music Call You Back” at Carburator Spring Tanah Kusir Jakarta March 27, 2016\r\n• Guest Star @  Stage Budaya, Jakarta Fair 2017\r\n• Launching 2nd USB Compilation Album \"Reformusical\" 2017 at Teater Kecil Taman Ismail Marzuki\r\n• Live Stream Guest at BATIK (Bicara Asik Seputar Musik) program, Pemuda FM radio.','Rock','teman;','Jakarta',144,'2017-09-04 09:13:39','2017-09-04 09:13:39'),(664,'RAKYAT','1504545639.jpg','Cerita Terbentuknya Band :\r\nAwal berdiri band ini pada tahun 1999, berawal dari teman satu tongkrongan dengan selera musik yang berbeda-beda. Dengan inisiatif dari seluruh personil, terbentuklah band ini dengan nama RAKYAT yang berarti \"RAsa KarYa Anak Tongkrongan\".\r\nSebelumnya band kami beranggotakan 5 orang : \r\n- Laonk Blues : Vokal\r\n- Pokin : Guitar\r\n- Regay : Lead Guitar\r\n- Edo : Drummer\r\n- Bontot : Bass\r\nSeiring waktu band ini sempat vakum beberapa tahun\r\nSetelah itu berganti personil dan berkurang 1 orang, hingga akhirnya menetap dengan personil yang sekarang ini.\r\nDengan personil :\r\n- Laonk Blues : Vokal, Guitars (1999 - present)\r\n- Andre : Lead Guitars (2014 - present)\r\n- Bontot : Bass (1999 - present)\r\n- Ipul : Drum (2017 - present)\r\n\r\nDan lagu kami yang berjudul \"Pengembara\" diciptakan oleh vokalist kami, karna memang dia tipe orang yang sangat suka travelling dan dia dapat inspirasi lagu ini ketika travelling ke salah satu gunung yang ada di indonesia.\r\n\r\nPrestasi Band :\r\n- Menjadi band pembuka band2 lokal yang ada di tangsel.\r\n- Milad ke 10 diacara okp GANESPA (Tang-Sel)\r\n- Guest Stars di Universitas Muhammadiyah Jakarta (UMJ) thn 2002\r\n- Milad walikota TANGSEL 2013\r\n- Mengisi acara2 hut RI ke 72 dari kampung ke kampung bulan lalu.','Blues','facebook;teman;','Jakarta',992,'2017-09-04 09:20:39','2017-09-04 09:20:39'),(665,'Retro Radio','1504555728.jpeg','Berdiri di 2017 asal dari Bekasi, beranggotakan 5 orang, namun salah satu di antaranya fokus untuk melanjutkan pendidikan. Pernah meraih juara 2 di ajang band di Universitas Bhayangkara Bekasi.','Others','teman;','Jakarta',1183,'2017-09-04 12:08:48','2017-09-04 12:08:48'),(666,'Blazzer','1504575214.jpg','Blazzer Adalah Band Heavy metal yang berasal dari kota surabaya yang berdiri pada tahun 2011 yang lalu .. blazzer pernah menjuarai berbagai macam kompetisi band di surabaya maupun di kota-kota besar yang berada di jawa timur ..','Heavy Metal','facebook;instagram;informasi_toko;poster;teman;','Surabaya',1197,'2017-09-04 17:33:34','2017-09-04 17:33:34'),(667,'BREAKFAST','1504575264.jpg','even GIGS Komunitas','Alternative Rock','guitar_plus;','Yogyakarta',1147,'2017-09-04 17:34:24','2017-09-04 17:34:24'),(668,'Sunshine','1504575507.jpg','Finalis XL indie wanted 2006\r\nJuara Favorit fest rock Pangkalan balai 2006\r\nJuara 1 festival rock betung 2007\r\nFinalis nagaswara search talent by zacky ex kapten 2010\r\nFinalis Festival Cardinal 2010\r\nJuara 2 festival merah putih 2015','Pop','facebook;instagram;umi;poster;teman;','Jakarta',1198,'2017-09-04 17:38:27','2017-09-04 17:38:27'),(669,'Sunshine','1504575525.jpg','Finalis XL indie wanted 2006\r\nJuara Favorit fest rock Pangkalan balai 2006\r\nJuara 1 festival rock betung 2007\r\nFinalis nagaswara search talent by zacky ex kapten 2010\r\nFinalis Festival Cardinal 2010\r\nJuara 2 festival merah putih 2015','Pop','facebook;instagram;umi;poster;teman;','Jakarta',1198,'2017-09-04 17:38:45','2017-09-04 17:38:45'),(670,'Sunshine','1504575673.jpg','Finalis XL indie wanted 2006\r\nJuara Favorit fest rock Pangkalan balai 2006\r\nJuara 1 festival rock betung 2007\r\nFinalis nagaswara search talent by zacky ex kapten 2010\r\nFinalis Festival Cardinal 2010\r\nJuara 2 festival merah putih 2015','Pop','facebook;instagram;umi;poster;teman;','Jakarta',1198,'2017-09-04 17:41:13','2017-09-04 17:41:13'),(671,'Sunshine','1504575768.jpg','Finalis XL indie wanted 2006\r\nJuara Favorit fest rock Pangkalan balai 2006\r\nJuara 1 festival rock betung 2007\r\nFinalis nagaswara search talent by zacky ex kapten 2010\r\nFinalis Festival Cardinal 2010\r\nJuara 2 festival merah putih 2015','Pop','facebook;instagram;guitar_plus;umi;poster;teman;lainnya;','Jakarta',1198,'2017-09-04 17:42:48','2017-09-04 17:42:48'),(672,'Masterplan','1504576267.jpg','Terbentuk 04-11-2015 dan sekarang masterplan sudah punya 8 lagu','Pop','facebook;instagram;teman;','Jakarta',1181,'2017-09-04 17:51:07','2017-09-04 17:51:07'),(673,'DREGENATE','1504580937.jpg','* Band Audisi CARDINAL AWARDS 2016\r\n* Band Audisi CARDINAL AWARDS 2017\r\n* Band Performance JIEXPO 2017','Alternative Rock','facebook;instagram;vipclub;guitar_plus;','Jakarta',88,'2017-09-04 19:08:57','2017-09-04 19:08:57'),(674,'Julyusman Tanurrezal & The Raging Herd','1504589018.jpg','Julyusman Tanurrezal and The Raging Herd is a solo project by talented young guitarist Julyusman Tanurrezal. He is an active practitioner and passionate lover of blues-rock. He started the band in 2012 with bassist Glory Saringar, drummer Soekanto Kasyim and Rafael Yefta on keyboard. The name of the band “The Raging Herd” is to express the power of blues music and the passion of the people.\r\n\r\nThe four members of Julyusman Tanurrezal and The Raging Herd have all been studying Performing Arts at the Institut Musik Indonesia since 2010. In 2016, Soekanto and Rafael successfully completed their studies and graduated from the Institut.\r\n\r\n\r\nTo share our music with the world, and to use our passion for music to drive us to be better, unique and more consistent musicians. Our objective is to pursue a career in the entertainment industry as musicians. We are a highly enthusiastic team of skillful young musicians, with great communication, boundless energy and creative ideas. We believe that our talent and experience will be a valuable contribution.\r\n\r\nSince the beginning of the project, Julyusman Tanurrezal and The Raging Herd have been playing live in some of Jakarta’s popular venues; Eco Bar, Maitrin Lounge, My Mate Café, JK7 Kemang, Tokove, and Rolling Stone Café. The band played Jakarta’s biggest Blues festival, The Trisakti Blues Festival in 2012 and 2013. In May 2016, Julyusman Tanurrezal & The Raging Herd has become the opening act for French rock band KOKOMO in Jakarta, and top 10 Digilive Indie Band Competition.\r\n\r\nJulyusman Tanurrezal and The Raging Herd released their first album “The Raging Herd” in March 2016 with 6 songs. The album is available on iTunes, Amazon, Spotify and many more.','Blues','facebook;','Jakarta',1157,'2017-09-04 21:23:38','2017-09-04 21:23:38'),(675,'The Istiqomah','1504589178.jpg','Di pertemukan dalam kegiatan kampus, yg bergerak di bidang musik, sejak 2011 kami mulai beristiqomah sampai akhirnya membuat karya sendiri.','Pop','instagram;teman;','Yogyakarta',1200,'2017-09-04 21:26:18','2017-09-04 21:26:18'),(676,'PARASUT BAND','1504590320.jpg','Band Ini bermula dari inisiatif antara Yusuf dan pandu \r\nyg kala itu gemar membuat lagu di sela-sela aktifitas mereka \r\nyang aktif di berbagai cafe dibandar lampung pada tahun 2015 silam. \r\nDengan adanya levis band talent ini akhirnya PARASUT \r\nmembentuk formasi resmi dan mereka berharap bisa terus berkarya \r\ndi industri musik dan tanah air.','Pop','instagram;guitar_plus;umi;teman;','Jakarta',878,'2017-09-04 21:45:20','2017-09-04 21:45:20'),(677,'ARraH Band','1504591317.jpg','Salam Satu ARraH,\r\nARraH Band adalah nama yang kami ambil untuk menyatukan dan menghubungkan kami dalam bermusik dan berkarya,kami mengusun genre alternative rock dimana yang mampu menampung semua ambisi bermusik kami yang berlatar belakang basic musik yang berbeda-beda,pada 13 Agustus 2013 yang lalu tercetuslah nama ARraH Band ini yang beranggotakan ian di Vocal, Ade di Lead Gitar, Gyzen di Gitar 2, Andi di Bass dan Armor di Drum.\r\nPrestasi yang paling berkesan bagi kami ialah saat kami mengikuti audisi untuk mengisi Band Utama pada event yang diadakan di Gresik untuk memperingati hari Ulang Tahun Petrokimia Gresik yang ke-44 pada tahun 2016 lalu, puji syukur kami menjadi Juara 1 dan dalam perform kami, kami membawakan lagu-lagu kami sendiri dari mini album kami. Yaaah ini lah sedikit cerita tentang kami ARraH Band. Salam jaya music Indonesia. Salam Satu ARraH,,, \\m/','Alternative Rock','facebook;instagram;teman;','Surabaya',1132,'2017-09-04 22:01:57','2017-09-04 22:01:57'),(678,'Djawara','1504593508.png','djawara band adalah band asal lampung yang mengusung genre Rock Alternative yang ber anggotakan personil nya : \r\n- Vocal : adit\r\n- Gitar : Surya\r\n- Bass : Santo\r\n- Keyboard : Lasmana \r\n- Drum : Rudin\r\n\r\nSemoga Djawara selalu menjadi Djawara di hati seluruh Kalangan masyarakat indonesia dan dunia.\r\nAMIEN.\r\n\r\nCP : 0896 - 5801 - 3997','Alternative Rock','guitar_plus;','Jakarta',1208,'2017-09-04 22:38:28','2017-09-04 22:38:28'),(679,'Srundenk','1504598701.JPG','Cerita\r\n\r\nBerdiri bulan september 2011,di Surabaya. Mengusung genre pop kreatif / indie, yang sekiranya bisa diterima masyarakat luas.\r\n\r\nPrestasi :\r\n\r\n10 besar Yamaha band religi 2011 di Surabaya\r\n8 besar finalist jazz traffic MLD spott di Surabaya\r\nJuara 2 festival band religi Jawa Pos, 2014 di Surabaya','Pop','teman;','Surabaya',1190,'2017-09-05 00:05:01','2017-09-05 00:05:01'),(680,'New Old','1504600293.jpg','New Old, band yang berasal dari Jakarta. Beranggotakan lima orang pemuda, dengan segala kemampuannya mensuguhkan alunan musik, yang bernuansa vintage -- mencoba mengajak khalayak untuk kembali nostalgia, di ruang imaji dan fantasi. Pada awal karirnya, New Old hanya beranggotakan empat orang, sebelum keluarnya posisi pada instrument bass. Sempat beranggotakan tiga orang pada tahun 2015. Pada tahun 2016, New Old mendapat keluarga baru, yakni; Sonny sebagai Bassist dan Nicko sebagai Keyboardist. Pada tahun itu pula, New Old juara pertama pada acara Ramadan Jazz Festival, dan satu panggung dengan musisi lainnya, seperti; Dira Sugandi,  Yuka Tamada, dan banyak lagi. Pada tahun yang sama, New Old berkesempatan tampil di panggung utama Pekan Raya Jakarta, sebagai band pembuka, bersama Geisha.','Pop','instagram;','Jakarta',1214,'2017-09-05 00:31:33','2017-09-05 00:31:33'),(681,'JU\'OND','1504600651.JPG','Lahir dari tangan dingin musisi muda dari Kota Pasuruan, Jawa Timur, Indonesia. Puput (vox) dan Sella (guitarist) yang menyukai warna music  yang sama, yakni paramore.\r\nDalam selang waktu, ju’ond berkumpul menjadi 5 personel. Dengan warna musik dan referensi yang beragam.\r\nParamore, tonight alive, gecko, billfold, Keane, Coldplay, dsb. menjadi referensi dalam pembuatan lagu-lagu dan warna musik kami. Dengan perform on stage yang begitu menjadi ciri khas, membuat kami mudah dikenali dan di ingat oleh penikmat musik.\r\nSentuhan musik poppunk ditambah beat cepat di setiap lagu, semakin menguatkan karakter musik kami. Sound tebal dan tajam di setiap live ataupun recording pun tetap menjadi andalan musikalitas JU’OND tersendiri.\r\n\r\n#Beberapa Event yang pernah kami ikuti:\r\n•	Guest Star “express sensation” Univ. Udayana Denpasar Bali 24-11-2012\r\n•	Feat “nitecoustic” KFC Jimbaran Bali 25-11-2012\r\n•	Guest Star “fest new story of 2013” Lap. Pasca Sarjana STKIP Jombang 2013\r\n•	Feat “ukm musicday se-Jateng” IAIN walisongo Semarang 05-04-2012\r\n•	Guest Star “tribute to paramore II” café capitano Bangil 05-05-2012\r\n•	Guest Star “bandance festival” Aula STKIP Pasuruan 2012\r\n•	Juara 1 “yamaha musicfest” GOR untung surapati Pasuruan 20-07-2013\r\n•	Best performance “yamaha free & style” taman kota Pasuruan 19-01-2013\r\n•	Feat “MKM gathering” Univ. Negeri Malang 2013\r\n•	Feat “melodic fest” Monkasel Surabaya 08-08-2013\r\n•	Feat “Paramore Nite” Colours PUB Surabaya 2013\r\n•	Feat “dies natalis UKM” Ubhara Surabaya\r\n•	Opening Act “Power Metal” Untag Surabaya,\r\n•	SPECIAL Perfprmance Feat “ukm Klinik Music Jombang” Lapangan Basket STKIP PGRI Jombang\r\n•	SPECIAL PERFORMANCE Feat “BAHAYA Record X PARAMORE CLUB INDONESIA” at ROLLING STONE CAFE JAKARTA, 26 Nov 2016.\r\n•	Feat “Campus Idol” at STKIP PGRI PASURUAN, 3 Dec 2016\r\n•	Feat “SUNDAY PSYCOUSTIC” at STREETROCKS WARKOP, 22 Jan 2017.\r\n•	Feat “Refresing Music” at Kantin STKIP PASURUAN, 14 Feb 2017-03-31\r\n•	Feat “PHOBIA TOUR” at Gedung Matahari Pasuruan, 3 Mart 2017\r\n•	Feat \"INDIE CLOTHING EXPO\" at Grand City Surabaya, 2 April 2017\r\n#Etc, …','Pop','facebook;instagram;teman;lainnya;','Surabaya',1130,'2017-09-05 00:37:31','2017-09-05 00:37:31'),(682,'Tokyolite','1504603371.jpg','Tokyolite dibentuk pada 2009 di Bogor. Mengusung genre funk rock, kami telah menelurkan 1 album (Avenue, 2015) dan 1 extended playlist (Hello, 2013).  Di tahun 2016, kami terpilih sebagai perwakilan Asia Tenggara di Kansai Music Conference, Osaka - kesempatan ini kami ambil untuk melakukan tur perdana  di 10 panggung di 5 kota di Jepang yang kami biayai secara independen dan juga memanfaatkan network fanbase yang kami miliki di Jepang. Banyak tantangan yang harus dihadapi selama tur, salah satunya ketika 2 additional player kami memutuskan untuk berhenti dari tur dan pulang ke Indonesia sehingga di tengah-tengah tur kami harus mencari pemain tambahan yang bisa membantu kami terus tampil di 6 panggung berikutnya. Beruntung kami dibantu oleh Izumi Miyamoto, musisi kawakan dari band Caro Kissa yang bersedia menjadi drummer kami hingga tur selesai. Dalam kesempatan yang sama, Tokyolite berhasil menjadi band Indonesia pertama yang diliput dan tampil di kanal Tokyo Acoustic Session, yaitu platform dokumenter musik yang menampilkan musisi Jepang serta internasional untuk tampil di area publik di kota Tokyo. Seluruh pencapaian ini tentunya juga tidak lepas dari prestasi kami sebagai runner up Asia Versus Grand Prix 2013, kompetisi band Asia yang diselenggarakan oleh Fuji TV. Di tanah air, kami sempat tampil di sejumlah panggung festival musik antara lain Java Jazz, JakCloth, Monkeylada, Jazz Goes To Campus, Terusik TRAXkustik, dan PopUp Gigs Demajors. Saat ini Tokyolite sedang menyiapkan materi untuk album kami yang kedua.','Funk','guitar_plus;','Jakarta',1127,'2017-09-05 01:22:51','2017-09-05 01:22:51'),(683,'Srundenk','1504604492.JPG','Cerita\r\n\r\nBand terbentuk November 2011, dengan formasi lama dan mengusung genre Rock. Seiring waktu, dengan pergantian formasi, maka Srundenk memutuskan untuk beralig ranah Pop industri. dan saat ini tengah mempersiapkan mini albumnya yang akan dirilis sekitar desember 2017.\r\n\r\nPrestasi\r\n\r\n10 besar Yamaha Band Religi 2012 di Surabaya\r\n10 besar festival band UNTAG 2013 di Surabaya\r\nJuara 2 festival akustik Religi Jawa Pos 2014 di Surabaya\r\n8 besar finalist MLD spot jazz fest 2015 di Surabaya','Pop','teman;','Surabaya',1216,'2017-09-05 01:41:32','2017-09-05 01:41:32'),(684,'Lavizta','1504606788.jpg','Lavizta terbentuk pada tgl 9 september 2010 lavizta memiliki arti bersinar di awal terbentuknya lavizta memiliki 3 single lagu dengan hits andalan meski ku terluka yang pada saat itu selalu menjadi jawara chart radio se palembang, juara festival band di acara IRC berlokasi di PTC mall palembang, menjadi 10 top finalis A mild wanted dan sering menjadi guest star di tiap daerah se sesumatra selatan dari tahun 2010 sampai 2014. Lavizta sempat vakum selama 2 tahun karena para personil pada saat lebh memilih untuk fokus pada pekerjaan pribadi para personil dan di tahun 2016 akhir tahun para personil lavizta kembali bermusik dan kini mengeluarkan 4 single lagu terbaru dengan hits andalan seperti dia','Pop','teman;','Jakarta',1207,'2017-09-05 02:19:48','2017-09-05 02:19:48'),(685,'Imperium','1504608329.jpg','imperium terlahir pada tgl 29 septemer 2016. dikota yg penuh hirup pikuk yaitu bekasi. untuk prestasi belum ada karna belum sempat mengikuti berbagai event dikarenakan fokus menggarap sebuah album insha allah. terimakasih.','Rock','informasi_toko;poster;teman;','Jakarta',1204,'2017-09-05 02:45:29','2017-09-05 02:45:29'),(686,'Kras','1504611805.jpg','Pada 2015 bulan November KRAS merilis E.P berupa kaset yang berjudul \"Patriam Fur\" yang mempunya arti Negeri Pencuri.c yang merupakan gabungan dari Heavy Metal, Thrash dan Rock. KRAS adalah band yang berasal dari Kota Jakarta, Indonesia, yang awal mulanya bernama B.A.D. Dibentuk oleh Bobby Ryzkiawan, Audi Cabrio dan Dimas Fajar yang sebelumnya memainkan musik crossover (punk, grindcore dan thrash metal) . Masing masing personil juga tergabung dalam band lainya seperti Bobby Rizkiawan yang tergabung dalam band Raspberry, Audi Cabrio yang tergabung dalam Roxxass dan Mystyfy. Lalu tidak lama kemudian bergabunglah Eben Andreas yang tergabung dengan band GRIBS (Gondrong Kribo Bersaudara) dan akhirnya band ini mengganti namanya menjadi KRAS. KRAS yang artinya \"Keras\" adalah ekspresi dari musik yang dimainkan band ini yang meracik empat elemen influence genre utama mereka Heavy Metal, Thrash, Rock dan Punk menjadi satu yang mereka namai dengan \"Heavy Metal Punk Machine\".\r\n\r\nSeiring berjalannya waktu pada awal 2017 Dimas (drum) pamit undur diri.Saat itu Kras sedang dalam proses produksi EP kedua yang berjudul \"Heavy Metal Punk Machine\".  Posisi drumer baru kemudian diisi oleh Erlangga \"EQ\" Muktia dari band Divine, sebelumnya ia pernah memperkuat Thrashline juga.\r\n\r\nKini formasi Kras pun terdiri dari Bobby Rizkiawan (vokal/bass), Eben Andreas (gitar), Audi Cabrio (gitar/vokal) dan EQ (drum).\r\n\r\nKras pernah masuk dalam jajaran nominasi Hammersonic 2017 dalam kategori Soul Of Steel (pendatang baru).Mendapatkan undangan interview dan perform di Extreme Moshpit TV (Oz Radio Bandung) dan Rase FM Bandung. Kras pun pernah  menjadi pengisi di salah satu event Thrash Metal terbesar di tanah air di Bandung \"Thrash On Hangover vol.1\" dan event metal \"Jakarta Keras\" di Lapangan Bulungan Outdoor, Jakarta Selatan, yang diselenggarakan oleh Ibu Kota Kami Punya.','Heavy Metal','guitar_plus;','Jakarta',1220,'2017-09-05 03:43:25','2017-09-05 03:43:25'),(687,'The Flash','1504613404.jpg','- Festival Band Uzone Digital Icon & sebagai satu-satunya band perwakilan dari Yogyakarta, dan tampil bareng Dewa 19 reuni, Mulan Jameela & The Virgin di Tennis Indoor Senayan 2014, Jakarta. \r\n- Menjadi 5 Band pilihan tampil live di acara Radioshow TV One 2017, YOgyakarta','Rock','instagram;','Yogyakarta',1167,'2017-09-05 04:10:04','2017-09-05 04:10:04'),(688,'101','1504617806.jpg','10 Finalis L.A Meet The Labels 2015 tingkat Nasional\r\nJuara III Yamaha Matic Music Fest 2013 tingkat Jawa Timur\r\nFinalis Galaxy Superstar 2012 tingkat Nasional','Pop','instagram;','Surabaya',1111,'2017-09-05 05:23:26','2017-09-05 05:23:26'),(689,'LANDHACK','1504618462.jpg','band LANDHACK terbentuk januari 2015 sering mengikuti ajang festival dan mengisi acara diberbagai tempat, seiring waktu band LANDHACK sempat mengalami pergantian personil dan akhirnya terbentuk formasi yang solid di bulan juni 2017 .','Rock','facebook;instagram;','Surabaya',1182,'2017-09-05 05:34:22','2017-09-05 05:34:22'),(690,'EMO','1504618529.jpg','Etnik Harmoni Bali (Emoni Bali) band asala Pulau Bali terbentuk pada 11 januari 2011 dimana merupakan kumpulan mahasiswa fakultas teknik di salah satu universitas negeri di Bali, pada awal terbentuk emoni pernah mengikuti kompetisi lokal dimana meraih juara pertama sekaligus favorit, sekitar bulan mei 2011 lolos sebagai 6 besar road to soundrenaline regional Bali NTT, lolos dalam 10 besar LA Light meet the labels pada tahun 2012, pada tahun yang sama emoni juga sempat tampil pada acara OVJ yang ketika itu melakukan road show ke Bali\r\ndari awal terbentuk emoni sering tampil pada acara-acara musik di Bali, pernah juga diundang sampai Mataram.\r\nSampai tahun 2017 emoni telah mengeluarkan 3 album dimana salah satu album (album ke 2) memberanikan diri memuat materi berisikan gubahan dan aransemen lagu daerah bali yang kini sudah hampir tidak dinyanyikan lagi oleh orang-orang bali khususnya anak-anak... salah satu lagu yang paling favorit dengan judul \"ketut garing\" yang merupakan lagu dengan views sampai 2,5 juta yang pada saat itu belum ada band bali yang memimiliki views sebanyak itu\r\nkali ini emoni mencoba mengikuti levis band hunt dengan mengirimkan salah satu lagu dari album pertama yang berjudul Rindu, dimana pada video klip ini kami ingin menyampaikan bagaimana perasaan pasangan yang lagi LDR, saking ingin bertemunya dengan sang kekasih sampai-sampai pertemuan pada sebuah mimpi pun terasa begitu nyata\r\n#SalamBerjutaHarmoni','Pop','maliq;','Surabaya',1009,'2017-09-05 05:35:29','2017-09-05 05:35:29'),(691,'ANOLUX','1504618860.jpg','ANOLUX adalah sebuah band baru dengan formasi yang menurut kami cocok antar personil.\r\nUntuk prestasi masing-masing personil memiliki prestasi tersendiri ketika dengan band lamanya\r\nKami bersatu mencoba memecahkan permasalahan yang ada dalam industri musik yaitu salah satunya Pembajakan yang mana menurunkan kualitas industri musik di Indonesia .\r\nkami mencoba peruntungan dengan mendaftar LEVIS BAND HUNT dan siapa tau kami bisa memasuki juara 1 dan mendapat kontrak kerjasama dengan Universal yang semoga saja itu gerbang harapan dari mimpi kami yang berjuang bertahu-tahun mencoba menjadi musisi top di Indonesia, Asia, dan Mancanegara .\r\nSemoga aksi, penampilan, dan performance musik kita berkualitas diajang ini hingga seterusnya.\r\nYeaaaahhhhh','Rock','facebook;informasi_toko;','Surabaya',1112,'2017-09-05 05:41:00','2017-09-05 05:41:00'),(692,'ANDTHOM BAND','1504621678.jpg','Andthom Band Merupakan Band Yang terbentuk 26 September 2015 Yang berasal dari kota kecil di sulawesi selatan yaitu Kota Palopo,Anthom terbentuk karena personil mempunyai visi dan misi yang sama,adapun prestasi yang di raih dalam 2 tahun belakangan ini yaitu,tahun 2015,8 kali menjuarai Festival Music acostic yang di adakan di kota palopo,makassar sulsel,2016,17 kali menjuarai festival band pop di kota makassar,palopo,masamba,soerako,kendari,.2017 Tour Road to Cafe Sulawesi Barat ,Polman,Majene,dan kota mamuju sponsor Clasmild ..','Pop','instagram;umi;teman;','Jakarta',860,'2017-09-05 06:27:58','2017-09-05 06:27:58'),(693,'d\'Almond','1504622194.jpg','bermula dari kumpulan teman di desa yang sering nongkrong bareng','Pop','guitar_plus;','Yogyakarta',1226,'2017-09-05 06:36:34','2017-09-05 06:36:34'),(694,'KRANS','1504622742.jpg','Memulai petualangan sejak Juni 2017, KRANS adalah salah satu dari sekian banyak nama yang ada di\r\nbenak kami saat memulai petualangan kami. Nama KRANS diambil dari Kamus Besar Bahasa Indonesia\r\nyang memiliki arti ‘karangan bunga’. Lagu-lagu yang kami buat sering kali merespon isu-isu dan keadaan\r\nyang terjadi di sekitar kami. Musik pop sederhana kami sajikan dengan memasukkan unsur-unsur musik\r\nlain, seperti folk, alternative, indie rock, punk, jazz, new wave, yang dipengaruhi oleh para idola kami.\r\nKami ingin mencoba membuat musik yang layak untuk dinikmati dan didengarkan khalayak umum.','Pop','facebook;teman;','Yogyakarta',924,'2017-09-05 06:45:42','2017-09-05 06:45:42'),(695,'SEMI PROJECT','1504623747.png','BAND INI BERAWAL DARI SEBUAH PERKUMPULAN YANG MEMUTUSKAN UNTUK MEMBUAT BAND.\r\nDAN BAND INI PERNAH DIUNDANG UNTUK BERMAIN DI STUDIO YG CUKUP TERNAMA DI DAERAH TANGGERANG','Pop','instagram;guitar_plus;poster;','Jakarta',832,'2017-09-05 07:02:27','2017-09-05 07:02:27'),(696,'RADIOMOTE','1504624284.png','Band ini berdiri untuk memberi warna baru di musik indonesia,kami radiomote memiliki pemikiran dan selera musik yang sama untuk berkarya','Pop','facebook;','Medan',1056,'2017-09-05 07:11:24','2017-09-05 07:11:24'),(697,'WAV band','1504626327.jpg','Berawal dari kesamaan ide dan kreasi dan sama sama menyukai band dari coldplay keane dan u2 maka terbentuklah wav band untuuk mewujudkan karya untuk sumbangsih untuk musik indonesia','Alternative Rock','facebook;','Jakarta',1229,'2017-09-05 07:45:27','2017-09-05 07:45:27'),(698,'Jagang Pinggir','1504629368.jpg','awal terbentuk band ini ketika itu pada awal masuk perukilahaan kita ber-4 sama-sama masuk kedalam organisasi mahasiswa UKM Band sebuah kampus swasta di Surabaya. akmal, wildan dan cici adalah divisi acara nya dan rendy adalah divisi peralatan. akmal wildan dan cici karena berada dalam satu divisi yang sama akhirnya mereka memiliki khemistri yang sama dan akhirnya memutuskan untuk membuat sebuat band dengan nama A.W.C yang adalah singkatan dari nama mereka. kemudian rendy dan akmal seringkali ketika nongkrong di sekretiat UKM Band, mereka berdua menemukan kecocokan dalam referensi musik. akhirnya pada suatu hari akmal mengajak rendy untuk ikut dalam latihan band nya tadi (A.W.C) dan disitu lah pertama kali komposisi pernil ini melakukan jamming dan menemukan warna baru dalam bermain musik rock yaitu dipengaruhi oleh permainan gitar dari rendy. latihan demi latihan di studio seringkali dilakukan dan terciptalah beberapa lagu yang akhirnya kita memutuskan untuk menghasilkan sebuah karya yang menunjukan jati diri dari band ini. yang kemudian dengan formasi ini otomatis nama band dirubah menjadi Jagang Pinggir. kita pun seringkali bermain di acara-acara komunitas, gig sepperti road to soundrenalin 2017 surabaya, serta acara-acara kampus dan juga beberapa bar di surabaya.\r\nnp:  akun instagram @jagangpinggir_official','Rock','maliq;','Surabaya',1231,'2017-09-05 08:36:08','2017-09-05 08:36:08'),(699,'O L D F I L E','1504629369.jpg','we are OLD FILE\r\n\r\nfrom Jambi,Indonesia\r\n\r\ncontact person:\r\nRUDI +62 852 7205 9545','Blues','facebook;instagram;informasi_toko;','Medan',1192,'2017-09-05 08:36:09','2017-09-05 08:36:09'),(700,'BAY','1504629418.jpg','Band ini memang belum memiliki prestasi, dalam hal kompetisi. Karena band ini baru terbentuk saat mengetahui ada event ini.','Pop','maliq;','Jakarta',494,'2017-09-05 08:36:58','2017-09-05 08:36:58'),(702,'Sarsaparilla','1504631166.jpg','Sarsaparilla terbentuk pada 24 November 2013. Yang berawal dari sesama anggota extrakulikuler musik di sebuah SMU. Shoufey Sungkar (Vocal),Gahtan Basandid (Guitar Lead),Fauzan Hanif (Drum),Rifky Algifari (Guitar Rythm).\r\nSarsaparilla merupakan band yang bergenre Pop. Yang berkeinginan besar menunjukan musikalitas yang unik dan fresh tetapi easy listening. Yang mempunyai konsep Colorfull dengan warna setiap personil Hijau,Merah,Biru dan Pink.\r\nDalam waktu singkat sarsaparilla telah melalukan recording yang dilakukan secara sendiri (Home Recording)\r\nSarsaparilla juga telah mengikuti berbagai event dan kompetisi band antar sekolah maupun umum.\r\nDan Pada tanggal 20 agustus 2017 Gitaris kami yang bernama Rifky Algifary (Berbaju biru) telah mengundurkan diri dan sudah tidak bisa bekerja sama dengan Sarsaparilla. Sarsaparilla juga dibantu oleh beberapa Personil additional yaitu Andre Arsanto (Bass), Satria Ghaibi (Keyboard), Marco Bagas (Guitar rhythm). Sarsaparilla Mengubah Fomasinya menjadi Bertiga yaitu Shoufey Sungkar (Vocal), Gahtan Basandid (Guitar Lead), Fauzan Hanif (Drum).\r\n\r\nPrestasi:\r\n-Menjadi Guest star di beberapa Pensi\r\n-Menjadi Guest star di beberapa Event\r\n-Bermain di Center Stage Jakarta Fair 2017','Pop','instagram;informasi_toko;guitar_plus;umi;maliq;','Jakarta',1178,'2017-09-05 09:06:06','2017-09-05 09:06:06'),(703,'Later Just Find','1504631711.jpg','Kami 7 manusia yang ingin bermusik dan bermain sekaligus bekerja bersama. mari dengarkan kami.','Pop','instagram;informasi_toko;vipclub;maliq;teman;lainnya;','Jakarta',1062,'2017-09-05 09:15:11','2017-09-05 09:15:11'),(704,'DBest Band','1504632500.jpg','10 Besar Festifal Band Koran Lampu Merah','Alternative Rock','instagram;','Jakarta',1193,'2017-09-05 09:28:20','2017-09-05 09:28:20'),(705,'TRILOGI','1504641554.jpeg','Trilogi adalah band Bandung yang beranggotakan tiga orang. memiliki tiga ideologi namun satu visi. memutuskan bergenre rock agar orang yang mendengarkan bisa termotivasi dan semangat dalam kesehariannya.','Alternative Rock','facebook;','Jakarta',1244,'2017-09-05 11:59:14','2017-09-05 11:59:14'),(706,'TCRS','1504652114.JPG','The  Curious,  band  yang  t e r l a h i r p a d a 2 0 1 1 . Diibentuk awalnya oleh Essa di Vocal dan Alan di G i t a r .​s e t e l a h mengumpulkan beberapa m a t e r i l a g u a k h i r n y a mereka memulai band ini dengan mengajak Samuel ( ex - D r u m ) L u ck y ( B a s s )\r\n.\r\nsempat memulai band ini dengan empat orang diatas dengan format yang sederhana, namun karena dirasa kurang dapat memenuhi kebutuhan akhirnya mereka sepakat mengajak Ruben (Keyboard) untuk memenuhi kebutuhan band ini. Pada perjalanannya TCRS yang beraliran Shoegaze-Alternatif ini,memilih referensi musik seperti mew, radiohead, the national, the other lives. sempat beberapa kali melakukan rekaman dan menghasilkan beberapa lagu. band ini mengawali karyanya dengan “Human” 2011. setelahnya kemudian disusul dengan merilis EP yang berisikan tiga lagu yakni : “Enggan Mati Masuk Surga”, “Mengencani Imajinasi dan “Reaksi Kimia”. Saat ini TCRS baru saja mengganti drumer mereka dengan Yuda “Bable” yang dengan formasi baru ini TCRS sedang dalam proses merampungkan album debut yang berisi 9 lagu dan akan dirilis dalam waktu dekat.','Alternative Rock','instagram;','Yogyakarta',1241,'2017-09-05 14:55:14','2017-09-05 14:55:14'),(707,'rula&reba','1504652270.jpg','kami band baru yang ingin mencari pengalaman :)','Alternative Rock','facebook;instagram;informasi_toko;vipclub;guitar_plus;umi;maliq;poster;teman;lainnya;','Jakarta',55,'2017-09-05 14:57:50','2017-09-05 14:57:50'),(710,'Pinkertune','1504664203.png','kehadiran pinkertune dalm dunia musik indonesia tak lepas dari sepak terjang sang vocalis/gitaris,apink risejet        dari awal pembentukan dan pencetusan nama pinkertune di tahun 2006 lihat foto “formasi awal”,dialah yang berandil besar melahirkan karya karya untuk pinkertune,namun seiring waktu berjalan dan beberapa kali mengalami pergantian personil dan pergantiannya di sebabkan adanya anggota yang memilih berhenti bermain musik  membuat band ini pasang surut dan tak tentu arah alias galau\r\ndan dengan segala apa yg terjadi  kembalilah di tahun 2017 ni\r\ntergugah kemauan untu menghadirkan kembali pinkertune setelah mencoba untuk menyeleksi beberapa lagu untuk membuat full album perdana mereka,begini kata apink saat di temui beberapa saat lalu“ada beberapa sih,\r\ndan yg akan di jadikan single \r\npertama itu kemungkinan where’s love sahut \"apink,\r\nini seperti mencari apa yg hilang dalam diri setiap org, kadang kadang dunia itu kacau tapi dengan cinta itu bisa menjadi indah dan bermamfaat,tidak sabar untuk bernyanyi bareng pinkisser ,cetusnya,,\r\nokay pinkisser tunggu ya\r\nlagu -lagu dari pinkertune\r\nsemoga bisa mewarnai dunia musik indonesia dan mewarnai harimu\r\npeace','Rock','umi;','Jakarta',781,'2017-09-05 18:16:43','2017-09-05 18:16:43'),(711,'Javanice','1504669033.jpg','Bermula dari sebuah event di kota Cianjur tahun 2013, Dira (vokal) yang saat itu memutuskan untuk berhenti bermusik dan menjadikan event tersebut last solo performance karena akan fokus bekerja dan meninggalkan dunia musik, setelah tampil, Ram (bassis) langsung menemui Dira karena tertarik dengan suara dan gaya panggung nya, Ram bercerita bila ia telah lama bermusik dengan teman masa kecil nya Dodi (gitar) dan belum menemukan teman lain yang kompak, dari sana beberapa bulan kemudian mereka bertemu dan mulai membentuk sebuah band dengan Harits (Drumer) yang bergabung tak lama setelahnya.\r\nBeraliran awal Japanese Rock, \"Javanice\" dipilih sebagai nama band dengan artian Java is nice (orang jawa/Indonesia itu relatif baik) dan Javanice siap memenangkan acara Levi\'s Band hunt Competition 2017\r\n\r\nPrestasi:\r\n-berpartisipasi dalam banyak event di kota sekitaran bandung sukabumi cianjur bogor jakarta dll, kebanyakan event bertema japanese.\r\n\r\n-Guest star di beberapa event\r\n\r\n-Dira (vokal) pernah masuk acara tv pencarian bakat suara mirip iman j-rocks\r\n\r\n-sudah memiliki 4 buah lagu dan 2 klip','Rock','facebook;','Jakarta',1254,'2017-09-05 19:37:13','2017-09-05 19:37:13'),(712,'ROMANTICK','1504669534.jpg','Berangkat dari sebuah persahabatan yang lama, walaupun kami pribadi yang berbeda-beda, tetapi kami selalu menerima perbedaan itu untuk bersatu.\r\n\"SATU NAMA, SATU MIMPI, DIRAIH BERSAMA DAN UNTUK BERSAMA\"\r\nWe Are ROMANTICK!\r\n\r\nPrestasi :\r\n- Juara 1 \"Rock Fest Kediri Jatim 2011\"\r\n- Finalis 3 besar band \"Digital Icon with Republik Cinta Management Jakarta 2014\"\r\n- 10 besar kompilasi album Alfa Record \"Project Alfa : Naga Mencari Bintang 2015\"\r\n\r\nContact Person :\r\n- 087758487111 (Tifa)\r\n- 085790540508 (Bayu)','Alternative Rock','guitar_plus;','Yogyakarta',1222,'2017-09-05 19:45:34','2017-09-05 19:45:34'),(713,'KANESIA','1504670605.jpeg','Salam Kenal dari KANESIA .\r\nKami merupakan Band yang menciptakan Lagu lagu bernuansa semangat nasional . Band kami memiliki misi untuk selalu memberikan semangat kepada kaum muda melalui lagu lagu yang kami bawakan . \r\nSebelumnya kami pernah tampil di Acara Jambore Daerah Se-Jawa Barat Tanggal 2 Agustus 2017 kemarin . Semoga Band kami dapat diikutkan dalam kompetisi ini . Terima Kasih','Pop','teman;','Jakarta',1217,'2017-09-05 20:03:25','2017-09-05 20:03:25'),(714,'Blind majesty','1504670766.jpg','Ancol lebaran festival 2017','Rock','facebook;instagram;informasi_toko;guitar_plus;umi;teman;','Jakarta',1221,'2017-09-05 20:06:06','2017-09-05 20:06:06'),(715,'nothingfall','1504671234.jpg','NF (nothingfall) adalah transformasi dari 3 personil  band pionir raprock di bandung pada 90an Ragajimesin ditambah 2 personil yang juga cukup lama bermain di skena underground kota bandung lain nya..\r\nterbentuk akhir 2016..sudah merilis single = video klip dan sekarang sedang proses menuju rilisan fisik','Others','guitar_plus;teman;','Jakarta',1257,'2017-09-05 20:13:54','2017-09-05 20:13:54'),(716,'Beauty and The Beats','1508545736.jpg','Band yang terbentuk atas keresahan yang sama. yaitu tidak berani berkarya secara Independent. Akhirnya kami memusutskan untuk membentuk band ini. dengan tujuan berkarya secara merdeka','Pop','instagram;maliq;','Yogyakarta',1230,'2017-09-05 20:18:28','2017-10-20 16:28:56'),(717,'The Dance Going On','1504671535.jpg','The Dance Going On terbentuk pada tanggal 6 Juni 2016, yang juga bertepatan dengan 1 Ramadhan dalam kalender Islam, Islam dan semakin mendukung konsep \"Baik-Buruk\" yang ada dalam konsep band ini sendiri.\r\n\r\nThe Dance Going On mengusung musik beraliran Gypsy, Psychedelic, Jamaican, Ska, Rock n Roll dan Rock Steady. The Dance Going On bukan hanya sekedar band melainkan Ide untuk regenerasi musik lokal, yang ingin menunjukan disharmony sebagai suguhan \"like-new\" dalam skena musik Indie Surabaya.\r\n\r\nAdapun beberapa Prestasi yang sempat kita raih, diantaranya adalah sebagai Best Local Band 1st Semester UrbanGigs dan Juara 2 Sound of Tri regional Surabaya.','Others','facebook;instagram;teman;lainnya;','Surabaya',1126,'2017-09-05 20:18:55','2017-09-05 20:18:55'),(718,'Passatu Band','1504672543.jpg','Juara II festival Band Antar Pelabuhan Se-Indonesia th 2012\r\nJuara I festival Band Antar Pelabuhan Se-Indonesia \r\nth 2013,2014,2015\r\nJuara I festival Band Car Terminal Lapiaza th 2016\r\nJuara I Festival Band antar BUMN th 2015\r\nJuara II Festival Band HUT KOLINLAMIL Angkatan Laut \r\nth 2016\r\nJuara I Festival Band antar BUMN th 2016','Pop','instagram;umi;','Jakarta',1256,'2017-09-05 20:35:43','2017-09-05 20:35:43'),(719,'Terts Mayor','1504675470.png','Kami sekumpulan anak muda yang terbenteuk dalam sebuah band yang bernama “Terts Mayor” awal mula kami terbentuk dari sebuah salah satu kampus seni di Jakarta dan kami semua adalah mahasiswa di kampus tersebut . Awal kami terbentuk tahun  2015 , dan dari awal hingga sekarang kami sudah mengeluarkan 3 track lagu ciptaan kami sendiri yang kami unggah di souncloud . Sejauh ini kami pernah mengikuti beberapa pagelaran musik seperti event music , festival ,acara wedding dll dan sampai sekarang menjadi home band di beberapa kafe .','Pop','instagram;','Jakarta',1100,'2017-09-05 21:24:30','2017-09-05 21:24:30'),(720,'7Miles','1504675718.jpg','7miles di bentuk pada tahun 2012 dengan mengusung aliran musik pop. 7miles terdiri dari lima(5) personel masing-masing adalah Naka(vocal), Iam(lead guitar), ivan(guitar), Rezard(bass), dan Rama(drum). Pada arangemen lagu kami sendiri bertemakan cinta dan kehidupan, instrumen yang di kedepankan lebih menonjolkan string dan petikan ciri khas pop modern dengan sound yang terasa luas pada saat pengolahan suara agar para pendengar enjoy dan mampu masuk dan merasakan karya yang kami olah. Arti 7miles sendiri memiliki arti yang luas. Angka 7 merupakan angka yang fenomenal menurut kami. Dan miles merupakan ukuran jarak dalam bahasa inggris. Jadi bisa di katakan motivasi kami adalah bagaimana kita menjadi band fenomenal tanpa menghitung jarak apapun baik dari sisi komunikator/penikmat musik 7miles. Maupun 7miles itu sendiri.','Pop','instagram;guitar_plus;','Jakarta',1261,'2017-09-05 21:28:38','2017-09-05 21:28:38'),(721,'ACTINIUM','1504676093.jpg','ACTINIUM Band yang terbentuk pada tanggal 12 Desember 2012 di Kota Bogor yang bergenre Rock/Nu Metal. Actinium saat ini sudah mempunyai mini album yang terlah di rilis bulan April 2017 lalu dalam bentuk fisik dan digital yang berisikan 4 lagu di dalam nya. ACTINIUM sendiri terinspirasi dari band band seperti Linkin Park, Bring Me The Horizon, Coldrain, Pierce The Veil, Mice Of Man, Limpbizkit, dan Lain nya. ACTINIUM sendiri biasa mengisi acara di acara acara pensi, festival festival musik lain nya, dan juga festival musik musik Matsuri/Jepang di berbagai daerah Jabodetabek.','Rock','guitar_plus;','Jakarta',1264,'2017-09-05 21:34:53','2017-09-05 21:34:53'),(722,'A.M.O Project','1504676273.jpg','Dibentuk Tahun 2016 di Bandung\r\nAmo project adalah project solo guitar instrumental oleh Gitarisnya sendiri, Amo. Beranggota  4 orang, 2 Gitaris, (Amo dan Hadi) Drummer (Andi) dan Bassis (Robert) Merekam, mendanai dan merilis sendiri EP yang berjudul \"My Guitar and Me\" yang memiliki genre yang luas dari heavy metal sampai jazz fusion pada September 2016. Dan akan terus maju berharap musik instrumental dapat menembus pasar musik Indonesia.','Others','guitar_plus;','Jakarta',1262,'2017-09-05 21:37:53','2017-09-05 21:37:53'),(723,'AFTER SKY','1504676593.jpg','AFTER SKY adalah girlband asal kota Malang Indonesia yang beraliran pop rock hingga speed metal. Resmi berdiri pada tanggal 4 september 2016,awalnya beranggotakan 4 orang tapi sekarang tersisa dua orang dan 2 additional player dan tetap solid sebagai band yang mengusung genre pop rock n speed metal\r\nPersonil after sky adalah Diana Novitasari (15  tahun) pada posisi gitar dan vokal dan Viola Intania (14 tahun) pada posisi drum dan vokal dibantu oleh Agung pradana (17 tahun) di posisi bass dan Fredyk theo (17tahun) drummer pengganti\r\nSetelah sukses dengan mini album mereka FIRST STEP TO FLY yg dirilis 20 November lalu, kali ini mereka merilis single yang berisi 2 lagu KIBARKAN BENDERA dan SELAMAT ULANG TAHUN TEMANKU yang sengaja dirilis pada 14 Agustus ini untuk menyambut hari kemerdekaan RI yang ke 72 \r\nRilisan single ini ditandai dengan pemutaran serentak di radio2 kota Malang, di Jawa Timur dan sebagian Jawa dan beberapa radio di luar pulau jawa di Indonesia pada tanggal 14 Agustus 2017\r\n\r\nPrestasi :\r\n-Favorit Djarum super Rock in Battle audisi malang\r\n-Band pembuka tour konser NINA WANG di malang','Alternative Rock','facebook;instagram;guitar_plus;umi;','Jakarta',861,'2017-09-05 21:43:13','2017-09-05 21:43:13'),(724,'TEORI','1508562402.jpg','TEORI terbentuk di kota Solo pada tahun 2010. Adalah Gege Saga, Martinus Sentana juga Ichsandy Nugraha yang mengusung kelompok musik ini. Terpengaruh dengan musik band-band inggris alternatif, menjadikan satu kesamaan diantara banyaknya perbedaan selera. Salah satu yang paling mempengaruhi adalah Radiohead.\r\n\r\nDisamping itu kemunculan Tame Impala serta Temples turut mewarnai perkembangan karya. Rock Alternatif dengan beberapa siraman modulasi pun lekat tersemat dalam album perdana kami yaitu “TANTRUM” (2016).\r\nBand indie dengan segala kemampuan untuk berproses serta promosi seringkali memutar cara agar karyanya didengar. TEORI memutuskan salah satu cara yang paling tepat adalah melakukan tur ke luar kota. Terhitung dalam medio 2 tahun terakhir, TEORI sudah dua kali melakukan ibadah tur Jawa-Bali. Selain itu showcase promo album serta media maya pun juga dilakukan. Tahun ini masih melanjutkan beberapa cara untuk promo album. Video musik untuk single kedua akan segera dirilis pertengahan tahun 2017.\r\n\r\nDiscography :\r\n-	Confused (single / 2014) \r\n-	Sesari Selagu (single / 2016) \r\n-	TANTRUM (album / 2017) \r\n-	Lovely Bones (single / 2017)','Alternative Rock','instagram;teman;lainnya;','Yogyakarta',1266,'2017-09-05 21:45:28','2017-10-20 21:06:42'),(726,'Palapa band','1504677764.jpg','Palapa band didirikan pada tanggal 27 Juni 2001 , seiring munculnya inspirasi kami untuk lebih maju dan lebih serius dalam bermusik , walaupun kemarinkemarin sempat berganti personil dan putus harapan tapi alhamdulillah sekarang masih bisa tetap berkarya dan masih tetap eksis dan tetap solid . Palapa band diambil dan ter inspirasi dari sebuah nama satelit yang mana fungsi dari satelit itu adalah memancarkan signalnya begitu luas dan mendunia , kami ingin juga memberikan sebuah alunan musik dan karya kami untuk didengar oleh seluruh masyarakat indonesia pada khususnya dan dunia pada umumnya . prestasi-prestasi palapa band : 1. Juara 1 festival musik se sulawesi Piala Menristek dibulukumba 2004\r\n2. Juara 2 festival suzuki se indonesia timur 2008 \r\n3. Juara 1 festival indivest regional kabupaten soppeng 2005\r\n4. Band opening GIGI kabupaten sinjai 2006\r\n5. Band opening KOTAK kabupaten Bone 2009\r\n6. Band opening COKLAT kabupaten Bone 2008\r\n7. Band terfavorit 10 besar festival A MILD WANTED regional Indonesia Timur 2009/2010 dll','Pop','teman;','Yogyakarta',1265,'2017-09-05 22:02:44','2017-09-05 22:02:44'),(727,'Ming&Mong','1504678656.jpg','Ming&Mong adalah band yang berdiri pada tahun 2016 dengan single pertama lagu Sebuah Lagu.','Pop','instagram;','Yogyakarta',1268,'2017-09-05 22:17:36','2017-09-05 22:17:36'),(729,'Mike Chemichael','1504679616.jpg','band ini berawal dari project solo Michael Manurung,\r\ndan kemudian berkembang menjadi sebuah band\r\n\r\nband ini telah menjadi performer dibanyak event pensi, sekolah, universitas, wedding, gigs, dan juga launching','Pop','instagram;teman;','Jakarta',1263,'2017-09-05 22:33:36','2017-09-05 22:33:36'),(730,'ALIVE BAND','1504679939.jpg','Alive band berasal dari kota brebes jawa tengah , kita terbentuk 7 june 2016 beranggotakan 4 orang bergenre pop , kita sering mengisi pensi2 sekolah dan d cafe2 IG : alive_official\r\n\r\nUntuk info hub 085742922241','Pop','instagram;guitar_plus;','Jakarta',1269,'2017-09-05 22:38:59','2017-09-05 22:38:59'),(731,'KeyP.A.D','1504680012.jpg','Formasi awal KeyP.A.D. ialah Purnama Ramadhan di posisi gitar dan vokal, Ahmad Adlan di posisi bass dan backing vocal serta Danialsyah di posisi drum dan vokal. Namun di awal Maret 2015 Ahmad Adlan meninggal dunia akibat penyakit akut yang menggerogotinya, untuk menghormati dirinya KeyP.A.D. akan terus memakai additional player untuk mengisi posisi pemain bass di setiap penampilan mereka. Menurut mereka Adlan tetap menjadi unsur band tersebut dan tidak boleh digantikan oleh siapapun.\r\nNama KeyP.A.D. diambil dari kata Key yang dalam bahasa Inggris artinya adalah Kunci dan P.A.D. diambil dari inisial nama ketiga personilnya. Yang dimana mereka memfilosofikannya bahwa unsur atau kunci dari band tersebut terletak kepada ketiga personilnya.\r\nAwalnya mereka tergabung didalam manajemen Be_Avenue dibawah bimbingan Fakhrie Ristrano atau akrab disapa Bang Ano dan mulai melebarkan sayap mereka di dunia musik Provinsi Aceh. Namun sekarang mereka memutuskan mengatur manajemen mereka secara independen.\r\nKeyP.A.D. menghasilkan 6 lagu sejauh ini yaitu Just Do It,Promise You,Be Yourself,I Love You Like a Music on the Dancefloor,Ijo dan PAD.\r\nKarya-karya mereka bertemakan Kehidupan sosial,cinta dan motivasi hidup seperti di lagu “Just Do It” yang menceritakan tentang ajakan untuk berani bertindak dalam hidup agar tidak menjadi seorang pecundang. “Promise You” menceritakan tentang romansa ketika diputuskan oleh pasangan tetapi tidak menjadi permasalahan bagi yang ditinggalkan. Dalam lagu “Be Yourself” KeyP.A.D. menyarankan orang-orang untuk menjadi dirinya sendiri didalam hidup. “I Love You Like a Music on the Dancefloor” menceritakan ketidakpedulian mendengarkan pendapat orang lain ketika kita mencintai seseorang dan tetap pada keputusan kita untuk mendapatkannya. Dalam lagu “Ijo” diceritakan tentang menikmati kesenangan dalam hidup dan “PAD” menceritakan ketiga personil di dalam band KeyP.A.D.\r\nDalam rencananya keenam lagu tersebut akan mereka kemas di dalam mini album yang sedang mereka kerjakan yang bertajuk “A” dan akan segera mereka rilis dalam waktu dekat ini. Rencananya mereka mendedikasikan album ini untuk Alm. Ahmad Adlan yang telah meninggalkan mereka.\r\nSekarang KeyP.A.D telah menetapkan Jafri Hasman dan Teuku Gabriel untuk menjadi personil dari KeyP.A.D.','Rock','instagram;guitar_plus;poster;teman;lainnya;','Medan',1271,'2017-09-05 22:40:12','2017-09-05 22:40:12'),(732,'Every Brains','1504680867.jpg','Every Brains, berdiri sejak tahun 2010. Berawal di massa-massa SMA kami, saat musik elektrik sedang bergejolak tapi kami menolak untuk terhanyut dalam dentuman beat yang terdengar dimana-mana. Kami memilih untuk menikmati kerasnya musik ACDC, The Doors, The Sigit dan musik-musik yang sebagian besar adalah warisan dari ayah-ayah kami. \r\n\r\nGigs pertama kami di imax kemang pada tahun 2010, tercengang saat melihat crowd berlari kearah kami ketika kami membawakan T.N.T dari ACDC. Saat itulah kami meyakini bahwa ROCK adalah musik & lifestyle kami. \r\n\r\nSempat vakum lama karena kebutuhan hidup yang memaksa kami untuk menjauh dari mimpi dan setelah beberapa kali mencari-cari drumer pengganti teman kami yang memutuskan untuk berpisah, akhirnya Togu hadir dengan pukulan blues nya yang membangunkan lagi hasrat kami untuk bermimpi lebih jauh. Kini kami hanya ingin mimpi kami terdengar dan berharap dapat membangkitkan kembali kejayaan musik rock.','Rock','instagram;','Jakarta',1274,'2017-09-05 22:54:27','2017-09-05 22:54:27'),(733,'Q-OZ ZEROFIVE','1508562195.jpg','Berdiri tanggal 05/05/2005.\r\nQ-oz zerofive sendiri telah banyak mengikuti festival-festifal dan parade di berbagai tempat baik di dalam kota maupun luar kota.seiring dengan proses itu,kami pun memiliki jam terbang sebagai bintang tamu baik didalam kota maupun luar kota','Rock','umi;','Jakarta',1275,'2017-09-05 23:36:19','2017-10-20 21:03:15'),(734,'EGO BAND','1504683571.jpg','Single \" Permainan Cintamu \" dan \" Seharusnya Setia \" meski lewat jalur indie tapi sudah diputar secara reguler di 40 radio di seluruh indonesia dan sudah terdaftar di spotify','Pop','facebook;lainnya;','Surabaya',1255,'2017-09-05 23:39:31','2017-09-05 23:39:31'),(738,'Mier','1504685605.jpg','Mier, /mɪ yɛr/ atau disebut juga sebagai Mier Music, sebuah band Alternatif Rock yang berdomisili di kota Medan, berasal dari kota Medan, Sumatera Utara, Indonesia. “Mier” sendiri merupakan anagram dari kata “Meir”, yang diambil dari nama Jewish yang memiliki arti “sesuatu yang bersinar”. Terbentuknya Mier diusung oleh Ihsan, Farid, Dafi, Ardi, dan Reza. Mier sendiri merupakan perubahan dari grup band SIX yang sudah aktif sejak 2015. SIX sendiri sudah pernah bekerjasama dengan beberapa musisi lokal dalam menjalankan kegiatan musik, antara lain raka ivanda, rizki pillo, serta mawi. Melanjutkan karir bermusik dalam naungan band, ihsan, farid, dafi bersama ardi dan ezak, menyusun kembali nama serta manajemen band untuk memulai menghasilkan karya sebagai band indie, yaitu Mier. Dalam menghasilkan karya musik, Mier mengambil beberapa musisi-musisi dunia sebagai referensi, antara lain Angle and Airwaves, Radwimps, The Killers, dan sebagainya. Keinginan untuk menyuguhkan musik yang ringan didengar dan dapat diterima golongan muda, tanpa mengurangi nuansa rock dan sentuhan modernisasi dalam dunia musik, Mier telah memperdengarkan hasil karya pertamanya ke dunia pada Juli 2017. Singel perdana Mier yang berjudul “Puisi Sunyi” dapat diakses pada banyak media pemutar lagu online seperti iTunes, Spotify, Deezer, dan masih banyak lagi.','Alternative Rock','instagram;','Medan',199,'2017-09-06 00:13:25','2017-09-06 00:13:25'),(744,'sound of inspiration','1504685911.jpg','terbentuk tanggal 5 maret 2008, dengan konsep pop groove dengan musik yg fresh dan fun, berharap bisa memberikan inspirasi positif bagi pendengar. meluncurkan single pertama yang berjudul \"hari ini indah\" dalam album \"student stars compilation\" pada tahun 2008. tahun 2010 meluncurkan single ke 2 berjudul \"salah siapa\" dalam album \"go green compilation\" bersama CSA record. pada tahun 2012 kami meluncurkan album indie pertama yang berjudul \"impian\" dengan single \"selalu ku rindukan\".pada tahun 2013 kami merilis single ke 2 dari album pertama berjudul \"impian\" dan berhasi masuk ke dalam album kompilasi kickfest 2013 yang di rilis di malang pada bulan mei. di tahun 2014 kami merilis single terbaru berjudul \"good time\"','Pop','maliq;','Jakarta',447,'2017-09-06 00:18:31','2017-09-06 00:18:31'),(747,'Hyu','1504687583.jpg','Cerita:\r\nBerawal dari pertemuan di studio di bilangan Jakarta Selatan pada tahun 2011, pada saat itu kami para personil memiliki Band masing-masing. Dan singkat cerita Band yang kamu punya masing-masing akhirnya menemukan titik jenuh yang tidak dapat di persatuan lagi, dan akhirnya guntur, sera, kiki, dedi memiliki visi dan misi bermusik yang sama, kami bentuklah band yang bernama HYU. Hingga saat ini kami sering mengikuti berbagai macam lomba festival. Tujuan kami dalam bermusik supaya kami dapat menghibur para penikmat musik tanah air, dan dapat di terima di industri musik Indonesia. \r\n\r\nPrestasi band :\r\n- juara 1 festival lomba full band majalah aneka yes sudirman 2014\r\n- juara 2 lomba akustik tahun 2016 baywalk pluit mall (musik indie bersatu) \r\n- juara 2 lomba akustik band Religi tahun 2017 blok M square  (FORMI forum musik indie)','Pop','facebook;','Jakarta',1278,'2017-09-06 00:46:23','2017-09-06 00:46:23'),(748,'JAVA JAVU','1504687688.PNG','JUARA 1 PIALA MENPORA \"ANDI MALARANGENG\"\r\nJUARA 1 HONDA BLADE NATIONAL\r\nJUARA 1 FESTIVAL TRINI NATIONAL\r\nJUARA 3 HUT TVRI NATIONAL','Rock','guitar_plus;','Jakarta',894,'2017-09-06 00:48:08','2017-09-06 00:48:08'),(749,'Basic Evolution','1504689367.JPG','Basic Evolution adalah sebuah band yang berasal dari Kota Depok, Jawa Barat, Indonesia. Band yang terbentuk pada Agustus 2012 lalu ini digawangi oleh 5 orang, yaitu :\r\n- Ichsan Novan Septian / Vocal, Rythm\r\n- Fachri Ghozali / Lead Guitar\r\n- M. Dinda Nugroho / Midi Controller, Vocal\r\n- Dien Galuh Ekananda / Bass\r\n- Ludfi Satria Nugraha / Drum\r\n\r\nKonsep musik yang Basic Evolution terapkan adalah \"Pop Sweet Punk\". Genre musik ini merukapan perkembangan dari Pop-Punk pada umumnya, hanya saja Basic Evolution memainkan musik Pop-Punk yang cenderung tidak melupakan nuansa lembut yang diberikan dari instrument midi controller. Karena hal itu kami menyebut musik yang kami mainkan bergenre \"Pop Sweet Punk\" \r\n\r\nBasic Evolution sudah menyelesaikan Mini Album pertama mereka yang bertajuk \"Monologue\" pada pertengahan tahun lalu. Mini album ini berisikan 5 buah lagu oroginal dari Basic Evolution, yaitu :\r\n- Aku Bukan Mereka\r\n- Mellisa\r\n- Running Out Of Time\r\n- Lost In Wonderland\r\n- The Night Is Alright\r\n\r\nDan pada pertengahan bulan Agustus 2017 lalu, Basic Evolution baru saja menyelesaikan sebuah film pendek berjudul \"Aku Bukan Mereka\" yang disutradarai oleh Haqie Rivardy. Film pendek ini merupakan pengembangan dari lagu andalah Basic Evolution yang berjudul \"Aku Bukan Mereka\". Setelah project film pendek ini, Basic Evolution berencana melanjutkannya dengan membuat video clip untuk lagu \"Aku Bukan Mereka\" tersebut. Jika tidak ada perubahan, project ini akan dilaksanakan pada awal tahun depan.\r\n\r\n\r\nBasic Evolution juga sering melakukan perform diberbagai pensi-pensi sekolah dan berbagai festival di daerah Jabodetabek, serta beberapa kali menghadiri undangan Radio.','Others','guitar_plus;','Jakarta',1285,'2017-09-06 01:16:07','2017-09-06 01:16:07'),(750,'The CleanTones','1504689624.jpg','- Top 5 finalist UI Music Festival 2016\r\n- 3rd Winner Liga Medika 2016\r\n- 1st Winner CGT 2016\r\n- Finalist CompFest 2016 & CompFest 2015\r\n- Playing at Labsproject 2017, Grand Closing UI Art War 2016, Pop Up Market 2015, Kuliner Merdeka, Tangerang Jazz Fest 2015','Alternative Rock','poster;teman;','Jakarta',1202,'2017-09-06 01:20:24','2017-09-06 01:20:24'),(751,'FOX FORT','1504690843.jpg','Fox Fort beranggotakan 5 manusia yang bertemu di sebuah kampus di kota Bandung yang mempunyai hobi yang sama di bidang musik yang beranggotakan Arga (Vocals, Guitar), Anyu (Drums, Percussion), Valdy (Backing Vocals, Guitar ), Lukman (Bass), dan Bayu (Guitar). \r\n\r\nMakna dari nama Fox Fort itu sendiri yaitu yang pertama “Fox” adalah rubah yang selalu beraktifitas dan berfikir keras pada malam hari karena pada waktu tercipta nama Fox Fort itu kami sedang duduk di bangku kuliah yang memiliki kebiasaan tidur menjelang pagi hari datang. Sedangkan “Fort” yang berartikan benteng, itu memaknai bahwa pondasi dari band ini kuat dan tidak bisa rubuh yang diibaratkan dengan materi-materi lagu yang kuat yang menjadi pondasi dari band Fox Fort sendiri dan menjadi modal dan bekal untuk gendang telinga para calon audience dari Fox Fort untuk merasakan hal yang berbeda pada setiap lagu yang kami buat.','Alternative Rock','instagram;','Jakarta',1289,'2017-09-06 01:40:43','2017-09-06 01:40:43'),(752,'Life Cicla','1504691670.png','LIFE CICLA Lahir dan Hadir di kota Cibinong, Bogor. Pada tanggal 11-12-2013. Nama LIFE CICLA memilik arti “Siklus Kehidupan”, Di ambil dari konsep music kami yang berisi tentang bagaimana memandang dan menjalani hidup. Karena, Life Cicla tidak ingin sekedar bermusik melainkan ingin bisa menyampaikan pesan pesan dari setiap lagu kepada masyarakat. Unsur ethnic & Rockoustic tidak lepas dari karya karya kami. Sentuhan gamelan dan instrument – instrument lain lahir ketika kami mengagumi keragaman dan keunikan yang ada di Tanah Air Indonesia.\r\nPada tahun 2013 Life Cicla merilis Official Mix Video Lagu Mata Hati, lalu pada tahun 2014 Life Cicla merilis mini album “From The Country with a Thousand Island yang berisikan tiga track. Setahun kemudian Life Cicla merilis song cover Rasa Sayange serta Kicir kicir. Dan pada tahun yang sama dibantu Paviliun Records dalam hal pendistribusian Life Cicla merilis Full Album “Jejak Pesinggah” yang berisikan 11 Track.\r\n\r\n\r\nOn Air \r\n\r\n2015\r\n\r\nOz Radio Jakarta\r\nBinus Tv \r\nTaman Buaya TVRI\r\n\r\n2016\r\n\r\nTrending Topic Jak Tv\r\nArdan Radio Bandung\r\nSapa Indonesia Pagi Kompas Tv\r\nIndonesia Morning Show\r\nTonight Show \r\n\r\n2017 \r\n\r\nDCDC Musik Kita Global Tv\r\n\r\nOff Air\r\n\r\nUrban Action\r\nPop Up! Demajors\r\nKisi Fest\r\nPesta Rakyat Jakarta\r\nA Mild Soundsation\r\nFreedom Fest\r\nRevolution Trisakti\r\nKlipKlim.com','Folk','facebook;','Jakarta',1213,'2017-09-06 01:54:30','2017-09-06 01:54:30'),(753,'Daneen','1504694739.jpg','Juara 2 Smex Band Competition 2017\r\nJuara 3 Smex Band Competition 2016\r\nJuara 1 High Up Festival 2017\r\nJuara 1 Engine Brake Band Competition 2016\r\nJuara 1 Mexpo Band Competition (Unair) 2016\r\nJuara 1 Enginering Festival (Ubaya) 2017\r\nJuara 1  Fisip Umsida Band Competition 2017\r\nJuara 3 Adi Buana Band Competition 2017\r\nJuara 3 ISTTS Band Competition 2016\r\nJuara 1 Unesa Band Competition 2015\r\nJuara 1 PUV (Ubaya) Band Competition (2014)\r\nBest Song Stiesia Festival 2016','Pop','instagram;umi;maliq;poster;teman;','Surabaya',1227,'2017-09-06 02:45:39','2017-09-06 02:45:39'),(754,'Fair','1504695123.png','Band yang berasal dari depok dengan konsep baru dari format lama dengan tambahan personil baru yang mengusung aliran musik british pop. dengan menciptakan terus karya lagu itu bagi kami adalah prestasi tersendiri','Pop','instagram;teman;lainnya;','Jakarta',1176,'2017-09-06 02:52:03','2017-09-06 02:52:03'),(755,'Bleeding Last Season','1504696244.jpg','Band asal kota Banyuwangi - Jawa Timur yang terbentuk dari tahun 2015 yang mencoba memberi warna baru pada musik indie Indonesia dengan mengusung genre Deathcore yang berbeda dari musik Underground yang lain. Bleeding Last Season mempunyai dua single. Single perdana berjudul \"Bloody Mary\" dan baru saja mengeluarkan single kedua yang berjudul \"Shoot Me\" yang sudah dapat didengar di Reverbnation / Soundcloud beserta VideoClip yang dapat ditonton pada saluran YouTube kami \"Bleeding Last Season\"\r\n\r\nUntuk prestasi, kami masuk top 10 bands dalam event BeholderFest (Bandung) yang di ikuti oleh band Indie seleruh Indonesia dan kami adalah salah satu yang mewakili Jawa Timur dalam audisi tersebut. Dan juga kami sudah sering perform dalam event besar di wilayah kami maupun di luar kota. Event besar yang pernah kami kunjungi seperti BeholderFest (Bandung), JakCloth 2016 (Jember), JemberIndieClothing (Jember), JemFest (Jember), Soundanger (Jember) dan kami juga sering menjadi Guest Stars di kota kami (Banyuwangi) seperti GrandOpening ExhaleApparel Store, RockGoJampi, Serdadu Blambangan #1, Banyuwangi Youth Fest 2017, Brotherhood 2017 dan lain lain. Lagu kita \"Shoot Me\" juga sering masuk dalam nominasi top Indonesia Deathcore songs di berbagai Channel YouTube indie di Seluruh Indonesia seperti PalingBerisik, Loudonesia, Indonesian Deathcore dan lain lain.\r\n\r\nLebih lengkap nya bisa di cek FansPage akun kami \r\nInstagram : https://www.instagram.com/bleedinglastseason/\r\nFacebook : https://www.facebook.com/bleedinglastseason/\r\nReverbnation : https://reverbnation.com/bleedinglastseason\r\nSoundcloud : https://soundcloud.com/bleedinglastseason\r\nChannel YouTube : Bleeding Last Season','Others','instagram;guitar_plus;','Surabaya',1292,'2017-09-06 03:10:44','2017-09-06 03:10:44'),(756,'Gema Reunion','1504699593.jpg','Gema berdiri tahun 2009. Gema memiliki genre pop yang terdiri dari 3 personil tetap. Gema mempunyai single hits yang berjudul  \"Salahku\" Cipt.Ade Gema. Prestasi kami dari tahun 2004 sampai 2008 menjuarai festival band diberbagai event,karena awalnya kami bergenre Rock. Tahun 2009 kami memutuskan utk merubah genre kami menjadi pop.','Pop','poster;teman;','Jakarta',1287,'2017-09-06 04:06:33','2017-09-06 04:06:33'),(757,'Never Turn Left','1504700892.png','Never Turn Left terbentuk pada 12 April 2017, berawal dari ujian Unit Kegiatan Mahasiswa (UKM) Band Metronome UHAMKA. Band ini terbentukdengan formasiCatur (Vokal), Aan (Guitar), Aldo (Guitar), Ilham (Drum), Jajang (Bass) dan mengusung genre Pop Punk. Seiringberjalannya waktu kami berhasil merilis single pertama yang berjudul Hey Kawan. Dalam lagu ini Never Turn Left featuring dengan Fanfun. Lagu ini ditulis oleh Fanfun dan Aan. Setelah menyelesaikan single pertama kami membuat single kedua yang berjudul Luka Cinta. Lagu ini ditulis oleh Aan guitaris dari Never Turn Left.\r\nSaat ini kegiatan yang sering diikuti adalah perform di berbagai acara seperti gigs dan acara pensi lainnya. Kami juga sering mengisi acara internal di kampus seperti Metrofest 3, yaitu acara UKM Band Metronome yang diadakan setiap tahun.','Others','instagram;teman;','Jakarta',1243,'2017-09-06 04:28:12','2017-09-06 04:28:12'),(758,'MINERAL EFFECT','1504700924.jpg','Terbentuk 10 Mei 2011, dengan 4 personil awal dan telah memproduksi 6 buah lagu (mini album). Salah satunya masuk dalam kompilasi album KICKFEST Malang 2013. Dan saat ini adalah formasi yg ke 6 dengan 5 personil.','Alternative Rock','teman;','Surabaya',1250,'2017-09-06 04:28:44','2017-09-06 04:28:44'),(759,'Fat Industry','1504700947.jpg','At first , Fat Industry was just a bedroom project. But after a few demo/project we decide to take this band outside the bedroom and let people listen to our song. Through this event, we hope to make a great debut for the band.','Alternative Rock','facebook;instagram;','Jakarta',1296,'2017-09-06 04:29:07','2017-09-06 04:29:07'),(760,'Monster Pengerat Wortel','1504701909.jpg','Sebuah band dengan karakter yang sangat kuat, baik dalam segi musik dan juga lirik. Genre musik dengan pengaruh era lama yang authentic dan unique, sering kali membuat band ini mendapat julukan \"penjelajah mesin waktu\"\r\nKomposisi pop yang dipadukan dengan unsur dixie tanpa terompet, dibalut nuansa kegelapan nan mendalam, berhasil membuat karya mereka diperhitungkan oleh beberapa radio indie di Eropa dan Amerika. Sempat merekam 2 lagu dalam bentuk video live performance, semakin memantabkan mereka untuk meluncurkan EP / album kedepannya','Others','facebook;instagram;','Surabaya',1295,'2017-09-06 04:45:09','2017-09-06 04:45:09'),(761,'Freak Deed','1504706571.jpg','Kita mencoba menyatukan rasa musik dihati masing\" personil dan kita kemas menjadi sebuah lagu','Alternative Rock','facebook;instagram;teman;','Jakarta',1303,'2017-09-06 06:02:51','2017-09-06 06:02:51'),(762,'Sevenday\'s band','1504707619.jpg','Cerita nya : sudah sering mengikuti festival musik di lampung dan pernah menjadi bintang tamu di acara acara dan di chanel tv lokal yang ada di lampung\r\nFrestasinya : baru memiliki 1 lagu single lembaran baruku hasil seni sendiri dan video klip','Alternative Rock','instagram;teman;','Jakarta',1184,'2017-09-06 06:20:19','2017-09-06 06:20:19'),(763,'DASHA 4FACE','1504708442.jpg','Dasha 4Face mencoba berkarya untuk meramaikan kancah musik dengan konsep sederhana.mengungkap perasaan berkarya lewat musik...','Pop','teman;','Yogyakarta',1301,'2017-09-06 06:34:02','2017-09-06 06:34:02'),(764,'Mistletoe','1504708598.jpg','Sejarah singkat MISTLETOE \r\nMistletoe band berdiri pada tanggal 6 Mei 2016, band asal BandungBandung ini mengambil genre rock alternatif. Kata MISTLETOE berarti sebuah gantungan harapan,  Prestasi Mistletoe masuk 5 besar di ajang Battle Coustic bisa di lihat di IG @kremamanagment','Alternative Rock','instagram;teman;','Jakarta',1299,'2017-09-06 06:36:38','2017-09-06 06:36:38'),(765,'Meyza Band','1504710962.jpg','Meyza Band berasal dari kota Bogor, Jawa Barat. Band ini terbentuk tanggal 14 February 2012 yang beranggotakan saat ini yakni Rendy sebagai Vocalis, Canski sebagai Gitaris, dan Dira sebagai Keyboardis. Genre yang diusung oleh Meyza band adalah Pop Rock.\r\n\r\nSelama 5 tahun diawal, Meyza band aktif sebagai pengisi acara dan bintang tamu pada acara-acara budaya Jepang, seperti Gelar Jepang UI, Jiyuu Matsuri UNJ, dan Bijac no Tanjowai Binus. Dan di tahun lalu, 14 Februari 2016. Meyza band sudah merilis Single Album \"Prologue\". Album ini dipasarkan oleh outlet Kizaru Animanga cabang Jakarta dan Bandung.','Alternative Rock','guitar_plus;poster;teman;','Jakarta',1212,'2017-09-06 07:16:02','2017-09-06 07:16:02'),(766,'TSOS','1504711002.jpg','Berbicara tentang prestasi, sampai saat ini, kami telah merekam dan merilis sebanyak 12 lagu yang dapat didengar di berbagai music store seperti Spotify, iTunes, Soundcloud, dll. di mana 5 di antaranya masuk ke dalam Mini Album kami yang berjudul “With Words”, yang resmi kami rilis pada bulan Mei 2016.','Pop','instagram;','Jakarta',1308,'2017-09-06 07:16:42','2017-09-06 07:16:42'),(767,'Mery Celeste','1508562117.jpg','Mery Celeste, merupakan Band Indie Pop/Rock lahir di Bogor pada tahun 2013. Nama Mery Celeste juga dipilih Oleh Rifqi Danu sang vokalis, yang merupakan nama suatu Kapal Kargo yang hilang di Samudra Atlantik. Mery Celeste baru merilis 2 single berjudul Orange dan Sham. Keduanya pernah memenangkan beberapa chart di beberapa media, seperti 1st Chart DCDC Musikkita Indie 2016, Hits Play Sushi 99.1 FM Padang, 1st Chart Demos Hai Magazine (Oct 2015), 1st Chart Indie Pro 2 RRI Bandung 2015, 1st Chart Oz Radio Bali 2015. Selain itu mendapatkan juga apresiasi sebagai, 1st Best Indie Band RRI Indonesia, 1st Band Indie Jakarta Audio Pro, Finalis Road to Soundrenaline Bali. Pada tahun 2016 Mery Celeste diberikan kesempatan berharga bisa kolaborasi bersama salah satu band idola Pure Saturday (Bandung) di GlobalTv pada acara DCDC Musikkita.','Pop','instagram;umi;maliq;teman;','Jakarta',1298,'2017-09-06 07:19:48','2017-10-20 21:01:57'),(768,'VETO','1504711937.jpg','Veto adalah band bernuansa Pop yang siap menggebrak industri musik Indonesia dengan lagu yang bertemakan cinta, perjuangan dan harapan','Pop','guitar_plus;','Jakarta',989,'2017-09-06 07:32:17','2017-09-06 07:32:17'),(769,'NINETY','1504713060.png','Ninety is an Indonesia Band with four personnel formed in August 2013 in Jakarta, Indonesia. It currently consists of Arya Nara Kusuma, Ryan Rizki Ramanda, Dimas Dzulfi Kurniawan, and Lanang Hanggoro. Their music style is inspired by the sound of 90\'s. The band brought their songs to the stream music of rock','Rock','instagram;teman;','Jakarta',1305,'2017-09-06 07:51:00','2017-09-06 07:51:00'),(770,'RAP N RESPECT','1504713464.jpg','Kami grup band asal Solo yang terbentuk pada tanggal 10/10/2010. Sempat beberapa kali berganti personil, dan pada saat ini kami beranggotakan 6 orang yaitu Syahrul (rapper), Yuditya (rapper & human beatbox), Wahyu (vokal & bass), Raihan (gitar 1), Sabar (gitar 2) dan Azri (drum). Kami sepakat dari awal terbentuk bermusik di genre hiprock, berkiblat pada Bondan Prakoso & Fade2Black, Saint Loco, Linkin Park.\r\n\r\nKenapa memilih hiprock? Karena menurut kami hiprock adalah jiwa kami, it’s our soul. Dan menurut kami di Solo atau bahkan di lingkup Surakarta pada umumnya, masih jarang yang mengabungkan sebuah rap digarap dalam format full band seperti ini. Kami coba mengambil “celah” yang berbeda dari kebanyakan genre musik yang laku dan booming pada saat ini. Kami tetap optimis untuk ber-hiprock karena kami yakin bahwa setiap genre musik itu pasti ada penikmatnya masing-masing.','Others','guitar_plus;','Yogyakarta',420,'2017-09-06 07:57:44','2017-09-06 07:57:44'),(771,'Violet Fighters','1508562571.jpg','Violet Fighters Band adalah band yang berasal dari kota Palembang yang terdiri dari empat personil yaitu Didit ( Vocal, Guitar ), A\'uw ( Guitar Lead ), Adi ( Bass ) dan Reza ( Drum ) yang masing masing personel berbeda style dan karakter serta latar belakang musik yang berbeda juga, namun saling melengkapi karena semua personel Violet Fighters menyukai berbagai jenis musik dan menerapkan dalam setiap permainan mereka, namun Violet yang berdiri pada tahun 2010 tetap solid dan selalu saling memahami porsi masing-masing personel dan juga kekeluargaan pastinya. Band Violet ini Pernah bermain bersama atau mengiringi artis-artis seperti Bang Ariyo Wahab The Dance Company, Candil Serius Band, Andy RIF, Judika dll dan juga Performing di acara Big Event dan juga Off air event di kota Palembang serta di Hotel dan Cafe-cafe ternama di kota Palembang. Band- band besar seperti U2, Xtreeme, Nirvana, Foo Fighters, Travis, Blink 182, Maroon 5 memiliki pengaruh besar di band ini namun Violet Fighters tetap memiliki karakter bermusik khas sendiri dan tertuang dalam karya yang berjudul \"Garis Batas\" dan ikut serta dalam Levi\'s Band Hunt dan ingin bisa memberi warna baru dalam dunia musik Indonesia, Maju terus Musik Indonesia. Suksess teruss Levi\'s dan Levi\'s Band Hunt Big Thanks','Alternative Rock','facebook;instagram;informasi_toko;umi;poster;teman;','Jakarta',1196,'2017-09-06 08:05:38','2017-10-20 21:09:31'),(774,'suburbians','1504720486.jpg','Suburbians, adalah band yang terdiri dari tiga orang yang terbentuk pada pertengahan 2016, mengusung genre Alternative Sad-Punk. Terbentuk di kota Bekasi, Jawa Barat. Band ini terbentuk karena pertemanan semasa SMA yang mana karena kesukaan dalam bermusik dan keinginan untuk mengibarkan bendera di kota kami sendiri.','Others','facebook;informasi_toko;poster;teman;','Jakarta',1120,'2017-09-06 09:54:46','2017-09-06 09:54:46'),(775,'vocad band','1504720768.jpg','Konser di acara band anak muda (BAM) TVRI riau ... live acara lagu pilihan pemirsa (LPP) distasiun TVRI riau ... lolos seleksi jadi band pembuka kotak di acara soundstations roud to soundrenaline 2017 di lap.bola pangkalan kerinci riau... diundang on air dipersada radio pekanbaru di acara local heroes','Pop','instagram;','Jakarta',402,'2017-09-06 09:59:28','2017-09-06 09:59:28'),(776,'BEMBI','1504721838.jpg','Teman-teman seperjuangan dari kafe ke kafe, hingga wedding dan event, kami memutuskan untuk mencoba membuat karya sendiri. Kami punya sebuah tujuan sederhana, yaitu membangkitkan kembali semangat musik band pop yang pernah populer di tahun 1990-2000an.','Pop','maliq;','Jakarta',1323,'2017-09-06 10:17:18','2017-09-06 10:17:18'),(777,'NOY BAND','1508562156.jpg','NOY terbentuk dari tahun 2011 yang mengusung aliran trans pop, berasal dari kota Palembang yang beranggotakan lima personil Reva (vocal), Dedi (gitar), Hafizh (gitar), Agus (bass), Eby (drum)\r\n\r\nFilosofi NOY itu sendiri adalah singkatan dari sebuah kata \"Not Only You\" (bukan hanya kamu), dan NOY pun kami definisikan suatu keoptimisan dalam hal positif yang dimana setiap orang bisa untuk menggapai sebuah impiannya yang tak terbatas bukan hanya kamu,aku, ataupun mereka\r\n\r\nTema dari musik yang kita buat tetap ada unsur cinta dan kehidupan yang dikemas dari ide2 kita berlima dengan influence yang berbeda','Pop','instagram;','Jakarta',1160,'2017-09-06 10:43:39','2017-10-20 21:02:36'),(778,'TELECOUSTIK','1504724580.jpg','Juara indigital fest quardata 2017','Pop','facebook;instagram;guitar_plus;lainnya;','Jakarta',1326,'2017-09-06 11:03:00','2017-09-06 11:03:00'),(779,'Coffee Strikes','1508561463.jpg','COFFEE STRIKES adalah band yang terbentuk di Kota MEDAN pada tanggal 22 November 2014.\r\nCOFFEE STRIKES memulai gerakan musiknya dengan mengupload video-video cover musik di YouTube dan Instagram dengan ciri khas\r\n“ROCK VERSION” pada setiap lagu yang mereka cover.\r\nKarena mendapat respon yang baik dari audiens, mereka sepakat untuk menciptakan mini-album yang didalamnya berisikan lagu-lagu original ciptaan sendiri.\r\n\r\nPrestasi :\r\n- 10 besar dalam kompetisi Digital Icon di Jakarta perwakilan dari Medan (saat itu masih bernama AFTERNOON Band)\r\n- Juara 2 pada festival band \"Rock Pool\" di Kota Medan\r\n- Juara 2 pada festival band \"Road to NORTHBLAST\" di Medan\r\n- Best guitarist pada festival band \"Road to NORTHBLAST\" di Medan','Alternative Rock','facebook;instagram;guitar_plus;umi;poster;teman;','Medan',1146,'2017-09-06 11:32:21','2017-10-20 20:51:03'),(780,'D\'Minim','1504726918.jpg','Mengisi acara karnaval ancol\r\nMengisi acara dalam rangka HUT kota Bekasi\r\nMengisi acara dalam rangka Pekan Raya Jakarta','Others','facebook;instagram;teman;','Jakarta',1321,'2017-09-06 11:41:58','2017-09-06 11:41:58'),(781,'Lune','1504730141.jpg','Bermula dari sharing tentang musik bareng, kemudian atas dasar hasrat bermusik kami tercetuslah band ini. Mengusung genre Rock/Stoner, kami terinspirasi oleh band seperti Black Sabbath, Sleep, Pentagram, The SIGIT.','Rock','instagram;','Jakarta',1322,'2017-09-06 12:35:41','2017-09-06 12:35:41'),(782,'Vaterland Band','1504750102.png','Berawal dari mempunyai hobi dan bercita-cita di musik, Andri dan Dzikri adalah satu Grup Band sewaktu SMA. Setelah lulus SMA kami bubar dan berjalan sendiri-sendiri. Setelah lewat 1 tahun Andri dan Dzikri memutuskan untuk bergabung dan membuat Band kembali, tanpa banyak membuang waktu kami pun bertemu dengan Hendri, [Hendri sendiri adalah teman Band Dzikri sewaktu dulu di SMP]. Setelah posisi terisi ber 3 kami pun membentuk band tanpa Drummer, terpaksa posisi Bassist di alihkan menjadi Drummer \"Sementara\" melewati pencarian yang rumit akhirnya masuklah Ryan, [Ryan sendiri adalah teman kerja Andri] setelah masuknya Ryan sebagai Drummer kemudian di susul masuknya Inno yang menempati posisi Vocalist, [Inno sendiri adalah teman kerja dari Andri dan Ryan]. Setelah membicarakan Band ini ternyata kami ber 5 cocok 1 sama lain, 1 mimpi dan 1 cita-cita, dari kecocokan ini kami mencoba untuk menyatukan semua perbedaan yang ada, untuk genre musiknya sendiri kami memutuskan untuk mencoba menyatukannya lewat musik yang kami usung \'Alternatif\' (Pop Rock). Nama VaterLand sendiri pun akhirnya kami tetapkan sebagai tempat penaungan karya-karya kami, VaterLand sendiri yang kami ambil dari bahasa Jerman yang berarti TANAH AIR mewakili filsuf yang berarti bahwa kami mencintai tanah air, siap berdiri dan melangkahkan kaki di blantika musik tanah air. Mengapa menggunakan bahasa asing jika cinta tanah air..? Karena kami berharap, tidak hanya di tanah air, tapi musik kami bisa sampai ke negeri lain. Dengan kami mencoba mengedepankan karya dan cita-cita semoga kami dapat diterima di industri musik Indonesia.\r\nlalu kami dan seluruh anggota memutuskan untuk berinovasi dengan membuat projek baru dengan Kiki (teman kerja dari Andri, Inno dan Ryan), yang sejak pindah ke Pringsewu ikut mendukung VaterLand (sebagai manajer) sebagai vokalis menggantikan Inno yang memutuskan untuk fokus memperdalam kemampuan bermusiknya (sembari memegang peran manajer menggantikan Kiki).\r\nSemoga dengan formasi baru ini VaterLand dapat semakin berkembang dan mampu melebarkan sayap hingga ke seluruh penjuru negeri.\r\n\r\nPenghargaan\r\n~ Live perfome di PRESMOVE MARKET 2017 di Pringsewu, MIE TIME CAFE tgl 19 Agustus 2017.\r\n\r\n~ Pringsewu Rockinmob 2017 di Pringsewu, Rest Area Pringsewu tgl 5 dan 17 Agustus 2017.\r\n\r\n~ Guest star di Putri Hijab Tanggamus 2017 di Gedung NU, Gisting tgl 14 Mei 2017.\r\n\r\n~ Juara Harapan 1 Pringsewu Acoustic Parade #2 yang di selenggarkan di Sokrim Cafe tgl 17 Juni 2017.','Alternative Rock','teman;','Jakarta',1224,'2017-09-06 18:08:22','2017-09-06 18:08:22'),(783,'MANUVER','1504753301.jpg','BAND ASAL BATAM, TERBENTUK 2016 AWAL \r\nTELAH MEMILIKI 3 SINGLE JAGOAN..','Pop','facebook;instagram;teman;','Jakarta',1314,'2017-09-06 19:01:41','2017-09-06 19:01:41'),(784,'Lada','1508562048.jpg','Lada adalah band asal Cibinong, Bogor yang memiliki segudah prestasi. Band yang digawangi oleh Ale Funky dan Cyntia ini terbentuk atas kesukaan mereka terhadap musik pop rock era 90-an. Ale sendiri adalah salah satu juara perta Supergitar Competition tahun 2015 lalu. Lada juga pernah menjadi juara di ajang festival band di Cibinong pada 2014 lalu.','Rock','guitar_plus;','Jakarta',1339,'2017-09-06 19:02:22','2017-10-20 21:00:48'),(785,'HIVE ID','1504754332.JPG','Berawal dari band kampus yang dibentuk oleh Faisal, Aha, dan Aris di akhir 2010, mimpi yang besar dan keinginan untuk tetap menjalankan passion bermusik walaupun setelah lulus kuliah menjadikan HIVE tetap eksis hingga sekarang.\r\n\r\nTelah aktif manggung di Jakarta sejak akhir 2015 khususnya di scene indie berbasis komunitas tempat mereka aktif bersosialisasi, 101% Music Community, HIVE mulai dikenal luas di Jakarta, dan telah bermain di beberapa panggung besar seperti panggung Cardinal di Pekan Raya Jakarta dan juga telah pernah tampil live sebagai guest star di program Teras Sore di Elshinta TV.\r\n\r\nKini di tahun 2017, HIVE fokus kembali ke root mereka sebagai musisi yaitu untuk berkarya, kembali ke studio untuk menyelesaikan beberapa lagu barunya yang siap untuk direkam dan diperdengarkan ke khalayak.\r\n\r\nKesempatan yang ditawarkan Levi\'s Band Hunt merupakan peluang emas bagi HIVE untuk bisa mendapatkan partner yang mumpuni dalam memperdengarkan karya-karya bermusik terbaru mereka, karya musik yang memadukan karakter vocal falsetto khas dari Aha yang berbau Japanese Rock, dengan aransemen musik khas British yang banyak dipengaruhi oleh Radiohead, Oasis, dan tentunya, The Beatles.\r\n\r\nGet ready to be HIVED.\r\n\r\nFB Page: https://www.facebook.com/HIVE.ID.OFFICIAL/\r\nTwitter: @HIVE_ID\r\nYoutube Channel: https://www.youtube.com/channel/UC1s4jn4MzCy63uNKwlgT1Sw','Alternative Rock','instagram;','Jakarta',1341,'2017-09-06 19:18:52','2017-09-06 19:18:52'),(786,'Syntesis','1504755179.jpg','Kami adalah band berasal dari Pringsewu Lampung yang ingin bercita cita menjadi band yang punya karakter bermusik tersendiri, band kami pernah mengikuti festifal musik dan masuk kedalam 5 besar, dan mendapt 2 piagam, kami juga sering mengisi acara di cafe cafe.','Pop','instagram;guitar_plus;','Jakarta',962,'2017-09-06 19:32:59','2017-09-06 19:32:59'),(787,'Walker','1504755297.jpg','Walker\r\nIndonesian Thrash Metal ,Cikalong Wetan , Bandung Barat.ID\r\n\r\nWalker adalah band yang berbasic aliran thrash metal, pada awalnya Walker hanya fokus pada materi lagu lalu dimainkan di studio, dikarenakan kesibukan para personil masing-masing. pada suatu waktu ada ajang pencarian bakat yaitu Hellprint West Java Invasion 2015,Walker mencoba peruntungan di ajang pencarian bakat tersebut. Dan tidak disangka ternyata Walker berhasil menjuarai ajang pencarian tersebut. Kini Walker sedang dalam menjalani promo album yang bertitle Mr.Walker dan akan membuat E.P di akhir tahun 2017 ini.\r\n\r\nContact : Subhan Rizal\r\nSms/Phone: 0896-5395-5936\r\nEmail : walkerthrash06@gmail.com\r\nFacebook : Walker Thrash\r\nInstagram : @walkerthrash\r\nTwitter : @walkerthrash\r\nAnother website:\r\nsoundcloud.com/walkerthrash \r\nreverbnation.com/walkerthrash\r\nhttps://www.youtube.com/channel/UCp4LDmdGfCoChD-mEjc-mRA','Others','facebook;instagram;guitar_plus;umi;poster;teman;lainnya;','Jakarta',1259,'2017-09-06 19:34:57','2017-09-06 19:34:57'),(788,'maGna','1504755501.jpg','magna terbentuk sejak tahun 2008 di kota Bogor..awal kami terbentuk karena persamaan visi dalam bermusik..sudah banyak event yang kita lalui seperti musik asik nesacafe..event radio bogor di megaswara fm,lesmana fm dsb..akhir kata mudah2 an kami bisa melangkah lebaih baik dan maju lagi dengan mengikuti event dari Levi\'s..\r\n\r\nSalam dari kami,\r\nMaGna','Pop','instagram;','Jakarta',1338,'2017-09-06 19:38:21','2017-09-06 19:38:21'),(789,'JackLine','1504757312.jpg','Dibentuk pada 1 oktober 2014, band kita bergenre MoodFlusso , kenapa genre kami moodflusso karena di lagu pada album kami terdapat banyak sekali genre. dari pop, funk, rock, folk, dan lain-lain. dan masih belum kita sebarluaskan\r\n\r\nJackLine pernah mendapatkan juara 2 pada tahun 2015 di acara festival diesnatalis ITS Surabaya\r\ndan festival WR. Soepratman di kaza city mall mendapatkan juara 3','Alternative Rock','instagram;','Surabaya',595,'2017-09-06 20:08:32','2017-09-06 20:08:32'),(790,'Good News','1508561937.jpg','Sebuah Band yang solid','Pop','instagram;','Jakarta',1333,'2017-09-06 20:08:34','2017-10-20 20:58:57'),(791,'BANANA PROJECT','1508545572.jpg','Banana Project adalah sebuah proyek iseng2 yang bisa dipertanggung jawabkan. Berawal dari keresahan akan situasi dimana industri musik yang kini semakin tidak jelas dan sebagai bentuk kekecewaan kami kepada lebel karena sempat memberi harapan angin surga. kami memutuskan untuk jalan dengen independent mengerjakan segala sesuatunya sendiri. Kami berdomisili diKota Bandar Lampung \r\n\r\nPresetasi -','Pop','facebook;instagram;informasi_toko;vipclub;guitar_plus;umi;maliq;poster;teman;lainnya;','Jakarta',1344,'2017-09-06 21:03:43','2017-10-20 16:26:12'),(792,'After Midnight','1504760649.jpg','After Midnight adalah sebuah band bergenre pop punk yang didirikan pada 21 April 2016 asal Bandung yang menggabungkan antara genre pop, rock, alternatif, melodic punk. After Midnight pernah mengikuti festival band Pasundan dan Supermusic ID Rockin Battle 2017.','Alternative Rock','guitar_plus;','Jakarta',1346,'2017-09-06 21:04:09','2017-09-06 21:04:09'),(793,'Jejak Awan Pesawat','1504761789.jpg','Jejak Awan Pesawat adalah sebuah band atau kelompok musik yang terbentuk pada tanggal 3 juni 2016 berasal dari kota Bandung, yang awal mulanya hanya sebuah project kecil2an untuk sesuatu hal, tapi lama kelamaan malah semakin menjadi seurius untuk di jalani, yang didirikan oleh 3 orang yaitu cepi, eki dan dyka, didirikan karena atas kecintaan kami terhadap musik dan hobi yang sama, lalu masuklah ahmad untuk mengisi kekosongan di posisi drum, karena saat itu posisi drum sedang kosong, karena kami bertiga tidak ada yang mengisi posisi itu. Nama Jejak Awan Pesawat sendiri kami ambil dari salah satu judul lagu sebuah idol group. Jejak Awan Pesawat mengusung jenis musik yang bergenre pop alternatif, tapi di setiap lirik dan musiknya kami berusaha memasukan bahasa dan musik2 sunda, jepang dan inggris.\r\nKalau masalah prestasi kami belum pernah mendapatkan prestasi, karena band ini masuk baeu terbentuk, tapi pada tahun 2016 kami pernah lolos audisi dan manggung di acara kick fest.','Pop','guitar_plus;','Jakarta',1347,'2017-09-06 21:23:09','2017-09-06 21:23:09'),(794,'Jumper Fi','1504762957.JPG','Jumper Fi adalah band modern rock masa depan. Dipimpin Cas Coldfire di garda depan sebagai vokalis, kharismanya yang kuat dan power vokalnya yang gagah namun melodic memberi nyawa dan identitas yang kuat. Gitaris Tino Hutabarat yang meledak-ledak semangatnya membuat crowd juga ikut terbakar. Jupiter Jupi di sector bass memberi rhythm section yang solid namun sarat musikalitas. Kevin Sugito di sector drum, selain sebagai tulang punggung musik yang kokoh juga memberi atraksi ‘akrobat’ stick drum yang memukau. Jujur, menonton band ini akan sangat sukar untuk membagi perhatian mata kita karena semua sector sangat atraktif. Prestasi musik antara lain adalah pernah menjadi 5 Besar finalis di ajang Indonesia Planet Rox 2016','Rock','guitar_plus;','Jakarta',1348,'2017-09-06 21:42:37','2017-09-06 21:42:37'),(795,'Niwakaraa','1504763536.JPG','Band ini terbentuk dari 2008,\r\nsudah menelurkan 2 album, yaitu Heartnote dan Revive\r\n\r\ndan telah manggung dibeberapa gigs, pensi, dan event lainnya.','Rock','instagram;teman;','Jakarta',1273,'2017-09-06 21:52:16','2017-09-06 21:52:16'),(796,'Redwine','1504766179.JPG','PROFIL REDWINE MUSIC\r\n \r\nRedWine Music adalah sebuah group band yang terbentuk pada tanggal 6 November 2015. Didirikan atas dasar kecintaan setiap personilnya terhadap musik. Masing-masing personil memiliki berbagai latar belakang dan basic yang berbeda namun memiliki VISI dan MISI yang sama dalam bermain musik, RedWine Music berkeinginan bermain musik untuk memuaskan semua publik . Maka terbentuklah RedWine Music yang membawakan jenis musik bernuansa Fussion Jazz.\r\n\r\nTujuan RedWine Music membawakan jenis musik ini adalah untuk mengisi acara di Café, pentas seni, tempat hiburan serta tidak tertutup kemungkinan mengisi acara musik di panggung-panggung indoor maupun outdoor. RedWine Music lebih mengutamakan live perfomance dan entertain sehingga audience akan merasa menikmati dan puas dengan penampilan RedWine.\r\n\r\nDalam perwujudannya RedWine Music akan menyuguhkan suatu pertunjukan yang menarik untuk dinikmati dan dikemas secara professional. RedWine Music menawarkan sebuah konsep musikalitas untuk meramaikan suasana tempat. Konsep kami menyuguhkan hiburan segar dengan penampilan profesional yang tidak hanya mementingkan keindahan harmonisasi musik belaka tapi juga menampilkan suatu perfomance yang atraktif.\r\n\r\nDengan demikian audience akan merasa terhibur dan merasa puas dengan penampilan RedWine Music serta ingin kembali lagi untuk mengunjungi tempat-tempat yang sudah kami kunjungi dan sponsor, serta dukungan anda .Besar harapan kami untuk bisa bekerjasama.\r\n \r\nTidak lupa juga, RedWine Music memiliki single perdana yang berjudul “Titik Nol”, dalam beberapa kedepan RedWine akan menyelesaikan albumnya pada tahun 2018.\r\n\r\n* PRESTASI : \r\n \r\n- MALAM KEAKRABAN UNIVERSITAS SURABAYA 2016, SURABAYA\r\n \r\n- MASTECH GADGET FEST 2016, GIANT WARU SIDOARJO\r\n\r\n- FRIDAY M LIVE, M RADIO 98.8 FM SURABAYA.\r\n\r\n- WHITE MODJO, MOJOKERTO\r\n\r\n- ACOUSTIC LAND, EATORLAND SURABAYA\r\n\r\n- YOX’S MUSIC COURSE, M RADIO SURABAYA.\r\n \r\n- MALAM AKRAB SENI, UNIVERSITAS SURABAYA 2017\r\n\r\n- UBAYA CULTURE FESTIVAL, UNIVERSITAS SURABAYA 2017\r\n \r\n - RISE TO GLORY, UPN VETERAN SURABAYA 2016\r\n\r\n- MARKETING EXPO, UNIVERSITAS AIRLANGGA SURABAYA 2016\r\n\r\n- GO A HEAD PEOPLE 2016, SURABAYA','Jazz','instagram;lainnya;','Surabaya',1349,'2017-09-06 22:36:19','2017-09-06 22:36:19'),(797,'HYRA','1504767493.JPG','HYRA adalah band yang berasal dari Yogyakarta, terbentuk di salah satu Universitas swasta di jogja,pada tahun 2014, akhir cerita terbentuklah 4 anggota band HYRA, Rohmat (vokal),  habibi (guitar),  yanda (bass),  adi (drums),  dengan mempunyai satu tujuan,  yang bergenre pop kekinian. HYRA memiliki satu mini album, terdiri dari 4 lagu.salah satunya akan di kirim linknya ke audisi levi\'s ini. Prestasi juara 1 band acoustic se\'Univ Janabadra, juara 2 festival band antar kampus, juara 3 festival band se\'bantul.','Pop','facebook;','Yogyakarta',1354,'2017-09-06 22:58:13','2017-09-06 22:58:13'),(798,'Andalusia','1504768595.JPG','Berawal dari teman nongkrong dan juga teman dekat, band yang terbentuk awal tahun 2017 ini awalnya hanya ingin menciptakan materi untuk specialist recording, namun juga tidak banyak cerita dan prestasi yang telah dibuat\r\ndikarekan yang bentrok dengan kesibukan masing-masing\r\n\r\ntetapi jauh sebelum ini, mereka terlebih dahulu sudah eksis dengan bandnya masing-masing sebut saja Ismu sang vocalist, dia lebih dulu terjun di bidang film dan iklan maupun video clip, Lanjut cerita ada Ady sebagai drumer yang telah lama bergabung dengan band D`Mozza. \r\nKhusus untuk pembetot bass di isi oleh Angger dia dulu sempat bergabung dengan band KATA dan Hunian.\r\n\r\nDi posisi gitar ada Gitagkumala yang masih tergabung dari band DEGA saat ini, namun sayang sekali posisi dia disini cuma sebagai addtional, sama hal juga dengan Eko dia juga additional keyboard dari band ini, dan Eko sendiri sudah lama bergabung dengan band Pillo sampai saat ini.\r\n\r\nBerbicara soalnya ajang kompesti yang sangat bergengsi ini kami jujur sangat antusias untuk mencapai jadi yang terbaik','Pop','facebook;','Jakarta',1357,'2017-09-06 23:16:35','2017-09-06 23:16:35'),(799,'Melody of Jessica','1504768786.jpg','Band yang awalnya bernama \"Next Uprising\" terbentuk pada tahun 2010 mempunyai 6 personel. Berbagai gigs dan event banyak kami ikuti. Beberapa yang berkesan adalah termasuk dalam album kompilasi band-bang indie di kota kami yaitu \"Gresik Band Community\" dan menjadi finalis \"LA Lights Indie Community\" di Surabaya. Kami juga pernah beberapa kali mengisi acara \"Indiekustik\" di stasiun TV lokal SBO TV.\r\n\r\nNamun seiring berjalan waktu dan kesibukan, beberapa personel memilih berhenti. Hanya tersisa Fachrizal \"Cecha\", Fahrezal \"Icang\", dan Bagas. Kami masih sering bermain di gigs dengan nama \"Next Uprising\" sampai akhirnya kami memilih untuk berganti nama. Lalu kami memutuskan berganti nama menjadi \"Melody of Jessica\" dan diikuti dengan masuknya personel baru yaitu Hernawan.\r\n\r\nTak banyak gigs yang kami ikuti, tapi kami lebih sering memproduksi lagu di rumah. Entah itu lagu cover artis lain atau lagu yang kami ciptakan sendiri. Fun fact, lagu-lagu band kami semuanya kami produksi sendiri di rumah.','Pop','facebook;','Surabaya',437,'2017-09-06 23:19:46','2017-09-06 23:19:46'),(800,'BM','1504769778.jpg','Band Ini Terbentuk Dari Teman Setongkrongan Yang Mempunyai Visi Dan Misi Yang Sama','Pop','teman;','Jakarta',1361,'2017-09-06 23:36:18','2017-09-06 23:36:18'),(801,'AFMA','1504770480.jpeg','AFMA terbentuk dari Singkatan dari Kalimat \"Angel From My Nightmare\" AFMA Lahir diTahun 2011 dengan Visi Misi Sebagai Band Heavy Metal dan sebagai Band Tributte Avenged Sevenfold dari Jakarta, Experience AFMA yaitu sebagai Band Guestar pengisi Acara Pentas Seni diSekolah Sekolah Seperti PENSI dan diAcara Band Tributte, Experience AFMA sendiri Kami pernah meraih Pemenang juara Pertama di Acara Battle Band Of Tributte Avenged Sevenfold, dan pernah bekerja sama dalam beberapa waktu kontrak bersama Al Ghazali dan Ahmad Dhani, dan kini kami sedang dalam proses pembuatan mini Album yang berjudul \"HeartBreakers\"','Heavy Metal','instagram;teman;','Jakarta',1345,'2017-09-06 23:48:00','2017-09-06 23:48:00'),(802,'TENHOLES','1504771047.jpg','Tenholes dibentuk pada bulan Oktober 2003 dimana pada saat itu scene Oi! dan Punk agak surut di Jakarta. Banyak band lawas berguguran,bubar dan vakum tak berkesudahan karena rehab,bui, bahkan ditinggal mati personil. Ukien (Achmad Muchlis) yang saat itu hampir memutuskan untuk berhenti dan meninggalkan dunia Underground karena vakum tak berkesudahan band nya yang terdahulu (The Useless). Alm Botaka (eks RGB) dan Ambonasty (Overcast) jadi dua sosok yang berhasil meyakinkan Ukien untuk membentuk band lagi dengan konsep yang lebih mengalir, genre yang disuka dan terarah. Meski masa-masa awal Tenholes banyak di pengaruhi Blitz, Cock Sparrer, Sham69 sampai The Business, Tenholes tidak ingin menjadi epigon dan memilih mengeksplor musikalitas masing-masing. Ketika Danny Mcblewer masuk mengisi formasi dan menularkan Dropkick Murphys dengan Celtic Punk nya. Gotcha! ini lah ide yang muncul pada saat itu yang menggabungkan musik Celtic yang dikemas dalam bentuk Punk Rock. Album pertama \'This is Fun This is Oi! This is Tenholes\' rilis tahun 2008 dibawah naungan Warriors Record dan Album \'Loyalty\' rilis pada tahun 2016 oleh Bergerak Records dengan dua single promo yang dirilis secara free download. Tenholes saat ini beranggotakan Ukien Bstrd (Voc), Andry (Guitar), Endry (Guitar), King Ewin (Mandolin), Aco (Drum), Bary (Bass).','Others','guitar_plus;','Jakarta',1291,'2017-09-06 23:57:27','2017-09-06 23:57:27'),(803,'Soulight','1504771891.jpeg','New Simply Souling Music Project','Others','facebook;instagram;teman;','Jakarta',1359,'2017-09-07 00:11:31','2017-09-07 00:11:31'),(804,'ROBBRS','1504772701.JPG','We found each other amidst our last dreadful years of university. Based in Yogyakarta, it started in early 2016 with just four people (Farigh, Lintang, Maher, and Icang) who study in the same faculty until later we met Awan on the way. Our knowledge in music varies as well as our taste and the genres that build us. Awan and Farigh both mostly listen to jazz; while Awan grew up with his guitar and a touch of pop-rock, Farigh has his heart on bass with neo-soul and hip-hop. Lintang as the vocalist has a strong connection with modern pop-punk bands and a handful of female solo pop musicians who are mostly from YouTube. Maher drums his way through a couple of brit-pop, pop-dance, and pop-jazz, and Icang strums his guitar with Japan 80’s Future Funk and Asian Vaporwave. With all the differences they push us to learn more about music from each other and help us explore our genre in ROBBRS.\r\nIt is safe to say that in ROBBRS we express our music via pop-alternative and our lyrics reach for the young adults who, even though most of the time question life itself, sometimes drown in their feelings. For now, we are still independent in sharing our music; We are extremely lucky to have a supporting environment where there are genuine people helping us grow and get through the music scene.\r\n\r\nWe have been blessed and very thankful to have been on several different stagesfor this past year. Some that challenged us, some that kept us humble. To pick one stage and tell the experience in detail in just a letter is an understatement because each stage has its own unique story. However, this is how ROBBRS is summed up throughout the year:\r\n	Urban Gigs by was our peak, with Monita Tahalea choosing us to play for her opening after hearing our first single, Spell You Do. It was the same day that we played at Malioboro in Malioboro Night Festival, the first time we had two gigs in one day and ended up in pain relief patches.\r\n	We also went on a trip to Jakarta with a 12-hour drive from Yogyakarta for a gig in Konser 1000 Band at BSD City and in Lalala Festival at Cikole, Lembang; those were quite special as we were chosen from a bunch of other bands who applied as well.\r\n	The night we met Stars and Rabbit in Foodiest’s Soft Opening was also a very magical one. We played right before them and the appreciation was overwhelming, they even gave us a shout out on stage saying they liked our originals.\r\n	Living in ‘the center of education’ or‘the city of students’, we have the advantage of playing in various campus environment such as HI Peace Festival, Evofest, Creative Days, Tourism Fair, and Korean Street Food Festival just to name a few.\r\n	And aside from all those exposures, we always manage to have some time for the small indie gigs and mingle with fellow indie musicians to support each other’s work.\r\n\r\nIt has been our dream from the beginning to push our limits and focus on creating and presenting our music to an audience. We still cannot forget how nervous and agitated we were the first time we played a full set-list of our own originals, how we were excited to record our very first song and share it on social media with amazing feedbacks from our friends and family. Our dream has slowly but surely been progressing and we cannot be more grateful about it.\r\nAlso we have released Silence EP on July 2017.','Pop','instagram;teman;','Yogyakarta',1358,'2017-09-07 00:25:01','2017-09-07 00:25:01'),(805,'fatkiller','1504774419.JPG','pengisi acara di Konser 1000 band Ice BSD\r\nPengisi acara di Jakarta fair 2017, Gambir Stage\r\nHeadline acara rock 90s tribute di atamerica','Rock','instagram;','Jakarta',1368,'2017-09-07 00:53:39','2017-09-07 00:53:39'),(806,'JUST ALKINGS','1504775857.jpg','KITA BERTIGA ADALAH KARYAWAN, KAMI BARU MEMBENTUK BAND INI DI TAHUN 2017. KAMI MEMILIKI PASSION YANG BESAR DI MUSIK. MANJA ADALAH SALAH SATU KARYA TERBAIK KAMI DAN LAGU PERTAMA YANG KAMI BUAT DEMONYA. OLEH KARNA ITU KAMI MAU MENCOBA DI LEVIS BAND HUNT INI UNTUK MEMULAI KARIR KAMI DI DUNIA MUSIK.  SEMOGA KARYA KAMI BISA DITERIMA OLEH SEMUA ORANG. GOD BLESS.','Pop','guitar_plus;','Jakarta',1000,'2017-09-07 01:17:37','2017-09-07 01:17:37'),(807,'Fayola','1504775965.jpg','Band yg berdiri pada pertengahan tahun 2015 ini sudah melewati banyak proses, mulai dari pergantian personil hingga sampai saat ini adalah formasi paling solid. Fayola pernah bermain di beberapa event besar & pensi, contohnya adalah IDP Fest 2017','Pop','teman;','Jakarta',1343,'2017-09-07 01:19:25','2017-09-07 01:19:25'),(808,'Smiling Horse','1504776190.jpg','Smiling Horse is a band with Rock N\' Blues/Expanded Blues genre. The name itself represents strong, royal, teamwork, brave, agile philosophy for reaching goals in music. So far, Smiling Horse was a winner for favorite band category at Psychofair 2016 UIN Jakarta and has been performing several times and some of them were big stages like Road to Soundrenaline, Jakcloth, and Indomusically Best Performances.','Rock','instagram;','Jakarta',1237,'2017-09-07 01:23:10','2017-09-07 01:23:10'),(809,'AK47 BAND','1504777081.jpg','Band Ak47 ingin menawarkan beberapa Karya Musik, & Terbentuk pada tanggal 01 Januari 2005','Pop','facebook;teman;','Jakarta',1365,'2017-09-07 01:38:01','2017-09-07 01:38:01'),(810,'Emotion Band','1504777806.jpg','Emotion adalah salah satu kelompok band musik bergenre Pop Rock Alternative yang terbentuk sejak tahun 2009, tapi sempat vacuum dan bersatu kembali di tahun 2013 dengan mempunyai lima personil tetap. Jimmy (Gitarist 1), Andri (Gitarist 2), Hendri (Basist), Martin (Drummer) dan Firly Natha (Vocalist). Kita juga berlima sebelumnya mempunyai band masing-masing, tapi dengan seiring waktu band kita itupun juga ikut vacuum. Maka dari itu kami berlima sepakat untuk membentuk band ini dengan berkeyakinan bisa mengekspresikan hobi bermusik kami kembali.\r\nNama Emotion itu sendiri yang artinya Emosi dalam konotasi positif, karena kami berlima mempunyai jenis aliran atau genre music yang berbeda-beda maka emosi kamipun juga berbeda-beda. Hanya dalam bermusik inilah kami bisa bersatu dan menggabungkan semua emosi kami serta visi misi kami untuk menciptakan hasil karya music yang bisa diterima dikalangan industry musik Indonesia. Serta Semoga kami juga bisa mengajak semua emosi pendengar kami ikut dalam alunan musik yang kami ciptakan.\r\n\r\nKalau Prestasi kita tidak ada, paling kita manggung-manggung di acara kampus dan jadi bintang tamu local di event-event musik di kota kita Palembang.','Alternative Rock','informasi_toko;poster;teman;lainnya;','Jakarta',1201,'2017-09-07 01:50:06','2017-09-07 01:50:06'),(811,'Emotion Band','1504777806.jpg','Emotion adalah salah satu kelompok band musik bergenre Pop Rock Alternative yang terbentuk sejak tahun 2009, tapi sempat vacuum dan bersatu kembali di tahun 2013 dengan mempunyai lima personil tetap. Jimmy (Gitarist 1), Andri (Gitarist 2), Hendri (Basist), Martin (Drummer) dan Firly Natha (Vocalist). Kita juga berlima sebelumnya mempunyai band masing-masing, tapi dengan seiring waktu band kita itupun juga ikut vacuum. Maka dari itu kami berlima sepakat untuk membentuk band ini dengan berkeyakinan bisa mengekspresikan hobi bermusik kami kembali.\r\nNama Emotion itu sendiri yang artinya Emosi dalam konotasi positif, karena kami berlima mempunyai jenis aliran atau genre music yang berbeda-beda maka emosi kamipun juga berbeda-beda. Hanya dalam bermusik inilah kami bisa bersatu dan menggabungkan semua emosi kami serta visi misi kami untuk menciptakan hasil karya music yang bisa diterima dikalangan industry musik Indonesia. Serta Semoga kami juga bisa mengajak semua emosi pendengar kami ikut dalam alunan musik yang kami ciptakan.\r\n\r\nKalau Prestasi kita tidak ada, paling kita manggung-manggung di acara kampus dan jadi bintang tamu local di event-event musik di kota kita Palembang.','Alternative Rock','informasi_toko;poster;teman;lainnya;','Jakarta',1201,'2017-09-07 01:50:06','2017-09-07 01:50:06'),(812,'Honeybeat','1504778555.jpg','Band acid yang terbentuk tahun 2009. tumbuh besar di komunitas jepang & jazz. untuk info lebih lanjut bisa diakses di www.facebook.com/honeybeat','Pop','instagram;guitar_plus;maliq;teman;','Jakarta',1370,'2017-09-07 02:02:35','2017-09-07 02:02:35'),(813,'The Colleagues','1504778667.jpeg','The Colleagues adalah band indie pop yang terbentuk di Bandung tahun 2011. Lagu pertama yang kami ciptakan berjudul \"Take It Easy\" dan kami membuat lima lagu lainnya hingga terbentuk sebuah EP album berjudul \"The Sweet Simple Colour\" pada tahun 2013 yang pertama kali dirilis oleh sebuah indie label di Inggris, Dufflecoat Records. Pada tahun yang sama, album EP pertama kami dirilis oleh sebuah indie label di Indonesia, Shinyhappy Records.\r\n\"The Sweet Simple Colours\" EP Album released in Cambridge, UK by Dufflecoat Records, 2013:\r\nhttp://www.dufflecoatrecords.fr/project/the-colleagues/\r\n\"The Sweet Simple Colours\" EP Album released in Depok, Indonesia by Shinyhappy Records, 2013:\r\nhttp://shinyhappyrecords.weebly.com/releases.html\r\n\"The Sweet Simple Colours\" EP Album sold out in Japan:\r\nhttp://www.thestonerecords.com/?pid=57582397\r\n\"I Can Never Be\" 5,000+ plays in South East Asia Indie (SEA Indie) Thailand:\r\nhttps://soundcloud.com/southeastasiaindie/sea-018-the-colleagues-i-can\r\n\"The Sweet Simple Colours\" EP Album and Band on-line and international review:\r\nhttps://www.discogs.com/Colleagues-The-Sweet-Simple-Colours/release/4622096\r\n\r\nhttp://thesoundofconfusionblog.blogspot.co.id/2013/04/the-colleagues-sweet-simple-colours-ep.html?m=1\r\n\r\nhttp://www.artisttrove.com/artist/374189429317168/The+Colleagues','Pop','informasi_toko;','Jakarta',1372,'2017-09-07 02:04:27','2017-09-07 02:04:27'),(814,'Lemon-T','1504779787.JPG','Lemon-T adalah sebuah group band yang terbentuk pada tanggal 11 Oktober 2016. Lemon-T dibentuk atas dasar kecintaan setiap personilnya terhadap musik. Masing-masing personil memiliki berbagai latar belakang yang berbeda namun memiliki visi dan misi yang sama dalam bermain musik. Lemon-T dalam perjalanan kariernya sudah pernah menjuarai beberapa festival musik seperti Festival akustik USU Medan 2016 (Juara 3), Festival Band di acara Dies Natalis Fakultas Ilmu Komputer USU Medan yang ke-5 (Juara 1), dan homeband regular di Kopi Takar Cafe&resto Jl. Setiabudi, Medan.','Pop','teman;','Medan',1306,'2017-09-07 02:23:07','2017-09-07 02:23:07'),(815,'BANTERR','1504779880.jpg','Berkumpul di awal tahun 2017 dengan mengusung indie garage rock sebagai garis musik yang akan kami jalani dan mengawali terbentuknya BANTERR.\r\n\r\nMeramu musik rock terdahulu dengan musik masa kini kami menunjukkan sebuah paduan nada, distorsi, dan skenario penuh irama.\r\n\r\nInstagram : @banterrmusic\r\nfacebook : /banterrmusic\r\nTwitter : @banterrmusic','Rock','instagram;','Jakarta',1366,'2017-09-07 02:24:40','2017-09-07 02:24:40'),(816,'NSFL','1504779910.jpg','NO STACK FOR LUCK atau yang biasa disingkat NSFL merupakan rock unit dari Bandung yang terbentuk di pertengahan 2017. Beranggotakan Nara (vocal), Mr. Pur (guitar), Chandra (bass), dan Qays (drums), NSFL bermula dari meng-cover lagu-lagu band-band Japanese Punk seperti SHANK, MONOEYES, dan FOUR GET ME A NOTS.\r\n\r\nNama NO STACK FOR LUCK sendiri mengindikasikan pemahaman pada tidak ada keberuntungan yang datang bertubi-tubi; yang berarti keberuntungan dapat diraih jika sudah melewati proses kerja keras; dalam hal ini proses kreatif dalam bermusik.\r\n\r\nMeski belum lama terbentuk, kami sudah memiliki demo-single yang telah rilis pada 31 Agustus 2017 berjudul GO MY WAY. Single ini sendiri berkisah tentang problematika dalam menjalani hidup yang kita inginkan, bagaimana menyikapi pandangan orang terhadap kita, dan kesiapan hati untuk menerima segala resiko dari jalan yang kita pilih.\r\n\r\nSOCIAL MEDIA\r\nhttps://www.instagram.com/nsfl.id/\r\nhttps://www.facebook.com/nsfl.id/\r\nhttps://www.youtube.com/channel/UCuRrJVqnMifA2h4c1FVDlqQ\r\n\r\nCONTACT\r\nnsfl.id@gmail.com\r\n0853-1400-3506 (Chandra)','Rock','guitar_plus;','Jakarta',1369,'2017-09-07 02:25:10','2017-09-07 02:25:10'),(817,'Hansel En Gretel','1504780651.jpg','Hansel En Gretel (Fictional Character)\r\n\r\nHansel & Gretel adalah, virtual band yang diciptakan pada tahun 2017 oleh Ricky A. Jeffersen (Guitar/Synth) & Rafaela Lisa S. (Vocalist/Drum/Percussion), setelah melewati berbagai macam proses sejak tahun 2015. Ditambah dengan William Budiyana (Gitar/Vocal) pada tahun 2017.\r\n\r\nMemainkan genre Pop (electro) yang divariasikan dengan genre lain seperti Deep House, Trap, Dubstep, Rock, Blues, Metal, Punk dll.\r\n\r\nDiresmikan pada tahun 2017 dengan Single yang berjudul \"Ikigai\".','Pop','facebook;','Jakarta',1319,'2017-09-07 02:37:31','2017-09-07 02:37:31'),(818,'Freund','1504781533.jpg','Dibentuk 2010 setelah gonta ganti nama dan personil. Juara festival pelajar dan umum tingkat kota dan provinsi. Masuk album indie tegal.','Pop','lainnya;','Jakarta',1373,'2017-09-07 02:52:13','2017-09-07 02:52:13'),(819,'La Hila band','1504781979.jpg','La Hila band berdiri pada tanggal 1 Januari 2010. La Hila diangkat dari kisah seorang putri yang hilang di tanah Donggo, Bima, NTB. La Hila menjadi inspirasi karena pengorbanan, kelembutan, pesan, dan niat untuk mengangkat sejarah La Hila itu sendiri. Visi dan Misi La Hila band adalah menjadi warna baru di belantika musik Indonesia dan mengangkat cerita rakyat Bima menjadi sebuah legenda Nusantara.\r\n\r\nPRESTASI :\r\n1. Mewakili provinsi Nusa Tenggara Barat dalam Festival Lagu Daerah oleh 32 provinsi. Desember - 2015\r\n2. Juara 2 Accoustic Competition, Emporium Pluit Mall. Maret - 2016\r\n3. Harapan 1 Festival Musik Betawi, Metro Cipulir Mall. Mei - 2016\r\n4. Juara 3 Festival Musik Jalanan. April - 2017\r\n5. Juara 1 Festival Musik Religi. Juni - 2017\r\n6. Juara 2 Festival Musik Nuansa Religi, Dinas Kebudayaan dan Pariwisata Jakarta Pusat. Agustus - 2017','Pop','teman;','Jakarta',1253,'2017-09-07 02:59:39','2017-09-07 02:59:39'),(820,'SOULMAKER','1504783590.jpg','Soulmaker dibentuk tahun 2014 dari sebuah sekolah menengah atas Sman 2 tangerang. tahun 2015: \r\n-Juara 1 pensi Fourtfhest Sma 14 Tangerang\r\n-juara 1 pensi Starfest Sma 7 Tangerang\r\n-juara 1 pensi greenive Sma 5 Tangerang\r\nTahun 2016:\r\n-juara 1 festival band budaicia\r\n-juara 1 festival band pelajar hut kota Tangerang\r\n-juara 1 festival Telkom jakarta\r\n-juara 1 fourthfest Sma 14 Tangerang\r\n-Juara 1 festival sumpah pemuda tangerang \r\n-juara 1 festival sma 6 Tangerang\r\n-juara 2 Greenive sma 5 Tangerang\r\n2017:\r\n-Juara 2 festival Cisadane Tangerang\r\nDan Soulmaker menjadi bintang tamu pensi pensi di kalangan sma dan smp di kota Tangerang\r\nINSTAGRAM: Soulmaker_sm\r\nYOUTUBE: https://www.youtube.com/channel/UC-_iPxe5E4S1wkzqwRLIIqg','Alternative Rock','instagram;guitar_plus;umi;teman;','Jakarta',1376,'2017-09-07 03:26:30','2017-09-07 03:26:30'),(821,'Rubic','1504784105.jpg','Rubic adalah band dari Yogyakarta, Indonesia . Mulai terbentuk pada tahun 2014 dengan mengusung genre Pop Jazz.\r\n\r\nNew Single  \"Secangkir Kopi Pagi\"','Pop','instagram;informasi_toko;','Yogyakarta',1087,'2017-09-07 03:35:05','2017-09-07 03:35:05'),(822,'Nadia feat Fanfun','1504784365.jpg','Saya adalah penyanyi solo yang baru saja mengeluarkan single perdana saya yang berjudul Balikan. Dilagu ini saya berkolaborasi dengan pemain ukulele bernama Fanfun. Lagu ini bernuansa Pop dan berunsurkan nuansa EDM.','Pop','teman;','Jakarta',1382,'2017-09-07 03:39:25','2017-09-07 03:39:25'),(823,'Nadia feat Fanfun','1504784369.jpg','Saya adalah penyanyi solo yang baru saja mengeluarkan single perdana saya yang berjudul Balikan. Dilagu ini saya berkolaborasi dengan pemain ukulele bernama Fanfun. Lagu ini bernuansa Pop dan berunsurkan nuansa EDM.','Pop','teman;','Jakarta',1382,'2017-09-07 03:39:29','2017-09-07 03:39:29'),(824,'The Very Nice','1504785110.jpeg','Kami  adalah The Very Nice Band\r\nDengan beranggotakan Yhuliant(Voc), Yayan(Gtr), Arga(Bass), Yosua(Drum), Yason(Keys), sekumpulan \'Nice-Guy\' yang menjadi perantau di Jakarta. \r\nBand kami terbentuk awal  tahun ini setelah kami berlima bertekad untuk menyelesaikan sebuah EP/Mini Album sebagai tanda rasa bermusik kami masih ada.\r\nmengusung aliran Pop dengan sentuhan Crunch Overdrive dari Gitar, iringan Drum dan Bass yang dinamis berbalutkan String Section.\r\nLatar belakang kehidupan kami menjadi lirik di dalam lagu-lagu yang kami ciptakan. \r\nBaik suka maupun duka kami tuliskan menjadi lirik dan lagu. \r\nMari mendengarkan musik kami, karena musik kami adalah perjalanan hidup kami.','Pop','facebook;instagram;','Jakarta',952,'2017-09-07 03:51:50','2017-09-07 03:51:50'),(825,'BAJINK LUNCAT','1504787431.jpg','2 Piala Trophy.\r\n\r\nBand Terbaik Music Fest Bogor.\r\n\r\nBest Song Music Fest Bogor.\r\n\r\nBest Guitarist Hotel Salak Gendeng Indi Fext','Rock','teman;','Jakarta',1385,'2017-09-07 04:30:31','2017-09-07 04:30:31'),(826,'SICKBOY','1504787880.jpg','terbentuk tahun 2014 SICKBOY berisikan mahasiswa-mahasiswa dalam satu UKM MUSIK SICMA UNY, berawal dari band yang hanya mengcover lagu-lagu rock berbagai era akhirnya SICKBOY memutuskan untuk membawakan karya sendiri.\r\n\r\nPRESTASI\r\n- live perform di kampus\" area jogjakarta\r\n- live perform di cafe dan bar\r\n- mengikuti ajang rockin battle 2017','Rock','poster;','Yogyakarta',1386,'2017-09-07 04:38:00','2017-09-07 04:38:00'),(827,'SOLD OUT','1504788464.jpg','Tahun 2009 terbentuk dengan 5 personil, membawakan genre pop-punk. 2017 kembali lagi dengan format 3 personil dengan genre yang lebih \"fresh\"\r\nRunner Up 1 Cardinal Awards dibali merupakan prestasi tertinggi S.O. serta beberapa di kompetisi lokal','Pop','guitar_plus;','Jakarta',1371,'2017-09-07 04:47:44','2017-09-07 04:47:44'),(828,'HACK\'S','1504789837.jpg','ingin menjadi yang terbaik dari yang terbaik .','Heavy Metal','facebook;','Medan',1387,'2017-09-07 05:10:37','2017-09-07 05:10:37'),(829,'TRAF','1504789964.jpg','TRAF Pernah menjuarai festival permen woods pada tahun 2007 dan menjadi salah satu finalis soundrenaline 2006','Alternative Rock','instagram;','Jakarta',882,'2017-09-07 05:12:44','2017-09-07 05:12:44'),(830,'Ming&Mong','1504790885.jpg','Ming&Mong merupakan band asal Yogyakarta yang berdiri pada tahun 2016. Personelnya terdiri dari tiga orang mahasiswa yang berkuliah di Universitas Ahmad Dahlan dan UIN Sunan Kalijaga Yogyakarta. Single pertamanya yaitu Tentang Ku dan Kamu.','Pop','instagram;','Yogyakarta',1389,'2017-09-07 05:28:05','2017-09-07 05:28:05'),(831,'Meirani & Anggi','1504791553.jpg','Meirani & Anggi adalah duo grup musik Indonesia beraliran pop yang berawal dari belajar musik disebuah organisasi musik dan didirikan pada 31 Mei 2017. Grup ini diciptakan oleh seorang guru musik yang sekaligus producer dalam organisasi tersebut dan nama grup dinamai dengan nama personil yaitu Meirani (Vocal) & Anggi (Vocal dan Guitar). Kami telah merilis single pertama kami yang berjudul \"Terimakasih\" sebagai karya pertama kami. Semoga karya kami dapat menghibur dan diterima dengan baik oleh masyarakat luas.','Pop','guitar_plus;teman;','Jakarta',1384,'2017-09-07 05:39:13','2017-09-07 05:39:13'),(832,'senja','1504793538.JPG','kami hanya sekumpulan remaja yang ingin terus berkarya dengan sederhana','Pop','guitar_plus;','Yogyakarta',1225,'2017-09-07 06:12:18','2017-09-07 06:12:18'),(833,'senja','1504793558.JPG','kami hanya sekumpulan remaja yang ingin terus berkarya dengan sederhana','Pop','guitar_plus;','Yogyakarta',1225,'2017-09-07 06:12:38','2017-09-07 06:12:38'),(834,'Koza','1504793887.JPG','Koza adalah band bergenre pop dengan lagu-lagu yang merefleksikan kehidupan sehari-hari, bercerita tentang suka duka, motivasi, jatuh cinta, patah hati yang dialami khususnya para remaja. Lagu-lagu Koza juga bertema aksi sosial dan menyuarakan hal-hal positif. \r\nBeberapa prestasi Koza sebagai berikut;\r\n- lolos sebagai semi-finalist International Song Writing Competition 2016 (ISC) dengan lagu \"The Trapped Man.\" \r\n-Pianist Koza Telah menciptakan 108 lagu sejak tahun 2005\r\n-Opening Performance for Musikimia di grand atrium, supermal karawaci (2013)\r\n-tampil di beberapa acara di supermal karawaci dibawah Djarum\r\n-Tampil sebagai guest star tiap tahun di acara drama Musikal Sekolah Berkebutuhan Khusus Spectrum (2012-2017) serta pianist Koza sebagai komposer untuk lagu-lagu drama Musikal acara sekolah ini.\r\n-menjadi bintang tamu pada acara Inbox SCTV (2014)\r\n-Runner Up acara Bintang Dari Rumah SCTV (2011)\r\n-dll.','Pop','teman;','Jakarta',1364,'2017-09-07 06:18:07','2017-09-07 06:18:07'),(835,'TIGER PAW','1504793918.jpg','BIOGRAFI :\r\n\r\nSPEED ROCK BAND DARI YOGYAKARTA YANG TERBENTUK DI TAHUN 2016 AKHIR. DI\r\nGAWANGI OLEH BRANDE EL TIGRE (OPATUA/GARAGE ROCK). DI REKRUTLAH DUA\r\nGU I TAR I S YANG BERASAL DAR I  GENRE YANG BERBEDA, FAR I D S I LOL\r\n(TREATMENT/DEATH METAL), DAN SI JOHN (ANTILOSER/PUNK). SERTA EPAN UZUMAKI\r\nDIPERCAYA SEBAGAI TUKANG GEBUK DRUM\r\nKEMBALI KE ERA PENDAHULU TIGER PAW BERANGKAT DARI MOYANG MEREKA SEPERTI\r\nHELLOWEN, IRON MAIDEN, JUDAS PRIEST DARI MEREKALAH MUSIK TIGER PAW ADA\r\nSEKARANG.  SEDANGKAN UNTUK VOCAL SANG VOCALIST BRANDE EL TIGRE\r\nTERLANJUR JATUH CINTA DENGAN CARA BERNYANYI ZACH SLAUGHTER DARI\r\nSKULLFIST. TERIAKAN MELENGKING PANJANG DENGAN DIIRINGI VIBRA TERATUR\r\nMENJADI CIRI KHAS KARYA DARI TIGER PAW, DIMANA DI ISI OLEH LEAD SUPER KENCANG\r\nDENGAN KARAKTER SEPERTI HERMAN LI DARI DRAGON FORCE, DAN GEBUKAN\r\nDRUM CEPAT YANG SIAP MEMBAKAR SETIAP PENDENGAR AKAN MENJADI PONDASI DI\r\nHAMPIR SEMUA KARYA YANG DIMILIKI TIGER PAW.\r\nTIGER PAW MERUPAKAN SEBUAH RAMUAN SEMANGAT BARU YANG MEMBARA DAN SIAP\r\nMEMBAKAR PANGGUNG MANA SAJA, MATERI LIRIK DI AMBIL DARI PENGALAMAN SANG\r\nVOKALIS SEPERTI DIA AMAT MENCINTAI MOTOR, DIA PERNAH MENJADI PENGGILA\r\nDOTA, PENENGGAK MINUMAN KERAS DAN MASIH BANYAK LAGI MATERI YANG\r\nTERKANDUNG DALAM KARYA-KARYA TIGERPAW DAN YANG UNIK DARI BAND INI  “KAMI\r\nBERBEDA DARI BAND METAL LAINNYA, KARENA HANYA TIGER PAW LAH YANG MEMAKAI\r\nSEMPAK DI LUAR SAAT MANGGUNG” UJAR BRANDE SELAKU VOCAL. DIBALUT OLEH\r\nANIMAL PATTERN DAN FESYEN KULIT MENJADI SALAH SATU CIRI KHAS KOSTUM\r\nBERAKSI SEKUMPULAN CAKAR MACAN INI. SILAHKAN MENIKMATI TIGER PAW DARI\r\nSEGALA PERSPEKTIF YANG ADA, NAMUN APAPUN YANG AKAN ANDA CETUSKAN\r\n“GAHAR” ADALAH KATA YANG TEPAT UNTUK INI SEMUA. \r\n\r\n\r\nPRESTASI :\r\n\r\n\"THE BEST OUTFIT\" DI FESTIVAL \"DJARUM ROCK IN BATTLE\" (YOGYAKARTA 2017).\r\n\"THE BEST METAL BAND\" PADA ALBUM KOMPILASI \"1000 KALORI\" (YOGYAKARTA 2017).\r\n\r\n\r\nCONTACT :\r\n\r\nWA : 0858 7773 5464 ( VERA SAURUS )\r\nE-MAIL : tigerpawrock@gmail.com\r\nYOUTUBE : https://www.youtube.com/channel/UCePBDLqfdnVtlyyUUh6J1PA\r\nSOUNDCLOUD : https://soundcloud.com/tigerpawrock\r\nINSTAGRAM : https://www.instagram.com/tigerpawrock/\r\nFACEBOOK : https://www.facebook.com/tigerpawrock\r\nTWITTER : https://twitter.com/tigerpawrock','Heavy Metal','facebook;instagram;teman;','Yogyakarta',1391,'2017-09-07 06:18:38','2017-09-07 06:18:38'),(836,'The Big Thing Machine','1504793980.jpg','Terbentuk sejak tahun 2004 dengan nama HIKARI dan aktif jejepangan di surabaya dengan mengusung genre JROCK yang banyak tersinspirasi oleh L~Arc~En~ciel, vakum sejak 2007 dan aktif kembali pada tahun 2015 dengan menambahkan unsur FUNK ROCK dalam setiap karya yang dihasilkan dan mengubah nama band menjadi THE BIG THING MACHINE.','Funk','teman;','Surabaya',984,'2017-09-07 06:19:40','2017-09-07 06:19:40'),(837,'Ketika Petir Menyambar','1504796264.jpg','Ketika Petir Menyambar adalah sebuah band\r\nModern Hard Rock yang terbentuk pada 17 Oktober 2012 di Bali, nama Ketika Petir Menyambar terinspirasi dari\r\npetir yang mempunyai cahaya kilat dan suara yg\r\nbergemuruh. Sempat juga ingin menggunakan nama\r\nKetika Petir Menyambar dengan bahasa inggris\r\n(when the lightning strike) namun penamaan dengan\r\nbahasa indonesia dirasa lebih cocok,\r\nmaka diputuskan menggunakan nama Ketika Petir\r\nMenyambar.\r\n\r\nAward dan Gigs perform,\r\n- Juara 1 Cardinal Award 2016\r\n- Juara 1 Festival musik STIKOM denpasar\r\n- Runner up Singaraja Band Heroes 2016\r\n- Performer, road to Soundrenaline 2017','Rock','instagram;guitar_plus;','Surabaya',345,'2017-09-07 06:57:44','2017-09-07 06:57:44'),(838,'TIMES NEW ROMANCE','1504796515.jpg','TIMES NEW ROMANCE ADALAH BAND YANG MEMAINKAN MUSIK SIMPLE POP\r\nDENGAN NADA YANG SEDERHANA DAN LIRIK YANG MUDAH DI INGAT MENJADIKAN BAND INI PEDE MEMBAWAKAN SELURUH LAGUNYA DENGAN MENGGUNAKAN BAHASA INDONESIA','Pop','facebook;instagram;umi;maliq;','Jakarta',1325,'2017-09-07 07:01:55','2017-09-07 07:01:55'),(839,'GODLIKE','1504796636.jpg','Cikal bakal GODLIKE, sudah terbentuk sejak Januari 2015. Berawal dari bertemunya Hendy (Bass) & Hudi (Gitar) yang merupakan rekan satu band, dengan Defit (Drum) untuk membentuk sebuah band rock.\r\n\r\nDari pertemuan tersebut Defit menyarankan untuk mengajak Dika yang juga seorang drummer untuk di daulat menjadi Vokalis.\r\n\r\nDari hasil sesi jamming pertama, ketidak cocokan langsung terlihat, perbedaan konsep dan pemikiran membuat band ini bubar bahkan sebelum berjalan.\r\n\r\nBerbulan-bulan setelah perpisahan tersebut Hendy, Hudi & Dika kembali dipertemukan oleh situasi. \r\n\r\nKetika Dika membutuhkan gitaris dan bassist untuk mengisi take recording, Dika menghubungi Hendy dan Hudi.\r\n\r\nSebaliknya, ketika band project Hendy & Hudi membutuhkan drummer atau pengisi vokal, maka mereka menghubungi Dika.\r\n\r\nTanpa disadari chemistry bermusik antara ketiganya terbentuk, materi pembentukan band side projectpun kembali dibahas.\r\n\r\nSekalipun berkali-kali sempat vacum karena perbedaan genre & konsep musik yang berbeda, toh band ini tetap berjalan tanpa nama.\r\n\r\nBeberapa drummer & vokalispun sempat diuji coba, karena pada awalnya Dika menginginkan agar band ini unik dengan 2 drummer dan vokalis yang dapat membawakan berbagai genre musik termasuk \"Rap\". \r\n\r\nMerasa sudah cukup kompak, pada akhirnya band ini memutuskan untuk berjalan hanya bertiga ketimbang harus menunggu sosok yang diinginkan dan membentuk chemistry dengan personil baru.\r\n\r\nDan terbentuklah formasi GODLIKE dengan posisi Hendy pada Bass, Hudi pada Gitar, sedanghkan Dika mengisi Drum & Vokal.\r\n\r\nNama GODLIKE sendiri diambil dari ungkapan game PC bertajuk \"DotA Allstars\" .','Alternative Rock','teman;','Jakarta',1395,'2017-09-07 07:03:56','2017-09-07 07:03:56'),(840,'ARIETTA','1504797281.jpg','ARIETTA adalah band yang berdiri pada Maret 2014, band yang berasal dari Karawang ini mengusung genre Modern Rock. Nama Arietta sendiri berasal dari bahasa Inggris yang berarti Syair / Melodi Cinta. Musik Arietta sendiri dipengaruhi oleh One Ok Rock, L’arc En ciel, Ungu, J-Rocks. Band ini digawangi oleh Yondi (Vocal), Ricki (Guitar), Arga (Guitar), Indra (Bass), Arif (Drumm).\r\nPrestasi ARIETTA :\r\n-Festival Band Purwakarta Kreatif (2015)=Juara I\r\n-Festival Band Se-Purwasukasi (2015)=Juara II\r\n-A ZONE Road To Soundsations Zona Purwasukasi (2015)=Juara III\r\n-Local Hero Soundsations Bekasi (2015)\r\n-Local Hero Soundsations Bogor (2015)\r\n-Local Hero Soundsations Karawang (2015)\r\n-10 Besar Band terbaik di HUT LANUD SURYADARMA Subang\r\n-Gueststar di beberapa Mall-mall & Event Pensi\r\n-Best Player Vocal,Guitar,Bass,Drumm\r\n-Dan masih banyak lagi prestasi lain nya dari Arietta.','Alternative Rock','facebook;instagram;teman;lainnya;','Jakarta',502,'2017-09-07 07:14:41','2017-09-07 07:14:41'),(841,'Gloria\'s Band','1504798009.jpeg','Band kami telah memiliki banyak pengalaman di dalam dunia musik. Band kami telah mengikuti festival musik di kampus-kampus dan terakir band kami masuk ke dalam 10 besar top finalist MLD SPOT dalam acara MLD Jazz Wanted.','Pop','instagram;','Jakarta',900,'2017-09-07 07:26:49','2017-09-07 07:26:49'),(842,'Bakat Terpendam','1504799063.jpg','Kami pernah mengikuti lomba band indie di Jakarta. Kami terpilih masuk 15 besar dan harus pergi ke Jakarta. Perjalanan penuh cerita serta pengalaman itu terbayar saat kami terpilih menjadi juara pertama yang sama sekali tidak pernah bayangkan atau sangka-sangka. Itulah salah satu cerita yang sangat berkesan yang dialami teman-teman Bakat Terpendam band','Others','guitar_plus;','Jakarta',1377,'2017-09-07 07:44:23','2017-09-07 07:44:23'),(843,'Varsha','1504799089.jpg','Juara 2 Indie Band Festival It\'s Mine Tang City Mall','Pop','instagram;','Jakarta',1397,'2017-09-07 07:44:49','2017-09-07 07:44:49'),(844,'VOW','1504799696.jpg','VOW adalah band pop rock asal Jogja. Dengan 1 vokalis dan 2 gitaris.','Alternative Rock','guitar_plus;','Yogyakarta',1402,'2017-09-07 07:54:56','2017-09-07 07:54:56'),(845,'Bougenvile','1504799946.jpg','juara 3 pestipal musik antar sekolah','Pop','facebook;','Jakarta',1399,'2017-09-07 07:59:06','2017-09-07 07:59:06'),(846,'Black Briar','1504800914.jpg','Dengan mengambil jalur genre Brit/Rock, Black Briar mencoba\r\nmengudara di kancah industri musik Indie di Jogjakarta.\r\nDigawali oleh Endi (Vocal/Gitar), Adnan (Drum), dan Tian (Bass)\r\nsejak awal tahun 2015 Blackbriar mulai menaiki panggung:\r\n-Civil League, UII, Jogjakarta, 2015\r\n-Last Intro Anniversary, Ruang Café,Jogjakarta, 2015\r\n-Heaven Sound, Hard Case Café,Jogjakarta, 2016\r\n-Sounds for Arctic Monkeys 2, Ecobar, Kemang, Jakarta 2016\r\n-British Night by KMA, Wedangan Kampoeng, Jogjakarta 2017\r\n-Sensasi Musik Rabu, Arcaf Café,Jogjakarta 2017\r\n-Opening band, Jakcloth Goes To Yogyakarta, 2017','Alternative Rock','poster;teman;','Yogyakarta',1330,'2017-09-07 08:15:14','2017-09-07 08:15:14'),(847,'MAOSKO','1504800998.JPG','MAOSKO terbentuk Mei 2017, karena kebiasaan nongkrong bersama di sebuah studio dan kami merasa satu pemikiran dalam bermusik. \r\n\r\nBand kami belum memiliki prestasi.','Rock','teman;','Jakarta',1396,'2017-09-07 08:16:38','2017-09-07 08:16:38'),(848,'Fatria Suma feat Rhythem Nusantara','1504801226.jpg','Rhythem nusantara project adalah band indie asal Lampung, Kotabumi Lampung Utara, yang terbentuk pada tanggal 12 januari 2016, prestasi yang di miliki setiap personil berbeda beda karna saat terbentuk nya Rhythem nusatara adalah pada saat event kumpul kangen musisi Kotabumi, terbentuk nya Rhythem nusantara  menambah warna baru untuk belantika musik di Indonesia khusus nya Lampung, Kotabumi Lampung Utara. Dari  sekian lagu yang dimiliki Rhythem nusantara Saat ini Rhythem nusantara memiliki satu lagu yang di record sebagai debut single dari sang vocalist suma fatria, dan semoga Rhythem nusantara selalu menjadi bagian warna warni di blantika musik Indonesia, yang selalu ikut andil dalam segala kegiatan yang menyangkut kesejahteraan musisi Indonesia.','Pop','instagram;guitar_plus;umi;maliq;','Jakarta',1401,'2017-09-07 08:20:26','2017-09-07 08:20:26'),(849,'The 5','1504801581.jpg','kami band asal pemalang \r\ndari sma kita selalu manggung sana sini tapi tak pernah juara...karna dulu kami hanya berkeinginan untuk merasakan sound yang mewah hahaha','Alternative Rock','facebook;','Jakarta',1407,'2017-09-07 08:26:21','2017-09-07 08:26:21'),(850,'ANONYMOUS','1504801824.jpg','ANONYMOUS berdiri pada pertengahan tahun 2014 dari  pertemanan di salah satu studio musik  di bilangan Bekasi Timur. warna musik yang dimainkan ialah    alternative,pop rock dengan pengaruh dari band-band, seperti Creed, Muse, DLL\r\nSetelah menimba pengalaman manggung diberbagai event dari band-band sebelumnya, pada pertengahan september ini DGAS akhirnya menyelesaikan satu lagu untuk demo mereka yang pertama. Lagu berjudul Kisahkku Tersimpan Di Kotamu. Dan masih dalam penggarapan lima lagu berikutnya. Rencananya ANONYMOUS akan menluncurkan mini album yang pertama.','Rock','teman;','Jakarta',1380,'2017-09-07 08:30:24','2017-09-07 08:30:24'),(851,'DIVO','1504802657.jpg','Semua Berawal Dari Imajinasi. Awali karier pada Medio 2006, DIVO telah temukan jati diri lewat 5 pendekar musikNya.. DIVO adlah gmbaran aktualisasi diri para personilnya dalam bermusik & berkarya,yang coba tawarkan sesuatu yg baru buat para pendengarnya.. Eksplorasi & inovasi tiada henti teLah buat DIVO berbeda..\r\nSO....DIVO IS ABOUT NEW CONCEPT MUSIC AND SONG !!!!','Alternative Rock','teman;','Yogyakarta',1406,'2017-09-07 08:44:17','2017-09-07 08:44:17'),(852,'Cendrawasih accoustik','1504802682.png','Pernah menjadi bintang tamu di acara malam puncak HUT RI ke 72','Pop','facebook;instagram;informasi_toko;vipclub;guitar_plus;umi;maliq;poster;teman;lainnya;','Jakarta',1310,'2017-09-07 08:44:42','2017-09-07 08:44:42'),(853,'Hansel En Gretel','1504803556.jpg','Hansel En Gretel (Fictional Character)\r\n\r\nHansel & Gretel adalah, virtual band yang diciptakan pada tahun 2017 oleh Ricky A. Jeffersen (Guitar/Synth) & Rafaela Lisa S. (Vocalist/Drum/Percussion), setelah melewati berbagai macam proses sejak tahun 2015. Ditambah dengan William Budiyana (Gitar/Vocal) pada tahun 2017.\r\n\r\nMemainkan genre Pop (electro) yang divariasikan dengan genre lain seperti Trap, Dubstep, Rock, Blues, Metal, Punk dll.\r\n\r\nDiresmikan pada tahun 2017 dan diresmikan dengan Single yang berjudul \"Ikigai\".','Pop','facebook;','Jakarta',1414,'2017-09-07 08:59:16','2017-09-07 08:59:16'),(854,'Aira Band','1504803777.jpg','Aira band awalnya bernama Qtha band,terbentuk pada tahun 2012.lalu karena seringnya tergonta ganti personil yang tinggal menyisakan abeng (vocal) dan erie (gitar) sebagai personil tetap,akhirnya mereka memutuskan untuk mengganti nama band mereka menjadi aira.','Pop','instagram;guitar_plus;teman;','Jakarta',1412,'2017-09-07 09:02:57','2017-09-07 09:02:57'),(855,'Remembering Sunday','1504804297.jpg','Sekelompok anak muda yang memiliki beberapa tujuan yang sama dalam hal bermusik, yang di bentuk pada 06 Juli 2017.','Others','instagram;teman;','Jakarta',507,'2017-09-07 09:11:37','2017-09-07 09:11:37'),(856,'HOT LAVA','1504805605.jpg','Berawal dari kami berdua (amir & tambi) yang mempunyai ide yang sama untuk membuat jenis musik yang berbeda dari biasanya tetapi tetap mudah di nikmati oleh pendengar musik. Kami pun membuat musik yang sekarang kami ikut kan dalam ajang levi\'s band hunt ini. Oh ya, kami menamakan jenis musik kami \"LAVAPOP\". Semoga dapat di terima oleh pendengar musik sekalian.. enjoy..','Others','teman;lainnya;','Surabaya',1035,'2017-09-07 09:33:25','2017-09-07 09:33:25'),(857,'NEGARA BAND','1504805678.jpg','Negara dapat diartikan sebagai sekelompok manusia yang dipersatukan oleh suatu rasa persamaan, karena nama Negara mempunyai makna yang dalam dan memiliki persamaan dalam visi & misi kami,akhirnya kami memakai nama tersebut dan diartikan sebagai sekelompok manusia yang mempunyai persamaan-persamaan dan tujuan dalam bermusik.Menjadi musisi adalah pilihan hidup kami walau jadi musisi tak semudah yang dibayangkan,penuh dengan perjuangan,pengorbanan,baik waktu dan materi,namun semua itu menjadi langkah-langkah kami untuk tetap semangat menjadi musisi. musisi adalah cita-cita kami,sejak pertama mendirikan band negara, kami sepakat bahwa main band adalah tujuan hidup kami bukan band yang asal-asalan tapi sebuah band yang merintis dari nol hingga menjadi sebuah band besar Indonesia. \r\n\r\nAwal terbentuknya band Negara yaitu pada 24 mei tahun 2008,band terbentuk  dengan formasi awal adalah Reren ( gitar 1 ), Iman (gitar 2), Ruly (Vokal), Akka (Drummer), Enu (Bass). Namun formasi ini hanya bertahan selama 1 tahun karena enu (bass) memilih untuk hengkang karena alasan akan kuliah diluar kota. Semenjak saat itu Negara kerap mengalami  perubahan formasi pada posisi bass. Namun pada saat Negara belum menemukan pemain bass untuk kesekian kali telah terjadi kejenuhan di personil yang lainnya yaitu Akka memutuskan untuk hengkang dari Negara. Akhirnya Negara pun tersisa dengan 3 orang personil. Langkah Negara pun tak terhenti disana, akhirnya Iman pun memutuskan untuk mengajak teman semasa SMA nya yaitu Maulana untuk mengisi posisi Drum. Dan setelah Maulana bergabung dengan Negara selama 2 bulan, ia pun merekomndasikan temannya yaitu Njul untuk mengisi posisi bass yang selama ini belum terisi. Setelah melihat dan mempertimbangkan Njul akhirnya seluruh personil Negara menyetujui usulan dari Maulana untuk mengisi kekosongan pada posisi bass. Akhirnya hingga saat ini Negara bertahan dengan formasi Ruly (vokal),Reren (gitar 1), Iman (gitar 2), Maulana (Drummer), Njul (Bass).','Pop','facebook;instagram;informasi_toko;vipclub;guitar_plus;umi;maliq;poster;teman;','Jakarta',1404,'2017-09-07 09:34:38','2017-09-07 09:34:38'),(858,'EMJI','1504806468.jpg','EMJI band berasal dari kota pangkalpinang provinsi Kep.Bangka Belitung,mencoba mengadu nasib di Ibu kota jakarta sejak 2013 sampai saat ini. \r\nPrestasi EMJI band sering menjuarai kompetisi-kompetisi festival band di bangka belitung','Pop','guitar_plus;teman;lainnya;','Jakarta',1309,'2017-09-07 09:47:48','2017-09-07 09:47:48'),(859,'pegasus','1504806798.jpg','juara 1 festival musik depok','Pop','facebook;instagram;informasi_toko;vipclub;guitar_plus;umi;maliq;poster;teman;lainnya;','Jakarta',826,'2017-09-07 09:53:18','2017-09-07 09:53:18'),(860,'STIKROY','1504806876.jpg','Pada tahun 2017 kami 5 mahasiswa yang berkecimpung dalam organisasi kegiatan band di kampus, suatu ketika ada sebuah kegiatan dimana kita harus menjadi satu band . Berawal dari bermain bersama kami memutuskan untuk terus lanjut dengan formasi band seperti ini dan menseriuskan band ini dengan nama band STICKROY dan dengan genre rock alternative, nama itu terlintas ketika kami ikut di sebuah festival dan salah satu dari kita menceletukkan nama itu. Dengan personil Riski Husein Nasution [vokal], Ilham Ardiansyah Gayo [gitar], Bebby Bimantara [gitar], Budi Triansyah [bass],Muhammad Khirzuddin [drum].\r\nBerawal dari mencover lagu band lain, kini kita mencoba untuk membuat lagu sendiri. Dengan tujuan  untuk meremaikan di blantika musik indonesia. Setelah melalui berbagai macam proses lahirlah  single perdana kita berjudul PENYESALAN. Sukses dengan pembuatan single perdana kami dan selang jangka waktu sebulan kami mencoba untuk membuat single kedua yang berjudul DALAM SENDIRIKU , dalam lagu ini kami berkolaborasi dengan Rachman Mamen gitaris dari band The B.O.N.A. Kami berharap semoga para pendengar musik bisa menyukai dan bisa membantu untuk terus memajukan lagu – lagu dari band kami serta semoga kami bisa terus berpartisipasi dalam blantika musik indonesia.','Alternative Rock','instagram;guitar_plus;teman;','Jakarta',1413,'2017-09-07 09:54:36','2017-09-07 09:54:36'),(861,'Bobby And The Office Project','1504807019.jpg','Bobby - Juara 1 Cipta Lagu Populer TV7 dengan lagu \"Ku Benci Kau Dengan Cintaku\"','Hip Hop','facebook;instagram;','Jakarta',1360,'2017-09-07 09:56:59','2017-09-07 09:56:59'),(862,'THE ROCK COMPANY','1504807884.jpg','* Opening Act Sheila On 7 Pensi Smaga diLiquid Tahun 2013\r\n* Performer path to the greatness SMANSA with Payung Teduh Tahun 2014\r\n* Celebrate your HALLOWEEN DAY Hallowcoustic Tahun 2015\r\n* Guest Star Keker Anniversary Tahun 2015\r\n* Indigo 96,0 edisi Oktober I-Radio Makassar Tahun 2015\r\n* Musik Hutan Tahun 2015 1st day\r\n* Live Concert “Music Class” Tahun 2015\r\n* Pesta Merdeka Pinrang Masa Depan Tahun 2015\r\n* Rocketeers 90’ in Music Tahun 2014\r\n* Rock In Celebes Tahun 2014\r\n* Yamaha Free Style Benteng Ford Rotterdam Tahun 2014\r\n* Undersiege Grand Opening Tahun 2015\r\n* Issue Road To Anniversary Peewee Gaskins Tahun 2013 di Liquid\r\n* HUT Ke-64 Wirabuana Makassar Music Day Tahun 2014\r\n* Guest Star Pekan Seni UNHAS Jas Merah Tahun 2015\r\n* Guest Star Music For Charity Tahun 2015\r\n* Lauching Honda verza MamujuTahun 2013\r\n* Road To Guinness Arthurs Day 2013\r\n* Undersiege Tri City dengan “Zian ZIgas”Bulukumba Tahun 2013\r\n* Accounting Carnaval Special Peformer Tahun 2015\r\n* Guest Star Musicial For Charity Kopie Roemah 2012\r\n* Road To Guinness Arthurs Day GOD CITY Tahun 2013 \r\n* GIIAS Makassar Automotif Show \"CCC 2014\r\n* Anniversary MEC opening Act Sheila on 7','Rock','instagram;guitar_plus;poster;teman;lainnya;','Surabaya',1415,'2017-09-07 10:11:24','2017-09-07 10:11:24'),(863,'Anoop Apoorva','1504808895.jpg','anoop apoorva terdiri dari empat personil rizki/debul (drum) ,wahyu/wacil (bass) ,serpico (lead guitar) ,afif (rytem guitar dan vocal) anoop apoorva terbentuk pada tanggal 17 april 2017 , arti dari nama anoop apoorva itu sendiri diambil dari bahasa sansekerta anoop itu mempunyai arti tidak bisa dibandingi dan apoorva itu indah sekali ,anoop apoorva menjadikan genre skedelick rock n\' roll . awal terbentuk band ini hanya terdiri dari wacil (bass) ,afif (guitar vocal) dan debul (drum) .lalu menggaet lead teman debul bernama ridho ,dan vocal ria temen debul juga . namun ketidak cocokan genre membuat mereka berdua meninggalkan anoop apoorva , kemudian kami bertiga bertemu serpico di studio tempat biasa kami latihan ,setelah berbincang lama kami bertiga pun tertarik dengan skill lead guitar yang dimiliki serpico .kami pun akhirnya menggaet serpico sebagai lead . lagu pertama yang kita buat adalah \"Aku Kau Dan Kalian\" dengan genre alternativ rock bercampur slow rock , kemudian kami membuat lagu berikutnya yaitu \"Sandra\" dengan genre rock n\' roll .karena kecocokan genre rock n\' roll kami berempat meluncurkan lagu selanjutnya yaitu \"Siapa Rasa\" dengan genre rock n\' roll bercampur sckedelick karna lirik yang rumit dan mempunyai arti didalam setiap liriknya .akhirnya kami pun cocok dengan genre yang membuat kami nyaman ,dan kami mengcover lagu the beatles - come together dengan arasement khas dari anoop apoorva . sampai saat ini kami bermain dan bersimponi bersama dalam anoop apoorva sampai saat ini . moto kami bersama di anoop apoorva adalah dari nusantara untuk menggapai dunia. Sudah pernah meraih juara 2 di kompetisi band sman 26 jakarta, pada tanggal 28 agustus 2017','Rock','facebook;instagram;guitar_plus;','Jakarta',1403,'2017-09-07 10:28:15','2017-09-07 10:28:15'),(864,'Hellfreezed','1504809626.jpg','terbentuk pada tahun 2014 di suatu Unit Kegiatan Mahasiswa di salah satu institute Perbankan Jakarta Selatan. kami memainkan Progressive/Metalcore, sejauh ini kami sudah mempunyai 3 single yang tersedia di Digital Store dan Youtube. kami pernah menjadi finalis pada event Hellprint Monster Tour 2016 yang diselenggarakan Di Rolling stone cafe jakarta selatan, Menjadi finalis Jakcloth Competition Summerfest 2017 dan Gitaris kami yan akbar nugraha sempat masuk di halaman GITARPLUS mengenai Gear apa saja yang dipakai untuk proses recording single ke 3 kami','Heavy Metal','instagram;guitar_plus;umi;maliq;teman;','Jakarta',1329,'2017-09-07 10:40:26','2017-09-07 10:40:26'),(865,'AYDA','1504810584.jpg','Menjuarai berbagai festival dan sering perform di cafe sekitar semarang','Rock','instagram;','Jakarta',1327,'2017-09-07 10:56:24','2017-09-07 10:56:24'),(866,'SUGAR CIGAR','1504811002.jpg','SUGAR CIGAR (SC) ADALAH BAND BERGENRE ROMANTIC POP DARI JAKARTA YANG BERDIRI PADA TANGGAL 3 JUNI 2017. MESKIPUN BAND BARU, NAMUN PARA PERSONILNYA BUKAN NAMA BARU DI INDUSTRI MUSIK TANAH AIR. BEBERAPA PERSONIL SC SUDAH MALANG MELINTANG DI INDUSTRI MUSIK SEJAK TAHUN 2003 DAN SEMPAT MENGELUARKAN SINGLE BERSAMA UNIVERSAL MUSIC INDONESIA PADA TAHUN 2010. SELAIN ITU PARA PERSONIL SUGAR CIGAR JUGA AKRAB DENGAN PENGALAMAN DAN PRESTASI DI DUNIA PERFESTIVALAN BAND. SALAH SATUNYA, SEBUT SAJA SANG VOCALIST YANG MERANTAU JAUH DARI AMBON KARENA MENJADI JUARA 1 KATEGORI SOLO VOCAL DI EVENT PERTAMINA GOT TALENT 2015. SELAIN ITU ADA JUGA PRESTASI BEBERAPA PERSONIL SC DIANTARANYA TOP10 INDIEFEST 2009 DAN KOMPILASI ALBUM INDIEFEST VOL.4, JUARA 3 NASIONAL CARDINAL AWARDS 2009, DAN BERKESEMPATAN MENJADI BAND PEMBUKA DI KONSER-KONSER MUSISI LUAR NEGERI DIANTARANYA BRUNO MARS, LENKA, THE ATARIS, BOYCE AVENUE, SPIN DOCTORS, DAN LAINNYA. SERTA PERNAH JUGA BERKOLABORASI DENGAN BEBERAPA MUSISI TERNAMA TANAH AIR.','Pop','instagram;informasi_toko;teman;','Jakarta',1199,'2017-09-07 11:03:22','2017-09-07 11:03:22'),(867,'ADIDURI Band','1504811549.jpg','Awalnya ADIDURI adalah project  solo dari sang vocalis Adi, penyanyi  kelahiran makassar yang menimba ilmu dan menyelesaikan kuliahnya di Yogyakarta. setelah menyelesaikan kuliah di Yogyakarta Adi kembali ke Makassar dan bertemu dengan personil lainnya yang mayoritas juga pernah kuliah di Yogyakarta,dan mereka membentuk sebuah band dengan nama ADIDURI, mereka sepakat untuk menjadikan ADIDURI sebagai nama band mereka, karena terinspirasi dari salah satu band dunia dan juga merupakan salah satu dari idola mereka yaitu BonJovi yang mana mereka juga menjadikan nama vocalist mereka sebagai nama band. ADIDURI sendiri dibentuk pada tahun 2009 dan sudah banyak prestasi yang telah diraih oleh band ini :\r\n	\r\nJuara 2 Yamaha “FREE YOUR SOUL 3” di Bandung 2009\r\nBintang tamu Indie “KICK ANDY” Metro Tv\r\nJuara 1 A MILD LIVE WANTED Regional Indonesia Timur 2012\r\nRunner up A MILD LIVE WANTED nasional audition jakarta 2012\r\n50 besar LA INDIEFEST 2013\r\n\r\ncontact person:\r\n081310290085\r\n081245001113','Pop','facebook;instagram;guitar_plus;teman;','Jakarta',1242,'2017-09-07 11:12:29','2017-09-07 11:12:29'),(868,'MOZAIK','1504811672.JPG','Band indie Bandung. Alternative, rock & folks. Mini albumnya \"Cahaya Malam\". Memiliki kekuatan dari segi lirik lagunya yang puitik, segar dan imajinatif. Menjadikan lagu sebagai cerminan realita sekaligus ruang refleksi. Berusaha menawarkan ide-ide baru secara tematik. Tahun, 2016, salah satu lagunya menjuarai Band in Bandung, acara chart band indie seBandung yang digagas Bandung Radio 95,2 fm','Alternative Rock','poster;teman;','Jakarta',1416,'2017-09-07 11:14:32','2017-09-07 11:14:32'),(869,'The Rattles','1504812254.jpg','The RATTLES adalah band rock asal Indonesia yang terbentuk pada tahun 2014 di Rawamangun, Jakarta Timur, dengan vocalist & guitarist M.Fauzan Fajri (ojan), bassist Chirst Sandy Anugrah (cacing) dan Drummer Chaqim Naim (apoy). \r\nDan sebelum nama The Rattles tercipta dulu kita bernama \"Paradigma\" dengan vocalist Daniel, Gutaris Febran, bassist Christ dan drummer Chaqim. dan dipertengahan tahun 2015 kita sudah tidak sejalan dengan daniel (vocalist) dan Febran (Guitaris), lalu tidak berangsung lama kita bertemu dengan fauzan (vocal&guitar), dengan cara menyanyi dan bermain guitarnya se irama dengan sub genre kita tersebut, dan secara resmi Fauzan sekarang bagian dari kami dan pada saat itu kita merubah nama band ini dari Paradigma menjadi Rattles.','Rock','instagram;poster;teman;','Jakarta',957,'2017-09-07 11:24:14','2017-09-07 11:24:14'),(870,'The Rattles','1504813012.jpg','The RATTLES adalah band rock asal Indonesia yang terbentuk pada tahun 2014 di Rawamangun, Jakarta Timur, dengan vocalist & guitarist M.Fauzan Fajri (ojan), bassist Chirst Sandy Anugrah (cacing) dan Drummer Chaqim Naim (apoy). \r\nDan sebelum nama The Rattles tercipta dulu kita bernama \"Paradigma\" dengan vocalist Daniel, Gutaris Febran, bassist Christ dan drummer Chaqim. dan dipertengahan tahun 2015 kita sudah tidak sejalan dengan daniel (vocalist) dan Febran (Guitaris), lalu tidak berangsung lama kita bertemu dengan fauzan (vocal&guitar), dengan cara menyanyi dan bermain guitarnya se irama dengan sub genre kita tersebut, dan secara resmi Fauzan sekarang bagian dari kami dan pada saat itu kita merubah nama band ini dari Paradigma menjadi Rattles.','Rock','instagram;poster;teman;','Jakarta',1417,'2017-09-07 11:36:52','2017-09-07 11:36:52'),(871,'The Rattles','1504813046.jpg','The RATTLES adalah band rock asal Indonesia yang terbentuk pada tahun 2014 di Rawamangun, Jakarta Timur, dengan vocalist & guitarist M.Fauzan Fajri (ojan), bassist Chirst Sandy Anugrah (cacing) dan Drummer Chaqim Naim (apoy). \r\nDan sebelum nama The Rattles tercipta dulu kita bernama \"Paradigma\" dengan vocalist Daniel, Gutaris Febran, bassist Christ dan drummer Chaqim. dan dipertengahan tahun 2015 kita sudah tidak sejalan dengan daniel (vocalist) dan Febran (Guitaris), lalu tidak berangsung lama kita bertemu dengan fauzan (vocal&guitar), dengan cara menyanyi dan bermain guitarnya se irama dengan sub genre kita tersebut, dan secara resmi Fauzan sekarang bagian dari kami dan pada saat itu kita merubah nama band ini dari Paradigma menjadi Rattles.','Rock','instagram;','Jakarta',1417,'2017-09-07 11:37:26','2017-09-07 11:37:26'),(872,'Moluska','1508562133.jpg','BIOGRAPHY\r\nMoluska yang sekarang sudah nggak ada personil awalnya lagi. Pertama bernama Mollusca dibentuk 2008 oleh Barry, vokalis lama bersama teman-temannya yang kebanyakan berasal dari Batam. Karena kesibukan masing-masing, akhirnya tinggal Barry seorang dan direklutlah Ambang, yang kemudian mencari personel tambahan yang ada sekarang. Barry pun mengundurkan diri dan melanjutkan karirnya sebagai pekerja kantoran. Semua personel yang sekarang sebelumnya sudah saling kenal karena dulu masing-masing punya band dan sering ikut festival, dan bandnya pada bubar. Akhirnya kami meneruskan tongkat estafetnya pada tahun 2010. Kenapa kami tetap pakai nama itu, karena namanya bagus menurut kami, akhirnya mengganti ejaannya saja dari mollusca ke Moluska.\r\n\r\nMoluska merupakan hewan triploblastik selomata yang bertubuh lunak. Ke dalamnya termasuk semua hewan lunak dengan maupun tanpa cangkang salah satunya kerang. Kami ambil filosofi seperti kerang, ia dapat memproduksi mutiara dan kami berharap dapat memproduksi karya-karya yang indah seperti mutiara.\r\n\r\nAWARDS & ACHIEVEMENT\r\n-	Juara 1 LA Lights Meet the experts “Online Superstars” di Univ. Budi luhur 2010\r\n-	Peringkat 1 regional Jakarta Barat dalam festival LA Lights Startup 2011 tahap Rookie stage\r\n-	Tahap Big stage LA Lights Startup 2011\r\n-	Juara 1 LA Lights Meet the experts “Build Your Bussines empire” 2011\r\n-	Finalis Cardinal Awards 2011 regional Jawa Timur\r\n-	Juara 1 Blu_M_Fest III November 2011 Univ. Budi Luhur Musik Festival\r\n-	Juara 3 festival Freedom To Music Inara Music Studio 2012\r\n-	Juara 1 festival KFC Talent Green Jak 2012\r\n-	Juara 3 festival suzuki nex hypermall Bekasi 2012\r\n-	Juara 2 festival suzuki nex bekasi mutiara gading timur 2012\r\n-	Juara 3 cardinal awards Depok Town Square 2012\r\n-	Finalis Cardinal awards wilayah Jakarta 2012\r\n-	Juara 3 festival Mr. Puisi MS Hall Vicky Sianipar 2012\r\n-	Juara harapan 3 festival Pasar Anak Negeri bersama Bpk. Hatta radjasa PAN\r\n-	Juara 2 Festival Yamaha ASIAN BEAT 2012 regional Jakarta 1\r\n-	Juara 1 festival Band RespectCup II SMPN 161 Jakarta Selatan 2012\r\n-	Juara 2 Festival Band Al-Azhar BSD 2013\r\n-	Juara 1 Festival A zone A mild Mei 2013 di Grogol foodcenter s3\r\n-	Juara 1 A mild SoundVersity regional Jakarta Barat Mei 2013 di Grogol foodcenter s3\r\n-	Juara 1 A mild soundversity regional Jakarta 2013 at Pisa Cafe Menteng\r\n-	Juara 1 Bedug Coustic at Green Pramuka Square JakPus 4 Agustus 2013\r\n-	Juara 1 festival Untukmu Pahlawan 10 Nov 2013 JakTv\r\n-	Juara 1 festival Smoothplay Envio Mild at Pappajack Jakarta Barat 11 Mei 2014\r\n-	76 Besar Rising Star Indonesia RCTI 2014\r\n-	40 besar music battle vidio.com tim uki Noah','Pop','guitar_plus;teman;','Jakarta',1340,'2017-09-07 12:50:51','2017-10-20 21:02:13'),(873,'eureka','1504817913.jpg','terbentuk tahun 2011,, karna memang 1 sekolah dan satu pemikiran..','Pop','teman;','Medan',1398,'2017-09-07 12:58:33','2017-09-07 12:58:33'),(874,'ZURFFF','1504819381.jpg','Band ini awalnya hanya mengawang di imajinasi kita dan akhirnya sekarang perlahan terwujud. Kita belom ada prestasi apa apa pada band ini dan kita harap dari levi\'s band hunt ini kita dapat mewujudkannya.','Others','instagram;lainnya;','Jakarta',1418,'2017-09-07 13:23:01','2017-09-07 13:23:01'),(875,'Cheery Trees','1508357186.jpg','Project ini terbentuk sejak tahun 2010, dan telah mengisi di berbagai macam acara khususnya di bandar lampung. salah satu puncaknya pernah mewakili lampung di event salah satu merek rokok terkenal pada tahun 2012 di palembang','Pop','instagram;guitar_plus;teman;','Yogyakarta',1421,'2017-09-07 15:37:08','2017-10-18 12:06:26'),(876,'Gloria\'s Band','1504831390.JPG','Band kami merupakan band yang sering mengikuti festival musik di kampus-kampus dan kami telah menjadi top 10 finalist band kota Surabaya Mld Jazz Wanted','Pop','facebook;instagram;','Jakarta',1424,'2017-09-07 16:43:10','2017-09-07 16:43:10'),(877,'Here We Go','1504833913.jpg','Here We Go adalah sebuah band Pop Punk yang terbentuk pada pertengahan\r\ntahun 2014 di kota Nganjuk Jawa Timur, Sebelumnya sudah pernah main dibeberapa gigs kecil dan pensi didaerahnya. Yang paling berkesan pernah bermain diajang djarum super rock, rising star, grand opening VW Se-Indonesia, dll','Others','guitar_plus;','Surabaya',748,'2017-09-07 17:25:13','2017-09-07 17:25:13'),(878,'Alley Silence','1504834346.jpg','Sebuah band yang mengusung genre Metalcore pada tahun 2009. Awal terbentuk dengan personil sementara Sinyo, Dayat, Oky, Bagus yang bernama \'ALLEY SILENCE\'. sempat vakum selama 4 tahun dikarenakan kesibukan kuliah, kerja dsb. Kemudian kami lanjut aktif lagi pada tahun 2013 ketika Sinyo (Guitar) bertemu Ryan Jagal (vocal) serta Brilian (drum) dari \'PSYCORE\' mengajak Febry (bass) dan Wahyu (Guitar) untuk memperkuat band ini, namun seiring berjalannya waktu, ada beberapa kali pergantian personil, dari bassist yang semula diisi Febry, digantikan oleh Bagus. Kemudian pada posisi gitar yang sebelumnya Wahyu digantikan oleh Novan, hingga kami berdiri dengan line up yang sekarang :\r\nRyan : Vocal\r\nBagus : Bass\r\nBrilian : Drum\r\nSinyo : Guitar\r\nNovan : Guitar','Others','guitar_plus;poster;teman;lainnya;','Surabaya',1363,'2017-09-07 17:32:26','2017-09-07 17:32:26'),(879,'Suaserima','1504836143.jpg','Suaserima terbentuk dari tahun 2012. Tema yang diangkat dalam karya kami seputar kehidupan sehari-hari, pengalaman pribadi, dan lingkungan sekitar. Pendekatan musik yang kami usung dan ilhami seputar musik Pop, Rock, Experimental, dan masih banyak lagi. Secara keseluruhan, warna musik yang kami mainkan \"Alternative\". Pada pertengahan 2017, kami sudah merilis single \"Memorabilia\", sebagai jembatan menuju album perdana yang dalam waktu dekat juga akan dirilis.','Alternative Rock','guitar_plus;','Yogyakarta',1426,'2017-09-07 18:02:23','2017-09-07 18:02:23'),(880,'Dominant','1504836343.jpeg','Band ini terbentuk pada tahun 2015 dengan nama Dominant yang terdiri dari 3 personil yaitu Monic (Pianist & Vocalist), Moses (Bassist), Daniel (Drummer). Dominant pernah mengisi acara reguler di salah satu mall di bogor dengan menambah additional player (gitarist) dan beberapa acara pernikahan. Dengan adanya levis band hunt, dominant memiliki mimpi untuk berkarya di industri musik indonesia.','Pop','facebook;','Jakarta',1334,'2017-09-07 18:05:43','2017-09-07 18:05:43'),(881,'Baruno','1504841275.jpg','Formed\r\n2015 in Jakarta, Indonesia\r\n\r\nMember\r\nIndro (Guitar), Ravi (Synth), Tefan (Drum), Ichul (Vocal), Deon (Bass)\r\n\r\nYears Active\r\n2015 - Present\r\n\r\nGenres\r\nAlternative Rock\r\n\r\nStyles\r\n•	Alternative Rock\r\n•	Punk/Rock\r\n•	Experimental Rock\r\n•	Alternative/Indie rock\r\n•	Indie Electronic\r\n\r\nMoods\r\n•	Intense\r\n•	Chaos\r\n•	Austere\r\n•	Atmospheric\r\n•	Enthusiasm\r\n•	Earnest\r\n•	Theatrical\r\n•	Suffocating','Alternative Rock','lainnya;','Jakarta',1277,'2017-09-07 19:27:55','2017-09-07 19:27:55'),(882,'ROCKET 88','1504842447.JPG','Rocket88, adalah band Rock asal Jakarta yang terbentuk pada tahun 2014 akhir. dengan:\r\n\r\n-Pradipta sebagai Vocal & Gitar\r\n-Dix (Arditya) Sebagai Bass & Vocal\r\n-Kevin sebagai Drum\r\n\r\nTerbentuknya mereka karena mereka berada disalah satu universitas dan jurusan yang sama, serta memiliki passion musik yang sama.\r\n\r\nMereka kebanyakan menyambangi gigs-gigs komunitas, dan pensi sekolah.\r\njuga beberapa kali mengisi di acara clothing festival jakarta (Jakcloth), dan Bermain diBalai Sarbini.\r\n\r\nDi akhir tahun 2017 ini mereka berencana merilis album perdana mereka yang berjudul \" Faceless \". sama seperti single mereka yang diunggah berjudul \" Faceless \"','Rock','instagram;guitar_plus;teman;','Jakarta',1429,'2017-09-07 19:47:27','2017-09-07 19:47:27'),(883,'Bending Note','1504842805.jpg','band asal bandung, siap dengan materi rekaman untuk 3 album, finalis band sound of 3 prov. banten','Alternative Rock','facebook;','Jakarta',1281,'2017-09-07 19:53:25','2017-09-07 19:53:25'),(884,'VELLA','1504844869.jpg','Sebuah band Sekolah yang terbentuk ditahun 2010, sempat facum karna personilnya kuliah semua. ditahun 2014 kami merintis kembali mimpi-mimpi kami.\r\nRentang waktu 2010 hingga sekarang Vella band beberapa kali mengikuti festival band tingkat SMA dan juga Tingkat Umum. Beberapa kali Vella band berhasil menjadi juara.','Pop','instagram;','Jakarta',1433,'2017-09-07 20:27:49','2017-09-07 20:27:49'),(885,'Muthia Test 2','1504849363.jpg','Manggung dimana aja','Others','facebook;','Jakarta',22,'2017-09-07 21:42:43','2017-09-07 21:42:43'),(886,'Mort','1504850959.JPG','MORT, sebuah band yang lahir di kota Denpasar pada bulan Maret 2015 dengan memainkan genre rock radikal/radical rock. Band ini beranggotakan 4 orang yaitu Angga Baskara (vokal), I Putu Wicaksana (gitar), Weda Adnyana (bass), dan Bagus Rangga (drum). Namun, seiring berjalannya waktu, disebabkan satu dan lain hal Weda & Rangga meninggalkan band. Kini formasi terbaru Mort diisi oleh Baskara, Putu, dan Mol (drum), serta additional bass.\r\n\r\n\"Mort\" diambil dari bahasa Prancis, dalam bahasa Indonesia berarti \"mati\". Filosofinya yakni MORT ingin membuat mati kejenuhan, kebosanan, dan rasa tidak nyaman para pendengar. Musik mereka berbasis pada thrash metal, punk, dan rock yang ter-influence-kan oleh beberapa band seperti Speedwolf, Viking Skull, Sarcasm, Municipal Waste, Metallica, dan Natterjack yang kemudian diramu menjadi satu keutuhan bernama rock radikal. Kuartet ini telah meluncurkan sebuah mini album bertajuk \"Berontak!!!\" yang dirilis pada tanggal 13 Oktober 2016 yang lalu, serta telah melaksanakan pesta perayaan mini album mereka pada 5 Januari 2017. 5 lagu bising nan menghentak terdapat dalam E.P ini yaitu \"Intimidasi Raksasa Negeri\", \"Cerita Malam Suram\", \"Berontak!!!\", \"Menjejal Ajal\", dan \"Beringas\" yang semuanya dapat didengar secara gratis di www.mortradical.bandcamp.com','Heavy Metal','poster;teman;','Surabaya',1435,'2017-09-07 22:09:20','2017-09-07 22:09:20'),(887,'Strange Brew','1504851072.jpg','kendati para personel band sudah cukup lama terendam masuk di dunia musik band ini merupakan salah satu project pertama yang melibatkan mereka bersama di satu band. dari berbagai macam influence tiap-tiap individu dipadukan sehingga tercipta sebuah komposisi yang tidak bisa dikatakan modern atau vintage sekalipun. darisitulah muncul ide nama band yaitu Strange Brew yang berarti campuran yang aneh atau seduhan yang aneh yang juga merupakan salah satu hits dari band rock 60an yang di motori oleh Eric Clapton yang bernama Cream. dengan sound yang dihasilkan oleh gitar fender startocaster yang mengacu pada spec tahun 1965 yang di beri suplemen pedal fuzzface, dentuman drum ala rock 90an vocal yang padat, barikade not-not rendah dari bass serta vokal yang memiliki karakter rock ballad bertemu terjadilah sebuah ekstraksi musikal yang kami sebut Strange Brew.','Rock','instagram;','Surabaya',793,'2017-09-07 22:11:12','2017-09-07 22:11:12'),(888,'Cloud.Ink','1504851638.jpg','Pengalaman:\r\n1.	UPH Fest 2016 home band\r\n2.	Maranatha Christian University Bandung “Psycomp 2017” guest star\r\n3.	UPH Open House 2017 home band\r\n4.	Wedding gigs\r\n•	April 2nd for Andreas and Wanglei at Menara Peninsula Hotel\r\n•	July 22nd for Stefanus and Sylvia at Marina Ancol\r\n5.	Beer Garden Valentine gig\r\n6.	Played for Timothy John Luntungan live recording project\r\n\r\nKarya Original:\r\n1. Sailing Sky\r\n2. Why Do We Fall','Pop','maliq;','Jakarta',584,'2017-09-07 22:20:38','2017-09-07 22:20:38'),(889,'Greenback Boogie','1504853084.jpg','Greenback Boogie terbentuk pada tanggal 14 Januari 2016, bermula saat Rian dan Faisal ingin membentuk band dan akhirnya bertemu dengan adik kelas Faisal semasa SMA yaitu Panji, Agi dan Satria. Setelah membuat cover project lagu-lagu populer dari era 90 hingga sekarang.\r\nPrestasi dari band kami adalah juara 2 Superrawk fest 2017 (Djarum Super) dan 40 besar Jakcloth band competition.','Alternative Rock','guitar_plus;','Jakarta',490,'2017-09-07 22:44:44','2017-09-07 22:44:44'),(890,'Hello Haters','1504853531.JPG','Hello Haters band  yang berasal dari Kota Malang, beraliran alternatif rock yang dibentuk pada awal perkuliahan di Universitas Brawijaya Malang pada tahun 2014 hingga sekarang. Prestasi yang pernah diraih adalah juara 1 dekan cup , 1 akustik ramadhan , dan sebagai pengisi acara dalam beberapa acara di kampus. Format personil band dari awal hingga sekarang tetap dan tidak berubah yakni Ergha : vokal + gitar , Mario : backing vokal + bass , Faza : synth , Estu : melodi , Ukaasyah : drum. Lalu pada tahun 2016 kami telah membuat single dengan judul lagu pertama dengan mengusung tema lagu percintaan dan kemudian baru mencoba home recording.','Alternative Rock','instagram;guitar_plus;','Surabaya',1420,'2017-09-07 22:52:11','2017-09-07 22:52:11'),(891,'Hello Haters','1504853564.JPG','Hello Haters band  yang berasal dari Kota Malang, beraliran alternatif rock yang dibentuk pada awal perkuliahan di Universitas Brawijaya Malang pada tahun 2014 hingga sekarang. Prestasi yang pernah diraih adalah juara 1 dekan cup , 1 akustik ramadhan , dan sebagai pengisi acara dalam beberapa acara di kampus. Format personil band dari awal hingga sekarang tetap dan tidak berubah yakni Ergha : vokal + gitar , Mario : backing vokal + bass , Faza : synth , Estu : melodi , Ukaasyah : drum. Lalu pada tahun 2016 kami telah membuat single dengan judul lagu pertama dengan mengusung tema lagu percintaan dan kemudian baru mencoba home recording.','Alternative Rock','instagram;guitar_plus;','Surabaya',1420,'2017-09-07 22:52:44','2017-09-07 22:52:44'),(892,'Hello Haters','1504853644.JPG','Hello Haters band  yang berasal dari Kota Malang, beraliran alternatif rock yang dibentuk pada awal perkuliahan di Universitas Brawijaya Malang pada tahun 2014 hingga sekarang. Prestasi yang pernah diraih adalah juara 1 dekan cup , 1 akustik ramadhan , dan sebagai pengisi acara dalam beberapa acara di kampus. Format personil band dari awal hingga sekarang tetap dan tidak berubah yakni Ergha : vokal + gitar , Mario : backing vokal + bass , Faza : synth , Estu : melodi , Ukaasyah : drum. Lalu pada tahun 2016 kami telah membuat single dengan judul lagu pertama dengan mengusung tema lagu percintaan dan kemudian baru mencoba home recording.','Alternative Rock','instagram;guitar_plus;','Surabaya',1420,'2017-09-07 22:54:04','2017-09-07 22:54:04'),(893,'VENA','1504854315.jpg','VENA pertama kali terbentuk tgl 29 Maret 2016 (masih dengan formasi 2 orang). Maves sebagai vocalist + guitarist, dan Navila sebagai vocalist + violinist. \r\nKami memilih untuk menggunakan nama VENA karena memiliki arti pembuluh darah balik, dimana setiap manusia pasti memilikinya. Dan vena berfungsi untuk mengalirkan darah dari seluruh tubuh menuju satu titik pusat yaitu jantung. Seperti visi kami, yang ingin menyatukan seluruh jiwa dan raga kami sebagai personil band ini menuju satu tujuan, yaitu kesuksesan, dengan menggunakan musik sebagai penentu arahnya. Begitupun harapan kami bagi setiap mata, hati, dan telinga yang menikmati karya kami akan menyatu dengan kami dan merasakan kebahagiaan. \r\nBerjalan sekitar 1 bulan, formasi kami berubah menjadi 4 orang. Karena Fadhil (drummer / cajon player) mulai bergabung. Kemudian ada Senna (bassist) yang sempat melengkapi penampilan kami namun harus terhenti karena berkuliah di luar kota. Dan ada Wilheart (keyboardist) yang sempat melengkapi penamilan kami, namun sayangnya, karena satu dan lain hal Wilheart tidak dapat melanjutkan perjalanannya bersama kami. Akhirnya formasi VENA saat ini baru berjalan mulai 17 Agustus 2017 sejak bergabungnya Chandra (bassist) dan Alfan (lead guitarist) sehingga penampilan VENA semakin harmonis dan semarak.\r\nBand kami yang bisa dibilang masih seumur jagung ini ternyata sudah mulai diperhitungkan sebagai band berkualitas oleh Masyarakat Jabodetabek. Khususnya bagi pelalu-pelaku usaha Cafe, Restaurant, maupun masyarakat umum dan instansi yang memiliki acara seperti ulang tahun, pernikahan, pembukaan tempat usaha, exhibition, gathering, reuni, seminar, dan event-event lain yang membutuhkan pemusik untuk mengisi acara. \r\nBanyak rintangan yang sudah kami tempuh sepanjang perjalanan karir band kami untuk mencapai kesuksesan. Dan syukur alhamdulillah selama ini hasil dari kerja keras kami semua mulai berbuah manis.  Jadwal kami untuk tampil dari panggung ke panggung saat ini sudah penuh mengisi keseharian kami. Karena kami sudah tampil secara reguler di beberapa tempat di area Jabodetabek. Selain di wilayah Jabodetabek, kami juga sudah mulai merambah area luar kota seperti Jogja, Medan, Bandung, Jombang, dan Surabaya. \r\nKami berharap semoga VENA akan menjadi jauh lebih baik lagi di masa mendatang, untuk itu dukungan dari para Sahabat VENA sangatlah berarti bagi kami.','Others','facebook;instagram;','Jakarta',1436,'2017-09-07 23:05:15','2017-09-07 23:05:15'),(894,'Lydian','1504855357.jpg','Lydian adalah band yang dibentuk berdasarkan kesamaan preferensi musik di antara para personil. Seluruh personil menyukai genre musik rock, meskipun masing-masing memiliki taste yang berbeda terhadap jenis rock yang disukai. Untuk menyatukan passion tiap personil, Lydian dibentuk dengan kombinasi sound yang unik. Kami senang bermain-main dengan suara gitar yang raw di satu sisi, dan melodik di sisi yang lain. Begitu juga dengan kombinasi suara bass dan drum yang simpel namun variatif dan powerful.\r\n\r\nMajalah HAI pernah membahas demo kami yang bertajuk \"Melodi\" pada edisi ke 37/2014/XXXVIII (15-21 September 2014). Untuk foto terkait bisa dilihat di on.fb.me/1AuwDV8.','Alternative Rock','facebook;poster;teman;','Jakarta',1441,'2017-09-07 23:22:37','2017-09-07 23:22:37'),(895,'Fiverna','1504855464.jpg','Fiverna terbentuk pada tanggal 14 Oktober 2015 dengan mengusung genre Pop-Groove. Kami terdiri atas lima orang personil, yakni Giovanni Yessynia Gunawan (Vocal), Hasrul Novarizki (Guitar), Aderiel Satya Bernike (Bass), Daniel Kinantyo Christy (Keyboard), dan Antonius Tri Cahya (Drum). Fiverna awalnya terbentuk dari beberapa orang anggota Airlangga Orchestra, salah satu Unit Kegiatan Mahasiswa yang ada di Universitas Airlangga, Surabaya.\r\n\r\nPengalaman Stage:\r\n- Guest Star Eco Party 2015 Corner FST Universitas Airlangga\r\n- Guest Star Stovit League 2016 FKG Universitas Airlangga\r\n- Guest Star Seminar Inspiratif 2016 with Keenan Pearce FF Universitas Airlangga\r\n- Guest Star “Private Gigs” Wisma Semen Gresik 2016\r\n- Guest Star Diplomers 2.0 FV Universitas Airlangga\r\n- Guest Star Airlangga Specta 2016\r\n- Guest Star Crown 2016 FF Universitas Airlangga\r\n- Guest Star Seminar Nasional & Fieldtrip Education FKH Universitas Wijaya Kusuma\r\n- Guest Star Inaugurasi FKH Universitas Airlangga','Pop','instagram;guitar_plus;','Surabaya',1150,'2017-09-07 23:24:24','2017-09-07 23:24:24'),(896,'Runaway','1504857729.JPG','-Mengisi acara JakIndie Pro di Panggung ABC Ancol 7 Juli 2017\r\n-Mengisi acara GBK Ramadhan Music Fest di GBK 20 Juni 2017\r\n- Mengisi acara Voice of Bekasi di Radio Suara Bekasi 17 Juli 2017','Alternative Rock','facebook;instagram;vipclub;maliq;poster;teman;lainnya;','Jakarta',1355,'2017-09-08 00:02:09','2017-09-08 00:02:09'),(897,'Runaway','1504857737.JPG','-Mengisi acara JakIndie Pro di Panggung ABC Ancol 7 Juli 2017\r\n-Mengisi acara GBK Ramadhan Music Fest di GBK 20 Juni 2017\r\n- Mengisi acara Voice of Bekasi di Radio Suara Bekasi 17 Juli 2017','Alternative Rock','facebook;instagram;vipclub;maliq;poster;teman;lainnya;','Jakarta',1355,'2017-09-08 00:02:17','2017-09-08 00:02:17'),(898,'Runaway','1504857747.JPG','-Mengisi acara JakIndie Pro di Panggung ABC Ancol 7 Juli 2017\r\n-Mengisi acara GBK Ramadhan Music Fest di GBK 20 Juni 2017\r\n- Mengisi acara Voice of Bekasi di Radio Suara Bekasi 17 Juli 2017','Alternative Rock','facebook;instagram;vipclub;maliq;poster;teman;lainnya;','Jakarta',1355,'2017-09-08 00:02:27','2017-09-08 00:02:27'),(899,'Liana band','1504858036.jpg','Liana band merupakan band yang baru memulai meramaikan kembali  belantika musik Indonesia  setelah beberapa tahun yang lalu sempat vakum dari dunia  hiburan tanah air. Di pertengahan tahun 2017 ini Liana band mencoba kembali peruntungannya  di dunia music Indonesia dengan mengusung Genre Pop Rock Romantic. Liana band terbentuk dari dua band yang berasal dari kota Cilegon dan Lampung, sebut saja  band  tersebut  yaitu Keisha band dan Djantan yang sudah bermusik sejak tahun 2006 s/d  Tahun 2014, di mana keduanya merupakan band yang sudah banyak menghasilkan karya lagu yang Easy Listening dan memenangkan  kejuaraan dari Festival – festival  band dan event event  baik di tingkat lokal maupun tingkat Nasional dan memenangkan kejuaraan seperti : Juara 1 Festival Gudang Garam tingkat Nasional Regional Palembang, Juara 1 Festival  Universitas Saburai Bandar Lampung, Juara 1 Kejuaraan  Piala Walikota Bandar Lampung, Juara  1 Kejuaraan  Piala Walikota  Cilegon, Finalis  A mild live Wanted Regional  Kota Cirebon,  Opening acara  Annivesary Slank “PLUR” , Opening  konser band Dmasiv (Kota Serang & Cilegon), Opening konser band Slank (Depok), Opening   konser band  The Cangcuters (Jakarta) & Opening konser band Seventeen (Kota  Bandar Lampung) \r\nMakna dari  kata Liana sendiri di ambil dari bahasa Jerman yang berarti “Manuasia yang Sederharna”, dimana makna tersebut menjadi dasar band kami untuk selalu menjadi  pribadi yang  selalu Low Profile dalam bermusik dan kami terapkan dalam kehidupan sehari – hari. \r\nPersonil Liana band digawangi  oleh 6 Personil  yaitu : Adit (Vokal), Adhe (Drum), Wildan (Lead Guitar), Rifki (Guitar Rhytem), Dudie (Bass), Eka (Keyboard) .\r\nKARIR\r\n-	Juara 1 Festival Band PT.Chandra Asri Cilegon (26 Agustus 2017)\r\nBand Social Media :\r\nFacebook : Lianaband cilegon\r\nInstagram : Lianabandcilegon\r\nEmail : lianabandgroup@gmail.com\r\nContact Person : Eka (081297858490)','Alternative Rock','poster;teman;','Jakarta',1422,'2017-09-08 00:07:16','2017-09-08 00:07:16'),(900,'Luna','1504858381.jpg','band ini berawal dengan nama \"Delv\" yang dulunya dengan vocalis laki2. mengawali karir sebagai pemenang JUARA 1 Speedytrack Telkom 2010, yang sempat ditampilkan live di TRANS corp. Juga Juara 3 Sprit DPlong Indonesia. setelah itu sering tampil di panggung2 besar seperti Soundrenalin.\r\nseiring berjalannya waktu, band ini mengalami perubahan konsep dengan bergabungnya Mahayu sebagai Vocalis, menggantikan Vocalis yg sebelumnya. dan membuat musik kami lebih renyah, dan menyenangkan.','Pop','informasi_toko;guitar_plus;teman;','Yogyakarta',1378,'2017-09-08 00:13:01','2017-09-08 00:13:01'),(901,'Sin-Thing','1504859563.jpg','Band yang terbentuk pada 28 Juni 2016 ini mengusung genre punk rock yang mengacu pada unsur sosial, politik, dan persatuan Indonesia. Disini kami menekankan bahwa kami tidak mempunyai skill bermusik yang spesial tetapi kami ingin membuat lagu-lagu yang mempengaruhi kebanyakan orang ke sisi positif.','Others','facebook;instagram;guitar_plus;umi;lainnya;','Jakarta',1447,'2017-09-08 00:32:43','2017-09-08 00:32:43'),(902,'Prasiwan','1504859676.jpg','pemain gitar akustik, dan harmonica/ sudah menggeluti dunia musik sejak SD dan berkarir sebagai solois sudah 4 tahun di bantu bersama teman - teman saya, sering perfom di caffe caffe maupun event','Folk','facebook;instagram;informasi_toko;vipclub;guitar_plus;umi;maliq;poster;teman;lainnya;','Surabaya',1228,'2017-09-08 00:34:36','2017-09-08 00:34:36'),(903,'Lowfat','1504860886.jpg','LowFat dibentuk setahun lalu dengan target rekaman album, sekarang sedang proses rekaman','Heavy Metal','guitar_plus;','Medan',1362,'2017-09-08 00:54:46','2017-09-08 00:54:46'),(904,'DESMOINE','1504862825.jpg','Band kami terbentuk dari sukanya kami terhadap musik..Demoine dari nama kota Desmoines, kota yang cukup indah dan kami rasa namanya juga cukup unik jadi kami memutuskan mengambil nama Desmoine.','Alternative Rock','facebook;teman;','Jakarta',1448,'2017-09-08 01:27:05','2017-09-08 01:27:05'),(905,'Red Maverick','1504862886.jpeg','Red Maverick adalah band yang dibentuk pada pertengahan tahun 2015. Awal terbentuknya\r\ndimotori oleh Happy (Vokal), Bayu Windiasko (Gitar), Rizki Aldo (Bass), dan Caecario Vito\r\n(Drum). Happy pada dasarnya adalah penyanyi Gereja. Saat itu band ini belum memiliki nama\r\npasti dan selalu berubah-ubah. Band ini memainkan musik-musik seperti Nirvana, Creed, Dewa\r\ndan lainnya. Setelah beberapa kali latihan, karena kendala kesibukan pekerjaan akhirnya Vito\r\nmengundurkan diri. Sempat bingung mencari pengganti Vito, pada akhir 2015 Jon sebagai\r\ndrumer resmi menggantikan Vito. Pada saat itu pula Happy menemukan nama yang pas untuk\r\nband ini, yaitu Red Maverick.\r\nBerjalan lurus dengan nama yang sudah pasti dan konsisten latihan, Bayu, Aldo dan Happy\r\nmembuat lagu pertama dengan judul Breakaway. Sebenarnya lagu Breakaway adalah lagu\r\nciptaan Bayu dari band sebelumnya dengan judul lagu Keep The Fire Light dari band Bayu sebelumnya yaitu Beat And Run. Setelah banyak perubahan komposisi lagu, akhirnya Bayu,\r\nAldo dan Happy resmi merubah judul dan komposisi lagu dengan judul Breakaway yang liriknya\r\nsendiri dibuat oleh Happy.\r\nSetelah berjalan hampir setengah tahun, karena kesibukan pekerjaan masing-masing, Red\r\nMaverick vacuum dari bermusik. Sempat berhenti hampir setengah tahun pada tahun 2016 dan\r\nJon pun mengundurkan diri dari posisi drum karena lokasi tempat tinggal Jon yang jauh dan\r\nkesibukan bekerja. Tidak beberapa lama Catra, yang sudah berteman lama dengan Bayu,\r\nmenggantikan posisi Jon sebagai drumer. Catra dan Bayu sempat memiliki band bersama\r\ndengan Fariz ‘Bleng’ Maulana yang sekarang membentuk band Groove Metal bernama Helliost\r\ndi Bandung. Namun Catra saat itu memegang posisi bass.\r\nTidak beberapa lama, Aldo tiba-tiba mengundurkan diri karena kesibukan pekerjaan dan usaha\r\nyang dijalankannya. Dengan segera Red Maverick pun merekrut Pras yang berteman baik\r\ndengan Bayu dan Happy. Pras sebenarnya adalah gitaris pada band sebelumnya, namun\r\nmemutuskan untuk mengambil posisi bass menggantikan Aldo.','Rock','instagram;teman;','Jakarta',1431,'2017-09-08 01:28:06','2017-09-08 01:28:06'),(906,'LEFAWIGI','1504864185.jpg','LEFAWIGI adalah band Alternative Rock asal Jakarta Timur. Nama LEFAWIGI sendiri merupakan singkatan dari nama-nama anggotanya (LExy--ex-member, FAlih, WIsnu, Giri--ex-member, Irfan). Untuk tahun ini kami juga kedatangan anggota baru yaitu Idham.\r\n\r\nTerbentuk sejak tahun 2010, LEFAWIGI aktif di kancah musik underground di Jabodetabek, terutama scene hardcore, hip-hop, dan punk rock.\r\n\r\nMusik kami terinspirasi dari berbagai spektrum musik. Mulai dari The Temper Trap dan Kodaline hingga Green Day dan Blink-182. LEFAWIGI mencoba untuk memberikan sound yang baru bagi penikmat musik tanah air.\r\n\r\nSalah satu single yang telah dirilis secara independen berjudul \"Rise\" dapat didengarkan di Spotify, iTunes, Deezer, dll. LEFAWIGI berencana meluncurkan album debutnya pada tahun 2018.\r\n\r\nCari tahu lebih lanjut mengenai kami di blog kami: lefawigi(dot)wordpress(dot)com.','Alternative Rock','instagram;teman;','Jakarta',1394,'2017-09-08 01:49:45','2017-09-08 01:49:45'),(907,'FSFS','1504865280.JPEG','Fsfs adalah salah satu band asal kota kembang berawal pada tahun 2009, berbagai formasi telah kami lakukan dan ini formasi baru dengan aldo pada vokal, dwiky pada gitar bachtiar pada gitar, bayu pada bass dan ihsan pada drum. Sebuah karya telah tercipta dengan single  Fake smile, kemudian True friends dan unspoken','Alternative Rock','instagram;','Jakarta',1286,'2017-09-08 02:08:00','2017-09-08 02:08:00'),(908,'Babalo\'on','1504865579.jpg','Memberontak di Timur Membara, Bekasi Street Grunge, Tuban Underground','Alternative Rock','facebook;instagram;informasi_toko;','Jakarta',1449,'2017-09-08 02:12:59','2017-09-08 02:12:59'),(909,'LIAR','1504867445.jpg','berawal dari obrolan tentang keresahan terhadap problema Ibukota, trio yang bersahabat saat berkuliah di Bandung sepakat membentuk LIAR yang merepresentasikan musik, attitude dan merchandising mereka yang sebenarnya','Rock','facebook;','Jakarta',1455,'2017-09-08 02:44:05','2017-09-08 02:44:05'),(910,'Endless Summer','1504867583.JPG','Terbentuk pada pertengahan 2015, dengan nama ENDLESS SUMMER yang bermakna keseruan yang tiada akhir dengan motto \"we\'ll burn you out, like the summer never end\".\r\nPrestasi :\r\nJuara 1 : Kampung Pemuda, 2016\r\nJuara 2 : Man Ice, 2017\r\nJuara 1 : Erlangga Talent Show, 2017\r\n\r\nPerformance:\r\nFestival Kampung Pemuda, Tangerang\r\nD\'sparted, Tangerang\r\nyouth Festival, Tangerang Selatan\r\nSonic Linguistic, Tangerang Selatan\r\nAlbes Festival,Tangerang Selatan\r\nO2 Cafe, Jakarta\r\nTangerang Culinary Night, Tangerang\r\nTMII Rock Nusantara, Jakarta\r\nLapiaza Dock 88, Jakarta\r\nAncol Beach Walk, Jakarta\r\nFestival Cisadane, Jakarta','Alternative Rock','instagram;','Jakarta',753,'2017-09-08 02:46:23','2017-09-08 02:46:23'),(911,'Tenggara','1504871293.jpg','Tenggara Adalah grup yang dibentuk dari pertemanan kelima personelnya, melalui inisiatif mikail sang guitars yg ingin ngeband dan diiyakan ollen keempat personel lainnya. Masing - masing personel dari Tenggara sendiri memiliki latar belakang musik yang berbeda namun serupa, melalui grup ini mereka menyatukan dalam karya.','Pop','facebook;teman;','Jakarta',1388,'2017-09-08 03:48:13','2017-09-08 03:48:13'),(912,'The WIse','1504872548.JPG','Alternative Band From Surabaya','Others','teman;','Surabaya',1461,'2017-09-08 04:09:08','2017-09-08 04:09:08'),(913,'EGO','1504872601.jpg','Don\'t have any. The only achievement we had and are happy about is when we met, started jamming and eventually found our colors.','Electro','teman;','Yogyakarta',1223,'2017-09-08 04:10:02','2017-09-08 04:10:02'),(914,'Lake And Trees','1504873913.png','\"Jodoh sudah di atur\" mungkin kalimat itu yang cocok menggambarkan cerita tentang Lake And Trees yang terbentuk dari mencari kerja bersama antara Ikay (Guitar) dan Azit (Vocal) , sharing musik mereka memiliki visi sama dan Azit memperkenalkan Ridwan (Gitar) kepada Ikay , lalu mencoba mencari karakter masing masing dan akhirnya terbentuk lagu Carry On , dari kisah permasalahan band masing masing yang pernah di lalui, lalu Ikay memperkenal kan Indra (Bass) kepada Ridwan dan Azit , Indra bertransformasi dari guitaris menjadi bassist untuk mejadi pondasi musik di band Lake And Trees','Alternative Rock','instagram;informasi_toko;teman;','Jakarta',1232,'2017-09-08 04:31:53','2017-09-08 04:31:53'),(915,'Stinghaze','1504874077.jpg','Stinghaze adalah sebuah band rock yg berasal dari jakarta yg terpengaruh oleh warna musik rock tahun 70-an','Rock','facebook;instagram;teman;','Jakarta',1456,'2017-09-08 04:34:37','2017-09-08 04:34:37'),(916,'VELLA','1504875421.jpg','Adam (gitar), Leon (bass), Sandi (drum) adalah kakak kelas gue di SMA. pertama gue diajak adam ikut eskul musik di SMA gue, karna emg gue suka nyanyi yaudah gue ikut. ga nyangka kita bisa awet sampe sekarang walaupun sempet facum, tapi itulah proses. festival pelajar dan umur pernah kita coba ikutin, syukur alhamdulillah ada yang nyangkut jadi juara dan ada juga belum beruntungnya kita.','Rock','instagram;','Jakarta',1462,'2017-09-08 04:57:01','2017-09-08 04:57:01'),(917,'Stand Together','1504875759.jpg','Awal berdiri band ini ialah pada tanggal 14 Maret 2017 dengan personil yang terbentuk dari beberapa pecahan band dan membentuk band Stand Together dengan genre Pop Indo. Memiliki visi dan misi yang sama ialah untuk memajukan belantika musik Indonesia untuk lebih maju dan baik ke depannya.','Pop','facebook;instagram;','Jakarta',1453,'2017-09-08 05:02:39','2017-09-08 05:02:39'),(918,'Stand Together','1504875776.jpg','Awal berdiri band ini ialah pada tanggal 14 Maret 