mitmen. Seiring berjalannya waktu, Muliadin Putra, Sigit Purnomosidi beserta Syafi Syafiq resmi melebur kedalam tubuh Havanah. \r\n     Havanah sendiri telah melibatkan diri dalam pergerakan sosial yang dinaungi AIESEC Indonesia yang kala itu diadakan di SMA Harapan 3 Medan. Harapannya, Havanah sedikit banyak dapat membantu AIESEC Indonesia untuk menggali serta mengembangkan bakat dan potensi jiwa jiwa penerus bangsa Indonesia.','Alternative Rock','instagram;teman;','Medan',1463,'2017-09-08 05:39:42','2017-09-08 05:39:42'),(926,'Coffeebeat','1504878021.jpg','Band reguler n event','Others','teman;','Jakarta',1442,'2017-09-08 05:40:22','2017-09-08 05:40:22'),(927,'Antartick','1504878120.jpg','Unit indie / urban rock dari Kota Bogor yang didirikan oleh Joe (vokal), Anang (gitar) dan Helvi (bass).','Rock','instagram;guitar_plus;','Jakarta',1471,'2017-09-08 05:42:00','2017-09-08 05:42:00'),(928,'Antartick','1504878133.jpg','Unit indie / urban rock dari Kota Bogor yang didirikan oleh Joe (vokal), Anang (gitar) dan Helvi (bass).','Rock','instagram;guitar_plus;','Jakarta',1471,'2017-09-08 05:42:13','2017-09-08 05:42:13'),(929,'Antartick','1504878144.jpg','Unit indie / urban rock dari Kota Bogor yang didirikan oleh Joe (vokal), Anang (gitar) dan Helvi (bass).','Rock','instagram;guitar_plus;','Jakarta',1471,'2017-09-08 05:42:24','2017-09-08 05:42:24'),(930,'Coffeebeat','1504878334.jpg','Band reguler n event','Others','teman;','Jakarta',1442,'2017-09-08 05:45:34','2017-09-08 05:45:34'),(931,'NYALA','1504878680.jpg','Biarlah lagu yang bercerita\r\nLirik nya mudah dihafal\r\nDan cocok dengan kehidupan anak muda','Pop','guitar_plus;','Surabaya',1247,'2017-09-08 05:51:20','2017-09-08 05:51:20'),(932,'TIME','1504878715.JPG','Band ini terbentuk dari kekeluargaan personel nya yang pada sebelumnya memiliki prestasi pada band nya masing-masing.Berbagai event diikuti dan sebahagiannya adalah GGRC,Cardinal award,Guines,dan band ini juga menjadi bagian dari Sound Of 3 menjadi 3 besar perwakilan kota medan.dan kini kami mempunyai 2 lagu karya kami yang berjudul say something dan Kita bisa.dengan berbagai macam music dari masing-masing personel kami menyatukannya dalam T.I.M.E','Alternative Rock','facebook;teman;lainnya;','Medan',1335,'2017-09-08 05:51:55','2017-09-08 05:51:55'),(933,'Nama','1504879050.jpeg','Band kami terbentuk pada tanggal 5 desember 2015.  Arti NAMA sendiri bagi kami adalah sebuah doa  layaknya orang tua memberikan harapan dan impian terhadap seorang anaknya . Kami pernah mengikuti audisi band di Fikar School, namun hanya sampai babak penyisihan.','Others','instagram;','Jakarta',1468,'2017-09-08 05:57:30','2017-09-08 05:57:30'),(934,'ANTC','1504879417.jpg','ANTC adalah singkatan dari Another Chance , berdiri sejak 28 September 2014 , band yang bermula dengan nama SAY HI Dan berawal dari 6 personil pada formasi awal lalu seiring berjalannya waktu pada bulan september 2016 ANTC resmi menjadi 3 personil yaitu Susan (  vocalis ) , Kevin ( Gitaris ) , Dan Fajar ( Drum ) . Genre yang kami usung adalah alternative melodic  . Pada tanggal 30 April 2017 ANTC masuk final acara SUPERRAWK FEST 2017 . Singel pertama kami yang berjudul  Hari dan Hati.','Alternative Rock','instagram;guitar_plus;poster;teman;','Jakarta',1024,'2017-09-08 06:03:37','2017-09-08 06:03:37'),(935,'MANJǍ','1504879432.jpg','Terhitung sebagai grup musik anyar — baru resmi berdiri pada Januari 2017 — Kelompok berformat trio ini bisa dibilang sosok yang telah lumayan malang\r\nmelintang di blantika musik Bali.\r\nMencampur banyak genre macam alternative, psychedelic, indie rock, dan prog rock, Manjă agak\r\nbingung jika diminta menyebutkan apa genre yang diusung. \r\n\r\nJika bicara etimologi serta filosofi di balik nama Manjă, itu berasal dari Bahasa Hindi yang diadopsi ke dalam\r\nBahasa Inggris yang berarti benang gelasan yang biasa digunakan dalam lomba layang-layang. Ini\r\ndimaknai sebagai simbol penghubung antara manusia dengan mimpi atau angan-angannya yang bebas\r\nmerdeka terbang di angkasa. Manjă ingin menciptakan musik yang menginspirasi kancah berkesenian di\r\nIndonesia, agar think outside of the box.\r\nSejauh ini Manjă telah memiliki 7 karya sendiri yang telah dinyanyikan saat manggung. Dan prioritas\r\nmereka sekarang ini masih hendak memperbanyak jam terbang seraya menulis lagu, membuahkan\r\nkomposisi baru sebanyak-banyaknya.','Alternative Rock','teman;','Jakarta',1459,'2017-09-08 06:03:52','2017-09-08 06:03:52'),(936,'LIBRA','1504879699.jpg','- 3 Besar guines beer jawa barat\r\n- 15 Besar amild live wanted regional Jakarta\r\n- Juara 3 Festival Se-Jak-Tim 2012\r\n- Juara Top Singer Depok\r\n- Juara 1 Antar Fakultas Sejabodetabek 2015','Rock','teman;','Jakarta',1472,'2017-09-08 06:08:19','2017-09-08 06:08:19'),(937,'BINGAR','1504880391.jpg','Dari kegelisahan menjadi hingar binger. Band yang terbentuk dari rasa kegelisahan tugas kuliah jurusan arsitek.','Rock','teman;','Jakarta',1473,'2017-09-08 06:19:51','2017-09-08 06:19:51'),(938,'The Hummingbird','1504880430.jpg','The Hummingbirds merupakan 5 orang pelayan ibadah di gereja HKBP Duren Jaya Bekasi yang menyukai genre musik Rock.','Rock','facebook;instagram;','Jakarta',1470,'2017-09-08 06:20:30','2017-09-08 06:20:30'),(939,'VELLA','1504880489.jpg','Kita adalah teman satu SMA, berawal dari festivalan akhirnya kita memutuskan untuk membuat karya sendiri yang jujur dan orisinil.\r\ntidak ada yang sempurna, kita sempat facum namun akhirnya kembali bersatu.','Rock','instagram;','Jakarta',1479,'2017-09-08 06:21:29','2017-09-08 06:21:29'),(940,'Niti Project','1504880539.jpg','Niti Project, Niti adalah singkatan dari nama-nama personel kami. Mulai menggunakan nama Niti Project pada awal 2017. Niti Project tidak terbatas hanya dalam satu genre, kami akan menuangkan apa yang ada Di dalam diri kami melalui musik. Kami juga membebaskan para pendengar untuk bebas menginterpretasikan musik yang kami bawakan. \r\n\r\n#SalamKitaIndonesia','Others','instagram;lainnya;','Jakarta',1410,'2017-09-08 06:22:19','2017-09-08 06:22:19'),(941,'BRANCHA AMARIS','1504880757.jpg','B.A , demikian singkatan dari BRANCHA AMARIS\r\nMemulai karir bermusik dengan nama B.A sejak tahun 2017,walaupun sebenarnya sudah memiliki kesibukan di dunia musik untuk waktu yang cukup lama.\r\n Di awali dari hubungan kaki beradik antara Ismail dan Dicky,mereka sepakat untuk membuat sebuah band profesional.\r\n\r\n Untuk prestasi,pernah beberapa kali mengikuti ajang festival band,dan sekarang ini B.A sudah memiliki 10 lagu,tetapi masih 1 lagu yang di keluarkan sebagai single dan sebagai lagu untuk promosi band ,yang berjudul MASIH MENCINTAIMU, dan selanjutnya B.A akan mengeluarkan single-single lainnya .','Pop','facebook;','Medan',1475,'2017-09-08 06:25:57','2017-09-08 06:25:57'),(942,'KopralJono','1504880986.jpg','Terbentuk\r\n sejak tahun 2011, Kopral Jono mengusung genre musik Ska, namun dengan \r\npengaruh khas daerah Melayu, sehingga kami menamakan genre tersebut \r\nSkaYu (Ska Melayu).\r\n\r\nPrestasi:\r\n10 besar Asean Beat - Palembang\r\n10 besar A Mild Wanted - Palembang\r\ntahun 2016 ; Band line up Pekan Raya Indonesia (Konser 1000 Band) - ICE \r\nBSD Tangerang\r\nTahun 2017 ; \r\n- Band Line Up Jak Cloth Musi Fest\r\n- Band Line Up Countdown to Asian Games 2018 - Palembang\r\n- Band Line Up Kreatifood by BeKraf','Others','instagram;informasi_toko;','Jakarta',681,'2017-09-08 06:29:46','2017-09-08 06:29:46'),(943,'zerodot','1504881553.png','band yang berdiri pada tahun 2016 , sudah beberapa kali ikut event - event di jakarta, beberapa kali mengisi acara wedding .','Pop','facebook;instagram;lainnya;','Jakarta',1419,'2017-09-08 06:39:13','2017-09-08 06:39:13'),(944,'man on wise','1504881605.JPEG','untuk yang terhormat:\r\nLevi\'s Indonesia & Universal Indonesia\r\nberikut cerita tentang kami.\r\n\r\nband ini baru saja dibentuk, kami personilnya ada 2. tapi kalau perform, kami menggunakan additional. proses pembuatan lagu, dikerjakan oleh kami berdua. dari proses pembuatan kerangka hingga tracking. \r\n\r\npengalaman perform sangat sedikit, dikarenakan rizki (voc) masih menyelesaikan studi kuliahnya di jogja. namun kami berdua sudah sangat lama malang melintang menjadi session player dan tahun ini kami disatukan menjadi project Man On Wise. terimakasih :)\r\nsalam hormat kami,\r\nrizki & Azhari','Alternative Rock','instagram;','Surabaya',1483,'2017-09-08 06:40:05','2017-09-08 06:40:05'),(945,'The Good Listener','1504881677.jpg','The Good Listener lahir di Yogyakarta pada tanggal 21 April 2011, dengan mengusung genre rock, kami berniat untuk mengibarkan kembali semangat musik rock. Tahun 2013 kami telah melaunching mini album bertajuk \"Partikel Emosi\", yang menceritakan tentang emosi yang ada didalam kehidupan bahkan sampai titik terkecil (partikel). Dalam mini album tersebut berisi 5 lagu yaitu Bebaskan aku, Trima kasih, Pesan dari rakyat, Cerita dilubang hitam, Angkat dan beri.','Rock','instagram;poster;','Yogyakarta',1480,'2017-09-08 06:41:17','2017-09-08 06:41:17'),(946,'Titik Awal','1504881717.png','terbentuk 10 juni 2006, band ini berawal dari sebuah ekstrakulikuler sekolah di kota bandung. dan kami memulai cerita bersama dengan main di event seperti java jazz festival, jazzy nite kompas tv, breakout net tv mediatama, PMKT Universitas pharayangan, the internasional kampoeng jazz ,Pasar Seni festival ITB, Jazz On April Pupuk Kaltim ( Tour ), Espose Universitas Padjajaran, Levi\'s Indonesia, Jinggle Indomie, Duta Walikota bandung, Klab jazz, Ixpo Fest Universitas pharayangan, dan event-event lainnya. dan sampai saat ini kami berjalan bersama untuk menggapai impian.','Pop','instagram;','Jakarta',1071,'2017-09-08 06:41:57','2017-09-08 06:41:57'),(947,'Skyress Band','1504881759.jpg','berdiri sejak 2010, pernah menjadi home band di salah satu cafe di daerah cibinong, kab.bogor','Pop','facebook;','Jakarta',1434,'2017-09-08 06:42:39','2017-09-08 06:42:39'),(948,'Beef Lover','1504882060.JPG','Belum Memiliki Prestasi','Alternative Rock',