us;','Surabaya',607,'2017-09-08 07:01:25','2017-09-08 07:01:25'),(968,'Brokenjacks','1504882889.jpg','Berdiri 9 juni 2017. Mempunyai 3 lagu hingga saat ini. 2 anggota sering cabutan musisi event seperti wedding dan cafe. Kami membawakan bermacam macam genre. Tidak fokus pada satu genre. Karna genre bukanlah batasan. Moto kami. \"Music is a honest way to speak our soul\".','Others','teman;','Jakarta',1235,'2017-09-08 07:01:29','2017-09-08 07:01:29'),(969,'Arley','1504882926.jpg','Arley terbentuk pada tanggal 20 Agustus 2015, nama Arley bermakna pemanah dan diharapkan band ini mampu mencapai suatu target seperti anak panah. Arley sering di undang untuk mengisi acara2 kampus dan cafe2 di surabaya. Awalnya band ini beranggotakan 5 orang personil, namun karena 2 personil lainnya harus fokus bekerja maka mereka memilih untuk keluar. Tetap bersemangat Arley pun masih melanjutkan penggarapan album pertamanya yang berjudul Pengagum Rahasia yang terdiri dari 5 lagu. Pengalaman lucu pernah terjadi ketika kita di undang di salah satu kampus kesehatan di surabaya, kita datang tepat waktu namun ternyata kita datang ke kampus yang lainnya dengan nama lain salah tempat.','Pop','guitar_plus;','Surabaya',607,'2017-09-08 07:02:06','2017-09-08 07:02:06'),(970,'AFLO','1504883383.jpg','Aflo adalah band yang mengatasnamakan sebuah keluarga bukan band atau team.Sehingga apapun yg terjadi kami saling bantu dan menopang satu dengan yang lain.Kami di satukan lewat musik yang berbeda yang kami kemas menjadi sebuah alunan nada dan kata. Semoga musik yang kami mainkan dapat di terima. \r\nAflo beberapa kesempatan mengikuti event kompetisi antara lain Finalis L.A Meet labels Reg Medan (2012), #3 place Cipta lagu Honda Scoopy, dan beberapa event lokal lainnya','Others','instagram;','Medan',1478,'2017-09-08 07:09:43','2017-09-08 07:09:43'),(971,'Arley','1504883398.jpg','Arley terbentuk pada tanggal 20 Agustus 2015, nama Arley bermakna pemanah dan diharapkan band ini mampu mencapai suatu target seperti anak panah. Arley sering di undang untuk mengisi acara2 kampus dan cafe2 di surabaya. Awalnya band ini beranggotakan 5 orang personil, namun karena 2 personil lainnya harus fokus bekerja maka mereka memilih untuk keluar. Tetap bersemangat Arley pun masih melanjutkan penggarapan album pertamanya yang berjudul Pengagum Rahasia yang terdiri dari 5 lagu. Pengalaman lucu pernah terjadi ketika kita di undang di salah satu kampus kesehatan di surabaya, kita datang tepat waktu namun ternyata kita datang ke kampus yang lainnya dengan nama lain salah tempat.','Pop','guitar_plus;','Surabaya',607,'2017-09-08 07:09:58','2017-09-08 07:09:58'),(972,'BETTER THAN BEFORE','1504883765.jpg','Better Than Before terbentuk pada tanggal 27 Juli 2007, kami berasal dari salah satu daerah yang sekarang  bernama Tangerang selatan yaitu Bintaro.\r\nKami adalah anak-anak muda yang memiliki satu keinginan yang  sama yaitu untuk  membesarkan jiwa musik yang tertanam di masing-masing jiwa kami, tempat yang sangat bersejarah adalah SMA KARTIKA X-1, disanalah awal mula Better  Than Before dapat terbentuk  2 Anak muda yang bersatu didalam sekolah ini yang awalnya  sama sekali  tidak memiliki keinginan untuk  membentuk sebuah band, namun karena ada satu tujuan yang tidak rasional untuk membentuk band \"agar dekat  dengan salah satu wanita\", awalnya si aneh ya dengan alasan itu untuk masuk ke  dalam ekskul band di sekolah,  namun setelah berjalannya waktu alsan itupun pudar dan membuat kami yakin serius dalam menjalanka n hobi  ini.\r\n \r\nkedua anak itu adalah DARWIN SETIAWAN LUBIS dan FAMHY ZUL ZAM ZAMI.Mereka berdua adalah penggagas besarnya nama D\'DAFY nama band  yang terbentuk pada tahun 2006  yang telah memiliki beberapa lagu yang salah satunya adalah TAK LAGI BERSAMA yang cukup diminati  anakanak disekolah karena lagi-lagi alasan mereka suka    adalah liriknya yang galau.setelah satu tahun bermusik, Darwin dan Fahmy merasa harus ada perubahan didalam band ini, sehingga hadir satu nama yaitu ANDI HIDAYAT seorang de kelas yang mencoba memberanikan diri untuk masuk kedalam band ini, namun setelah melakukan beberapa pertimbangan akhirnya Andi pun dicoba\r\nuntuk bisa masuk  kedalam D\'DAFY sebagai pemain gitar rhythm, setelah itu Andi  membawa dan mengenalkan YOGA LUQMAN HUKKAMA sebagai drummer.\r\n \r\nPada   saat   awal   latihan   belum   banyak   kecocokan   yang   didapat  didalam   band   ini, banyak hal-hal yang aneh terutama didalam skill dalam mengelola aransemen. Beberapa bulan berlalu pada tahun 2007 band yang dipimpin oleh Darwin dan Fahmy ini mencoba untuk  mengganti nama mereka menjadi BETTER THAN BEFORE dengan awal aliran adalah Melodic dan mulai  masuk  kedal  dunia  gigs,  acara  demi  acara  telah  dilewati  dengan  hantakan  drum  ala  punk membuat kami mulai  dikenal oleh kalangan musik indie terutama dikawasan kami.\r\n \r\nMerasa ada yang  harus  diperbaiki  pada  tahun  2010  Darwin  Membuat  satu  perubahan  dengan membuat  lagu dengan judul \"KAU\" dan ini adalah sejarah terbesar yaitu nama Better  Than Before sudah banyak yang  mencintai dan satu hari share lagu tersebut mendapatkan respon yang sangat besar dengan download satu hari  itu bisa mencapai  500an orang pendownload, dan aliran BTB pun mulai terarah dan ternyata memang sangat pas dengan sebutan POP PUNK.\r\n \r\nSetelah  1  Tahun  lagu  KAU  tersebar  diseluruh  masyarakat  dengan  free  download,  lagi-lagi kami harus melakukan perubahan konsep agar pendengar kami tidak bosan dan akhirnya pada tahun   2011  GALIH  PRAYOGA  masuk   sebagai  synthesizer  /  Keybordis   BTB   dan   dengan masuknya   galih   kami   merecord  lagu  INGATLAH  KAWAN  dan  dengan  sentuhan  Synth  lagu  ini sangat  membuat  warna  baru  dari  BTB  yaitu  menjadi  POWERPOP  PUNK  dan   respon  dari masyarakat sangat antusias dan membuat lagu ini tidak kalah dengan lagu KAU dan menjadi jagoan\r\ndari BTB dengan lirik dan nada yang Sangat Easy Listening ditelinga parapendengar.\r\n \r\nPada  tahun   2012  BTB  mengeluarkan  single  terbaru  yaitu  yang  ketiga  dengan  judul MELANGKAH lagu  move on dari orang yang telah menyakiti kita ini menjadi salah satu lagu yang sering didengarkan oleh indiersyang sedang sakit hati, lagi-lagi lirik yang diciptakan Darwin membuat para  pendengar tersayat dan merasa sedang berada didalam lagu tersebut, namun lagu yang direkam secara live ini menjadi musik yang kurangdibandingkan2singlesebelumnya.\r\npada tahun 2013 ini Better Than Before yang sudah mantap dengan aliran dan  keyakinan\r\n \r\nmereka dalam mengolah instrumen mengeluarkan single terakhir sebelum mengeluarkan EP yang insya Allah akan keluar pada tahun 2014. single terakhir ini berjudul SENDIRI alunan musik\r\ndan  irama  serta  lirik  menjadi  satu  kesatuan   yang   sangat   diperhitungkan   BTB   pada   lagu   ini, sehingga lagu ini sangat terdengar lebih matang dibandingkan lagu yang lainnya, sampai saat\r\nini lagu Sendiri menjadi andalan BTB dalam mendoktrin  masyarakat agar lebih mengenal dan mencintai BTB, selain lagu-lagu tadi dirilis  secara pribadi oleh btb, lalu  kami juga pernah masuk kedalam CD kompilasi KAISER bersamaan dengan band-band indi terkenal  indonesia, malaysia dan singapura dan dirilis di 3 negara tersebut, kemudian  kami juga pernah masuk kedalam  album kompilasi yang dirilis dan didownload didalam web.','Alternative Rock','instagram;teman;','Jakarta',1489,'2017-09-08 07:16:05','2017-09-08 07:16:05'),(973,'HIRA','1504883765.jpg','HIRA terbentuk pada tahun 2014 terdiri dari 4 orang dengan background musik yang berbeda sehingga memperkaya musik dan style bermain HIRA. Single HIRA yang berjudul \"Melangkah Maju\" sempat disiarkan di radio seluruh Indonesia pada tahun 2015 dan menduduki chart di beberapa radio selama 3 bulan.','Rock','instagram;teman;','Jakarta',1351,'2017-09-08 07:16:05','2017-09-08 07:16:05'),(974,'Initial','1504883767.jpg','pernah juara 1 ajang festival ban daerah, best player\r\nkami band daerah inhu riau, berawal dari persahabatan, yang mana setiap individu dari kami memiliki potensi yang luar biasa dalam bermusik. kami biasa membuat demo lagu sendiri di studio kami sendiri, lebih tepatnya home recording.','Alternative Rock','instagram;teman;','Medan',1476,'2017-09-08 07:16:07','2017-09-08 07:16:07'),(975,'KAWANLAMA','1504884066.JPG','Kawanlama adalah storyteller folk band . kami berkarya dengan sederhana serta lirik yang simple dan positif.','Folk','instagram;guitar_plus;','Jakarta',1488,'2017-09-08 07:21:06','2017-09-08 07:21:06'),(976,'Smokin\' Roses','1504884074.jpg','Terbentuk pada tahun 2004 dengan anggota Bani (vocalist & bassist), Dika (drummer), Artha (guitarist), dengan nama band Monday Madness. Mengusung genre alternative rock. Kemudian band yang berasal dari Kota Bogor ini berganti nama menjadi Smokin\' Roses pada Agustus 2017, serta menambah anggota baru yaitu Wira (guitarist) dan Afif (bassist). Bani yang semula mengisi bass, beralih menjadi vokalis. Saat ini Smokin\' Roses sedang proses menyelesaikan mini album yang direncanakan rilis akhir tahun ini.','Alternative Rock','teman;','Jakarta',1474,'2017-09-08 07:21:14','2017-09-08 07:21:14'),(977,'Virus.','1504884686.jpg','awal terbentuknya Virus. pada tahun 2006 silam\r\nkami kuliah di universitas,fakultas,angkatan yang sama di UNPAD Bandung\r\npada awalnya terbentuknya band ini bernama Calcyfer yang merupakan sekumpulan teman kuliah yang pada akhirnya membentuknya band dan menjadi home band cafe di score ciwalk bandung pada tahun 2007.\r\n\r\nkemudian dikarenakan adanya sedikit perubahan pada formasi dan kontrak di beberapa cafe yang menginginkan personel yang lebih ramai berubah nama kembali menjadi Orangebox dengan tambahan 2 personel lagi tetapi kami bertiga masih merupakan core/inti band tersebut.\r\n\r\nDan kini kami kembali bertiga lagi pada tahun 2012 sampai sekarang, dikarenakan kenyamanan kami bertiga dengan formasi sedikit orang yang menurut kami lebih mudah dan simple untuk dioraganisir dalam rekaman demo, audisi, show dsb dibandingankan dengan banyak personel.\r\n\r\nkami bertiga sering membawakan dan terinfluence dari musik-musik seperti jazz, blues, pop, akustik, top40\r\n\r\nprestasi:\r\n1.home band cafe score ciwalk bandung pada tahun 2006-2008\r\n2.home band padjajaran mall pada tahun 2008-2009\r\n3.juara 1 akustik fest kedokteran UNPAD 2008\r\n4.juara 1 akustik fest food.tech UNPAD 2008\r\n5.juara 2 jazz fest psikologi UNPAD 2009\r\n6.juara favorit 1 lomba cipta lagu 99ers/prodia ITB 2010\r\n7.Home Band Jatos 2006\r\n9.100 Besar A Mild fest regional Bandung/Jawa Barat\r\n\r\nnote: maaf sebelumnya kami sudah pernah mensubmit lagu sebelumnya dengan email band, tetapi ada kesalahan pada kelengkapan data. terima kasih','Pop','instagram;guitar_plus;','Jakarta',1490,'2017-09-08 07:31:26','2017-09-08 07:31:26'),(978,'S.A.M SITE','1504885025.jpg','Project S.A.M Site dimulai sejak 2009, namun tahun 2015 adalah tahun kebangkitan band yang mengusung Industrial Nu Metal, Techno Core sebagai aliran utamanya. Dengan ciri khas penggunaan Distorted Vocals, Distorted \r\nGuitar, High Speed Drums, dan Sampling S.A.M Site selalu mempersembahkan musik yang enerjik dalam setiap penampilannya. Saat ini S.A.M Site sudah merampungkan sebuah mini album yang diberi judul “Into the Parasite”.','Others','guitar_plus;poster;teman;lainnya;','Jakarta',1423,'2017-09-08 07:37:05','2017-09-08 07:37:05'),(979,'Polychromatic','1504885801.jpg','Polychromatic are an Indonesian pop rock band from Jakarta, formed in 2011 by lead guitarist Ardika Rizky, drummer Aldo Nugroho, vocalist Lingga Winando and bassist Zulfikar “Ajey” Mohamad. The band’s first song written together was “Jatuh Cinta” and Polychromatic started to be a stage performer. They usually performed at the café, school event and festival.\r\nIn the last of 2011, the band added Alamsyah Ibrahim (guitar) to their line up, and also Brody Vigo (drums) to replace Aldo Nugroho. A year later, Lingga, Alamsyah and Brody left the band. After 10 months apart, Aldo returned to the band, and Ajey left Polychromatic and formed a new band named Sound The Sip with Lingga, Rafi Novadi (drums) and Renzo (guitar).\r\nIn 2014-2015, Polychromatic also worked with Vigar Wardhana (vocal), Bagus Trilaksono (bass) and Erick Mandalika (bass) as an additional members. In 2015, guitarist Aziz Faishal and lead vocalist Yusama Abdurrahman joined the band and released their first single “Save Me” on Soundcloud. This song is also played on the local and online radio in Indonesia and United States. Their single also reached the 1st place on the radio chart for 1 month on Indie Pro 2 RRI (Radio Republik Indonesia/Radio of Republic Indonesia).\r\nThe music has lots of influence of British, American and Australian modern pop rock like Queen, U2, Radiohead, Coldplay, Linkin Park, Fall Out Boy, Arctic Monkeys, Mutemath, OneRepublic, Fun., The Temper Trap, Foals, The 1975, Imagine Dragons, and Twenty One Pilots.','Alternative Rock','instagram;','Jakarta',1466,'2017-09-08 07:50:01','2017-09-08 07:50:01'),(980,'AMAKUSA','1504886034.jpg','Amakusa adalah satu-satunya band yang konsisten mengcover X-Japan (Band legendaris Jepang) di komunitas Jepang dan Metal. Genre Amakusa adalah rock TANPA scream / growl, serta ballad dengan feel yang sangat menyentuh. Kami pernah membawakan lagu \"Art of Life\" dari X-Japan dengan durasi 29 menit full song (Special Performance Gelar Jepang UI 2009 dan Honnoukai Star Bandung 2012).\r\n\r\nSelain itu Amakusa masuk dalam finalis band dalam konser Final Fantasy Orchestra bersama Adi MS dan Twilite Orchestra membawakan lagu \"One Winged Angel\" dan \"J.E.N.O.V.A\" karya Nobuo Uematsu. Amakusa memiliki fanbase yang kuat terutama di Jabodetabek dan Bandung bersama komunitas X-Japan Indonesia @XJAPAN_ID sebagai afiliasi utama kami.\r\n\r\nEvent yang pernah kami ikuti selain campus fair dan bunkasai  diantaranya adalah Jakarta Fair 2011, launching album TRAUMA Band \"Dominasi Kemenangan\", Kulturblender music, fx musicmotion bersama FORMI (Forum Music Indie Indonesia) serta Kompas Gramedia Fair 2012, Istora Senayan, dan official pre event L\'arc en Ciel world tour 2012 at Hard Rock Cafe Jakarta oleh LA Lights Music.\r\n\r\nEvent-event selanjutnya yang kami ikuti adalah Urban Fest 2012 Ancol, Ennichisai Blok M 2013, Tribute to Hide Pink Spider, Jakarta (Official event from Headwax Management Japan), Gelar Jepang UI 2013,  LOKA (Indie Rock Band from Japan) DEVA\'S TOUR, Jakarta, JAKCLOTH 2013 at Nushock Stage, Senayan, IRO FEST 101.4 Trax FM at Atrium EX Plaza 30 mei 2014, exclusive interview and accoustic performance on iro-iro 101.4 Trax FM (31 Agustus 2014), Suara untuk Gaza bersama musisi-musisi indie Indonesia, Cosplay Nation Lippo Mall Puri, Doraemon World Anibee TV with IMMG, 27 September 2014, and Japan Festival in Indonesia,1 November 2014 (Official Event from Japan Embassy, as the opening of Ryutaro Makino, Japanese Jazz & Blues Singer), Philosofair FIB UI 2015, Launching album Henohenomoheji and Fairytails, Bandung, The Rock Campus by Ezra Simanjuntak ~Rolling Stone Cafe 2015, featured band in GET TV J-MUSIC CHANNEL VOL 2, Jak Japan 2015, Plaza Blok M Matsuri 2015, J-All Star Carnival, Little Tokyo Ennichisai 2016, Road to Kaori Nusantara Expo 2016, Pekan Raya Indonesia - Konser 1000 Band, Haru Matsuri UHAMKA 2017, Recital Percussion IKJ 2017, dan Jak Japan Matsuri 2017.','Rock','instagram;poster;lainnya;','Jakarta',1439,'2017-09-08 07:53:54','2017-09-08 07:53:54'),(981,'DE\'CRUE','1504886181.jpg','Band rock n roll nyentrik asal Manado, Sulawesi Utara.\r\n\r\n- Finalis Grandfinal Cardinal Bali\r\n- Tour 5 kota Sulawesi RockinCelebes 2015\r\n- Line Up Manado Mayhem 2015, 2016\r\n- Opening Act NAIF\r\n- Opening Act SID\r\n- Opening Act SHAGYDOG\r\ndll','Rock','instagram;','Yogyakarta',1443,'2017-09-08 07:56:21','2017-09-08 07:56:21'),(982,'MILESTONE','1504886372.jpg','Kami disini ingin menggali tentang isi yang ada dari manusia selama mereka hidup baik dari aspek manapun. Kami disini ingin membuat karya yang berisi pesan kepada manusia agar mereka dapat berfikir sejenak tentang kehidupan yang ada, agar mereka dapat meraih apa yang menjadi tujuan mereka selama mereka masih diberi waktu oleh Sang Pencipta untuk mewujudkannya. Disini kami merupakan pembawa pesan berupa musik yang dikemas dalam bentuk lagu yang ber-aliran Alternative Pop. Projek kami disini berbentuk kelompok/band yang bernama MILESTONE. Milestone sendiri dapat diartikan sebagai Batu Loncatan yang jelasnya adalah menjadi jembatan untuk kita agar menjadi lebih sukses daripada yang sebelumnya kami lakukan. Milestone dibentuk pada pertengahan tahun 2016 dan telah bermain di berbagai event seperti Event Kampus, event komunitas, pensi SMA, dan event-event lainnya seperti soundsation, pagelaran seni budaya, dan lain-lain.','Alternative Rock','instagram;umi;poster;teman;','Yogyakarta',1015,'2017-09-08 07:59:32','2017-09-08 07:59:32'),(983,'NARNIA','1504886660.jpg','Awalnya kita punya band masing masing lalu kita sepakat untuk membentuk band bersama yaitu NARNIA dan untuk prestasi masing masing dari kita pernah meraih penghargaan dari beberapa festival band.','Pop','teman;','Jakarta',1085,'2017-09-08 08:04:20','2017-09-08 08:04:20'),(984,'Weekend Junction','1504886704.jpg','merupakan band yang dibentuk dengan kesuakaan pada rasa musik yang sama,\r\n\r\ndipengaruhi oleh band-band British Pop Pada era awal setelah bubarnya the beatles.\r\n\r\nBand weekend Junction ( yang sempat bernama Arga Dranie\'s weekend junction)\r\n\r\nsempat beberapa kali mengisi beberapa Event di kota palembang. seperti Acara Urban Gigs ataupun Acara Authenticity.\r\n\r\ndan kini, setelah berangkat ke ibukota, dengan tujuan masing-masing yang berbeda, band ini kembali di Reformasi dengan format dan personil yang baru.','Alternative Rock','instagram;guitar_plus;','Jakarta',874,'2017-09-08 08:05:04','2017-09-08 08:05:04'),(985,'Fairytails','1504886872.png','Fairytails, Grup music asal bandung yang kini beranggotakan lima orang. Gema, Rully, Verry, Ovi dan Donny memilih alternative rock sebagai genrenya. Kini sudah memiliki satu mini album bertajuk “ THIS TIME”. Fairytails pernah menjadi finalis Global Battle of the Band dan Planet Rox Indonesia. Saat ini Fairytails juga kerap menjadi pengisi acara di festival jepang, selain membawakan lagu sendiri, merekapun mengcover lagu-lagu dari ONE OK ROCK, The Oral Cigarettes, Maroon 5 dan juga yang lainnya.','Alternative Rock','instagram;teman;','Jakarta',903,'2017-09-08 08:07:52','2017-09-08 08:07:52'),(986,'NARNIA','1504887033.jpg','Awalnya kita punya band masing masing lalu kita sepakat untuk membentuk band bersama yaitu NARNIA dan untuk prestasi masing masing dari kita pernah meraih penghargaan dari beberapa festival band.','Pop','teman;','Jakarta',1085,'2017-09-08 08:10:33','2017-09-08 08:10:33'),(987,'NARNIA','1504887075.jpg','Awalnya kita punya band masing masing lalu kita sepakat untuk membentuk band bersama yaitu NARNIA dan untuk prestasi masing masing dari kita pernah meraih penghargaan dari beberapa festival band.','Pop','teman;','Jakarta',1085,'2017-09-08 08:11:15','2017-09-08 08:11:15'),(988,'BREAKLESS','1504887208.jpg','Band indie Surabaya yang terbentuk pada tahun 2016, dengan Genre Rock Alternative yang lebih modern, bebrapa kali berpatisipasi dalam event-event musik Jawa Timur','Rock','facebook;instagram;teman;','Surabaya',1451,'2017-09-08 08:13:28','2017-09-08 08:13:28'),(989,'Shelonia','1504887386.jpg','Shelonia terbentuk pada 8 Agustus 2006 di Jakarta. Berawal dari persahabatan Adi (Gitaris), Gio (Vokalis) dan Ronald (Gitaris) saat ketiganya belajar di Lembaga Pendidikan Musik Farabi, akhirnya tercetus lah ide untuk membentuk sebuah grup musik yang dinamakan Shelonia.\r\n\r\nLalu kemudian bergabunglah Ian (Drummer) dan Tommy (Bassis), sekarang ini sudah digantikan Yeke (Bassis). Sejak awal dibentuk Band Shelonia memulai perjalanan musiknya dari acara Pensi-pensi sekolah, Top 40 di cafe-cafe, Wedding, Festival-festival musik dan lain-lain.\r\n\r\nBand Shelonia sempat Vakum semenjak Adi (Gitaris) Meninggal dunia. Kini Band Shelonia ingin berjuang kembali untuk menjadi Band-band besar seperti Sheila on 7, Peterpan, Nidji dan lain-lain.\r\n\r\nPrestasi Shelonia, Juara Festival Audiopro JAPEX PRJ 2013, Opening Ari Lasso di PRJ 2012, Bermain di Java Jazz 2011, Bintang Tamu di setiap pensi-pensi sekolah.','Pop','facebook;','Jakarta',1258,'2017-09-08 08:16:26','2017-09-08 08:16:26'),(990,'tiberias','1504887692.jpg','TIBERIAS terbentuk tahun 2012. sebelum berganti nama TIBERIAS sebelumnya band ini bernama BRINA. Beberapa tahun lalu kami hampir bubar , dikarenakan masalah internal. Tapi 1 tahun belakangan ini kami mulai membangun kembali band ini , dan mengubah nama dari BRINA menjadi TIBERIAS .\r\nUntuk prestasi yang dicapai kami hanya menembus 10 besar audisi band lokal bertaraf nasional dan beberapa kami juga berkesempatan menjadi opening beberapa band ternama.','Alternative Rock','instagram;','Yogyakarta',1481,'2017-09-08 08:21:32','2017-09-08 08:21:32'),(991,'ASA','1504887716.jpg','ASA BAND terbentuk pada awal tahun 2013 , berawal dari nongkrong bareng di sebuah studio musik di daerah jakarta pusat . Sampai pada suatu saat kami mempunyai ide untuk membentuk sebuah grup band beraliran pop.\r\nHingga akhirnya kita sepakat membentuk band dengan nama ASA.Asa berarti harapan atau juga awal sampai akhir. Dengan harapan dan tujuan yang sama semoga karya-karya kami bisa di terima di masyarakat indonesia.','Pop','facebook;','Jakarta',1408,'2017-09-08 08:21:56','2017-09-08 08:21:56'),(992,'NARNIA','1504887736.jpg','Awalnya kita punya band masing masing . Tetapi kiya memutuslan untuk buat band bersama yaitu Narnia . Untuk prestasi masing masing dari kita sempat mraih beberapa penghargaan dari fesyival band.','Pop','facebook;instagram;teman;','Jakarta',1085,'2017-09-08 08:22:16','2017-09-08 08:22:16'),(993,'hujan dan mantan','1504887740.JPG','hujan dan mantan bertujuan merepresentasikan sebuah narasi yang mewakili kisah romansa kompleks,\r\nkisah penyesalan,\r\nkisah amarah,\r\nkisah dendam,\r\nkisah caci maki,\r\nkisah kenangan,\r\nsemua kisah yang dalam-dalam kita kubur dan sudah jauh-jauh kita tinggalkan, namun semua kisah tersebut muncul dengan cepat oleh sebuah momen alami yang disebut HUJAN,\r\ntajuk yang kami wakili untuk sebuah alunan syahdu dan mengiringi momen tersebut,\r\nkamilah\r\nHUJAN dan MANTAN\r\n\r\nterbentuk di tahun 2016 dari scene trash metal dan hardcore di surabaya kami terbentuk karena kami ingin memberi nama baru, image yang berbeda dari yang selama kami tekuni, image yang bisa mewakili seluruh segmen yang belum bisa kami sentuh dari cadasnya genre kami sebelumnya\r\n\r\nso LEVI\'S, please endorse us!\r\nlet the story begin in those showbiz!\r\nlet\'s spread the moment!','Pop','informasi_toko;vipclub;','Surabaya',1390,'2017-09-08 08:22:20','2017-09-08 08:22:20'),(994,'Katabatik','1504888068.jpg','Just Katabatik & let\'s rock!!!','Rock','guitar_plus;teman;','Medan',859,'2017-09-08 08:27:48','2017-09-08 08:27:48'),(995,'ARVEL','1504888109.jpg','1. juara 1 aransemen lagu kota bekasi (2010)\r\n2. juara 1 PAMSI (2011)\r\n3. featuring at yadika\'s day (2012)\r\n4. partisipan djarum super mobile tron (2013)\r\n5. featuring PRO jam event (2014)','Alternative Rock','informasi_toko;','Jakarta',1393,'2017-09-08 08:28:29','2017-09-08 08:28:29'),(996,'song leste','1504888179.jpg','Punya 10 lagu yang siap mewarnai blantika music indonesia','Blues','guitar_plus;','Surabaya',1485,'2017-09-08 08:29:39','2017-09-08 08:29:39'),(997,'song leste','1504888350.jpg','Punya 10 lagu yang siap mewarnai blantika music indonesia','Blues','guitar_plus;','Surabaya',1485,'2017-09-08 08:32:30','2017-09-08 08:32:30'),(998,'white band','1504888581.jpg','white band ini adalah project yang masih baru berusia sekitaran 3 bulan dan terbentuk pada tanggal 27 juni 2017 awal puasa kemarin. kami biasa manggung di acara even,guest star sekolah,birthday party dll.\r\nband ini asli dari kota reog(Ponorogo)','Pop','facebook;instagram;informasi_toko;vipclub;guitar_plus;umi;maliq;poster;teman;lainnya;','Surabaya',1495,'2017-09-08 08:36:21','2017-09-08 08:36:21'),(999,'MusiM','1504888601.jpg','MUSIM adalah group band yg sudah malang melintang di dunia hiburan. Tapi karena masing2 personel kurang ahli \"bermain\" dengan media sosial, sejauh ini MUSIM hny tampil off air. Dalam 1 minggu tak kurang 3 - 4 kali tawaran untuk jadwal panggung. \r\nBeberapa kali MUSIM masuk 20 besar ajang musik amildlivewanted.dan ada beberapa ajang bergengsi lainnya yg tidak mungkin kami sebutkan satu persatu.Namun, prestasi terbaik adlah sekitar tahun 2015 sempat akan diajak kerjasama dengan mas Piyu (PADIband). Tapi karena terhalang dana, MUSIM merelakan untuk kesempatan itu.\r\nSemangat MUSIM tak berhenti sampai disitu. Saat ini MUSIM terus menerus memproduksi karya2 terbaru. Sudah banyak sekali lagu yg MUSIM ciptakan sebelum2nya tapi untuk kali ini MUSIM sengaja memasukkan lagu sederhana akan tetapi lagu terbaru MUSIM, yg bercerita tentang bahwa perpisahan adalah sesuatu yg tidak abadi. untuk diikutsertakan dalam ajang LEVI\'SBANDHUNT. Semoga Tuhan memberi kesempatan untuk MUSIM dan melalui LEVI\'SBANDHUNT lagu terbaru ini bisa diterima secara nasional.\r\nMUSIM itu sendiri bagi kami memiliki arti yaitu panjang umur. Segala bakat, kemampuan, semangat, dan waktu kami tumpahkan semua disini. Dengan harapan MUSIM bisa panjang unur dan selalu ada dalam meramaikan dunia musik di Indonesia ini.','Pop','teman;','Jakarta',964,'2017-09-08 08:36:41','2017-09-08 08:36:41'),(1000,'JOHN LEGO','1504888748.png','Berawal dari kesamaan visi dan misi serta selera musik yang sama, pada tahun 2012 dibentuklah band dengan John Lego yang mengusung genre Rock. Band asal Jakarta ini awaalnya terdiri dari 5 orang personil. Namun dengan seiringnya waktu, salah satu personil mengundurkan diri dan tersisa 4 orang personil sampai saat ini.\r\nSelama perjalanan karier band, telah banyak tampil dari panggung ke panggung dan mengikuti beberaapa festival musik di Indonesia.\r\nBeberapa prestasi yang pernah diraih antara lain :\r\n1. Finalist 3 Besar Indonesia Regional \"Festival Music International Envol Et Macadam Canada 2013\"\r\n2. Juara 1 A Mild Soundsation 2013\r\n3. Juara 2 Wrangler Music Festival Battle Of The Band 2013','Rock','instagram;teman;','Jakarta',1492,'2017-09-08 08:39:08','2017-09-08 08:39:08'),(1001,'STAIRS & SNAKES','1504889933.jpg','band yang punya mimpi manggung di las vegas','Classic','facebook;lainnya;','Yogyakarta',1353,'2017-09-08 08:58:53','2017-09-08 08:58:53'),(1002,'All Size','1504890005.jpg','Band ini dibentuk dari semua alumni satu sekolah','Rock','poster;teman;lainnya;','Surabaya',1498,'2017-09-08 09:00:05','2017-09-08 09:00:05'),(1003,'neo n','1504890242.jpg','neo n adalah proyek solo derekoo irfan amanullah, untuk menuangkan ide-ide musiknya yang \"unik\" (setidaknya menurut dia sendiri) yang sebelumnya selalu kandas dalam bermusik karena tidak menemukan band/personil yang sesuai dengan visinya. Dimulai tahun 2009, dibantu oleh gandu (drum), dan Mirza (bass). Pada 2011 posisi bass digantikan oleh Dewa.\r\nSampai saat ini neon tampil di seputar acara kampus, komunitas indie, komunitas british, dan selalu membawakan lagu sendiri, yang sampai sekarang sudah ada stok 7 lagu.','Pop','facebook;poster;teman;','Surabaya',1288,'2017-09-08 09:04:02','2017-09-08 09:04:02'),(1004,'Voodoo Dolls','1504891216.jpg','Composed from soul, funk blues and little rock genre, Voodoo Dolls bring you to another fresh music.\r\nSpecial stage:\r\nPre-Show Ceremony PON Jabar 2016\r\nBest 10 of Kickfest Bandung 2013','Blues','guitar_plus;','Jakarta',1501,'2017-09-08 09:20:16','2017-09-08 09:20:16'),(1005,'Gotas De Sudor','1504896510.jpg','ikut acara komunitas dan masuk beberapa kompilasi reggae diantaranya kompilasi yang di produseri starlight musik serta pencapaian terbaru bermain di pekan raya jakarta menjadi pembuka momonon dan steven jam','Others','instagram;lainnya;','Jakarta',1503,'2017-09-08 10:48:30','2017-09-08 10:48:30'),(1006,'BAD ELEVEN','1504926393.jpeg','Bad Eleven\r\n\r\nAnggota: Bagus (Guitar/Vocal), Alfin (Bass/Back Vocal), Amry (Drum/Percussion).\r\n\r\nBad Eleven band bergenre Melodic Poppunk yang terbentuk di Malang pada 20 September 2009. Nama Bad Eleven pun berarti masa kenakalan kita sewaktu kelas 11, dan horornya kita semua bersekolah di SMK. Dan history dimulai dari 3 sekawan yaitu, Amry, El dan Bayu yang memiliki kesamaan menyukai musik terutama genre melodic punk yang akhirnya menjadi genre Bad Eleven itu sendiri.\r\n\r\nLagu pertama yang berjudul Scream Your Spirit menjadi jagoan single kami, banyak gigs atau acara musik yang kami ikuti saat itu. 2 Tahun berlalu, Bayu memutuskan untuk mundur dikarenakan pekerjaan dan waktu terus berjalan kita bertemu teman kami Fero dan Bagus menjadikan dia pemain ke tiga dan ke empat di Bad Eleven untuk mengisi posisi Bayu.\r\n\r\nDi tahun 2012 kita mengajak Yugo Atrhaz untuk mengisi Synth dan memberi warna baru di musik Bad Eleven itu sendiri yang menghasilkan lagu berakhir sudah dan First Time dan formasi berlima ini bertahan sampai 2 tahun yang akhirnya Yugo pun memutuskan mundur. Dan tukang record kami saat itu yaitu Alfin kita rekrut menggantikan Yugo di posisi Synth.\r\n\r\nWaktu terus berjalan dan tahun 2015 kita sudah sepakat untuk membuat album pertama kami, dan di saat proses pembuatan album dua teman kami El dan Fero pada saat itu memutuskan untuk mundur dikarenakan pekerjaan. Tidak menyerah dengan formasi bertiga, kita pun tetap melanjutkan pembuatan album pertama kami dan akan di rilis tahun 2016 yang bertitel “This is new Start” yang berartikan awal yang baru di Bad Eleven.\r\n\r\nPengalaman Event:\r\nGuest Star Pensi SMKN 3 Malang\r\nGuest Star Pensi SMAN 1 Lawang\r\nGuest Star Pensi SMA Malang\r\nIndiecloth Surabaya\r\nGuest Star Pensi SMKN 12 Malang\r\nMalang Popunk #4\r\nRLKZFest #3 dan lain lain','Others','teman;','Surabaya',1482,'2017-09-08 19:06:33','2017-09-08 19:06:33'),(1007,'The Black Bird','1505106787.png','pensi-pensi di SMA bandung','Pop','poster;','Jakarta',1509,'2017-09-10 21:13:07','2017-09-10 21:13:07'),(1008,'Lantera','1505111548.png','Home Band Caffe conggo','Rock','teman;','Jakarta',1511,'2017-09-10 22:32:28','2017-09-10 22:32:28'),(1009,'LifeTime','1505114625.png','juara 1 festival band SMA se kota Bandung','Pop','teman;','Jakarta',1510,'2017-09-10 23:23:45','2017-09-10 23:23:45'),(1010,'Crazy Steady','1505115641.png','main di acara-acara sekolah','Others','poster;teman;','Jakarta',1513,'2017-09-10 23:40:41','2017-09-10 23:40:41'),(1011,'pena Band','1505116996.png','main di event-event biasa','Alternative Rock','teman;','Jakarta',1515,'2017-09-11 00:03:16','2017-09-11 00:03:16'),(1012,'Aulora','1505118460.png','manggung di acara pensi dan event2','Pop','teman;','Jakarta',1516,'2017-09-11 00:27:40','2017-09-11 00:27:40'),(1013,'Aptisena','1505120300.png','Acara2 kampus','Others','teman;','Jakarta',1517,'2017-09-11 00:58:20','2017-09-11 00:58:20'),(1014,'Rival and Friends','1508562224.jpg','blm ada prestasi','Jazz','instagram;teman;','Jakarta',1518,'2017-09-11 01:26:39','2017-10-20 21:03:44'),(1015,'AVIATE','1505122137.jpg','Aviate adalah band fresh yang dibentuk bulan mei 2017, Aviate band 2 kali perfome dan mengikuti kompilasi dari proganizer bandung','Alternative Rock','instagram;','Jakarta',1519,'2017-09-11 01:28:57','2017-09-11 01:28:57'),(1016,'Anoda Band','1505124332.jpg','Band Anak Muda kreatif yang selalu berkembang dalam wawasan dan berkesenian khususnya seni musik','Alternative Rock','teman;','Jakarta',1520,'2017-09-11 02:05:32','2017-09-11 02:05:32'),(1017,'rockaporta','1505125698.jpg','Pertama kali ikutan kompetisi','Others','lainnya;','Jakarta',1521,'2017-09-11 02:28:18','2017-09-11 02:28:18'),(1018,'Sahuta Band','1505126061.jpg','Sahuta Band terbentuk pada tanggal 4 April 2016 dan telah mengeluarkan 1 buah mini album tradisional melayu di 