','Juara 1 FEstival Band di Saiji Water Park','Pop','teman;','Jakarta',1586,'2017-09-12 07:37:14','2017-09-12 07:37:14'),(1078,'CO 2','1505231546.jpg','Terinspirasi Paramore. Sering tampil di pentas musik','Alternative Rock','teman;','Jakarta',1587,'2017-09-12 07:52:26','2017-09-12 07:52:26'),(1079,'sendja gurau','1505234091.jpg','band ini terbentuk dari 4 sekawan yang bersama sejak masih dibangku SMA','Others','poster;teman;','Jakarta',1584,'2017-09-12 08:34:51','2017-09-12 08:34:51'),(1080,'Will Start Today','1505238705.jpg','Will Start Today \r\nawal mula beranggotakan 4 orang yaitu Riko Armanda ( Vokal ) Zhaki Kurnia ( Bassist ) Alessia Aya ( Guitar ) Ecky Nugros ( Drum ) \r\ndan dari itu kami berhasil menciptakan karya kami 2 ( dua ) lagu yang sudah selesai di recording Cerita Diakhir Senja dan Acuhkan Mereka , namun  sang gitaris mengundurkan diri dikarenakan jenuh bermain musik yang tak kunjung berhasil ( opini dia ) \r\nriko , zhaki , dan ecky tidak mundur , dan akhirnya memutuskan untuk membuat video clip / video movie dengan lagu berjudul cerita diakhir senja dengan ala kadarnya , kami mendapat respon baik kepada teman kerabat fans dan lain lain .\r\ndan kami menemukan gitaris baru yang bernama Yoga . \r\nnamun sangat disayangkan lagu ke 3 (tiga) sang drum ecky nugros memutuskan untuk mengundurkan diri melanjutkan keinginannya menjadi pegawai negeri sipil ( pns ) \r\nRiko , Zhaki dan yoga tidak berhenti juga , kami mendapatkan pengganti drum bernama rocky .\r\ndan selanjutnya kami merecording lagu ke 3 ( tiga ) yang berjudul Anytime .\r\nnamun setelah lagu ke 3 (tiga) yang di sepakatin bersama akan di keluarkan ketika video clip / video movie selesai dirilis , zhaki sang gitaris memutuskan untuk mengunddurkan diri dengan alasan mencari hidup baru di ibu kota ( jakarta )\r\ndan inilah will start today yang sekarang  .\r\nRiko Armanda , Rocky Hasan Sitompul dan Yoga Lutfie .\r\ndalam waktu dekat kami akan mengeluarkan video clip / video movie dalam waktu dekat ini .','Rock','facebook;instagram;informasi_toko;vipclub;guitar_plus;umi;maliq;poster;teman;lainnya;','Medan',1588,'2017-09-12 09:51:45','2017-09-12 09:51:45'),(1081,'I Sense','1505239676.png','juara 1 djarum Djarum Rawkin Battle 2017','Others','poster;teman;','Jakarta',1589,'2017-09-12 10:07:56','2017-09-12 10:07:56'),(1082,'I Sense','1505240379.png','juara 1 djarum rawkin battle 2017\r\npengisi acara event2 kampus di Bandung','Others','poster;teman;','Jakarta',1590,'2017-09-12 10:19:39','2017-09-12 10:19:39');
