INSERT INTO `songs` VALUES (6,'Berjuang','https://soundcloud.com/user-555754352/little-day-berjuang-1','Ku langkahkan kaki ini\r\nDengan semangat membara\r\nTak pernah ku hiraukan\r\nDengan segala ocehan\r\nDimana mereka yang selalu memandangku sebelah mata\r\n\r\nBuka lebar kedua matamu\r\nInilah aku yang kau remehkan\r\nKini jadi pujaan\r\nDiman mereka yang selalu memandangku sebelah mata\r\n\r\nOoo...ooo..\r\n\r\nInilah api yang kau berikan\r\nSemangatku untuk membuktikan\r\nTak pernah berhenti ku terus\r\nBerjuang\r\nBERJUANG.. BERJUANG..',12,'2017-08-03 08:09:12','2017-08-23 19:39:16',2,50,0),(7,'Dan Bila Esok Hari','https://soundcloud.com/hive-id/hive-dan-bila-esok-hari-new-arrangement','Dan bila esok hari\r\nSong & Lyric by Nugraha Saputera\r\n\r\n(Verse 1)\r\nDeras hujan yang turun\r\nMengingatkan aku pada dirimu\r\nBangkitkan seluruh rindu\r\nYang tertimbun\r\n\r\n(Verse 2)\r\nTak bisa ku pungkiri\r\nSemua rasa yang kini terpatri\r\nDan tak bisa hilang dari\r\nPikiranku..\r\n\r\n(Chorus)\r\nDan bila esok hari kau dengar aku\r\nBernyanyi dalam benakmu\r\nMaka saat itulah aku\r\nMerindukan dirimu\r\n\r\nDan bila esok hari kau ingin aku\r\nTuk berada di sampingmu\r\nAku disini\r\nMasih disini, menunggumu..\r\n\r\n(Verse 3)\r\nApakah kau rasakan apa yang kurasakan\r\nSemua yang kulakukan hanya untuk dirimu\r\nTak dapat kau mengerti atau tak mau mengerti\r\nDengarkan lah diriku ini sungguh dari hati\r\n\r\n(Back to reff)\r\n(Interlude)\r\n(Back to reff)\r\n(Back to Verse 3)',13,'2017-08-03 19:51:41','2017-08-23 19:39:11',2,50,0),(8,'Matahari','https://soundcloud.com/duapintu/matahari','Matahari terik bersinar langit biru\r\nAngin berhembus debu cahaya di wajahmu\r\n\r\nOh Cantiknya muka bumiku\r\n\r\nGerimis sejukkan badanmu langit mendung\r\nBerkendara di jalan panjang dan berliku\r\n\r\nOh nikmatnya berpetulangan \r\nOh indahnya laut, gunung, dan pantai\r\nSemua kita jaga lah',14,'2017-08-05 20:37:52','2017-08-23 01:02:47',3,60,0),(9,'Jadi pacarku','Listen to JADI PACARKU by Aranda Abi Prinanda #np on #SoundCloud https://soundcloud.com/aranda-abi-prinanda-1/jadi-pacarku','Aku dan kamu di sini\r\nAku ingin bicara\r\nCoba dengarkanlah aku\r\nHanya sebentar saja\r\nHanya sebentar saja\r\n\r\nRasa yang hadir dalam hidupku\r\nTak pernah begini\r\nPelan pelan buatku menggila\r\nSaat kau tak bersamaku\r\n\r\nReff\r\nAku ingin kau tau selama ini\r\nAku memendam rasa yang dalam padamu\r\nDan kini kau tau bagaimana \r\nAku padamu\r\nApa kau juga dan kau mau\r\n\r\nSong\r\nSejak pertama ku mengenalmu\r\nAda yang beda darimu\r\nKau slalu tampil apa adanya\r\n\r\nInterlude\r\nKucinta apadanya\r\nKau slalu apa adanya\r\n\r\nReff\r\nAku ingin kau tau selama ini\r\nAku memendam rasa yang dalam padamu\r\nDan kini kau tau bagaimana \r\nAku padamu\r\nApa kau juga dan kau mau\r\nApa kau juga dan kau mau\r\n\r\nJadikan aku jadi pacarmu\r\nJadikan aku jadi pacarmu\r\nJadikan aku jadi pacarmu\r\nJadikan aku jadi pacarmu\r\nPacarmu\r\nPacarmu....\r\nBacksound\r\n(Jadikan aku jadi pacarmu)',15,'2017-08-06 01:07:50','2017-09-15 01:36:37',3,78,0),(10,'Animal','https://soundcloud.com/high-gain/animal','One of these days\r\ni guess it will finally end\r\nall the memories, and all the pain\r\nit\'ll unravel one last time\r\n\r\nOr maybe i should just give into it\r\nlet myself fall again\r\npain and me have a long and deep understanding of one another\r\n\r\nOne last time, one last time\r\n\r\nWhen you fall that far, when you fall that far\r\nwhen you lose all the control, and got nothing left to grab onto\r\nAll that\'s left is an animal.',16,'2017-08-06 10:13:08','2017-08-23 01:02:39',2,60,0),(11,'Watch Your Step','https://www.youtube.com/embed/_LgNCmrJsM8','Watch Your Step \r\n\r\nLook at the central street in the morning\r\nSee busy people walking down\r\nWorried about the future and worried about the money\r\nAnd they forget about, their deepest dream\r\n\r\nQuick thinking is choice to follow\r\nGet my suit and combing hait\r\nAin\'t sure gone get it but\r\nLife is get hard, it just about how abounding rich\r\n\r\nWatch your mind take deep breath don\'t be falling\r\nShut your eyes, be wise of choosing, wisely\r\nWhat your fighting for it\'s to be further, further, better\r\nI guess your done\r\n\r\nMy oldman say to seek the passion\r\nEven wealth it\'s not around\r\nIt\'s sound so cheesy\r\nBut choice is all yours\r\nYou know what i\'d say\r\nThat\'s is alright',17,'2017-08-07 09:44:57','2017-10-18 12:12:40',2,95,1),(12,'Severine','https://soundcloud.com/agustino-carvallo/vilotes-severine','Severine you come to me, when everything seems hard to see\r\nSeverine you come to me, then everything is bright to be\r\n\r\nReff :\r\nSave me, I don’t wanna crazy\r\nI don’t wanna be standin’ here, without you here\r\nI’ll take this pain alone\r\n\r\nSave me, I don’t wanna be lonely\r\nLike I ever felt, I know I’m deaf, I know I’m blind\r\nBut you’re the shining light\r\n\r\n* Save me, I don’t wanna be crazy, I don’t wanna be lonely \r\n   take me now, shine me now down along',18,'2017-08-07 17:52:35','2017-08-23 01:02:30',2,60,0),(13,'Planet Lain','https://www.youtube.com/watch?v=2-8FQTZnNjM','Kami dari planet lain \r\ndi sini kami semua sama (2x)\r\ntiada putih tiada hitam\r\ndisini kami semua sama (2x)\r\nreff:\r\nkami iri kami iri kami iri\r\ndisana kalian semua berbeda\r\nkami iri kami iri kami iri\r\ndisana kalian semua berbeda \r\nnamun kalian membuat perbedaan ini menjadi alasan untuk ber-barbar-ria',19,'2017-08-07 19:08:44','2017-08-23 01:02:19',2,60,0),(14,'Inilah Janjiku','https://soundcloud.com/aabeproject/inilah-janjiku-1','Cinta\r\nYang selalu kuberi kepadamu\r\nKumau kau coba coba mengerti\r\nYang kuberikan hanya satu arti\r\n\r\noooh...beiby\r\n\r\nKumencari cari arti semua ini\r\nHanya kamu yang selalu dihati\r\nTakkan pernah ada yang lain lagi \r\nkamu kumohon percaya...percaya aku\r\ntakkan.. takkan mungkin tinggalkan cinta kita nanti\r\nkumau kamu mengerti\r\nini cinta\r\n\r\nInginnya aku kamu kam