tapaki\r\nMenahan lelahku sendiri,\r\ntakkan pernah berhenti (2x)\r\n\r\nLepaskanlah!\r\nLuka bisu, hidup bersanding haru, itu bukan milikmu\r\nLepaskanlah!\r\nGelap jiwa yang harus diakhiri, hidup harus berarti\r\n\r\n(dialog)\r\nhidup tak pernah indah..\r\napakah pendosa akan selalu jadi pendosa..\r\nmengapa kita hanya berdoa tanpa mencoba..\r\nmakan tuh idealis gak laku dijual..\r\naku orang yang bebas dan tak akan pernah memilih..\r\n\r\nLepaskanlah!\r\nLuka bisu, hidup bersanding haru, itu bukan milikmu\r\nLepaskanlah!\r\nGelap jiwa yang harus diakhiri, hidup harus berarti\r\n\r\nit will be forever\r\nas the one i\'ll be remind\r\nas the one i\'ll be recall\r\nas the one i\'ll be relate',22,'2017-08-08 01:31:25','2017-08-23 01:02:08',2,60,0),(17,'Weirdoom','https://www.youtube.com/watch?v=aTkX1mFq7z0','Bicara... teruslah bicara\r\nSeakan semua tanpa arah\r\n\'kan datang menerka\r\nLangkah desah mereka\r\nTerdengar jelas merana\r\nWahai tabu mengertilah\r\nLelah menyapu semuanya\r\n\r\nTerlalu banyak kata yang terlepas dari bibir ini\r\nDan ku masih menemani malam yang penuh tanya\r\nBegitu naif kau merindukan semua abadi\r\nTak kau lihat sekitar apa yang terjadi\r\n\r\nTerombang-ambing ku bawa jauh ke dalam\r\nMasa kelam yang tak pernah habisnya\r\n\r\nDan ku tak peduli\r\nHancurkan saja ku tak berdaya\r\nHancurkan semuanya\r\nDan ku tak peduli\r\nHancurkan saja ku tak berdaya\r\nHancurkan semuanya\r\n\r\nTerombang-ambing ku bawa jauh ke dalam\r\nMasa kelam yang tak pernah habisnya\r\nTerombang-ambing ku bawa jauh ke dalam\r\nCaci maki yang tak pernah habisnya\r\n\r\nTerlalu banyak kata yang terlepas dari bibir ini\r\nDan ku masih menemani malam yang penuh tanya\r\nBegitu naif kau merindukan semua abadi\r\nTak kau lihat sekitar apa yang terjadi',23,'2017-08-08 04:40:46','2017-08-23 19:39:02',3,70,0),(18,'Music Everywhere','https://m.soundcloud.com/numan-nugraha/music-everywhere','Saat kejenuhan menghampiri diri saat semua terasa hilang \r\nTak ada yang peduli membuat ku putus asa berjalan sendiri tanpa arah \r\nTerdengar alunan nada memberi semangat menginspirasi membangkitkan ku dari semua keterpurukan \r\n\r\nDengarlah musikmu\r\nBukah hatimu \r\nRasakan semuanya \r\nTerdengar indah \r\nLihat sekitar mu \r\nBayangkan semua berpadu \r\nLihat sekitarmu \r\nWhen music makes you move',24,'2017-08-08 05:22:23','2017-08-23 01:01:59',3,60,0),(19,'Dreamland','https://youtu.be/Eq6Ro-oBQQQ','CB, we\'re gonna miss you\r\nSorry, for all your stories\r\nHappy, is not a reason\r\nFreedom, is a solution\r\nLiving in the dreamland,\r\nwaiting for that someone\r\nto take me from my hell\r\nStruggling from the inside\r\nwaiting for that someone\r\nto wake me from my sleep\r\ncannot take this anymore\r\nwhen i say it\'s nothing more\r\ni\'m gonna lose it\r\nmyself is nothing more\r\nmyself is nothing more',25,'2017-08-08 06:21:22','2017-08-23 01:01:56',2,60,0),(20,'Cerita di Luar Jendela','https://soundcloud.com/lamafa-23/cerita-diluar-jendela','Cerita di luar jendela \r\nmenyapa gulita di luar sana\r\nmembangunkan mimpi yang pulas di dasar mata\r\n\r\nKisah mimpi semalam yang begitu mesra\r\nSeberkas cahaya warnai seulas tawa\r\n\r\nReff : Di suatu pagi raut wajah mentari berseri\r\n          sinari arti akan hadirnya hari ini\r\n\r\nBias-bias cahaya menggelitik mata \r\nDi luar jendela hiduplah seulas tawa\r\n\r\n\r\nReff : Di suatu pagi raut wajah mentari berseri\r\n          sinari arti akan hadirnya hari ini',26,'2017-08-08 07:00:14','2017-09-15 01:27:16',3,0,0),(21,'Pergilah Cinta','https://www.youtube.com/watch?v=sW7WYViJoDQ','Kini sudah tak ada\r\ncinta dan harapanku\r\nmimpiku tak seindah kenyataan nya\r\n\r\nSendiriku jalani\r\ntanpa lagi bersamamu\r\npintaku jangan hapus kenangan kita\r\n\r\nReff :\r\nPergilah cinta\r\nkuterima, semoga kau bahagia\r\njangan tangisi\r\nbiar semua, berakhir disini\r\n\r\n*\r\nsendiriku jalani \r\ntanpa lagi bersamamu\r\npintaku jangan hapus \r\nkenangan kita\r\n\r\n*Back to Reff \r\n\r\nInterlude :\r\nKu tak ingin cinta\r\nyang sementara',27,'2017-08-08 07:43:37','2017-08-23 01:01:50',1,60,0),(22,'Some timea','Black drama - sometimes','Sometimes i like to be alone to think everything i do not everyone can feel what i feel hemmmm\r\nNot everyone can know when the wind would stop try to better days thing always changes\r\nI can be the one i can be\r\nI can be the one i can be\r\nGo down and come in come in out\r\nGo down and come in come in out\r\nI just want you to know this feeling i just want to like them i feel like i\'m going crazy but one thing you must understan about perfect love \r\nI can be the one i can be\r\nI can be the one i can be\r\nGo down and come in come in out\r\nGo down and come in come in out \r\nImposible if time\r\nLet to stay here\r\nImposible if tome\r\nFor along time\r\nImposible if time\r\nJust look at it \r\nWe go on like this',28,'2017-08-08 08:14:06','2017-09-15 01:36:12',1,79,0),(23,'Disappointed Of God','https://soundcloud.com/user-157338721/secret-wall-revenge-disappointed-of-god','curse my name\r\ncurse my soul\r\ncan you see my pain? (2x)\r\nand can you fell that? (2x)\r\nthe hope have been broken\r\ni\'m dying to feel it\r\ni can\'t wake up and never to want start again (2x)\r\n\r\nplease god bring my soul i\'m sick of my life (2x)\r\nmy voice have been disappear, my eyes have been blinding (2)\r\n\r\nwhy god?  (2x)\r\n\r\n i?\r\ni need one last breath for the fix my soul\r\nplease god bring me it, i can\'t take this alone\r\nplease help me for the last time\r\n\r\nmy voice have been disappear, my eyes have been blinding (2)\r\n\r\ni never stop to fight it but i always lose\r\nwhy god? i need a justice!\r\n\r\ni\'m sick of the bastard people\r\nwhere is your justice i need now!\r\ni no need the bullshit\r\nplease change my destiny\r\ndon\'t make me a loser\r\none more time\r\nplease change my destiny',29,'2017-08-08 08:18:52','2017-08-23 01:01:47',2,60,0),(24,'Sick Weirdo','https://youtu.be/bwZXu82c0q4','I knew you from a 