ana makna tersebut menjadi dasar band kami untuk selalu menjadi  pribadi yang  selalu Low Profile dalam bermusik dan kami terapkan dalam kehidupan sehari – hari. \r\nPersonil Liana band digawangi  oleh 6 Personil  yaitu : Adit (Vokal), Adhe (Drum), Wildan (Lead Guitar), Rifki (Guitar Rhytem), Dudie (Bass), Eka (Keyboard) .\r\nKARIR\r\n-	Juara 1 Festival Band PT.Chandra Asri Cilegon (26 Agustus 2017)\r\nBand Social Media :\r\nFacebook : Lianaband cilegon\r\nInstagram : Lianabandcilegon\r\nEmail : lianabandgroup@gmail.com\r\nContact Person : Eka (081297858490)\r\n \r\nLiana Band\r\nCreated By. Epeng & Pamong\r\nTittle : nafas hidupku\r\nSatu sisi takkan Berhenti\r\nUntuk Menunggu dan Memahami\r\nSemua ini..\r\nAku Berjanji Untuk Setia\r\nMenemanimu..\r\nSampai Ajal memisahkan Kita\r\nYakinkanlah Hatimu..\r\nSatu sisi takkan Berhenti\r\nUntuk Menunggu dan Memahami\r\nSemua ini Takkan berakhir\r\nMeski  jarak memisahkan kita Berdua\r\nPercayalah..\r\nAku Berjanji untuk Setia Menemanimu..\r\nSampai Ajal memisahkan Kita\r\nYakinkanlah Hatimu..\r\nAku berjanji untuk menjaga Cinta ini\r\nSampai akhir nafas hidupku\r\nYakinkan Aku untukmu…',899,'2017-09-08 00:07:16','2017-09-10 20:50:23',0,50,0),(732,'Bhinneka Tunggal Ika','https://m.youtube.com/watch?v=Y62lf23mT0g','Bhinneka Tunggal Ika\r\n\r\nBhinneka tunggal ika\r\nSemboyan negara Indonesia\r\nBhinneka tunggal ika\r\nBukan hanya hiasan di kaki sang garuda\r\nBhinneka tunggal ika\r\nJangan sampai terpecah konflik isu SARA\r\nBhinneka tunggal ika\r\nSatu simbol persatuan yang harus kita jaga\r\n\r\nPancasila bukan sebuah catatan buta\r\nItulah dasar kita hidup bernegara\r\nDi Indonesia kita banyak saudara\r\nDari Aceh hingga Papua\r\n\r\nBhinneka Tunggal Ika\r\nTak membedakan warna baju suku dan agama\r\nBhinneka tunggal ika\r\nLandasan awal terwujudnya cita-cita bangsa\r\nBhinneka tunggal ika\r\nTersenyum bersama anak cucu kita\r\nBhinneka tunggal ika\r\nWalau berbeda beda tetap satu jua\r\n\r\nPancasila bukan sebuah catat